INSERT INTO public.avaliacao VALUES (186, 101, 91, 10, 'Trabalha muito bem desenvolvido e completo. Contempla diversas áreas de pesquisa. Se continuado, pode haver melhorias na questão de conexão entre o sistema e aplicativo. O uso de sensores de umidade comerciais, com proteção, deve ser considerado.', NULL, NULL, true);
