INSERT INTO public.avaliacao VALUES (214, 84, 539, 8.69107142857142811, 'Ótima explanação. Infelizmente não foi possível demonstrar o experimento na feira, embora visualizado por meio de vídeo. No relatório sugiro referenciar ao longo do texto com citações diretas ou indiretas. Além disso, as referências bibliográficas devem ser o último item do relatório e não as considerações finais. Em geral, um bom trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (217, 119, 541, 3.99642857142857144, 'Fazer mais amostras', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (218, 119, 106, 3.45714285714285685, 'O trabalho analisou apenas 3 amostras de gasolina de 3 cidades diferentes. Poderia ter aumentado o número de amostras, recolhendo de postos com bandeira e de bandeira branca para comparar. A ausência de caderno de campo pode demonstrar que o trabalho não teve densidade de pesquisa na área.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (227, 165, 541, 5.44107142857142811, 'O trabalho está bom', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (286, 90, 535, 9.40000000000000036, 'O trabalho poderia discutir a reação Química que ocorre com mais profundidade . Falando por exemplo das reações de oxidação e redução', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (236, 96, 539, 9.34999999999999964, 'Ótima apresentação e domínio do experimento, bem como conclusões de diferença de pressão.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (183, 180, 275, 6.5857142857142863, 'Os alunos podem encapsular a solução usando recursos impressos em 3D e também podem incluir no relatório mais recursos gráficos para deixá-lo mais visual. Além disso, é necessário incluir mais detalhes da metodologia e referências no relatório.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (224, 75, 106, 9.80000000000000071, 'Muito bom o trabalho. A avaliação qualitativa vai torná-lo melhor', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (230, 139, 541, 7.75, 'Muito bom.. continuar o projeto', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (248, 190, 539, 7.65000000000000036, 'Sugestão de explorar/detalhar melhor com mais exemplos os segmentos da teia.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (211, 186, 539, 0, 'Não compareceu.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (285, 90, 106, 8.59999999999999964, 'Bom trabalho em se tratando de ensino fundamental.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (213, 84, 524, 8.72142857142857153, 'Testar o funcionamento do experimento com os materiais adequados antes do evento', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (258, 189, 275, 8.34999999999999964, 'Trabalho adequado e muito interessante, recomenda-se que os alunos façam oficina no IF', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (271, 82, 986, 8.58928571428571352, 'Projeto excelente e de grande relevância social, no que diz respeito a busca por uma sociedade inclusiva. Penso que o projeto deve ter continuidade, no caráter de pesquisa científica, levantando os aspectos da caminhada do IFRS na perspectiva da inclusão escolar, contendo os olhares dos diversos sujeitos envolvidos no processo (alunos, professores, fubcionarios, comunidade escolar). Deixo como sugestão a reflexão das questões éticas (é possível expor o nome da pessoa e também autor em questão?). Saliento, ainda, a riqueza que seria ter demais colegas dentro deste mesmo projeto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (59, 30, 937, 7.80714285714285694, 'Muito bom esse trabalho. Os alunos demonstraram alto conhecimento no assunto e apresentaram uma solução adequada para uma demanda real. Ponto alto: qualidade visual do trabalho. Senti apenas a necessidade de testar o app de alguma forma.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (18, 162, 944, 8.875, 'Achei um trabalho de extrema importância! A apresentação da Julia foi maravilhosa também, de forma clara e lógica!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (6, 174, 939, 6.75, 'De modo geral o trabalho está muito bom. Percebeu-se empenho e dedicação na construção do sistema e na apresentação do resultado. Chamou atenção a utilidade do sistema quando se propõe a resolver um problema da realidade do campus, no caso das vendas da cantina. Como sugestão de melhoria, talvez em um trabalho ou implantação futura, fica a ideia de implementar leitura por código de barras, onde a saída dos produtos na venda fosse automatizada pela leitura do código de barras, bem como a identificação do aluno, através da leitura de um cartão de identificação ou crachá. Independentemente parabéns pelo trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (4, 56, 984, 8.5464285714285726, 'O trabalho esta bem estruturado. O jogo precisa de alguns ajustes: botão de navegação; criar sequencia/restrições para passar para a próxima fase/ assunto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (66, 35, 91, 8.99107142857142705, 'Trabalho bem executado com protótipo apresentado ao final. Sugestão de inicializar o sistema com valores padrão. Disponibilizar o projeto e código de forma aberta.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (1, 11, 938, 7.90892857142857242, 'Ao avaliar o trabalho, foram apresentados protótipos da ferramenta na versão web e mobile. Como sugestões para as ferramentas sugeriu-se implementar cuidados de acessibilidade , como por exemplo, atalhos de teclado e boas relações de contraste.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (127, 147, 943, 5.79999999999999982, 'O trabalho apresentado estava na fase inicial, portanto não tinha ainda resultados parciais. No entanto, faltou clareza quanto a justificativa e objetivos da pesquisa. Em relação à apresentação oral, ainda é necessária uma reorganização lógica dos passos da pesquisa.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (265, 160, 947, 5.27500000000000036, 'Apresentar de forma mais clara e com mais domínio a organização da pesquisa, os objetivos, o passo a passo da pesquisa (metodologia).', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (46, 14, 944, 9.34999999999999964, 'Acredito que poderia ter mais referências e abordar mais sobre quais funcionalidades do sistema terá, para ter um diferencial dos outros aplicativos, já existentes. Apresentação foi muito boa e clara!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (264, 44, 935, 9.32499999999999929, 'O resultado mostra o entusiasmo das alunas pelo tema. Os gráficos e entrevistas foram bons métodos para realizar a pesquisa, mas senti falta de um registro mais detalhado do processo e das conclusões.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (62, 185, 652, 8.61607142857142705, 'Excelente trabalho, muito bem apresentado.infelizmente faltou o caderno de campo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (53, 135, 984, 7.37142857142857189, 'Trabalho bem estruturado. De acordo com o apresentador o próximo próximopara implementação em sala de aula, será a troca do Bluetooth pelo WIFI.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (76, 133, 91, 7.84821428571428648, 'Foi apresentado uma versão parcial do sistema proposto. Talvez reduzir a quantidade de tarefas a serem implementadas para facilitar.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (288, 183, 541, 10, 'Muito bom o trabalho. Continuar na pesquisa', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (22, 123, 558, 8.25, 'Não havia poster do trabalho, mas não comprometeu a apresentação. A organização da apresentação foi muito boa e o relatório e caderno de campo estavam presentes e foram apresentados. O trabalho apresenta grandes possibilidades de contribuição para a área da saúde.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (287, 183, 524, 10, 'Revisar a norma técnica da ABNT sobre formatação da bibliografia', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (12, 114, 547, 9.6875, 'Excelente ideia o aluno deve levar adiante seu projeto. Parabens . Objetivo verbo no infinitivo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (275, 141, 542, 10, 'O trabalho foi muito bem apresentado. Com clareza e objetividade. Os autores estão de parabéns.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (41, 86, 547, 9.80000000000000071, 'Excelente ideia o aluno deve levar adiante seu projeto. Parabens', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (39, 115, 534, 7.04999999999999982, 'Trabalho de excelente qualidade técnica. Recomendo apresentar o relatório técnico nas próximas apresentaçoes', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (255, 49, 986, 10, 'O trabalho está excelente, apresentando um problema social, bem como as hipóteses para resolução, dentro dos padrões estabelecidos para um trabalho científico. Apresenta grande relevância social, uma vez que atua em prol de uma escola inclusiva e na luta pelo respeito à diversidade humana. Sugiro que o projeto possa ter continuidade e ser realizado com todas as turmas da escola, transcendendo a sala de recursos. Sugiro como referência para aprofundamento no tema da inclusão escolar, os escritos da professora da UNICAMP, Maria Teresa Mantoan.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (23, 171, 939, 10, 'O trabalho está muito bom. Chama atenção o domínio, conhecimento, empenho e interesse dos componentes em apresentar e demonstrar a ferramenta. A idea proposta tem grande relevância social, e a intenção de utilizar a tecnologia como ferramenta de disseminação de ações sociais é muito pertinente nos dias atuais. O desenvolvimento e a interface da plataforma estão muito bons, com boa usabilidade, e bem agradável visualmente. O material de divulgação, cartões, folders logo e etc são um diferencial bem interessante que agrega bastante valor ao projeto. De maneira geral não tenho sugestões de melhoria. Acredito que os componentes tem várias ideias de implementação e melhoramento futuro para a plataforma. Parabéns e boa sorte com o projeto no futuro. Sucesso!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (27, 50, 938, 7.98749999999999982, 'O trabalho está bem organizado, apresentando inúmeras informações sobre a metodologia do desenvolvimento da aplicação web. No entanto ao ouvir a apresentação oral houve dificuldades em entender com clareza qual o contexto de uso (espaços) da aplicação do objeto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (48, 5, 558, 10, 'O trabalho apresenta potencial de contribuição muito grande. A pesquisadora mostra domínio da pesquisa. Excelente organização.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (119, 118, 947, 9.69999999999999929, 'Excelente trabalho! A pesquisa deve continuar e ser difundida em função da relevância do tema e dos resultados obtidos ate o momento.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (263, 44, 943, 6.75, 'O trabalho é interessante na medida em que visa resgatar o senso coletivo em relação à brinquedos e brincadeiras. No entanto, faltou aprofundamento e delimitação do tema. Outro aspecto pertinente seria examinar diferentes intervalos de tempo, buscando as diferenças entre períodos menores.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (26, 181, 984, 7.69642857142857206, 'Gostei bastante do tema. Eles não apresentaram caderno de campo físico, mas utilizam o trello. Muito boa a ideia de continuidade do trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (257, 189, 986, 9.75, 'Este trabalho evidencia a inserção das TIC&#39;s (Tecnologias da Informação e da Comunicação) na escola, a partir das pesquisas realizadas em sites, a fim de buscar referências para o estudo da fotografia e suas nuances. Percebo que se trata de um tema de interesse dos autores e, em todas as experimentações fotográficas, é possível perceber a sensibilidade destes jovens, ao captarem os mais diversos cenários. O processo de diversas tentativas para o aprimoramento da fotografias caracteriza trabalho científico. Penso que projeto deve ter continuidade, estendendo-se à escola como um todo e resultando em uma exposição destas fotografias. Trabalho excelente!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (679, 201, 1449, 0, 'Não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (366, 70, 305, 8.69999999999999929, 'Trabalho muito bem feito.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (106, 70, 948, 8.82499999999999929, 'O trabalho está muito bom! O tema é relevante e foi bem investigado e apresentado.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (298, 89, 733, 0, 'Trabalho ausente', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (37, 152, 939, 10, 'O trabalho está muito bom. A ideia de desenvolver o pensamento computacional é bastante pertinente com a realidade em q vivemos. Foi possível perceber o empenho e comprometimento dos alunos na explicação do trabalho e da metodologia de desenvolvimento utilizada. Sugiro apenas que seja incluído no projeto alguma forma de pensamento computacional desplugado de forma a atingir mais pessoas com o projeto, principalmente aquelas em escolas onde não existe infraestrutura de ti suficiente para aplicação das atividades.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (307, 99, 982, 9.59999999999999964, 'Informar o tempo de realização do trabalho. Em geral o trabalho foi bem construído e sugiro para estudos futuros uma análise de entrevistas para comparar os resultados ou ainda um estudo com adultos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (30, 46, 984, 8.70892857142857224, 'Gostei bastante do tema e da escrita do trabalho. Conforme a autora será criado um controle de acesso, o que é bem importante, pois no momento usa os dados de acesso do moodle campus Canoas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (300, 111, 931, 9.80000000000000071, 'Foi um prazer ouvir Antonio e Natália apresentarem o processo de desenvolvimento do app Eyesee! Todo o percurso da pesquisa, bem como a demonstração das telas do app, foi demonstrado de maneira clara, coesa e detalhada. O trabalho é extremamente relevante ao tema da inclusão e acessibilidade, e espero ouvir falar do lançamento do app na rede dos Ifs em breve. Como recomendação para futuras apresentações, recomendo apresentarem as características iniciais descartadas pensadas para o app, pois foram descartadas a partir de entrevistas feitas com os futuros usuários do app, pessoas com deficiência visual. Relatar essa mudança de perspectiva é fundamental para entendermos algumas questões referentes ao que pensamos serem dificuldades da população com deficiência visual e quais são de fato essas dificuldades. Isso, me parece, tomou bastante tempo do trabalho de pesquisa e merece destaque nas apresentações orais. Parabéns pelo trabalho!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (61, 185, 938, 9.35714285714285765, 'O trabalho está muito bem organizado. O relatório, o caderno de campo e a apresentação oral se interligam e conseguem sanar possíveis dúvidas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (299, 111, 982, 9.24464285714285694, 'Apresentar como encontrão os voluntários da pesquisa e a metodologia para atingir os resultados. De resto o trabalho está bem desenvolvido.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (20, 177, 217, 8.50535714285714306, 'A proposta do trabalho é bastante interessante porém em alguns momentos não fica claro qual é o objetivo do software e o que exatamente ele faz além de um cadastro.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (243, 42, 735, 7.90000000000000036, 'Organizar o trabalho de tal forma que todos os participantes do projeto falem sobre ele. Pesquisar um pouco mais sobre a teoria do eletromagnetismo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (235, 144, 735, 6.90000000000000036, 'Organizar melhor a apresentação. Pesquisar mais sobre a teoria fotográfica para melhor relacionar com o projeto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (33, 138, 938, 6.02500000000000036, 'Não foi encontrado o relatório teórico e os apresentadores demonstraram dificuldades em apresentar o projeto ( objetivos, público, etc)', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (308, 99, 935, 9.57499999999999929, 'Pesquisa relevante e diretamente relacionado com o cotidiano das alunas. Bem estruturada, mostra o domínio delas nas etapas de uma pesquisa. O questionário poderia ter sido mais completo com um maior cuidado no direcionamento das perguntas, mas foi adequado para o escopo deste projeto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (121, 62, 982, 10, 'Organização dos gráficos que apresente todos os resultados da última pergunta do questionário.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (267, 40, 609, 10, 'Ampliar a bibliografia. Pensar na utilização das imagens presentes nos jornais. Pensar em explorar os gráficos e imagens para apresentar visualmente o tema pesquisado. Parabéns pelo trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (25, 181, 937, 9, 'Ótimo trabalho. Ótimas referências. Muito divertida a interação com o bot.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (312, 123, 939, 4.42142857142857171, 'Me pareceu que a proposta precisa ser melhor pensada e elaborada. Embora a idea seja boa, a implementação não parece ser uma real necessidade, pois o que o sistema propõe pode ser feito por uma agenda normal, como Google agenda por exemplo. Senti um pouco de dificuldade em compreender a aplicabilidade e a adesão dos médicos e profissionais da saúde. Também notei que a aplicação web não foi completamente desenvolvida o que prejudica um pouco a visualização da proposta.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (304, 34, 931, 9.75, 'Queridas e querido: muito obrigada pela aula dada sobre a história do movimento LGBTQ+. Aprendi muito com sua exposição clara, coesa e detalhada sobre a rebelião de Stonewall. A pesquisa foi desenvolvida de modo adequado e espero que sigam divulgando os achados que encontraram em outras modalidades para além de feiras técnicas. Nas idas e vindas da história, é muito interessante vermos que estamos repetindo movimentos do passado e que, portanto, temos muito a aprender com o que já vivenciamos em outros tempos. Parabéns pela exposição e pela pesquisa relevantes.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (302, 126, 931, 0, 'Ausente.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (160, 31, 223, 9.74107142857142705, 'Trabalho com excelente rigor metodológico. Uma dica é ressaltar a importância do uso de jornais como fonte de pesquisa, principalmente em relação à época da Revolução Cubana.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (240, 54, 566, 9.625, 'Excelente trabalho. Boa pesquisa. Assunto relevante para área humana e científica. Perguntei a componente do grupo do prosseguimento da pesquisa obtive uma afirmativa do prosseguimento desse estudo. Excelente desenvoltura da apresentadora.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (88, 68, 77, 8.80178571428571388, 'O trabalho é bem ousado e os autores apresentaram com bastante clareza o projeto. A questão da interdisciplinaridade e da expressão robótica educacional não haviam ficado muito claras na apresentação, visto que o trabalho tem foco industrial. Talvez seja importante que esses termos sejam retirados ou melhor abordados no trabalho, fazendo parte da história deste projeto (por exemplo). Mas é, sem dúvida, um excelente trabalho desenvolvido pela equipe (alunos e orientador). Parabéns a todos!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (314, 104, 452, 0, 'Não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (294, 186, 566, 0, 'Trabalho ausente.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (301, 126, 943, 0, 'Não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (296, 167, 943, 0, 'Os autores não compareceram ao VI IFCITEC', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (5, 174, 938, 7.75535714285714306, 'O trabalho está bem organizado. Como sugestão para uma próxima apresentação , buscar expor de forma mais clara a metodologia oralmente.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (155, 77, 947, 8.35714285714285765, 'Algumas informações devem ser acrescentadas ao pôster e à fala dos alunos (período de atividade da revista, etc.)', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (101, 170, 982, 9.69999999999999929, 'Formulário no Google docs para sugestão dos colegas da turma e escola', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (91, 106, 566, 7.87142857142857189, 'Bom trabalho. Não foi proporcionado ver o secador em funcionamento. Somente a explicação de como funciona.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (250, 188, 652, 8.65000000000000036, 'A apresentação foi boa, no início as alunas estavam um pouco nervosas e falando rápido. Excelente trabalho com grande poder multiplicador.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (179, 124, 464, 7.625, 'Dar continuidade à pesquisa, explicitar os dados coletados, bem como trechos (sequências) analisados.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (184, 180, 720, 6.7267857142857137, 'Ideia interessante, uma pena que não funcionou na hora. Faltou um pouco de organização e clareza das ideias e objetivos. Mais atenção quanto a apresentação visual do trabalho (pôster e experimento).', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (159, 31, 609, 9.9375, 'Trabalho muito bom. Sugiro deixar maus claro o problema de pesquisa e os objetivos para não gerar uma confusão de ambos. Um farto material de jornal analisado o que demonstrou pesquisa. Parabéns pelo trabalho realizado.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (338, 184, 457, 9.42500000000000071, 'Trabalho bastante interessante. Sugestão continuar o trabalho aumentando o público.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (136, 9, 452, 9.21785714285714342, '1) Apresentar mais de um cartaz, mesmo que do levantamento inicial citado e porque o trabalho se propõe a analisar cartazes, no plural. 2) Apresentar fonte e legenda da(s) imagem(ns); 3) Apresentar no banner ao menos os principais autores do referencial teórico.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (342, 149, 305, 8.92321428571428577, 'Alguns objetivos como avaliacao historica nao aparece no poster e relatorio', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (295, 167, 114, 0, 'Ausente', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (689, 322, 944, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (358, 43, 460, 9.73750000000000071, 'Ótimo trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (359, 110, 460, 9.67857142857142705, 'O pôster poderia ser melhor resumido, está com muito texto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (327, 45, 508, 9.80000000000000071, 'Compartilhar com colegas da escola os resultados do trabalho a fim de esclarecer o assunto e sensibilizar as outras pessoas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (47, 5, 720, 9.5625, 'Parabéns pelo trabalho, gostei muito. Como sugestão inserir a sala onde o trabalho será apresentado e um botão de voltar nas avaliações pendentes.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (209, 79, 936, 9.75, 'O grupo escolheu um tema interessante, muito relevante na faixa etária deles, e com a pesquisa relataram a desinformação acerca do tema em uma amostra significativa de estudantes.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (320, 136, 652, 6.12857142857142811, 'Excelente trabalho, bom domínio do conteúdo. Não havia o pôster e os alunoa poderiam ter feito uma apresentação mais organiada.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (19, 177, 457, 7.73749999999999982, 'O trabalho está bom. Foi sugerido que acrescente outros itens no cadastrado do animal sobre a incidência ou não de doenças, quantidade e tipo de ração. Outra forma de visualização qdo for um grupo grande de animais.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (149, 134, 948, 7.70000000000000018, 'O trabalho é muito importante para o estímulo à atividade física.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (313, 104, 487, 0, 'Projeto não compareceu à feira', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (322, 67, 114, 6.75, 'Melhorar a parte de teste e validação do produto obtido.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (310, 96, 77, 8.44999999999999929, 'As autoras demonstraram bastante entendimento do trabalho apresentado. É importante que o pôster tenha um pouco mais informações sobre o trabalho. Os resultados finais e conclusões poderiam trazer mais informações a respeito do trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (324, 116, 566, 9.80000000000000071, 'Excelente trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (268, 40, 223, 9.88749999999999929, 'Trabalho muito bem fundamentado metodologicamente. Sugiro ressaltar as conclusões da pesquisa durante a apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (237, 52, 77, 10, 'Ótimo trabalho! Parabéns! Os pequenos autores demonstraram muito envolvimento com o trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (223, 75, 535, 9.80000000000000071, '.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (99, 161, 464, 8.55000000000000071, 'Excelente iniciativa, pode-se produzir mais materiais como o documentário para dar continuidade à conscientização da escola.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (270, 58, 944, 5.625, 'Assunto importante, porém precisa-se focar em algo a mais relevante.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (318, 35, 652, 9.59999999999999964, 'Excelente trabalho, se nota claramente que foi construído ao longo do tempo. A apresentação foi clara e bem organizada. As alunas mostrarm domínio do assunto. Parabéns', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (94, 87, 566, 1.82499999999999996, 'Boa a intenção do projeto. Contudo a aplicação das ideias foi desorganizada e insuficiente para os objetivos propostos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (164, 132, 609, 8.93035714285714377, 'Revisar o texto do banner. Ter uma maior precisão na hora de expor oralmente o trabalho. Parabéns e continue com os seus estudos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (328, 45, 114, 8.82142857142857295, 'Melhorar parte técnica do trabalho. Definir os objetivos de forma que possam deixar claro se eles foram atingidos ou não. Ótimo tema e pesquisa muito bem feita.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (185, 101, 275, 8.20178571428571423, 'O trabalho traz recomendações nas conclusões, o que considerei um item muito importante para a continuidade do projeto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (49, 129, 457, 6.65892857142857242, 'Melhorar o visual das telas. Fazer uma maior adequação visual ao futebol já que um dos objetivos é a motivação através da relação com o mesmo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (337, 184, 947, 9.375, 'Ótimo trabalho! Tema super relevante para ser discutido desde o ensino fundamental, visto que se trata de saúde pública.', NULL, NULL, true);
