INSERT INTO public.avaliacao VALUES (446, 224, 223, 8.90714285714289922, 'Os apresentadores fizeram uma boa apresentação do trabalho. O estudo aborda um assunto relevante e contemporâneo, cujos resultados e conclusões apontam soluções para a solução do problema de desinformação sobre os crimes vittuais. Além disso, os resultados podem sustentar futuros trabalhos. No entanto, o caderno de campo parece ter sido subutilizado, desfavorecendo o conjunto da obra. Esse é um aspecto que merece maior atenção dos autores.', NULL, NULL, true);
