INSERT INTO public.avaliacao VALUES (412, 259, 223, 9.45714285714289993, 'A apresentadora do trabalho utilizou seu tempo de maneira adequada e fez uma boa explanação sobre sua pesquisa. Escolheu um tema que está em alta na sociedade, utilizando uma produção cinematográfica da cultura pop. Por essa razão, o trabalho tem potencial para atingir um público maior do que o do meio acadêmico, objetivo que pode ser alcançado através da divulgação científica nas redes sociais. Para evidenciar melhor o desenvolvimento do trabalho, o caderno de campo pode ser melhor utilizado, sendo incluído trechos de análise de algumas imagens do filme, entre outros.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (568, 346, 1076, 9.82499999999999929, 'Parabéns aos envolvidos, sugiro continuar a pesquisa focando, por exemplo, no consumo de açúcar, em outros componentes não saudáveis de outros alimentos e etc. Sugiro também, dizer no resumo que os experimentos foram feitos não só com refrigerante de cola, mas com outros também. Ainda, tenho um pouco de dúvidas se ao invés de usar o nome da marca para se referir a determinado refrigerante o correto e ético seria usar nomes mais genéricos: refrigerante de cola, refrigerante sabor guaraná e etc. No mais, parabéns. Agradecemos a participação no ifcitec.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (525, 204, 434, 0, 'Projeto não compareceu', NULL, NULL, true);
