INSERT INTO public.avaliacao VALUES (580, 331, 652, 8.15000000000000036, 'Tema muito bem escolhido e atual, os alunos que apresentaram muito vem e mostraram domínio do assunto. Senti falta de todos os integrantes falarem sobre o tema.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (437, 309, 516, 9.15000000000000036, 'Os pesquisadores apresentaram a temática de pesquisa com bastante apropriação. Sugere-se que que tragam mais informações sobre os efeitos físicos e psicológicos, não destacando apenas sobre a sua frequência de uso dentre os estudantes pesquisados.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (401, 247, 1076, 9.69999999999999929, 'Parabéns aos envolvidos. Trabalho bem apresentado. Como sugestão, diria para aludirem mais às bibliografias durante a explicação. Lembrando que isso não é para desanimar, e sim para incentivar o melhoramento contínuo das apresentações. Mencionar livros e sites sobre o assunto ajuda a dar credibilidade. No mais, parabéns. Agradecemos a visita ao ifcitec.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (515, 220, 1052, 5.04999999999999982, 'Tema relevante. Sugere-se que sejam esclarecidos os conceitos de alotropia e das formas de obtenção da grafite sintética - alternativa mais efetiva e na qual o Brasil tem programas de pesquisa', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (533, 348, 223, 9.80000000000000071, 'A apresentadora demonstrou domínio do assunto pesquisado, conseguindo apresentá-lo de maneira que um interlocutor leigo consegue compreender os fatos históricos. O relatório e o caderno de campo demonstram o processo de estudos e análises necessários para a realização do estudo. Sugere-se à autora evidenciar mais os resultados e as conclusões do estudo durante a apresentação oral.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (636, 322, 91, 0, 'Projeto não compareceu', NULL, NULL, true);
