INSERT INTO public.avaliacao VALUES (674, 283, 1450, 10, 'Excelente trabalho. Consistente e de extrema relevância para o atual contexto político e social. O apresentador mostra domínio e perspectiva de continuidade. Pôster muito criativo, harmônico e diretivo. Parabéns ao aluno e à orientadora pelo alto nível das produções!', NULL, NULL, true);
