INSERT INTO public.avaliacao VALUES (687, 219, 1450, 9.94999999999999929, 'Única ressalva diz respeito à organização do texto no pôster. Os demais pontos observados demonstraram excelência.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (706, 257, 944, 9.34999999999999964, 'Trabalho bom, porém apresentação muito rápida e faltando alguns elementos importantes', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (863, 421, 1602, 5.42499999999999982, 'O projeto é importante pois remete a discussões acerca da sustentabilidade ambiental do planeta.
INSERT INTO public.avaliacao VALUES (847, 407, 1628, 10, 'Parabéns! O projeto de pesquisa evidencia um excelente trabalho, que parte de um problema relevante, atual, e com grande impacto social, em relação á saúde, consequência pela pandemia. O objetivo foi apresentado pelos estudantes de maneira correta tanto no resumo como na oralidade, levando em consideração estrategias eficazes, em procura de auxilio a pessoas com o tipo de trastorno pesquisado (ansiedade - depresión), focada em melhorar a qualidade de vida. Os procedimentos foram organizados em todo o processo, apropiando-se de ferramentas e recursos tecnológicos próprias das (TIC) válidos para o abordagem da ciência, complementando dito projeto com uma campanha de conscientização intra-escola, com ações concretas para a prática, na mesma comunidade, e chegando à conclusão com resultados bem definidos. Adiante!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (782, 430, 1597, 9.82499999999999929, 'O vídeo complementou de forma adequada o trabalho, as imagens apresentadas foram de boa qualidade e pertinentes para o entendimento do trabalho. O áudio tinha qualidade e a apresentadora falou com clareza, facilitando o entendimento. Como sugestão, variar a entonação de voz (para a apresentação ficar mais animada/menos monótona).Espero que o trabalho continue, pois este é o tipo de trabalho que desperta a curiosidade e provoca vários questionamentos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (760, 418, 1631, 7.90000000000000036, 'Observa-se que, no vídeo aparece um objetivo que não está presente no resumo, por isso, foi atribuído “regular”, visto que esse novo objetivo não foi contemplado na pesquisa: “objetiva a produção e promoção de catálogos criados a partir da seleção e da digitalização de acervos, obras consideradas raras e objetos”. E o objetivo não era “analisar e debater a presença das mulheres no campo da Saúde a partir do periódico “Hygia- Revista Mensal Popular de Medicina e Educação Sanitária”? Ficou confuso! Entretanto, no conjunto da obra, o trabalho é bom.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (852, 399, 1628, 10, 'Parabéns! interesante trabalho científico, nele pode evidenciarse ter alcançado objetivos muito puntuais, onde a função de cada língua, no conceito de capital simbólico, é colocada em consideração para o contexto acadêmico, -com a importancia que isso conlleva-, enfatizando neste projeto, principalmente o estudo das funções do espanhol respeito ao português, tendo em conta que é uma língua falada em todos os países regionais, (hispanohablantes), daí sua importancia da presente pesquisa. O trabalho denota que foi levada de maneira ordenada e correta, partindo de propósitos claros, fazendo investigações com bom abordagem, onde se menciona a consulta e leitura específica, usando recursos digitais. A pesquisa resgata conclusões significativas pelos estudantes, onde se conclui ter a necessidade ir na direção de fomentar maior inserção dos alunos, no estudo e perfeiçoamento da língua espanhola, procurando melhor desenvolvimento com a sistematização das futuras pesquisas. Adiante!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (855, 389, 1631, 4.09999999999999964, 'No resumo, faltou a terceira palavra-chave. Na parte inicial do vídeo, aparecem só imagens com textos, sem explicações alguma dos autores. O vídeo ficou mais de 3 minutos passando o slide final e parece que ficou sem fechamento da apresentação do trabalho, pois uma das autoras não fez as considerações finais (em seu lugar, ficou rodando um slide final).', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (887, 377, 1598, 8.55000000000000071, 'O vídeo poderia estar com legendas para melhor entendimento e acessibilidade. Sugiro, para apresentações futuras, pensar na possibilidade do vídeo ter legendas, audiodescrição e tradução em Libras. Senti falta de uma apresentação do protótipo com simulação de uso. Não ficou muito claro como o usuário ficaria com os acessórios (cintos elásticos) e como seriam as questões referentes ao conforto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (901, 429, 87, 9.84999999999999964, 'Prezadas, incilamente parabéns pela pesquisa. Não pude deixar de reparar já na leitura do resumo e após ver o vídeo que o título da pesquisa se refere a um equipamento para idoso, porém o utilitário criado mostra-se útil também para outros sujeitos com alguma deficiência de mobilidade. Sugeri neste caso que o título e vídeo sejam adequados seja adequado.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (904, 431, 86, 9.34999999999999964, 'O trabalho é muito bom! Parabéns! A apresentação das autoras foi muito clara, organizada, fazendo boa relação entre a fala e os slides. Apenas senti falta, na metodologia, da descrição das características das crianças sobre as quais os pais responderam: qual a idade delas? Situação sócio-econômica? Como estes pais foram contatados? Informações mais precisas sobre isso, permitiriam perceber se as crianças mais novas tiveram mais ou menos efeitos do que as mais velhas e também refletir sobre sua situação familiar, uma vez que estes aspectos interagem com a qualidade de vida no isolamento social.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (902, 377, 87, 9.05000000000000071, 'Prezados integrantes, Primeriamente parabéns pelo projeto, Algumas considerações: - O vídeo poderia ter sido gravado totalmente na horizontal para uma melhor visualização e junto a isto poderia ter sido incluida legendas; - Senti falta da visualização do protótipo da pesquisa; - E por último fiquei com dúvidas referente a como o paciente seria fixado com os cintos, principalmente no que tange ao conforto do mesmo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (906, 426, 86, 9.59999999999999964, 'O trabalho foi muito bem realizado e as autoras apresentaram com propriedade, boa postura, dicção e domìnio do assunto. A quantidade de respondentes da pesquisa é bastante expressivo. Parabéns pela coleta. No entanto, só fica de fora da reflexão a situação sócio-econômica dos respondentes, uma vez que essa situação pode afetar em grande medida - junto com o isolamento - a qualidade de vida das pessoas. Seria interessante continuar a pesquisa, acrescentando outros elementos à possibilidade de uma vida saudável agora que o isolamento está findando: como as pessoas vão reverter esses efeitos negativos? Vão mudar seus hábitos de consumo? A possibilidade de frequentar espaços públicos para lazer, melhorou a qualidade de vida delas?', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (909, 370, 1837, 9.52500000000000036, 'Ótimo trabalho, com objetivos claros, fica a pergunta de como será feita analise dos animais que foram adotados, como será feito isso na plataforma ?', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (566, 350, 566, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (690, 351, 91, 10, 'Ótimo trabalho com tema extremamente relevante para a inclusão. Protótipos criativos e funcionais.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (599, 361, 92, 8.71428571428569931, 'O relatório técnico precisa alguns ajustes de forma (sumário, tabelas em uma página apenas etc.). No geral ótimo trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (714, 367, 305, 8.40000000000000036, 'Os objetivos aparecem apenas no final do resumo. Os itens introduçao e demais topicos chama mais atenção que o titulo. As meninas apresentaram de forma pratica a quantidade de açucar nos produtos de forma muito bacana.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (703, 242, 380, 9.82857142857140076, 'Trabalho muito bem estrutrado. Continuar a coleta de dados e a realização das oficinas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (649, 237, 91, 10, 'Ótimo trabalho com grande relevância social. Ainda em fase de protótipo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (720, 198, 563, 9.40000000000000036, 'O trabalho apresenta boa relevância técnica na área da Química. Ainda requer alguns ajustes.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (682, 284, 1530, 6, 'Apresentar relatório e caderno de campo. Especificar as aplicações já disponíveis e o que ainda será feito.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (600, 303, 563, 9.52857142857140005, 'O trabalho está bem articulado e o relatório bem escrito. As experiências realizadas perfazem os objetivos propostos. Ainda requer alguns ajustes.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (726, 204, 944, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (724, 323, 457, 6.45000000000000018, 'Observar a coerência dos documentos na metodologia. Foi analisado trechos das constituições baseadas em um autor e não toda a constituição. Melhorar as informações do cartaz e a participação do grupo na apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (513, 299, 563, 7.70000000000000018, 'O trabalho pode melhorar na sua metodologia.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (490, 197, 1120, 10, 'Ótimo trabalho, bem escrito e com apresentação clara e concisa. Parabéns à equipe e ao professor orientador. O espaço estava um pouco compacto, haja vista um número muito grande de expositores na sala. No entanto, a falta de espaço e o ruído intenso no entorno não foi impeditivo para a excelente apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (725, 323, 207, 7.25, 'Trabalho relevante, no entanto alguns alunos precisam melhorar a forma de apresentar.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (709, 249, 1448, 10, 'Trabalho com uma temática muito interessante e pertinente. Acredito que a pesquisadora tem condições de aprofundar ainda mais essa pesquisa. Ótima apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (722, 231, 380, 8.86428571428569967, 'Trabalho de boa qualidade. Temática importante e atual. Seguir a pesquisa e aprofundar o tema.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (509, 199, 1100, 8.84999999999999964, 'A apresentação estava bem interessante. Apesar do trabalho estar mais na fase inicial, as autoras mostram segurança ao desenvolver o tema.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (717, 245, 1449, 10, 'Ressaltar que as alunas construíram o simulador do tornado com materiais recicláveis', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (501, 352, 1100, 9.22857142857139934, 'A pesquisa é bem interessante, os apresentadores possuem uma postura adequada. O projeto está no início, apresentando resultados parciais.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (727, 345, 1530, 8.66428571428570038, 'Os resultados parciais poderiam ser melhor descritos. Eles ficaram muito subjetivos e são relacionados somente à compilação do programa e não à sua utilização para o fim desejado. Como ainda está em andamento, acredito que os resultados finais serão bastante promissores.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (708, 227, 1449, 10, 'Interessante que elas ressaltaram que devemos olhar as pessoas na frente da lei, criando uma ideia de consciência coletiva na comunidade.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (474, 353, 1120, 7, 'Bom trabalho, com clareza na exposição, segurança e conhecimento das técnicas utilizadas. O espaço estava um pouco compacto, haja vista o grande número de expositores e visitantes na sala. No entanto, esses contratempos não obstaculizaram a eficiente e entusiasmada apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (443, 278, 457, 6.82500000000000018, 'Os resultados e as conclusões do trabalho devem ser do pesquisador baseadas nas pesquisas e não ser apenas a reprodução do pensamento de umacunica referência ou autor.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (520, 206, 1120, 7, 'Excelente e pertinente trabalho que precisa ter continuidade! Muito bem escrito, conciso e esclarecedor. Equipe integrada, segura e entusiasmada. Parabéns às estudantes e orientadora.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (728, 209, 305, 8.80000000000000071, 'Os dados de aproveitamento precisam ser mais bem aproveitado', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (729, 311, 652, 9.625, 'Excelente trabalho, a apresentação foi muito bem organizada. Apenas a questão do tipo de adubo poderia estar mais clara. Parabéns pelo excelente trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (721, 198, 508, 10, 'Trabalho bem delineado.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (730, 216, 1025, 10, 'Pesquisa muito interessante, principalmente porque a ideia vem de alunos de inclusão, colocando em prática suas ideias de pesquisa.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (433, 365, 508, 10, 'Trabalho muito importante para a educação e conscientização sobre o descarte correto de lixo para comunidade.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (723, 346, 508, 10, 'O trabalho está bem delineado com resultados muito interessantes.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (548, 287, 457, 9.61428571428569967, 'Sem observações.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (758, 394, 1639, 10, 'Parabéns pelo excelente trabalho e edição multimídia, ambos impecáveis! O trabalho possui objetivo bem definido, além da relevância social evidenciada com segurança e criatividade.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (731, 415, 86, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (858, 438, 1687, 9.125, 'O resumo, vídeo e apresentação estão adequados.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (749, 380, 138, 9.40000000000000036, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (739, 406, 1616, 9.25, 'Trabalho bem organizado e com excelente apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (757, 394, 1616, 6.27500000000000036, 'O resumo mostra-se bem elaborado, todavia o vídeo não expôs a metodologia (uso do questionário) e seu respectivo resultado o qual culmino no projeto de ação, de igual modo não fora exposto o objetivo do trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (765, 412, 1644, 10, 'Excelente proposição, muito bem organizada e apresentada, além de ser extremamente necessária!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (745, 383, 136, 8.22499999999999964, 'Em trabalhos futuros, apresentar de forma mais objetiva para respeitar o tempo máximo de apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (781, 430, 1721, 10, 'A pesquisa realizada foi muito bem elaborada. Os dados apresentados e a metodologia utilizada estavam bem claros.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (737, 402, 1608, 2.75, 'Ótimo resumo', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (754, 387, 1608, 10, 'Excelente', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (740, 406, 1608, 10, 'Muito bom, tema de grande relevância.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (880, 384, 1639, 10, 'Trabalhos com gamificação e games na educação sempre devem apresentar qualidade e objetividade. Parabéns por evidenciar tão bem a importância da ação nos processos de ensino e de aprendizagem. Recomendo fortemente que o trabalho seja submetido ao WLC RIEONLIFE Unisinos, pois o evento possui uma linha específica para abarcar um trabalho com tal magnitude.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (800, 403, 1605, 9.69999999999999929, 'Trabalho ótimo. Muito bem organizado e muito importante.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (788, 434, 1605, 10, 'Trabalho relevante e muito bem organizado e apresentado. Excelente!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (810, 393, 1687, 2.67499999999999982, 'O resumo tem erros de português, tais como síntese da proposta. Além disso, introdução-objetivo são insuficientes. Tão pouco tem-se a metodologia. No vídeo não tem a participação dos alunos, apenas slides com textos extensos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (812, 392, 1687, 4.32500000000000018, 'O resumo está adequado, mas o vídeo não tem a participação dos alunos. Com isso, apesar da relevância do tema, o trabalho deixou a desejar.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (801, 396, 86, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (823, 398, 86, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (821, 397, 86, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (775, 395, 86, 4.25, 'Inicialmente, ao lermos o resumo, o projeto parece muito bem construído. No entanto, ao assistir o vídeo ficam faltando muitos aspectos necessários para o entendimento do que o autor pretendia com a pesquisa. No vídeo não há menção de forma correta aos objetivos, à metodologia utilizada, quais os periódicos foram pesquisados e as conclusões são pouco elaboradas. Além disso, o vídeo tem outros detalhes que comprometem uma melhor avaliação: não tem som, o autor não se apresenta no vídeo, não há identificação de orientador ou instituição e o título do vídeo faz referência ao Salão da UFRGS (publicado em 12 de julho). Teria sido um link enviado por engano? Observando o conteúdo do vídeo fica claro que o vídeo apresenta um trabalho trimestral para algumas disciplinas do Ensino Médio, desviando-se do projeto de pesquisa apresentado no resumo. Infelizmente, penso que o autor do trabalho não entendeu os objetivos da feira e o que precisava produzir para expor.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (732, 415, 87, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (802, 396, 87, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (822, 397, 87, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (824, 398, 87, 0, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (733, 437, 1603, 10, 'Parabéns pela importante pesquisa e ótima apresentação. Para melhorar a compreensão do seu projeto para seu público acredito ser importante esmiuçar, explicar em detalhes o que seja racismo estrutural, você abordou o que seja racismo, porém para completar o entendimento da importância do seu trabalho, acredito que esse ponto, o racismo estrutural, é relevante e merece uma explicação. No mais, continue a pesquisar e aprofundar suas análises sobre o racismo estrutural. Att.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (769, 427, 138, 7.27500000000000036, 'Como contribuição de melhoria para o projeto sugiro delimitar melhor a metodologia, está espraiada. &#34;uma pesquisa aplicada com pessoas que trabalham remotamente na região metropolitana de Porto Alegre&#34;. É muito genérico. Poderia até ter aplicada uma pesquisa em uma Instituição de Ensino com docentes e estudantes buscando compreender os impactos causados pelo ensino remoto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (868, 443, 1725, 7.84999999999999964, 'O trabalho é muito relevante. Espero que consigam colocar em prática assim que for possível.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (881, 440, 1595, 9.69999999999999929, 'O projeto é uma iniciativa muito boa e interessante. O suporte de acessibilidade é um ponto pouco abordado em outros ambientes de ensino de programação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (795, 404, 920, 6, '', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (803, 424, 207, 9.57499999999999929, 'Muito bom. Vídeo de ótima qualidade e muito claro. Só acho que poderiam ter trazidos exemplos de negócios que foram auxiliados pelo projeto (obviamente, sem citar nominalmente, mas usar - no caso da pequena empresa A, o auxílio de seu..., o resultado foi...).', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (838, 385, 1604, 8.42500000000000071, 'Projeto não compareceu', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (783, 416, 1604, 9.82499999999999929, 'No resumo e apresentação, incluir referenciais teóricos para conceituar os termos estudados.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (814, 381, 1644, 10, 'Trabalho super interessante, importante e muito bem apresentado. Cumpriu de forma plenamente satisfatória todos os requisitos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (874, 371, 1615, 7.04999999999999982, 'O trabalho está adequado, dessa forma indico sua apresentação neste evento.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (882, 440, 1615, 7.79999999999999982, 'Tanto o resumo quanto o vídeo de apresentação estão adequados, dessa forma recomendo a publicação deste projeto no evento.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (850, 420, 136, 8.07499999999999929, 'As imagens do vídeo ficaram um pouco prejudicadas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (841, 435, 1629, 8.94999999999999929, 'O resumo tem alguns problemas de concordância nominal. Corrigir a palavra autoavaliação. Parabéns pelo trabalho!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (851, 399, 1629, 6.97499999999999964, 'Podiam ter mostrado exemplos da tradução e do site no vídeo. O vídeo não mostra nada sobre o trabalho. Podiam ter explicado melhor o trabalho na apresentação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (843, 411, 1629, 8.55000000000000071, 'O resumo tem alguns problemas de concordância. Exemplo: &#34;se os mesmo&#34;. Revisar o resumo. O trabalho é de muita relevância para a área de Letras. Parabéns!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (815, 369, 1593, 9.40000000000000036, 'Este trabalho é excelente, todos deveriam ser assim, dos 04 trabalhos que estou avaliando, este é o único que atende o proposto. Na verdade é muito triste ver que todos os demais estão muito aquém do esperado, mas mesmo assim são aceitos, e sujeitos a avaliação.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (865, 378, 75, 8.77500000000000036, 'Parabéns pela escolha do tema, que é extremamente relevante. As apresentadoras deixaram claro muitos aspectos da pesquisa, que não estavam expostos no resumo pela limitação de caracteres. Desejo muito sucesso ao projeto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (857, 438, 1622, 7.52500000000000036, 'Aplicação sensacional de eletrônica e meio ambiente (biologia). Não foi possível identificar demais autores e instituição de ensino.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (860, 382, 92, 9.19999999999999929, 'Ótimo trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (866, 378, 92, 8.30000000000000071, 'Não apresentou no resumo a metodologia.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (805, 433, 106, 8.94999999999999929, 'O projeto tem méritos e foi bem executado e apresentado.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (848, 407, 1608, 9.5, 'Muito bom', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (820, 422, 1622, 7.29999999999999982, 'Trabalho bem importante no contexto atual. Parabéns!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (753, 387, 1603, 10, 'Parabéns pela importante pesquisa e ótima apresentação. A fim de melhorar a compreensão de sua pesquisa fiquei com algumas questões, a saber: - Todos negros e negras foram batizados, ou há negros e negras que não foram batizados? Como dimensionar esse ponto? - Onde se pretende arquivar todas os resultados da pesquisa? Att.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (831, 391, 1725, 8.67500000000000071, 'AVALIAÇÃO DO RESUMO Erros de escrita: Faltou o acento em &#34;biotecnologico&#34;. Faltou um &#34;b&#34; em &#34;Cianoactérias&#34;. Faltou um &#34;v&#34; em &#34;isando&#34;. Faltou espaço em &#34;clorada.O cultivo...&#34;. &#34;Protéico&#34; não tem acento. Os resultados estão rasos. Faltou colocar as porcentagens de aprovação pelos julgadores, qual das receitas obteve maior aprovação. Já que possui uma tabela do potencial proteico do alimento, qual seria esse potencial? A ideia é interessante, mas o resumo deixou a desejar. AVALIAÇÃO DO VÍDEO/APRESENTAÇÃO Os julgadores foram treinados para fazerem a avaliação? Quantos julgadores participaram do experimento? Não deixou claro. Vídeo bem elaborado, com ótima postura e apresentação das autoras.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (839, 408, 1725, 1.39999999999999991, 'AVALIAÇÃO DO RESUMO Poderia ter iniciado o resumo com &#34;As plantas medicinais...&#34; Sinceramente, o resumo não tem estrutura e conteúdo o suficiente para ter sido homologado. AVALIAÇÃO DO VÍDEO/APRESENTAÇÃO De fato, não há conteúdo para ser avaliado neste trabalho!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (746, 383, 1603, 9.82499999999999929, 'Parabéns pela importante pesquisa e ótima apresentação. A fim de melhorar a compreensão da pesquisa fique com algumas dúvidas, a saber: - Como a hipótese não pode ser corroborada, acredito ser importante reformular a hipótese visando melhor descrever a realidade que se apresenta. - Um dos motivos de não se poder se corroborar a hipótese inicial é a instabilidade das mídias, assim acredito ser interessante analisar a posição das mídias e discorrer sobre seu histórico de posicionamentos frente aos governos, a fim de compreender melhor o porquê da instabilidade. -Na metodologia esta escrito que &#34;A metodologia está fundamentada no estudo de periódicos como fonte primária e bibliografias históricas como fonte secundária.&#34;, assim pergunto, toda fonte tem um posicionamento, você chegou a verificar posicionamentos contrários as suas fontes? Se sim, quais? Espero ter ajudado. Att.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (738, 402, 1603, 10, 'Parabéns pela importante pesquisa e ótima apresentação. Tenho somente uma provocação, a qual gostaria que estivesse em sua apresentação, e assim acredito que você possa acrescentar nas futuras apresentações, a saber, por que você acredita que Públio Ovídio Naso relatou essas figuras, Páris e Helena, com essas características, Páris mais emotivo, e Helena mais racional? Espero ter contribuído. Att.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (875, 372, 1595, 8.90000000000000036, 'Trabalho bastante relevante para ser utilizado como complemento na educação de idosos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (750, 380, 1709, 7.32500000000000018, 'Percebe-se a participação de apenas um integrante do grupo no vídeo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (878, 370, 1595, 9.125, 'O trabalho apresenta uma proposta muito interessante de aplicativo para auxiliar animais abandonados e em situação de rua. Minha dúvida está relacionada a como se pretende desenvolver as funcionalidades de adoção e alimentação de animais, pois nos diagramas apresentados no vídeo não ficou muito claro como essas funcionalidades devem ser implementadas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (764, 436, 1709, 10, 'Parabéns pela iniciativa de ajudar os alunos a aperfeiçoarem sua produção textual, focada no ENEM. Muito interessante o projeto continuar melhorando e buscando atualizar-se.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (886, 373, 1595, 9.05000000000000071, 'O trabalho mostra um aplicativo interessante para conectar alunos a professores particulares. Porém, o aplicativo apresentado não necessariamente pode resolver os problemas apresentados na justificativa. Muitos estudantes tem demonstrado problema com a falta de organização para os estudos online. Como o aplicativo pode contribuir para a solução desse problema?', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (792, 428, 516, 9.55000000000000071, 'Parabéns pelo trabalho realizado. Estou curiosa para ver o resultados do próximo experimento.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (796, 404, 516, 7.04999999999999982, 'Meninos, parabéns pelo trabalho desenvolvido. Aprender física na prática é, certamente, muito interessante, ainda mais quando inserida a língua espanhola. Entretanto, o trabalho não deixa claro quais ideias e experimentos foram (ou serão) testados, não apresentando os resultados e as aprendizagens adquiridas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (799, 403, 516, 10, 'Meninas, parabéns pelo trabalho desenvolvido. O texto do resumo está claro e contém todos os itens necessários. O vídeo está impecável, com uma apresentação clara e atrativa, bem como muito bem explicado e ainda com legendas. Parabéns!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (829, 425, 1442, 8.19999999999999929, 'Estimados pesquisadores! Parabéns pelo trabalho desenvolvido. Vocês trouxeram um tema que merece e carece de muitos estudos ainda. Acredito que o trabalho poderia ter uma melhor delimitação quanto ao público investigado. Como sugestão: investigar a população da escola, pais e estudantes.Dessa forma o problema d epesquisa e as conclusões finais poderiam estar mais aproximadas da metodologia escolhida. Senti falta na produção do vídeo da participação dos demais integrantes do grupo. Parabéns Caroline por representar tão bem o trabalho na produção do vídeo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (849, 420, 207, 7.70000000000000018, 'Muito interessante a pesquisa, parabéns aos estudantes. Para o vídeo, poderiam ter aproximado mais o PPT, pois ficou difícil de acompanhar as explicações. Não foi possível identificar o orientador.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (759, 418, 1644, 9.80000000000000071, 'No resumo, a parte dos resultados poderia ter sido um pouco melhor apresentada. Se tivesse mencionado alguns dados estatísticos obtidos por meio da pesquisa, já daria uma noção mais clara sobre o tópico, algo que foi muito bem explicado no vídeo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (776, 395, 508, 5.34999999999999964, 'O trabalho contempla a interdisciplinaridade e está apresentado de forma bastante clara. O resumo precisa de pequenos ajustes na linguagem mas nada que diminua a qualidade do resumo apresentado. Também sugiro explorar um pouco mais os resultados. O vídeo está sem áudio o que impossibilitou uma avaliação mais completa e adequada. De forma geral está um trabalho muito interessante. Parabéns aos participantes!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (845, 400, 1644, 9.80000000000000071, 'A justificativa indicada no resumo poderia ter sido mais bem articulada e os objetivos não se mostraram tão evidentes quanto na apresentação em vídeo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (784, 416, 508, 9.72499999999999964, 'O projeto está bem delineado, organizado e objetivo. As alunas possuem domínio do assunto e fizeram uma excelente apresentação. Como sugestão para deixar o trabalho mais atrativo, utilizar mais recursos no vídeo como figuras e esquemas na introdução, e o vídeo poderia ser um pouco mais curto, no máximo 10 min a depender do evento. De modo geral o trabalho está excelente! Parabéns as integrantes e orientadores!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (811, 392, 1639, 5.5, 'O trabalho possui importância acadêmico-científica, contendo adequada metodologia e objetivos. O vídeo não apresenta seus participantes, somente o conteúdo imagético, muito bem editado. Exemplo de de produção bem definida e sintetizada.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (808, 390, 508, 8.875, 'A pesquisa está bem interessante, contemplando interdisciplinaridade. Como sugestão para apresentações futuras, o vídeo pode apresentar mais recursos visuais e as apresentadoras podem dispensar o recurso do celular para mostrar mais domínio do assunto e dialogar de forma mais direta com o expectador. De modo geral, o trabalho ficou bem diferenciado e atrativo. Parabéns as alunas e orientadores!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (742, 417, 982, 9.69999999999999929, 'No resumo, não ficou claro quais eram os resultados da pesquisa. Sugiro que conste a informações, por exemplo, do percentual de alunos no ensino superior, entre outros apresentados no vídeos. A apresentação foi ótima! Mostrou toda a relevância e resultados da pesquisa de forma clara e concisa.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (830, 425, 652, 5.32500000000000018, 'Na apresentação oral poderiam ter trazido mais dados da pesquisa. Como gráficos e as perguntas utilizadas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (836, 439, 652, 8.19999999999999929, 'Quanto a metodologia não ficou claro onde e como foi aplicado o formulário. Quem respondeu esse formulário? Quais faixas etárias foram atendidas. Acredito que esses dados deveriam ter sido citado. Ótimo trabalho, parabéns.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (763, 436, 982, 10, 'A apresentação ficou excelente, inclusive sugiro que seja incluída como uma apresentação e tutorial da plataforma, pois está muito bem explicado. O que sugiro que seja incluído no resumo e na apresentação é de que além do aluno praticar mais a redação, ele também apresenta mais sobre regras da língua portuguesa ao realizar a correção. É um aprendizado de diversas formas. Parabéns pela relevância do projeto e pela paixão que as alunas demonstram ao apresentar o trabalho. Elas apresentam uma fluidez para falar do tempo, que é raro até mesmo no ensino superior encontrar. Somente elogios para o trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (876, 372, 1615, 7.72499999999999964, 'O projeto está adequado, tanto o resumo quanto o vídeo de apresentação. Dessa forma, recomendo sua apresentação neste evento.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (842, 435, 136, 8.09999999999999964, 'A apresentação dos dados dos gráficos, por vezes, ficou confusa, pois apenas um gráfico era apresentado por vez, porém trazendo dados de duas perguntas, causando confusão entre os percentuais apresentados e os dados informados em áudio.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (879, 384, 1615, 8.5, 'O resumo e apresentação do projeto foram muito bem elaborados, em especial o vídeo que foi montado de forma interessante, não ficou muito longo e o alunos era bastante cativante em suas explicações.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (834, 388, 1615, 3.82500000000000018, 'Acredito que este conteúdo é importante, todavia creio que para ser exposto em um evento como este deveria ter um pouco mais de dedicação na elaboração, tanto do resumo como do vídeo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (844, 411, 982, 9.80000000000000071, 'O projeto apresentado é muito relevante, pois além de identificarem o problema, o grupo buscou formas de resolver um dos impactos, que é angariando fundos para a biblioteca adquirir mais livros. Além de estar ensinando a pesquisa, o projeto desenvolve os alunos para a sociedade. Parabéns pela iniciativa!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (883, 423, 1726, 9, 'Alguns pontos sobre a apresentação. Acredito que poderiam ter explicado o motivo de trabalhar com MongoDB. No quesito do Javascript ficou claro o motivo da escolha (por ser uma das três principais tecnologias para web atualmente), mas do MongoDB não. Foi por facilidade/praticidade em desenvolver junto com o NodeJS? Desempenho? Melhor formatação dos dados com um banco de dados orientado a documentos ao invés de usar um modelo relacional? No caso do Scrum, se menciona que foram feitas reuniões semanais, acredito que não se fala em reunião diária porque talvez os alunos não ficaram todos os dias disponiveis no projeto, mas também acho que vocês poderiam explicar um pouco mais de como o Scrum foi utilizado no projeto, ao invés de simplesmente comentar que ele é utlizado para gerenciar/organizar o tempo. Penso que o trabalho ficaria mais rico se explorassem mais isso. No mais, vídeo bem feito, formatado e com conteúdo claro.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (773, 405, 720, 8.94999999999999929, 'Parabéns pelo trabalho, pesquisa muito interessante e de grande relevância ao apresentar a importância da Agricultura Familiar para as comunidades rurais e para a economia dos municípios. Como observação, senti o resumo um pouco confuso não destacando de forma adequada a definição do problema de pesquisa, a justificativa e os objetivos. Em relação a apresentação, sugiro para as próximas que vierem que procure falar um pouco mais devagar, com mais pausa. Mais uma vez meus parabéns pelo seu trabalho.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (761, 413, 1592, 7.47499999999999964, 'O tema abordado é importantíssimo para o futuro não só dos profissionais de saúde, mas para todo o capital humano . Embora a pesquisa tenha um mérito extraordinário, sugiro que para fins de publicação e demais apresentações futuras a análise dos resultados seja melhor explorado em comparações com dados públicos sobreo assuntos já pesquisados e traga uma perspectiva mais abrangendo principalmente a região em que que esses profissionais se encontram. Sugiro mudança no título, que fique claro que a perspectiva é específica, pois ele não é coerente, trazendo a impressão de uma abrangência maior do que realmente foi explorado.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (787, 434, 720, 9.92500000000000071, 'Parabéns pelo trabalho. A minha única dúvida é se vocês pretendem seguir está linha de investigação com outras plantas medicinais usadas comumente pelas pessoas. A validação científica das plantas medicinais é muito interessante, desmistificando assim muitos mitos, os quais passam de geração por geração, ou comprovando as suas eficiências.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (840, 408, 1442, 3.27499999999999991, 'Estimados pesquisadores! Parabéns pela iniciativa de participação. Acredito que o trabalho possa ser melhor estruturado apontando de forma clara a problemática, os objetivos da pesquisa e a metodologia de coleta de dados. Na descrição do resumo aparecem dados soltos e afirmações sem referência a autores ou pesquisa empírica. Pesquisar é um invento humano para compreender melhor o meio em que vive. Logo remete a questão a vocês: por que resolveram pesquisar o tema? Onde buscaram as informações? As conlusões são embasadas em quais princípios?', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (770, 427, 1592, 5.70000000000000018, 'A pesquisa é de extrema importância, porém não foi abordada de forma coerente, no resumo e no vídeo não foram contempladas informações importantes, como por exemplo a base teórica de sustentação para as afirmações realizadas pelos alunos na análise dos resultados. Muitas conclusões precipitadas, inclusive o próprio título do trabalho onde traz a palavra &#34;ofícios&#34;, mas não foi informado quais ofícios foram abordados, já que não foi dito qual a população e nem amostra pesquisada, lembrando que cada profissão tem suas particularidades específicas para o desempenho da função, o tema foi tratado de maneira genérica não seguindo o cerne para o assunto tão complexo, como o avanço tecnológico, a automação e a adoção de inteligência artificial nos processos organizacionais que criarão novas formas de trabalho, exigindo um novo perfil dos profissionais do futuro.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (762, 413, 1639, 10, 'Parabéns pela importante iniciativa de olhar para a saúde mental dos profissionais de saúde, principalmente em decorrência da pandemia de COVID-19 que ainda estamos vivenciando. Como pesquisador na área da saúde, agradeço pela oportunidade de conhecer um belo exemplo de trabalho coletivo em contexto de Iniciação Científica.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (804, 424, 1592, 8.07499999999999929, 'O trabalho é de extrema urgência, pois o tema é contemporâneo, é um problema que foi enfatizado com a pandemia. Embora o projeto ainda não tenha sido concluído, não foi abordado na apresentação dados que que sustentassem as afirmações na conclusões, faltaram elementos para que se possa ser mensurado que os conhecimentos repassados às empresas serão utilizados com impactos positivos nas demandas apresentadas. Sugiro que para as próximas apresentações do trabalho, esses dados apareçam de forma mis coerentes para que se obtenham informações relevantes ao objetivo explorado com base o histórico e no contexto em que essas empresas estão inseridas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (833, 388, 1721, 7.72499999999999964, 'O assunto abordado é de extrema relevância, mas poderia ser mais enriquecido com mais dados quantitativos, como a porcentagem de depressão pós-parto entre garotas de 10 a 20. Além disso, não ficou claro de onde as informações foram retiradas, como por exemplo, a afirmação de que o corpo da mulher não está pronto para estar em gestação até após sair da adolescência.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (856, 389, 1592, 8.47499999999999964, 'O trabalho apresentou muito bem o anglicismo, embora não tenha apresentado elementos basilares de como será de fato realizada essa maior compreensão das pessoas quanto ao uso das palavras estrangeiras adotadas, que trazem o &#34;aportuguesamento&#34; ou até mesmo o uso de falsos cognatos, as alunas demonstraram no vídeo comprometimento e domínio do assunto, é nítido o esforço em apresentar o tema, o que favorece o sucesso da pesquisa, pois é importante que esse assunto seja esclarecido e informado de maneira coerente pra que todos consigamos nos comunicar de forma correta, seja na nossa língua materna, quanto em língua estrangeira.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (864, 421, 1593, 4.72499999999999964, 'Metodologia, resultados parcial ou final não encontrados. Vestimenta inadequada. Slides ruim de ver, erro de formatação (desleixo)', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (835, 439, 1442, 8.90000000000000036, 'Estimados pesquisadores! Parabéns pelo trabalho realizado. Ele apresenta-se muito bem fundamentado. Senti falta do outro integrante do grupo na apresentação do vídeo. Deixo como sugestão apresentarem a delimitação da escolha das 200 pessoas participantes: foram moradores de determindada cidade, foram colegas de escola, ... Mais uma vez parabéns pela excelência do trabalho apresentado', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (819, 422, 1593, 3.14999999999999991, 'Os autores não aparecem no vídeo. Somente uma pessoa apresentou. Faltou e muito a capacidade de síntese e clareza. Vídeo longo e cansativo. Os apresentadores NÃO fizeram a exposição de modo lógico, claro e conciso.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (806, 433, 1593, 6.02500000000000036, 'Por que não estudar algo local, com possiblidades de contribuir e mudar positivamente a realidade no qual estão inseridos, o a aluno, o colégio, e o IFRS Canoas? Por que o IFRS Canoas aceitou trabalhos que não focam na contribuição da realidade local, estadual e regional?', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (859, 382, 1602, 9.75, 'O projeto é muito interessante, tanto como um projeto de engenharia, quanto como um projeto que busca a inclusão de pessoas portadoras de deficiência. Como sugestão, uma vez que as peças principais do mecanismo estão projetadas, proceda-se a impressão das mesmas, e realize-se os testes utilizando cilindros pneumáticos comerciais. Isto possibilitará que parte da equipe trabalhe no desenvolvimento dos músculos pneumáticos enquanto outra parte da equipe possa trabalhar na programação da marcha, o que diminuiria o tempo de desenvolvimento e testes operacionais do dispositivo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (871, 386, 1602, 9.55000000000000071, 'O projeto é muito interessante. Acreditamos que ainda é necessário vários desenvolvimentos de tecnologias para que se atinja resultados excelentes. Como sugestão, poderia se analisar o uso de estruturas impressas de polímeros, o que resultaria em um conjunto e menor peso.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (869, 379, 1602, 10, 'Ótimo trabalho. Como sugestão sugere-se que as peças sejam impressas em polímeros para redução do peso do conjunto, e que seja utilizado um motor elétrico de alta eficiência energética e baixo peso, também com o mesmo objetivo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (867, 443, 75, 5.42499999999999982, 'Parabéns pelo tema relevante. Infelizmente o resumo e o vídeo não apresentam detalhes importantes sobre a metodologia e o andamento e validação do trabalho. Estes aspectos poderiam ser muito melhor explorados na apresentação. Como por exemplo, haverá a garantia de que o braço vacinará corretamente o animal? O vídeo, de apenas 4min12seg poderia apresentar a instituição, a equipe e prestar maiores esclarecimentos sobre a pesquisa e o projeto.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (872, 386, 75, 8.97499999999999964, 'Parabéns pelo tema, extremamente relevante e que realmente pode mudar a vida das pessoas. A apresentação estava muito boa, mas senti que poderiam ter explorado mais a questão das redes neurais, que foi vagamente citada em dois pontos do vídeo e também no resumo. Desejo muito sucesso neste projeto!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (807, 390, 1622, 9.59999999999999964, 'Tema interessantíssimo, pois o bioma Amazônia e seus contextos sociais e políticos, ocorre nos países vizinhos ao Brasil, mas que não é mencionado pela mídia nacional, como o trabalho apresentou, bem como a visão da imprensa de língua espanhola desses países. Trabalho inédito!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (870, 379, 92, 9.125, 'Ótimo trabalho. Vídeo poderia ser mais objetivo.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (809, 393, 106, 1.55000000000000004, 'O título do trabalho aborda a alteração nos genes causados pela poluição das indústrias chinesas, mas a apresentação fala do consumo de cigarros e das consequências à saúde humana. Parece que são dois trabalhos distintos. O vídeo mostra textos com imagens ao fundo. Imagens estas que, em sua maioria, não dizem respeito ao conteúdo dos textos. Não há referências bibliográficas, os dados são colocados sem citar a fonte dos seus autores. O trabalho em si não é adequado a uma feira de ciências, embora o assunto seja importante.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (813, 381, 106, 8.47499999999999964, 'O projeto tem muita relevância e precisa ser aperfeiçoado. Senti falta, na descrição da metodologia, da explicação das diferenças entre os tratamentos 1, 2, 3 e 4 e também do quadro comparativo das análises físico-químicas do bioplástico com o plástico comum, pois fica meio sem sentido para o leitor saber, por exemplo, a densidade do bioplástico sem saber a densidade do plástico comum.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (873, 371, 1726, 8.82499999999999929, 'Pontos a considerar: - A ideia do projeto é muito boa, mas como está bem no início, ainda na parte de modelagem e prototipagem, não tem como avaliar o app. - No vídeo tinha uma faixa do &#34;Wondershare Filmora&#34;, que atrapalhava a leitura dos slides. Eu sei que em alguns casos não é possível remover na versão free, mas isso atrapalha muito para quem está vendo o vídeo, principalmente quando se apresentam os protótipos de tela. - Acredito que seria interessante explorar mais a metodologia de como o app está sendo modelado, se há alguma revisão ou não, por exemplo. Como os requisitos são levantados, se isso passou por alguém da área ou se foi feito pelo aluno apenas; Outro ponto diz respeito ao teste do app pelos usuários, pois não ficou claro se eles vão ter algum checklist para marcar e quais requisitos são importantes nessa avaliação. -', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (910, 426, 1837, 8.47499999999999964, 'Parabéns por utilizar varias metodologias de pesquisa, a unica pergunta é, quais foram os padrões de pessoas que responderam a pesquisa.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (885, 373, 1726, 9.47499999999999964, 'Uma pena o trabalho conter apenas documentação de requisitos e prototipação de tela, pois não conseguimos ver a plataforma de fato, mas já é um bom início. No mais, vídeo bem feito, com bastante fundamentação. A comparação com as outras plataformas também agregou bastante, pois mostra a diferença da plataforma com as outras e porque ela é relevante. Objetivou bem as funcionalidades e tecnologias utlizadas, apesar de não descrever se utilizou alguma metodologia específica para desenvolver (scrum, xp, entre outras) e como elencou as funcionalidades, se foi por comparação com os outros sistemas apenas ou se utilizou algum estudo/pesquisa ou outro critério a mais de base para definir as funcionalidades.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (780, 419, 1601, 9.82499999999999929, 'Fiquei curiosa com os demais resultados que serão obtidos deste trabalho, mas em suma o projeto é muito interessante, os discentes tem domínio do assunto e será de grande valia para a comunidade científica.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (791, 428, 1601, 9.65000000000000036, 'Fiquei curiosa com os demais resultados que serão obtidos deste trabalho, mas em suma o projeto é muito interessante, os discentes tem domínio do assunto e será de grande valia para a comunidade científica, de modo que precisamos muito avaliar novas matérias-primas como recurso para produtos de uso do dia a dia.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (816, 369, 1601, 9.92500000000000071, 'Fiquei curiosa com os demais resultados que serão obtidos deste trabalho, o projeto é muito interessante, a discente tem domínio do assunto e mostra interesse genuino pelo projeto. A ideia é incrivel, criativa, sustentavel e desejo que vire um produto comercial no futuro. Boa sorte!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (832, 391, 1611, 8.55000000000000071, 'Excelente linha de pesquisa, muito interessante abordar um problema que a ONU evidencia. Após revisar o material que foi disposto pude perceber que pouco se detiveram em cima do resumo do trabalho dando poucos detalhes, não apresentando de forma clara os objetivos do trabalho e tão pouco apresentaram resultados que pudessem ser avaliados como um fechamento da escrita. O resumo necessita de uma revisão de ortografia de maneira que que a leitura fique mais clara junto com os objetivos que querem apresentar, quanto a conclusão penso que seria mais interessante salientar os resultados que obtiveram nos gráficos e tabelas, assim correlacionando a frase final. O vídeo está muito bem apresentado, nele o grupo conseguiu se sair muito melhor na organização de ideias e na apresentação das informações.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (884, 423, 1639, 10, 'O trabalho com plataformas digitais requer garra, ousadia e perseverança, pois envolve inúmeras questões. Parabenizo o grupo pelo belo e importante trabalho apresentado. Olhar para as escolas é fundamental para o êxito da ação. A metodologia é muito bem delimitada e definida, assim como as linguagens de programação adotadas para a construção do recurso. Recomendo a submissão do material no WLC Unisinos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (837, 385, 1611, 5.82500000000000018, 'Interessante a linha de pesquisa e extremamente importante não apenas no momento atual mas para salientar preocupações pós pandemia também. O resumo necessita ser reformulado utilizando uma linguagem em 3° pessoa e uma linguagem culta sem o uso de gírias, também é necessário demarcar bem as partes do texto como introdução, objetivo, metodologia e conclusão. Há informações no vídeo que são de extrema importância para categorizar teu resumo como por exemplo a preocupação da ONU com o aumento de problemas mentais. Quanto a metodologia que apresenta no resumo, faltou trazer dados sobre esse procura em sites e as entrevistas, não é apresentado em nenhum momento do resumo sobre teus achados nos sites e muito menos se eles vão de encontro com as respostas que colheu nas entrevistas. Para o vídeo seria mais interessante que trouxesse slides em vez de dar enfoque na câmera em você, na expressão linguística deve-se rever o uso de gírias ou palavras do teu cotidiano no dia a dia enquanto apresenta um trabalho de caráter formal.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (790, 432, 1597, 6.5, 'Bacana a forma espontânea dos autores apresentarem e a escolha do laboratório para a apresentação inicial do vídeo. A iluminação estava muito boa, no entanto a distância do microfone (captação do som) prejudicou o áudio. Cuidar para que a participação dos autorres seja mais equilibrada (não precisa ser igual, mas a Tatiane teve uma participação muito maior do que os demais). Cuidar com a otimização do tempo - se bem planejado metade do tempo seria suficiente - e a sequência lógica (Introdução>objetivos>metodologia>resultados>discussão>conclusão) - no trabalho não foi observada essa sequência. Também muita ênfase na produção do bioplástico, pouca nos testes (mesmo que planejados). As condições experimentais precisam ser justificadas e, de prerferência, referenciadas.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (846, 400, 1631, 4.42499999999999982, 'Sobre o resumo: - No título, menciona-se &#34;prejuízos causados&#34; no ensino público, entretanto, não há considerações sobre quais seriam estes prejuízos. Não seria mais pertinente &#34;dificuldades causadas”, visto que isso é mais enfatizado no texto? Afinal, &#34;prejuízos&#34; ou &#34;dificuldades&#34;? Dessa forma, o texto não contempla o seu enunciado no título. - O texto não apresenta objetivos corretamente definidos e coerentes. - Não apresenta metodologia, que contemple os objetivos. No conjunto da obra, o trabalho é insuficiente.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (766, 412, 1631, 4.72499999999999964, 'No título, destaca-se que o estudo será sobre “impressões de estudantes e docentes do campus canoas”, entretanto, o trabalho abarcou uma visão geral dos currículos, fugindo, assim, do proposto. Na apresentação, a aluna fica quase todo o tempo se balançando, o que deve ser evitado. No conjunto da obra, é um trabalho regular!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (862, 429, 1598, 9.625, 'O título do trabalho refere ser a cadeira de rodas de uso para idosos, mas o produto pode ser utilizado, também, por pessoas com deficiência ambulatória. Talvez, com o título mais abrangente, abra-se o leque para a comercialização. Sugiro que no Resumo as frases sejam mais curtas, pois como estão dificultam o entendimento. No vídeo, uma autora comenta sobre a cadeira ser acessível para todos. Creio que esta fala é muito abrangente e precisa ser revista.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (899, 405, 86, 7.97499999999999964, 'O projeto apresentado é muito interessante, mas o título não contempla o que de fato foi realizado, uma vez que foi mais do que um relato de estágio. Nas conclusões senti falta de uma problematização sobre o montante destinado à agricultura familiar: porque representa tão pouco do destinado em comparação com os valores gastos para pessoas jurídicas? Esse número pode ser expandido? Entendo que, sendo estagiária da Secretaria, a pesquisadora pode se sentir pouco à vontade em criticar o gasto do dinheiro, mas as pesquisas científicas, além de mostrar dados, devem problematizar sobre eles para promover a reflexão sobre o assunto. Para trabalhos futuros fica a sugestão de um estudo sobre como a pandemia afetou esses agricultores, quanto a prefeitura gastou com alimento escolar em 2020 e 2021, em comparação com 2019 e, em não tendo gasto com a alimentação escolar, o que foi realizado pelo poder público em prol dos agricultores familiares?', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (912, 437, 87, 9.92500000000000071, 'Barbara parabéns pela pesquisa, A pesquisa nos traz uma reflexão que mesmo no século XXI ainda precisam ser ditas e apresentadas. O tema o racismo estrutural é extremamente relevante e precisa ser amplamente trabalhado, pois a apropriação ainda é muito latente.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (900, 432, 86, 8.07499999999999929, 'O projeto é muito interessante e tem boa justificativa. Sugiro aos pesquisadores que organizem melhor a fala da sua apresentação, de forma que todos os autores contribuam de igual forma na apresentação do trabalho. Seria interessante, tbm, utilizar o apoio de slides para falar sobre os aspectos do projeto. É preciso diminuir o caráter informal da explanação. O projeto tem bastante potencial de continuar e espero vê-lo em outras feiras em breve.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (911, 431, 87, 9.92500000000000071, 'Meninas, Primeiramente parabéns pelo projeto. Seguem algumas considerações: - Senti falta na pesquisa da situação social/financeira dos pesquisados; - Outro ponto é, quais seriam as possibilidades destes pesquisados terem novamente uma vida saudavel e como seriam trabalhadas estas possibilidades para por fim conseguirem reverter um pouco estes danos.', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (891, 417, 86, 9.90000000000000036, 'O projeto é muito interessante, tem envergadura e é de grande valia para o IFRS melhorar sua política de egressos. Na metodologia, fiquei com dúvida sobre qual era a totalidade da amostra, ou seja, quantos eram os egressos que receberam os questionários. 199 o responderam, mas seria interessante explicitar o quanto isso representa no total de egressos do campus. Sugiro que o projeto seja levado à gestão do IFRS para auxiliar a pensar a política de egressos da instituição. Parabéns pelo trabalho!', NULL, NULL, true);
INSERT INTO public.avaliacao VALUES (913, 419, 86, 8.90000000000000036, 'O projeto é bastante interessante e foi bem construído em termos de objetivos e metodologia, no entanto, não fica claro quais os passos da metodologia foram realizados. O texto e a fala no vídeo dão a entender, através dos verbos no futuro, que a pesquisa ainda irá realizar diversos passos da metodologia, ou seja, ainda é uma pesquisa em andamento. Se assim é, precisaria abordar o tempo de execução da pesquisa para conseguir verificar se os objetivos são passíveis de serem realizados. Os objetivos específicos e a metodologia fazem alusão a um projeto de boa envergadura e que demandará muitas fases de execução. Desejo que o projeto siga acontecendo e traga. no futuro, resultados sólidos.', NULL, NULL, true);
