INSERT INTO public.projeto VALUES (302, '“TECLE ENTER PARA JOGAR”: A PROGRAMAçãO DE JOGOS EM MICROCOMPUTADORES COMO MEIO DE APRENDIZAGEM (1981-1984)', 'O advento dos microcomputadores do Brasil no início dos anos 1980 foi acompanhado pelo surgimento de revistas especializadas que buscavam disseminar essas tecnologias no país. Para fazer frente aos videogames, que passavam a oferecer a possibilidade de diversão para os jovens no ambiente doméstico, os produtores e divulgadores dos micros procuraram explorar a dimensão do entretenimento como estratégia de consumo dessas novas tecnologias. Isso porque contribuía para atrair potenciais usuários, e desmistificar o computador como uma máquina “inacessível”, voltada exclusivamente para aplicações “sérias”. Nossa pesquisa visa explorar como os jogos eletrônicos eram representados através das revistas de microinformática e como eles podiam influenciar a interação do usuário com o artefato tecnológico. Como fontes para a pesquisa, foram escolhidas as revistas Micro Sistemas e Micro Mundo, devido a circulação desses periódicos entre a nascente comunidade de usuários de microcomputadores. Para análise, foram escolhidos anúncios publicitários e matérias voltadas aos jogos entre os anos de 1981 e 1984, destacando-se as publicações de códigos em linguagem BASIC relacionados a jogos de diferentes tipos, como “Labirinto”, “Descubra a Senha” e “Fórmula 1”, acompanhados de introduções que instigavam os leitores a programarem para desfrutá-los. Como resultado parcial, nossa pesquisa vem apontando que a visão dos microcomputadores como máquinas para jogos mais elaborados não envolvia apenas a dimensão do entretenimento, mas havia uma preocupação em mostrá-los em seu potencial educativo. Ainda que os jogos de microcomputadores não fossem essencialmente um produto pedagógico, o estímulo proporcionado na produção (digitação) de um jogo ou seu consumo proporcionava o aprendizado em programação entre os usuários, envolvendo diversas habilidades como lógica, domínio da linguagem BASIC, matemática e percepção visual.', NULL, NULL, '2019-08-10 13:00:00', '2019-09-19 15:22:35', 3, 2, 7, 5, true, 9.375, 9.80000000000000071);
INSERT INTO public.projeto VALUES (38, 'RODA DOS EXPOSTOS X ABANDONO INFANTIL', 'Abordagem preliminar da função desempenhada pela Roda dos Expostos no Brasil e a atuação da Santa Casa de Misericórdia, evidenciando o Regimento dos expostos referente á cidade de Porto Alegre (1837- 1880). A justificativa para o desenvolvimento do presente trabalho deve-se à relevância no contexto histórico e social da Casa da Roda, no amparo de crianças abandonadas, cuja incumbência tem destaque na evolução dos direitos fundamentais da criança, pelos quais encontram entre tantos desafios para sua concretização,o abandono infantil, reflexo da exclusão social que persiste hodiernamente. Para a realização da pesquisa, na parte qualitativa usamos como fonte principal, os documentos de nascimentos e óbitos, as cartas designadas à administração da Santa Casa, situadas no Arquivo Histórico, a respeito dos expostos e o Livro de Matrículas- Cultural Santa Casa. A pesquisa quantitativa é apresentada por meio de gráficos estatísticos de acordo com as informações do Livro de Matrículas.', NULL, NULL, '2018-08-05 21:32:38', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (30, 'VEGMAP - UM APLICATIVO PARA AJUDAR VEGETARIANOS E VEGANOS A ENCONTRAR PRODUTOS E OPÇÕES', 'De acordo com pesquisas recentes, tem-se a estimativa que quase 5 milhões de indivíduos já praticam o veganismo, que é o modo de viver não consumindo produtos de origem animal ou testados em animais. Na sociedade atual, é cada vez mais comum que os indivíduos optem por um estilo de vida veganos, e também, em maior número, vegetariano, que pode futuramente influenciar o cidadão às práticas veganas. Um estudo realizado pelo site Vegan Bits em 2017 com 11 mil pessoas, cerca de 10% afirmou já ter aderido ao movimento vegano/vegetariano e apenas 2% ainda é fiel à crença. É possível notar que o número de desistentes desse tipo de estilo de vida é muito grande, tendo como um dos principais motivos a falta de tempo para cozinhar e o déficit de estabelecimentos com opções variadas. Deste modo, tendo como base a dificuldade de encontrar produtos com tais limitações e o crescente número de indivíduos adotando esse estilo de vida, é um grande problema a baixa disponibilidade de lugares que ofereçam produtos com as demasiadas restrições. Dessa maneira, o presente projeto tem como objetivo geral o desenvolvimento do VEGMAP, um aplicativo para facilitar o encontro de locais que ofereçam opções variadas de alimentos e produtos diversos, cumprindo com as restrições do usuário. O aplicativo contará com um mapa (utilizando a API do Google Maps) que exibirá estabelecimentos cadastrados no Google My Business, mostrando lojas e restaurantes próximos. Além disso, será disponibilizada a opção de avaliar casas comerciais, proporcionando uma melhor experiência para toda a comunidade do aplicativo. A aplicação contará com uma interface amigável, construída utilizando recomendações e boas práticas de design a fim de melhorar a experiência do usuário.', NULL, NULL, '2018-08-01 21:04:06', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.13482142857142776);
INSERT INTO public.projeto VALUES (233, 'CANUDO DE PLÁSTICO: IMPACTOS E ALTERNATIVAS AO CONSUMO.', 'Ao longo do tempo o homem tem criado diversos utensílios, ferramentas e tecnologias para auxiliá-lo a ter uma melhor qualidade de vida. Algumas destas criações são mais sofisticadas e outras muito simples. Um utensílio simples, utilizado há muito tempo, é o canudo para beber, mas a sua evolução para o modelo plástico trouxe severas consequências ambientais. O canudo plástico representa 4% de todo o lixo plástico do mundo. Ele é feito de poliestireno e apesar de ter uma vida útil de dez minutos, tempo médio para tomarmos uma bebida, ele demora 500 anos para se decompor na natureza. O objetivo desse trabalho é identificar as consequências do uso de canudo plástico e propor alternativas para esta situação. A coleta de informações teve duas etapas. Na primeira, realizou-se um estudo exploratório por meio de pesquisa bibliográfica e documental. Na segunda, elaborou-se uma pesquisa de campo com a aplicação de um questionário junto aos estabelecimentos instalados na praça de alimentação de um shopping de Porto Alegre. O resultado da pesquisa de campo demonstra que a grande maioria dos bares e lancherias oferecem canudos plásticos para os seus clientes, entretanto identificamos na pesquisa documental que avançam as vendas dos canudos biodegradáveis. Por fim, o trabalho registra a necessidade de implementarmos uma legislação que restrinja o uso dos canudos plásticos, pois estimasse que em 2.050 haja mais plásticos do que peixes nos oceanos.', NULL, NULL, '2019-08-07 16:17:32', '2019-09-19 15:35:33', 10, 3, 7, 5, true, 10, 8.38749999999999929);
INSERT INTO public.projeto VALUES (180, 'TRANSMISSOR FM', 'Com base nos conhecimentos que me foram ensinados na área de eletrônica, resolvi apresentar como projeto para a IFTEC, um transmissor FM, onde pretendo mostrar e fazer a aplicação dos conhecimentos que adquiri até o momento sobre resistores, indutores capacitores, entre outros. O transmissor FM vai ser feito por meio de um circuito simples, composto por: -Resistor de 22k Ohms; -Resistor de 37k Ohms; -Resistor de 10 Ohms; -Resistor de 4.7k Ohms; -Capacitor; -Indutores; -Fonte de tensão; -Capacitor variavel; -Bateria de 9V; -Estanho(para executar a soldagem dos componentes); -Estação de solda; -Cabo P2; -Transistor BC 337; O circuito utilizado para executar o transmissor FM é simples e tem como função produzir uma onda de radiofrequência relativamente curta. O circuito funciona de forma que o transistor BC 337 vai amplificar o sinal, juntamente um indutor e um capacitor em paralelo vão ter como função a variação da frequência de operação, logo outro capacitor será responsável pela realimentação de parte do circuito, portanto os resistores servirão para a polarização da base do transistor enquanto outro capacitor faz o seu desacoplamento, este circuito sendo alimentado por uma bateria de 9V. Pretendemos fazer a execução do projeto hoje proposto, com a orientação do Professor Emílio Arend e juntamente com os nossos conhecimentos adquiridos sobre eletrônica. Esperamos alcançar todos nossos objetivos que são fazer uma demonstração de forma simples de como funciona um transmissor FM e assim por fim aplicar nossas habilidades na área.', NULL, NULL, '2018-08-10 23:30:23', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 6.65625);
INSERT INTO public.projeto VALUES (81, 'MOVIMENTADOR PARA PAINEL SOLAR', 'A energia é de grande importância para a humanidade, nada se faz sem energia, sabendo disso e percebendo que alguns meios energéticos irão se esgotar algum dia, o ser humano passou a procurar meios energéticos renováveis, um dos meios encontrados é a utilização da energia solar, que é captada, geralmente, por painéis fotovoltaicos (painéis solares). Devido à rotação da Terra entorno do Sol, os painéis solares fixos não recebem incidência direta dos raios solares durante todo o dia, para resolver esse problema, existem alguns painéis solares que possuem uma base móvel, para que seja possível um melhor aproveitamento dos raios solares em relação ao painel fixo. O que o grupo se propõe a fazer é criar um protótipo de base móvel para painel solar controlada por Arduino. O protótipo a ser desenvolvido consiste na criação de um aparelho que irá movimentar-se procurando o ponto com maior incidência de raios luminosos. A estrutura do aparelho é constituída de uma parte mecânica integrada com uma parte eletrônica, fazendo o posicionamento angular e rotacional do painel solar. A parte mecânica é estruturada por uma base para colocação do painel solar e dois micro servo motores que irão movimentar o sistema. A parte eletrônica é constituída, basicamente, por um microcontrolador, sensores de luminosidade e por um painel fotovoltaico. A procura pela posição de maior eficiência do painel e a movimentação serão feitas da seguinte forma: *O painel e os sensores de luminosidade serão fixados sobre uma placa de madeira ou acrílico de forma retangular e a placa será fixada na parte mecânica do protótipo; *Os sensores, colocados nas extremidades da placa, produzirão sinais de tensão que serão enviados para o Arduino; *No microcontrolador, será feita uma comparação entre os resultados dos sensores para descobrir se existe a necessidade de movimentar o painel.', NULL, NULL, '2018-08-08 17:39:54', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 7.5, 9.77232142857142883);
INSERT INTO public.projeto VALUES (190, 'TEIAS ALIMENTARES', 'As teias ou cadeias alimentares revelam uma complexa interação entre os seres vivos. Os produtores, que podem ser as algas, bactérias e plantas utilizam energia luminosa do sol e a convertem em energia química. Uma das consequências é a reserva de alimento que estes seres fazem para eles mesmos e para outros que se alimentam deles. Estes últimos, os consumidores, também tem seu papel nas relações tróficas entre todos os seres vivos de uma cadeia alimentar. Os consumidores primários alimentam-se dos produtores, os secundários alimentam-se dos consumidores primários e, os demais seguem esta lógica piramidal até os decompositores da matéria orgânica. Estes, como fungos e bactérias, finalizam as relações tróficas dentro de uma complexa relação de nutrição entre diferentes seres vivos. Este trabalho tem por objetivo revelar a importância das relações energéticas e de nutrição entre os diferentes seres vivos que compõem uma teia alimentar. Observou-se que cada ser vivo, desde o produtor até os decompositores têm, cada um, uma relação muito sensível de interdependência entre eles.', NULL, NULL, '2018-09-17 13:38:03', '2018-09-20 19:47:07', 10, 3, 6, 5, true, 7.5, 8.4375);
INSERT INTO public.projeto VALUES (37, 'ORIGENS AÇORIANAS: CASAMENTOS NA FREGUESIA DE NOSSA SENHORA DA CONCEIÇÃO DE VIAMÃO 1747-1759.', 'O propósito da pesquisa é o estudo da população de origem açoriana que se fixou no Rio Grande no século XVIII. A justificativa para desenvolver o trabalho é debruçar-se sobre a “colonização de casais” e suas estratégias de inserção na sociedade obtidas através dos matrimônios, trazendo à tona os questionamentos sobre o comportamento social e demográfico. Esses registros podem informar-nos suas origens e suas estratégias de socialização. São, portanto, indicativos das condições de vida. Para atingir os objetivos propostos, foram seguidas as seguintes etapas: leituras teóricas, Elaboração de um formulário, e gráficos. Entre outros resultados, percebemos a presença significativa de açorianos. Analisando-se a referência às naturalidades de noivos (as) que se casaram entre 1747 e 1759. Dos 184 assentos paroquiais de pessoas livres e escravas, que perfazem um total de 368 Indivíduos, temos 62 citadas como açorianos, 65 africanos, 174 nativos, 30 de origem Européia e 37 não informados. Isso significa que quase um terço dos indivíduos que casam tem ascendência açoriana, e que as ilhas que mais contribuíram foram, respectivamente, São Jorge, Faial, Terceira e Pico. Esses dados preliminares apontam para a necessidade de aprofundar as análises e determinar, suas estratégias de migração e de inserção no Rio Grande, atendendo ao fato de que, longe de ser homogêneo, este grupo de indivíduos teve diferentes motivações e trajetórias variadas desde a origem até a chegada e inserção no RS.', NULL, NULL, '2018-08-05 16:31:36', '2018-09-20 19:47:07', 11, 3, 6, 5, true, NULL, 8.65000000000000036);
INSERT INTO public.projeto VALUES (131, 'DESENVOLVIMENTO DE UMA PLATAFORMA WEB PARA MONITORIA A DISTâNCIA', 'Este trabalho propõe-se o desenvolvimento de uma plataforma web para monitoria a distância, visto que muitos alunos não podem comparecer presencialmente. Dessa forma, o projeto se objetiva a auxiliar quem possua dificuldade, por meio de um ensino a distância, em qualquer disciplina do técnico integrado. Mesmo que o IFRS tenha criado o projeto bolsas de monitoria, os alunos não frequentam os atendimentos em grande escala, isto porque nem todos residem próximo da instituição, fazendo com que tenha um percurso cansativo que, consequentemente, desperdice o seu tempo de estudo para, simplesmente, chegar até a instituição. Além disso, muitos estudantes possuem atividades extracurriculares no turno inverso, prejudicando ainda mais a vinda à escola. Para este trabalho, foi feita uma pesquisa de abordagem qualitativa de natureza aplicada. Foram estudados diversos sistemas que utilizam o ensino a distância, pois assim seria possível entender suas técnicas e aplicá-las. Posteriormente, foi realizada uma modelagem UML, linguagem para auxiliar a desenvolver a estrutura de uma aplicação orientada a objetos. Na fase atual está a implementação, já que o sistema não está concluído. Por último, serão realizados testes, por alunos e monitores do IFRS, pois eles serão os principais usuários do software. A autenticação é restrita aos alunos do IFRS, ou seja, através de uma API, obteve-se os dados de todos estudantes. Quanto ao funcionamento do sistema, o aluno se estiver com dificuldades, poderá enviar um ticket de atendimento, que subsidie seu problema. Quando enviado, o monitor da disciplina informada será notificado e deverá elaborar um material didático que possa solucionar essa dúvida. Para o futuro, será feito um perfil aos professores, para que recebam um relatório do que foi produzido pelos monitores de sua disciplina.', NULL, NULL, '2018-08-10 17:02:25', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.51249999999999929);
INSERT INTO public.projeto VALUES (97, 'DIREITOS HUMANOS ESCLARECIDOS: ANáLISE DO IMPACTO DE CAMPANHA DE CONSCIENTIZAçãO NO ENSINO FUNDAMENTAL', 'A presente pesquisa objetiva analisar o impacto que uma campanha de conscientização sobre a importância dos direitos humanos provoca em alunos do Ensino Fundamental. Em um país que sofre com a violência endêmica, como o Brasil, é natural que o tema direitos humanos seja motivo de polêmica.Em questionário realizado com o público alvo, setenta e três alunos do Oitavo ano do Ensino Fundamental, se constatou que o tema direitos humanos era desconhecido ou conhecido superficialmente por quase totalidade dos entrevistados, a ponto de alguns afirmarem não fazerem uso de tais direitos. Diante da necessidade de esclarecimento do assunto, iniciamos uma série de atividades de conscientização sobre a importância dos direitos humanos para o bem da sociedade, a se destacar palestras, debates com autoridades municipais, encenações, paródias musicais e jogos. Após a realização das atividades descritas realizamos um novo questionário e analisamos as respostas obtidas, traçando um paralelo entre as informações obtidas no primeiro e no segundo instrumento de pesquisa. Comparando as respostas dos dois questionários, foi possível constatar que grande parcela dos alunos demonstrou ter compreendido a necessidade da preservação dos direitos básicos, bem como o entendimento de que é responsabilidade de todos a efetivação plena de tais direitos. A campanha de conscientização sobre a importância dos direitos humanos para o bem de sociedade se mostrou eficaz.', NULL, NULL, '2018-08-09 18:25:57', '2018-09-20 19:47:07', 11, 3, 6, 5, true, NULL, 10);
INSERT INTO public.projeto VALUES (114, 'ENGLISH FUN: UMA PLATAFORMA VERSáTIL PARA O ENSINO DE INGLêS PARA CRIANçAS', 'O domínio de uma segunda língua em um mundo globalizado, onde há frequente intercâmbio de pessoas e informações, promove uma maior participação cultural e social às pessoas, onde as mesmas também passam a desempenhar um maior papel nas atividades mundiais. Aliado a isso, o frequente uso de aparelhos eletrônicos no cotidiano aponta para uma necessidade de adaptar nossas formas de ensino e aprendizagem a nosso contexto atual, onde os tipos de público com acesso a esses dispositivos vem crescendo de forma significativa. O presente trabalho, então, propõe o desenvolvimento de uma plataforma web em HTML 5 e PHP, chamada English Fun, com o objetivo de facilitar o processo de aquisição preliminar de língua inglesa para o público infantil já alfabetizado em português. O processo de aprendizagem se dará de maneira lúdica, com atividades que engajem o público alvo em um ambiente acolhedor para iniciar o desenvolvimento de um segundo idioma, através de tarefas com temas do cotidiano. Dessa forma, o software busca funcionar como meio facilitador para criar uma base no idioma e deixar o usuário mais confortável e com mais interesse pela língua inglesa ao ingressar no ensino regular. Por fim, acerca dos estudos feitos conclui-se que a exposição precoce a uma segunda língua pode resultar em um maior interesse pela aquisição de um novo idioma e com isso surge a necessidade da disponibilidade de um maior número de maneiras para suprir essa demanda, principalmente de forma gratuita e de qualidade, o que é uma das propostas da plataforma English Fun.', NULL, NULL, '2018-08-10 11:02:10', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.08660714285714377);
INSERT INTO public.projeto VALUES (5, 'SISGETEC - SISTEMA DE GERENCIAMENTO DE EVENTO IFCITEC', 'O Campus Canoas do IFRS desde o seu primeiro ano como instituição busca inserir na realidade de seus discentes, a aprimoração do método científico. As feiras de ciência e inovação incentivam os estudantes a se tornarem jovens pesquisadores a partir do desenvolvimento de projetos de pesquisa dentro da escola. A Feira de Ciências e Inovação Tecnológica, doravante IFCITEC, realizada desde 2013, apresenta um grande número de projetos inscritos e mobiliza participantes de projetos, voluntários, administradores, comissão avaliadora e comissão organizadora. O presente trabalho visa desenvolver um sistema que auxilie na demanda gerada, agilizando e tornando mais confiáveis os processos inerentes à comissão organizadora. A partir de uma abordagem qualitativa foi possível utilizar a feira como a fonte direta de dados e assim, entender seu funcionamento, além disso foi indispensável a utilização de duas técnicas: observação participante e grupos de discussões, extremamente importantes para entender que a preocupação com o gerenciamento das inscrições não deve ser maior que a busca pelo desenvolvimento de projetos que propiciem nos estudantes novas aprendizagens. A primeira, se deu através da participação como um dos voluntários da IV IFCITEC e presente na comissão organizadora da V IFCITEC, onde puderam ser observadas as carências que a feira possuia, já os grupos de discussões, se deram por uma série de reuniões com os organizadores da feira discutindo as funcionalidades que o sistema deveria conter. Após a análise dos requisitos, ocorreu a modelagem do sistema utilizando a UML (Unified Modeling Language), buscando a elaboração de um conjunto correto de diagramas que facilitassem a compreensão do sistema. A partir da implementação do sistema, que já está sendo utilizado no gerenciamento da VI IFCITEC, será disponibilizado um questionário para todos os participantes, a fim de obter uma análise diversificada quanto a sua eficiência e para possíveis adaptações do sistema.', NULL, NULL, '2018-07-16 18:44:04', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7.875, 9.78125);
INSERT INTO public.projeto VALUES (181, 'INTELIGÊNCIA ARTIFICIAL: APLICAÇÕES E IMPLICAÇÕES NA SOCIEDADE', 'Há centenas de anos o ser humano tenta entender e replicar o funcionamento de nossos cérebros, numa busca incessante tanto por auto-conhecimento quanto pela capacidade de conceber outro ser inteligente. Em toda a história da espécie humana, nunca estivemos tão próximos desse objetivo. Apenas nas últimas décadas criamos ferramentas capazes de possibilitar a comunicação entre pessoas em extremos opostos do mundo. Criamos até mesmo algoritmos capazes de aprender e se auto-aprimorar para aumentar a própria efetividade. Ora, a capacidade de aprender não é proveniente da inteligência? É possível caracterizar isso, então, como inteligência? Será que finalmente seremos (ou até mesmo já somos) capazes de criar uma máquina pensante? Foram esses questionamentos que nos motivaram a realizar esta pesquisa. Pretendemos identificar as principais aplicações de inteligências artificiais (IAs) na sociedade através de buscas em notícias e artigos científicos, destacando as áreas onde essas tecnologias são aplicadas e comparando-as com as funções desempenhadas por humanos, tomando por base os estudos de Gardner sobre Inteligências Múltiplas. Além disso, serão implementados chatbots (softwares capazes de interagir com humanos por meio de chats) construídos com diferentes estruturas de aprendizado e treinamento, a fim de identificar sua eficiência na interação com humanos, avaliando parâmetros como a coerência das respostas fornecidas pelos bots e o tempo de interação com outros indivíduos. Atualmente, a pesquisa está em progresso, já sendo possível identificar o planejamento de aplicações de IAs em áreas como advocacia e medicina, além de outras que vêm sendo testadas, como os carros autônomos. O desenvolvimento de um chatbot para o app Telegram já foi finalizado e está em funcionamento. Além disso, encontramos algumas ferramentas muito úteis para o desenvolvimento e treinamento de IAs, como as bibliotecas TensorFlow e scikit-learn. Os resultados, no geral, se mostram promissores.', NULL, NULL, '2018-08-10 23:37:13', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.34821428571428648);
INSERT INTO public.projeto VALUES (264, 'MATERIAIS BIODEGRADáVEIS', 'Muits pessoas sabem que existem meios mais viáveis de não prejudicar o meio ambiente, do mesmo jeito não se interessam em trazê-los para suas vidas, algumas também não têm o conhecimento de todos esses estudos. Felizmente pessoas que se importam com ele criaram materiais biodegradáveis, que se decompõem em menos tempo, sem prejudicá-lo no processo. Mas mesmo com esses materiais, não podemos jogar nenhum tipo na natureza, pois não queremos viver no meio do lixo. No artigo 225 da Constituição Federal, diz que todos têm direito ao meio ambiente ecologicamente equilibrado, impondo-se ao poder público e a coletividade o dever de rendê-lo e preservá-lo para presentes e futuras gerações. O objetivo desta pesquisa é conscientizar as pessoas que não devemos jogar nenhum tipo de material no ambiente. Pesquisou-se em vários sites e arquivos na internet. Entrevistou-se algumas turmas para construir um gráfico. Descobriu-se vários tipos de materiais biodegradáveis, o tempo que eles levam para se decompor e seus preços. Um canudo plástico comum custa menos de um centavo e leva de cinquenta a duzentos anos para se decompor, já o biodegradável custa menos de cinco centavos e leva dois anos e três meses para se decompor. Vale a pena investir nesses materiais biodegradáveis e respeitar a natureza.', NULL, NULL, '2019-08-09 16:14:01', '2019-09-17 16:12:00', 10, 3, 7, 2, NULL, 6.625, NULL);
INSERT INTO public.projeto VALUES (112, 'NúCLEO DE COMUNICAçãO', 'O Núcleo de Comunicação tem o intuito de trabalhar, propagar e enraizar, junto à comunidade externa, o nome do IFRS - Campus Farroupilha no município de Farroupilha/RS e região. Este projeto está vinculado ao programa Campus da Gente e é uma ferramenta para expandir, no município e região, o nome do IFRS, a importância da instituição gratuita e o que o campus oferece. Por meio do Núcleo, alunos bolsistas e voluntários, produzem conteúdos midiáticos a respeito de atividades e ações do campus que são difundidas por meio das mídias digitais e em visitas às escolas da região. Neste projeto, os bolsistas, juntamente com os coordenadores da ação e com membros do Programa Campus da Gente, apoiam oficinas de comunicação e criatividade que são realizadas tanto no campus como em escolas do município de Farroupilha/RS. Este projeto se justifica pela necessidade dos cidadãos de Farroupilha/RS e região conhecerem melhor o que é, como funciona, o que oferece e as possibilidades do IFRS. Infelizmente, por mais que venha sendo trabalhado, é comum percebermos, em contato com a comunidade, um desconhecimento sobre nossa instituição, sobre os cursos e ações e sobre a gratuidade do IFRS. Além disso os setores de Comunicação e Extensão haviam identificado, entre alunos de diversos cursos com afinidades às atividades que envolvam audiovisual, fotografia, escrita, etc e que solicitaram ao setor oportunidade para participar em atividades. Desde o início do projeto foram desenvolvidas ações que levaram o que é produzido pelo campus a toda a comunidade, como o Conta pra Gente, que entrevista alunos e servidores a respeito de temas relevantes; o História de Aluno, que conta a vida de alguns estudantes do campus; o Não Escorregue na Língua, que dá dicas de língua portuguesa nas redes sociais; o Dicas da Bibi, que traz o dia-a-dia da biblioteca e dicas de leitura; e o CientificaMente, que mostra em vídeo os projetos de ensino, pesquisa e extensão desenvolvidos por alunos e servidores.', NULL, NULL, '2018-08-10 10:50:03', '2018-09-20 19:47:07', 5, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (169, 'DITADURA MILITAR NO BRASIL: O ASSASSINATO DE EDSON LUÍS E A PASSEATA DOS CEM MIL', 'Ao longo de nosso trabalho vamos abordar dois acontecimentos ocorridos no período da Ditadura Militar No Brasil, e para isso visando melhor compreensão, é de suma importância falarmos e abordarmos aqui também sobre a Ditadura Militar Brasileira, para então começarmos a discutir a delimitação do tema. Buscamos tanto como objetivo de foro íntimo e acadêmico devanear e contatar as verdades sobre os fatos ocorridos e o assassinato de aparente estudante, protestante Edson Luis, compreender o momento histórico pelo qual o país estava atravessando bem como a representação de tais temáticas pela mídia da época e despertar interesse nas pessoas trazendo informações que não tiveram acesso, assim tendo noção da história que contitui o Brasil. Concluindo se as ações tomadas tanto pela sociedade quanto pela administração política totalmente autoritária foram justas ou insensatas. No entanto, análise em estudo deverá prover a conciêntização dos acontecimentos históricos que marcaram com repercusões de violência e agressividade, de um período contra uma população à procura de seus direitos como sensatos cidadões, buscando um espaço de percepção das deficiências da sociedade. Queremos saciar questionamentos e duvidas deixados pelas informações que já se tem sapiência, e e outras duvidas que vem surgindo ao decorrer. Queremos também compreender como a sociedade da época reagia à o estado político daquele eminente período, e se a própria fiava-se ao que o jornal conceituava em suas matérias. Por fim temos como proposito no presente projeto embasar as teorias confrontando com a prática.', NULL, NULL, '2018-08-10 22:23:02', '2018-09-20 19:47:07', 3, 2, 6, 2, NULL, 2.875, NULL);
INSERT INTO public.projeto VALUES (140, 'ESTUDANDO COM O INIMIGO', 'Visando refletir sobre como a juventude tem convivido com a depressão em ambientes escolares, este estudo explora as interconexões entre os processos de socialização, individualização e depressão em ambiente escolar. Por um lado, o estudo se ocupa em refletir sobre como as dinâmicas sociais típicas das sociedades contemporâneas, podem ter influenciado o aumento dos casos de depressão entre jovens. Por outro, promove a discussão sobre as atividades de apoio estudantil na prevenção da depressão entre jovens estudantes. A pesquisa é realizada através da revisão teórica e da coleta de dados junto a estudantes e profissionais da educação, que compõe o universo escolar do Instituto Federal do Rio Grande do Sul, campus Canoas. A coleta de dados é dividida em duas etapas: a. com estudantes, seguindo a metodologia do inventário de depressão de Beck, como instrumento de auto-avaliação da depressão. As informações do inventário de depressão de Beck serão complementadas com o levantamento de dados pessoais dos alunos, tais como a composição familiar, renda familiar aproximada, sexo, idade, turma, histórico de medicação psiquiátrica. b. com profissionais do setor de apoio aos estudantes, através de entrevistas semi-estruturadas, para mapear as medidas de prevenção a depressão. Neste trabalho não será solicitado a identificação do aluno. De posse desses resultados, será feita uma apresentação para a comunidade escolar, visando a ampliação do debate e a construção de estratégias de enfrentamento desta doença que acomete nossos jovens.', NULL, NULL, '2018-08-10 19:09:25', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 9.5, 8.13660714286000086);
INSERT INTO public.projeto VALUES (40, 'A DISSOLUÇÃO DA UNIÃO SOVIÉTICA NA IMPRENSA BRASILEIRA', 'O fim dos 69 anos da União das Repúblicas Socialistas Soviéticas (URSS) nunca esteve tão iminente quanto na década de 1990. Não é à toa que em 26 de dezembro de 1991, no Kremlin em Moscou, a bandeira da União Soviética descia do mastro principal e dava lugar à bandeira da Rússia, como consequência da declaração n°142-H do então Soviete-Supremo da União Soviética, Mikhail Gorbachev, o último de sua história. Isso simbolizava ao mundo o fim: o fim dos anos gélidos da Guerra Fria, o fim de uma nação já desgastada econômica e politicamente, e principalmente, o fim da história de uma nação. Dadas as circunstâncias, decido então adotar como problema de pesquisa para o presente estudo, apresentar como a imprensa brasileira apresentou à população a dissolução da União Soviética. Dado o problema de pesquisa, adota-se, então, como objetivo geral apresentar como a imprensa brasileira representou a dissolução da União Soviética, enquanto especificamente busco relacionar o fim da União Soviética com o fim da Guerra Fria, bem como busco apresentar as possíveis condições que levaram a dissolução da União Soviética. Quanto a metodologia deste projeto, inicio a pesquisa fazendo o fichamento da bibliografia sobre a Guerra Fria e a União Soviética, seguido de uma leitura intensiva e fichamento das fontes primárias (os jornais). Após essa etapa, faz-se a análise da documentação primária com a documentação bibliográfica, onde, para fontes primárias, foram escolhidos os jornais O Estado de São Paulo (conhecido popularmente como Estadão) e a Folha de São Paulo.', NULL, NULL, '2018-08-06 00:06:05', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 8.625, 9.94374999999999964);
INSERT INTO public.projeto VALUES (67, 'BIODIESEL A PARTIR DA GORDURA DA PELE DO FRANGO', 'O aquecimento global é uma das maiores preocupações mundiais, é causado principalmente pela liberação de dióxido de carbono na atmosfera, um dos maiores causadores disso é a queima de combustíveis fósseis. Perante essa questão devemos pensar em alternativas para a diminuição do uso desses combustíveis e uma alternativa é o biodiesel. Atualmente o Brasil é destaque no desenvolvimento de uso de fontes renováveis, sendo o segundo maior produtor de biodiesel no mundo. O biodiesel pode ser obtido através de diversas matérias primas, como óleos vegetais e de gorduras. O objetivo dessa pesquisa foi produzir o biodiesel a partir da gordura extraída da pele de frango, a pele de frango é rica em gordura, cerca de 32%. Quando não usada para fins alimentícios, na maioria das vezes é usado como cama de frango (adubo orgânico). A gordura da pele do frango foi obtida através do cozimento em fritadeira tipo airfryer caseira. Para a realização da síntese do biodiesel, foi reagido 14 mL de Metanol com 0,5 g de NaOH. A mistura foi aquecida em banho maria por 10 minutos a 50 oC. Após essa etapa, foi adicionado à mistura 60mL de óleo extraído da pele de frango. A seguir o líquido foi transferido para um funil de decantação e mantido em repouso para separar em duas fases. O biodiesel foi lavado com HCl 5% e seco com Na2SO4. Na extração de gordura de 1 kg de pele rendeu 390 mL de óleo. Conseguiu-se obter o melhor resultado da síntese utilizando o catalisador hidróxido de sódio e o reagente metanol em aquecimento por 10 minutos em 50 oC. O rendimento de biodiesel foi de 75%. Após a síntese ser concluída realizou-se a determinação do pH, com indicador universal o resultado obtido foi entre 6,0 e 7.0. Através de pesquisas realizadas pelo grupo, conclui-se que a produção de biodiesel a partir da gordura da pele de frango é possível.', NULL, NULL, '2018-08-07 16:03:51', '2018-09-20 19:47:07', 4, 2, 6, 5, true, 8, 3.375);
INSERT INTO public.projeto VALUES (56, 'CODE OVERLORD: JOGO PARA AUXíLIO DO ENSINO DO PARADIGMA DA ORIENTAçãO A OBJETO', 'A orientação a objeto é um paradigma de programação criado entre a década de 50 e 60, que se baseia no conceito de “objetos”. Estes contém dados na forma de atributos e podem realizar tarefas através de métodos. Além disso, a orientação a objeto apresenta diversos mecanismos de reutilização de código, como herança e genéricos, que reduzem grandemente o tempo requerido para desenvolver um sistema. Para averiguar a importância deste paradigma, foi feita uma pesquisa no sistema de busca de empregos infojobs.com para o cargo de desenvolvedor/programador. Depois de analisadas 75 vagas, foi constatado que 70% delas requiriam linguagens orientadas a objeto. Com sua importância definida, procurou-se averiguar o grau de sucesso de seu ensino analisando a primeira prova de orientação a objetos do 3º ano de 2018 em desenvolvimento de sistema do IFRS - Canoas. Foi constatado que 50% da turma obteve desempenho mínimo esperado ou abaixo deste. O projeto, então, se propõe a desenvolver um jogo que auxilie no ensino dos conceitos deste paradigma. Em salas de aula, são muito comuns exercícios do tipo “crie uma classe que sobrescreva pelo menos 3 métodos”, que forçam o aluno a aplicar os conceitos. Com o proposto jogo, numa situação com um dado desafio, a solução poderia ser desenvolvida de uma maneira mais intuitiva, permitindo ao aluno aplicar “naturalmente” os conceitos deste paradigma. O projeto pretende facilitar o ensino da orientação a objeto, e para constatar seu grau de sucesso, está planejada uma oficina com a turma do 3º ano de desenvolvimento de sistemas para que os alunos possam jogar o jogo e fornecer feedback sobre o que acharam e se conseguiram aprender/fixar melhor algo.', NULL, NULL, '2018-08-07 14:19:36', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 9, 7.91339285714285801);
INSERT INTO public.projeto VALUES (149, 'O QUE CONTA UM CONTO? ANáLISE COMPARATIVA DE VERSõES DO CONTO DE FADAS CINDERELA', 'O tema de nosso projeto é conto de fadas e suas diferentes versões. Assim, nosso problema de pesquisa se centrará na análise de versões do conto de fadas &#34;Cinderela&#34;.Como objetivos do projeto, buscamos entender como as versões do conto de fadas da cinderela foram se modificando ao longo do tempo, tendo como ponto de partida as mais famosas versões deste conto, dos autores Charles Perrault e dos irmãos Jacob e Wilhelm Grimm. Isto porque os contos de fadas sempre estiveram presentes em nossas vidas, e tivemos contato com diferentes versões ao longo do tempo. Na nossa infância, tivemos conhecimento de uma única versão da cinderela, conforme fomos amadurecendo fomos apresentados à outras versões, e por consequência dessa variedade, tivemos outras interpretações da mesma história. Em decorrência dessas experiências de leitura, gostaríamos de entender o porquê destas diferenças, e achamos que a melhor maneira para compreender estas diferenças é através da análise das divergentes versões. Metodologicamente, primeiramente definimos a obra Cinderela como o conto que seria analisado, e optamos pelas versões de Grimm e Perrault que passamos a denominar como &#34;originais&#34; ou fundantes. Em seguida, coletamos um conjunto de livros com a mesma história em língua portuguesa, compondo o corpus de análise. A partir do corpus, foram comparadas as diferentes versões e grupos de trechos selecionados foram analisados a partir de noções de Estudos Literários, Análise Textual e Psicanálise. Buscamos como resultados compreender como o conto foi adaptado pelas sociedades em suas épocas, isto é, se há influência de questões históricas e sociais nas diferentes versões; além de entender a influência que os contos de fadas tem na construção moral do indivíduo.', NULL, NULL, '2018-08-10 20:25:41', '2018-09-20 19:47:07', 3, 2, 6, 5, true, NULL, 9.33839285714000056);
INSERT INTO public.projeto VALUES (94, 'GOVERNO JK: A CONSTRUçãO DE BRASíLIA NA IMPRENSA', 'Este projeto tem como objeto de estudo a construção da cidade de Brasília; e como a imprensa jornalística da época a retratara. Ainda se discute muito sobre a real intenção do presidente Juscelino Kubitscheck (JK) ao construir uma nova capital para o país. Para uns, ele queria construir uma capital “do nada”, para ter a liberdade de construir um projeto com ares de modernização; para outros, o real objetivo do presidente era retirar a capital da cidade do Rio de Janeiro, um local de grande população urbana e que possibilitava que muitos protestos fossem realizados em frente a sede do governo. A construção de Brasília foi realizada aceleradamente; muito dinheiro foi investido e um grande contingente de trabalhadores do norte e do nordeste foi até lá em busca de melhores condições de vida. Eram tempos de grande otimismo e valorização dos aspectos nacionalistas: a começar pela primeira vitória da seleção do Brasil em uma Copa do Mundo (1958), até chegar a produzir carros totalmente no Brasil. A inauguração de Brasília, nesse contexto, seria o ponto máximo da valorização de um projeto nacional de modernização. Contudo, também foram tempos de grande endividamento externo, sendo uma das principais razões a construção da nova capital. Portanto, buscamos compreender como foi representada a inauguração de Brasília na imprensa brasileira. Em uma relação entre fontes primárias (jornais) e fontes secundárias (bibliografia) está assentada nossa metodologia. Faremos um fichamento desses livros que tratam da História do Brasil dos anos 50, do governo JK e do nacional-desenvolvimentismo. Depois disso, vamos articular os dados obtidos através de pesquisa detalhada nos periódicos da época (disponíveis na Hemeroteca da Biblioteca Nacional) com as nossas fontes secundárias já fichadas. As conclusões nos mostram que talvez a melhor explicação para a construção de Brasília seja aquela que une os dois elementos: o viés modernizador de JK com uma certa proteção ante as pressões populares.', NULL, NULL, '2018-08-09 16:01:00', '2018-09-20 19:47:07', 3, 2, 6, 2, true, NULL, NULL);
INSERT INTO public.projeto VALUES (362, 'PLACAS SOLARES AUTôNOMAS', 'O uso de energia renovável e o consumo consciente correspondem a dois dos Objetivos de Desenvolvimento Sustentável, da agenda 2030 da ONU. O Brasil, tem apresentado um crescimento significativo no uso da energia solar, no entanto, observou-se, durante as pesquisas realizadas, que em algumas residências não é possível a instalação de placas solares, considerando os baixos índices energéticos produzidos. A problemática que norteia esta pesquisa é: &#34;Como é possível aumentar a eficiência das placas solares por meio de um suporte com movimentação programada?&#34; Para responder essa pergunta, buscou-se analisar e compreender o processo de funcionamento das placas solares existentes, bem como, a sua captação; a movimentação do suporte; a programação para desenvolver o software; as mais diversas funcionalidades da Raspberry PI 3 e como esta placa pode contribuir no processo de montagem do suporte programável. Com base nessas pesquisas e discussões, decidiu-se dar início ao desenvolvimento de um protótipo funcional, em escala reduzida. Este suporte tem sua mobilidade programada, no intuito de otimizar a captação de energia de placas já instaladas em residências ou empresas, que tenham o telhado triangular, ou seja, caída de água para o lado leste e oeste. O projeto conta com a aplicação de um questionário para identificar a demanda de utilização do mesmo. O método utilizado foi o exploratório, de abordagem mista. Os principais procedimentos foram pesquisa bibliográfica, aplicação de questionário e testes com o uso do protocolo de registro de prototipagem. A partir deste protótipo foi possível identificar a movimentação por meio da programação e a verificação em tempo real dos sensores de luminosidade. Como resultado final, pretende-se desenvolver o suporte em tamanho real.', NULL, NULL, '2019-08-14 16:14:55', '2019-09-19 14:02:33', 6, 2, 7, 5, true, 9.625, 8.53928571428570038);
INSERT INTO public.projeto VALUES (118, 'O LONGO CAMINHO DA LIBERDADE: UM ESTUDO DE CASO DA LEGISLAÇÃO ABOLICIONISTA NO BRASIL', 'Diferente das emergentes Repúblicas sul-americanas, o Brasil foi um dos últimos países abolir a escravidão, no final do século XIX. No entanto, desde 1810, a Inglaterra vinha pressionando Portugal a extinguir o tráfico negreiro, e posteriormente o Império Brasileiro, tendo em vista a motivação econômica. Mas por qual motivo, a legislação brasileira foi lenta e gradual na abolição da escravidão? Tendo como premissa a presente a pergunta, o objetivo do presente trabalho é apresentar na forma de estudo de caso, os tratados internacionais e a legislação que interferiu no caminho da liberdade da população escrava no Brasil. Um segundo objetivo relaciona-se a questionar, no público alvo escolar, o motivo da abolição tardia no Brasil. A pesquisa será realizada na metodologia de estudo de caso da legislação e uma entrevista onde perguntaremos, o motivo da abolição no Brasil ter sido lenta e gradual, e o papel da escravidão na sociedade brasileira.', NULL, NULL, '2018-08-10 13:29:12', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 7.5, 4.84999999999999964);
INSERT INTO public.projeto VALUES (116, 'ALIMENTADOR DE RAçãO AUTOMáTICO', 'Alimentadores de ração com características automáticas ou até mesmo alimentadores mais simples servem para beneficiar animais domésticos e auxiliar seus tutores. Sabendo que geralmente os problemas em relação à saúde dos animais domésticos podem ser causados pela má alimentação, muitas vezes devido à falta de disponibilidade de tempo do dono e que essa preocupação para com o animal vem aumentando, com o intuito de que o mesmo envelheça com saúde, maneiras de manter o bem-estar do cão/gato são prioridades. O projeto apresentado visa conciliar praticidade ao tutor e o bem-estar do animal doméstico com a construção de um alimentador de ração automático que contemple as necessidades do pet de acordo com seu porte, incluindo também a dieta diária de forma que o animal possa alimentar-se mesmo sem a presença do dono. O alimentador de ração automático realiza a dosagem da ração periodicamente abrangendo a quantidade que o animal ingere dividida em porções que são determinadas pelo tutor e adaptadas conforme suas preferências. A estrutura apresenta um baixo custo e pode ser dividida em mecânica e elétrica. No aspecto mecânico, há um local de armazenamento da ração e a área de dosagem que são feitos de tubos PVC, já a condução da ração até a vasilha é realizada por uma mola de aço. Em relação aos aspectos elétricos, a rotação da mola é executada por um motor de corrente contínua baseado em programação prévia na plataforma de prototipagem Arduino. O motor que está acoplado à mola permanece ligado até que seja realizada a dosagem com a quantidade correta, sendo que o alimentador terá o número de acionamentos ao longo do dia de acordo com a dieta do pet.', NULL, NULL, '2018-08-10 11:19:34', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 7.875, 9.78125);
INSERT INTO public.projeto VALUES (119, 'TEOR DE ÁLCOOL NA GASOLINA', 'O TEOR DE ÁLCOOL NA GASOLINA: Conforme a Agência Nacional do Petróleo (ANP), a gasolina é uma mistura de hidrocarbonetos que apresenta, um percentual obrigatório de etanol (C2H6O) de 27% com tolerância de 1% para mais ou para menos. O álcool utilizado na gasolina tem a função de diminuir a emissão de monóxido de carbono (CO) ao meio ambiente e aumentar a octanagem da gasolina (resistência a detonação). Em contrapartida, o alto índice de etanol na gasolina pode trazer danos ao veículo, como a corrosão do sistema de injeção eletrônica, entre outros. A partir dessas informações, este projeto tem por objetivo determinar o teor de etanol presente na gasolina de diferentes postos de abastecimento de Canoas-RS, verificando se o combustível é adulterado ou não. Como metodologia, será realizado um experimento utilizando volumes iguais de água e de cada amostra de gasolina (50 mL cada) formando misturas em provetas de 100 mL. Após a agitação de cada mistura, será verificada a alteração dos volumes iniciais para a determinação da quantidade de etanol presente em cada amostra. Sabe-se que o etanol apresenta uma parte polar e outra apolar em sua molécula, e que sua parte apolar é atraída pelas moléculas que constituem a gasolina, formando ligações do tipo dipolo induzido. Ao colocar a gasolina em contato com a água, a parte polar da molécula de etanol, que possui o grupo OH, irá se ligar com a água formando ligações de hidrogênio, que por serem muito mais fortes do que ligações de dipolo induzido são capazes de separar o etanol da gasolina. Assim, o volume ocupado pela mistura água e etanol indicará a quantidade desse álcool presente em cada uma das amostras de gasolina, indicando se elas estão de acordo com a legislação vigente.', NULL, NULL, '2018-08-10 13:52:44', '2018-09-20 19:47:07', 4, 2, 6, 5, true, 8.375, 3.72678571428571415);
INSERT INTO public.projeto VALUES (87, 'SISTEMA ALIMENTADOR AUTOMÁTICO PARA ANIMAIS UTILIZANDO ARDUINO', 'O projeto proposto neste trabalho será um sistema automático que irá realizar a alimentação de animais domésticos, assim facilitando a vida do dono, e tornando a alimentação dos animais mais simples.Para o crescimento apropriado do animal é importante ter uma alimentação controlada,porém, nem sempre é possível atender a estas necessidades conforme problemas que ocorrem no dia a dia, assim fazendo os donos passarem um longo período longe de seus animais de estimação. Isto pode comprometer a alimentação dos domésticos. Então será elaborado um sistema de alimentação automatizado, para facilitar nesse processo.A plataforma Arduino irá comandar nosso sistema, onde iremos disponibilizar um LCD e um keypad para que o usuário possa escolher como agendar o horário que irá ser derramado sua comida e água.Em nosso projeto será utilizado sensores como,Leitor RFID: Irá detectar a presença do animal próximo ao pote, onde será visto pela interface ARDUINO, se o animal ainda ainda possuir comida não será liberado mais alimento, a não ser que esteja no horário da alimentação automática que será programada pelo dono. Sensor de profundidade/nível d&#39;água : Este sensor irá verificar o nível da água e mandará os dados ao programa, se caso o animal estiver necessitando o sistema acionará uma válvula solenóide que irá liberar água. Quando o nível alto for detectado pelo sensor, a válvula solenóide será desligada. Esse processo só será feito novamente quando o sensor verificar que o nível está abaixo. Módulo Conversor Hx711 E Sensor De Peso 1 kg :Esta célula será utilizada para obter exatidão na quantidade de comida liberda. Após ser meça a quantidade de alimento, a célula irá enviar as informações ao sistema para que possamos saber o nível medido no momento atual,para saber se será liberado mais ou não.', NULL, NULL, '2018-08-09 00:47:14', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 7.375, 2.3125);
INSERT INTO public.projeto VALUES (124, 'IGUALDADE DE GêNERO NO MUNDO DO TRABALHO: O QUE é PRECISO PARA QUE HOMENS E MULHERES TENHAM CONDIçõES IGUAIS EM SUA CARREIRA PROFISSIONAL?', 'Nossa pesquisa objetiva mostrar a desigualdade de gêneros no mundo do trabalho e os fatores que influenciam para que isso aconteça. A desigualdade entre gêneros inicia na infância com uma educação voltada para meninos e outra para meninas, fazendo-se crer que existem trabalhos a serem realizados apenas pelo gênero masculino, e outros devem ser realizados predominantemente pelas mulheres. Nosso estudo é qualitativo e buscamos fazer uma pesquisa bibliográfica em artigos científicos, vídeos no YouTube e outras fontes que tratassem sobre a desigualdade de gênero e os principais aspectos que contribuem para que essa desigualdade ocorra. Nosso estudo se encontra em andamento, porém até o momento é possível apontar como resultados as seguintes dificuldades: a) divisão do trabalho doméstico com o companheiro. As mulheres ao chegarem em casa da sua jornada de trabalho, as vezes necessitam ainda cuidar da rotina doméstica, desde o preparo das refeições aos cuidados com os filhos; b) as mulheres em sua maioria são responsáveis pelo cuidado com os filhos, portanto, caso não haja possibilidade de uma escola integral, necessitam trabalhar um tempo menor que os homens para o cuidado das crianças. Assim, concluímos que para que haja igualdade de gênero no mercado de trabalho é preciso pensarmos na divisão das tarefas domésticas, não sobrecarregando apenas a mulher e a necessidade de vagas em creches e escolas de educação integral permitindo que as mães possam deixar seus filhos em segurança.', NULL, NULL, '2018-08-10 15:26:11', '2018-09-20 19:47:07', 11, 3, 6, 5, true, NULL, 7.02500000000000036);
INSERT INTO public.projeto VALUES (50, 'LITERAMA: UMA PLATAFORMA WEB COMO POSSIBILIDADE DE COMPREENSãO DOS TEXTOS DE MACHADO DE ASSIS', 'Machado de Assis é um exponente da literatura brasileira, sendo considerado um dos maiores nomes do cenário literário. Seu estilo de escrita, ao mesmo tempo em que fascina pela genialidade, assusta os seus leitores por possuir um nível de linguagem (registro) diferente do qual estão acostumados a utilizar no cotidiano, necessitando assim de um cuidado maior ao lê-lo. O presente trabalho vem como uma ferramenta de auxílio aos alunos e professores, buscando trabalhar a obra machadiana de forma mais dinâmica, num ambiente web, que visa ajudar o educando a compreender os textos do autor de uma forma mais simples. O objetivo do trabalho é implementar uma plataforma web para auxiliar a pré-leitura, leitura e pós-leitura dos contos do autor. A seção “pré-leitura” é um ambiente no qual o usuário poderá se ambientar com o conto antes de lê-lo, contando com artigos acadêmicos sobre a temática, vídeos de releituras já feitas, imagens com legenda dos locais narrados, etc. A “leitura” conterá o texto escolhido para ser lido e na “pós-leitura”, o aluno poderá trabalhar com o que compreendeu do texto, por meio da construção de mapas conceituais, através da ferramenta Sobek Graph, que irá proporcionar um recurso visual para o educando participar de forma ativa no processo de compreensão textual. Como complemento, o estudante terá a oportunidade de escrever uma releitura, isto é, como ele traria o contexto da obra para os dias atuais, por meio da escrita de uma nova história, sem perder os detalhes intrínsecos à obra. A metodologia empregada é a abordagem qualitativa, uma vez que busca analisar o problema de um determinado grupo – os alunos leitores de Machado – e de natureza aplicada, pois tenta resolver o problema desse grupo em especial. A pesquisa se encontra em andamento, e como resultados parciais pode-se apontar que as seções de “pré-leitura” e “leitura” já estão implementadas. Já foram realizadas entrevistas que muito colaboraram com o delineamento da plataforma.', NULL, NULL, '2018-08-07 13:36:15', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.66339285714285623);
INSERT INTO public.projeto VALUES (141, 'TRAJETOS E PROJETOS DE JOVENS-ALUNOS DO IFSUL', 'O presente projeto apresenta como temática a análise sobre culturas juvenis contemporâneas, tendo como foco de investigação as diferentes condições que perpassam o cotidiano dos jovens e sobre as quais se (re)criam trajetos e projetos de vida. Nesse sentido, problematiza quais as trajetórias e projetos de vida de jovens-alunos dos cursos técnico-integrados do Instituto Federal de Educação, Ciência e Tecnologia Sul-rio-grandense (IFSUL) do campus de atuação dos pesquisadores. O objetivo da pesquisa consiste na investigação acerca das trajetórias biográficas e escolares de ingressos e egressos dos referidos cursos, permitindo, assim, a busca por compreensões sobre as diferentes condições de viver esse tempo de espera e preparação para a vida adulta, problematizando concepções e sentidos atribuídos às experiências que os perpassam nos espaços institucionais (inclusive escolares) e em seus interstícios. Nessa direção, torna-se relevante aos processos de formação de sujeitos-alunos operantes na instituição escolar reconhecer quem são e o que ensejam os jovens, percebendo em seus trajetos e projetos possibilidades de (re) pensar espaços, práticas e discursos. Para tanto, ocorreu a adoção dos principais procedimentos metodológicos presentes nas Ciências Sociais, como observações e entrevistas. Espera-se, com esse estado do conhecimento, proporcionar mecanismos e estratégias para redução nos índices de evasão e retenção, bem como acompanhamento dos jovens-alunos egressos com vistas a construir maior interação da escola ao mundo do trabalho e ao exercício da cidadania.', NULL, NULL, '2018-08-10 19:10:42', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 8.5, 9.82053571428571459);
INSERT INTO public.projeto VALUES (79, 'HORMôNIOS SEXUAIS: TESTOSTERONA, PROGESTERONA E ESTROGêNIO', 'Dentro da perspectiva dos hormônios sexuais, os de maior ênfase são a testosterona, progesterona e estrogênio, pois atuam de diferentes maneiras no indivíduo. Este estudo tem como objetivo identificar e relatar qual a influência dos hormônios no desenvolvimento e amadurecimento sexual dos homens e das mulheres, incluindo uma comparação entre eles e o conhecimento popular sobre o assunto. Para o registro dessas pesquisas foram feitas entrevistas com o urologista Dr. Walter José Koff e a ginecologista e obstetra Dra. Rosana Perin Cardoso, e uma enquete com 102 jovens de 16 anos de idade do Colégio Santa Dorotéia, para descobrir o que eles sabem sobre a influência desses hormônios. Porém, foi observado que os adolescentes não possuem, em geral, um conhecimento acerca do assunto, uma vez que apenas 15% dos entrevistados sabiam algo em relação aos hormônios sexuais e a atuação deles no corpo, 4% tinham um conhecimento breve e 81% relataram que não compreendiam nada. Sobre as entrevistas feitas, viu-se que a testosterona tem função reprodutiva para a formação dos espermatozoides, aumenta a massa muscular, engrossa a voz, produz a agressividade, aumenta a libido, auxilia no estado físico e está ligada à produção da acne. Um dos efeitos colaterais da testosterona é a calvície, provocada pela falta do hormônio e no excesso de peso. Em referência aos hormônios sexuais femininos, a progesterona influencia no desenvolvimento do órgão genital feminino, no qual os ductos embrionários, por não sofrerem estimulação da testosterona, diferenciam-se em útero, ovários e genitália externa. Além disso, ela regula juntamente com o estrogênio o ciclo menstrual preparando o organismo para a gestação e para as alterações relacionadas a modificações na pele, cabelo, libido e humor. Portanto, a progesterona e o estrogênio determinam os aspectos femininos de depósito de gorduras dando um aspecto de curvas, a dispersão de pelos, a voz, os ciclos menstruais e, em decorrência, os sintomas de TPM.', NULL, NULL, '2018-08-08 16:13:02', '2018-09-20 19:47:07', 4, 2, 6, 5, true, NULL, 9.63749999999999929);
INSERT INTO public.projeto VALUES (146, 'TOI STUDIO, UM AMBIENTE VIRTUAL DE DIVULGAçãO DE ARTE', 'À medida que a era digital ganhava reconhecimento por todo mundo entre 1950 e 1970, o entendimento das tecnologias progressivas e de seus usos potenciais começou a tomar forma, incluindo seu uso para a criação e/ou divulgação de trabalhos artísticos. Embora não seja reconhecida como um movimento distinto, a arte digital continuará a evoluir conforme a tecnologia segue sua curva exponencial, tomando forma como uma alternativa plausível aos meios tradicionais de criação de arte em nossa sociedade.A divulgação online de um portfólio para artistas das áreas artísticas em geral não é trivial, pois na maioria dos casos, a apresentações dos trabalhos é feita de forma cronológica, com organizações baseadas no padrão de cada sistema, impossibilitando o usuário de apresentar todo seu trabalho da forma e ordem que deseja. Além disso, a publicação de trabalhos dessas áreas em sistemas virtuais traz o risco de plágio e de uso não autorizado do mesmo, ato que apesar de ser caracterizado como crime, dificilmente é reconhecido, já que a Internet não apresenta total segurança ao usuário, viabilizando que artistas digitais tenham uma das, senão sua principal fonte de renda, utilizada sem consentimento. Apesar das atuais plataformas disponíveis filtrarem os trabalhos dos artistas com alguns níveis de proteção, apenas informam os demais usuários que os direitos são reservados, ainda permitindo que outros usuários baixem os mesmos sem complicações. A proposta deste trabalho é oferecer um ambiente de compartilhamento e apresentação de arte para um diversificado leque de artistas, sendo eles pintores, desenhistas, ilustradores, modeladores 3D, designers gráficos e outros profissionais relacionados as artes digitais de cunho visual. Ambientes deste tipo, em geral não apresentam a possibilidade de o usuário aplicar marca d&#39;água em suas publicações.Esta característica, aumenta a segurança do usuário de que seu trabalho não será usado sem seu consentimento e atribuindo crédito ao trabalho', NULL, NULL, '2018-08-10 19:59:14', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7.875, 0);
INSERT INTO public.projeto VALUES (59, 'ROEDORES: FOCO NA ESPéCIE CTENOMIS FLAMARIONE', 'Nosso trabalho fala sobre os roedores, que são a ordem de mamíferos com placenta mais numerosa do mundo, reunindo mais de 2000 espécies. Nosso foco foi o roedor Tuco-Tuco das Dunas (Ctenomys flamarioni), uma espécie nativa do Rio Grande Do Sul. Essa espécie também pode ser chamada de Marmota dos pampas, curus-curus e ratos-de-pentes. Nós visitamos diversos sites mais especializados e isolamos os principais tópicos do nosso assunto, registrando-os no caderno de campo logo em seguida. Também assistimos entrevistas sobre o assunto no Youtube. Aprendemos que os tucos-tucos das dunas é uma espécie em grande risco de extinção, sendo que a maior causa das mortes de tuco-tucos é a urbanização. Descobrimos que não existe somente uma raça de tuco-tuco. Além disso, descobrimos que os tuco-tucos pertencem ao gênero Ctenomys, vivem em média em 4 a 8 anos tem cerca de 25 cm de comprimento, possuindo uma cauda curta. Sua dieta consiste em plantas rasteiras e raízes de algumas plantas. Seus predadores são as serpentes, os felinos, os cães selvagens e as aves de rapina. Com a ocupação de áreas urbanas, cachorros e gatos domésticos também viram uma ameaça ao Tuco-Tuco. O que mais nos impactou foi sabermos o que às vezes acontece com esse roedor, quando constroem calçadas na praia muitas vezes esses roedores não conseguem mais voltar para a superfície, pois moram debaixo da terra e como não tem forças o suficiente para cavar através da calçada ficando presos no solo até morrer.', NULL, NULL, '2018-08-07 14:41:58', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 4.125, NULL);
INSERT INTO public.projeto VALUES (133, 'DISPOSITIVOS COM ARDUINO PARA O CONTROLE DE ESTACIONAMENTO E CONDUÇÃO AUTOMOTIVA', 'DISPOSITIVOS COM ARDUINO PARA O CONTROLE DE ESTACIONAMENTO E CONDUÇÃO AUTOMOTIVA: Este projeto tem como objetivo criar dispositivos para auxiliar o controle e a identificação de vagas em um estacionamento e auxiliar o motorista tanto no momento de estacionar o carro como na identificação de obstáculos durante a condução pelo piloto automático. O trabalho, portanto, consiste em duas partes: a criação de um controle de vagas de estacionamento e a implantação de sensores automotivos, sendo que em ambas as partes faz-se uso do Arduino como componente essencial dos processamentos. O controle de vagas de estacionamento consiste em exibir aos motoristas a quantidade de vagas disponíveis e onde elas estão, facilitando e poupando tempo dos motoristas na procura pela vaga. Tal controle será exposto em um display externo que recebe os dados a partir de um sensor HC-SR04 (sensor de ultrassom) responsável por desligar o LED presente na vaga quando ela não estiver disponível, em um processo automatizado pelo Arduino Mega 2560. No que diz respeito aos sensores automotivos, um deles servirá como um sensor de ré que auxilia o motorista no momento de estacionar o carro, emitindo um “bip” através de um buzzer que varia a frequência conforme a distância que o veículo estiver da parede ou do obstáculo. Quando esta distância alcançar o limite e o veículo estiver muito próximo da colisão, o Arduino não permitirá que o motorista acelere o carro sem antes trocar a marcha. O sensor responsável por medir esta distância é o sensor HC-SR04 posicionado na traseira do veículo. Também será colocado um sensor para controle do piloto automático do veículo, quando esta função for acionada, a qual mantém o veículo a determinada velocidade sem a necessidade de o motorista acelerar o carro. Esses sensores, também do tipo HC-SR04, que serão acionados juntamente ao piloto automático, serão responsáveis por alertar o motorista – por meio de um buzzer – sobre qualquer obstáculo presente na estrada.', NULL, NULL, '2018-08-10 17:32:02', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 8.75, 7.68660714285714342);
INSERT INTO public.projeto VALUES (161, 'A PRESERVAçãO DO MEIO AMBIENTE COMEçA PELA GENTE', 'O presente trabalho objetiva mostrar que, apesar da consternação geral frente as notícias cada vez mais alarmantes sobre problemas ambientais (como aquecimento global e o lixo nos oceanos) dificilmente as pessoas se acham responsáveis por isto ou estão dispostas a fazer algo à respeito. Frente a isto, começamos a fazer observações no ambiente escolar, entendendo que este é um dos primeiro espaços que impactamos positiva e negativamente. Além de observações, registramos através de fotografias o cotidiano de destinação resíduos secos e orgânicos, a manutenção da limpeza das salas de aula e ambientes comuns da escola, bem como a preservação do patrimônio da escola. Também realizamos entrevistas com alunos, professores, equipe diretiva e funcionários sobre como os mesmos enxergam o cuidado com o ambiente escolar e quais são suas atitudes frente a isto. Os registros geraram um material tão interessante que a princípio resolvemos transformá-lo em um documentário homônimo ao projeto. Como a quantidade e qualidade do material foram surpreendentes, o projeto gerou uma série de pequenos documentários que buscam sensibilizar não apenas os alunos mas toda comunidade escolar.', NULL, NULL, '2018-08-10 21:11:48', '2018-09-20 19:47:07', 11, 3, 6, 5, true, NULL, 8.875);
INSERT INTO public.projeto VALUES (162, 'GELAB: APLICAÇÃO WEB DE GERENCIAMENTO DE ESTOQUE LABORATORIAL EM INSTITUIÇÕES DE ENSINO', 'O presente trabalho possui o objetivo de suprir algumas das necessidades encontradas por professores, alunos e técnicos de cursos relacionados às áreas de química e biologia quanto ao gerenciamento de produtos em estoque dos laboratórios de instituições de ensino. Para tal, propõem-se o desenvolvimento de um sistema Web que auxilie no controle e no compartilhamento destes produtos e informações. Entre os problemas encontrados, destaca-se a dificuldade no gerenciamento da quantidade e data de validade. Com o uso da aplicação, o usuário poderá cadastrar diversos itens utilizados nos laboratórios que faz parte em grupos para compartilhamento com outros membros da instituição. Além disso, o sistema permitirá a geração de relatórios sobre os itens cadastrados em cada grupo. O desenvolvimento do trabalho se dá a partir de uma abordagem qualitativa e de natureza aplicada. As técnicas de pesquisa utilizadas foram entrevistas e observação não participante, sendo realizadas com alunos e professores de cursos das áreas citadas anteriormente, e que estão em meio laboratorial com bastante frequência. Com os dados coletados, foi realizado o levantamento de requisitos do sistema. Como resultados parciais, devido ao fato de que o trabalho está em andamento, cita-se a implementação completa do cadastro e autenticação no sistema, criação de grupos, cadastro de produtos em um grupo, visualização de detalhes e informações e, por último, o destaque para produtos em quantidade baixa e/ou que passaram do prazo de validade.', NULL, NULL, '2018-08-10 21:18:40', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 4.4375);
INSERT INTO public.projeto VALUES (135, 'USANDO AS NOVAS TECNOLOGIAS PARA PROMOVER A ACESSIBILIDADE AOS ALUNOS SURDOS DO IFRS CAMPUS OSÓRIO', 'A língua brasileira de sinais é reconhecida por lei desde 2002, embora ainda exista dificuldade na comunicação entre ouvintes e surdos por falta do conhecimento de LIBRAS. A falta de acessibilidade, em áreas como educação, torna evidente a inferiorização, desqualificação e junto a exclusão de surdos em atividades. Portanto, outras maneiras de se comunicar em sala precisam ser mostradas, não limitando-se apenas ao intérprete. Diante disso, propomos usar a tecnologia para reduzir tal barreira promovendo a inclusão dos alunos surdos no ambiente escolar. Eles possuem dificuldades em relação a troca de períodos e intervalo, que é anunciado somente por sinal sonoro. Assim, o projeto se baseia nas dificuldades encontradas e na busca por solucionar esse impasse. O desenvolvimento do trabalho ocorre usando a plataforma de hardware Arduíno, combinando a programação e a pesquisa sobre surdez na educação. Assim, o projeto Novas Tecnologias visa um sistema capaz de sinalizar visualmente o toque do sinal para o intervalo, bem como a comunicação entre colegas e até mesmo o simples chamado do estudante pelo nome. Para isso, além do protótipo, pretendemos desenvolver um aplicativo para sua respectiva configuração, e para auxiliar o estudante surdo na comunicação. Os integrantes do projeto se dividem em dois grupos para o desenvolvimento das atividades, conforme disponibilidade. Os grupos se reúnem no turno inverso ao da aula, e reuniões quinzenais ocorrem às quintas-feiras, das 12h até 13h30min, para que todos possam participar debatendo as pesquisas e o andamento das atividades. O protótipo ainda está em fase de desenvolvimento. Porém, como resultado espera-se que permita a inclusão do aluno surdo, utilizando-se de tecnologias dentro do próprio ambiente escolar. Concluindo, o trabalho oportuniza aos participantes do projeto o aprendizado sobre a plataforma Arduíno, promovendo acessibilidade aos alunos surdos da própria instituição, e reduzindo a desigualdade em nossa comunidade.', NULL, NULL, '2018-08-10 18:24:22', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 7.23571428571428577);
INSERT INTO public.projeto VALUES (68, 'PROTóTIPO DE HARDWARE ABERTO PARA RECONHECIMENTO E AçãO COM OBJETOS -P.H.A.R.A.O.', 'O presente projeto tem como objetivo principal a adaptação da metodologia de projeto de um protótipo de robô de fins educacionais, para geração de um robô industrial utilizado na movimentação de objetos em fábricas. Deseja-se assim desenvolver um protótipo de veículo automatizado de transporte, capaz de realizar atividades de movimentação de materiais em processos de produção, em empresas de pequeno e médio porte e também em âmbito acadêmico. De forma a atingir os objetivos, pesquisas de cunho bibliográfico foram realizadas, visando um melhor entendimento de questões práticas e metodológicas associadas ao desenvolvimento de robôs. Durante o estudo, foram realizados testes e simulações de componentes mecânicos e eletrônicos, feitas primeiramente no robô educacional. Conta-se com a utilização de materiais reciclados para a construção dos elementos estruturais, bem como da infraestrutura do laboratório de fabricação mecânica (IFSUL), para a transformação da matéria prima. Utilizou-se neste projeto o laboratório de eletrônica para construção física de placas de circuitos eletroeletrônicos. Como o projeto trata da utilização de um robô com capacidade de carga definida, esta característica teve de ser avaliada de forma criteriosa, o que levou a equipe a desenvolver habilidades ao longo do período envolvido no projeto. Serão apresentados resultados de estudos de elementos finitos, para verificar características de carga máxima e deformações em aplicação de carga. Ainda estão sendo verificadas as competências do protótipo, tendo sua estrutura projetada, mas sujeita a alteração caso seja percebido algo que contribua ao melhoramento do protótipo.', NULL, NULL, '2018-08-07 16:06:50', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 9.22589285714285623);
INSERT INTO public.projeto VALUES (84, 'MINI BOBINA DE TESLA', 'O objetivo deste projeto é não apenas ensinar, mas demonstrar como a bobina de tesla ( no caso, em tamanho menor e mais simples) originalmente funcionava, de forma segura e prática. Tesla foi sem dúvida um dos maiores cientistas da história e contribuiu para o progresso da humanidade ao descobrir meios de utilizar a eletricidade sem o uso de fios. É importante honrá-lo e validar suas descobertas ao expressar os fenômenos elétricos envolvidos em sua bobina. São estes mesmos fenômenos que fazem parte do nosso dia a dia e, na maioria dos casos, nem notamos que acontecem ao nosso redor a todo o momento. A MINI BOBINA DE TESLA é constituída por um circuito simples, ligado a uma bateria de 25 a 32 volts, com duas principais bobinas: a primária e a secundária. Ela funciona como um transformador ressonante, podendo chegar a tensões elevadas na bobina secundária e, assim, criar um campo elétrico forte o suficiente para ionizar o ar. Estas tensões serão devidamente manipuladas, a fim de garantir a segurança tanto dos autores quanto das pessoas que estiverem analisando o projeto. Planejamos, de início, formar raios pequenos de um centímetro, apenas para a experiência ser mais completa para quem estiver observando. Variados fenômenos elétricos podem ser percebidos, como a criação de campo elétrico e campo magnético. Utilizaremos uma lâmpada fluorescente ( também inventada por Tesla!) para mostrar como os gases dentro dela são excitados pelo campo que a bobina secundária produz e assim, ela acende. Esperamos, por fim, que o trabalho incentive as pessoas a pesquisarem mais sobre a eletricidade que nos rodeia e que consiga incentivar a curiosidade em busca de mais conhecimento sobre o assunto.', NULL, NULL, '2018-08-08 20:50:45', '2018-09-20 19:47:07', 4, 2, 6, 5, true, NULL, 8.70625000000000071);
INSERT INTO public.projeto VALUES (32, 'MEGA CIDADÃO – UM APLICATIVO EM BENEFÍCIO DA CIDADANIA', 'Estudos demonstram o crescimento de exposições e cobranças à gestão pública através do avanço da internet e das redes sociais. A partir deste contexto surgiu a ideia de criar um ambiente que permitisse a exposição destas questões, onde os usuários tenham liberdade para reclamar e serem ouvidos, bem como possam interagir com o poder público e visualizar as reclamações de outros usuários. Este projeto, denominado Mega Cidadão, decorre de um trabalho de conclusão de curso Técnico em Informática para Internet e busca melhorar a forma de comunicação entre comunidade e prefeitura, provendo um espaço que permita o exercício da cidadania. Tem por objetivo oferecer um ambiente acessível e prático para os cidadãos do município de Gravataí registrarem demandas direcionadas à prefeitura, através de um aplicativo Android. Por intermédio destas tecnologias, verifica-se a oportunidade de transformar a comunicação entre município e cidadão em algo intuitivo e viável a todos. A iniciativa ainda encontra-se em desenvolvimento e, por conta disto, estão disponíveis, no momento, alguns módulos do aplicativo proposto. Pretende-se, em breve, a disponibilização de um protótipo para alguns voluntários, de forma a validar as premissas da proposta. Este trabalho, inicialmente, está sendo criado para atender solicitações relacionadas à Secretaria de Obras Públicas do município de Gravataí, que é um órgão bastante demandado nas redes sociais pela gama de serviços sob sua responsabilidade. No cronograma de desenvolvimento do trabalho estão previstos contatos com a prefeitura, de forma a apresentar o projeto e colher sugestões para o aplicativo. É estudada a possibilidade do escopo do aplicativo ser estendido a outras secretarias, como Saúde, Educação, Serviços Urbanos e Cultura, Esporte e Lazer.', NULL, NULL, '2018-08-03 10:05:47', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 0);
INSERT INTO public.projeto VALUES (130, 'TÔMPERO - UMA FERRAMENTA DE VISIBILIDADE, ANÁLISE E FOMENTO DE CONSUMO NO SETOR DE ALIMENTAÇÃO FORA DO LAR', 'Segundo dados do Sebrae, 99% das empresas são de micro e pequeno porte. Sendo quase metade familiares e de grande maioria no setor de alimentação, elas aumentaram a participação na geração de empregos e receita. Neste contexto, o mercado de Alimentação Fora do Lar tem sido responsável por movimentar bilhões de reais no Brasil. Dados como estes evidenciam que é um setor que merece atenção, dado seu papel econômico e social na geração de empregos. Neste sentido, ferramentas e ações que ajudem no seu crescimento com a implementação de tecnologias acessíveis em termos de custos e utilização, que auxiliem, facilitem e modernizem estabelecimentos não são só benvindos, como necessários. O presente trabalho busca criar uma ferramenta mobile com interface web de análise de hábito de consumo, integrada ao consumo gratificado estimulando seu crescimento e alcance do setor em empresas de micro a pequeno porte, que na maior parte dos casos, ainda não informatizadas e, portanto, não aparelhadas para usufruírem dos benefícios tecnológicos tanto nas suas rotinas de gestão quanto para atenderem, prospectarem e fidelizarem clientes. A metodologia envolveu pesquisas de caráter exploratório, limitação de área geográfica e levantamento bibliográfico em marketing, economia e estatística; e análise de tecnologias para implementação das funcionalidades previstas. Na dimensão tecnológica, recorre a conceitos de processamento de dados e cloud computing, para possibilitar a transformação de dados em informação e portabilidade da aplicação, afim de disponibilizar análises, gráficos e tendências de consumo. O produto proposto auxiliará essas empresas a atualizarem-se quanto às possibilidades de expansão econômica, por meio do acesso a informação, possibilitando entender melhor seu público e ser mais assertiva em promoções, conquistando e mantendo relação com clientes, contribuindo, portanto, com a sustentabilidade e crescimento, tanto em termos econômicos quanto de empregabilidade.', NULL, NULL, '2018-08-10 16:53:25', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 0);
INSERT INTO public.projeto VALUES (159, 'PáTIO DE EXPERIMENTOS', 'Relógios solares já muito usados foram perdendo sua utilidade, para a maioria dos casos, ao longo dos anos de sua existência. Porém, sua presença ainda é muito bem-vinda como objeto de decoração, curiosidade e estudo sobre o movimento do Sol para pessoas que tem interesse na área das ciências. O relógio de Sol apresenta a hora do nascer do Sol até o pôr do Sol. No passado, os relógios e seus diferentes modelos eram usados, junto com as observações astrais, para a construção de calendários. Neste projeto apresentaremos o funcionamento de um relógio Solar equatorial. Sua construção será em bom tamanho e com materiais perecíveis. Este tipo de relógio tem seu disco com as horas sempre paralelo com a linha do equador e seu gnômon, ou ponteiro, é perpendicular ao eixo de rotação terrestre. O relógio solar equatorial pode ser usado em qualquer latitude, desde que o gnômon esteja apontando para o polo celeste do hemisfério local e a placa do seu mostrador esteja em um ângulo com sua superfície horizontal igual a colatitude. Dessa forma, ao orientar o relógio proposto é necessário a determinação da direção norte-sul local. Para tal, vamos demarcar sobre um piso horizontal a sombra projetada por uma estaca posicionada verticalmente no momento do meio dia solar. Esta marcação é a direção norte-sul naquele local. Além da direção norte-sul, precisamos ainda conhecer a latitude local. Diferentemente do passado, o uso de relógios Solares equatoriais, são importantes para compreender o movimento diurno e anual do Sol para o aproveitamento da energia solar diretamente em arquitetura de casas e prédios, na colocação de placas fotovoltaicas ou de placas coletoras para aquecimento direto da água. Pois a forma como construímos casas e prédios e como posicionamos as placas para absorção da energia solar determina a eficiência do sistema instalado. A proposta de desenvolver um estudo e confeccionar um relógio de Sol faz parte do projeto de ensino do Pátio de Experimentos do Campus Canoas.', NULL, NULL, '2018-08-10 21:03:03', '2018-09-20 19:47:07', 4, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (39, 'PRESSÃO HIDROSTÁTICA', 'Este trabalho versa sobre a pressão hidrostática, isto é, a força que as moléculas de líquidos exercem umas sobre as outras, devido à atração gravitacional da Terra. Nosso objetivo com esse projeto é demonstrar, através da intensidade dos jatos d’água que variam com a profundidade, como a água resiste à pressão de um determinado objeto. Para realizar essa demonstração, utilizamos os seguintes materiais: 4 metros de cano PVC 25mm, 8 seringas de 20ml, 20 braçadeiras de nylon e 2 metros de mangueira siliconada de 4mm. Quanto à metodologia, procedemos desta forma: construímos um robô, cuja base foi feita com alguns canos de PVC; logo após, montamos a garra do robô também com cano de PVC fazendo a conexão com joelhos de PVC; com toda a base pronta, fizemos furos em determinados lugares para a colocação das seringas e da mangueira; por fim, colocamos água nas seringas (mas não as enchemos) e fizemos o sistema de controle do nosso robô, o qual também foi feito com cano de PVC e seringas. Com este experimento, obtivemos o resultado desejado: o robô funciona somente com a pressão hidrostática. E chegamos à conclusão de que, dependendo da pressão sofrida, a água sofrerá a mesma, apenas com uma variação na pressão. Isto é, se colocarmos pressão total na mangueira, a água terá a mesma pressão, como se fosse a mangueira do nosso pátio, pois se abrirmos muito o registro a pressão para a água sair será maior e então ela virá com força total.', NULL, NULL, '2018-08-05 22:19:38', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (195, 'DOENçAS E ESTIGMAS SOCIAIS: ONTEM E HOJE', 'O propósito deste trabalho é abordar as representações sociais de doenças como Hanseníase, Peste Negra e AIDS, destacando a perspectiva geral da sociedade, seus sentimentos e suas manifestações contraditórias despertadas pelas doenças. A principal razão do desenvolvimento da pesquisa centra-se no fato de que, as relações entre as enfermidades e o preconceito, embora já muito combatidas, ainda persistem, e constituem um sério entrave no controle de algumas enfermidades. Entende-se a relação entre estigmas sociais e portadores de doenças, como um problema relacionado à falta de esclarecimentos. A conscientização constitui um passo importante para a melhora na vida dos enfermos. Para atingir os objetivos propostos, entrevistamos profissionais da saúde e investigamos a história das doenças citadas: onde e quando surgiram, locais de incidência, segmentos sociais mais afetados, etc. Paralelamente, elaboramos um questionário online sobre as enfermidades e o divulgamos na escola, com o objetivo de observar os pensamentos da comunidade e trazer reflexões a partir desses resultados. Por fim, estamos escrevendo um artigo que será apresentado em universidades portuguesas, na ocasião em que realizaremos um intercâmbio naquele país, ainda esse ano. Como síntese geral, pode-se afirmar que existe a necessidade de trabalhar a temática da diversidade e do preconceito com mais frequência no espaço escolar, ampliando-se a forma de olhar, entender o diferente/a diferença, seja ela qual for.', NULL, NULL, '2019-07-21 11:57:58', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 6.5, NULL);
INSERT INTO public.projeto VALUES (348, 'INVASãO DA POLôNIA - O MASSACRE DE KATYN', 'O tema O Massacre de Katyn foi escolhido após uma pesquisa geral em relação a Invasão da Polônia, que se iniciou em 1939. Esse massacre, embora muito pouco conhecido, foi uma atrocidade cometida pelos soviéticos, que, além de terem matado 22000 soldados poloneses, descartaram os corpos dos soldados e omitiram a verdade do mundo. Os soldados alemães, em 1943, encontraram os corpos e acusaram os soviéticos do ocorrido, mas por conta dos acontecimentos envolvendo a Alemanha na época, os soldados alemães foram responsabilizados pelo massacre. O fato dessa fatalidade ser tão pouco conhecida e mal explicada nos motivou a dar início a esse projeto de pesquisa, e levantamos a seguinte questão: como o cinema representou o Massacre de Katyn? Tivemos como objetivo geral compreender como o cinema representou o Massacre de Katyn e como objetivos específicos investigar o tema com maior profundidade e entender porque esse massacre aconteceu. Com isso encontramos o filme Katyn, do diretor Andrzej Wajda, que retratou com fidelidade o ocorrido na floresta de Katyn em 1941 - esse compromisso em mostrar a verdade se dá por conta de que o pai de Wajda era um dos soldados poloneses assassinados no massacre. Além do filme, utilizamos outros meios de pesquisa, as principais obras consultadas foram os livros A História do Século XX (GILBERT, 1997); Segunda Guerra Mundial (RIBEIRO, 2003); Seis meses em 1945 (DOBBS, 2015) e História: Novos Objetos (FERRO, 1976). O livro de Marc Ferro nos apresenta o método de pesquisa: como utilizar filmes como fontes primárias e como foi difícil o processo de credibilidade desse tipo de metodologia no mundo da pesquisa. Foi concluído que os reais culpados pelo Massacre de Katyn foram os soviéticos e que essa fatalidade impopular e essa verdade revelada precisam ser apresentadas para as pessoas. E para termos uma noção, somente em 2010, sessenta e nove anos depois do massacre, a Rússia assumiu a responsabilidade, enquanto soviéticos, sobre o genocídio.', NULL, NULL, '2019-08-11 23:20:15', '2019-09-19 14:17:24', 3, 2, 7, 5, true, 9.5, 9.32499999999999929);
INSERT INTO public.projeto VALUES (164, 'GERADOR ELEMENTAR PARA APLICAçõES DIDáTICAS', 'Aliar teoria e prática é imprescindível no processo de ensino-aprendizagem, pois, principalmente em cursos técnicos é notório que somente a teoria sem uma aplicação didática prática da matéria, torna o aprendizado menos eficiente. Isso não é diferente em cursos que envolvem eletricidade, onde são essenciais conhecimentos sobre princípios de geração de energia e eletromagnetismo, dos quais aulas práticas são indispensáveis. Desta forma, o presente projeto visa a construção de um gerador elementar para ser usado em aulas práticas referentes a estes conteúdos. O gerador elementar demonstra com clareza estes fenômenos, já que o mesmo transforma energia mecânica em energia elétrica, a partir da movimentação de ímãs de neodímio que interagem com bobinas elétricas. O projeto conta com seu primeiro protótipo já modelado, detalhado e construído junto a bobinas elétricas estrategicamente diferentes, o que proporciona variados testes. O protótipo e as bobinas foram construídos pelos alunos e também autores do projeto, juntamente ao orientador e o coorientador do mesmo. As atividades de prototipagem foram realizadas no laboratório de mecânica do IFSul – câmpus Sapiranga, e dentre os materiais utilizados temos madeira, aço, alumínio, plástico e cobre. Sendo assim, agora se tem em vista efetuar cálculos comparativos às práticas, aperfeiçoar o primeiro protótipo de gerador, a criação de novos geradores com propostas diferentes, a divulgação do projeto em feiras, e o uso do gerador, já concluído, em aulas de eletricidade no câmpus Sapiranga e, se possível, também em outros câmpus de Institutos Federais, a fim de levantar dados sobre o rendimento acadêmico dos alunos antes e depois da implantação do projeto.', NULL, NULL, '2018-08-10 21:33:31', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 8.75, 8.66696428571428612);
INSERT INTO public.projeto VALUES (147, 'TERRITóRIOS NEGROS DE CANOAS: UM ROTEIRO PELOS PONTOS DE REFERêNCIA DA POPULAçãO NEGRA NA CIDADE', 'O presente trabalho apresenta um roteiro dos territórios negros de Canoas. Enquanto território negro, compreende-se todo espaço da cidade apropriado, qualificado, marcado pela presença de grupos negros, ainda que não exclusivamente. O objetivo da pesquisa desenvolvida é criar um roteiro dos pontos de referência da população negra em Canoas. Sendo assim, primeiramente foi realizada uma pesquisa bibliográfica sobre o conceito de territórios negros e sobre a origem da população negra em Canoas. Como a pesquisa ainda está em andamento, neste momento estão sendo realizadas entrevistas com pessoas ligadas ao movimento negro de Canoas. Com esses dois procedimentos, estão sendo mapeados os espaços marcados pela presença negra na cidade utilizando o aplicativo Google Maps. Como esse processo não foi finalizado, o roteiro ainda não se encontra fechado. Mas, considerando a geografia de Canoas, já é possível indicar que o percurso iniciará no Quilombo Chácara dos Rosa, o primeiro quilombo urbano a ser reconhecido no Brasil, e se encerrará na Praia do Paquetá, um local importante para as religiões de matriz africana da região. Quando a fase de mapeamento dos territórios for finalizada será possível produzir a versão final do roteiro, que será apresentado à prefeitura municipal a fim de que se torne um projeto cultural e educativo. Assim, percorrer por esses espaços pode ser uma maneira de valorizar e de manter viva a história e a cultura afro-brasileira na cidade.', NULL, NULL, '2018-08-10 20:21:59', '2018-09-20 19:47:07', 11, 3, 6, 5, true, NULL, 2.89999999999999991);
INSERT INTO public.projeto VALUES (45, 'A BIPOLARIDADE FORA DO SENSO COMUM', 'Segundo a Organização Mundial da Saúde (OMS), já passa de 60 milhões o número de afetados pelo Transtorno Bipolar, que caracteriza uma condição psicológica cujos sintomas consistem em alterações de humor durante os episódios de mania e depressão, podendo, entre eles, existir períodos assintomáticos. O portador do distúrbio apresenta crises com duração a partir de quatro dias até uma semana (tipo II) ou de um período indefinido, podendo se estender a meses ou anos (tipo I). Tais crises interferem diretamente no comportamento, sono, fome e qualquer relação interpessoal ou profissional do indivíduo. Entretanto, o conceito real difere do popular disseminado ao longo dos anos, uma vez que se costuma utilizar a denominação “bipolar” para definir pessoas de fácil irritabilidade ou personalidade flexível. Assim, acontece a banalização da enfermidade em si, ação que gera pré-julgamentos e dificuldades desnecessárias no processo de aceitação e tratamento daquele afetado pela mesma. Nesse quadro, faz-se necessária a quebra do paradigma que classifica como menos grave ou importante qualquer caso de alteração psíquica, de modo que o amparo da família ou amigos esteja sempre disponível, juntamente com o apoio; esse, extremamente valoroso à terapia. Para tanto, realizou-se uma pesquisa bibliográfica e entrevista com dois profissionais da área da saúde, sendo uma psicóloga, Andressa Pastoris, e um professor universitário de psicologia, Tárcio Soares, além da averiguação da opinião com um público de diferentes faixas-etárias, totalizando 100 pessoas. Então, pôde-se confirmar a insciência de 83% dos entrevistados através de perguntas simples a tratar do conhecimento próprio e experiências do tipo, mesmo dos que possuíam alguma de vivência nesse meio. Sendo assim, mostra-se indispensável a disseminação de informação sobre o transtorno, sabendo que o equívoco acarreta complicações à vida em sociedade.', NULL, NULL, '2018-08-06 18:53:08', '2018-09-20 19:47:07', 4, 2, 6, 5, true, NULL, 9.31071428571428683);
INSERT INTO public.projeto VALUES (333, 'BOBINA DE TESLA', 'Neste projeto pretende-se construir uma Bobina de Tesla para demonstração de propriedades dos campos elétricos, magnéticos e eletromagnéticos. Os materiais para a confecção da bobina e do seu circuito de acionamento são de baixo custo e fácil aceso, visto que, para a base da bobina será utilizado uma caixa de papelão ou madeira e cano de PVC que vão atuar como materiais isolante, fios de cobre esmaltados de diferentes diâmetros para as bobina, resistores, transistor, interruptores, fios de diferentes cores para o circuito, bateria, conector de bateria, etc. Na bobina consta dois enrolamentos, um primário de poucas espiras de um condutor de maior diâmetro e um secundário com muitas espiras de um fio mais fino. Desta forma se consegue gerar tensões elevadas e, com elas, produzir descargas elétricas ou faíscas entre terminais condutores com forma esférica. Também será gerado no eixo central das bobinas e próximo delas um campo magnético elevado que será demostrado com uma lâmpada fluorescente que deverá ascender apenas com a presença desse campo, quando colocada próxima da bobina. Outra forma de demostrar a presença do campo magnético poderá ser através de líquidos com propriedades ferromagnéticas. Para isso será escolhido uma base líquida viscosa, que poderá ser um óleo ou gel na qual será dissolvido um material com propriedades magnéticas como o pó de toner das impressoras a laser. Esse líquido deverá reagir as variações do campo magnético, mudando a sua forma. Foi utilizado neste projeto como referência a pesquisa feita por BARRETO (2014) e também vídeos relacionados ao tema, que servirão de motivação do projeto.', NULL, NULL, '2019-08-10 22:41:50', '2019-09-19 14:17:53', 7, 2, 7, 5, true, 7.375, 0);
INSERT INTO public.projeto VALUES (145, 'SEGUNDA GUERRA MUNDIAL: O ASSALTO DO EXÉRCITO VERMELHO A BERLIM', 'Este trabalho aborda a Segunda Guerra Mundial, delimitando como tema o assalto do Exército Vermelho a Berlim, para um melhor entendimento dos fatos ocorridos no ano de 1945, em especial após as ordens de Stálin para o Exército Vermelho capturar a capital alemã. A presente pesquisa traz em seus detalhes como a Alemanha se encontrava devastada e enfraquecida. O problema de pesquisa tem enfoque em perceber como a imprensa brasileira retratou o assalto do Exército Vermelho a Berlim, que acaba se tornando uma das principais notícias da mídia brasileira, tendo como objetivo entender como a imprensa brasileira noticiou o assalto e analisar a importância do Exército Vermelho na Grande Guerra Patriótica e o desfecho dos acontecimentos na época, além de destacar a importância da União das Repúblicas Socialistas Soviéticas para a queda do nazismo. Para a melhor desenvoltura da presente pesquisa realizamos uma ampla pesquisa bibliográfica dos livros que contam a Segunda Guerra Mundial com o intuito de nos familiarizarmos com o ocorrido. Para a realização do artigo, utilizamos como fonte primária os jornais Diário de Notícias e Correio da Manhã, do estado do Rio de Janeiro, que expressam a vulnerabilidade da Alemanha, a agilidade de Stálin para a posse da capital alemã, os avanços do Exército Vermelho e dos exércitos aliados e os esforços do Exército Vermelho para a queda do Führer Adolf Hitler. Temos como objetivo levar esse assunto que é pouco discutido no meio escolar e prover debates em prol da história.', NULL, NULL, '2018-08-10 19:45:25', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 8.375, 0);
INSERT INTO public.projeto VALUES (134, 'O ESPORTE PARA ALÉM DA COMPETIçãO', 'A presença do esporte na sociedade moderna é uma história repleta de tensões. Sua presença na escola também é resultado de planos e intentos, dada sua adequação ao projeto de formação de homens aptos à disputa numa sociedade em que a alegria e a felicidade não estão disponíveis para todos. Tendo esses pressupostos teóricos, e ético-políticos, como ponto de partida desenvolvemos o projeto de extensão denominado “O Esporte para além da competição”, prevendo organizar eventos esportivos no interior do Câmpus Canoas tendo, como objetivo geral, oportunizar à comunidade interna e externa do Campus momentos de socialização, de atividade física, de lazer, de integração e de prazer, através da prática esportiva priorizando nesta as características lúdicas. Além deste, como objetivos específicos, o referido projeto procura possibilitar à todos os participantes a reflexão, a compreensão e a vivência dos diferentes sentidos e significados atribuídos à prática esportiva no tempo livre. Assim, organizamos o primeiro evento denominado “Brincando de Jogar”, em 09/06/2018, durante toda a manhã, no pátio do Câmpus. A organização do evento aconteceu de forma sistemática e participativa, através de reuniões semanais entre o orientador e a aluna bolsista. Na construção do regulamento é possível ressaltar como ponto significativo o fato de não se adotar árbitros para nenhuma modalidade oferecida. Esse critério favoreceu o entendimento de que, para além da vitória, o mais importante era o jogo “ter graça” para todos os participantes; ou seja, a socialização e a alegria de jogar deveriam ser as únicas vencedoras a priori. Relatos dos participantes do evento, como por exemplo: “ficou um gostinho de quero mais” (aluna); “quando terá outro? (aluno); “muito bom o evento” (pai); “fazia tempo que não brincava assim” (professor); apontam, em nosso entendimento, que os objetivos do referido projeto foram alcançados.', NULL, NULL, '2018-08-10 18:23:50', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 9.5, 7.89732142857142883);
INSERT INTO public.projeto VALUES (151, 'S.C.A.VE. – SOIL COLLECTOR AUTOMATED VEHICLE', 'A atividade do setor agrícola do brasil é uma das mais importantes para a economia do país, tendo assim um forte papel na produção em larga escala com almejo de comércio nacional e internacional, gerando números significativos no controle do Produto Interno Bruto - o valoroso PIB. Assim, grandes empresas do setor de mecanização da agricultura, estão instaladas no país. Empresas como John Deere e Massey Fergusson possuem plantas instaladas no estado do RS, alavancando a produção na região. Destaca-se que a ineficiência técnica no processo de produção agrícola bem como o trabalho manual inadequado para cada tipo de solo influenciam de forma negativa os processos de cultivo, ocasionando diversos problemas nos meios de produção. Neste viés enquadra-se, por exemplo, a amostragem ou coleta das amostras de solo, futuramente destinadas a análises químicas detalhadas a fim de identificar e quantizar as substâncias presentes no terreno que alteram fatores como o pH local e são fundamentais à designação correta do processos de adição de nutrientes em escassez, visando o balanceamento químico-nutricional indicado à plantação. O projeto S.C.A.Ve. – Soil Collector Automated Vehicle - propõe um estudo de forma a identificar e solucionar a carência de conhecimento da região onde se deseja produzir, através da aplicação de meios tecnológicos associados a coleta de solo. Neste tocante, o objetivo principal deste estudo é desenvolver um robô autônomo destinado mover-se em uma região agrícola executando a tarefa de coleta e identificação de amostras de solo, que posteriormente serão destinadas a análise laboratorial.', NULL, NULL, '2018-08-10 20:28:50', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 8.44375000000000142);
INSERT INTO public.projeto VALUES (160, 'OS LANCEIROS NEGROS NA GUERRA DOS FARRAPOS', 'O presente trabalho aborda uma pesquisa sobre a Guerra dos Farrapos, em especial os Lanceiros Negros. Como a história desse grupo de farrapos é muitas vezes esquecida, nosso grupo se interessou em conhecer mais sobre a participação dos negros na Guerra dos Farrapos. A pesquisa realizada teve como objetivo informar as pessoas como toda a história dos Lanceiros Negros aconteceu. Para atingir esse objetivo, nosso grupo realizou uma pesquisa bibliográfica em sites da internet e em livros a fim de conhecer a história desse grupo. E, para contar a história para as pessoas, estamos no processo de construção de uma maquete. Como a pesquisa ainda está em andamento, não temos resultados explícitos para poder apresentar conclusões, mas esperamos que as pessoas conheçam mais sobre essa história através do nosso trabalho.', NULL, NULL, '2018-08-10 21:03:23', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 8.125, 7.63750000000000018);
INSERT INTO public.projeto VALUES (61, 'PLANETAS HABITáVEIS: SISTEMA KEPLER 90 E MARTE', 'Ao longo do tempo nós pesquisamos outros planetas e sistemas que poderiam ser habitados. Nós escolhemos esse assunto porque queremos descobrir o que o ser humano irá fazer quando não irá poder viver mais na terra. Participar do grupo de iniciação científica foi o que nos motivou a pesquisar. Nós desenvolvemos a pesquisa com a ajuda da internet e vários vídeos do Youtube também nos encontramos para fazer o trabalho e várias pesquisas. No desenvolvimento da pesquisa descobrimos que a NASA anunciou a descoberta do sistema solar de KEPLER-90, que é composto por 8 exoplanetas, alguns semelhantes a planetas existentes em nosso sistema solar. Esse sistema está localizado a 2.500 anos luz da terra então não seria muito possível nós viajarmos até lá. A NASA diz que Marte não pode ser naturalmente habitável, mas o ser humano pode transformar Marte em um planeta habitável. Para isso Marte deve passar por um processo de terraformação, que é um processo que modificaria a atmosfera desse planeta para que pudéssemos viver lá. Nossa maior descoberta ao longo da pesquisa foi sobre a existência sistema solar de Kepler e como seria a mudança na atmosfera de Marte para que pudéssemos habitar esse planeta.', NULL, NULL, '2018-08-07 14:52:43', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (235, 'CHUVEIRO MICROCONTROLADO', 'De extrema popularidade nos lares brasileiros, os chuveiros elétricos são os mais estimados. Muitas vezes tido como o principal vilão na hora de economizar energia, principalmente no inverno, acaba-se por ignorar que as duchas tendem a ser muito mais eficientes e econômicas que outros sistemas de aquecimento. Entretanto, para juntar bom desempenho e economia, é necessário realizar uma boa escolha na hora da compra do produto, respeitando as orientações de uso do fabricante além de submeter-se às especificidades do produto na hora da instalação. Posto isto, o projeto tem como objetivo automatizar o funcionamento de um chuveiro elétrico, visando a redução de consumo de luz e consequentemente auxiliando na utilização do mesmo de forma consciente. Mediante a programação desenvolvida com o uso do módulo Esp8266, será permitida a comunicação Wi-fi entre um aplicativo para smartphone e o microcontrolador, de forma a poder temporizar a passagem de corrente ao chuveiro, além de um aviso luminoso (baseado no percentual de tempo de uso decorrido), um sensoriamento de presença, que de acordo com o tempo de ausência do usuário, irá bloquear a passagem de corrente ao chuveiro, e a existência de um tempo mínimo entre banhos, que será escolhido pelo usuário com base nos tempos disponíveis no aplicativo. O projeto deverá auxiliar na economia de energia por meio da função primordial de controle de tempo, temporização, que será auxiliada por funções de apoio. Entre os quais, se encontra o bloqueio de funcionamento da energia entre banhos, proveniente de um tempo mínimo definido pelo usuário por meio do aplicativo pelo smartphone. Por intermédio do aplicativo “ChuveiroMicrocontrolado”, estará disponível a função de escolha de tempo do banho, do tempo bônus e de tempo mínimo entre banhos, para assim evitar que o usuário ligue o chuveiro logo após a conclusão do tempo estabelecido, burlando assim o objetivo de economia do mesmo.', NULL, NULL, '2019-08-07 21:02:27', '2019-09-17 16:12:00', 7, 2, 7, 2, NULL, 9.75, NULL);
INSERT INTO public.projeto VALUES (363, 'A GUERRA DAS CORRENTES: A BATALHA ENTRE DOIS MAGOS QUE DEU ORIGEM A ERA ELÉTRICA', 'Este trabalho tem como objetivos: Relacionar as contribuições de Tesla e Thomas Edson para a revolução energética, ou seja, a era elétrica. Identificar os tipos de correntes citando as vantagens e desvantagens de sua utilização. Explicar como esta batalha afetou o sistema elétrico brasileiro. A justificativa para que seja desenvolvido o mesmo deve-se ao fato de que atualmente é impossível conceber um mundo sem eletricidade, mas nem sempre foi assim. Muitos cientistas trabalharam incansavelmente entre o final do século XIX e o início do século XX, período de grandes descobertas e inventos nesta área. Nikola Tesla e Thomas Edison são importantes personagens desta história, em seus laboratórios surgiram inventos que mudaram a realidade da época e ditam hábitos até agora. Assim entendemos que a famosa “Guerra das Correntes”, travada entre eles, trouxe inúmeros benefícios à sociedade. Inicialmente, foi feito um estudo da história da eletricidade e magnetismo anterior aos dois cientistas. Através de pesquisa e leitura de livros e artigos, entre outros, disponíveis eletronicamente na WEB. Tendo como foco estabelecer as relações entre os trabalhos desenvolvidos, que relatam da origem das observações dos primeiros fenômenos elétricos e magnéticos, até o final do século XIX e início do século XX, a aplicação na indústria da geração elétrica. Também pesquisamos como o sistema elétrico brasileiro foi afetado por esta batalha. A seguir passamos em sala de aula um documentário sobre a guerra elétrica e após solicitamos aos colegas que fosse respondido um questionário sobre o tema com objetivo de avaliarmos o conhecimento da turma sobre o assunto. Os resultados indicam que o nível de conhecimento era baixo porem após apresentação da pesquisa este aumentou significativamente. Como conclusões podemos dizer que: A popularização e disseminação da iluminação, por meio da lâmpada elétrica, foi apenas uma parte de toda a revolução.', NULL, NULL, '2019-08-14 17:37:29', '2019-09-17 16:12:00', 4, 2, 7, 2, NULL, 7.375, NULL);
INSERT INTO public.projeto VALUES (307, 'TRILOGIC: UM AMBIENTE DE ENSINO DA LóGICA DE PROGRAMAçãO PARA ALUNOS OUVINTES E NãO OUVINTES', 'A lógica de programação é essencial para aqueles que desejam ingressar na área de informática, sendo responsável pelo entendimento de qualquer linguagem de programação, assim, sua compreensão tem reflexos na aprendizagem do aluno em novos conteúdos. Contudo, cerca de 60% das retenções no curso estão relacionadas à essa disciplina (Rocha, 2010). Tendo em vista os índices de retenção citados, o projeto de pesquisa denominado, Uso de Técnicas de Gamificação como Auxílio ao Ensino e Aprendizagem de Lógica de Programação, desenvolveu um ambiente intitulado TriLogic. O mesmo conta com atividades lúdicas, visando a compreensão da matéria. O projeto obteve aprovação de 90,9% dos alunos que o utilizaram e um maior rendimento na matéria. No entanto, o mesmo acaba não abrangendo alguns estudantes, os alunos não ouvintes, incapazes de usufruir do ambiente TriLogic devido a sua condição auditiva. Esses alunos tem como primeiro idioma a Língua Brasileira de Sinais, logo, as atividades propostas se tornam pouco acessíveis a eles, em razão da dificuldade em compreender o português escrito. Diante das melhorias proporcionadas pelo projeto, foi pensado em ampliar o ambiente, o tornando acessível a alunos não ouvintes, a partir da utilização da Suíte Vlibras, responsável por realizar a tradução dos textos didáticos presentes no TriLogic com o auxílio de um intérprete 3D para interação com o usuário. Logo, o objetivo estabelecido pelo projeto foi de promover a adequação do ambiente TriLogic de forma a atender, além de alunos ouvintes, os alunos não ouvintes. Através da interação direta com o objeto de estudo, resultado da participação como bolsista no projeto TriLogic, foi possível estar a par de aspectos mais específicos do mesmo. Com as novas funcionalidades, o ambiente será disponibilizado à intérprete de Libras do campus Canoas. A partir de sua utilização, serão indicados pontos a serem melhorados para que, adiante, sejam resolvidos e o ambiente disponibilizado ao usuário final.', NULL, NULL, '2019-08-10 14:54:54', '2019-09-17 16:12:00', 6, 2, 7, 2, NULL, 6.75, NULL);
INSERT INTO public.projeto VALUES (51, 'O QUE NOS DIFERENCIA DOS OUTROS ANIMAIS? FOCO NA VISãO E ALIMENTAçãO', 'Pesquisamos as características que diferenciam a visão do ser humano da visão de outros animais. Esse assunto foi escolhido, pois gostaríamos de entender melhor como é a visão da hamster da Ana Luiza. A pesquisa foi feita em sites e consultando a professora. Sobre a visão pesquisamos que as abelhas conseguem ver tonalidades quase imperceptíveis para o ser humano, além de verem raios ultravioleta que os ajudam a voltar para as colmeias. Já as águias são capazes de enxergar um pequeno animal como um rato caminhando pelo mato, como a águia de asa redonda que enxerga a cinco mil metros de altura. Os macacos não tem uma definição exata de como é sua visão pois varia dependendo da sua espécie, sendo que a maioria deles é tricromata, significa que enxergam apenas vermelho, verde e azul. Nós percebemos que a visão do ser humano para os animais é muito diferente. Também aprendemos com a teoria evolutiva defendida pela bióloga Suzana Herculano-Houzel, que a nossa dieta composta por alimentos cozidos ajudou o nosso desenvolvimento cerebral. A partir do que descobrimos sobre as diferenças na maneira de enxergar, pesquisamos uma hipótese evolutiva que diferencia a consciência da vida do ser humano de outros animais. Graças à prática de cozinhar os alimentos nossos ancestrais conseguiram superar a barreira energética que mantém outros primatas e demais mamíferos limitados a números bem menores de neurônios.', NULL, NULL, '2018-08-07 14:00:13', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (42, 'TREM ELETROMAGNÉTICO CASEIRO', 'O trabalho que apresentaremos mostrará um trem eletromagnético caseiro. Nosso intuito é mostrar como atuam os trens elétricos reais. O projeto foi confeccionado com os seguintes materiais: 1 pilha AAA, 2 ímãs de Neodímio (diâmetro pouco maior que a pilha), arame de estanho e um cilindro (diâmetro maior que o ímã). Para a confecção do trilho enrolamos o estanho no cilindro, em espiral. Após, o cilindro foi retirado ficando apenas uma mola. Para a composição do trem colocamos um ímã em cada ponta da pilha. Como o ímã possui dois pólos magnéticos opostos é preciso que o mesmo pólo de ambos os ímãs fique em contato com a pilha. Assim o trem terá o mesmo pólo magnético nas duas pontas. Para utilização dos pólos colocamos os dois ímãs grudados paralelamente, fixamos um deles na ponta de cima da pilha e o outro ímã nessa mesma posição na outra ponta. Para execução do projeto é preciso colocar o trem dentro do trilho. A energia da pilha, que está em contato com os ímãs, também entrará em contato com a mola transformando-a num eletroímã, que criará dois pólos magnéticos nas regiões de contato com as pontas do trem. Como o trem possui o mesmo pólo magnético nas suas pontas e a mola possuirá os dois, a interação dos pólos causará repulsão de um lado e atração de outro. As duas forças se somarão no mesmo sentido e causarão o movimento do trem pelo trilho. Concluímos a experiência com sucesso, apesar de dificuldades para adquirir os materiais. E acreditamos ter atingido nosso objetivo.', NULL, NULL, '2018-08-06 04:38:15', '2018-09-20 19:47:07', 10, 3, 6, 5, true, NULL, 7.51250000000000018);
INSERT INTO public.projeto VALUES (320, 'EXPERIMENTANDO ONDAS ELETROMAGNéTICAS', 'As ondas eletromagnéticas foram previstas por Maxwell (1831 – 1879), mas foram produzidas pela primeira vez através de um experimento por Heinrich Hertz (1857 – 1894). Atualmente, as ondas eletromagnéticas produzidas por circuitos eletrônicos estão presentes em todos os espaços levando informações através de sinais de televisão, rádio, telefone e internet, sem contar que cada vez mais estamos conectados em dispositivos Wi-Fi, Bluetooh e 4G. Hertz, em seu experimento, utilizou duas esferas de bronze polidas ligadas a uma bobina e separadas por uma pequena distância que permitia a formação de faíscas quando altas voltagens eram aplicadas nas esferas pela bobina. Como receptor ele usou uma espira aberta, onde nas extremidades duas pequenas esferas também estavam separadas por uma distância pequena, colocado a alguns metros de distância do faiscador. Ele percebeu que toda vez que uma faísca era produzida, o receptor, no espaço entre as esferas, também liberava uma faísca. Ele havia construído o primeiro emissor e o primeiro receptor de ondas eletromagnéticas. O nosso trabalho consiste em realizar um experimento onde podemos observar a formação, a propagação e a recepção de ondas eletromagnéticas a partir de faíscas, de forma parecida como fez Hertz. Para isso, vamos usar um acendedor de fogão com faiscador, fios de cobre e papel alumínio como emissor e fios de cobre como receptor. Uma pequena lâmpada, do tipo que tem em chaves teste, será acoplada no receptor. Tudo isso é montado sobre dois suportes de madeira distintos. A partir disso, toda vez que o acendedor é acionado um pequeno brilho é observado na lâmpada indicando o recebimento de um sinal eletromagnético. Ao desenvolver esse experimento, estaremos compreendendo o princípio de formação de ondas eletromagnéticas em circuito elétrico, bom como sua propagação e recepção em antenas. Esse meio tão importante e fundamental de transmissão de sinal de televisão, de telefone e de internet, usado na atualidade.', NULL, NULL, '2019-08-10 19:07:57', '2019-09-17 16:12:00', 4, 2, 7, 2, NULL, 6.33333333333333304, NULL);
INSERT INTO public.projeto VALUES (208, 'FARAÓS, MÚMIAS E BISTURIS: DA MAGIA AO CONHECIMENTO MÉDICO EMPíRICO', 'Pretende-se, nesse trabalho, abordar o conhecimento do povo egípcio na área da saúde. A razão do desenvolvimento da pesquisa deve-se ao fato dos antigos egípcios terem sido a primeira civilização do mundo a produzir tratados de medicina. Entende-se a medicina Egípcia como um conjunto variado de tratamentos mágicos e tradicionais e observação dos pacientes. Prescrições mágicas, terapêutica. Procedimentos tais como examinar as fezes, colocar leite sobre queimaduras, coletar sinais vitais auscultando o coração, o trabalho médico dividido em especialidades, o teste de gravidez, o incentivo a amamentação, a saúde da mulher, a realização de sangrias e de circuncisões já eram práticas realizadas pelos antigos médicos/as egípcios/as. Faziam uso do sangue menstrual, do sangue de animais, da placenta, bem como de diferentes plantas tais como o grão de bico (olho de falcão) e a babosa. O ensino da medicina ocorria nas Casas, e era tão avançado que atraia estudiosos de diferentes partes do mundo e incluía mulheres. O mais antigo conceito de saúde, baseado no bom deslocamento dos fluídos orgânicos, foi gerado no antigo Egito, e seus profissionais contavam com um sofisticado e diversificado instrumental cirúrgico. As análises feitas até o momento permitem afirmar que o processo de mumificação do corpo representou o primeiro método de conservação de tecidos, um procedimento fundamental para áreas do conhecimento tais como: anatomia, patologia, citologia microbiologia entre outras.', NULL, NULL, '2019-07-30 15:22:16', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 6.375, NULL);
INSERT INTO public.projeto VALUES (301, 'FOSSA DAS MARIANAS: PROFUNDIDADE X BIODIVERSIDADE', 'Este trabalho refere-se ao local mais profundo dos oceanos na fronteira entre as placas tectônicas do Pacífico e das Filipinas denominado Fossa das Marianas. A biodiversidade da vida marinha em altas profundidades, a formação geológica do local, os fenômenos que lá se verificam e a poluição oceânica foram as motivações do projeto. O problema se dá pela questão: “Como é possível existir vida marinha em altas profundidades nos oceanos?”. Os objetivos são: identificar as condições físicas, biológicas e geológicas da Fossa das Marianas; conhecer sua biodiversidade marinha; analisar a poluição oceânica na Fossa das Marianas; divulgar aspectos relevantes sobre o local de forma digital. Compreendendo a importância dos oceanos, entende-se a necessidade de um estudo sobre sua diversidade. No oceano Pacífico localiza-se a maioria das fossas submarinas, sendo a maior delas a das Marianas. Porém, sua grande profundidade não é capaz de livrá-la da poluição. É de suma importância a conservação deste local, garantindo a riqueza das espécies e dos ecossistemas. A metodologia utilizada neste projeto se deu através de pesquisas em sites confiáveis, abordando informações pertinentes sobre o local. A partir de uma entrevista com a comunidade escolar, constatou-se tratar de um local desconhecido. A criação de uma página web com imagens, vídeos e informações sobre os oceanos, a Fossa das Marianas e seus mistérios será a culminância do projeto.', NULL, NULL, '2019-08-10 12:43:19', '2019-09-17 16:12:00', 10, 3, 7, 2, NULL, 4.75, NULL);
INSERT INTO public.projeto VALUES (305, '&#34;CALADA, FEMINISTA!” - A IMPORTâNCIA DE COMPREENDER OS SIGNIFICADOS DA LUTA FEMINISTA', 'Por meio deste trabalho, pretende-se compreender de que maneira a exibição de determinada vertente feminista pode afetar a visão geral sobre o movimento em si, bem como de qual forma as concepções adotadas podem interferir no empoderamento de outras visões admitidas pelas correntes do feminismo. Considera-se a importância das várias vertentes feministas, no entanto percebe-se cada vez mais a disseminação de apenas algumas mais específicas, sendo elas, inclusive, difundidas superficialmente. Os feminismos radical, liberal e socialista são alvos de muitos ataques nas mídias sociais, impactando o movimento como um todo. Nesse contexto, as demais correntes, como o feminismo interseccional, despontam como absortas e pouco difusas na sociedade. Dessa maneira, determinadas formas de manifestação política são generalizadas e estereotipadas, como por exemplo, o modo no qual feministas são vistas como “feias”, “frustradas”, “mal-amadas”, entre outros, o que pode levar ao afastamento de muitas pessoas, inclusive mulheres, a aderirem à causa. O projeto “Calada, feminista!”, no qual essa pesquisa faz parte, tem como objetivo principal adquirir conhecimentos em relação ao feminismo para, após, transmitir os aprendizados à comunidade interna e externa do IFRS - Campus Canoas. Como procedimentos metodológicos têm-se pesquisa bibliográfica, pesquisa documental em mídias sociais e comentários a respeito do tema (netnografia) e aplicação de questionários, com a finalidade de aproximação da opinião das pessoas. Dessa forma, pretende-se evidenciar as diferentes concepções do feminismo. Espera-se, por meio desse trabalho, contribuir para a desmistificação do conceito por trás do movimento feminista, das diversas faces da opressão estrutural, bem como contribuir para o interesse do público em relação ao tema.', NULL, NULL, '2019-08-10 14:27:56', '2019-09-17 16:12:00', 3, 2, 7, 2, NULL, 5.5, NULL);
INSERT INTO public.projeto VALUES (193, 'AVALIAÇÃO IN VITRO DA CITOTOXICIDADE DE UM LÍQUIDO IÔNICO E SUA ATIVIDADE ANTIVIRAL FRENTE AO ZIKA VÍRUS', 'O objetivo desta pesquisa foi investigar o potencial citotóxico do líquido iônico (BTAC1)2ImCl frente à linhagem celular Vero e empregar as concentrações não tóxicas em teste de atividade antiviral frente ao Zika vírus. A justificativa da pesquisa vem do seguinte contexto: o ZIKV tem gerado preocupação mundial devido à sua associação à microcefalia e à síndromes neurológicas. Contudo, até o momento, não há medicamentos eficazes para combatê-lo, o que fez a OMS, em 2018, incluí-lo na lista de patógenos para os quais é extremamente necessário desenvolver-se pesquisas. Além disso, uma nova classe de compostos, denominados líquidos iônicos, está emergindo, porém poucos estudos tratam de sua atividade antiviral. Em relação à metodologia para realizar a pesquisa, células Vero foram expostas ao sal nas concentrações de 1000; 500; 250; 125; 62,5 e 31,25 µM, e com estas foram realizados os ensaios de citotoxicidade de incorporação do corante SRB e redução de MTT. Para análise do ensaio foi realizada análise estatística, através da qual percebeu-se que o sal apresentou toxicidade apenas na concentração de 1000 µM. As concentrações não tóxicas do composto foram aplicadas no ensaio de atividade antiviral de redução de placas frente ao ZIKV, no qual células Vero foram expostas ao ZIKV e à estas concentrações. Para análise do teste foi calculada a porcentagem de inibição da atividade viral que as concentrações apresentaram em relação ao controle viral, através da qual foi possível notar que todas as concentrações inibiram a atividade viral, sendo que o maior valor, 54% de inibição, foi gerado pela concentração de 125 µM. Sabendo que uma limitação para o desenvolvimento de moléculas antivirais é o fato de que vírus são parasitas intracelulares e é relativamente difícil atingi-los sem danificar as células, os resultados obtidos podem ser considerados promissores.', NULL, NULL, '2019-07-16 16:59:49', '2019-09-19 16:38:25', 4, 2, 7, 5, true, 9.625, 9.97499999999999964);
INSERT INTO public.projeto VALUES (57, 'PRé-HISTóRIA', 'Nós escolhemos a Pré-história como tema de pesquisa, porque quando estudamos esse assunto em aula achamos muito interessante e julgamos importante saber mais sobre o passado da nossa espécie Homo sapiens. Até agora nós aprendemos sobre os períodos da Pré-história, a arte rupestre, o fogo e os hominídeos. Além de pesquisarmos na internet e em livros, nós vimos vídeos no Youtube sobre a Pré-história, fomos a um museu de Ciência e Tecnologia da PUCRS. Nesse espaço, vimos exposições sobre evolução humana, arte rupestre e fósseis. Além disso, representamos com uma maquete sobre como os homens pré-históricos produziam o fogo, e fizemos uma tinta rupestre. Nós descobrimos que a Pré-História começou com o surgimento do homem e terminou quando desenvolveram a escrita. A Pré-História foi dividida em três períodos: Paleolítico (Idade da Pedra Lascada), quando ocorreu a descoberta do fogo; Neolítico (Idade da Pedra Polida), período em que foi desenvolvida a prática da agricultura e Idade dos Metais, período em que foi desenvolvida a prática da metalurgia. Também conhecemos mais a fundo a arte rupestre, nessa forma de expressão predomina a representação ilustrações artísticas feitas pelos homens pré-históricos. Este tipo de arte pode ser observado em paredes de cavernas antigamente usadas pelos homens pré-históricos como abrigo. A principal experiência vivida foi saber como nossa espécie se desenvolveu até os dias de hoje.', NULL, NULL, '2018-08-07 14:25:18', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, 4.125, NULL);
INSERT INTO public.projeto VALUES (332, 'STILBOMB - SISTEMA DE RADIAÇÃO SOLAR COM BOMBEAMENTO PARA USO NA IRRIGAÇÃO', 'O agronegócio é um dos setores que mais se desenvolve no Brasil e utiliza cada vez mais a tecnologia, automatizando partes base de seu processo como é o caso da irrigação. No Rio Grande do Sul, a grande parte das estações de bombeamento utilizam motores elétricos ou a diesel para executar a irrigação nas lavouras, gerando assim, além de grandes gastos com o método, a poluição ao meio-ambiente. Grande parte do território brasileiro se localiza próximo a linha do equador, de forma que o território tem bons índices de irradiação solar durante o dia. O seguinte projeto trata-se do desenvolvimento de um sistema de bombeamento de água bruta para irrigação à partir de um motor térmico acoplado a um concentrador solar. A pesquisa está sendo elaborado seguindo a metodologia científica para pesquisa, onde foi delimitado um tema e um problema, definimos uma hipótese, e objetivos que foram alcançados utilizando as ferramentas de pesquisa: entrevistas, formulários e questionários. A partir da análise dos dados coletados por meio das ferramentas de pesquisa, foi desenvolvido um modelo de sistema com um concentrador solar irradiando energia solar a um motor térmico stirling que aciona uma interface de potência e está aciona uma bomba d’água. Com o protótipo construído, pode-se demonstrar que os objetivos podem ser alcançados, através da construção de uma bomba d&#39;água de 2,5 watts que pode mover 90 litros de água por hora, atribuindo uma quantidade específica de radiação ao motor térmico, é possível realizar o bombeamento de água em lavouras. O sistema além de eliminar altos custos empregados para o processo, elimina a poluição gerada por este, sendo assim uma alternativa limpa e sustentável.', NULL, NULL, '2019-08-10 22:32:49', '2019-09-17 16:12:00', 7, 2, 7, 2, NULL, 6.625, NULL);
INSERT INTO public.projeto VALUES (273, 'AVALIAçãO DA MORTALIDADE DA LAGARTA-DO-CARTUCHO-DO-MILHO COM APLICAçãO DO óLEO ESSENCIAL DE CITRONELA.', 'A lagarta-do-cartucho (Spodoptera frugiperda) é um inseto-praga responsável por grande perda de produtividade em lavouras de milho. A citronela (Cymbopogon winterianus) tem seu vegetal largamente cultivado em razão do seu óleo essencial ter valor comercial devido a ação de repelência a insetos. Dessa forma, o objetivo da pesquisa foi avaliar a mortalidade da lagarta-do-cartucho-do-milho sujeita a alimentação com 500 ppm de óleo essencial de citronela. O projeto iniciou-se pela obtenção e plantio de citronela. Para o método de extração comparou-se o rendimento obtido pela técnica de arraste a vapor e hidrodestilação do tipo Clevenger. O ensaio de mortalidade foi conduzido a temperatura ambiente, 40 lagartas com 10 dias de vida foram expostas a dieta contendo óleo essencial de citronela e outras 40 a dieta controle. O cultivo da planta permitiu o desenvolvimento e crescimento do vegetal. A técnica de arraste a vapor não produziu óleo essencial suficiente para separação do hidrolato. Já o processo de obtenção por hidrodestilador do tipo Clevenger atingiu um rendimento de 2,45% em base seca. O bioensaio não apresentou diferença significativa de mortalidade do inseto-praga, 80% no controle contra 77,5% na dieta com cietronela. Dessa forma, concluímos que através do acompanhamento da criação de S. frugiperda, foi possível compreender o ciclo de vida da lagarta-do-cartucho-do-milho. O teste de mortalidade não foi conclusivo devido a contaminação de fungos a moscas. O rendimento de obtenção de óleo essencial de citronela pelo método de hidrodestilação do tipo Clevenger foi maior que o método arraste a vapor.', NULL, NULL, '2019-08-09 18:26:26', '2019-09-17 16:12:00', 4, 2, 7, 2, true, 8.25, NULL);
INSERT INTO public.projeto VALUES (394, 'GREEN BAG TRAZ A MODA, A PRATICIDADE E A SUSTENTABILIDADE PARA DENTRO DOS EVENTOS.', 'Esse trabalho tem por objetivo constatar o preço que o meio ambiente paga pelo nosso entretenimento e mostrar uma solução prática e sustentável para a diminuição do lixo que é deixado pelo público de grandes eventos. A razão da presente pesquisa se dá pela necessidade de conscientização e debate sobre esse fator, já que o ambiente como um todo é afetado pelos resíduos que deixamos nele, prejudicando, consequentemente, a nossa saúde. Como metodologia realizamos uma pesquisa quantitativa com 225 pessoas a partir de um formulário com as seguintes perguntas: se elas tem costume de frequentar eventos, se consomem comidas e bebidas nesses locais, se costumam jogar o lixo em lixeiras ou não e, por último, se teriam interesse em adquirir um produto para facilitar o descarte do lixo de forma mais rápida e eficaz. Categorizamos todas as respostas que obtivemos e concluímos que 92% se interessaram pela ideia de ter um material de auxílio para o lixo. Em suma, a partir das análises feitas por meio das pesquisas, desenvolvemos um produto chamado Green Bag: uma mochila que, além de agradar visualmente por ser produzida com retalhos de jeans, pretende trazer a praticidade do descarte do lixo em eventos. Seu diferencial é que, além de servir para guardar seus pertences, ela terá embalagens de plástico biodegradável, feitas com amido de milho, para armazenar os resíduos. A escolha do jeans se dá pelo fato de que sua produção gasta em média 3800 litros de água para 1 quilo de material e os retalhos que sobram são desperdiçados. Além disso, a Green Bag é forrada com tecidos orgânicos, tornando nosso produto cada vez melhor, tanto para as pessoas quanto para o meio ambiente.', NULL, NULL, '2021-10-08 10:28:38', '2021-11-04 23:49:57', 3, 2, 9, 5, true, 8.375, 8.13749999999999929);
INSERT INTO public.projeto VALUES (157, 'PEDAL SWITCHER LOOPER COM ARDUINO', 'O presente projeto tem como objetivo desenvolver um pedal “switcher looper” que facilitaria a utilização de pedais de efeito para guitarras elétricas, estes servem para mudar o timbre do instrumento. Isso é possível porque a guitarra é um instrumento de corda com captação elétrica, seu funcionamento é como uma central de pedais conectando outros pedais de guitarras, fazendo suas seleções, de forma que seu usuário consegue acionar de maneira prática, diferentes pedais simultaneamente. Isso resolve o problema que muitos músicos têm ao utilizar vários pedais, que por falta de praticidade acaba atrapalhando na hora de tocar o instrumento. O pedal switcher looper tem várias entradas e saídas para a conexão dos pedais de efeito de guitarra e com botões é capaz de mudar a seleção de bancos que servem para guardar as informações selecionadas, alem desses botões de navegação haveria também botões para a seleção de diferentes bancos como, por exemplo: numa cadeia de pedais 1,2,3 e 4 seria capaz de selecionar um banco que iria entregar como resultado o funcionamento apenas 1 e 3, logo apos selecionando o próximo banco selecionado 1 e 4. Para a realização do projeto iremos utilizar como componente principal a placa de prototipagem Arduino por ser possível fazer a manipulação de botões de navegação e de seleção e o chaveamento das entradas e saídas tendo papel e supre as necessidades do projeto por ser viável economicamente e ter plataformas e “Shields” fáceis de manipular. Utilizaremos também resistores, transistores e diodos para a realização do nosso trabalho', NULL, NULL, '2018-08-10 20:57:50', '2018-09-20 19:47:07', 7, 2, 6, 2, NULL, 5.125, NULL);
INSERT INTO public.projeto VALUES (69, 'INICIAçãO CIENTíFICA NO ENSINO FUNDAMENTAL', 'O presente trabalho é um relato da observação de uma aluna do curso normal sobre a metodologia aplicada com a turma de Iniciação Científica dos alunos do 6º e 7º anos do ensino fundamental do Colégio Dom Feliciano de Gravataí/RS no primeiro semestre de 2018. A apreciação das aulas foi registrada em caderno de campo pela estudante. As atividades executadas durante as aulas de Iniciação Científica tiveram o objetivo de orientar os alunos sobre a condução de pesquisas nos assuntos escolhidos pelos próprios educandos. A partir das observações realizadas e acompanhamento da pesquisa, pode-se perceber os alunos foram bastante espontâneos na escolha dos temas que iriam pesquisar. Percebe-se pela análise dos assuntos, que é claro entre os alunos o fato da ciência não ser restrita apenas à área das ciências da natureza, química, física e biologia. Considerou-se esse fato bastante positivo e um reflexo da cultura de pesquisa introduzida nos anos iniciais do ensino fundamental do Colégio Dom Feliciano. Chama ainda a atenção o nível de especificidade atingido em alguns dos grupos de pesquisa. Ao longo das aulas os alunos foram estimulados a eleger um foco para o tema escolhido, a fim de aprofundar seus conhecimentos, evitando a superficialidade. Durante as apresentações em aula, os alunos deixaram claro o porquê do assunto escolhido e demonstraram apropriação do conhecimento por meio da explicação oral. As orientações aos alunos dada pela professora ressaltavam a importância da elaboração de um foco na pesquisa, para que os conhecimentos fossem aprofundamentos. Contemplou-se a socialização dos conhecimentos adquiridos pelos grupos ao longo do tempo. Como culminância do projeto, houve a exposição dos trabalhos na Mostra de Ciências & Inovação do próprio colégio. Ao longo do processo, foi observado, o protagonismo dos alunos ao se apropriarem de um novo conhecimento.', NULL, NULL, '2018-08-07 16:10:17', '2018-09-20 19:47:07', 5, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (11, 'CLICKFISIO: UMA FERRAMENTA DIGITAL PARA AUXÍLIO NO TRATAMENTO FISIOTERÁPICO', 'A tecnologia aplicada a saúde tem inovado o tratamento de doenças, reduzindo o tempo de reabilitação e facilitando o trabalho dos profissionais. Sabe-se também que indivíduos que necessitam de tratamento fisioterapêutico podem não comparecer às consultas regularmente, por diversos motivos, o que chamamos de descontinuidade do tratamento. Sendo assim, esse projeto tem como objetivo o desenvolvimento de um sistema Web e Mobile que auxiliará os pacientes na execução dos exercícios fisioterapêuticos em âmbito familiar, sempre com indicação, recomendação e supervisão adequadas de seus fisioterapeutas, contribuindo assim com a minimização da descontinuidade dos tratamentos fisioterápicos. O sistema visará, também, auxiliar o trabalho dos profissionais, por promover o controle de pacientes e de seus tratamentos. Para a fundamentação do projeto, bem como para implementação das funcionalidades do ClickFisio, foram realizadas entrevistas com profissionais da área, bem como revisões bibliográficas sobre a temática. Para a construção do sistema foram empregadas as linguagens PHP, JS, HTML, CSS, SQL e JAVA, para o armazenamento dos dados e informações foi utilizado o banco de dados Maria DB, como resultado obtém-se uma ferramenta Web/Mobile que disponibiliza protocolos que visam a execução correta e contínua dos tratamentos conforme a orientação do fisioterapeuta. A correta execução dos protocolos pelo paciente, por intermédio da utilização do ClickFisio. pode reduzir o tempo de tratamento.', NULL, NULL, '2018-07-27 15:35:16', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.95446428571428577);
INSERT INTO public.projeto VALUES (196, 'HISTÓRIA DA ENERGIA NUCLEAR E SUAS CONSEQUÊNCIAS.', 'Neste trabalho, nosso objetivo é estudar as múltiplas questões que dizem respeito ao uso da energia nuclear, tais como: onde começou? Onde se instalou? E quais foram os principais acidentes decorrentes dessa fonte de energia. A justificativa para desenvolver pesquisa sobre esse tema se deve à importância da temática. Entendida, por alguns como algo não tão necessário, mas que, no entanto, constitui-se como uma energia funcional e limpa, que mesmo com os lixos que provém, é defendida por muitos como algo necessário e útil. Para atingir os objetivos propostos, foram seguidas as etapas: primeiramente, elaboramos um questionário, sobre o entendimento da comunidade escolar sobre o assunto. Depois analisamos as suas origens, como ela se espalhou, sua utilização no Brasil, seu funcionamento, suas vantagens e desvantagens, além dos principais acidentes nucleares, em especial sobre o maior deles: Chernobyl. Ao longo dessas etapas, analisamos os resultados do questionário a fim de auxiliar o entendimento sobre o assunto. Análises feitas até o momento nos permitem concluir que a energia nuclear é perigosa por que pode produzir lixo tóxico e, em muitos casos, ela pode ser substituída, por outras menos nocivas ao meio ambiente. A energia nuclear, no entanto, não é “antiga”, e ainda temos muito para aprender sobre ela. Além disso, ela é muito perigosa, precisando ser manuseada com muita prudência, da forma certa, caso contrário pode acontecer algo trágico, demorado para ser solucionado.', NULL, NULL, '2019-07-21 13:52:53', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 5.625, NULL);
INSERT INTO public.projeto VALUES (127, 'SGT - SISTEMA WEB PARA ORGANIZAçãO E GERENCIAMENTO DE TORNEIOS ESPORTIVOS', 'Práticas esportivas têm se mostrado como ferramentas importantes no desenvolvimento físico do ser humano. De forma organizada, estas atividades atuam como entretenimento a participantes e espectadores. Porém, existe hoje uma dificuldade na organização de competições esportivas amadoras. O organizador de eventos deste tipo gerencia, por vezes, usando ferramentas rudimentares e difíceis, como anotações manuais ou até mesmo softwares computacionais que não possuem ferramentas automatizadas de controle do torneio. Isso o obriga a informar, calcular e organizar todos os dados, tal como ocorre no Instituto Federal de Educação, Ciência e Tecnologia do Rio Grande do Sul - Campus Canoas (IFRS Canoas). Há também certa limitação na busca por competições por parte de jogadores e equipes que buscam participar de torneios existentes. O que se propõe no presente trabalho é um sistema web que visa auxiliar na criação e organização de competições esportivas de vôlei e futsal, motivado pela necessidade do IFRS Canoas em ferramentas para a melhor administração de torneios destas modalidades. Com isso, busca-se propiciar aos administradores do torneio, membros do Instituto ou entusiastas de torneios amadores, uma plataforma que facilite a organização do campeonato, bem como o gerenciamento de dados estatísticos e de participantes da competição. Também objetiva oferecer a busca, visualização e inscrição em torneios por parte de equipes e jogadores que desejam participar de competições. Desta forma, procura-se tornar mais fácil a tarefa de gerenciamento de torneios, dando ao usuário uma ferramenta prática e simples, aumentando as possibilidades de uma competição organizada. O software em questão oferece ferramentas de criação e gerenciamento de times e competições de diferentes modalidades, bem como permite a busca e inscrição destes times nos torneios e, por fim a visualização de dados que o sistema armazena e oferece a gerenciadores e entusiastas para consulta.', NULL, NULL, '2018-08-10 16:08:28', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (174, 'CREDIT2EAT - SISTEMA DE GERENCIAMENTO DE CANTINAS', 'O Credit2Eat – Sistema de Gerenciamento de Cantinas é um sistema voltado para o gerenciamento de cantinas, principalmente a que se faz presente no campus canoas do IFRS. Este sistema possibilita ao dono do estabelecimento realizar diversos processos de maneira automatizada, os quais antes eram feitos manualmente, como cadastrar novos clientes, solicitando algumas informações que serão armazenadas em um banco de dados, tais como: nome, matrícula, telefone e e-mail. Cada cliente será identificado por sua matrícula, tanto os alunos quanto os servidores, e com essa matrícula eles terão a possibilidade de realizar compras à vista ou a prazo. A prazo os clientes poderão ter uma dívida que deverá ser paga ao fim de cada semana e ao fim do mês para os servidores. A matrícula dos alunos e dos servidores servirá também para a conexão com o sistema Moodle, que carregará as fotos dos mesmos, facilitando então sua identificação. Além disso, o Credit2Eat auxiliará o proprietário da cantina com o controle de estoque. Para realizar o abastecimento de suas mercadorias, o proprietário deve informar ao sistema a ação, com a quantidade nova de cada produto, e este atualizará o estoque automaticamente. Quando uma venda for realizada, o estoque será decrescido automaticamente, e emitirá um alerta ao proprietário se a quantidade de produtos for menor do que um certo número escolhido pelo dono do estabelecimento. Esse alerta será emitido de duas maneiras, uma via e-mail e outra será apresentada na tela do sistema, em um local de avisos.', NULL, NULL, '2018-08-10 23:02:03', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 7.25267857142857153);
INSERT INTO public.projeto VALUES (262, 'XENOFOBIA NO BRASIL', 'O trabalho, apresenta a importância de entender a Xenofobia no Brasil. Xenofobia é a aversão, antipatia ou ódio contra refugiados, forasteiros ou imigrantes. O principal motivo da sua existência é o falso sentimento de nacionalismo e superioridade de parte da população, que acredita na preeminência de sua cultura e etnias. Através de pesquisas e acontecimentos no país, hoje, essa aversão é tratada como crime. Migrar é um direito humano. Os países em que a xenofobia está presente infringem os artigos da Declaração Universal dos Direitos Humanos (12 e 13), particularmente, no Brasil, indo de encontro ao artigo da Constituição Federal (5º, termo xv). Um exemplo bem próximo de nós canoenses, é a difícil realidade de aceitação dos imigrantes venezuelanos, através da xenofobia, da adaptação e procura de emprego. Para desenvolver esse trabalho, fiz pesquisas em sites na internet; entrevistas nas turmas do 7º ao 9º ano da escola Leonel Brizola, para diagnosticar o conhecimento sobre o assunto perante os entrevistados e pesquisei imagens e dados sobre a xenofobia no Brasil. Percebeu-se que ainda existe muita antipatia, e que será necessário muito respeito por essas pessoas que não usufruem das mesmas culturas que as nossas. Temos que agir para que o preconceito acabe, pois todos os indivíduos são iguais e merecem toda a igualdade. O imigrante que vem para o Brasil vem por motivos de: Crises políticas ou econômicas, desemprego e em busca de melhores condições de vida.', NULL, NULL, '2019-08-09 15:28:14', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 6.875, NULL);
INSERT INTO public.projeto VALUES (344, 'CONSUMO DE REFRIGERANTE NA ESCOLA', 'Em 2018, foi aprovada a lei que proíbe a venda de balas, pirulitos, biscoitos recheados e refrigerante nas escolas de educação básica, públicas e privadas. O refrigerante ocupa o 6º lugar na lista dos 20 alimentos mais consumidos por adolescentes brasileiros, à frente de hortaliças, frutas e leite. Os dados fazem parte do Estudo de Riscos Cardiovasculares em Adolescentes, realizado pelo Ministério da Saúde. Mais de 80% dos jovens consomem sódio, uma das substâncias presentes nos refrigerantes, acima dos limites máximos recomendados. Tendo em vista o alto consumo de refrigerante pelos adolescentes, surgiu a pergunta: com a ausência na escola, o que os alunos começaram a consumir? Assim essa pesquisa teve o objetivo de mapiar o consumo de refrigerantes por adolescentes na escola. Para tanto, foram colocadas lixeiras nas salas de aula das turmas de 8º ano do Colégio Dom Feliciano e os alunos foram orientados a depositar as embalagens dos lanches consumidos nas lixeiras. Semanalmente as mesmas foram esvaziadas e as embalagens identificadas e contabilizadas. Os resultados mostraram que com a ausência de refrigerante, os jovens recorrem aos chás e sucos industrializados, bebidas com altos teores de açúcar e sódio. Bebidas mais saudáveis como água e sucos naturais não parecem ser opções para os adolescentes. Concluímos que o consumo de refrigerantes ainda é um problema entre os adolescentes, mesmo com a limitação de compra na escola, os alunos procuram alternativas pouco saudáveis.', NULL, NULL, '2019-08-11 19:20:07', '2019-09-19 14:28:55', 10, 3, 7, 5, true, 7.75, 9.19999999999999929);
INSERT INTO public.projeto VALUES (249, 'LITERATURA BRASILEIRA CONTEMPORâNEA E INTERNACIONALIZAçãO: UMA ANáLISE A PARTIR DE PRêMIOS LITERáRIOS E OBRAS TRADUZIDAS PARA A LíNGUA INGLESA', 'Os prêmios voltados à literatura brasileira vêm se tornando cada vez mais democráticos e oferecendo espaço para diferentes perfis de autores, fato que promove a popularização de concursos literários e se torna, por sua vez, relevante ao estudo do perfil e das tendências da literatura brasileira no século XXI, bem como da relação entre sistema literário e processos tradutórios. A partir dessa premissa e tendo como objeto as relações travadas entre literatura brasileira contemporânea e internacionalização, o presente trabalho tem como objetivo promover a coleta e a análise de dados acerca do sistema literário brasileiro atual, de modo a inter-relacionar prêmios literários e traduções para o mercado anglófono, buscando estabelecer um perfil acerca de autores e obras premiados e traduzidos nos últimos dez anos (2010-2019). Para isso, o trabalho conta com pesquisa de natureza aplicada, utilizando o método quantitativo de investigação para o levantamento de dados, bem como o método qualitativo para a análise do sistema literário brasileiro atual frente à globalização e à chamada world literature. Com o estudo realizado, é possível perceber que as mulheres ainda ocupam uma posição minoritária dentre os agraciados com prêmios literários; contudo, observa-se um percentual expressivo de escritoras traduzidas dentre as premiadas na última década, o que acrescenta importante dado acerca do status quo da internacionalização da literatura brasileira contemporânea em prol da redução das desigualdades em nível sociocultural. Conclui-se, portanto, que há ainda a necessidade de ações que promovam a internacionalização de obras produzidas por escritoras brasileiras no século XXI, o que inclui o trabalho de tradução literária para a língua inglesa, considerada língua franca em tempos globais.', NULL, NULL, '2019-08-08 21:49:41', '2019-09-19 16:02:06', 3, 2, 7, 5, true, 9.375, 9.22857142857144908);
INSERT INTO public.projeto VALUES (82, 'RELATOS DE EXPERIÊNCIA DE VIDA DE UMA PESSOA COM DEFICIÊNCIA E A SUA CONTRIBUIÇÃO PARA A APRENDIZAGEM NO CAMPUS CANOAS', 'O presente trabalho foi desenvolvido dentro do paradigma da linguagem, como referencial filosófico que influencia, de maneira determinante, as diferentes concepções de mundo, de linguagem e de método. A linguagem, segundo Gadamer, “não é somente um dentre muitos dotes atribuídos ao homem que está no mundo, mas serve de base absoluta para que os homens tenham mundo, nela se representa o mundo”. Nesse diapasão, busca-se descortinar as possibilidades hermenêuticas encobertas pelo senso comum disseminado, que comunica a incapacidade de uma pessoa com deficiência. Que acredita e reproduz que uma pessoa com deficiência deve permanecer sob tutela constante, que a frequência à escola para ela tem uma função apenas lúdica, que ela não será capaz de absorver conhecimento, e que seu futuro é permanecer medicada em frente à uma tela de televisão. O João Lúcio Rossa comunica, diariamente, no campus Canoas, que não absorve essa linguagem que estigmatiza uma pessoa com deficiência. O aluno em questão não se esconde. Não tem vergonha de ser uma pessoa com deficiência. Se reconhece como tal, conhece os seus direitos e luta rotineiramente por eles. Os direitos do estudante em debate incluem o ingresso no Instituto Federal por meio de cotas, a adaptação no planejamento das aulas e na avaliação, reconhecidos formalmente apenas em 2016, com a publicação da Lei nº 13.409. Mas vão além disso, uma vez que a criação legal não muda a linguagem incorporada sobre a pessoa com deficiência num passe de mágica. De forma que, o ingresso do João Lúcio no Campus Canoas importa numa readequação, não somente curricular, mas existencial do corpo docente e de servidores em geral, na forma como se concebe a aprendizagem. Importa, sim, numa reformulação da vivência num sentido experiencial. Observa-se que o discente promove um laboratório de aprendizagem experiencial no Campus Canoas, fazendo que a antropoética preconizada por Morin saia das estantes e ganhe pés, mãos, braços e abraços.', NULL, NULL, '2018-08-08 18:10:07', '2018-09-20 19:47:07', 9, 2, 6, 5, true, NULL, 8.33125000000000071);
INSERT INTO public.projeto VALUES (276, 'COMPARAçãO DE MéTODOS DE CRIAçãO MASSAL DE EPHESTIA KUEHNIELLA', 'A Ephestia kuehniella é uma espécie de mariposa largamente utilizada para reprodução de Trichogramma sp., uma vespa capaz de controlar pragas agrícolas sem o uso de agrotóxicos. O objetivo da presente pesquisa foi comparar segundo a produção total de ovos de dois métodos de criação massal de E. kuehniella. Foram comparados dois métodos de criação massal de E. kueniella. O primeiro, Modelo A, é comumente utilizado em laboratórios de pesquisa científica em universidades. Para ambos os sistemas o substrato de desenvolvimento das larvas de E. kuehniella foi uma mistura de farinha integral e levedo de cerveja em pó na proporção de 97 e 3 % respectivamente. Toda a fase de desenvolvimento larval e pupal de E. kuehniella ocorreram nesses recipientes. No modelo A as bandejas foram cobertas individualmente um saco de tecido voil para evitar a contaminação da criação com parasitoides de larvas ou outros insetos. Além disso o tecido permite a troca de gases e homogeneização da temperatura com o ambiente externo. Após o início a emergência, diariamente foi feita a retirada dos adultos com aspirador de boca. E sua disposição em gaiolas feitas de cano de PVC. Na base inferior da estrutura foi posicionado um prato plástico para coleta de ovos. O segundo método avaliado, Modelo B, não é feita a aspiração das mariposas, o que representa uma redução de custo com mão-de-obra relevante para o processo. Observa-se que os adultos permanecem na base do sistema, ovipositando no pote da base da estrutura, que diariamente é retirado e o conteúdo peneirado para separação dos ovos. A massa de ovos média coletado no sistema convencional, modelo A, foi de 5,4 g e enquanto que no sistema B foi de 0,9 g. Além disso, os ovos do sistema convencional apresentavam uma menor quantidade de particulados sujidade. Dessa fora, conclui-se que o método convencional se mostrou mais eficiente para produção de ovos de E. kuehniella para reprodução de Trichogramma sp.', NULL, NULL, '2019-08-09 19:09:10', '2019-09-17 16:12:00', 7, 2, 7, 2, true, 8.125, NULL);
INSERT INTO public.projeto VALUES (101, 'SISTEMA AUTOMáTICO DE IRRIGAçãO - INTEGRADO A INTERNET', 'A proposta inicial do projeto é utilizar a plataforma Arduino para criar um sistema capaz de operar em dois modos, o primeiro modo podendo medir a umidade do solo, e a partir do dado obtido irrigar ou não (a partir da escolha do usuário) a plantação com o tempo determinado pelo usuário, o segundo modo sendo uma rotina de irrigação onde o usuário pode escolher o tempo e o horário de irrigação de sua plantação. O problema observado foi o gasto excessivo de água para irrigação de plantações, cerca de 70% do uso de água mundial é direcionado para o agronegócio, e este valor no Brasil chega a 72% do consumo total de água, de acordo com a ONU o uso da água tende a crescer a uma taxa 2 vezes maior que o crescimento da população (fonte: EBC – Empresa Brasil de Comunicação). O propósito da escolha desse projeto é economizar os gastos de água em grande escala. Para o funcionamento do sistema o usuário deve definir a umidade mínima e máxima suportada pela planta a ser irrigada, assim como o tempo de irrigação (usando somente os comandos via internet), pois cada planta possui características diferentes de cultivo. Algumas plantas absorvem a água em maior quantidade em menos tempo, outras funcionam de forma diferente, demorando o dobro do tempo para absorver a mesma quantidade de água, por isso é muito importante o usuário do sistema ter a oportunidade de escolher o tempo de irrigação e a condição da umidade do solo para que comece a irrigação. O sistema será montado utilizando canos de PVC, uma válvula solenoide, sensores de umidade, dois microaspersores e uma caixa confeccionada pela dupla. Para a programação será usada uma placa Arduino Mega que irá monitorar o sensor, Módulo DS3231 que irá servir para o controle do tempo, para fazer a conexão via internet será usado o ESP8266 12E/F e será utilizado um sistema transistorizado para acionar a válvula solenoide.', NULL, NULL, '2018-08-09 20:46:45', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 9.10089285714285623);
INSERT INTO public.projeto VALUES (403, 'HáBITOS ALIMENTARES X HUMOR: UMA AVALIAçãO COM ESTUDANTES DO ENSINO MéDIO INTEGRADO NO IFSUL - CâMPUS LAJEADO', 'Alimentação é um conjunto de hábitos que o homem utiliza, não só em função de sua saúde, mas como um elemento cultural, ou seja, que vai além das substâncias necessárias para a manutenção da vida. Atualmente, as pessoas passaram a consumir mais alimentos ricos em calorias, gorduras, açúcares livres e sal. Segundo o Programa de Avaliação Internacional de Estudantes, 56% dos estudantes brasileiros relataram ficar mais estressados durante os estudos. Assim, para contribuir com a conscientização da vida saudável, tanto física como mental, no ambiente escolar, o objetivo do trabalho foi verificar o tipo de alimentação e a existência de percepção de alteração de humor nos estudantes do Ensino Médio Integrado (EMI) do IFSul Câmpus Lajeado. A metodologia foi uma pesquisa quali-quantitativa através de questionário online com 30 perguntas de caráter objetivo, além da aferição do IMC com base nos dados de peso e altura. Dos 299 estudantes do EMI, 54,2% responderam o questionário. A maior parte dos respondentes (93,2%) têm entre 16 e 18 anos, sendo 54,9% do sexo feminino. Em termos de frequência 75,3% fazem de 3 a 4 refeições ao dia. O consumo de frutas, leite, carne e ovos aparece em destaque, alimentos congelados fazem parte da dieta semanal e Fast Food são consumidos por 50,3% dos respondentes algumas vezes ao mês. Os transtornos de humor diagnosticados por médico perpassam 21%, com destaque para ansiedade e depressão. Dos estudantes, 69,9%, demonstraram alteração no consumo de alimentos em razão de estresse ou ansiedade, destes 38,9% relataram aumento e 16,7% diminuição no consumo. A sensação de tristeza influencia uma modificação alimentar para 74,1% dos respondentes enquanto a sensação de alegria altera o hábito para 31,5%. A análise dos dados permite indicar que os estudantes do EMI, aparentemente, possuem variação no seu consumo alimentar resultante de sua alteração de humor, com ênfase para o aumento desse consumo apesar de 74,2% apresentarem IMC eutrófico.', NULL, NULL, '2021-10-10 20:22:04', '2021-11-05 00:15:21', 4, 2, 9, 5, true, 9.875, 9.84999999999999964);
INSERT INTO public.projeto VALUES (338, 'MIELOTRIKE - TRICICLO ADAPTADO PARA UMA CRIANÇA COM MIELOMENINGOCELE NÍVEL LOMBAR BAIXO', 'A inclusão social é um fator importante no desenvolvimento durante a infância, sendo ainda mais significativo para uma criança com alguma necessidade especial. Atividades lúdicas auxiliam no processo de inclusão, pois é no decorrer dessas atividades que ocorre a integração entre as crianças, enquanto elas estão aprendendo a compartilhar, a serem cooperativas e a respeitar as regras impostas por elas mesmas para que as brincadeiras aconteçam. Tendo isso em vista, o projeto possui o objetivo de construir um triciclo que sirva de forma lúdica e fisioterapêutica no desenvolvimento de uma criança com mielomeningocele nível lombar baixo, promovendo também, a sua independência e sua inserção no meio social. Além disso, andar de triciclo, por ser uma atividade aeróbica, melhora a condição pulmonar e muscular e diminui as probabilidades da obesidade que está associada a doenças graves, como a diabete e a hipertensão. A mielomeningocele é uma malformação congênita da coluna vertebral em que as meninges, a medula e as raízes nervosas ficam expostas, causando danos nas crianças, conforme o seu nível, sendo que no nível lombar baixo, a criança apresenta dificuldade em completar o ciclo da pedalada e para a marcha, necessitam de órtese suropodálica e auxiliar de marcha. Pensando nisso, o presente projeto fundamenta-se em projetar fisicamente o Mielotrike, utilizando como base um triciclo Drift trike e adaptando movimento manual semelhante ao de uma Hand Bike, que é uma bicicleta utilizada no ciclismo paralímpico, onde os pedais (manípulos) são adaptados para as mãos, sincronizado com o movimento pedal. Assim, o movimento manual auxilia a criança a completar o ciclo da pedalada, ajudando-a na fisioterapia. Para a elaboração do projeto foi utilizada uma metodologia tecnológica de abordagem qualitativa, pois é visada a adaptação do triciclo e avaliação do resultado pelo usuário e por um profissional da área fisioterapêutica e possíveis usuários.', NULL, NULL, '2019-08-10 23:13:24', '2019-09-19 16:06:44', 9, 2, 7, 5, true, 8.625, 9.91428571428570038);
INSERT INTO public.projeto VALUES (86, 'ROLê ACESSíVEL - SISTEMA DE AVALIAçãO DE ACESSIBILIDADE URBANA', 'Cada vez mais observamos que as Pessoas com Deficiência (PcDs) estão se integrando na sociedade, muito em função das políticas públicas adotadas pelo país. São pessoas cegas, surdas, cadeirantes, etc, que agora utilizam os espaços públicos que vêm se adaptando. De igual maneira, essa integração está acontecendo nos restaurantes, bares, casas de shows, bem como outros estabelecimentos comerciais. Porém a adaptação necessária ocorre lentamente. Visando essas mudanças, refletimos o quão difícil é, nesta sociedade não acolhedora, estruturalmente falando, a locomoção e autonomia dos PcDs. Muitas são as vezes em que elas acabam por não se incluírem aos demais, em função das barreiras de infraestrutura. Nossas cidades não são suficientemente adaptadas para esses indivíduos. Frequentemente, atividades cotidianas se tornam difíceis, sendo em alguns casos impossíveis. Em virtude dessa realidade, idealizou-se o desenvolvimento de um sistema Web chamado “Rolê Acessível: sistema de avaliação de acessibilidade urbana”, que tem como objetivo facilitar a busca por locais acessíveis para as PcDs. A ideia é trazer um ranking, onde os estabelecimentos mais bem colocados, seriam os locais com mais recursos inclusivos as PcDs. Logo, estes seriam os que o sistema sugeriria ao usuário com maior prioridade. No desenvolvimento do back-end utilizou-se o PHP, linguagem de script open source de uso geral adequada para o desenvolvimento Web que pode ser embutida no HTML. Provido de bibliotecas de funções de acesso ao banco de dados MySQL o PHP facilita na construção da conexão, consultas, inserção e alteração de informações na base de dados. Este ainda é um projeto em andamento, portanto as conclusões parcialmente retiradas, são as de que a partir do desenvolvimento deste sistema, os locais que não possuem recursos acessíveis, acabarão por serem pressionados e influenciados a melhorar seu atendimento, adicionando recursos de receptividade aos PcDs.', NULL, NULL, '2018-08-08 22:29:08', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 8.625, 9.33035714285714235);
INSERT INTO public.projeto VALUES (183, 'ESTUDO DA APLICAÇÃO DO NANO PÓ METÁLICO PARA ACELERAÇÃO DO PROCESSO DE PRODUÇÃO DO BIOGÁS', 'O presente projeto de pesquisa trata-se de um estudo da aplicação do nano pó metálico, produzido pelo corte a laser de barras metálicas, no processo de produção de biogás, visando a sua aceleração. A pesquisa tem um caráter experimental, já que através dela foram realizadas amostras de biogás com nano pó metálico proveniente de processos mecânicos, entretanto, estudos bibliográficos também foram realizados para um maior entendimento dos assuntos abordados. O biogás é uma energia renovável e que nos últimos anos tem ganhado muito destaque pelo fato de que matérias orgânicas, geralmente jogadas no lixo, são utilizadas para gerarem energia. Entretanto, o seu processo é complexo, exigindo que muitos fatores estejam controlados, como a temperatura e a ausência de oxigênio, por exemplo. As nanopartículas ferromagnéticas podem ser produzidas de diversas maneiras, tanto em laboratório, através de uma reação de hidróxido e nitrato de potássio com sulfato ferroso, por exemplo, quanto em processos mecânicos, como é o caso do corte à laser de barras. Sendo produzidas em laboratório em uma quantidade limitada ou em uma grande quantidade em fábricas, as nanopartículas possuem características que podem ajudar o processo de produção de biogás. Adicionar nanopartículas ferromagnéticas na produção de biogás e confirmar os seus efeitos, principalmente a aceleração, traria grandes benefícios para o processo e um destino digno para o nano pó. Para realizar esse experimento, foram elaboradas seis amostras de produção de biogás, três com o resíduo e três sem ele, além de certas quantias de matéria orgânica e inóculo. Análises posteriores de gás metano, dióxido de carbono, ácido sulfídrico e amônia foram realizadas para que se fosse feita uma comparação entre os resultados encontrados e a hipótese fosse confirmada ou não.', NULL, NULL, '2018-08-10 23:48:43', '2018-09-20 19:47:07', 8, 2, 6, 5, true, 9.25, 10);
INSERT INTO public.projeto VALUES (267, 'MIELOWALKER - DISPOSITIVO DE AUXÍLIO À MARCHA DE CRIANÇAS COM MIELOMENINGOCELE NÍVEL LOMBAR BAIXO II', 'O presente projeto, da área de engenharia mecânica junto à tecnologia assistiva, tem como tema central a patologia mielomeningocele. Considerada a segunda causa de deficiência motora infantil segundo Brandão, Fujisawa e Cardoso (2009), a mielomeningocele (MMC) pode ser definida como uma malformação embrionária do sistema nervoso central que ocorre nas primeiras quatro semanas de gestação. Portanto, as crianças que possuem essa patologia, conforme Rocco, Saito e Fernandes (2006) obtêm comprometimento neurológico, urológico e ortopédico, acompanhado por paraplegia flácida e alteração sensitiva abaixo do nível da lesão, sendo necessárias sessões de fisioterapia ao longo do seu crescimento e um dispositivo de auxílio à marcha. Porém, os dispositivos existentes, além de muitas vezes não serem totalmente eficientes para os pacientes, possuem custo elevado, variando até R$ 26.843,54, e necessitam de trocas com o decorrer do crescimento da criança. Como solução, esse projeto consiste na projeção de um dispositivo de auxílio à marcha de crianças com mielomeningocele nível lombar baixo tendo baixo custo em relação aos demais, estimulando a reabilitação física dos pacientes, com conforto e segurança. Concluiu-se que o dispositivo resiste às forças axiais que serão aplicadas, sendo capaz de auxiliar a marcha de crianças com mielomeningocele nível lombar baixo. O dispositivo Mielowalker tem como principal diferencial o fato de proporcionar maior independência e autonomia, contribuindo para o desenvolvimento pessoal da criança, promovendo grande estímulo aos seus membros inferiores, auxiliando a sua reabilitação física, tendo custo estimado de produto R$ 2.845,67.', NULL, NULL, '2019-08-09 16:41:24', '2019-09-17 16:12:00', 7, 2, 7, 2, NULL, 6, NULL);
INSERT INTO public.projeto VALUES (268, 'DEPRESSãO NA ADOLESCÊNCIA', 'Depressão é uma doença crônica e recorrente, que produz alterações no humor. Esse transtorno mental está se tornando cada vez mais comum na adolescência. Por isso, escolhemos estudar sobre o assunto. O objetivo da nossa pesquisa é compreender as causas e efeitos da depressão na adolescência para assim podermos alertar as pessoas sobre os perigos dessa doença. Nós começamos a nossa pesquisa, buscando na internet mais informações sobre a depressão na adolescência. Nós entrevistamos as psicólogas da nossa escola, Dinamara e Rita Mara, para entender melhor o que causa a depressão em adolescentes. “- Quais são os sinais que podem ajudar a identificar pessoas que estão sofrendo de depressão?”. Nós fizemos um questionário sobre a depressão e pedimos para os alunos da nossa escola do 6º e 7º anos para responder assim percebemos como realmente os adolescentes enxergam a depressão. Aprendemos que os principais sintomas de depressão são isolamento, nervosismo, dores sem fim e desempenho escolar ruim. Entre o público entrevistado 68% das pessoas consideram que sofrem de depressão pessoas que sentem tristeza diariamente. Nós concluímos que não devemos cuidar apenas da nossa saúde física, pois muitas vezes a saúde mental é que poderá levar a pessoa para um problema mais sério. Dentre os vários tipos de distúrbios a mais comum é a depressão que é hereditária, ou seja, é passada de geração em geração. Por esses motivos não devemos fazer brincadeiras com uma doença tão séria quanto essa!', NULL, NULL, '2019-08-09 17:41:24', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 5.75, NULL);
INSERT INTO public.projeto VALUES (96, 'CONSTRUINDO DINAMôMETRO COM MATERIAIS RECICLáVEIS', 'Quando subimos em uma balança de chão não estamos nos pesando, como costumamos dizer, e sim quantificando nossa massa. Pois o peso depende da ação da gravidade (que na Terra é de aproximadamente 10 Newton). Então, por este fato a única maneira de realmente sabermos o peso de algo é com o auxílio de um dinamômetro, o qual tivemos como objetivo construir utilizando apenas materiais que fossem recicláveis. Nosso método então foi usar um elástico de dinheiro preso a um canudo de aproximadamente 22cm onde estava colada uma régua de papel e, na extremidade inferior, um gancho de arame preso junto à régua. Todos estes materiais foram colocados dentro de um cano de PVC de 30cm. Quanto maior a carga pendurada ao gancho, mais o elástico se estica, o que nos possibilita visualizar a régua e, aonde ficar o final do cano de PVC, nos indica, indiretamente, o peso do objeto. Nossa tentativa teve um resultado positivo, pelo fato de contar junto à gravidade conseguimos pesar os objetos testados, o que não conseguimos com uma balança, que apenas quantifica a massa. Pelo fato de que queríamos que fosse um dinamômetro construído apenas com materiais recicláveis e simples, não temos a garantia de que este seja resistente da mesma forma que provavelmente seria, caso fosse feito com materiais novos e complexos.', NULL, NULL, '2018-08-09 18:19:31', '2018-09-20 19:47:07', 10, 3, 6, 5, true, 7.375, 8.89999999999999858);
INSERT INTO public.projeto VALUES (194, 'APRENDIZAGEM DE CONCEITOS DA ADMINISTRAçãO COM JOGOS DIGITAIS : RELATOS DE EXPERIêNCIAS', 'Introdução: Jogo é uma didática utilizada em escolas de negócios. Uma didática que utiliza métodos ativos na qual possibilita um ambiente simulado do mundo de negócios para a construção e aplicação de conceitos. O projeto Jogos de Simulação Inferenciais Digitais (JSID) em Ciências Sociais Aplicadas: Desafios e Oportunidades Didáticos Pedagógicos propõe-se investigar e criar alternativas didáticas para o ensino destas Ciências. Objetivo geral: Identificar e relatar os conteúdos do Curso Técnico de Administração que podem ser trabalhados com didáticas de métodos ativos e pela prática dos jogos de simulação digitais. Metodologia: utilizando o Relato de Experiências em sessões comatividade prática de jogos digitais em diversas temáticas:gestão de negócios,civilização, gestão de cidades; transporte e logística. Até o presente momento foi experimentado os jogos de negócios Lemonade Tycoon e Lemonade Stand. Resultados: foi verificado na prática nos jogos digitais as possibilidades de:identificar os conceitos de estratégia competitiva de Porter, operar os conceitos de marketing de “ 4Ps “ (Produto, Preço, Praça e Promoção) de Kotler edesenvolver de forma crítica as competências de planejamento, organização, coordenação e controle. Considerações Relevantes: daspráticas dos jogos digitais constatou-se a possibilidade de identificação de construçãode conceitos da Administração por um método ativo em detrimento de uma abordagem puramente teórica tornando assim mais interativa,críticae lúdicaa aprendizagem. Apoio: oficinas permanentes de cultura, oficinas de jogos no ensino, e a da Oficina de Estudos Estratégicos daUniversidade Federal do Rio Grande do Sul.', NULL, NULL, '2019-07-19 20:10:06', '2019-09-17 16:12:00', 5, 2, 7, 2, NULL, 6, NULL);
INSERT INTO public.projeto VALUES (359, 'A CAIXA TETRA PAK E SUAS FUNCIONALIDADES.', 'Visamos a melhoria do ambiente e população. Entrevistamos ONG Brasil sem Frestas, que reutiliza caixas Tetra Pak como isolante térmico em casas de madeira com frestas. Tal organização tem sede em Passo Fundo e pontos de coleta em dois outros municípios. E há a possibilidade da implementação na UFRGS. Os objetivos são: identificar as embalagens Tetra Pak, estimular a coleta seletiva de Tetra Pak, divulgar a importância da separação correta das caixas e sua aplicação na forração térmica, informar a necessidade da criação de postos de coleta para viabilizar projetos que beneficiem a comunidade e o. Pesquisamos sites, entrevistamos a ONG Brasil sem Frestas e questionários para pessoas de idades variadas. As caixas são separadas por cores e marcas, para que a casa seja igualmente revestida. Dos 141 entrevistados, 68,1%, não sabiam do que as caixas Tetra Pak eram compostas. As caixas são compostas por camadas como: o polietileno, o papel e a folha de alumínio. Descobrimos que muitas pessoas reutilizam e selecionam as caixas Tetra Pak como material para reciclagem. E 75,2% desconheciam a ONG. Também revelou que as caixas ainda são desconhecidas e por desconhecer sua importância, acabam descartando no lixo. A caixa Tetra Pak, além de preservar alimentos por mais tempo, pode ser reciclada e reutilizada para outros fins. Projetos esses que já se encontram em execução em regiões do Rio Grande do Sul, como nos contou um professor, que a usou em sua própria casa e através da ONG.', NULL, NULL, '2019-08-14 11:12:34', '2019-09-17 16:12:00', 10, 3, 7, 2, NULL, 5.25, NULL);
INSERT INTO public.projeto VALUES (322, 'TRAVA ELETRôNICA UTILIZANDO ARDUINO', 'De maneira direta, o objetivo do projeto está relacionado a uma maneira rápida e de baixo custo a fim de solucionar o problema da falta de controle por parte das instituições de ensino quanto a entrada e saída dos alunos e servidores desses respectivos estabelecimentos. O Massacre de Suzano foi um massacre escolar ocorrido em 13 de março de 2019, na Escola Estadual Professor Raul Brasil no município de Suzano, no estado de São Paulo. Dez pessoas foram mortas na manhã do ocorrido. Rodrigo Maia, Presidente da Câmara dos Deputados, manifestou sua solidariedade às famílias das vítimas e falou que &#34;é hora de o Brasil unir forças e competências para compreender o que houve e impedir a repetição de massacres como este&#34;. Esse projeto torna-se importante a partir do momento em que há uma crescente insegurança dentro das escolas, tanto aqui no Brasil quanto em outros lugares, como por exemplo, em países com maior ocorrência desses lamentáveis incidentes e utilizando o conhecimento científico é possível projetar diversas e incontáveis maneiras de inibir esse problema. Apropriando-se da metodologia experimental, o projeto visa desenvolver uma trava eletrônica a partir da plataforma Arduino, utilizando os conceitos de programação na linguagem própria do Arduino, indução eletromagnética, sinal wireless, rádio frequência, montagem de circuito, entre outros, além disso, desenvolver técnicas para aumentar a eficiência e segurança, como por exemplo, enviar um mensagem ao usuário sempre que a trava fosse desbloqueada com o uso de suas credenciais. O projeto almeja que alunos tenham suas próprias credenciais de acesso a suas instituições de ensino. Utilizando o módulo RFID RC 552 para o desbloqueio da trava eletrônica e através de um banco de dados que registra o nome do aluno, hora e data do acesso ou retirada da área, será possível ter controle sobre quem saiu e quem entrou nas mediações da escola.', NULL, NULL, '2019-08-10 19:28:05', '2019-09-19 14:29:10', 7, 2, 7, 5, true, 7.5, 0);
INSERT INTO public.projeto VALUES (231, 'GLIFOSATO: O HERBICIDA COM POTENCIAL CANCERÍGENO', 'O Glifosato é um herbicida sistêmico de amplo espectro. É considerado o agrotóxico mais usado no mundo, especialmente no Brasil. Ele aumenta em 41% o risco de uma pessoa exposta vir a desenvolver o linfoma não-Hodgkin - um tipo de câncer que tem origem nas células do sistema linfático e que se espalha de maneira desordenada pelo organismo -. A constatação é de uma ampla pesquisa da Universidade da Califórnia em Bekerley, Universidade de Washington e da Faculdade de Medicina Mount Sinai, de Nova Iorque, divulgada pela Elsevier. Assim, o grupo objetivou identificar os conhecimentos prévios sobre o Glifosato, que os internautas de determinadas comunidades apresentaram, visando ao esclarecimento desses riscos em âmbito escolar e midiático, evitando a desinformação. Ademais, seguiu-se as seguintes etapas metodológicas: buscou-se conhecimento sobre seus componentes, através de leituras, análises e discussões. A seguir, viu-se uma insigne omissão da substância e os processos jurídicos contra a empresa responsável e, então, utilizou-se a internet para formular e divulgar um questionário online com perguntas a respeito do herbicida e conhecimento prévio a ele. Assim, dentre as 110 pessoas que responderam, obteve-se 60,2% das respostas de jovens de 16 a 19 anos e 29,6% de 20 anos ou mais. Desses, 89,4% afirmaram que o uso excessivo é desnecessário, principalmente em possíveis casos de câncer. No entanto, 84,6% desconhecem o agrotóxico Glifosato, que foi classificado em 2015 pela Agência Internacional de Pesquisas em Câncer (IARC) da Organização Mundial da Saúde como &#34;provavelmente cancerígeno em humanos&#34; (Categoria 2A) com base em estudos epidemiológicos, em animais e in vitro. Dessa forma, é possível substituir essa aplicação prejudicial ao ser humano e à natureza: a cobertura do solo com lonas de plástico biodegradáveis ou palha, preparação do terreno com a sacha e o controle térmico, tornam-se investimentos viáveis e sustentáveis em longo prazo.', NULL, NULL, '2019-08-07 10:59:09', '2019-10-26 18:04:17', 4, 2, 7, 5, true, 7.875, 9.06428571428569896);
INSERT INTO public.projeto VALUES (78, 'GENéTICA POPULACIONAL – MUTAçãO/ADAPTAçãO', 'O objetivo deste trabalho de pesquisa é expor com as pessoas o assunto da mutação/adaptação do corpo humano em determinadas circunstâncias. Acreditamos que conhecer as mudanças do corpo é importante, mas que conhecer como e os motivos pelas quais elas acontecem traz benefícios para o indivíduo dentro de diversos aspectos preponderantes que permeiam esse contexto. Tomemos como exemplo a diferença da quantidade de melanina presente nos corpos de indivíduos de determinadas regiões do planeta, uma pessoa que vive em uma área com grande incidência solar terá a pele mais escura do que alguém que vive em outra área com menos incidência, ou seja, o individuo que vive na área com maior incidência terá mais resistência à luz solar. Para chegarmos a uma resolução do objetivo realizamos um breve questionário com um grupo de pessoas para descobrir qual era o nível de conhecimento delas sobre o tema abordado. Após o termino do questionário, as pessoas criavam interesse em saber o porquê da pergunta, logo respondíamos a real resposta. Em síntese constatamos que praticamente nenhuma delas soube responder, porém algumas tinham uma pequena idéia sobre o que se tratava a resposta, e todas criaram interesse no debate do tema. Por término concluímos que a abordagem do tema com as pessoas, no geral tendo ou não conhecimento, é importante para entendermos de maneira mais ampla as adaptações do nosso próprio corpo mediante ao meio em que ele se encontra, além de estimular a criação de hipóteses e o interesse científico.', NULL, NULL, '2018-08-08 16:02:43', '2018-09-20 19:47:07', 4, 2, 6, 5, true, NULL, 5.93125000000000036);
INSERT INTO public.projeto VALUES (188, 'UTILIZAçãO DE RESíDUOS SóLIDOS DO AMBIENTE ESCOLAR PARA CONSTRUçãO DE UM JARDIM SUSPENSO', 'Uma das grandes preocupações do mundo contemporâneo, é o que fazer com a grande quantidade de material residual oriundo do consumo humano. No ambiente escolar, este problema não é diferente, dada a herança cultural que ainda há na sociedade brasileira. Neste sentido, o presente trabalho teve por objetivo iniciar um projeto de utilização de resíduos recicláveis para criação de um jardim suspenso. Foram coletados resíduos nas lixeiras do pátio da escola que pudessem ser utilizados para o plantio de plantas ornamentais, classificados quanto a sua origem material e pesados numa balança de precisão. Foram realizadas sete coletas, entre maio a agosto de 2018, obtendo um total de 4,741 kg de resíduos, sendo destes, 3,198 kg de garrafa PET, 489 g de recipientes de papelão, 383 g de recipientes plásticos, 355 g de latas de alumínio e 316 g de tampinhas plásticas. Evidenciou-se que os resíduos, de origem plástica compreenderam 82,2%, os de papelão contabilizaram 10,3% e o de alumínio 7,5%. Apesar de 67,5% do total ser somente de garrafa PET, o tipo plástico de maior reciclagem no país, ademais tornaram-se um grande problema ambiental, pelo longo tempo que levam para se decompor. Por fim, indica-se que na compra de produtos, sejam consideradas as embalagens com menor tempo de degradação, como o papelão, ou que tenham grande valor econômico, como o alumínio, afim de que se diminua o dano ambiental gerado pela produção de lixo na Escola Municipal de Ensino Fundamental General Osório.', NULL, NULL, '2018-09-17 11:30:40', '2018-09-20 19:47:07', 10, 3, 6, 5, true, 7.5, 8.875);
INSERT INTO public.projeto VALUES (342, 'ESPORTIZANDO', 'O Projeto ESPORTIZANDO propõe aos estudantes do IFRS Campus Canoas a oportunidade de ampliar seu vocabulário motor através de vivências de modalidades esportivas que não são comumente praticadas no campus. A ideia do nome é provocar a curiosidade e o interesse em querer praticar atividades físicas, a partir de experiências esportivas ou corporais de forma constante. ESPORTIZANDO quer oportunizar que os estudantes se mantenham ativos para além do horário das aulas de educação física e assim conquistem hábitos de saúde para a melhoria da qualidade de vida. Faz parte da metodologia do projeto desenvolver as atividades físicas em nível de iniciação, treinamento e recreação, bem como a participação em eventos esportivos promovidos também pelo projeto e pelo instituto. Tem-se, em âmbito social, o objetivo de estimular a inclusão dos estudantes no ambiente do IFRS, promovendo atividades desportivas com atenção maior para práticas em conjunto entre todos os participantes do projeto, visando esportes coletivos com interação, além de desenvolver a disciplina, postura, respeito, autoconhecimento, alteridade, trabalho em equipe, habilidades de socialização e, finalmente, disponibilizar momentos de lazer que também propiciam um aprendizado fundamental para o desenvolvimento social, emocional e profissional dos participantes. Utilizando momentos de treinos e atividades voltadas ao esporte e à dança, busca-se obter na extensão do ano letivo o aumento do interesse e de interação dos participantes com o mundo esportivo e com uma vida de saúde e atividades físicas regulares, independente da presença ou ausência de experiências anteriores com tais práticas, porte físico ou gênero, além de um sentimento de pertencimento na instituição.', NULL, NULL, '2019-08-11 01:17:39', '2019-09-17 16:12:00', 4, 2, 7, 2, NULL, 6.5, NULL);
INSERT INTO public.projeto VALUES (115, 'ROBô ASPIRADOR', 'Este trabalho apresenta o desenvolvimento de um aspirador de pó robótico, dotado de sensores, atuadores e interface de comunicação sem fios. Para a criação do robô foram utilizados hardware, software livre e materiais recicláveis. Nesta primeira versão do projeto o robô possui 1 Arduíno Eleggo, 1 placa de extensão, 2 ponte H, 1 módulo relé, 1 sensor de distância ultrassônico, 1 servo motor, 1 bateria de lítio 3.7 volts, 1 bateria 12 volts, 1 motor 12 volts, 1 cooler, 2 vassouras circulares, 2 garrafas pet, um pedaço de mangueira, 6 motores de roda e 4 rodas, com todos estes componentes fixados (através de parafusos, fita dupla face e/ou Tyraps) à uma base de madeira Eucatex 3mm. O robô funciona de duas maneiras: manual ou automática. Na forma manual é possível comandar o acionamento das vassouras, o acionamento do aspirador, e ainda controlar para qual direção o robô andará. Todo controle do aspirador pode ser realizado através de um aplicativo de celular, que será responsável por enviar os comandos através de uma conexão Bluetooth. Na forma automática, quando o aspirador é ligado, todos os componentes dele funcionam juntos, não se tendo um controle de cada parte, ou seja, não é possível controlar o acionamento das vassouras ou do aspirador em si, nem da direção, pois ele seguirá sempre reto até que o sensor ultrassônico detecte um objeto à frente, que vai medir a distância do seu lado esquerdo e direito e virar para seguir andando naquela que for maior, caso as duas sejam iguais, ele volta para trás. O objetivo deste aspirador automático é facilitar a tarefa de limpeza e espera-se que diminua o tempo perdido por estas pessoas através desta tarefa doméstica. Além disto, o aspirador robótico tem um baixo custo, por se utilizar materiais recicláveis, o que possibilita mais pessoas terem acesso a ele.', NULL, NULL, '2018-08-10 11:16:41', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 6.77500000000000036);
INSERT INTO public.projeto VALUES (152, 'PROGRAMANDO FáCIL: CONHECENDO A COMPUTAçãO', 'De acordo com dados fornecidos pelo IDEB, os alunos do nono ano do Ensino Fundamental das cidades de Osório e Tramandaí atingiram apenas em 21% do aprendizado adequado em Matemática, e 40% em Português, aproximadamente. Assim, é necessário que existam ações socioeducativas voltadas ao uso adequado do raciocínio lógico, em proveito do aumento da qualidade da educação básica. Através do projeto Programando Fácil, encontramos uma forma de discutir essa problemática, contribuindo para a consolidação do conhecimento dos alunos, de forma lúdica, envolvendo o uso de jogos para o desenvolvimento do pensamento computacional. São oferecidas oficinas aos alunos das séries finais do Ensino Fundamental, das escolas da região do litoral norte, abordando um primeiro contato com a Computação, com o uso da plataforma code.org, sendo esta uma organização sem fins lucrativos com objetivo de divulgar e ensinar programação a pessoas de todas as idades. Em cada oficina é realizado um teste avaliativo inicial e outro final, a fim de verificar e comparar os conhecimentos obtidos durante as atividades. As oficinas podem ser realizadas tanto no laboratório de informática da Escola convidada quanto nas dependências do IFRS Campus Osório, possibilitando também a divulgação dos cursos oferecidos na Instituição. Até o momento, as oficinas mostraram uma melhoria significativa em seus resultados, indo de 3,29 acertos iniciais para 4,44 acertos ao final da oficina, dentre 5 questões propostas, motivando o grupo a continuar aplicando o projeto. Até o momento, o retorno recebido dos participantes tem sido positivo, instigando os estudantes a conhecerem mais sobre a Computação, bem como buscam impactar uma melhoria nos resultados do IDEB a longo prazo. Além disso, conclui-se também que as atividades proporcionam um momento de compartilhamento e integração entre os estudantes e a comunidade, atendendo os propósitos da extensão.', NULL, NULL, '2018-08-10 20:29:39', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7.875, 9.84375);
INSERT INTO public.projeto VALUES (205, 'SEGUNDA GUERRA MUNDIAL: A GUERRA EM HOLLYWOOD', 'Em nosso artigo abordamos a Segunda Guerra Mundial, conflito que ocorreu entre os anos de 1939 e 1945 dividindo o mundo entre Aliados (Estados Unidos, União Soviética, Inglaterra, França e os demais países que se integraram) e Eixo Berlim-Roma-Tóquio. Sempre nos interessamos por esse assunto pois é um grande marco para a história. É importante estudarmos e relembrarmos o conflito para que o mundo perceba os males causados e não cometa os nunca mais. Outro aspecto importante que nos levou à escolha do tema foi que desde sempre fomos incentivados a ter apreço por filmes, e assisti-los se tornou uma das melhores formas de nos divertimos. Pensando em conjunto, chegamos à conclusão de que seria ideal unificar um com o outro. Desse modo, nosso problema de pesquisa foi: “Como filmes atuais repercutem a Segunda Guerra Mundial?”. Assistindo e analisando cuidadosamente filmes sobre o conflito, poderíamos elevar nosso conhecimento. Tivemos como objetivo geral divulgar, após o estudo, como dois filmes atuais representam a Segunda Grande Guerra e específicos descobrir se tais filmes seguem fielmente a história verídica ou há distorções. Em termos metodológicos, nossa pesquisa está fundamentada na análise dos filmes Até o último homem e Corações de Ferro e de livros e artigos (ARNAUT, MOTTA; FERRO; REIS FILHO, FERREIRA, ZENHA; LOPEZ; PADRÓS, RIBEIRO, GERTZ). Começamos realizando a leitura dos livros e elaborando fichamentos sobre eles. Depois de termos nos apropriado desses estudos, assistimos e analisamos os filmes citados acima. Após análises, podemos observar que Até o Último Homem busca mostrar uma história verídica e chama atenção por trazer conflitos dentro do território japonês, algo não muito abordado. Corações de Ferro apenas representa o conflito na prática, trazendo ao público a vida e a rotina de combatentes dentro da guerra, algo também interessante. Sendo distintos, retratam a guerra de forma diferente, mas trazem a essência do conflito.', NULL, NULL, '2019-07-25 16:33:04', '2019-09-17 16:12:00', 3, 2, 7, 2, NULL, 6.875, NULL);
INSERT INTO public.projeto VALUES (310, 'EXPERIMENTO DE JOULE', 'No final do século 18 e início do século 19 o estudo da Termodinâmica tornou-se o foco mais importante na Física. Questões básicas acerca do calor, como sua natureza, motivaram o desenvolvimento dessa teoria e o estabelecimento de suas leis. O trabalho proposto tem como objetivo compreender a relação entre trabalho mecânico e calor através da montagem de um experimento, similar ao desenvolvido por James Prescott Joule na determinação da relação entre essas grandezas, a primeira medida em Joules e a segunda medida em calorias. A montagem do experimento consiste num dispositivo feito por um recipiente que contém água em seu interior e um sistema de aletas que realizam movimento giratório através do movimento de descida de duas massas presas por um fio que passa por duas roldanas. Quando as massas são liberadas de certa altura, durante sua descida com velocidade constante, a força de atração gravitacional realiza trabalhos sobre elas ao mesmo tempo em que o sistema de aletas dentro da água do recipiente é agitado. Essa agitação gera um aumento na temperatura da água do recipiente. Nesta situação, temos a transformação da energia potencial gravitacional, cujo valor pode ser determinado pela altura de “queda” e do peso das massas, em aumento da energia térmica da água, cujo valor poder ser determinado pela quantidade da água no recipiente e sua variação de temperatura. Joule estabeleceu uma relação entre o trabalho e a quantidade de energia transferida na forma de calor, encontrando a equivalência entre eles de 1,0 cal = 4,18 J. Este é denominado também de equivalente mecânico do calor. Nosso experimento não tem a preocupação de determinar com precisão a relação caloria-joule como conhecemos hoje, mas sim, de proporcionar a verificação direta do aumento da temperatura da água no interior do recipiente através de um termômetro digital. Com isso, estaremos explorando um importante experimento de termodinâmica para a compreensão de um pouco da dinâmica da energia.', NULL, NULL, '2019-08-10 15:57:50', '2019-09-17 16:12:00', 4, 2, 7, 2, NULL, 6.875, NULL);
INSERT INTO public.projeto VALUES (214, 'REMOLDED – ENSAIO SOBRE REUTILIZAçãO DE TECIDOS NA DEMONSTRAçãO SOBRE SUSTENTABILIDADE', 'O projeto Remolded é desenvolvido por alunos do Curso Técnico de Mecânica da Fundação Escola Técnica Liberato Salzano Vieira da Cunha a fins de efetuar o PID (Projeto Interdisciplinar) proposto pelo curso. Nosso projeto consiste na obtenção de uma placa de tecido sobreposto a partir de resíduos de malharias, também chamados de retalhos, que muitas vezes não recebem o descarte correto e nem mesmo o tratamento correto. Assim, com a obtenção desta placa, planeja-se criar instrumentos educativos que visam corroborar no desenvolvimento da consciência ecológica e entendimento da importância da sustentabilidade na infância e juventude, assim como, proporcionar a melhora de habilidades como: lateralidade e motricidade fina e ampla. De forma metodológica, dividimos esta pesquisa em três partes para sua execução: a obtenção da placa, a criação de um instrumento educativo e por fim a caracterização química e mecânica desse. A obtenção será feita a partir de um processo de sobreposição, onde os retalhos foram adquiridos a partir de doação da empresa Linda Flor Confecções e serão sobrepostos com adição de Acetileno de Polivinila (PVA) em uma caixa de aço SAE 1020 e comprimidos durante a secagem. Será desenvolvido com o auxílio de profissionais da área da pedagogia e membros do Centro Pedagógico da Fundação Liberato, como Juliana Von e Cláudia Klinski, um instrumento educativo que seja de fácil aprendizado e inserção na infância e juventude. Já a última etapa do projeto, a caracterização do material desenvolvido será executada nos laboratórios de ensaios do curso de Engenharia mecânica da Universidade do Vale dos Sinos (Unisinos) com a mediação da Professora Tatiana Louise Avila de Campos Rocha.', NULL, NULL, '2019-08-05 08:13:49', '2019-09-17 16:12:00', 7, 2, 7, 2, NULL, 6.875, NULL);
INSERT INTO public.projeto VALUES (49, 'ESSE É O NOSSO JEITO DE SER: &#34;CADA UM DO SEU JEITO&#34;', 'O projeto Esse é nosso jeito ser: “Cada um do seu jeito, consiste no desenvolvimento de pesquisa e proposição de atividades interativas para toda comunidade da Escola Municipal de Ensino Fundamental Sete de Setembro. A pesquisa tem como objetivo proporcionar a interação dos alunos atendidos na Sala de Recursos com os demais alunos e profissionais da escola, através de dinâmicas diversificadas utilizando materiais alternativos e recicláveis. Percebendo o distanciamento das práticas escolares em relação ao trabalho realizado pelo Atendimento Educacional Especializado (AEE), e a diversidade de idades dos alunos que freqüentam a sala de recursos, surgiu a ideia de organizar estratégias para aproximar as práticas das necessidades específicas dos alunos. Pensando na coletividade e na valorização das vivências, foi planejado e construído este projeto. A metodologia do trabalho é composta por sete etapas, dividida em: Planejamento, coleta de dados e análise, construir estratégias para aproximar as práticas (objetivos), construção da dinâmica de trabalho, experimentos, verificação da relevância da construção de dinâmicas desenvolvidas e aplicação nas turmas (coleta de dados e análise) e conclusão. As análises feitas até o momento permitem afirmar que é possível criar estratégias através de dinâmicas e brincadeiras alternativas que aproximem as práticas cotidianas da escola, além do fato que o contato dos alunos com uma aplicação de projeto serve também como incentivo à pesquisa.', NULL, NULL, '2018-08-07 09:10:49', '2018-09-20 19:47:07', 12, 3, 6, 5, true, NULL, 10);
INSERT INTO public.projeto VALUES (293, 'AACE - AUXILIAR DE APRENDIZADO DE CIRCUITOS ELéTRICOS', 'Auxiliar de Aprendizado de Circuitos Elétricos – AACE Um circuito elétrico é a conexão de componentes ligados em circuito fechado, por meio de fios condutores. A matéria de Circuitos Elétricos estuda seu funcionamento, analisando os seus diversos componentes e suas funções, assim como as suas aplicações na atualidade. Partindo do fato que convivemos cada vez mais com essa tecnologia, é útil uma ferramenta que auxilia no aprendizado e entendimento do desenvolvimento de circuitos complexos. A área da informática é muito ampla, possibilitando vários tipos de projetos que podem ser utilizados em diversas regiões do conhecimento. Este projeto é focado na parte de transmissão de informação, também é encaixado na região da computação e foi escrito em uma linguagem de programação considerada nível médio. A ferramenta AACE (Auxiliar de Aprendizado de Circuitos Elétricos) é um programa desenvolvido na IDE Visual Studio Community na linguagem de programação Visual C#. Ela possui recursos de aprendizagem, com uma aba específica de material didático do assunto e conta também com meios de facilitar as análises de diversos tipos de circuitos, através de aplicações da Lei de Ohm em sinais contínuos e alternados, além de uma ferramenta de associação de resistência e impedância. Com este programa, a aprendizagem da matéria de Circuitos Elétricos se torna facilitada, criando um ambiente favorável para o estudante na resolução de cálculos complexos e compreensão de conceitos utilizados na área de eletrônica, e para pessoas com curiosidade de aprender sobre isso, mesmo atuando em outras áreas do conhecimento.', NULL, NULL, '2019-08-09 23:49:00', '2019-09-17 16:12:00', 6, 2, 7, 2, NULL, 4.5, NULL);
INSERT INTO public.projeto VALUES (318, 'OFFBOARD - MANUTENçãO E SUPORTE A SERVIçO DA COMUNIDADE', 'O projeto Offboard é uma iniciativa do campus Canoas, para capacitar e estimular os alunos na realização de manutenção e assistência técnica em serviços de informática, atendendo tanto a comunidade interna do campus quanto a externa. Essas atividades são realizadas por 4 integrantes, sendo um bolsista e três voluntários. Entre as atividades são destacadas a manutenção, a formatação, a catalogação, a limpeza e o teste de peças. Através de doações de componentes, são montados computadores de mesa e notebooks, que são disponibilizados para serem doados ou emprestados para discentes com baixa renda ou que sofreram imprevistos com suas máquinas, impossibilitando a realização de atividades requisitadas pelo campus. Estes mesmos computadores montados são utilizados para fazer a verificação das peças que são oferecidas ao projeto. As peças doadas são devidamente testadas e verificadas. Caso apresentem defeitos, busca-se aproveitar ao máximo os componentes ainda funcionais da peça defeituosa. O projeto preocupa-se com o destino adequado dos materiais que são descartados frequentemente, com isso, fora feita uma parceria com uma empresa externa, que implementou uma lixeira específica para descarte de materiais, e resíduos eletrônicos no IFRS - Campus Canoas. Neste momento, está sendo implantado nos computadores do projeto, um sistema operacional, baseado em linux, desenvolvido pela equipe do projeto Offboard, consequentemente, ampliando o projeto para o meio externo. Além da montagem de computadores, o projeto oferece oficinas de capacitação para a comunidade interna e externa, levando assim integração entre o nível médio-técnico com os outros níveis de educação do campus Canoas, visando possibilitar o maior entendimento e a realização de atividades básicas de manutenção e assistência técnica. Além de aprimorar o conhecimento de todos os envolvidos nas oficinas o projeto acaba por ter uma maior visibilidade dentro e fora do campus.', NULL, NULL, '2019-08-10 18:43:52', '2019-09-19 13:32:28', 6, 2, 7, 5, true, 7.25, 9.43214285714284983);
INSERT INTO public.projeto VALUES (224, 'CRIMINOSOS DO DIA A DIA: AS CORRIQUEIRAS INFRAÇÕES VIRTUAIS E A DESINFORMAÇÃO A RESPEITO DO CÓDIGO PENAL', 'O fenômeno da globalização, facilitou o acesso às mais diversas informações e plataformas, entretanto, favoreceu também a disseminação de conteúdo impróprio e violação de direitos pessoais. Ergo, o grupo objetivou estabelecer margem definidora entre liberdade e infração e analisar o nível geral de conhecimento dos usuários a respeito de certas leis presentes no Código Penal, cujo conteúdo diz respeito a situações presentes em seu cotidiano. Desse modo, então, esclarecer sua importância a fim de promover o exercício pleno e consciente da cidadania, além de empregar essa conduta na construção de uma sociedade mais harmônica. Para tanto, seguiu-se as seguintes etapas metodológicas: a priori, buscou-se a total compreensão da legislação penal brasileira por meio da leitura e posterior análise coletiva e discussão. A seguir, utilizou-se da internet para pesquisar dados a respeito da recorrência das respectivas infrações e seu impacto no modo de vida socioeconômico vigente e, em seguida, foi elaborado e divulgado pelo grupo um formulário digital com perguntas a respeito da percepção e contato prévio individual com esses casos. Nesse quadro, dentre as 145 pessoas que responderam ao questionário, obteve-se 42,8% das respostas de jovens de 17 a 20 anos e 31,7% de 30 anos ou mais. Ademais, os exemplos citados por esses não abrangem a totalidade dos delitos desse âmbito, e tal desinformação comprovou-se ainda pela totalidade de pessoas que declararam já haver tomado conhecimento de atitudes de transgressão (62,8%) e não ter agido em repressão a elas (77%), ação que também caracteriza violação da lei. Como considerações finais, vale ressaltar que 57,2% nunca teve contato com os próprios direitos e deveres sociais durante o ensino básico ou médio. Portanto, compreende-se essencial a introdução dessa abordagem no ambiente escolar, visto que nessa etapa os jovens já se apresentam inseridos nas mídias sociais digitais.', NULL, NULL, '2019-08-06 18:30:15', '2019-10-26 18:07:45', 5, 2, 7, 5, true, 7.5, 9.4535714285714505);
INSERT INTO public.projeto VALUES (4, 'USO DE TÉCNICAS DE GAMIFICAÇÃO COMO AUXÍLIO AO ENSINO E APRENDIZAGEM DE LÓGICA DE PROGRAMAÇÃO', 'Este projeto de pesquisa visa explorar o potencial do conceito de gamificação como estratégia contemporânea relevante e poderosa para atrair a atenção dos alunos. Seu objetivo principal é utilizar o conceito de gamificação na construção de um ambiente lúdico virtual para auxiliar no ensino e aprendizagem de lógica de programação aos alunos dos primeiros anos dos cursos técnicos em Desenvolvimento de Sistemas e Eletrônica, visto que os projetos de cursos (PPCs) destes 02 (dois) cursos possuem a disciplina de lógica de programação como um de seus componentes curriculares. Além de servir de ferramenta para os alunos, acredita-se que a solução elaborada também atenderá às demandas dos professores que ministram a referida disciplina. O uso do conceito de gamificação em ambientes de aprendizagem tem sido área que desponta e pode se revelar oportunidade de atividade profissional destes alunos posteriormente. Este projeto visa, ainda, motivar os alunos que cursam lógica de programação a aprenderem respeitando seu próprio ritmo e possibilitando maior autonomia em suas atividades. Tem-se observado que as disciplinas de Lógica de Programação, nos diversos cursos do IFRS Campus Canoas, apresentam uma grande retenção, a qual está relacionada, muitas vezes, à falta de motivação e à diversidade de ritmos de aprendizagem. Cabe ressaltar que este projeto ja está em andamento e tem-se obtido excelentes resultados descritos na produção cientifica e publicados em diversos eventos de Computação, incluindo eventos internacionais de grande visibilidade.', NULL, NULL, '2018-07-09 22:54:14', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 9.62946428571428648);
INSERT INTO public.projeto VALUES (225, 'O PAPEL DA MULHER NA CONSTRUÇÃO EPISTEMOLÓGICA DA SOCIEDADE CIENTÍFICA', 'O período da Grécia Antiga influenciou diversos comportamentos presentes na sociedade do século XXI. Embora criações como a democracia tenham seus aspectos positivos, é essencial destacar que nem todos os legados da época possuem esse resultado. O machismo, que declarava as mulheres como incapazes de formar raciocínio político ou científico suficiente para serem consideradas cidadãs, fundamentou a desvalorização feminina presente no decorrer de toda a história humana. Reunir dados que comprovem essa depreciação e analisar a perspectiva da sociedade contemporânea sobre essa informação são o fulcro do trabalho. Para atingir tal objetivo o grupo formulou um questionário que, em primeiro plano, perguntava as informações básicas para compreensão do perfil dos entrevistados, como idade e escolaridade. Nesse âmbito, destacou-se o grupo de 15 a 21 anos, cursando o ensino médio, deixando em segundo lugar o público com mais de 35 que frequenta ou já concluiu o ensino superior. Posteriormente, o documento continha imagens de personalidades importantes no meio científico, tanto masculinas quanto femininas, onde era questionado nível de conhecimento dos interrogados sobre esses. Segundo os resultados, dentre as 120 pessoas entrevistadas, mais de 100 souberam identificar Albert Einstein e Galileu Galilei. Contraposto a isso, apenas 52 conheciam Marie Curie e outros 32 Rosalind Franklin. Quando indagados sobre as fontes desses conhecimentos, 85,8% que afirmaram que aprenderam sobre os cientistas homens na escola, enquanto apenas 37,6% foram instruídos sobre os trabalhos femininos nesse mesmo local. Por último, aos 86,8% que não consideraram essa valorização suficiente foi viabilizada uma área para exposição de ideias, onde foram arrecadadas opiniões sobre como melhorar essa situação. Entendemos que a mulher ainda precisa de mais espaço no meio científico. Desse modo, verifica-se a existência de um problema que dímere os avanços de milhares de mulheres.', NULL, NULL, '2019-08-06 18:38:20', '2019-10-26 18:06:29', 5, 2, 7, 5, true, 8.125, 8.85357142857144908);
INSERT INTO public.projeto VALUES (399, 'UMA VIVêNCIA IOT: ESPANHOL CONSCIêNCIAS', 'Neste trabalho, iremos abordar diferentes áreas do conhecimento, estimulando o aumento da proficiência em Língua Espanhola. Também, atingiremos diferentes públicos propiciando a globalização das aprendizagens, estimulando como fator principal a gestão de projetos. Embasados nos escritos de Bourdieu (1989), sabemos que a cultura dominante, aqui o capital simbólico das línguas, tem distintas funções, ao mesmo tempo que une, separa e também legitima distinções, conforme a distância que ocupa em relação às culturas dominantes. Neste sentido propomos de forma integrada e gradativa, a tradução do portal www.saladafisica.com transcrevendo da Língua Portuguesa para Língua Espanhola. Escolhemos ciência e espanhol, como uma resposta para introduzir o estudante a um segundo idioma bem como dar acesso a sistematização de pesquisas de qualidade neste campo. Nossa metodologia será baseada na Pesquisa do acordo ortográfico da Língua Espanhol, atividade essa mediada pelos professores e executada pelos alunos. Nossas percepções até o momento sinalizam a necessidade cada vez maior de rompermos com este capital simbólico das línguas, imposto, uma vez que as ideologias são sempre duplamente determinantes e a nossa neste viés é sinalizar como moradores de um país fronteiriço e próximo de hispanohablantes, a necessidade da inserção, estudo e aprofundamento do mesmo no campo acadêmico.', NULL, NULL, '2021-10-08 16:39:30', '2021-11-16 09:24:25', 11, 3, 9, 5, true, 8, 8.48750000000000071);
INSERT INTO public.projeto VALUES (341, 'CONTROLE DE FREQUÊNCIA ESCOLAR INTELIGENTE', 'O controle de frequência estudantil é essencial para a comprovação de presença do aluno. Esse controle é, normalmente, caracterizado por ser um processo manual realizado diariamente por professores, que frequentemente enfrentam dificuldades durante o processo. Com isso, o presente trabalho possui como objetivo prover um controle de frequência efetivo e eficaz, através de um sistema de chamada inteligente, utilizando algoritmos de reconhecimento facial. Para isso, foi elaborado e aplicado uma pesquisa de opinião, através de um questionário destinado a professores, obtendo 53 respostas, com a finalidade de compreender como é realizado o controle de frequência nas escolas, fazendo um levantamento de dificuldades encontradas pelos professores durante esse processo. Como resultado desse questionário, destacam-se que os professores despendem em torno de cinco minutos para completar o controle de frequência em uma sala de aula. Além disso, 77,4% dos professores afirmaram ter vivenciado algum problema relacionado ao método de controle de frequência tradicional. Com base na análise dos resultados obtidos, foi desenvolvido um sistema de controle de frequência baseado em reconhecimento facial. Para a elaboração do sistema, inicialmente foi realizada uma pesquisa bibliográfica sobre o assunto em questão. Após, foram levantados os requisitos do sistema, em função dos resultados obtidos no questionário. Baseado nisso, foi elaborada a arquitetura, modelagem e implementação do sistema. De uma forma geral, espera-se que a inserção da tecnologia no processo de controle de frequência, contribua de forma significativa para o aprendizado do aluno, através do aproveitamento do tempo antes utilizado no controle de frequência.', NULL, NULL, '2019-08-10 23:38:05', '2019-09-19 14:40:53', 6, 2, 7, 5, true, 8.375, 10);
INSERT INTO public.projeto VALUES (72, 'CONTROLE DE ACESSO A COMPARTIMENTO', 'Com a necessidade de armazenar e permitir que apenas pessoas autorizadas tenham acesso a um compartimento seguro designa-se a esta demanda um cofre, porém os modelos atuais são em vasta maioria pesados, dificultando sua portabilidade, além de possuírem poucos ou apenas um mecanismo de identificação. Tendo em vista esta demanda, a proposta deste trabalho é fazer algo pessoal, que se possa ter em casa, permita a mudança de local com maior facilidade em relação a cofres comuns e ao mesmo tempo mantenha os itens seguros. Conta com registro de uso e permite ao usuário diversas maneiras de acessar seu conteúdo. Para cumprir com esse objetivo, foi confeccionada uma caixa com dois compartimentos: a) módulo interno: onde ficam os componentes eletrônicos responsáveis pelo funcionamento (Arduino, NodeMCU, Leitor de Identificação por radiofrequência (RFID)); b) espaço interno para o usuário. Esta caixa possui os seguintes mecanismos de autenticação para garantir acesso a seu interior: a) Teclado numérico para senha (PIN): Para esta função foi utilizado um teclado numérico ou Keypad, com o intuito de receber do usuário o input de senha numérica. b) Identificação por Tag RFID (Cartão e Chaveiro): Para esta função foi utilizado o leitor de RFID para identificar o usuário e garantir acesso. c) Leitura de digital (Leitor Biométrico): Esta função realiza a autenticação por meio de um leitor biométrico. d) Mecanismo de fechadura de cópia de segurança/backup (Chave). Com o intuito de facilitar a utilização do usuário, há um Liquid Cristal Display (LCD), localizado junto ao leitor biométrico e teclado numérico na parte superior externa da caixa, instruindo o usuário para realizar configurações ou no processo de abertura da caixa. Para tornar possível a utilização do registro de acesso, foi utilizado um NodeMCU para disponibilizar os registros online. Os mesmos apresentaram Data e Hora e identificação do portador das credenciais utilizadas para abrir a caixa.', NULL, NULL, '2018-08-08 08:38:42', '2018-09-20 19:47:07', 7, 2, 6, 2, NULL, 5.375, NULL);
INSERT INTO public.projeto VALUES (176, 'GOVERNO JOÃO GOULART, GOLPE DE 1964', 'Este projeto de pesquisa aborda o governo de João Goulart. Com a renúncia de Jânio Quadros em 1961, assume a presidência do Brasil o até então vice-presidente João Goulart, que em 1964 torna-se vítima de um golpe de estado. Mostrar as diferentes opiniões e repercussões dos jornais da época, aprofundar os motivos do golpe e apresentar o Governo Goulart são os principais objetivos desta pesquisa. Para o desenvolvimento desta pesquisa realizamos uma pesquisa bibliográfica sobre o Governo João Goulart, desde sua eleição como vice-presidente até a sua renúncia e tendo seu fim posto por um golpe de estado militar. Para isso lemos os livros “ História Concisa do Brasil”, do autor Boris Fausto e “ O Governo João Goulart, as Lutas Sociais no Brasil – 1961 – 1964”, do autor Luiz Alberto Moniz Bandeira. A partir destas leituras primeiro compreendemos como se deu a chegada de João Goulart ao governo, os diversos acontecimentos que foram necessários para isso acontecer – Eleição de Jânio Quadros e João Goulart e posterior renúncia de Jânio Quadros em 19 de agosto de 1961. Seguindo essa pesquisa coletamos diversas informações para entender os fatos que aconteceram para que se desse o Golpe no dia 31 de março de 1964, desde a pressão sofrida por Kennedy e as várias manifestações sociais e confrontos de classe que influenciaram para que isso acontecesse. A partir destas leituras tentamos descrever os fatos acontecidos durante o Golpe de 1964, tentando elucidar como João Goulart chegou e foi retirado do governo. Fizemos também a leitura do Conhecendo esses fatos vamos procurar e fazer uma leitura das diversas notícias jornais Correio do Amanhã, fundado por Edmundo Bittencourt em 15 de junho de 1901 e Correio Braziliense, fundado por Assis Chateaubriand 21 de abril de 1960. Através dessas leituras buscaremos descobrir como a imprensa citada reagiu com todos os acontecimentos e como as notícias foram levadas através dos periódicos.', NULL, NULL, '2018-08-10 23:19:02', '2018-09-20 19:47:07', 3, 2, 6, 2, NULL, 7.5, NULL);
INSERT INTO public.projeto VALUES (313, 'DA FRIGIDEIRA PARA A TELA: A TINTA QUE SAI DA COZINHA!', 'Este trabalho tem o objetivo de apresentar uma maneira de aproveitar os resíduos de óleo gerados na cozinha da escola. A partir da crescente demanda de alternativas sustentáveis aos resíduos gerados pelos processos nas diversas rotinas da vida moderna, bem como, de que este reaproveitamento seja igualmente sustentável, viável e de interesse dos sistemas envolvidos, justifica-se buscar alternativas às ações mais comumente apresentadas como a produção de sabão ou ainda biodiesel. Dentro deste contexto, nosso grupo de pesquisa buscou uma nova utilização do resíduo disponível, mas que também servisse à rotina escolar, resultando em um produto que possa ser utilizado normalmente na escola com benefícios ecológicos e econômicos. Para atingir o objetivo proposto, foram realizadas pesquisas para identificar uma rotina de produção factível no ambiente escolar e que igualmente não fosse de grande custo financeiro. Adicionalmente, serão investigados os impactos de rendimento econômico, viabilidade técnica do processo e qualidade efetiva da aplicação do insumo produzido nas formas em que se apresentar. Os dados apresentados até o momento indicam que é possível, mas segue-se a investigação a fim de obter resultados definitivos sobre a qualidade do produto e sua aplicação na rotina escolar.', NULL, NULL, '2019-08-10 17:15:17', '2019-09-17 16:12:00', 10, 3, 7, 2, true, 7.5, NULL);
INSERT INTO public.projeto VALUES (425, 'EFEITOS DA PANDEMIA', 'Desde o final de 2019, a pandemia do Coronavírus atingiu o mundo inteiro, provocando milhares de mortes e deixando muitas vítimas com traumas e sequelas. Devido a isso, o trabalho teve como objetivo verificar como foi o impacto da pandemia na vida dos leopoldenses. Como metodologia foi realizado uma enquete através de redes sociais como Instagram e Whatsapp para refletir sobre este impacto. Com base nos dados coletados e analisados neste estudo concluiu-se que a pandemia deixou as pessoas mais vulneráveis e sensíveis aos acontecimentos do dia a dia, fazendo com que as mesmas ficassem com medo de morrer ou até de perder alguém que ama. As diversas restrições e perdas impactaram a vida dos leopoldenses nos campos educacional, econômico e social, sendo necessário diversas reestruturações no município.', NULL, NULL, '2021-10-15 10:41:19', '2021-11-03 18:47:33', 10, 3, 9, 5, true, 7.375, 6.76249999999999929);
INSERT INTO public.projeto VALUES (221, 'O USO DA TECNOLOGIA PARA A CONSCIENTIZAÇÃO SOBRE O DESCARTE IRREGULAR DE LIXO E SUAS CONSEQUÊNCIAS', 'No Brasil, conforme o Ministério do Meio Ambiente, 56% dos municípios depositam incorretamente o lixo ao descartá-lo. Essa prática representa um grave problema, que pode desencadear consequências ambientais e nocivas à saúde humana, a exemplo da poluição dos solos e lençóis freáticos e da proliferação de doenças como dengue e leptospirose. Dessarte, o presente estudo pretende verificar o conhecimento das pessoas acerca da forma correta de descartar o lixo; ademais, após a coleta de dados e com base nesses, visamos à realização de um aplicativo para facilitar o acesso à informação. Para tanto, foi aplicado um questionário a 195 porto-alegrenses com perguntas as quais englobam o tema supracitado. Nessas perguntas, os participantes foram questionados quanto ao seu interesse no tema, às suas práticas de descarte de lixo e à sua consciência em relação às formas corretas de descartá-lo. A partir disso, verificou-se que 99% dos participantes acham o descarte irregular de lixo um problema relevante e 96,9% interessam-se por isso. No que se refere às práticas de descarte, 71,3% separam o lixo doméstico em seco e orgânico, contudo 55,4% falham ao reconhecer o significado das cores dos cestos de coleta seletiva. Logo, apesar do domínio de noções básicas sobre essa questão - a exemplo da importância da separação de resíduos domésticos -, não há um aprofundamento efetivo no assunto por parte dos cidadãos, visto que conhecimentos como as cores dos cestos de coleta seletiva de lixo, entre outros, ainda lhes são estranhos. Desse modo, denota-se a escassez de informações disponíveis às pessoas. Assim, baseando-se nos resultados e na opinião dos pesquisados sobre a importância da presença de informações acessíveis acerca do assunto na internet, o grupo promoveu a criação de um aplicativo contendo, dinâmica e sucintamente, os principais esclarecimentos para as dúvidas populares. Assim, almejamos dinamizar e facilitar a conscientização das pessoas sobre o descarte irregular de lixo.', NULL, NULL, '2019-08-06 17:03:46', '2019-10-27 01:56:02', 4, 2, 7, 5, true, 10, 9.82499999999999929);
INSERT INTO public.projeto VALUES (368, 'ROBô ACIONADO POR CONTROLE REMOTO SEM FIO', 'Este trabalho tem o objetivo de apresentar um protótipo de robô de papelão que se locomovesse para frente e para trás por meio de controle remoto sem fio. A escolha deste projeto se deu por ser algo ousado e por não ter sido apresentado nada similar nas feiras científicas das quais participamos. Os materiais usados para confeccioná-lo foram, em sua maioria, reutilizados, tais como: papelão, fios, motor de carrinho de controle remoto, placa mãe que transmitisse sinal para o controle, entre outros. Este trabalho exigiu muita criatividade para sua conclusão, pois foram necessárias algumas adaptações tanto de materiais quanto na execução do projeto. O robô foi apresentado na II Mostra Científico-Cultural da E. M. E. F. Prof° Odette Y. O. Freitas onde conquistou o 2° lugar na classificação geral.', NULL, NULL, '2019-09-17 14:19:32', '2019-09-19 14:00:27', 10, 3, 7, 5, true, 7.5, 8.32499999999999929);
INSERT INTO public.projeto VALUES (29, 'VERSATILIZANDO: UMA PLATAFORMA PARA ARMAZENAMENTO E COMPARTILHAMENTO DE POEMAS, HAICAIS E LETRAS DE MúSICAS AUTORAIS', 'O armazenamento da nuvem tem se tornado cada vez mais comum em vários contextos, tanto no meio acadêmico quanto no profissional. Além disso, compartilhar - arquivos, fotos, etc. -, é algo que a população realiza cada vez mais, o que pode passar até despercebido, por já fazer parte do cotidiano. Esse universo não poderia excluir os escritores, em especial os que escrevem haicais, letras de música e poemas, sendo voltado a esses gêneros o Trabalho de Conclusão de Curso mencionado neste resumo. O autor pode visualizar e escrever textos, que podem ser por ele compartilhados ou apenas salvos. O usuário também poderá curtir textos, comentar a respeito dos mesmos e compartilhar obras em modo anônimo. O website possibilitará realizar essas operações quando o usuário já tiver realizado seu login no sistema. Ao visualizar textos alheios, será possível selecionar uma categoria ou um autor para que sejam exibidas apenas obras correspondentes a tais requisitos. No desenvolvimento do trabalho foi utilizada a abordagem qualitativa e, quanto à natureza, a escolhida foi a do tipo aplicada. A plataforma está sendo implementada na linguagem de programação PHP (PHP Hypertext Preprocessor) e as linguagens HTML (HyperText Markup Language), CSS (Cascading Style Sheets) e JavaScript vêm sendo utilizadas para customização das telas. O banco de dados é montado com o phpMyAdmin e MySQL . Até o momento estão sendo realizados testes de andamento e, em breve, o sistema estará disponível para testes mais amplos, com as futuras funcionalidades já implementadas.', NULL, NULL, '2018-08-01 20:12:52', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 5.375, NULL);
INSERT INTO public.projeto VALUES (392, 'CONSEQUÊNCIAS TRAZIDAS PELA EMISSÃO EXCESSIVA DE POLUENTES PELA INDÚSTRIA', 'Esse trabalho tem por objetivo citar algumas das possíveis alterações genéticas trazidas como consequência pela emissão excessiva de poluentes no planeta. Além disso, nós evidenciaremos quais são os principais poluentes, destacando suas fórmulas estruturais e moleculares, além de propor uma alternativa com relação a como a química pode auxiliar nessa questão. A razão da presente pesquisa se dá pela necessidade de conscientização e debate sobre esses fatores, já que o planeta como um todo enfrenta grandes dificuldades causadas pela excessiva emissão de poluentes pelas indústrias. Como metodologia, realizamos uma pesquisa bibliográfica em artigos do Google Acadêmico, com as seguintes palavras chaves: poluição chinesa, alteração de DNA, gases do efeito estufa e alteração genética. Categorizamos as centenas de artigos encontrados de acordo com o fator de impacto dos mesmos. Em suma, a partir das análises feitas por meio das pesquisas, pudemos concluir a importância da necessidade das indústrias se responsabilizarem pelos cuidados com os poluentes que emitem, de forma a reduzir essas quantidades, visando diminuir a poluição do planeta como um todo, assim como as consequências trazidas para a natureza e para o próprio ser humano, como as alterações genéticas, ocorridas na gestação ocasionando maior propensão ao desenvolvimento de doenças respiratórias nos recém- nascidos. Alertamos para gases como dióxido de carbono, dióxido de enxofre, trióxido de enxofre e monóxido de carbono que apresentam altas concentrações nos meios apontados neste estudo.', NULL, NULL, '2021-10-08 08:55:20', '2021-11-05 09:58:51', 8, 2, 9, 5, true, 9, 4.91249999999999964);
INSERT INTO public.projeto VALUES (317, 'VERIFICANDO A INTOLERâNCIA à LACTOSE NA COMUNIDADE ESCOLAR DA EMEF SETE DE SETEMBRO', 'A atividade da enzima lactase diminui na maior parte dos animais mamíferos após o desmame. Na espécie humana, uma mutação ocorreu, permitindo que o indivíduo adulto consiga se alimentar desta substância. Existem, entretanto, pessoas que apresentam hipolactasia (baixa atividade da enzima), o que causa os sintomas comuns da intolerância à lactose (flatulência, dor abdominal, diarreia, etc.). O objetivo do trabalho é verificar a incidência da intolerância à lactose na comunidade escolar da EMEF Sete de Setembro e esclarecer questões sobre tratamento e como lidar com esta característica, visto que com o avanço dos exames laboratoriais cada vez mais pessoas são diagnosticadas com este distúrbio. A pesquisa foi desenvolvida na EMEF Sete de Setembro, Canoas – RS, durante o mês de julho e utilizou pesquisa bibliográfica de artigos na internet e um questionário anônimo com três perguntas: 1- Você sabe o que é intolerância à lactose?, 2- Você tem intolerância à lactose?, 3- Algum familiar seu tem intolerância à lactose? A maior parte dos entrevistados afirma saber o que é intolerância à lactose (94%), apenas 4% dos entrevistados apresentam o distúrbio e 34% afirma possuir algum familiar com a característica. A intolerância à lactose apesar de não ter cura, tem tratamento, que se baseia na não ingestão dos alimentos com o açúcar e/ou a administração de enzima para os momentos subsequentes à ingestão dos alimentos que possuam lactose em sua composição.', NULL, NULL, '2019-08-10 18:06:25', '2019-09-19 14:48:56', 10, 3, 7, 5, true, 8.375, 9.22499999999999964);
INSERT INTO public.projeto VALUES (48, 'GOSCHOOL - UMA PLATAFORMA DIGITAL PARA AUXILIAR NO DIA A DIA DE QUEM UTILIZA OU TRABALHA COM TRANSPORTE ESCOLAR PRIVADO', 'O presente trabalho apresenta os resultados parciais de uma pesquisa em andamento, que tem como objetivo desenvolver uma plataforma digital que visa aumentar a eficiência e a eficácia do transporte escolar. O dia a dia dos agentes presentes no transporte escolar é marcado por algumas deficiências na área da gestão (gerência de rotas e qualidade), e na comunicação entre os indivíduos (passageiro, motorista), impactando de maneira negativa na eficiência e eficácia do serviço. Assim, o trabalho tem como tema os diferentes modos que a tecnologia possa proporcionar a melhora da gestão e a comunicação entre os diferentes indivíduos que compõem o ambiente do transporte escolar. Para a realização do estudo, primeiramente, se pesquisou a origem do serviço, as leis que regem o mesmo e os diferentes impactos da carência da gestão das empresas que prestam o serviço. Posteriormente, se investigou os diferentes trabalhos que abordam a tecnologia na questão da roteirização dos transportes, e as técnicas utilizadas por grandes empreendedores na área da prestação de serviço para melhora do mesmo. Em seguida, se fez uma pesquisa por meio de um questionário, com os diferentes agentes que participam do dia a dia do transporte escolar, sendo eles, os passageiros, os motoristas, os administradores das empresas e os responsáveis pelo passageiro. Após a análise da coleta dos dados, foram mapeadas as necessidades e os métodos a serem utilizados para que se alcançasse os objetivos propostos. E assim, espera-se desenvolver uma aplicação capaz de suprir as necessidades mapeadas durante a pesquisa.', NULL, NULL, '2018-08-06 20:42:03', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 9.22232142857142989);
INSERT INTO public.projeto VALUES (75, 'CAFé DA RELATIVIDADE: UMA ESTRATÉGIA DE DISCUSSÃO DE FÍSICA MODERNA E CONTEMPORÂNEA', 'As descobertas da física moderna são responsáveis por vários avanços da humanidade, sobretudo em medicina e engenharia e está intimamente associada à melhora da qualidade de vida das pessoas. Entretanto, estudos indicam que a forma como a disciplina de física é tratada nas escolas não consegue refletir a sua importância e não aproveitam o potencial de conhecimento científico existente, especialmente no que se diz respeito à relação com a vida cotidiana dos estudantes e com as inúmeras possibilidades de serem realizadas atividades práticas. De um modo geral, a Física Moderna não é apresentada durante o ensino médio de uma maneira amigável, e acaba sendo tida, por grande parte dos estudantes, como sendo de difícil entendimento. Propõe-se uma estratégia para despertar o interesse e aproximar o estudante da física moderna: o Café da Relatividade, baseado na metodologia do “World Café”. Trata-se de um encontro de estudantes onde são debatidos temas relacionados à física moderna, mediados por docentes da área de física. Os participantes podem circular livremente, conforme seu interesse, interagindo com os demais participantes. Ao final do encontro, são aplicados questionários com o objetivo de verificar as percepções dos participantes quanto à metodologia utilizada e a relação com o conteúdo debatido. Com base nos resultados da pesquisa, concluímos que a metodologia aplicada nos encontros foi muito bem recebida pelos participantes, pois obteve-se resultados positivos no que diz respeito à linguagem empregada, dinâmicas usadas e interesse dos estudantes por assuntos relacionados à física.', NULL, NULL, '2018-08-08 12:22:05', '2018-09-20 19:47:07', 4, 2, 6, 5, true, NULL, 9.80000000000000071);
INSERT INTO public.projeto VALUES (296, 'DISPOSITIVO DE AUXíLIO PARA PESSOAS COM DEFICIêNCIA VISUAL OU DISCROMATOPSIA EM TITULOMETRIA', 'Apesar de todo avanço relacionado à inclusão, as pessoas portadoras de algum tipo de deficiência ainda sofrem dificuldades no mundo do trabalho. Tanto por falta de acessibilidade e preconceito, quanto por ausência de plano de carreira e baixos salários. Além do mercado de trabalho, as áreas de ensino também apresentam falta de acessibilidade. De acordo com o Instituto Brasileiro de Geografia e Estatística – IBGE, no censo demográfico de 2010, 23,9% da população total, têm algum tipo de deficiência – visual, auditiva, motora e mental ou intelectual. Dessa parte, 18,6% são deficientes visuais. E, conforme o Conselho Federal de Medicina, em 2004, 5% da população mundial sofre de discromatopsia (daltonismo). Outro fato a considerar é que, no estudo da química, em especial em sua parte prática, diversos métodos evidenciam seu resultado através da mudança de cor, como por exemplo, a titulação volumétrica. De forma a possibilitar que os deficientes visuais e daltônicos executem análises químicas, como titulações volumétricas, este trabalho tem o objetivo de criar um dispositivo eletrônico que emita um som que indique o ponto final dessas análises. O dispositivo contará com um arduíno UNO, um sensor de cor TCS3200, uma bateria de 9V e um emissor sonoro. O sensor faz a leitura da cor no formato RGB (red, green e blue – vermelho, verde e azul), em uma escala de 0 à 255. Os métodos titulométricos a serem testados serão neutralização, complexação e oxi-redução por dicromatometria. Para conferir exatidão nos resultados, os métodos serão calibrados previamente e os dados armazenados no arduíno. Sendo que, em primeiro lugar, será testado a influência da iluminação local nas cores obtidas pelo sensor a fim de identificar as possíveis variáveis de leitura do sensor causada por este fator. Até o momento, o grupo desenvolveu o dispositivo e programou o arduíno para fornecer os dados da leitura das cores do sensor, em RGB. Os demais testes estão em andamento.', NULL, NULL, '2019-08-10 00:03:10', '2019-09-19 13:47:43', 4, 2, 7, 5, true, 9.375, 9.92500000000000071);
INSERT INTO public.projeto VALUES (132, 'A REPRESENTAÇÃO DO DESEMBARQUE DOS ALIADOS NA NORMANDIA ATRAVÉS DA IMPRENSA BRASILEIRA', 'A Segunda Guerra Mundial foi o maior conflito bélico já acontecido e mudou significativamente a História do Século XX. Esse conflito foi travado pelos jovens que criaram-se no Otimismo da década de 20, viveram sua juventude na Depressão dos anos 30 e lutaram de 1939 a 1945, ao lado dos Aliados, na dura busca pela liberdade e contra o totalitarismo. Em razão disso, resolve-se pesquisar em periódicos da época o que as pessoas ficavam sabendo sobre o conflito. Durante a pesquisa concluímos que a utilização de periódicos, consegue obter resultados confiáveis. Por este motivo, nossa pesquisa pretende responder a seguinte questão: como a grande imprensa brasileira representou o desembarque dos Aliados na Normandia? Como objetivo geral, procuraremos analisar como os jornais da grande imprensa do Brasil apresentaram um dos pontos cruciais da Segunda Guerra Mundial, que passou à História como o Dia D. E como objetivos específicos, buscaremos evidenciar a dimensão da operação Overlord na Segunda Guerra Mundial e compreender as táticas aplicadas para o fato culminante da virada dos Aliados. Para tanto, utilizaremos como fontes primárias os periódicos A Noite e O Jornal, ambos do Rio de Janeiro, então capital do Brasil, e disponíveis na Hemeroteca da Biblioteca Nacional. Esta pesquisa tem sua importância para o discernimento crítico dos fatos ocorridos durante a busca da liberdade, estabelecida pelos Aliados, para que assim acontecimentos brutais como esses não retornem, determinando a morte e miséria de milhares de seres humanos.', NULL, NULL, '2018-08-10 17:30:01', '2018-09-20 19:47:07', 3, 2, 6, 5, true, NULL, 9.46517857142857189);
INSERT INTO public.projeto VALUES (144, 'CâMARA ESCURA', 'Neste trabalho propomos falar sobre a Câmara Escura. Ela se resume em uma caixa composta por paredes opacas, possui um orifício em um dos lados e, na parede paralela a este orifício, um papel vegetal é colocado. O funcionamento da câmara escura é de natureza física. O princípio da propagação retilínea da luz permite que os raios luminosos que atingem o objeto passem pelo orifício da câmara e sejam projetados no anteparo na parede paralela. Esta projeção produz uma imagem real invertida do objeto no anteparo. Quanto menor o orifício, mais nítida é a imagem formada, pois a incidência de raios luminosos vindos de outras direções é bem menor. Nosso objetivo é construir uma câmara escura utilizando materiais de baixo custo, fáceis de conseguir e mostrar como é o seu funcionamento. Os materiais utilizados foram: uma caixa de papelão média, tinta preta, papel vegetal, fita isolante preta e tesoura. Começamos pintando a caixa de papelão com a tinta preta; depois de seco utilizamos a fita isolante para tampar todas as entradas de luz, fizemos um pequeno furo na parte de trás da caixa para que a imagem pudesse ser transmitida; após isso desenhamos um retângulo na parte da frente da caixa, o recortamos e colamos neste espaço o papel vegetal, por onde será transmitida a imagem. Depois de finalizarmos e testarmos chegamos à conclusão que, através de um experimento simples e barato, é possível ter efeitos óticos básicos com clareza e exatidão.', NULL, NULL, '2018-08-10 19:43:14', '2018-09-20 19:47:07', 10, 3, 6, 5, true, 7, 7.85000000000000053);
INSERT INTO public.projeto VALUES (330, 'PRESO NAS ALUCINAçõES', 'A paralisia do sono é um distúrbio caracterizado por uma paralisia temporária do corpo imediatamente após o despertar ou, com menos frequência, logo antes de adormecer. A paralisia do sono em si, acontece com todas as pessoas quando dormem, pois é um mecanismo do corpo para que seja possível o relaxamento e o descanso. A ideia de pesquisa sobre o assunto surgiu a partir de experiências pessoais dos autores com o distúrbio e tem como objetivo elucidar mecanismos sobre como ocorre, fatores que influenciam a ocorrência de episódios, incidência na população e também possíveis tratamentos. O trabalho foi desenvolvido para feira de ciências da EMEF Sete de Setembro em Canoas – RS, durante o mês de julho. Foram utilizados diversos meios de consulta e revisão bibliográfica, principalmente revistas científicas online. Foi revisado que a pessoa portadora do distúrbio desperta durante a fase REM do sono e, apesar de já consciente, não é capaz de se mover, podendo, inclusive, ter alucinações. Existem vários fatores que podem disparar eventos de paralisia do sono, entre eles o estresse, consumo excessivo de álcool, uso de drogas, mudanças súbitas na vida, traumas, etc. Segundo bibliografia específica, cerca de 8% da população mundial pode ser afetada por esta doença crônica, que, embora não tenha cura é possível tratar.', NULL, NULL, '2019-08-10 22:27:29', '2019-09-19 15:01:22', 10, 3, 7, 5, true, 9.125, 8.3125);
INSERT INTO public.projeto VALUES (297, 'CONVERSATION MEETINGS: SPEAKING COMO PRÁTICA LINGUÍSTICA DENTRO DO PROJETO EXTENSIONISTA LINGUAGENS E(M) COMUNICAÇÃO', 'O projeto extensionista “Linguagens e(m) Comunicação” iniciou em 2019 a partir da necessidade de endereçar os cursos de língua francesa então ofertados em 2018 no IFRS Campus Canoas. Pensado como uma vertente do programa “Olhares Sobre as Cidades: Experiências de Viagens”. Visando a importância das relações interpessoais e transnacionais em um mundo globalizado, o projeto tem por objetivo promover a interação linguística de seus participantes, além de reconhecer as demais linguagens presentes em nosso cotidiano. Ao aliar Pesquisa (expressa na preparação teórica e prática envolvida nas atividades), Ensino (ao passar o conhecimento retido para outras pessoas) e Extensão (ao disponibilizar essas oportunidades para o público externo), essas ações promovem de fato a indissociabilidade entre estes pilares da iniciação científica na instituição. Para tanto, estão sendo disponibilizados cursos de língua francesa, oficinas de escrita criativa e encontros de prática de conversação em língua inglesa desde o 1° semestre de 2019. No que diz respeito aos “Conversation Meetings”, que é a atividade relacionada à prática de conversação, pensou-se em dois encontros semanais com foco direto na habilidade de speaking. A bolsista e os participantes se encontram para falar exclusivamente em inglês. Os participantes, mesmo com níveis distintos de conhecimento, são capazes de se comunicar e se colocam na posição de aperfeiçoar essa habilidade a partir de estímulos preparados previamente. Tanto o material utilizado quanto os assuntos escolhidos são elaborados integralmente pela bolsista e revisados pela coordenadora, fato que encoraja a autonomia da estudante, bem como representa uma oportunidade de colocar à prova seus conhecimentos. Logo, todos os envolvidos estão sendo beneficiados com o projeto: a instituição, a coordenadora, a bolsista e de modo especial, os participantes. Certificação de 50 horas será ofertada aos participantes com frequência superior a 75% ao término dos encontros.', NULL, NULL, '2019-08-10 10:24:56', '2019-09-17 16:12:00', 3, 2, 7, 2, NULL, 4.875, NULL);
INSERT INTO public.projeto VALUES (288, 'DEGRADAÇÃO DE CORANTES DA INDÚSTRIA COUREIRA A PARTIR DA ENZIMA PEROXIDASE EXTRAÍDA DA CASCA DE BATATA DOCE (IPOMOEA BATATAS) E CASCA DE BANANA (MUSA SP.)', 'O propósito deste trabalho é avaliar a degradação dos corantes do efluente oriundo do processo de tingimento do couro utilizando enzima peroxidase extraída da casca de batata doce e casca de banana. A razão do desenvolvimento desta pesquisa se deve ao fato de que esses efluentes gerados dificultam o tratamento convencional, pois podem modificar a atividade fotossintética do fitoplâncton onde forem descartados, já que diminuem a transparência da água, por causa dos corantes em excesso, afetando a passagem da luz solar.A metodologia do trabalho iniciou-se com a extração em quadruplicata da enzima das cascas que foram adquiridas comercialmente, após foi feita sua caracterização pela análise de espectroscopia de absorção molecular baseada na diferença de absorbância na região do visível quando em contato com peróxido de hidrogênio e guaiacol e em presença de tampão de Sorensen, durante 5 minutos. A enzima extraída será aplicada, separadamente, no resíduo da indústria coureira e serão feitos testes por espectroscopia de absorção molecular, observando a diferença de absorbância na área do comprimento de onda ideal para cada corante, que foi determinada por uma análise de varredura do espectro (UV - Visível). Serão avaliados também aspectos como pH e turbidez do resíduo antes e depois do tratamento. No presente trabalho também foi adicionada a enzima nos corantes isolados e feitos os mesmos testes referentes ao resíduo para análise da sua degradação. Os resultados parciais indicam que a enzima peroxidase pode ser extraída e caracterizada a partir da casca de banana. Além disso, a peroxidase extraída da casca de banana apresentou resultados positivos referente à degradação do corante isolado Acid Orange 7. As demais etapas estão em andamento. Portanto, como conclusões preliminares, podemos afirmar que a casca da banana é uma fonte de peroxidase e ainda que a peroxidase extraída possui ação de degradação frente a corantes isolados.', NULL, NULL, '2019-08-09 22:29:22', '2019-09-19 16:42:09', 8, 2, 7, 5, true, 9.25, 10);
INSERT INTO public.projeto VALUES (212, 'RETALHANDO SABERES!', 'O projeto Retalhando Saberes tem por objetivo incentivar os alunos do 7º anos a lerem com certa freqüência e a produzirem textos, por meio de poemas. Estes visitaram a casa de cultura Mário Quintana em Porto Alegre para se inspirarem nas grandiosas obras deste grande escritor gaúcho. Após lerem poemas de diversos autores incluindo as obras de Mario Quintana, os alunos produziram seus próprios textos e poemas, a maior parte deles voltados para o tema, natureza. Seis destes poemas foram colocados em almofadas literárias produzidas por um grupo de alunas do 7° ano. O projeto interdisciplinar que envolve educação ambiental, promove ações em benefícios ao meio ambiente, portanto as almofadas foram confeccionadas e customizadas com retalhos doados por uma loja de tecidos. Os poemas concretos foram produzidos em filtros de café reutilizados. E os poemas foram escritos em papel reciclado e parte deste papel reciclado, foi produzido pelos alunos que montaram o livro de poemas do 7° ano. Todas estas ações influenciaram outras turmas da escola, as quais foram convidadas a conhecerem o projeto e a trazerem um livro de leitura para a doação. Os livros doados foram entregues pelos alunos para motoristas que passavam em frente á escola, chamamos esta ação de blitz literária. Reconhecemos que a leitura, a escrita e o cuidado com o meio ambiente são importantíssimos para todos, inspirar outros é o nosso dever.', NULL, NULL, '2019-07-31 21:05:02', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 5.875, NULL);
INSERT INTO public.projeto VALUES (184, 'ABORTO, UM DIREITO?', 'O aborto consiste na interrupção da gestação antes que o feto ou embrião consiga sobreviver fora do útero. Pode ocorrer de forma espontânea ou provocada. Atualmente, na legislação brasileira, em apenas três casos o aborto provocado é considerado legal. O presente trabalho está sendo desenvolvido por alunos do 9º ano do ensino fundamental da EMEF Sete de Setembro, localizada no bairro Estância Velha em Canoas. Tem como objetivos fomentar o debate sobre o aborto na comunidade escolar e promover a reflexão sobre as liberdades individuais, o papel do Estado e a influência da religiosidade. Para isso, será feita revisão da legislação, contextualização do debate bioético sobre o início da vida e aplicação de questionários. A hipótese levantada foi de que a religião exerce influência sobre o posicionamento do indivíduo a respeito da legalização do aborto.', NULL, NULL, '2018-08-10 23:52:40', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 8.5, 9.40000000000000036);
INSERT INTO public.projeto VALUES (335, 'A TEORIA DA INTELIGêNCIA DAS MULTIDõES', 'Em uma feira no condado de Orange no Sul da Califórnia, em 1906, ocorreu uma competição que tinha como objetivo adivinhar o peso exato de um boi, com o decorrer da feira foram registradas diversas tentativas de descobri-lo. O matemático Francis Galton observou essas tentativas, calculou a média aritmética e obteve um resultado muito próximo do peso do boi. O resultado desses experimentos é um dos exemplos da chamada da Teoria da Inteligência das Multidões. O experimento tem como propósito comprovar a vertente matemática da Teoria com as estatísticas que afirmam que a agregação de informações de todas as tentativas de acerto é melhor e mais precisa que uma escolha de algum membro do grupo. Para comprovarmos a veracidade da Teoria da Inteligência das Multidões, teremos dois exemplos prontos para o dia da IFCITEC. Na primeira garrafa de plástico teremos um certo peso de areia que será medido com uma balança de precisão e a segunda garrafa será preenchida com uma quantidade de balas de goma coloridas. Para recolher as informações e resultados dos experimentos será necessário auxílio dos estudantes do Instituto Federal Campus Canoas. Ao atingir a meta de tentativas de acertos, será feita a média aritmética de quilos na primeira garrafa e de unidades na segunda. O projeto é uma pesquisa experimental, pois, o que importa para ele é demonstrar com números e cálculos uma teoria que recorre a argumentação de que a sociedade é consciente e que os indivíduos unidos têm maior possibilidade de prosperar do que apenas um indivíduo solitário.', NULL, NULL, '2019-08-10 22:52:25', '2019-09-19 15:03:25', 4, 2, 7, 5, true, 8.25, 8.38571428571430033);
INSERT INTO public.projeto VALUES (309, 'CONSUMO PRECOCE DE áLCOOL ETíLICO: EFEITOS FíSICOS E PSICOLóGICOS', 'O álcool é um grupo orgânico que se caracteriza por apresentar um grupo hidroxila ligado ao carbono saturado. O álcool etílico presente nas bebidas alcoólicas, ao ser ingerido, provoca inicialmente uma sensação de prazer, relaxamento, podendo até reduzir o estresse. Porém, o seu consumo excessivo causa a dependência, resultando no desenvolvimento de doenças mentais e mal funcionamento de alguns órgãos. Ingerido precocemente por por crianças e adolescentes torna-os mais suscetíveis a doenças. O nosso trabalho possui o objetivo de informar e alertar sobre os efeitos e danos do álcool ao nosso organismo. Realizou-se pesquisa quantitativa com alunos do Ensino Fundamental II, cujos resultados demonstraram que a maioria dos alunos já ingeriu algum tipo de bebida alcoólica sob a influência de amigos ou família. A análise preliminar destes resultados permite inferir que há uma parcela de pessoas consciente dos danos e efeitos, mas ignora-os totalmente, e a outra não consegue abandonar esse hábito. Portanto podemos concluir que além de causador de inúmeras doenças ao nosso organismo o álcool pode também ser considerado uma droga, pois é tóxico para a nossa mente e corpo, desencadeando um vício que não é facilmente abandonado por diversas pessoas.', NULL, NULL, '2019-08-10 15:50:44', '2019-09-19 16:14:20', 10, 3, 7, 5, true, 7.375, 9.0625);
INSERT INTO public.projeto VALUES (337, 'OBTENçãO DE SULFATO DE ZINCO A PARTIR DE LODO GALVâNICO DO MUNICíPIO DE NOVO HAMBURGO', 'A galvanização consiste no recobrimento de peças metálicas por outro metal a fim de evitar a corrosão ou obter o acabamento desejado. A prática permite a formação de revestimentos finos por meio de imersão em solução contendo o metal pretendido sob a forma de íon. Entretanto, o processo gera um resíduo denominado lodo galvânico, o qual é classificado pela ABNT como resíduo perigoso – Classe I, sendo esse comumente destinado a aterros industriais. Em decorrência disso, observou-se a criação de pesquisas as quais apontavam para sua aplicação como aditivo em outros materiais, como os cimentícios e os poliméricos. Todavia, os resultados apontavam para alterações nas propriedades desses, podendo comprometer assim os seus propósitos. Exposto o problema, o presente projeto de pesquisa visa recuperar sulfato de zinco, sal empregado em diferentes segmentos industriais, a partir de amostras de lodo galvânico de empresa da cidade de Novo Hamburgo e, adiante, reintegrá-lo no processo de galvanição em banhos à base de ZnSO4. O desenvolvimento consiste na coleta de 6 amostras da empresa Metalburgo, as quais foram quarteadas em uma única amostra. Empregaram-se, então, análises como fluorescência de raio X, a qual constatou na composição mássica da amostra o zinco como elemento majoritário. Posteriormente, realizou-se a abertura da amostra em micro-ondas e, logo após, efetuou-se o procedimento de precipitação seletiva com a finalidade de precipitar o composto almejado. Os resultados expõem a viabilidade da recuperação de sulfato de zinco a partir de lodo galvânico para empresas do segmento industrial tratado, e aponta para uma alternativa na diminuição de resíduos da indústria da galvanização.', NULL, NULL, '2019-08-10 22:58:20', '2019-09-19 15:55:30', 8, 2, 7, 5, true, 9.375, 9.5);
INSERT INTO public.projeto VALUES (412, 'REFERêNCIAS NEGRAS NOS CURRíCULOS: IMPRESSõES DE ESTUDANTES E DOCENTES DO CAMPUS CANOAS NA áREA DE HUMANIDADES', 'O trabalho tem como objetivo diagnosticar e ampliar a discussão acerca de referências afrocentradas no currículo dos cursos integrados ofertados no IFRS - campus Canoas - RS com enfoque principal na área de humanidades. Na fase inicial propõe-se como metodologia fazer o levantamento das referências que compõem os currículos, aplicar questionários para os corpos docente e discente como instrumento de coleta de dados e apresentar a partir dos dados coletados o impacto de trabalhar referências negras para a formação dos estudantes do campus Canoas. Como referência, o trabalho utilizará escritos de autores(as) como: Lélia Gonzalez, Molefi Kete Asante, Milton Santos, etc. Trabalhar esses intelectuais com os estudantes do IFRS - campus Canoas nas áreas das ciências sociais faz parte da busca pelo fim do silenciamento e do racismo, além de incentivar a busca pela diversidade cultural e científica em sala de aula. Além disso, pretende-se enfatizar a possibilidade de mudança epistemológica e política quando referimos à questão étnico-racial no currículo dos cursos ofertados na atualidade — os quais precisam ampliar a discussão embasados nas legislações vigentes. O debate sobre a lei 10.639/03 — que torna obrigatório o ensino da história e da cultura afro-brasileira e africana na educação básica de todas as escolas — tem trazido à tona muitas questões que ainda não são pauta nos currículos. E, ainda que a lei esteja em vigor, as áreas que mais a acatam são as das linguagens, como Língua Portuguesa e Literatura — mesmo assim, são poucos os títulos de autores negros que se encontram em sala de aula. No entanto, disciplinas como Sociologia, Filosofia, História e Geografia também possuem grande influência na formação de sujeitos conscientes e antirracistas. Com isso, é esperado que o projeto estimule a discussão acerca da carência de referências afrocentradas nos currículos dos cursos integrados, além de futuramente auxiliar os docentes na aplicação das mesmas em sala de aula.', NULL, NULL, '2021-10-13 19:20:24', '2021-11-05 02:30:34', 3, 2, 9, 5, true, 9.75, 7.36249999999999982);
INSERT INTO public.projeto VALUES (64, 'PRODUçãO DE ALIMENTOS ORGâNICOS: COMPOSTEIRA RESIDENCIAL', 'O consumo de vegetais orgânicos vêm se popularizando devido a preocupação das pessoas em se alimentar melhor. O objetivo dessa pesquisa foi a elaboração de um protótipo de composteira e uma horta vertical para casas e apartamentos. Dois recipientes foram perfurados e cobertos por uma pequena tela para que as minhocas não possam passar. No recipiente inferior se instalou uma torneira para drenagem do chorume. Para que a composteira funcione, é necessário colocar no recipiente do meio terra comum e minhocas e no superior os sedimentos orgânicos (cascas de frutas, verduras, etc). Se formará na base o húmus que será utilizado como adubo na plantação orgânica. A horta vertical pode ser feita com Garrafas PET ou canos de PVC. Nós entrevistamos o Avô de uma das integrantes, Romeu José Mayer, agricultor que mora em Caibaté, RS e planta diversas culturas diferentes em sua propriedade. Concluiu-se que é possível produzir alimentos orgânicos em espaços reduzidos (como casas pequenas e apartamentos) e com o custo mais baixo, também é possível que a população comece a ter uma alimentação mais saudável de forma mais prática. Esperamos que o relato de nossa experiência permita que mais pessoas possam cultivar alimentos orgânicos em suas residências, mesmo dispondo de pouco espaço.', NULL, NULL, '2018-08-07 15:08:45', '2018-09-20 19:47:07', 10, 3, 6, 5, true, NULL, 8.48750000000000071);
INSERT INTO public.projeto VALUES (166, 'FOTOETNOGRAFIA: A REALIDADE DE ADOLESCENTES DA PERIFERIA DE CANOAS', 'O nosso trabalho é sobre a realidade de adolescentes que moram na periferia de Canoas. Nas comunidades em que moramos, próximo à Escola Municipal de Ensino Fundamental Assis Brasil, no bairro Mato Grande, muitas famílias vivem da reciclagem, inclusive as nossas, e queríamos representar essa realidade de maneira positiva. Assim, o objetivo deste trabalho é mostrar a realidade de adolescentes que vivem nessas comunidades através da fotografia. Para isso, utilizamos uma metodologia chamada fotoetnografia, que se propõe a registrar determinada cultura através de fotografias em uma sequência narrativa. Inicialmente tivemos um encontro de orientação com uma fotógrafa e assistente social que nos apresentou a metodologia e nos deu uma oficina sobre fotografia. A partir desse encontro, estudamos um livro de Luiz Eduardo Robinson Achutti, no qual conhecemos os procedimentos metodológicos e onde nos baseamos para fazer nossas fotografias. Após isso, definimos que nosso trabalho teria três eixos: as pessoas; as comunidades; a escola. Com base nesses eixos, realizamos duas saídas fotográficas, uma em julho e outra em agosto de 2018, utilizando uma Câmera Nikon D60 e smartphones para fazer os registros. Como a pesquisa ainda está em desenvolvimento, estamos na fase de organizar a sequência narrativa do nosso trabalho. Com esta pesquisa, esperamos que as pessoas conheçam a realidade de adolescentes que moram na periferia de Canoas e respeitem a população que necessita da reciclagem.', NULL, NULL, '2018-08-10 21:52:21', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 8.875, 7.94999999999999929);
INSERT INTO public.projeto VALUES (53, 'EVOLUçãO DOS SERES HUMANOS', 'A evolução dos seres humanos é um assunto muito importante para nós, pois desde que estudamos na aula queríamos nos aprofundar mais, tirar nossas dúvidas. Sabemos que é um tema essencial para sabermos sobre nossa origem. Por isso, o nosso objetivo foi descobrir mais sobre o evolucionismo, estudando de diferentes maneiras, para que pudéssemos explicar essa pesquisa de forma clara e divertida. Durante a pesquisa nós estudamos a Teoria de evolução de Darwin, entrevistamos uma professora de Biologia chamada Silvana Silveira e fomos ao museu. Além disso, pesquisamos em livros e sites. Evolucionismo é a teoria que defende a ideia que os seres vivos se transformam ao longo do tempo pois sofrem de seleção natural. A teoria acima é fruto de muitas pesquisas feitas pelo Charles Darwin. As mutações são as alterações no material genético de um organismo, podendo criar uma nova característica. Esse processo também é conhecido por deriva genética. A seleção natural ocorre quando os indivíduos mais adaptados a condições têm maior chance de sobrevivência. Além das coisas descobertas já citadas ao longo do banner, nós descobrimos também um pouco mais sobre a evolução dos seres humanos. Evolução humana é o processo de mudanças que originou os seres humanos e os diferenciou como espécie. Diferentes espécies de seres humanos já foram descobertas por historiadores, como pré-australopitecos, astralopitecos, Homo halibis, Homo erectus, Homo ergaster, Homo sapiens, Homo sapiens sapiens.', NULL, NULL, '2018-08-07 14:08:25', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 3.25, NULL);
INSERT INTO public.projeto VALUES (398, 'PROBLEMAS GEOPOLÍTICOS E GENÉTICOS CONSEQUENTES DA EMISSÃO DE POLUENTES QUÍMICOS PELO SETOR INDUSTRIAL', 'O objetivo do presente estudo é verificar os principais gases poluentes do ar nas zonas urbanas do Brasil e da China, nas perspectivas químicas, biológicas e geográficas. Para isso seguimos os seguintes caminhos metodológicos: pesquisa documental em artigos científicos, no repositório digital Google Acadêmico, com as palavras-chave poluição, alteração genética e gases usando os filtros geográficos de acordo com o objetivo da pesquisa. Como resultado parcial de nossas análises, verificamos que os principais poluentes do ar são o monóxido de carbono, dióxido de carbono, dióxido de nitrogênio, o ozônio. Segundo estudos biogenéticos a Organização Mundial da Saúde (OMS), disserta sobre algumas alterações genéticas que ocorrem a partir da exposição aos poluentes. As Leis Ambientais foram criadas com a intenção de proteger o meio ambiente e reduzir ao mínimo as consequências de ações devastadoras. Fazendo um comparativo com a China, verificamos mudanças estratégicas por parte do governo chinês que resultou em uma melhora na qualidade do ar, porém os problemas ambientais ainda são diversos e algumas soluções permanecem apenas no projeto, sendo necessárias políticas ambientais mais rígidas. Além disso, solucionar o problema da corrupção é fundamental, visto que os investimentos no setor é lento. A China lançou um plano de ação para reduzir a poluição com medidas que incluem o controle e substituição do carvão nas áreas industriais por energias limpas, como o gás natural, e também a promoção de transportes ecológicos. A partir desta análise, em perspectivas de diferentes disciplinas, é possível compreender a importância do conhecimento em relação aos impactos biológicos, químicos e geopolíticos que a poluição gera. Soluções utilizadas por países, com alta taxa de emissão de poluentes, com o objetivo de reduzir e controlar a poluição são abordados dentro da análise de estudo.', NULL, NULL, '2021-10-08 15:20:01', '2021-11-02 20:50:53', 8, 2, 9, 5, true, 8.75, 0);
INSERT INTO public.projeto VALUES (74, 'CANAL IFíSICA RIO FORTE', 'A disciplina de física é muito importante no currículo escolar, especialmente pelo fato de trazer uma série de teorias e conceitos que fazem parte do cotidiano das pessoas. Apesar de sua relevância, é tida por grande parte dos estudantes como sendo de difícil entendimento, gerando altos índices de reprovação, resistência às aulas e um maior empenho para se atingir a aprovação. Fatores como a deficiência de aprendizagem vinda do ensino fundamental nos alunos, a baixa carga horária da disciplina, a não adequação dos conteúdos ao cotidiano e a escassez ou inexistência de atividades extracurriculares aumentam as dificuldades de alunos e professores. O canal IFísica Rio Forte busca despertar o interesse e aprofundar conhecimentos de temáticas da física, utilizando como estratégia a produção de um vídeo com demonstrações práticas e explicações elaboradas pelos próprios estudantes. Trata-se de uma metodologia que oferece aos alunos uma nova forma de comunicação, onde é possível ler, escrever, estudar, expressar opiniões, refletir sobre o que está sendo estudado e trocar ideias, tornando a aprendizagem dinâmica e significativa. Com isso, os resultados obtidos foram de que metade dos estudantes (51,2%) afirmam aprender melhor com a produção do vídeo e aulas tradicionais e apenas (12,2%) afirmam ter aprendido melhor com a produção e apresentação do vídeo. A primeira vista este resultado pode levar a crer que a produção do vídeo não se mostra como uma boa estratégia para a maioria dos estudantes, no entanto alguns pontos precisam ser considerados, os quais podem ter comprometido assim a qualidade do trabalho.', NULL, NULL, '2018-08-08 12:02:50', '2018-09-20 19:47:07', 4, 2, 6, 5, true, NULL, 8.25178571428999952);
INSERT INTO public.projeto VALUES (167, 'ADOLESCêNCIA: TRANSFORMAçõES E DILEMAS DO CORPO FEMININO', 'A adolescência é uma fase da vida onde passamos por grandes transformações, sejam físicas, psicológicas ou até sociais. Nós também estamos atravessando essa etapa e percebemos as mudanças em nossos amigos e familiares. Na puberdade, observamos mudanças físicas no corpo feminino como o crescimento das mamas, aparecimento de acnes em determinadas partes do corpo (principalmente no rosto), aumento de alguns odores e aparecimento de pelos pubianos e axilares. Como mudanças psicológicas, observamos alterações de humor, formações de grupos de amigos por afinidades e aumento do apetite. Nosso trabalho tem como objetivo compreender como ocorrem essas mudanças ao longo da adolescência e por que ocorrem, principalmente no gênero feminino. Nosso trabalho é do tipo qualitativo, e consistiu em uma pesquisa bibliográfica em vários sites na internet e artigos científicos para descobrirmos as principais mudanças tanto físicas quanto psicológicas. A pesquisa se encontra em andamento e pretendemos realizar entrevistas com adolescentes do gênero feminino para descobrirmos como elas percebem essas mudanças em seus corpos. Os principais dados encontrados nas pesquisas tratam sobre como os hormônios femininos influenciam tanto nas mudanças físicas como psicológicas das adolescentes. Os resultados desse estudo poderão ajudar essas jovens a entender melhor as mudanças da adolescência e a superá-las como uma fase.', NULL, NULL, '2018-08-10 21:55:27', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 9.125, 0);
INSERT INTO public.projeto VALUES (393, 'CONSEQUêNCIA DA POLUIçãO NOS GENES E SEU COMBATE EM INDúSTRIAS CHINESAS', 'A poluição ambiental com gases tóxicos é um assunto recorrente faz décadas no mundo inteiro. Esses compostos causam alterações genéticas não somente nas células pulmonares, mas atingem a cavidade oral, a faringe e o esôfago. O presente estudo objetiva analisar a poluição em massa do setor industrial chinês, responsável por provocar diminuição da resistência respiratória entre outros efeitos adversos à saúde humana, flora e fauna. Para tanto realizamos uma pesquisa de natureza básica com metodologia bibliográfica, consultando o repositório digital da UFRGS. A China, que após as reformas de 1978 teve seu dinamismo econômico intensificado, atraindo a atenção da comunidade internacional preocupada com os riscos ambientais, local e globalmente produzidos. A expansão econômica, o consumo de energia, a escassez de terras aráveis e a poluição provocam impactos e perspectivas de controle ambiental em todas as sociedades. Diante disso, em 2013 a China fez uso de pesquisas no campo da química para aumentar a oferta de energias mais limpas, como o gás natural, além de não conceder licenças de construção para os projetos que não cumpram com os requisitos ambientais. Algumas empresas estão adotando os métodos exigidos. Contudo, nem todas parecem querer atender a essa demanda. Em síntese, apesar da indústria chinesa ser uma das maiores poluidores, ela tem adotado medidas para reduzir impactos ambientais. Salientamos que mais estudos nessa área devem ser feitos para conhecer a eficácia dessas medidas.', NULL, NULL, '2021-10-08 09:10:54', '2021-11-05 09:47:09', 8, 2, 9, 5, true, 9, 2.11249999999999982);
INSERT INTO public.projeto VALUES (90, 'BATERIA DE ALUMíNIO', 'O projeto trata-se de uma bateria de lata de alumínio. Os materiais usados foram uma lata de alumínio, um metro de fio de cobre desencapado, água, água sanitária, oxigênio do ar, papel toalha e sal. Inicialmente foi cortada a boca da lata, lixando-a por dentro. O fio de cobre foi enrolado no papel toalha, depois enrolada mais uma camada de papel toalha, para que ele não entre em contato com o alumínio, deixando uma ponta do fio para cima. A lata foi furada no lugar onde ficaria o cobre e após foi adicionado sal, água e a água sanitária dentro da lata. Pôs-se o fio de cobre dentro da lata e após conectado em série, isto é, o pólo positivo (cobre) de uma no negativo (alumínio) da outra. Ocorreu uma reação química entre o alumínio da lata, o oxigênio do ar e a água. O sal não participou da reação, mas ajudou no processo tornando a água boa condutora de eletricidade (quando dissolvido os íons são separados e o oxigênio do ar estimula os elétrons a se movimentarem, gerando uma corrente elétrica). No alumínio ocorre a oxidação (perda de elétrons) e no cobre ocorre a redução (ganho de elétrons). O cobre serve como um condutor de corrente elétrica. Ao juntar a água sanitária, a bateria passa a usar mais o oxigênio dela, gerando mais elétrons, com isso mais correntes elétricas. O tema escolhido se deve ao interesse do grupo no assunto e também pela questão sustentável de que trata. O objetivo foi mostrar uma forma de produzir energia elétrica reaproveitando resíduos, como o alumínio.', NULL, NULL, '2018-08-09 12:01:30', '2018-09-20 19:47:07', 10, 3, 6, 5, true, NULL, 9);
INSERT INTO public.projeto VALUES (125, 'TAIDEFIM', 'A inclusão de pessoas portadoras de necessidades especiais no meio social é um tema muito discutido, mas não 100% efetivado. Apesar dos esforços de movimentos nacionais e internacionais em prol dos deficientes, nem todas as comunidades em âmbito nacional tem acesso a essa assistência inclusiva. Tendo em vista as grandes dificuldades enfrentadas por essas comunidades, buscamos com o TAIDEFIM incluir e melhorar a capacidade de aprendizagem, além de contribuir para uma melhor interação social. O TAIDEFIM (Teclado Adaptado para Deficientes Físicos e Mentais) é um teclado adaptado para pessoas com deficiências físicas e mentais e possui um aplicativo para computadores. Tem como objetivo integrar pessoas com necessidades especiais, através da tecnologia, para que elas tenham um melhor desenvolvimento em atividades escolares e intelectuais. O TAIDEFIM terá um aplicativo para computadores com diversos níveis intelectuais, para que possa atingir um número maior de pessoas. Será composto por um teclado adaptado com tamanho e dimensões ideias para pessoas com dificuldades motoras, além de cores vívidas para fácil identificação e palavras explicativas tanto visuais quanto em braile. Para elaboração do projeto foi necessário a integração de diversas matérias como linguagem de programação e microcontroladores, sendo que nosso primeiro obstáculo foi a criação de um aplicativo educacional, o qual consiste em um jogo de perguntas e respostas, de nível fácil, médio e difícil, através da plataforma Apresentações do Google. Para o software, utilizamos a plataforma de acessibilidade do Windows para termos resposta do jogo através do teclado e não do mouse, já para o software do teclado, foi usado o aplicativo IDE para arduino. Para confecção do hardware, aderimos a plataforma Inventor para melhor visualização do projeto, com objetivo futuro de impressão 3D, e já para sua construção de software, utilizamos o microcontrolador arduino.', NULL, NULL, '2018-08-10 15:36:19', '2018-09-20 19:47:07', 7, 2, 6, 2, true, 7.125, NULL);
INSERT INTO public.projeto VALUES (63, 'NEUROCIêNCIA NA MúSICA: ESTUDO DE CASO NA EDUCAçãO INFANTIL', 'A música pode ser uma grande aliada a aprendizagem, apesar de sua utilização no espaço escolar ainda ser pouco explorada. Por isso, essa pesquisa se faz importante por explorar este assunto tão pouco divulgado e debatido atualmente. Um dos objetivos é entender a influência da música no funcionamento neural e a sua contribuição da mesma para a ciência. Além disso, será apresentado, como a música pode nos ajudar em inúmeros sentidos da nossa vida. Para isso foram necessárias entrevistas com profissionais da área, a leitura de livros, artigos e websites. Também, a aplicação de uma metodologia com crianças de 3 e 4 anos do Colégio Dom Feliciano. Foi observado o comportamento das crianças ao cumprir a atividade, principalmente sua atenção com diferentes músicas. O cérebro é fundamental para o controle e percepção dos sentidos, dentre as suas funcionalidades há nove áreas responsáveis pelo armazenamento e interpretação de músicas. os gêneros musicais trazem reações diferentes nas pessoas, por terem situações de vida diferentes, não despertam os mesmos sentimentos. Os últimos estudos sobre a neurociência na música registraram que a musicalidade e o aprendizado de um instrumento musical ajudam na assimilação de conteúdos que exigem raciocínio lógico, criatividade e concentração, o que pode ajudar muito nas escolas e podendo assim a musicalidade auxiliar também na recuperação de pessoas com determinadas patologias como Alzheimer, ansiedade, dentre outras.', NULL, NULL, '2018-08-07 15:05:05', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (143, 'CONSTRUINDO UM MODELO DE RESPIRAçãO PULMONAR', 'O sistema respiratório é um conjunto de órgãos responsáveis pelas trocas gasosas do organismo com o meio ambiente, possibilitando a respiração celular. É composto, além de dois pulmões, por fossas nasais, boca, faringe, laringe, traquéia, brônquios, bronquíolos, diafragma e os alvéolos pulmonares reunidos em sacos alveolares. O nosso objetivo com este trabalho é identificar os órgãos que formam o sistema respiratório, através da confecção de um protótipo, e explicar como se dão as trocas gasosas. Os materiais que utilizamos para fazer o modelo são garrafa pet, balão, mangueira, fita de cetim, cola quente, arame e fita isolante. Primeiro, cortamos a garrafa, depois, a mangueira e encaixamos um pedaço no outro. Passamos um arame dentro da mangueira e em seguida colocamos um balão em cada ponta, passamos fita de cetim em volta. Furamos a tampa da garrafa e colamos a mangueira. Após isso, colamos um ferro na parte inferior da garrafa, esticamos um balão na parte de fora da garrafa e passamos fita isolante. O resultado foi um trabalho onde conseguimos alcançar os nossos objetivos, já que aprendemos o quão importante é a nossa respiração e como ela se processa.', NULL, NULL, '2018-08-10 19:30:00', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 6.125, NULL);
INSERT INTO public.projeto VALUES (58, 'EFEITOS DA RADIAçãO NO MEIO AMBIENTE', 'Ocorreram muitos acidentes envolvendo radiação no mundo. Dois dos mais impactantes para o meio ambiente foram a explosão da Usina Nuclear Chernobyl em 1986 e o dano ocorrido por uma tsunami em Fukushima em 2011. Escolhemos esse assunto, por temos interesse em entender melhor o efeito da radiação no meio ambiente. Pesquisamos na internet o efeito da radiação nos seres vivos que existiam na região na qual ocorreram os acidentes nucleares. Descobrimos que o meio ambiente foi muito afetado. Muitas espécies de plantas e animais acabaram morrendo. Porém, outras conseguiram se adaptar. Um exemplo de animal que sofreu adaptação foi um percevejo. Sua coloração sofreu variações pelo efeito da radiação. Suas pintas pretas nas asas vermelhas mudaram seu padrão. As árvores também estão sujeitas a mutações, algumas podem apresentar anomalias durante seu crescimento. O impacto da radiação sobre as taxas de mutação, câncer e mortalidade varia muito de acordo com a espécie. Em geral pode-se dizer que quanto maior for a exposição a radiação maiores serão os efeitos na saúde no indivíduo.', NULL, NULL, '2018-08-07 14:34:27', '2018-09-20 19:47:07', 12, 3, 6, 5, true, 5.875, 2.8125);
INSERT INTO public.projeto VALUES (246, 'TARTARUGAS', 'O presente trabalho aborda o tema tartarugas, as fases de desenvolvimento, suas características, hábitos, etc. As tartarugas são répteis, quelônios que possuem cascos em suas costas. Elas se alimentam de frutas, vegetais, peixes pequenos e insetos quando estão na natureza. Os principais objetivos do projeto são os de conhecer as fases de desenvolvimento, conscientizar sobre a preservação das espécies e dos biomas, apresentar as curiosidades, mostrar as evoluções sobre as tartarugas em geral, além de fazer com que mais pessoas tenham interesse pelas tartarugas e se conscientizem da importância do papel de todos nós perante a preservação da natureza, para mantermos todos os seres do planeta. O assunto despertou interesse nos integrantes devido ao fato de alguns deles terem esses répteis como animais de estimação e, por esse motivo, a curiosidade só fez crescer o desejo de aprender ainda mais sobre esses seres. Através da metodologia de pesquisa bibliográfica e observação de algumas tartarugas e seus comportamentos, teve-se a oportunidade de conhecer mais a fundo sobre a origem, características e modo de vida desses animais tão calmos e dorminhocos.', NULL, NULL, '2019-08-08 20:13:44', '2019-09-19 15:05:33', 10, 3, 7, 5, true, 7.375, 6.76250000000000018);
INSERT INTO public.projeto VALUES (292, 'ROBOFEELING', 'O projeto Robofeeling foi desenvolvido para auxiliar os professores de língua inglesa e trazer um diferencial nas aulas. A ideia surgiu após uma das pesquisadoras salientar o quão difícil está sendo estudar o idioma por não ter tido contato durante o ensino fundamental 1. Após inúmeras pesquisas, constatou-se que não há no Brasil um projeto semelhante e o que há no exterior é muito caro e fica inviável a aquisição pelos professores. Já o Robofeeling é feito com material reciclável e de fácil programação. O próprio professor poderá trocar a programação do Robô e poderá utilizá-lo além da versão modelo: &#34;How are you?&#34;, pois não necessita de treinamento específico e personalizado como os demais projetos de robótica. Apesar do projeto ter recebido o prêmio de 2°lugar na feira multidisciplinar do Instituto Gustavo Nordlund e ter sido sucesso entre as crianças do 2° e 3° ano (público-alvo), percebeu-se a necessidade de evolução e , para a participação no IFICITEC, terá uma versão atualizada com ajustes para alunos deficientes visuais.', NULL, NULL, '2019-08-09 23:43:39', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 5.5, NULL);
INSERT INTO public.projeto VALUES (331, 'O IMPACTO DO USO DE AGROTÓXICOS NA BIODIVERSIDADE BRASILEIRA', 'O Brasil, segundo dados divulgados pelo Ministério do Meio Ambiente, é o maior consumidor mundial de agrotóxicos. O presente estudo tem como objetivo relacionar a degradação do ecossistema brasileiro com o uso excessivo e indiscriminado de agrotóxicos. Os dados do estudo foram coletados em publicações e artigos científicos sobre o tema, envolvendo evidências científicas, estatísticas e gráficos. Os estudos evidenciam que o uso dessas substâncias causa prejuízo sobre os insetos, a água, o solo e os peixes, muitas vezes, por alterarem seu habitat natural. Cabe ressaltar que a região sul do Brasil é a maior consumidora dessas substâncias e representa 30% do uso de agrotóxicos no país. Segundo indicadores, na região ocorre também o maior número de mortes de insetos polinizadores, como as abelhas, por conta do uso abusivo de defensivos agrícolas. Os estudos pesquisados demonstram importante interferência dos agrotóxicos no equilíbrio do ecossistema e, consequentemente, na vida animal e humana. Em síntese pode-se dizer que o uso de agrotóxicos está diretamente relacionado à degradação do ecossistema e de sua biodiversidade, e representa uma ameaça ao equilíbrio da saúde humana e ambiental.', NULL, NULL, '2019-08-10 22:29:27', '2019-09-19 15:01:36', 10, 3, 7, 5, true, 9.375, 7.07500000000000018);
INSERT INTO public.projeto VALUES (139, 'RESÍDUOS SUSTENTÁVEIS', 'RESUMO O projeto “Resíduos Sustentáveis” tem por objetivo fomentar ações em prol da sustentabilidade no IFSul, câmpus Sapiranga, minimizando o desperdício de produtos reaproveitáveis na Instituição. Percebeu-se que a comunidade escolar ingere grande quantidade de chimarrão e café, ocasionando uma volumosa produção de resíduos orgânicos. Devido a isto, gerou-se um problema: “De que forma podemos dar um destino ecologicamente correto à borra de café e à erva de chimarrão?”. Estes até então eram descartados no lixo orgânico e encaminhados ao aterro sanitário, havendo perda de seu potencial de virar adubo para plantas. Após a coleta destes resíduos, por meio de recipientes distribuídos em pontos estratégicos da escola, os mesmos foram quantificados, e por fim, depositados em uma composteira doméstica. Esta foi montada a partir de três recipientes de 15 litros, empilhados e conectados entre si por um filtro. Os resíduos são misturados a folhas secas, as quais contêm micro-organismos, garantindo a degradação da matéria orgânica. O chorume produzido é recolhido por meio de uma válvula de escape e, após o período de três semanas, já obtivemos o adubo orgânico. Para análise das melhorias proporcionadas pelo adubo a plantas cultivadas em solo pouco fértil, como é o caso da nossa Instituição, foram escolhidas seis mudas de Ipê do câmpus, em que somente três delas receberam o adubo produzido, enquanto as demais são o controle negativo. Antes da aplicação do adubo, foi realizada a medição dendrométrica das mudas, verificando-se um atraso no desenvolvimento das mesmas. Daqui a três meses novas medições serão realizadas para fins de comparação. O recolhimento dos resíduos teve grande adesão por parte da comunidade escolar, a qual utilizou adequadamente os recipientes disponibilizados, evitando o descarte no lixo comum e manifestando, via questionário, o interesse em aprender a fazer uma composteira em sua casa.', NULL, NULL, '2018-08-10 18:59:33', '2018-09-20 19:47:07', 8, 2, 6, 5, true, NULL, 7.8267857142899997);
INSERT INTO public.projeto VALUES (85, 'FONTE DE ALIMENTAçãO DE COMUTAçãO VARIáVEL COM ARDUINO', 'A fonte de alimentação caseira seria uma ferramenta para experimentos de circuitos eletrônicos que precisa de uma certa alimentação (tensão no circuito), essa fonte terá uma alimentação ajustando a tensão de 0 até 30 Volts e 5 Ampères para cada CH (saída da fonte). A alta eficiência não é realmente crucial para a atividade de pesquisa, mas é um bom benefício se pudermos ficar verdes economizando energia. Como primeira parte vou falar q o projeto implementa um controlador de comutação é projetado usando o circuito integrado (CI). O CI é uma solução completa de baixo custo para o controlador de comutação. Na primeira vez que a fonte de alimentação é ligada, a tensão é aumentada lentamente para evitar a corrida atual. O CI é configurado para fornecer esse recurso e pode ser ajustado selecionando o valor adequado do Capacitor, dando origem a um ciclo de pulso, A tensão de saída é regulada ligando e desligando por dois transistores. A tensão de saída é primeiro dividida pelo divisor de tensão, esta tensão é comparada com a tensão de controle da saída. Como segunda parte vou fala do modo visual mostrando a tensão, corrente e potência que a fonte fornecendo para alimentar o circuito, com um controle digital e display LCD gráfico para a nossa fonte de alimentação será apresentado aqui. O microcontrolador usado no circuito é o Arduino, usamos a placa para facilitar o desenvolvimento, se você não quiser usar a placa Arduino. As principais características da fonte de alimentação são o nível de tensão de saída ajustável e o limitador de corrente ajustável. Precisamos de uma interface de controle para definir os parâmetros e uma exibição para monitorar o valor real do parâmetro controlado. A interface de controle consiste de três chaves (para CH) e um potenciômetro (para CH). Os interruptores de tecla são lidos pelo pino de entrada digital da placa do micro controlador, e o potenciômetro é lido pela entrada analógica da placa.', NULL, NULL, '2018-08-08 21:56:06', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 0);
INSERT INTO public.projeto VALUES (155, 'UTILIZAçãO DE RESíDUOS SóLIDOS DO AMBIENTE ESCOLAR PARA CONSTRUçãO DE UM JARDIM SUSPENSO', 'Uma das grandes preocupações do mundo contemporâneo, é o que fazer com a grande quantidade de material residual oriundo do consumo humano. No ambiente escolar, este problema não é diferente, dada a herança cultural que ainda há na sociedade brasileira. Neste sentido, o presente trabalho teve por objetivo iniciar um projeto de utilização de resíduos sólidos para criação de um jardim suspenso. Foram coletados resíduos nas lixeiras do pátio da escola que pudessem ser utilizados para o plantio de plantas ornamentais, classificados quanto a sua origem material e pesados numa balança para quantificação. Foram realizadas sete coletas, entre maio a agosto de 2018, obtendo um total de 4741 kg de resíduos, sendo destes, 3198 kg de garrafa PET, 489 gr. de recipientes de papelão, 383 gr. de recipientes plásticos, 355 gr. de latas de alumínio e 316 gr. de tampinhas plásticas. Evidenciou-se que os resíduos, de origem plástica compreenderam 82,2%, os de papelão contabilizaram 10,3% e o de alumínio 7,5%. Apesar de 67,5% do total ser somente de garrafa PET, o tipo plástico de maior reciclagem no país, ademais tornaram-se um grande problema ambiental, pelo longo tempo que levam para se decompor. Por fim, indica-se que na compra de produtos, seja considerada embalagens com menor tempo de degradação, como o papelão, ou que tenham grande valor econômico, como o alumínio, afim de que se diminua o dano ambiental gerado pela produção de lixo na Escola Municipal de Ensino Fundamental General Osório.', NULL, NULL, '2018-08-10 20:31:15', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (272, 'HAMBÚRGUER VEGETARIANO COM ADIÇÃO DE PROTEÍNAS DAS FOLHAS DE ORA PRO NÓBIS', 'A produção e o consumo de carnes bovinas causam impactos ambientais, tendo problemas relacionados ao desmatamento, emissão de gases e o uso excessivo de água para a alimentação do gado. Dessa forma, o objetivo desta pesquisa foi desenvolver uma receita para produção de hambúrguer vegetariano com textura, sabor e propriedades nutricionais semelhantes ao produzido de matéria animal, otimizando a receita com as folhas da planta Ora-Pro-Nóbis. Incialmente foram preparadas 4 receitas de hamburguer vegetariano e avaliadas por análise sensorial entre as integrantes do grupo. Após a escolha da receita base que seria otimizada, foi feita a adição de OPN para aumento proteico do alimento final. A receita otimizada foi submetida a nova análise sensorial com a turma do primeiro módulo do curso técnico em química, forma avaliados sabor, aroma, aspecto visual e textura. Além disso, foi realizado um teste de congelamento a fim de verificar se o produto manteria suas características após 4 semanas submetido a baixas temperaturas. A receita base escolhido tinha como principal ingrediente feijão preto e sua escolha se deu devido ao menor custo de preparo em relação às demais receitas, aspecto visual próximo ao hamburguer a base de carne animal e sabor. A adição de OPN foi capaz de aumentar o teor de proteínas em 34% e o teor de fibras em 47%. Estima-se que uma porção de 100 g do hamburguer com adição de OPN contenha 8,3 g de proteínas e 9,4 g de fibras. A aceitação do produto na análise sensorial foi alta atingindo notas acima de 4,4 em uma escala máxima de 5 em todos os itens avaliados. Conclui-se, portanto, que o hambúrguer vegetal desenvolvido teve grande aceitação, mesmo entre o público não vegetariano. Sugerindo assim, o seu potencial para comercialização. Além disso, a OPN se mostrou uma alternativa adequada para aumentar o teor proteico da receita.', NULL, NULL, '2019-08-09 18:10:12', '2019-09-19 14:30:34', 4, 2, 7, 5, true, 10, 9.11428571428569967);
INSERT INTO public.projeto VALUES (200, 'HISTóRIA DO MOVIMENTO LGBT+: A REBELIãO DE STONEWALL', 'A rebelião de Stonewall foi uma série de protestos que começaram na madrugada de 28 de junho de 1969, no bairro nova iorquino Greenwhich Village. Por cerca de seis noites, a população LGBT+ do Village (em sua maioria, jovens de rua) lutou contra violência policial que sofria e contra o domínio do crime organizados sobre seu entretenimento. A partir desses protestos surgiram organizações que tiverem extrema importância na construção do que hoje concebemos por movimento LGBT+, como a Gay Activists Aliance e a Gay Liberation Front, responsáveis pela produção da primeira “parada gay”. Nosso tema foi escolhido na intenção de promover uma maior conscientização para com o movimento LGBT+, através da compreensão de sua história e luta. Entendemos que o estudo de eventos como esse possa contribuir de forma significativa para a remoção do estigma que, ainda hoje, recai sobre os movimentos ditos minoritários. Nossa metodologia consiste na análise das fontes primárias (produções audiovisuais) e na leitura das fontes secundárias. Nosso problema de pesquisa é compreender como o cinema estadunidense retratou a rebelião de Stonewall, a partir do estudo de nossas fontes primárias, sendo estas o filme Stonewall e o documentário Stonewall Uprising. Nossos objetivos específicos são estudar o efeito da rebelião no movimento LGBT+ e buscar suas origens. Como resultado da pesquisa, obtivemos consciência do impacto que a rebelião de Stonewall teve na cultura conservadora e conformista que estava sendo rompida entre as décadas de 1960 e 1970, e buscamos resgatar seu espírito de luta frente ao retorno dessa cultura nos tempos atuais. Trazemos esta pesquisa para “tirar do armário” as raízes do ativismo queer e dar-lhes seu devido reconhecimento, visando sempre ressaltar a importância da educação na construção do respeito para que no futuro não haja necessidade de rebeliões como a de Stonewall.', NULL, NULL, '2019-07-23 13:36:11', '2019-09-19 15:12:39', 3, 2, 7, 5, true, 9.75, 9.90000000000000036);
INSERT INTO public.projeto VALUES (54, 'GENÉTICA: A ESTRUTURA DO DNA E AS DOENçAS HEREDITáRIAS', 'Genética é a parte da ciência que estuda a hereditariedade, a estrutura e função dos genes e a variação dos seres vivos. O motivo pela qual nós escolhemos este assunto é que achamos interessante e, acreditamos que no ácido desoxirribonucleico (DNA) pode-se encontrar respostas para perguntas e soluções para uma doença. Começamos nossa pesquisa pela internet, entendendo como se forma o DNA, elencando os elementos que compõe o mesmo. Debatemos a importância do DNA à vida humana, aprofundamos como algumas doenças genéticas são transmitidas e para finalizar fizemos um modelo do DNA e após tudo, estruturamos o trabalho, criando assim nosso projeto: GENÉTICA. A estrutura básica do DNA humano é formada, na parte externa da molécula, pela ligação entre a desoxirribose de um nucleotídeo com o grupo fosfato de outro e, na região interna, pela formação de pontes de hidrogênio entre as bases nitrogenadas. As doenças são consideradas genéticas quando ocorre uma alteração no material genético. Podem conter caráter hereditário, ou podem ser causadas por alterações no DNA ao longo da vida. Nós aprendemos que na maioria das vezes as doenças não se manifestam no exato momento do nascimento do indivíduo e sim ao longo da vida. Também concluímos que a genética é base para a compreensão da evolução humana. Hoje em dia, mesmo durante a gestação é possível saber se a criança irá nascer com algum problema genético.', NULL, NULL, '2018-08-07 14:12:14', '2018-09-20 19:47:07', 10, 3, 6, 5, true, 7, 9.36250000000000071);
INSERT INTO public.projeto VALUES (171, 'INFOVOLUNTáRIO', 'O projeto “InfoVoluntário” aborda a temática do voluntariado, aliando-a à tecnologia em prol da ampliação do engajamento da comunidade, pois destacam-se negativamente baixos índices de envolvimento da população brasileira com este tipo de ação. Também é importante ressaltar que a divulgação de trabalhos voluntários e o acesso à informação quando não executados de forma efetiva, acabam por tornar-se empecilhos às práticas solidárias. A pesquisa investiga então como desenvolver uma ferramenta eficiente no incentivo às atividades voluntárias, através de funcionalidades que utilizam recursos e tecnologias atuais. Sendo assim, pretende-se auxiliar na difusão do voluntariado nas comunidades através da implementação de um sistema Android e Web para uso de instituições, parceiros e voluntários. Prioriza-se a interatividade, atratividade ao usuário, fácil utilização e o acesso a informação de acordo com as necessidades do usuário. Os métodos para a realização do projeto foram divididos em quatro etapas de execução. A primeira delas destina-se ao embasamento teórico acerca do tema, incluindo procedimentos como: revisão bibliográfica, estudo das tecnologias aplicadas, avaliação de trabalhos relacionados e aplicação de questionário na comunidade. Já para a segunda etapa, visa-se o planejamento e esquematização de funcionalidades. A programação, junto a fase de testes em relação ao funcionamento e critérios técnicos, forma a terceira etapa, focalizada na construção do sistema e sua disponibilização. Por fim, há na quarta etapa de desenvolvimento, a divulgação do sistema e formalização dos resultados e conhecimentos obtidos. Respectivamente ocorrem através de: participação em feiras científicas, publicações acadêmicas e divulgação nas redes; escrita de artigo científico e relatórios técnicos. O projeto está desenvolvimento, porém apresenta resultados parciais positivos, condições favoráveis para sua realização e indica continuidade através de atividades previamente planejadas.', NULL, NULL, '2018-08-10 22:39:38', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7.625, 9.70625000000000071);
INSERT INTO public.projeto VALUES (219, 'A CRISE DE 1929 REPRESENTADA NA IMPRENSA BRASILEIRA', 'A presente pesquisa possui como tema a Crise de 1929 que afetou os Estados Unidos e grande parte do mundo impactando fortemente a economia e o mercado financeiro de diversos países capitalistas. O início da crise foi marcado pela quebra da Bolsa de Valores de Nova Iorque, que é considerada uma consequência da ação conjunta entre as crises de superprodução e do campo instauradas nos Estados Unidos após a Primeira Guerra Mundial. O enfraquecimento da crise se deu somente após o presidente Roosevelt impor o plano intervencionista New Deal, que auxiliou no desafogamento do mercado e fez a economia norte-americana voltar a respirar um pouco mais aliviada. Porém, a recuperação completa dos EUA só ocorreu com o estímulo e os lucros do mercado bélico durante a preparação para a Segunda Guerra Mundial. Hoje em dia, o tema da Crise de 1929 é pouco debatido nas instituições de ensino, fato este que considero inadequado, pois entender os impactos de tal crise é importante para entendermos outras crises do capitalismo que nos afetam diretamente. Por conta disto, nosso problema de pesquisa é analisar como a imprensa brasileira retratou a Crise de 1929. Nosso objetivo geral é demonstrar como a Crise de 1929 foi representada na imprensa brasileira e como objetivos específicos pretendemos demonstrar a situação vivida pela população na época e perceber como os impactos da crise foram sentidos em nosso país. Para fins de desenvolvimento da pesquisa, elaboramos uma revisão bibliográfica através das leituras e fichamentos dos textos de ANVERSA, COGGIOLA, HOBSBAWM, PAPI e utilizamos como fontes primárias os jornais Correio da Manhã e Jornal do Brasil das edições entre 1928 – 1942 disponíveis na Hemeroteca Digital da Biblioteca Nacional. A pesquisa está em desenvolvimento, até esse momento resultados parciais demonstram que a imprensa brasileira representou com bastante ênfase os impactos da Crise de 1929 na economia mundial, por conta da grande cobertura apresentada nos periódicos lidos.', NULL, NULL, '2019-08-06 16:14:44', '2019-09-19 15:16:13', 3, 2, 7, 5, true, 8.25, 9.38571428571430033);
INSERT INTO public.projeto VALUES (76, 'CONECTANDO MULHERES AO EMPREENDEDORISMO', 'O projeto Conectando Mulheres ao Empreendedorismo busca através de aulas realizadas no IFSUL-câmpus Venâncio Aires, ensinar as participantes do mesmo a usar o software livre Inkscape Project, para que com este conhecimento consigam gerar renda. Acreditamos que as mulheres ainda estão em desvantagem em relação ao emprego e o salário no mercado de trabalho, com base nesses dados este projeto incentiva a mudança na vida destas alunas. Não apenas tendo como interesse final, fazer gráficos para medir resultados que reflitam o desenvolvimento das pessoas envolvidas, pois sabemos que há pontos da vida que não podem ser contados numericamente. Assim buscamos ensiná-las a usar tecnologia e o conhecimento ao seu favor, pois acreditamos que o saber é um processo e não um produto. Não apenas esperando que tenham uma renda extra, mas sim que concluam estas aulas com vigor, responsabilidade e entusiasmo, para que não somente estas aprendam, mas juntamente com elas, nós também aprendamos. Trocando experiências e mostrando que elas não devem temer este mercado, e sim se arriscarem a novas oportunidades. Ensinar mulheres da cidade de Venâncio Aires será mais que apenas mostrar conhecimentos da área de informática, nossos objetivos irão além disto. Pois buscamos criar espaços e momentos no ambiente de aula, para discutir e refletir sobre assuntos que tanto assustam e perseguem as mulheres em toda a sua trajetória cultural, como o assédio, desigualdade em todos os âmbitos sociais, estupro, violência e morte. O projeto Conectando Mulheres ao Empreendedorismo, busca não responder uma única pergunta, mas sim, criar questionamentos para que suas respostas sejam outros questionamentos. Independente das dificuldades, visamos ensinar e ser capazes de responder as diversas perguntas das alunas, assim indo em busca, se necessário, de novas experiências e conhecimentos, para continuarmos aprendendo e ensinando.', NULL, NULL, '2018-08-08 13:53:50', '2018-09-20 19:47:07', 5, 2, 6, 2, NULL, 4, NULL);
INSERT INTO public.projeto VALUES (126, 'MULHERES NEGRAS NA CIêNCIA BRASILEIRA', 'Nosso objetivo nessa pesquisa foi investigar a trajetória acadêmica e profissional de mulheres negras na ciência brasileira. Sabemos que existem desigualdades de oportunidades entre gêneros e raças no Brasil e dos obstáculos enfrentados pelas mulheres, em especial mulheres negras, e crescer em carreiras científicas. Nosso estudo é qualitativo e para realizá-lo, primeiramente pesquisamos em artigos científicos e reportagens que abordassem a presença da mulher na ciência, em especial, da mulher negra. Após, procuramos algumas pesquisadoras atuantes em instituições de ensino superior para que respondessem a um questionário com perguntas abertas com a intenção de compreendermos sua trajetória até o cargo que atualmente ocupa. Encaminhamos o questionário a três pesquisadoras. Até o momento obtivemos o retorno de um questionário. Concluímos que existem muitas dificuldades para o crescimento profissional da mulher negra na área da ciência, porém, através de exemplos como da nossa entrevistada percebemos que é possível vencer as dificuldades e incentivar outras meninas e mulheres a conquistas seu lugar no mercado de trabalho.', NULL, NULL, '2018-08-10 15:43:41', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 7.375, 0);
INSERT INTO public.projeto VALUES (14, 'SIGABLUE – UM APLICATIVO VOLTADO À SEGURANÇA PÚBLICA', 'Um dos grandes problemas enfrentados pela sociedade brasileira tem sido a violência urbana. As ocorrências, em crescente número, afetam a população drasticamente e a torna vítima de situações que põem em risco os seus pertences e até mesmo as suas próprias vidas. O aplicativo proposto neste trabalho, denominado SigaBlue, busca auxiliar a população em geral a evitar áreas perigosas. A plataforma efetua uma sondagem das ocorrências cadastradas pelos usuários, classificando cada região conforme o número de notificações existentes em determinada área e permite notificar as pessoas sobre a situação do local, efetuando, inclusive o cálculo de rotas seguras. O modelo do sistema é dividido em três partes: usuário, na qual encontram-se todas as ações e interações que o usuário poderá realizar; serviço, que tem como principal função fundamentar toda a lógica, para que toda ação e interação do usuário seja realizada de forma adequada; e interface do usuário, que tem a finalidade de exibir os resultados e notificações ao usuário. A área de prevenção da violência urbana tem tido um grande crescimento, contando com aplicativos como o “Onde eu fui roubado”, “Crime Maps”, “Wiki Crimes” e “B.O. Coletivo”. No entanto, SigaBlue não foi apenas elaborado para aperfeiçoar as funcionalidades, não funcionais, contidas em outros sistemas, mas sim para oferecer novas características. O presente projeto, oriundo de um Trabalho de Conclusão de Curso Técnico em Informática para Internet, ainda está em processo de desenvolvimento. Os próximos passos do trabalho envolvem a conclusão de módulos e correções de erros. Entretanto, com as simulações já realizadas, o sistema demonstra êxito na elaboração das sondagens das ocorrências, nas classificações dos locais e na disponibilização de rotas. Desta forma, as funcionalidades já concluídas e as que ainda estão em desenvolvimento permitirão aos usuários evitar os focos de criminalidade, prevenindo-se de situações de risco.', NULL, NULL, '2018-07-31 07:55:30', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7.125, 8.9732142857142847);
INSERT INTO public.projeto VALUES (351, 'DEFICIêNCIA VISUAL: ENSINO DE ELETRICIDADE ATRAVéS DA TECNOLOGIA ASSISTIVA', 'Segundo dados da OMS (2013), cerca de 39 milhões de pessoas no mundo são cegas e outras 246 milhões possuem perda severa ou moderada da visão o que dificulta a realização de tarefas do cotidiano. No Brasil, mais de 6,5 milhões de pessoas possuem alguma deficiência visual: 528.624 pessoas são incapazes de enxergar e 6.056.654 pessoas possuem baixa visão ou visão subnormal. O curso de Eletromecânica apresenta na grade curricular a disciplina de Eletricidade na qual muitos discentes possuem dificuldades de aprendizagem, pensando nisso e na possível alternativa para alunos com deficiência visual frequentarem o curso, com base em estudos o grupo buscou explorar os sentidos de tato e audição, criando um kit com dispositivos pedagógicos voltados para deficientes visuais com o intuito de incluí-los e auxiliá-los no ensino de Eletricidade. Nesse sentido, novas pesquisas realizadas referentes aos 5 sentidos humanos provam que a partir da perda de um ou mais sentidos, o cérebro cria novas conexões que fazem com que os sentidos restantes se desenvolvam com mais intensidade. Em pessoas cegas, a audição, o tato e o paladar são recursos fundamentais para as percepções exteriores e interiores do indivíduo, sendo a ausência da visão um aspecto positivo nesta perspectiva. Logo, foram desenvolvidos três protótipos que auxiliam na compreensão dos conceitos básicos de Eletricidade tais como Lei de Ohm, interação das cargas elétricas e associação de resistores em série e paralelo. Seguindo a metodologia do projeto, foi realizado o modelamento (3D) e detalhamento (2D) no software SolidWorks, em seguida a confecção dos protótipos. Os próximos passos serão a adaptação do material teórico para a escrita Braille bem como a adaptação de um protoboard, com a finalidade de permitir que o usuário possa montar seu próprio circuito e após, será realizado aulas experimentais com deficientes visuais para testes e possíveis ajustes.', NULL, NULL, '2019-08-12 21:57:35', '2019-09-19 15:23:25', 7, 2, 7, 5, true, 8.75, 9.5785714285714505);
INSERT INTO public.projeto VALUES (438, 'TURTLE TECH: DISPOSITIVO ELETROELETRÔNICO AUXILIAR NA PRESERVAÇÃO DA ESPÉCIE DE QUELÔNIO MESOCLEMMYS HOGEI', 'O Mesoclemmys hogei é uma espécie de quelônio endêmica do Brasil, símbolo do Rio Paraíba Sul, que nos últimos anos apresentou drástica diminuição em sua população, sendo considerada uma espécie criticamente em perigo, uma classificação antes da extinção na natureza. Além disso, estima-se que a redução populacional chegue a 80% num futuro próximo. Segundo o projeto Cágado-do-Paraíba, entender os hábitos reprodutivos destes animais é a chave para salvá-los da ameaça de extinção, sendo este o maior desafio dos pesquisadores, pois até então, nunca foi encontrado o local de desova, por exemplo. Isso se dá, pois o monitoramento atual, através de um transmissor vhf, não oferece precisão, além de possuir uma série de falhas que impedem o monitoramento adequado do animal. Sendo assim, o estudo busca desenvolver um dispositivo eletroeletrônico de monitoramento remoto e instantâneo que possa solucionar esses problemas, de maneira a auxiliar no levantamento de dados biológicos e em especial, reprodutivos, da espécie, contribuindo com as iniciativas em prol de sua preservação. O dispositivo é constituído por um módulo de GPS e um transmissor de rádio NRF24l01. Sendo o GPS responsável por fornecer a localização do animal através de coordenadas e o transmissor NRF transmitir essas informações para uma antena próxima ao local, na margem do rio. Esta antena envia as coordenadas para os pesquisadores através de um SMS, utilizando um módulo GSM, assim o pesquisador recebe a informação de onde estiver por telefone. O dispositivo é alimentado por uma bateria de lítio de 1715mA, recarregado por uma placa solar de 5V e controlado por um Arduino UNO. A tecnologia de GPS para o monitoramento animal é cada vez mais utilizada por ser mais precisa, leve e eficiente no recolhimento de dados essenciais na preservação da biodiversidade, reforçando a ideia da importância da união de conhecimentos de diversas áreas com um fim: a preservação das espécies ameaçadas e da biodiversidade como um todo.', NULL, NULL, '2021-10-17 21:16:12', '2021-11-05 10:22:18', 8, 2, 9, 5, true, 9.5, 8.32499999999999929);
INSERT INTO public.projeto VALUES (43, 'AQUECEDOR SOLAR COM TUBOS DE PVC', 'O consumo de energia elétrica no Brasil é muito alto, e para produzir essa energia toda é necessária à construção de usinas, que geram um impacto enorme no meio ambiente. Em média o valor gasto em energia elétrica representa de 30% a 50% do consumo de energia em uma residência, gerando um consumo alto de energia elétrica. Uma solução é utilizar energia solar para aquecer a água para o banho, com a elaboração de um aquecedor solar com materiais disponíveis em lojas de materiais para construção. Mas, porque devemos utilizar a energia solar dentre tantas outras? A energia solar não emite gases, reduzindo as consequências do efeito estufa. É uma forma de energia limpa, sustentável, renovável e, com isso reduz o impacto ambiental. O sol é uma fonte de energia limpa e renovável, ou seja: a geração de energia solar não está associada à emissão de poluentes. Isso não quer dizer, entretanto, que não existam impactos ambientais causados pela obtenção deste tipo de energia. Esse aquecedor solar de água é um sistema composto por coletores solares instalados sobre o telhado e ligados em uma caixa d&#39;água revestida com isolante térmico, que servirá para a utilização no banho. No box do banheiro terá um misturador de água quente e fria e um chuveiro com dimmer, mais conhecido como chuveiro eletrônico, que irá servir de suporte térmico para os dias onde o Sol não apareça. O sistema funciona por termo-sifão, ou seja: a água do fundo do reservatório, água mais fria, vai para os coletores que são instalados abaixo do nível inferior do reservatório, quando o sol bater nos coletores, vai aquecer a água que está dentro deles, por sua vez a água quente vai ficar mais leve, e será empurrada de volta para o reservatório térmico pela água mais fria, a qual é mais pesada, que virá do fundo do reservatório para a base dos coletores. Essa circulação será natural e constante enquanto possuir Sol.', NULL, NULL, '2018-08-06 11:17:07', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 9.54374999999999929);
INSERT INTO public.projeto VALUES (257, 'TAXIADAPT – UTILIZANDO A TECNOLOGIA PARA AUXILIAR A LOCOMOÇÃO DE PESSOAS COM DEFICIÊNCIA FÍSICA', 'O Censo Demográfico de 2010, do Instituto Brasileiro de Geografia e Estatística, afirma que 23,9% da população brasileira declarou ter pelo menos um tipo de deficiência, porcentagem que corresponde aproximadamente a 45,6 milhões de pessoas. As demais pesquisas indicam que deficientes físicos encontram dificuldade de deslocamento em diferentes barreiras, desde o uso do transporte público até a falta de uma infraestrutura arquitetônica nas cidades. Assim, o aplicativo TaxiAdapt tem como objetivo desenvolver um software com a intenção de ofertar uma nova alternativa no serviço de transporte individual de pessoas portadoras de deficiência. Para a realização da pesquisa, primeiramente é exibido o referencial teórico, onde há definições sobre deficiência física e mobilidade urbana. Para o desenvolvimento do software, será utilizada a linguagem Java, tecnologia GPS para determinar a localização atual, com isso, usuários podem encontrar o veículo com a integração entre mapas e localização, utilizando os frameworks Spring Security e Spring Data para a comunicação com o banco de dados relacional MySQL. Dessa maneira, espera-se que o aplicativo TaxiAdapt facilite o deslocamento dessas pessoas através de corridas, as quais serão realizadas por veículos acessíveis, melhorando o nível de conforto, diminuindo o tempo de espera pelo serviço e possibilitando independência dos usuários. O usuário terá a possibilidade de realizar agendamentos de corridas através do aplicativo, focado apenas no estado do Rio Grande do Sul (RS).', NULL, NULL, '2019-08-09 10:56:41', '2019-09-19 15:17:23', 6, 2, 7, 5, true, 9.625, 9.375);
INSERT INTO public.projeto VALUES (270, 'A INFLUêNCIA DA LEITURA PARA O APRENDIZADO DA LíNGUA PORTUGUESA', 'A leitura é uma ferramenta muito importante para o aprendizado. Porque lendo, podemos descobrir novas culturas, entre outras coisas. Dessa forma, o objetivo desta pesquisa foi verificar se a leitura influência na contextualização de algumas palavras e ver o quanto a interpretação de texto muda de pessoa por pessoa. Será que é possível descobrir novos significados para palavras já conhecidas a partir da leitura? Realizamos uma dinâmica com 51 alunos do 4° ano, que funcionou da seguinte forma: entregamos a eles uma folha com quatro palavras, pedimos que escrevessem o significado das mesmas e depois lemos um texto, A ‘Menina do Vestido Azul’, e pedimos a eles que reescrevessem os significados das palavras, para ver se, após a leitura do texto, a visão deles havia se modificado. Depois de fazermos a dinâmica analisamos as respostas e fizemos alguns gráficos para mostrarmos e compararmos de forma clara e específica os resultados. Analisando os gráficos dessa dinâmica podemos ver que o índice de acertos aumentou 3,92% e que o índice de erros diminuiu 1,47% após lerem o texto. Assim como também se observou que o número de crianças que responderam a segunda folha de perguntas aumentou. Nós concluímos que a leitura pode sim influenciar no aprendizado da língua portuguesa, já que muitas das crianças mudaram de opinião sobre o significado das palavras depois da leitura.', NULL, NULL, '2019-08-09 17:53:12', '2019-09-19 14:41:15', 11, 3, 7, 5, true, 8, 9.80000000000000071);
INSERT INTO public.projeto VALUES (274, 'DESPERDÍCIO DE ALIMENTOS', 'O desperdício de alimentos é muito comum em nossa sociedade. Por isso, o objetivo da pesquisa foi entender como ocorre a perda desses alimentos em residências e restaurantes e o que se pode fazer para reduzir esse fato. Fizemos uma pesquisa bibliográfica sobre o desperdício de alimentos. Além disso, fizemos entrevistas com responsáveis por restaurantes para descobrir se eles conhecem dados do descarte de resíduos orgânicos dos estabelecimentos. A fim de compreender como podemos reduzir o desperdício de alimentos em uma residência, mapeamos como ocorre o descarte de comida e formulamos um questionário sobre o assunto. Na entrevista com os responsáveis dos restaurantes descobrimos que o estabelecimento A monitora o desperdício de alimentos e descarte de cerca de 15 kg de resíduos orgânicos por dia, 5 kg de prato e 10 kg do buffet. O estabelecimento B monitora o desperdício de alimentos e observa que o maior desperdício acontece no sábado. O público que respondeu o questionário online afirmou que 66% deles costuma olhar a data de validade antes de comprar um produto e que 78% não costuma servir mais comida no prato do que consegue consumir. Dessa forma, conseguimos perceber que muitas pessoas têm bons hábitos. Os restaurantes entrevistados também têm uma maneira muito boa de lidar com os alimentos, diferente do que nós pensávamos, muitos já monitoram o desperdício de alimentos.', NULL, NULL, '2019-08-09 18:40:30', '2019-09-19 15:18:42', 10, 3, 7, 5, true, 8.625, 9.47499999999999964);
INSERT INTO public.projeto VALUES (123, 'HEALTH & CARE', 'Entre os diversos problemas presentes no sistema de saúde brasileiro, a utilização de sistemas e softwares adequados para o auxílio nas interações de médicos e pacientes tem sido um de pouco uso. Por esta razão, muitos agendamentos de consultas e tratamentos, pedidos de atestados e receitas médicas são obstáculos de muitos brasileiros atualmente. Enormes filas de atendimento, necessidade de locomoção até um consultório e altas taxas de cobrança em ligações são dificuldades que muitos pacientes enfrentam para realizar consultas e procedimentos médicos. Com o avanço da tecnologia e da informática em diversas áreas, o seu uso tem sido de grande ajuda para o auxílio e desenvolvimento de distintas ferramentas. São utilizados diversos aplicativos em diversas áreas como educação, comunicação, entretenimento, segurança, comércio, pesquisa, cinema, arte e muito mais. Pensando nisto, o uso da tecnologia na área da saúde poderia ser de grande ajuda para muitas pessoas que sofrem dificuldades para locomoção, tempo de espera e situação financeira. Por conta destes fatores que tem se apresentado, minha proposta de solução é implementar um sistema web que auxilie profissionais de saúde, secretários e pacientes a estabelecerem uma melhor comunicação e interação utilizando da tecnologia. Isto fará com que os atendimentos e agendamentos sejam realizados de forma mais rápida, prática e barato. A proposta deste trabalho é desenvolver um sistema web que permita o agendamento de consultas médicas pelos pacientes, o gerenciamento da agenda médica pelo profissional da saúde e/ou secretário e o gerenciamento de prontuários médicos pelo profissional da saúde.', NULL, NULL, '2018-08-10 15:08:45', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7.75, 6.33571428570999995);
INSERT INTO public.projeto VALUES (356, 'DELTA: UMA PLATAFORMA PARA DESPERTAR O INTERESSE DE CRIANçAS EM CIêNCIA', 'Com o avanço da tecnologia, é possível perceber que existem pontos positivos e negativos em relação ao uso de computadores e dispositivos móveis por crianças. Como ponto positivo, há o desenvolvimento do letramento digital. Como ponto negativo, há a falta de interesse na leitura. O presente trabalho faz parte de uma pesquisa em andamento e tem o objetivo de desenvolver o aplicativo Delta, que pretende contribuir para o hábito de leitura e despertar o interesse em ciência em crianças do 9° ano do Ensino Fundamental. Neste trabalho, foi realizado uma pesquisa bibliográfica sobre leitura, letramento digital, gamificação e textos de divulgação científicas, além uma pesquisa sobre aplicativos para crianças relacionados aos temas da pesquisa. Foram aplicados formulários para crianças de algumas escolas da região metropolitana de Porto Alegre a fim de validar a aplicação, seu público-alvo e a sua aceitação. Para o desenvolvimento do aplicação, serão utilizadas tecnologias como: Java, para a programação da aplicativo; MySQL, para o armazenamento de dados; e Android, para a criação das telas do aplicativo. Os resultados parciais apontam que não há aplicativos voltados para crianças com o objetivo de contribuir para o hábito de leitura e para despertar o interesse em ciência. Por fim, espera-se que o aplicativo possa alcançar um grande número de usuários para disseminar o conhecimento científico em diversas áreas e, também, que seja desenvolvido uma versão para usuários do sistema IOS.', NULL, NULL, '2019-08-13 23:09:55', '2019-09-19 15:18:14', 6, 2, 7, 5, true, 7.25, 10);
INSERT INTO public.projeto VALUES (433, 'ANÁLISE DE PRECIPITAÇÃO NO SEMIÁRIDO NORDESTINO', 'O avanço da urbanização e crescimento populacional intensificam a preocupação com os recursos naturais, sobretudo com os recursos hídricos, dada sua importância para todos os seres vivos. A precipitação é considerada um dos elementos mais importantes nos estudos hidrológicos, pois permite observar tendências climáticas em determinada região e avaliar melhor a influência antrópica no local. A região semiárida do Nordeste apresenta características específicas quanto ao clima, com limitações de recursos naturais marcantes e escassez de recursos hídricos. Considerando as causas citadas, o objetivo deste trabalho foi analisar o regime de precipitação no semiárido nordestino tendo como objeto de estudo a bacia hidrográfica localizada na Fazenda Tamanduá, no Sertão Paraibano. Por via de uma série histórica de dados pluviométricos coletados no local durante 93 anos (1926-2018), diferentes análises estatísticas foram realizadas utilizando o software Excel 2019 para determinar a média mensal de precipitação na série, períodos de seca frente aos fenômenos el niño e la niña, acumuladas mensais e permanência da precipitação mensal e anual. A precipitação média anual foi de 721,8 mm; indicando os meses de março e abril como os mais chuvosos (médias de 215 mm e 116mm, respectivamente) e agosto e setembro (médias de 3 mm e 1 mm, respectivamente) como mais secos. As médias mensais, quanto à linearidade, apresentam tendência negativa no período, demonstrando que a precipitação decai ao longo dos meses na série temporal. Os dias sem chuva analisados considerando os fenômenos el niño e la ninã indicaram que, em anos com a presença dos eventos, houve maior ocorrência de seca. Além disso, os resultados demonstram e reforçam a importância da preservação dos recursos hídricos; visto que, na série, foram observados longos períodos de seca, que afetam tanto o ecossistema como também a população local.', NULL, NULL, '2021-10-17 14:56:04', '2021-11-04 20:13:06', 8, 2, 9, 5, true, 8.875, 7.48749999999999982);
INSERT INTO public.projeto VALUES (34, 'HISTÓRIA DO MOVIMENTO LGBT+: A REBELIÃO DE STONEWALL', 'A rebelião de Stonewall aconteceu em meio ao turbilhão de mudanças do final da década de 60, fruto da influência da contracultura e do movimento hippie no crescente ativismo LGBT+ estadunidense. Foi em meio a protestos contra a guerra no Vietnã e grupos que lutavam pelos direitos da população negra, que drag queens, gays e lésbicas rebelaram-se contra as forças policiais nova iorquinas que os oprimiam, e contra a atuação do crime organizado na gerência de bares destinados a comunidade queer. Em busca de acontecimentos que ajudaram a moldar a sociedade, trazemos um tema de pouca visibilidade na tentativa de incentivar seu estudo e reflexão. Para isso optamos pelas produções audiovisuais como fonte de pesquisa histórica, apostando metodologicamente tanto na confiança do documentário, quanto na incerteza ficcional do filme para “tirar do armário” uma importante parte da história do movimento LGBT+. Desse modo, nosso problema de pesquisa é analisar a forma como a rebelião de Stonewall foi retratada pelo cinema estadunidense do século XXI? E nossos objetivos são compreender os eventos da madrugada de 28 de junho de 1969 e demonstrar suas consequências na cena queer atual, assim como seu impacto na cultura conservadora e conformista que estava sendo rompida entre as décadas de 1960 e 1970. Essa mesma cultura tem se reerguido nos últimos anos, ameaçando as conquistas de grupos que vem lutando por seus direitos há muito tempo, como o movimento feminista e o LGBT+. Com este projeto que tem por objetivo analisar a rebelião de Stonewall através do cinema, visamos ressaltar a importância da educação na construção do respeito, para que no futuro não haja necessidade de rebeliões como a de Stonewall.', NULL, NULL, '2018-08-03 15:16:05', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 8.375, 9.78125);
INSERT INTO public.projeto VALUES (52, 'ESTATÍSTICA FINANCEIRA: VARIAçãO DOS PREçOS DESDE O INíCIO DO PLANO REAL', 'A estatística é a ciência que trabalha com probabilidades. Escolhemos este assunto pois achamos que seria bem legal saber o preço dos alimentos no início do plano real e o seu preço de lá até aqui. E além disso estudar o quanto a cesta básica representa percentualmente no salário mínimo. Durante o projeto pesquisamos em diversos sites. Além disso, entrevistamos o empresário Paulo Roberto Villa Verde e a economista Mariane Oliveira Ragusi, o que nos ajudou a sanar várias das nossas dúvidas. Aprendemos que o preço dos alimentos muda constantemente. Havia uma época que o preço dos alimentos da manhã eram diferente da tarde e da tarde para a noite. Em 1994 o salário mínimo era de R$ 64,70 e em 2018 é de R$ 954 um percentual de aumento de 1.372,45%. Em 1994 a cesta básica custava R$ 70,80 que correspondia a 109,27% do salário já em 2018 é de R$434,70 que corresponde a 45,56% do salário. Um fato interessante foi o que o percentual da cesta em relação ao salário mínimo diminuiu, o que é um grande avanço econômico. Isso deveria ter melhorado a situação financeira de muitas famílias brasileiras, porém ainda hoje muitas delas passam por dificuldades financeiras devido ao custo de vida do país. Outro fato que achamos muito diferente foi a variação do preço dos alimentos desde a saída da fazenda até os supermercados.', NULL, NULL, '2018-08-07 14:03:46', '2018-09-20 19:47:07', 10, 3, 6, 5, true, NULL, 9.07499999999999929);
INSERT INTO public.projeto VALUES (250, 'TECMACROUCH - TECNOLOGIA ASSISTIVA DE RECREAÇÃO PARA CRIANÇAS COM MARCHA CROUCH NA PARALISIA CEREBRAL', 'O projeto realizado foi desenvolvido com o propósito de unir tecnologia assistiva com a atividade lúdica, promovendo a inclusão de pessoas com paralisia cerebral a nível de marcha crouch. Para isso foi desenvolvido um brinquedo com base no gira-gira possibilitando que crianças com essa deficiência consigam brincar no mesmo ambiente que as demais. Tendo em vista a necessidade de brinquedos adaptados no Brasil, mais especificamente em Novo Hamburgo/RS, e o quanto os mesmos influenciam na inclusão social, na ludicidade, no desenvolvimento da diversão e aprendizagem de uma criança se torna de grande importância o desenvolvimento de um brinquedo que se adeque às necessidades de uma criança com paralisia cerebral em nível de marcha crouch. A pesquisa, contou com o auxílio de uma fisioterapeuta, realizou-se um estudo de caso, tendo assim noção do cotidiano de uma criança com paralisia cerebral a nível de marcha do tipo crouch. Para a fundamentação deste projeto foram utilizados como referências: artigos científicos, livros, consultas com diferentes profissionais da área de engenharia mecânica, fisioterapia e tecnologia assistiva. Foi feita a realização de cálculos para dimensionar o dispositivo conforme o seu material, além da projeção em software de CAD 3D, simulações para verificar se o dispositivo aguentaria as cargas que estivesse sujeita e impressão 3D de um modelo de protótipo em escala reduzida. A partir das simulações foi possível verificar que o brinquedo resiste às cargas que serão aplicadas obtendo um bom coeficiente de segurança, sendo capaz de estimular a inclusão, ajudar inclusive no processo fisioterapêutico, atendendo aos objetivos do projeto. Para a continuidade do projeto os próximos passos envolvem a fabricação de um protótipo em escala real, instalação e testes práticos.', NULL, NULL, '2019-08-09 00:20:54', '2019-09-19 13:57:39', 7, 2, 7, 5, true, 10, 8.96071428571429962);
INSERT INTO public.projeto VALUES (295, 'DETECTOR DE METAIS', 'O projeto tem como tema a reutilização do lixo eletrônico, e a montagem de um detector de metais de baixo custo com componentes reaproveitados, podendo ser feito por qualquer pessoa com mínimo conhecimento em eletrônica. O projeto irá apresentar o aparelho montado por alunos do 1º ano do ensino médio integrado em eletrônica, esse detector irá ajudar o meio ambiente, pois o lixo eletrônico que seria descartado de modo muitas vezes incorreto, pode receber um novo fim, como sendo um equipamento para segurança patrimonial ou pessoal, podendo ser adaptado para segurança automatizada,ou na construção civil para identificar se no interior de paredes ou lajes existe rede elétrica, assim evitando acidentes que podem ser fatais. Por esse motivo, terá uma explicação simples e fácil para as pessoas entenderem o funcionamento de um detector de metais; as suas principais funções e quais os benefícios de usar o modelo desenvolvido neste projeto, que visa ser mais prático e ter um custo menor em termos de produção, construção e ainda tendo um impacto menor no meio ambiente. E já que o projeto visa o consumidor e o meio ambiente, utilizamos não somente os meios teóricos já utilizados normalmente para pesquisas, mas também foram utilizados os meios práticos, realizando vários testes a fim de saber se o “metalhere”(nome dado por nós desenvolvedores) é viável e seguro, e de que qualquer um pode fazê-lo. É esperado que ao final do projeto tenham sido desenvolvidos dois modelos, sendo um compacto e simples, perfeito para segurança e construção civil, e outro mais robusto e potente, que pode ser utilizado e adaptado para funcionar de diversos modos diferentes, ambos funcionando com baterias ou alimentação externa. Ao final de todos testes realizados, foi concluído que o projeto é viável,porém é necessário realizar mais pesquisas junto aos orientadores, para que assim possa ser afirmado que o “metalhere” pode ser feito e utilizado por todos, assim cumprindo seu propósito.', NULL, NULL, '2019-08-10 00:02:42', '2019-09-19 10:27:13', 7, 2, 7, 5, true, 7.375, 9.59999999999999964);
INSERT INTO public.projeto VALUES (35, 'AQUáRIO AUTOMATIZADO', 'Como outros animais de estimação, os animais que vivem em aquários demandam cuidados diários. Ao viajar, por exemplo, as pessoas que possuem aquários preocupam-se em como os animais que vivem neles podem sobreviver sem sua presença. Sendo assim, a ideia do projeto é automatizar um aquário, permitindo a programação de eventos como alimentação, iluminação e ativação de bomba de oxigênio/filtro, incluindo o controle de temperatura da água. Essas ações também poderão ser realizadas manualmente, através de botões. Através de um teclado, o usuário poderá navegar pelo menu e configurar as opções mostradas no Display LCD. Para a temperatura, o usuário poderá definir a faixa, em graus Celsius, de temperatura em que a água poderá variar. Será utilizado um sensor DS18B20 para medição e um aquecedor que será ativado ou desativado, através de um relé, de acordo com a temperatura da água. Para a iluminação, através de uma lâmpada LED, e oxigenação, através de uma Bomba de oxigênio/ Filtro, do aquário o usuário poderá escolher de quanto em quanto tempo (intervalo de tempo) esses dispositivos devem ser ativados, através de relés, e por quanto tempo deverão permanecer ligados. Já, para a alimentação, o usuário precisará configurar apenas o intervalo de tempo em que a comida será despejada na água, com o auxílio de um Servo Motor. Todas essas funções serão controladas pelo microcontrolador Arduino Mega. Já, o controle do tempo será efetuado por um módulo de tempo real (RTC DS3231). A estrutura do projeto será uma bandeja de madeira dividida em duas metades. Uma será fechada e conterá a parte elétrica e eletrônica (LCD, Teclado, Arduino, Relés...) e outra será aberta e conterá o aquário e os dispositivos associados a ele (Lâmpada, Motor, Bomba, Aquecedor...).', NULL, NULL, '2018-08-03 16:31:28', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 6.875, 9.29553571429000058);
INSERT INTO public.projeto VALUES (26, 'LAB AOT- AUTOMATION OF THINGS', 'Este referido projeto aborda o desenvolvimento de um sistema de automação residencial que será implantado no laboratório de pesquisa do campus Charqueadas do IFSul. Este laboratório é um local destinado aos bolsistas e voluntários que estão desenvolvendo algum projeto. Porém alguns problemas são detectados no sistema de acesso atual do local, que ainda é de forma manual (por meio de chave). Os principais problemas encontrados são: O desperdício de tempo em ir até a recepção solicitar a chave, e assim como a questão de apenas uma pessoa ficar com a posse dessa chave. O projeto está em fase de desenvolvimento, e ele visa satisfazer as necessidades de segurança e restrição do ambiente. O controle no acesso do local será realizado por meio de tags RFID, as informações do usuário contidas nela serão coletadas por um leitor inteligente RFID integrado a plataforma Arduino, ao aproximar o cartão do leitor, o arduino verificará no software se o usuário está cadastrado, somente assim ele pode liberar ou não a porta. Caso o usuário não esteja autorizado, um led vermelho se acende, indicando rejeição, e se o código do usuário estiver no sistema, um led verde acende e se o usuário for liberado, é acionado um atuador que destravará a porta, permitindo o acesso. Os cartões RFIDs serão distribuídos apenas para os frequentadores do laboratório (no caso: voluntário, professores e bolsistas), esses cartões serão credenciados no sistema, sendo assim, só cartões autorizados poderão destravar a porta.', NULL, NULL, '2018-07-31 16:43:34', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 8, 0);
INSERT INTO public.projeto VALUES (189, 'ILUSÃO DE PERSPECTIVA', 'O trabalho tem como objetivo explorar de forma criativa os recursos da câmera fotográfica. Realizamos experiências de perspectiva com brinquedos e pessoas, buscando realismo na cena. Fizemos no primeiro momento pesquisas em sites confiáveis sobre o olhar fotográfico e o uso da perspectiva na fotografia. Cada um de nós cria e desenvolve o seu próprio olhar na fotografia com o decorrer do tempo. Não nasce com você e, com certeza, vai se modificando, sofrem influências da sociedade, desde que nascemos. O que vivemos, nossas vivências, histórias, programas de televisão, redes sociais, define boa parte do olhar de cada um. Percebemos nesta experiência, que nossas fotografias foram melhorando a medida que fomos fazendo repetidas vezes. Fotografar é um treino. Quanto mais fazíamos, melhor ficavam os resultados e novas ideias surgiam. Nosso trabalho ainda está em construção, mas almejamos como resultado, uma exposição fotográfica em diálogo com outras experiências fotográficas da rede municipal.', NULL, NULL, '2018-09-17 13:08:17', '2018-09-20 19:47:07', 12, 3, 6, 5, true, 7.5, 9.05000000000000071);
INSERT INTO public.projeto VALUES (70, 'CLÓVIS X LUZIA: AS ORIGENS DO HOMEM AMERICANO.', 'O propósito desse trabalho é analisar e discutir as principais teorias sobre a entrada do ser humano na América. A razão do desenvolvimento da pesquisa, deve-se ao interesse que desenvolvemos sobre as duas principais teorias debatidas pelos cientistas: a do Povo de Clóvis (entrada ocorre pelo Estreito de Bering acerca de 12 mil anos, na ocasião da última Era Glacial) e a da Polinésia (no qual se enquadra o fóssil de Luzia), que teriam entrado através de pequenas embarcações, de ilha e ilha e, provavelmente, em datas mais remotas que a definida pela outra teoria. Para atingir os objetivos propostos foram realizadas visitas a museus, lido o livro: “Arqueologia Uma Atividade Muito Divertida”, visando o estudo de como os arqueólogos trabalham. Registramos tudo em um Diário de pesquisa e, por fim, compartilhamos com os colegas da turma. A análise feita nos permitiu aprender mais sobre o passado dos primeiros americanos, além de conhecer a importância do trabalho realizado pelos arqueólogos.', NULL, NULL, '2018-08-07 17:41:04', '2018-09-20 19:47:07', 11, 3, 6, 5, true, NULL, 8.76249999999999929);
INSERT INTO public.projeto VALUES (222, 'AS PERSPECTIVAS DE HABILIDADES E COMPETÊNCIAS NECESSÁRIAS PARA TRABALHAR NO CONTEXTO CIBERNÉTICO DA 4º REVOLUÇÃO INDUSTRIAL', 'Na perspectiva da quarta revolução industrial, o presente estudo tem como objetivo identificar e esquematizar habilidades que os trabalhadores devem desenvolver para que não sejam reféns da era cibernética. Para registro dessa pesquisa, foram feitas revisões bibliográficas através da plataforma Lume UFRGS e uma pesquisa mediante a um formulário feito por intermédio do Google, a qual se questiona empregados de um amplo espectro etário do ramo das indústrias e comércios localizadas na cidade Porto Alegre / RS. Para tanto, foi observado que das 57 empresas interrogadas, 56% delas constataram que a execução predominante do trabalho em seus empreendimentos é realizada por máquinas, 68,4% estão convictos que a inteligência artificial gera desempregos e 82,5% julgam necessário buscar novas habilidades para adequar-se ao novo mundo que se configura. Em meio a essa perspectiva, o presente estudo propõe nove habilidades para adaptar-se a esse novo panorama. Identifica-se que 39% dos entrevistados vê a flexibilidade cognitiva, aptidão relacionada ao fato de ampliar novas maneiras de pensar enxergando novos padrões e fazendo associações únicas entre elas, como a melhor dentre as outras. Constatamos que 55% dos trabalhos já existentes no Brasil podem ser substituídos por tecnologias e, por consequência, visa à importância do trabalho em equipe e o improviso como maneiras para acabar com esse impasse. Entretanto, com a ascensão das máquinas no mercado e a consequente automação do trabalho, as habilidades sociais mais requisitadas, conforme os nossos resultados e pela revisão bibliográfica são: o julgamento e tomada de decisões, e a inteligência emocional, afim de reconhecer e avaliar as emoções de outras pessoas estabelecendo empatia e produzindo os resultados desejados. Assim, considera-se que a busca por novas habilidades para posterior formação de competências é crucial para a harmonia entre a mão de obra humana e o mundo cibernético pós moderno.', NULL, NULL, '2019-08-06 17:13:07', '2019-10-26 17:58:44', 3, 2, 7, 5, true, 8.125, 9.14285714285714946);
INSERT INTO public.projeto VALUES (275, 'DESSALINIZAçãO E FILTRAçãO DA áGUA', 'Neste trabalho/projeto, iremos apresentar como funciona a dessalinização(retirada do sal) da água do mar, e um projeto de filtro caseiro para a despoluição/purificação/filtragem da água doce. O nosso objetivi é mostrar às pessoas como podemos, através de um projeto simples, despoluir águas impróprias para a utilização. Sabemos que a despoluição e a dessalinização são extremamente necessárias, porém, ao contrário da dessalinização, que é um processo muito complexo e altamente caro, mostraremos que a despoluição/filtragem pode ser algo completamente acessível. Primeiramente, mostraremos como funciona a dessalinização da água do mar em unidades industriais e como funciona a despoluição/filtragem da água doce por meio de um filtro construído com elementos naturais que encontramos ao dia-à-dia. Mostraremos fotos e vídeos da construção e utilização do filtro que fizemos, neste filtro consiste em: utilizar uma garrafa pet com a ponta inferior cortada na horizontal, e, de baixo para cima, colocar pedras(brita), logo abaixo areia, depois carvão ativado(ou carvão normal), e por último, algodão, a água poluída será despejada na abertura da garrafa, passará pelas pedras para remover o conteúdo visível, como galhos e folhas, depois passará pela areia, que serve para remover os dejetos que passariam pelas pedras, depois vem o carvão, que serve para reter as impurezas da água e deixar ela potável, no final o algodão, que serve para deixar a água incolor. Escolhemos este assunto para nosso trabalho, porque o consideramos de extrema importância para a situação atual do Brasil e do resto do mundo, queremos conscientizar e motivar muitas pessoas a dar mais valor à pouca água potável ainda existente no mundo.', NULL, NULL, '2019-08-09 18:54:13', '2019-09-19 16:18:58', 8, 2, 7, 5, true, 7.5, 0);
INSERT INTO public.projeto VALUES (31, 'REVOLUÇÃO CUBANA: A REPRESENTAÇÃO DA INVASÃO DA BAíA DOS PORCOS NA GRANDE IMPRENSA BRASILEIRA', 'Partindo do problema de pesquisa “perceber como os jornais brasileiros representaram a invasão da Baía dos Porcos”, iniciamos nosso estudo nos anos iniciais da Revolução Cubana e nos concentramos no ano de 1961, um grande marco na história cubana. Em razão disso, nosso objetivo geral é analisar como a grande imprensa do país representou a invasão e como objetivos específicos queremos demonstrar a complexidade do processo revolucionário cubano e entender de que formas a Revolução Cubana se articulou com a Guerra Fria. Como hipótese, acreditamos que o evento teve uma grande cobertura jornalística em nosso país, em razão do contexto internacional da Guerra Fria. Em um momento onde Estados Unidos da América (EUA) e União das Repúblicas Socialistas Soviéticas (URSS) disputavam hegemonia mundial, a pequena ilha de Cuba não demorou a se tornar protagonista das disputas entre as superpotências. A tal ponto que, em 17 de abril de 1961, o governo do presidente John Kennedy, patrocinou a tentativa de invasão ao território cubano por parte de tropas de mercenários cubanos treinados pela Agência Central de Inteligência (CIA), evento que passou a ser conhecido como a Invasão da Baía dos Porcos. Para analisar nossas fontes de pesquisa - os jornais Diário de Notícias e Última Hora - realizamos os fichamentos dos livros de história enfatizando o período de janeiro de 1959 a abril de 1961 – momento entre a vitória da revolução e a invasão da Baía dos Porcos. Encerrada essa primeira etapa, começamos a coleta de informações nos jornais que estão disponíveis online na Hemeroteca da Biblioteca Nacional. Com os resultados, entendemos que estudar Revolução Cubana é estudar a organização atual do mundo, suas situações econômicas, sociais, políticas e geográficas, pois os episódios dessa época influenciaram o mundo inteiro. Os acontecimentos do passado sempre serão os mesmos, mas a maneira que uma sociedade os descreve e os compreende cria uma opinião geral sobre o fato.', NULL, NULL, '2018-08-02 11:21:59', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 8.75, 9.83928571428571352);
INSERT INTO public.projeto VALUES (9, 'ANÁLISE DE CARTAZES DE DIVULGAÇÃO DE FESTAS: QUANDO O DESIGN GRÁFICO VIRA DESIGN DE ASSÉDIO', 'Considerando que a imagem sexualizada da mulher vem sendo utilizada em campanhas publicitárias como forma de atrair o público consumidor masculino, a presente pesquisa tem como objetivo compreender a relação do design de cartazes de divulgação de festas em casas noturnas na região do Vale do Sinos com a cultura do assédio. O estudo recorre a princípios da semiótica e do design emocional para analisar e identificar emoções projetadas nesse público através das formas de uso da representação dos corpos femininos nesses produtos de design gráfico. Além de pesquisa bibliográfica acerca de Design Gráfico, Semiótica, Design Emocional e Cultura do Assédio, a metodologia envolve dimensões empíricas como a análise de cartazes de festas, utilizando os princípios da semiótica relacionados ao design emocional; e, em caráter complementar, duas pesquisas de opinião, uma realizada em redes sociais para identificar se mulheres vivenciam assédio em festas em casas noturnas; e a outra, sobre que emoções os cartazes suscitam no público que o aprecia como forma de identificar sua relação com a cultura do assédio. Análises parciais indicam que a divulgação pode estar não somente atraindo o público masculino para a festa em si, mas convidando-o ao assédio, considerando a conotação sexual do design gráfico utilizado. Discussões de resultados sugerem, portanto, o designer gráfico e a empresa responsável pelo marketing como corresponsáveis indiretos pela perpetuação da cultura do assédio em casas noturnas.', NULL, NULL, '2018-07-27 15:16:15', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 10, 9.48392857142857082);
INSERT INTO public.projeto VALUES (254, 'ANáLISE E SOLUçõES PARA O DESCARTE INCORRETO DE LIXO ATRAVéS DO APLICATIVO “ONDE VAI?”', 'O presente estudo tem por objetivo identificar e confirmar as dificuldades da população no descarte correto de lixo e ainda apresentar uma proposta inovadora para a resolução do imbróglio. Para isso, utilizou-se de uma pesquisa de caráter qualitativo e estatístico, cuja coleta de dados foi realizada através da aplicação de um questionário virtual, constituindo uma mostra de aproximadamente 60 pessoas. Isto posto, criou-se o “Onde Vai?”, um protótipo de um aplicativo que guie as pessoas para o local próprio de descarte, conscientizando quanto aos malefícios do indevido erro prático. Ademais, o aplicativo orienta como o material foi criado, despertando assim atenção pela sua produção e possibilidade de reuso. Assim, também foi criado um site para que as pessoas complementem com propostas relacionadas a sustentabilidade e para que a ideia propague-se até um maior número de pessoas. Os resultados preliminares relacionados a lixos, cujo local era duvidoso, demonstraram que grande parte da população comete erros que prejudicam o processo de tratamento, reciclagem e reaproveitamento do material descartado. Isso ocorre ao passo que os custos para o procedimento com os objetos tratados aumentam e muitas vezes prejudicam o ambiente em caso dessa inconsciência. Portanto, a falta de noção da população no descarte de resíduos foi confirmada e espera-se que a disseminação do aplicativo, assim como uma melhora por parte dos próprios usuários, incentive a redução no índice de casos de descartes incorretos, de modo que torne a relação do homem com a natureza mais harmônica.', NULL, NULL, '2019-08-09 09:56:50', '2019-09-19 15:35:06', 4, 2, 7, 5, true, 8.75, 6.39642857142855004);
INSERT INTO public.projeto VALUES (260, 'EPEN: PROTÓTIPO DE PLOTTER CNC PARA CONFECÇÃO DE PCI', 'Na confecção de placas de circuito impresso (PCI’s), atualmente, um dos métodos mais utilizados é o de transferência térmica. Porém, esta forma de prototipagem artesanal, além de expor quem a executa a temperaturas elevadas, normalmente exige que se faça correções manuais na impressão do layout (trilhas do circuito), gerando atrasos no desenvolvimento de projetos. Uma alternativa a este método é utilizar uma máquina a Comando Numérico Computadorizado (CNC), entretanto este tipo de máquina possui um custo de aquisição elevado para a maioria das instituições de ensino. Logo, chegou-se a seguinte questão problema: como desenvolver um protótipo de máquina automatizada para reproduzir o desenho das trilhas do circuito? Tendo em vista responder à questão problema e alcançar o objetivo geral, foram elencados três objetivos específicos: projetar e construir uma estrutura mecânica; projetar e construir um sistema eletrônico; selecionar um conjunto de software e firmware para gerenciar o protótipo. Para isto, foi projetada uma estrutura mecânica, na qual foram realizadas simulações estáticas. A seguir, foi projetado um sistema eletrônico responsável por integrar os periféricos físicos do protótipo com o controle computacional, e por fim foram investigados softwares para gerenciar o funcionamento do dispositivo. Após ser validado por meio de simulações, a estrutura mecânica foi impressa em impressora 3D. Simultaneamente, foi confeccionada uma PCI para aplicação no sistema eletrônico. Os resultados obtidos até o momento são referentes às simulações realizadas na estrutura mecânica, onde foram avaliados os dados obtidos com validação positiva para construção. Seguindo as metas elencadas, foram selecionados os softwares para realizar a comunicação do protótipo com o computador. Ademais, foi determinado por meio de uma equação matemática que o protótipo terá uma resolução de 0.1 milímetro e poderá confeccionar PCI’s de dimensões máximas de 120 milímetros x 160 milímetros.', NULL, NULL, '2019-08-09 13:37:09', '2019-09-19 14:56:56', 7, 2, 7, 5, true, 9.625, 9.78928571428570038);
INSERT INTO public.projeto VALUES (95, 'ENCHENDO BALõES COM BICARBONATO E VINAGRE', 'O trabalho trata de um experimento que mostra, através da reação química entre o bicarbonato de sódio (NaHCO3) e o vinagre (CH3COOH), a produção de gás para inflar balões. O produto comum usado para este fim é o gás Hélio (He), porém, na impossibilidade de adquirí-lo, buscou-se uma alternativa mais econômica. O objetivo foi compreender como ocorre a reação química entre o bicarbonato de sódio e o vinagre para inflar os balões. A mistura de vinagre com o bicarbonato de sódio gera um produto chamado ácido carbônico (H2CO3), que logo se decompõe em dióxido de carbono (gás carbônico). É a produção e liberação desse gás que gera as bolhas. Os materiais usados foram uma garrafa de plástico (capacidade de 1L), um balão, uma colher de sopa de bicarbonato de sódio, três colheres de sopa de vinagre e um funil. No início, encheu-se o balão duas vezes para esticá-lo. Em seguida, foi posto o bicarbonato de sódio na garrafa e o vinagre no balão, prendendo-se a parte aberta do balão na garrafa. Levantou-se o balão deixando-se o vinagre despejar-se dentro dá garrafa. A mistura de vinagre e bicarbonato de sódio produziu uma espuma e o balão começou a encher. Isto aconteceu, pois o bicarbonato e o vinagre, ao se misturarem, liberaram o dióxido de carbono (CO2), que é o responsável por encher o balão. Essa reação denomina-se dupla troca, ou seja, quando duas substâncias compostas reagem entre si, trocando seus componentes e dando origem a duas novas substâncias compostas.', NULL, NULL, '2018-08-09 17:39:25', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 5.625, NULL);
INSERT INTO public.projeto VALUES (137, 'PHOTOGRAPHYDATA – APLICAÇÃO WEB PARA FOTÓGRAFOS', 'Para realizar uma busca de informações de uma foto, muitas vezes os fotógrafos precisam recorrer a softwares pagos, o programa mais famoso entre os fotógrafos é o Adobe Lightroom, um software com um valor de R$ 35.00 por mês, ele possui: organizador de arquivos, editor de imagens e um Metadata reader, entre outras ferramentas. O Adobe Lightroom é um exemplo de software que precisa ser instalado no computador ou notebook que vai ser utilizado, o mesmo por vez acaba exigindo muito do computador, ou seja, é necessário um computador com configurações muito boas para rodar o programa. O PhotographyData tem o objetivo desenvolver uma aplicação web gratuita, para fotógrafos iniciantes, que oferece algumas ferramentas como o Metadata reader, uma interface de fácil entendimento onde o fotógrafo pode visualizar as informações de suas fotos ou de algum outro fotógrafo, isso contribui para o aprimoramento das habilidades na fotografia pois o profissional pode compreender o funcionamento da câmera nas mais diversas situações, outra ferramenta que vai compor o PhotographyData é um assistente de lentes (Lens Helper), essa função irá avaliar alguns dados de todas as fotos que foram colocadas pelo usuário no site, com base nesses uploads, o Lens Helper irá avaliar qual lente o usuário mais utilizou nas suas fotos que ficaram com notas altas (o usuário avalia a própria foto com uma nota de 0 a 5), qual lente que ele não usa tanto e pode vender, quais lentes que não combinam com o perfil do fotógrafo e qual lente que combina com o perfil do fotógrafo.', NULL, NULL, '2018-08-10 18:34:41', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 6.25, NULL);
INSERT INTO public.projeto VALUES (99, 'A IMPORTâNCIA DA REPRESENTATIVIDADE NEGRA NA MíDIA E NA ESCOLA', 'O Brasil foi o último país da América Latina a abolir a escravidão, fato que se torna mais grave quando percebemos a inexistência de políticas públicas de inclusão aos ex cativos; isto sem falar nas tentativas de branqueamento da população e na negatividade associada à nossa histórica miscigenação racial. Tais fenômenos levam à marginalização social do negro e por consequência sua invisibilidade. A desigualdade desencadeada por essa segregação racial limita a participação dos negros nas mais diversas instâncias da sociedade, seja na formação intelectual - escolas e universidades– , no espaço a ser ocupado no mercado de trabalho, este geralmente estigmatizado como sendo mais braçal e menos racional, ou nas diversas mídias sociais, dentre elas jornais, revistas, novelas, seriados, filmes e redes sociais. Desse modo, prolifera-se o racismo no corpo social e o que se vê é um país extremamente desinformado no que diz respeito à cultura negra, pois a mesma não é divulgada nas escolas e, muito menos, na mídia. Sendo assim, este estudo tem por objetivo dar visibilidade à falta da representatividade da cultura negra na mídia e nos espaços escolares, haja vista que se trata de um país de grande pluralidade étnica e cultural. Para tanto, utilizamos o método quantitativo censitário, tendo como universo pesquisado 1.170 adolescentes e jovens de duas escolas do município de Canoas, uma privada e a outra pública. De mesmo modo, o intuito deste trabalho é analisar se há alguma disparidade de resultados entre as escolas averiguadas no que tange ao racismo e à falta de representatividade dos negros. Contudo, problematizamos a responsabilidade da escola e da mídia no combate ao racismo e à intolerância, além das consequências oriundas da falta de visibilidade negra nesses espaços, visto que que a ausência de representatividade do povo afro-brasileiro deve ser revista e superada. Em um país onde há tanta diversidade, é necessário que haja espaço e respeito para as diferentes etnias.', NULL, NULL, '2018-08-09 20:32:13', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 7.25, 9.58749999999999858);
INSERT INTO public.projeto VALUES (88, 'O CONTROLE DA INFORMAçãO NA ERA DAS &#34;FAKE NEWS&#34;', 'A presente pesquisa surgiu da leitura do livro 1984, do escritor inglês, George Orwell, em que tivemos que realizar uma resenha na disciplina de História. Na obra, Orwell apresenta um mundo dominado pela controle absoluto das informações e do que é verdade (Ministério da Verdade), trazendo os conceitos do Grande Irmão (Big Brother), aquele que tudo observa e vê, indispensável para incriminar as pessoas que pensavam diferente (crimideia). Tendo como inspiração a presente obra, produzimos um questionário estruturado sobre as principais notícias falsas, ou “Fake News”, que circulam nas redes sociais. Ainda no questionário apresentamos três eventos falsos que foram utilizados para justificar uma intervenção militar e ou conflito militar entre países modernamente. O objetivo da pesquisa era identificar quais notícias falsas os estudantes mais acreditavam e em que meios sociais eles mais acessavam tais conteúdos. Ainda como hipótese de trabalho fizemos a relação entre a capacidade econômica, a concepção religiosa, o grau de instrução e se isso interferia na crença das “Fake News” pré-listadas. Aplicamos o questionário no público alvo do ensino fundamental (séries 8 e 9) público e privado, e ensino médio em escolas públicas regulares e técnicas. Ao todo foram aplicados 127 questionários. Para evitar manipulação das respostas, o questionário não foi identificado e as Fake News foram apresentadas de forma em que os estudantes devessem se posicionar sobre as afirmativas.', NULL, NULL, '2018-08-09 07:51:54', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 8.25, 9.86250000000000071);
INSERT INTO public.projeto VALUES (358, 'ELEGÂNCIA CONSCIENTE: A MODA EM SEUS DIVERSOS ESTILOS SUSTENTÁVEIS E O CONSUMO AMBIENTALMENTE CORRETO.', 'O presente projeto tem como objetivos: Analisar o conceito teórico de moda e o que ela representa. Compreender como a moda proporciona ações voltadas ao mundo sustentável. Compartilhar resultados e propor uma discussão sobre um conjunto de procedimentos metodologicos buscando assim auxiliar na conscientização e formação de um mundo sustentável. Além destacar a reutilização de materiais recicláveis, o aumento de vida útil de uma peça de roupa, tecidos com menor impacto ambiental. A coleta de dados se deu no primeiro semestre de dois mil e dezoito. A pesquisa foi realizada inicialmente através de artigos e informações em fontes digitais sobre moda e sustentabilidade Para entender melhor as teorias e conceitos propostos foi utilizado um método de pesquisa exploratória através de entrevistas qualitativas com cinquenta pessoas da nossa comunidade escolar aleatoriamente escolhidas. Uma vez respondidas às entrevistas e utilizando o referencial teórico para analisar os dados coletados. Passamos a descrever os resultados obtidos e a discutir como os mesmos seriam apresentados à comunidade escolar. Decidimos então que nesta apresentação incluiríamos: Algumas verbalizações extraídas das entrevistas, apresentação de vídeos, amostras de tecidos sustentáveis, moda feita a partir de material reciclado e a criação de um folheto sobre o tema o qual foi distribuído a mesma. Após foi realizado um debate com a comunidade escolar sobre o assunto, para verificarmos se os nossos objetivos haviam sido atingidos. Podemos concluir que: O consumo inconsciente é a principal causa da degradação do meio ambiente. Fica evidente a importância do conteúdo para um futuro menos impactante nas suas dimensões ambientais e sociais. Acreditamos que os objetivos propostos foram respondidos ao contextualizar a moda, seu mercado, sustentabilidade e consumo. Apesar de ser possível uma moda sustentável, ainda há muito que ser feito.', NULL, NULL, '2019-08-14 00:10:21', '2019-09-17 16:12:00', 8, 2, 7, 2, NULL, 8.75, NULL);
INSERT INTO public.projeto VALUES (299, 'GLOBO FLUTUANTE: UMA PROPOSTA PARA O COTIDIANO', 'É de extrema importância para a formação acadêmica o conhecimento e compreensão plena dos conceitos básicos de eletromagnetismo por meio da lei de Faraday e lei de Lenz, exemplificando o campo magnético gerado por uma corrente. A proposta do projeto visa trabalhar os conceitos apresentados e desenvolvidos para não somente proporcionar um conhecimento teórico do assunto, mas também um conhecimento prático, que tem como principal função ajudar a visualizar alguns desses aspectos aplicados à vida cotidiana. Uma das grandes ideias criadas a partir do desenvolvimento da teoria eletromagnética, foi a levitação por meio da interação de campos. Depois de muitos experimentos, observou-se que todo ímã ou eletroímã (um imã cujo o campo magnético é gerado por uma corrente i), tem uma polarização, ou seja, tem um pólo sul e um pólo norte. Onde há linhas de campo magnético que saem do pólo norte e entram no sul, e a interação entre dois ímãs ou eletroímãs se dá pela atração de pólos de nomes diferentes e repulsão de pólos de nomes iguais. O projeto tem como principal finalidade fazer um maquete realista de um planeta, no caso saturno, “flutuar” utilizando uma corrente elétrica em um solenóide ligado a uma diferença de potencial(d.d.p) para gerar um campo magnético que contenha linhas de campo praticamente uniformes no centro, que se oponha às de um imã que será colocado no centro, e revestido por um material leve, ou seja, a força magnética de repulsão dada pela interação desses campos produzida, deve ser de mesmo valor da força peso do objeto, considerando as dificuldade de encontrar uma estabilidade e uma corrente que consiga suprir tais necessidades. Pelos aspectos acima sabe-se que o experimento aborda diversos conceitos e que são essenciais para o desenvolvimento da ciência e da tecnologia contemporânea mundial, por esse motivo devemos incentivar a construção de experimentos pelos alunos de todos os graus para incentivá-los a aprender cada vez mais.', NULL, NULL, '2019-08-10 11:41:10', '2019-09-27 15:33:48', 7, 2, 7, 5, true, 9.125, 8.12857142857144943);
INSERT INTO public.projeto VALUES (186, 'MEDINDO âNGULOS COM O AUXILIO DE UM TEODOLITO', 'O uso de equipamentos para medir ângulos remonta aos povos antigos, cerca de 3.000 anos a.C., cada povo antigo possuía um equipamento e um método próprio para medir ângulos, os egípcios contavam com a groma, os romanos contavam com a dioptra e assim por diante, ambos equipamentos possuíam uma grande semelhança em seu modo de funcionamento. O teodolito é uma evolução dos equipamentos desenvolvidos pelos povos antigos, assim como estes equipamentos, o teodolito também é utilizado para medir ângulos, porém de forma mais precisa e prática, o teodolito comumente é utilizado na construção civil, e na agricultura para realizar o estudo topográfico de um determinado local ou para determinar a altura e/ou distância de um determinado objeto em relação ao equipamento. Sua construção é composta por um disco graduado para medir a angulação vertical em relação ao horizonte, um disco graduado para medir a angulação em relação ao azimute, uma luneta junto com um lazer são utilizados para focalizar o objeto no qual se quer calcular a distância, tudo isso apoiado sobre um tripé. Para calcular a distância e/ou a altura de um determinado objeto, é preciso nivelar o equipamento e posicionar a luneta na posição de zero grau em ambos os discos graduados, depois de feito isso precisamos procurar o objeto com o auxílio do telescópio e tomar ciência dos ângulos obtidos. Com o auxílio da trigonometria, é possível então obter a distância e a altura do objeto em questão em relação ao local onde está posicionado o teodolito. Foi confeccionado um teodolito com materiais de baixo custo e o utilizamos na prática para medir a distância e a altura de uma torre similar a usada em telefonia celular, localizada no Campus Canoas. Os resultados obtidos foram confrontados com os reais e a margem de erro foi pequena. O uso prático desse equipamento permite um melhor entendimento no estudo da geometria em matemática e da determinação de medidas de distância por paralaxe de objeto astronômicos em Astronomia.', NULL, NULL, '2018-08-10 23:57:59', '2018-09-20 19:47:07', 4, 2, 6, 5, true, NULL, 0);
INSERT INTO public.projeto VALUES (73, 'A VISãO DO ALUNO SOBRE O GêNERO SEMINáRIO: UMA APLICAçãO EFETIVA NO AMBIENTE ESCOLAR', 'O gênero oral seminário tem fundamental importância no cenário educacional, pois se caracteriza como uma atividade socioeducativa, trazendo aos alunos da Educação Básica o desenvolvimento de habilidades e competências que se tornam parte do indivíduo como um todo e não somente sob a perspectiva de “ser aluno”. A literatura disponível, sobre o ensino do gênero seminário, sugestões metodológicas, tanto de ensino quanto de aprendizagem, bem como a importância do gênero e sua desvalorização, assim como os benefícios trazidos com sua prática recorrente, é rica e variada. Contudo, no que tange a visão do aluno sobre esta prática, é necessária a formulação dessa bibliografia específica. Dito isso, o objetivo central deste estudo é descobrir se os alunos do Ensino Fundamental II e do Ensino Médio, do colégio Maria Auxiliadora de Canoas, os quais são expostos ao gênero seminário desde a sexta série, percebem e entendem os benefícios trazidos por esta prática pedagógica. Para tanto, a metodologia utilizada foi a pesquisa quantitativa. Assim, foi construído um questionário com 21 assertivas, que descrevem os benefícios da oralização praticada na forma de seminário em sala de aula. A aplicação do questionário, bem como a tabulação e análise dos dados, está em andamento. Espera-se, como resultado desta pesquisa, que os alunos tenham consciência dos benefícios trazidos por este recurso didático.', NULL, NULL, '2018-08-08 11:51:03', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (103, 'INCLUSãO DIGITAL', 'É inegável que o século XXI vem sendo marcados por constantes mudanças nos meios de trabalho, comunicação e principalmente tecnológicos. Cada vez mais as pessoas convivem com recursos computacionais no seu cotidiano, que vão desde o uso de celular para funções básicas como a calculadora ou o despertador, até o uso de recursos que requerem mais estudos, como o uso de planilhas ou apresentações. Apesar de esta ser uma realidade muito presente, ainda existem muitos cidadãos, principalmente os que estão em situação de vulnerabilidade social, que não têm acesso ou não possuem capacitação para usar tais tecnologias e muito menos usufruir dos seus benefícios e facilidades. Dessa forma, o projeto visa promover a inclusão digital das populações excluídas por meio de aulas ministradas no campus Venâncio Aires, proporcionando um ambiente de aprendizagem através do uso das tecnologias da informação como instrumento de construção e exercício da cidadania. Ainda, visa-se oferecer a elas novas formas de acesso à inovação, capacitando e facilitando a inserção no mundo do trabalho, dos estudos ou mesmo socialmente, quando se trata de comunicação. Além disso, acredita-se que ampliando os conhecimentos desse público, abrem-se horizontes para uma maior qualidade de vida e uma constante busca pela atualização e pelos estudos, o que se torna cada vez mais importante considerando o visível aumento de exigências das empresas, concursos e universidades. Finalmente, acredita-se que a educação deve ser concedida a todos de forma igualitária e que essa é a maior ferramenta para integrar um elemento socialmente posposto.', NULL, NULL, '2018-08-09 21:08:16', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (206, 'HISTÓRIA DE MULHERES ARTISTAS', 'O presente projeto realizará discussões acerca da história da arte através de produções cinematográficas que abordam as histórias de vida de artistas mulheres em diferentes épocas. Serão realizadas sessões para contemplação das produções fílmicas, seguidas pelo compartilhamento de percepções e informações relacionadas ao contexto social e sistêmico da arte em que a artista se insere. A equipe de execução do projeto, composta por uma bolsista e seis voluntárias, realiza pesquisas teóricas acerca da historiografia e dos sistemas econômicos da arte para compreender os contextos das trajetórias de vida e de produção das artistas apresentadas nos filmes. A relevância do projeto se afirma pela insurgência de pesquisas que têm demonstrado que a historiografia da arte oficial está registrada pelo olhar masculino (Janson, Gombrich, Argan), privilegiando o registro da produção artística de homens em detrimento à escassa produção feminina. Portanto, entre os objetivos deste projeto figuram a oportunização de espaços de pesquisa e análise sobre o enfoque, a qualidade da produção artística feminina, bem como sobre os contextos sociais e artísticos em que se inseriram (ou de que foram excluídas) à luz das pesquisas de historiadoras contemporâneas como NOCHLIN (2016), VICENTI (2017), ASSIS (2012) e CAO ( 2008). A fruição cinematográfica será empregada em sua potencialidade para a interterritorialidade entre as demais linguagens artísticas de acordo com BARBOSA (2008) e READ (1982). Até o momento, foi realizada uma sessão aberta à comunidade acadêmica, empregando o filme Grandes Olhos (2014) que retrata a história de Margaret Keane. Entre as primeiras constatações salientamos a profissionalização na arte como um reflexo do que consiste o mundo do trabalho. A partir das leituras iniciais, foram estabelecidas categorias para direcionar a observação das trajetórias de vida das mulheres artistas que serão abordadas.', NULL, NULL, '2019-07-27 13:34:50', '2019-09-20 11:52:59', 3, 2, 7, 5, true, 8.625, 7.4214285714285495);
INSERT INTO public.projeto VALUES (424, 'ASSESSORIA A MICRO, PEQUENOS EMPREENDEDORES E EMPREENDEDORES INDIVIDUAIS DA REGIãO METROPOLITANA DE PORTO ALEGRE IMPACTADOS PELA PANDEMIA.', 'A partir dos impactos causados pela pandemia da Covid-19, grande parte dos empreendimentos presenciaram a redução na atividade econômica e diversos se viram à beira da falência. Neste contexto, surge o projeto “Assessoria a Micro, Pequenos Empreendedores e Empreendedores Individuais da Região Metropolitana de Porto Alegre impactados pela pandemia”, com o intuito de auxiliar pequenos empreendedores e impedir o fechamento de suas empresas, assim, contribuindo para o desenvolvimento regional. Dentre os objetivos específicos, o projeto visa diagnosticar os principais pontos a melhorar, construir um plano de ação focado nas necessidades do empreendedor e acompanhar os resultados da assistência fornecida aos microempreendedores e empreendedores individuais. A iniciativa conta com uma equipe de bolsistas, coordenadores e servidores voluntários, que em conjunto efetuam a metodologia de três etapas: o diagnóstico, onde o empreendedor foi entrevistado para compreensão do negócio e das principais dificuldades que enfrenta; a priorização, em que foram elencadas todas as necessidades da empresa, com o uso de uma matriz de impacto ou relevância; e os planos de ação, que buscam sanar as dificuldades enfrentadas. No total, o projeto tem duração de seis meses, até o momento da submissão 17 empresas foram auxiliadas e a maior parte dos empreendimentos finalizou as etapas de diagnóstico e priorização, de forma que a terceira etapa, onde é projetado o plano de ação e remodelagem de negócios esteja em andamento. É esperado que ao final do projeto a empresa participante tenha autonomia para aplicar de forma prática os conhecimentos adquiridos ao longo da proposta, mantendo suas atividades, fortalecendo a economia de sua localidade e no melhor dos cenários obtendo a capacidade de expandir suas atividades, se distanciando do risco de falência.', NULL, NULL, '2021-10-13 23:44:01', '2021-11-03 21:52:51', 5, 2, 9, 5, true, 7.625, 8.82499999999999929);
INSERT INTO public.projeto VALUES (323, 'A INFLUêNCIA ILUMINISTA NO PROCESSO DAS CONSTITUIçõES DO SéCULO XVIII E XIX.', 'O pensamento iluminista traduziu um importante marco civilizatório que foram os movimentos de consolidação de direitos num novo período histórico. Desde a Revolução Francesa a tradição jurídica da Europa Continental, influenciada pelo pensamento do Rousseau, traduziu a ‘vontade geral’ num ‘contrato social’. O objetivo do nosso trabalho é analisar o pensamento de cinco principais pensadores iluministas (Voltaire, Rousseau, Adam Smith, Montesquieu e J. Locke) e de que forma essas ideias foram consagradas no movimento de Constituições ocorridas no século XVIII e XIX. Iremos comparar as seguintes Constituições: Francesas de 1791, 1795 e 1799; Americana de 1787 e as Emendas das Liberdades de 1791; Constituição Pernambucana de 1817. A nossa hipótese de trabalho consiste que o desconhecimento das ideias iluministas e do processo de conquistas de direitos pode provocar a sua perda. A metodologia aplicada foi a análise e leitura de documentos históricos e relacioná-los com as ideias iluministas descritas nos livros didáticos, juntamente com a aplicação de um questionário no âmbito escolar. Como resultados percebemos que as chamadas liberdades, ou a primeira geração dos direitos humanos esteve vinculada diretamente ao pensamento iluminista.', NULL, NULL, '2019-08-10 19:54:46', '2019-09-19 15:57:27', 11, 3, 7, 5, true, 7.5, 7.50833333333333286);
INSERT INTO public.projeto VALUES (443, 'JETA BETA: UMA PROPOSTA DE AUTOMAÇÃO PARA A APLICAÇÃO DA VACINA BOVINA', 'No Brasil uma das atividades econômicas também importantes na exportação é o agronegócio, ou seja, a prática produtiva ligada direta ou indiretamente à pecuária. Segundo a EMBRAPA (2016) a pecuária está atualmente entre as principais atividades econômicas do Brasil, no período de 2000 a 2015, a produção de carne teve crescimento de 45%, enquanto o rebanho bovino de corte cresceu 25%. Com o aumento da produtividade vem a preocupação com patologias que podem se disseminar trazendo perdas insustentáveis economicamente. A este respeito a vacinação é um instrumento importante para prevenir e evitar a disseminação de enfermidades, mantendo os animais saudáveis e diminuindo os riscos e prejuízos financeiros. Infelizmente 17,3% dos fazendeiros não fazem esse processo de vacinação por falta de conhecimento, falta de novas tecnologias e mão de obra precária. De acordo, com uma pesquisa do autor, realizada por meio de um questionário virtual através do google forms no ano de 2020, 18,3% dos produtores possuem pouca ou nenhuma acessibilidade aos procedimentos de vacinação, seja por falta de conhecimentos, problemas técnicos, escassez de mão-de-obra ou ausência de novas tecnologias que facilitem a aplicação de vacinas. Considerando tudo que foi mencionado este trabalho é um seguimento da pesquisa intitulada “Jeta: uma proposta sustentável de automação para a aplicação da vacina bovina” e apresenta-se aqui uma proposta de automação para aplicação de vacinas, facilitando assim o trabalho do pecuarista. Devido as inconveniências causadas pelo novo coronavírus até o momento não foi possível a criação física do protótipo Jeta, porém mesmo em versão alpha suas vantagens são inegáveis, incluindo otimização do tempo de trabalho, manejo correto para a imunização e organização durante o processo.', NULL, NULL, '2021-10-25 16:59:37', '2021-11-04 07:48:14', 7, 2, 9, 5, true, 7.375, 6.63749999999999929);
INSERT INTO public.projeto VALUES (379, 'PORTABLE TREADMILL: ESTEIRA PARA TREINO DE MARCHA DE PACIENTES COM PARALISIA CEREBRAL', 'Este projeto envolve as áreas da engenharia mecânica e tecnologia assistiva, tendo como tema o estudo de um mecanismo redutor da velocidade mínima da Portable Treadmill para o uso no treino de marcha de pacientes com Paralisia Cerebral (PC). Define-se PC como uma lesão neurológica que causa limitações em atividades, sendo atribuídas a um distúrbio não progressivo que ocorre no desenvolvimento encefálico fetal ou na infância. A desordem motora na PC, em geral, é acompanhada por distúrbios em diversas áreas. Portanto, indivíduos com esse distúrbio devem ser acompanhados por fisioterapeutas, que utilizam diferentes tratamentos, sendo o treino de marcha um deles. Este tem como objetivo auxiliar o corpo a manter o equilíbrio e desenvolver uma marcha, independente ou com auxílio, de forma eficaz. O principal objetivo da reabilitação é oferecer ao indivíduo a possibilidade de agir de forma independente em suas atividades cotidianas, logo, deve-se ter em vista a importância da marcha para esse fim. Sabendo que a velocidade mínima da esteira próxima de zero é um fator importante na funcionalidade do treino e o mercado regional carece dessa particularidade, o projeto visa agregar à Portable Treadmill um mecanismo que permita que a mesma tenha uma velocidade mínima reduzida. Para isso, estudou-se os assuntos abrangentes ao projeto, aplicou-se um questionário em 31 fisioterapeutas, realizou-se uma saída de campo à clínica especializada e uma coleta de dados na esteira PhysicalTec, em que mediu-se o diâmetro das polias. Com isso, a relação entre elas é de 1:5,3. Considerando a velocidade mínima da esteira estudada de 0,3 m/s, pretende diminuí-la para 0,1 m/s. Obteve-se um fator de redução de no mínimo 1:16 e, visto que o motor precisa de uma folga para evitar o superaquecimento, estima-se uma redução de 1:20. Portanto, esse mecanismo é uma primeira ideia para futuros estudos, sendo os diâmetros das polias, sucessivamente, 20, 100, 20 e 80 mm.', NULL, NULL, '2021-09-29 09:34:20', '2021-11-04 14:05:08', 7, 2, 9, 5, true, 10, 9.5625);
INSERT INTO public.projeto VALUES (198, 'DEGRADAÇÃO DE ÓLEO LUBRIFICANTE PARA AUTOMÓVEIS UTILIZANDO FUNGOS DOS GÊNEROS ASPERGILLUS SPP. E PENICILLIUM SPP.', 'Esta pesquisa tem como objetivo principal verificar a degradação de óleo lubrificante utilizando os fungos Aspergillus spp. e Penicillium spp. Assim como outros derivados do petróleo, o óleo lubrificante pode causar diversos danos ao meio ambiente quando descartado incorretamente ou em casos de vazamentos acidentais. Tendo em vista o impacto que esse contaminante pode causar ao meio, a investigação de métodos que consigam diminuir ou evitar esses danos se torna bastante relevante. Dessa maneira, a pesquisa verifica essa hipótese através de uma variedade de testes. O teste com indicador DCPIP - 2,6-diclorofenolindofenol, identifica a presença de oxidação microbiana de hidrocarbonetos através da mudança de cor, do azul para o incolor. Também será utilizada espectrometria de absorção UV-visível, que relaciona a absorção de luz com a concentração de uma solução através da Lei de Beer, e a espectrometria de infravermelho, que detecta a presença de diversas ligações químicas em uma amostra, através de sua frequência de vibração característica. O ensaio de biorremediação para testar a degradação dos fungos em sistemas com o solo contaminado está em andamento. As amostras foram divididas em: solo, solo contaminado, solo biorremediado por Aspergillus spp. e solo biorremediado por Penicillium spp. Esse ensaio está sendo realizado em duplicata, em cubas de tamanhos iguais e condições de temperatura constante, será quantificada a presença de óleos e graxas através do método de extração de Soxhlet. A umidade e a capacidade de campo foram previamente determinadas para que fosse possível regular a quantidade de água adicionada conforme o ocorrer da pesquisa. O solo utilizado foi submetido a análises de macro e micronutrientes no laboratório de solos da UFRGS antes e depois do processo de biorremediação para fins comparativos. Testes prévios com o indicador DCPIP em diferentes concentrações mostraram presença de oxidação microbiana com ambos fungos utilizados.', NULL, NULL, '2019-07-22 13:23:02', '2019-09-19 16:40:45', 8, 2, 7, 5, true, 10, 9.69999999999999929);
INSERT INTO public.projeto VALUES (47, 'FATORES QUE LEVAM AO DESENVOLVIMENTO DA HIPERTENSÃO ARTERIAL NA IDADE ADULTA', 'No Brasil, a hipertensão arterial atinge de 6% a 8% das crianças e adolescentes, segundo a Sociedade Brasileira de Cardiologia, e pode desenvolver doenças como o AVC. Assim, este estudo pretende verificar os fatores que podem ajudar a desenvolver a hipertensão na idade adulta. Para isso, foi verificada a pressão arterial de 25 jovens do Ensino Médio do Colégio Santa Dorotéia, em repouso e após uma corrida de 2 min. O Índice de Massa Corporal desses alunos foi calculado, e cada aluno foi orientados a identificar-se com um dos grupos de alimentos apresentados - o primeiro formado por frutas, verduras, carnes magras e alimentos com baixo sódio e o segundo, por carnes gordurosas, alimentos industrializados, ricos em sal e fast-foods. Ademais, os voluntários foram classificados em ativos ou sedentários, de acordo com sua frequência da prática de atividades físicas. Dessa maneira, verificou-se que, em média, os alunos com maior IMC apresentaram maior pressão arterial, provavelmente devido ao maior esforço do coração por causa da maior massa corporal a ser nutrida pelo sangue. Ademais, os sedentários (39,3%) apresentaram um aumento médio de pressão arterial sistólica (PAS) de 2 mmHg menor em relação aos ativos (60,7%); já o aumento da diastólica (PAD) foi 1 mmHg maior nos sedentários, o que mostra provável a maior potência contrátil do miocárdio e uma menor resistência vascular periférica nos pesquisados ativos, visto que sua PAS variou mais e a PAD, menos, após a corrida. Por último, os jovens que se identificaram com o grupo de alimentos 2 (53,6%) apresentaram PAS e PAD de, respectivamente, 8 mmHg e 5 mmHg maior do que aqueles que se identificaram com o grupo 1 (46,4%), evidenciando que uma dieta saudável e com baixo sódio auxilia no controle da pressão arterial. Portanto, apesar de os hábitos supracitados não causarem mudanças significativas na pressão arterial dos jovens, em razão de seu metabolismo acelerado, a longo prazo eles são fatores de risco para a hipertensão.', NULL, NULL, '2018-08-06 19:29:59', '2018-09-20 19:47:07', 4, 2, 6, 5, true, 7.5, 5);
INSERT INTO public.projeto VALUES (62, 'O MACHISMO NA SOCIEDADE SOB O OLHAR DO PúBLICO JOVEM', 'Foi estudada a influência do machismo nos dias de hoje na vida dos jovens. O tema foi escolhido, pois queríamos avaliar se o machismo ainda existe ou é só um “drama” criado por uma parcela da sociedade. O objetivo é demonstrar o quão influente o machismo está nos dias de hoje na vida dos jovens. Entendendo esse aspecto, pretende-se disseminar a ideia de igualdade de gêneros na sociedade. Fizemos um trabalho de pesquisa visando conhecer um pouco do impacto do machismo em nossa sociedade. Assistimos a vídeos, lemos livros sobre o assunto e conversamos com outras pessoas para ouvir diferentes opiniões. Elaboramos uma série de perguntas através do Google Formulários para avaliarmos o que a nossa comunidade pensa sobre o assunto. Foi possível perceber que o machismo está expresso de diversas maneiras em nossa cultura, e não só em atitudes como discriminação ou estupro. Vimos que movimentos feministas existem há muito tempo, mas que nos últimos anos, tem ganhado muito espaço principalmente na mídia, onde antes, eram retratados como polêmicos. O machismo ainda é um problema sério na sociedade. Por fim, pensamos que com o debate proposto, poderemos sensibilizar principalmente o público jovem de nosso Colégio, no sentido de ressaltar que as ações machistas praticadas no cotidiano afetam muitas pessoas. Desejamos erradicá-las e assim ajudar a quem já sofreu com essas ações, tornando o convívio dos indivíduos em sociedade cada vez mais igualitário.', NULL, NULL, '2018-08-07 14:58:29', '2018-09-20 19:47:07', 11, 3, 6, 5, true, NULL, 8.86250000000000071);
INSERT INTO public.projeto VALUES (303, 'RECUPERAÇÃO DE PETRÓLEO COM BIOSSURFACTANTES PRODUZIDOS POR BACILLUS AMYLOLIQUEFACENS MO13 A PARTIR DE GLICERINA RESIDUAL', 'O objetivo do projeto é aplicar biossurfactantes (BS) produzidos por Bacillus amyloliquefacens MO13, utilizando glicerina residual como fonte de carbono, na recuperação avançada de petróleo. A justificativa da pesquisa centra-se na necessidade de desenvolver soluções alternativas para a recuperação de petróleo, uma das principais fontes de energia do mundo, porém, um recurso finito. Como uma alternativa biodegradável contra os surfactantes químicos, muitas pesquisas estão testando BS para a recuperação, uma vez que são subprodutos metabólicos produzidos por microrganismos e diversas fontes de carbono podem ser utilizadas como substrato para a sua obtenção. Para atingir o objetivo proposto, foram seguidas as etapas: a) avaliação de diferentes pré-cultivos sobre a produção do BS; b) avaliação da concentração de substrato para a produção; c) avaliação da melhor temperatura para a produção; d) avaliação do tempo necessário para produção; e) testes de estabilidade; f) verificação da concentração micelar crítica; g) caracterização do BS h) caracterização da glicerina utilizada nos processos; i) testes da recuperação de petróleo avançada em seringa, erlenmeyer e colunas. As análises feitas até o momento indicaram que as melhores condições para a produção são com um pré-cultivo de LB, a concentração do substrato em 3% a 30°C de 3 a 5 dias. O BS se mostrou bastante estável quando exposto a grandes temperaturas e pressão, em pHs mais baixos e nas concentrações de 10%, 20% e 35% a tensão superficial do BS sofreu um aumento considerável, a CMC do BS ficou entre 10 e 20 ppm. A glicerina um pH em torno de 5,74, com densidade de 1,26 e viscosidade de 232 mPa.s. Os testes de recuperação de petróleo e de caracterização do tensoativo estão em andamento. Em síntese, até o momento, foi possível observar a eficiência do BS produzido através da sua padronização e estabilidade, tendo grande potencial para a recuperação de petróleo.', NULL, NULL, '2019-08-10 14:18:20', '2019-09-19 16:44:25', 8, 2, 7, 5, true, 8, 9.76428571428570002);
INSERT INTO public.projeto VALUES (185, 'VISUALIZAÇÃO ADAPTÁVEL DE DADOS DA SAÚDE PARA DISPOSITIVOS MÓVEIS', 'O presente trabalho tem como objetivo geral construir um modelo de geração de visualizações de dados médicos para dispositivos móveis (smartphones e tablets) que facilite o acesso e interpretação de informações por profissionais da área da saúde. A razão para o desenvolvimento da pesquisa centra-se na necessidade do desenvolvimento de uma ferramenta capaz de esclarecer o máximo de informações possíveis sobre o ambiente hospitalar, que exija o mínimo de esforço do profissional de saúde e proporcione uma boa experiência em sua utilização. O meio encontrado para atingir tal meta se dá na exploração de técnicas de visualização de dados, ou seja, a representação visual de dados. Esta será dada em formato de gráficos que buscam dispor as informações de forma esteticamente agradável, simples e direta. A metodologia da pesquisa de cunho exploratório, segue as seguintes etapas: Brainstorm de ideias para identificação do tema, pesquisa bibliográfica e documental para adquirir conhecimentos sobre o assunto abordado e trabalhos já elaborados que possuem relação com o tema, coleta de dados sobre profissionais da saúde por questionário, levantamento de requisitos necessários para o modelo, projeto e modelagem, desenvolvimento do modelo, implementação do protótipo, avaliação e validação e análise de resultados obtidos. Os resultados parciais da pesquisa indicam a pouca automatização presente na rotina da área da saúde, a qual se mantém presa ao preenchimento constante de informações em papéis, além de apontarem a aceitação do público final para com o tema da pesquisa e a utilização da tecnologia no cotidiano da área. Em síntese, pode-se ressaltar que a área da saúde carece de ferramentas tecnológicas para auxiliar o dia a dia dos profissionais atuantes e o modelo de visualizações proposto possui o potencial de auxiliar esses profissionais e promover a automatização de processos desenvolvidos em ambientes hospitalares.', NULL, NULL, '2018-08-10 23:56:53', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.98660714285714235);
INSERT INTO public.projeto VALUES (204, 'HYDRA: UMA SOLUçãO INTELIGENTE CONTRA ENTUPIMENTO DE BUEIROS', 'Diversas cidades sofrem com problemas ligados ao saneamento. Dentre eles, é possível destacar os alagamentos ocasionados pelo entupimento do fluxo da água em bueiros. Quando há uma massa considerável de resíduos sólidos no interior das bocas de lobo, um grande volume de água fica retido e acaba, em certo momento, transbordando e causando danos a várias estruturas, ou até mesmo, causando tragédias que culminam na morte de pessoas. Sendo assim, foi criado o problema de pesquisa de nosso trabalho: “Quais ferramentas ou mecanismos podemos utilizar para o monitoramento do acúmulo de lixo em bueiros?”. Tendo em mente a gravidade de tais problemas, surge o projeto HYDRA, um sistema que realizará a medição do nível de resíduos retidos nas bocas de lobo através de um sensor ultrassônico integrado à uma placa de Arduino e enviará os dados mensurados, via rede, até uma central responsável pela manutenção dos bueiros, prevenindo assim que esses problemas ocorram. O nosso objetivo geral é, justamente, “utilizar o conceito de smart cities para resolver o problema de entupimento de bueiros” tendo em vista que o tema de smart cities tem ganhado cada vez mais visibilidade por ser uma alternativa a problemas urbanos. Temos como objetivos específicos: “criar um sistema capaz de resolver o problema do entupimento de bueiros, promover um impacto positivo na economia e no bem-estar social de determinada cidade através do nosso sistema e otimiza-lo para obter dados mais precisos e confiáveis”. Para construção de tal sistema, foram utilizados como forma de embasamento teórico, trabalhos relacionados ao tema de Internet of Things e Smart Cities e de matérias publicadas pela imprensa que evidenciam o impacto que nosso sistema causaria. Foi criado, também, um protótipo para demonstração da eficácia de nosso projeto. Através da análise dos dados, foi possível concluir que o nosso projeto seria de extrema importância e auxiliaria na economia urbana e preveniria que graves problemas ocorressem.', NULL, NULL, '2019-07-23 16:26:45', '2019-09-19 15:41:23', 6, 2, 7, 5, true, 9.25, 0);
INSERT INTO public.projeto VALUES (55, 'CRIMES VIRTUAIS E OS PERIGOS DA INTERNET', 'No mundo existem cerca de 3,6 bilhões de internautas e cerca de 47% dessas pessoas já sofreu ou sofre com os crimes virtuais. Escolhemos esse assunto porque é cada vez mais comum em nosso cotidiano as pessoas serem vítimas de crimes virtuais. Queremos ajudar, principalmente os jovens, a se prevenir. Nós buscamos informações na internet e já fizemos vários questionários e entrevistas sobre o assunto. É muito importante as pessoas saberem que estão sofrendo um crime virtual, que pode ser: calúnia, insultos, difamação, divulgação de materiais confidenciais, ou ainda, apologia ao crime, criar comunidades que ensinam e influenciam outros crimes. Já existe uma lei contra isso, a Lei 12.737 pode levar pessoas à 30 anos de prisão. Para tratar desses crimes foi criada a Delegacia de Repressão aos Crimes Informáticos (DEIC). Além dos crimes virtuais, a internet também pode nos causar doenças como: Nomofobia (medo de ficar sem internet), náusea digital (enjoos, dores de cabeça e febre são os principais sintomas dessa doença, que é causada pelo uso excessivo da internet) etc. Nós concluímos que a cada ano que se passa os crimes virtuais ficam mais comuns. Porém já existe uma lei que pode levar a pessoa à prisão. Além disso, descobrimos que a internet pode ser nociva à saúde, pois pode causar doenças como: a nomofobia, náuseas muito mais.', NULL, NULL, '2018-08-07 14:17:08', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 7.625, 4.54999999999999982);
INSERT INTO public.projeto VALUES (384, 'SERANUS - UM JOGO CASUAL QUE AUXILIA ALUNOS NO ESTUDO DA LITERATURA BRASILEIRA', 'Mesmo com o mercado de jogos se expandindo cada vez mais, uma área que permanece pouco explorada por diversos desenvolvedores é a que envolve a faixa etária de adolescentes e jovens adultos com o intuito de auxiliar seus estudos relacionados aos conteúdos curriculares do ensino médio de uma maneira didática. Muitas vezes, plataformas com essa finalidade tendem a ter um foco maior no conteúdo do que na própria jogabilidade e no interesse de jogadores, o que acaba afastando essa faixa etária em específico. Diversos estudos apontam o impacto que um jogo pode gerar no aprendizado de seus usuários. Seymour Papert, um dos pioneiros no uso de computadores no aprendizado, defendia que a educação pode ser potencializada através de um facilitador, incluindo a utilização de jogos. Sabendo disso, o projeto Seranus surge com a proposta de ensinar jogadores sobre a literatura brasileira. A principal característica dessa aplicação é ser um jogo capaz de satisfazer tanto o jogador casual quanto os que estão procurando aprender sobre o assunto tratado. O estilo visual novel foi escolhido por sua grande ênfase em diálogos e envolvimento do jogador na história. Jogos como Danganronpa e Doki Doki Literature Club utilizam essa ênfase para causar medo no jogador, enquanto aplicações como Undertale e Deltarune aproveitam-se para emocionar o jogador com sua história profunda. Visando esse potencial de impacto no usuário, Seranus possui como seu maior diferencial, além de sua história principal, o caráter pedagógico. Este projeto utiliza Twine para estruturar o roteiro, o framework JavaScript RenJS, o banco de dados MySQL e a linguagem PHP. Atualmente, a estrutura da história, o diagrama de casos de uso, a arquitetura do projeto e a fase inicial do roteiro estão concluídos. Os próximos estágios do desenvolvimento compreendem a conclusão da modelagem do banco de dados, um protótipo do jogo utilizando o framework RenJS e a implementação de um sistema de conquistas.', NULL, NULL, '2021-10-04 13:33:29', '2021-11-05 00:03:09', 6, 2, 9, 5, true, 8.5, 9.25);
INSERT INTO public.projeto VALUES (106, 'SECADOR DE FRUTAS COM CONTROLE AUTOMATIZADO', 'O conceito do projeto é, de forma automatizada, produzir em casa suas frutas secas sem o uso de processos químicos que podem deixar substancias nocivas nas frutas, assim também diminuindo o custo das mesmas. A execução envolve o uso de um microcontrolador Arduino sendo programado para receber dados de leitura de sensores de temperatura, controlar a temperatura e iluminação de uma estrutura, exibir informações em um painel LCD, guardar informações sobre diferentes processos para diferentes frutas e possuir uma interface para dispositivos móveis.A estrutura será construída a partir de uma caixa de isopor. A mesma contará com uma lâmpada (que será acionada a partir da placa Arduino por um shield relé) e uma grade com certa altura em relação à resistência,. A placa Arduino utilizada é a versão MEGA, pela maior quantidade de pinos. O sensor de temperatura LM35 será utilizado por sua precisão ao indicar temperaturas adequada para a proposta (a variação chega a, no máximo, 1.5°C). A iluminação será feita por uma lâmpada de LED pela sua característica de baixo consumo de energia, e o seu acionamento será feito com um shield de relé para Arduino. Para exibir as informações, será usado um LCD de 16x4 posições, que exibirá a hora atual utilizando o módulo RTC DS3231 (versão comum de um relógio em tempo real para Arduino), a temperatura ambiente a partir de um sensor posicionado fora da estrutura, opções de processos para secar diferentes frutas estruturadas em um menu intuitivo e simples, agendamento para horários determinados e tempo restante para finalizar o procedimento. Para que o usuário possa utilizar dispositivos móveis para controlar o protótipo, o módulo ESP8266 será utilizado como um intermediário, que conectará a placa Arduino a uma rede Wi-Fi, enquanto algumas ações poderão ser feitas utilizando um smartphone com sistema Android conectado a essa mesma rede.', NULL, NULL, '2018-08-09 22:43:21', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 8.125, 8.03214285714285836);
INSERT INTO public.projeto VALUES (107, 'UM DIAGNóSTICO DA INTOLERâNCIA RELIGIOSA EM RELAçãO àS RELIGIõES DE MATRIZ AFRO-BRASILEIRAS NO MUNICíPIO DE SAPUCAIA DO SUL', 'Esta pesquisa, em andamento, tem como objetivo diagnosticar a intolerância religiosa associado aos cultos de matriz afro-brasileira no município de Sapucaia do Sul. A razão do desenvolvimento este trabalho partiu após realizar observação da 11ª Semana da Consciência Negra, onde na sua programação contava com a caminhada contra a intolerância religiosa, com o objetivo de diminuir a discriminação de qualquer culto religioso em Sapucaia do Sul, mas o evento teve pouca aderência de participantes,o que nos levou a procurar artigos a respeito da intolerância religiosa. Após leituras de artigos e levantamento da realidade sócio religiosa de Sapucaia do Sul, percebemos que as religiões de matriz afro-brasileiras estão presentes no município e em sua maioria nas regiões periféricas.Portanto, a pergunta que norteia a presente pesquisa é : De que forma a intolerância religiosa está relacionada contra aos cultos de matriz afro-brasileiras no município de Sapucaia do Sul? E para compreender as complexidades da realidade iremos realizar a coleta de dados com os moradores e terreiros presentes no município por meio das seguintes etapas: a) Identificar como a intolerância religiosa está presente no município aplicando questionários com os moradores de Sapucaia do Sul. b) Analisar como os praticantes de religiões de matriz afro-brasileiras se posicionam sobre essa temática, realizando entrevistas semi-estruturadas e questionários. c) Compreender como não praticantes de cultos afro-brasileiros pensam sobre a questão da intolerância, fazendo o uso também de entrevistas semi-estruturadas e questionários. Os estudos feitos até o momento nos permite afirmar a existência de aproximadamente 58 locais de culto religiosos de matriz afro-brasileiras no município e instituições que auxiliam na regulamentação dos mesmo.', NULL, NULL, '2018-08-09 22:56:09', '2018-09-20 19:47:07', 3, 2, 6, 5, true, NULL, 0);
INSERT INTO public.projeto VALUES (252, 'ESPéCIES DE ABELHAS SEM FERRãO EM CANOAS, RS: CONHECER PARA PRESERVAR', 'As abelhas são um dos polinizadores mais importantes das angiospermas. Além disso, muitas espécies apresentam importância econômica pela produção de mel, própolis, pólen e geoprópolis. Nos últimos anos, esses animais têm sofrido uma diminuição de suas populações em função do uso de agrotóxicos em plantações. As abelhas sem ferrão possuem um ferrão atrofiado não sendo possível utilizá-lo para sua defesa. Algumas espécies de plantas nativas necessitam do trabalho de polinização desses animais para sua reprodução. Nosso trabalho tem como objetivo apresentar as espécies de abelhas nativas sem ferrão ocorrentes para a região de Canoas, RS e mostrar a importância da preservação desses animais para o meio ambiente. Para isso, realizamos uma pesquisa bibliográfica buscando informações relacionadas as diversas espécies de abelhas do Brasil e, posteriormente focamos nas espécies de abelhas sem ferrão registradas para a região de Canoas, RS. Após, realizamos uma visitação a criador de abelhas sem ferrão onde verificamos as condições necessárias para a criação doméstica desses animais. A partir dessa pesquisa, descobrimos que no RS existem cerca de 24 espécies nativas, algumas com potencial econômico e de fácil manejo. Nosso próximo passo no projeto é verificar a viabilidade de criação nos arredores da escola e identificar espécies de plantas que podem contribuir para a atração desses animais.', NULL, NULL, '2019-08-09 07:20:12', '2019-09-19 15:43:25', 10, 3, 7, 5, true, 8.75, 6.98749999999999982);
INSERT INTO public.projeto VALUES (108, 'T.IHELP- UMA PLATAFORMA PARA AUXILIAR PROFISSIONAIS à OBTENçãO DE RENDA ALTERNATIVA NA áREA DE T.I;', 'Segundo dados do IBGE, o índice de desemprego no Brasil atingiu 13,1% no trimestre encerrado em março de 2018, isso significa que 13,7 milhões de pessoas estão desempregadas no país, mesmo com graduação e cursos de especialização, em pesquisas com alguns desempregados por meios de redes sociais, há afirmações de que faltam oportunidades. Por outro lado, em 2012, 48% da população afirmou ter buscado trabalho extra nos últimos 12 meses para complementar a renda (CNI, 2012). Conhecendo os impactos que o desemprego pode causar na economia brasileira,é importante propor diferentes formas de como a tecnologia pode auxiliar a população a ter uma forma de sustento e giro de capital. De acordo com informações disponibilizadas pelo Sindicato das Empresas de informática do Rio de Janeiro (TI Rio), de Janeiro a Setembro de 2016, 2327 vagas de emprego no setor de tecnologia da informação foram fechadas no país. Tendo em vista as pesquisas sobre aplicativos atuais e relacionados ao tema fazendo assim uma comparação de tecnologias, pesquisas realizadas na área de T.I e no mercado de trabalho, o presente trabalho tem como objetivo geral desenvolver um aplicativo móvel para contribuir com mão de obra qualificada e eficaz para a sociedade por meio da colaboração, cooperação e comunicação entre os usuários, sendo um sistema para disponibilizar uma forma de renda para quem possui as devidas qualificações, onde o usuário cliente solicita algum serviço no aplicativo e o usuário profissional da área de T.I atende o pedido.', NULL, NULL, '2018-08-10 02:15:13', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 7.375, NULL);
INSERT INTO public.projeto VALUES (44, 'BRINQUEDOS E BRINCADEIRAS: ONTEM E HOJE', 'A razão do desenvolvimento dessa pesquisa é o estudo do uso dos brinquedos e das brincadeiras como uma forma de conservar a memória, possibilitando as crianças conhecimento de que brincar não é somente manusear, mas também construir com as próprias mãos. Objetiva apresentar os brinquedos e as brincadeiras como possíveis fontes históricas, onde podemos aprender a pesquisar sobre os costumes e hábitos, uso dos materiais, avanços de tecnologias, etc. Para atingir esses objetivos foram propostas atividades em que o aluno possa efetivamente realizar trocas afetivas e intelectuais com professores e colegas; classificar alguns brinquedos e brincadeiras de acordo com as épocas passadas e comparar as brincadeiras de hoje com as vividas por nossos pais e avós. Pesquisado brinquedos usados por gerações passadas. Como síntese, pode-se afirmar que os brinquedos de hoje em dia estão mais ligados à tecnologia do que educação e muitos já não existem mais.', NULL, NULL, '2018-08-06 17:52:04', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 7.25, 8.03749999999999964);
INSERT INTO public.projeto VALUES (354, 'O FESTIVAL DE WOODSTOCK', 'Essa pesquisa aborda o evento que teve mais de 400.000 pessoas em busca de paz, amor e liberdade: o Festival de Woodstock. O evento ocorreu no ano de 1969, em um simples palco de madeira, sem fundos ou uma boa estrutura, encarando uma tempestade e até mesmo falta de banheiros, tudo isso acontecia em um sitio na cidade de Bethel, no estado de Nova York. Ocorrido em um cenário de ebulição dos Estados Unidos, mobilização por direitos civis e a guerra do Vietnã que se incorporava cada vez mais, com um público que fugia dos padrões impostos pela sociedade, e que não concordava com a tradicional frase de ir e “morrer na guerra” ou até mesmo viver para ter uma família. Escolhemos esse tema pelo fato de ser uma pausa ao padrão do que foi o pós-guerra (Segunda Guerra), o que faz não ser apenas um evento de música e entretenimento e na verdade um evento de ato político-existencial muito grande de rebelião. Desse modo, nosso problema de pesquisa é como o Festival de Woodstock potencializou a contracultura? Nosso objetivo geral é entender como o evento influenciou a sociedade desde a década de 1960 até os dias atuais e como objetivo específico analisar a importância da contracultura na sociedade do pós-guerra. Para realizarmos nossa pesquisa, analisamos o filme “Woodstock - 3 Dias de Paz, Amor e Música” (Direção de Michael Wadleigh; EUA. Filmagem – 3h05min). Depois partimos para a segunda parte, realizando a leitura e o fichamento das fontes secundárias GUAZZELLI (2010); PAES (1997); MACIEL (1987); GOFFMAN; JOY (2004) e FORNATALE (2009). Das análises feita até o momento concluímos que para as pessoas da época, o Festival de Woodstock representou um grande marco e conquista cultural, tornou-se um símbolo para as próximas gerações. Woodstock revolucionou os hábitos, formas de pensar, e principalmente a cultura do povo estadunidense e de grande parte do mundo, incluindo o Brasil, motivo pelo qual nos leva a nos interessar cada vez mais pelo assunto.', NULL, NULL, '2019-08-12 23:16:08', '2019-09-19 13:52:55', 3, 2, 7, 5, true, 8.625, 0);
INSERT INTO public.projeto VALUES (98, 'CALCULADOR DA LEI DE OHM', 'Calculador da lei de ohm Lei de Ohm, criada pelo físico alemão Georg Simon Ohm, é uma fórmula um tanto quanto útil, que diz que a tensão sobre um resistir ôhmico, (resistores em que a tensão aplicada é proporcional a corrente elétrica) é igual ao produto da corrente que passa sobre o mesmo com a sua resistência. Esta lei é essencial para a nossas aulas de circuitos elétricos. Cansado de resolver os mesmos cálculos o todo tempo eu que estava estudando programação e circuitos elétricos na casa do meu irmão, tive a ideia de montar o calculador da lei de Ohm, para facilitar os meus cálculos em circuitos elétricos. O programa começou com um funcionamento simples, com três programas diferentes, um para calcular a tensão, outro pra calcular a corrente e outro para calcular a resistência. No decorrer do ano acabei conhecendo o Matthäus e o Daniel, e eles acabaram se envolvendo com software e começamos a melhora-lo, colocando todos os tipos de funções novas que aprendíamos na aula de programação como por exemplo caso e enquanto. O calculador da lei de Ohm serve basicamente para evitar erros durante a criação de qualquer tipo de circuito eletrônico, já que a lei de Ohm é uma lei essencial, e se houver erros provavelmente irá queimar algum componente gerando um dano ao circuito que poderia causar o dobro do trabalho ao montador do circuito elétrico. Além de poupar tempo, em casos de consertos, por exemplo, ao utilizar o calculador reduziríamos significativamente o tempo de trabalho do usuário.', NULL, NULL, '2018-08-09 20:03:07', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (105, 'ARMAZENAMENTO SEGURO DAS IMAGENS DE CâMERAS DOS PRESíDIOS (ASICP)', 'O ASICP, Armazenamento Seguro das Imagens de Câmeras dos Presídios, consiste em um sistema que provém armazenamento distribuído de vídeos registrados por câmeras de segurança localizados em sistemas carcerários, garantindo a integridade e a segurança dos mesmos. Este projeto propõe o desenvolvimento de um software que utiliza a tecnologia emergente Blockchain, unida ao InterPlanatary File System(IPFS) para prover o armazenamento de imagens seguro, que não esteja vulnerável a adulterações, distribuído, que não esteja vinculado a uma instituição regulamentadora, e descentralizado, que não sofra a perda de conteúdos por estar vinculado a um servidor principal. O objetivo desta pesquisa consiste em criar uma forma de guardar o conteúdo das câmeras de segurança de modo que garanta que a integridade de toda informação armazenada no sistema seja mantida. Devido a casos ocorridos no Brasil de quebra da integridade de conteúdos produzidos por câmeras de segurança, por exemplo, o caso do político Anthony “Garotinho” que sofreu agressões durante sua estadia na cadeia pública de Benfica, onde houve a comprovação de adulteração das imagens, foi desenvolvida a ideia de um sistema que fosse capaz de realizar com segurança o processo de armazenamento e garantir a não adulteração do conteúdo. Pretende-se atingir tal nível de segurança a ponto de que o que for armazenado, possa ser utilizado como prova judicial inquestionável. Para embasar esta pesquisa, optou-se por utilizar conceitos como os princípios da segurança da informação, criptografia assimétrica, computação forense e sistemas distribuídos.', NULL, NULL, '2018-08-09 22:16:20', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (387, 'ESCRAVIDãO E TRáFICO DE AFRICANOS ATRAVéS DOS REGISTROS DE BATISMO (RIO GRANDE DO SUL, 1780-1850)', 'Até pouco tempo atrás, acreditava-se que a escravidão, no Rio Grande do Sul (doravante RS), não tinha tido a importância, para a formação social e econômica da região, que teve no restante do Brasil. Tal produção da memória, auxiliou na construção da imagem de um estado branco e democrático, onde as relações sociais não haviam sido permeadas pelas relações escravistas. Contudo, nas últimas três décadas a historiografia reviu tal questão, mostrando a importância da mão de obra escrava (e africana) para quase toda a capitania, tanto na pecuária, nas charqueadas, na pequena agricultura, quanto nos centros urbanos. Uma das vertentes dessa renovação historiográfica diz respeito ao tráfico atlântico de africanos. Milhares de africanos escravizados aportaram no RS entre 1780 e 1850. Todavia, ainda é desconhecido para quais localidades e regiões do RS os africanos desembarcados no porto de Rio Grande, por onde chegavam os escravos comercializados para o RS, foram enviados. Dessa forma, esta pesquisa se propõe a investigar quantos escravos africanos foram levados às pias batismais nas diferentes capelas do RS entre 1780 e 1850, verificando a representatividade de tal fonte para a análise do próprio tráfico de africanos para o sul da América portuguesa e, depois, para o sul do Império do Brasil. Caso ela seja expressiva, por um lado, será possível elaborar uma cartografia, a partir dos registros de batismo, dos africanos que viveram e trabalharam no RS no colonial tardio e, principalmente, na primeira metade do século XIX. Por outro, será possível contribuir para o esforço de resgate das reminiscências da cultura africana nas Américas e, em especial, no Brasil e no RS. Por fim, os resultados da pesquisa podem auxiliar da revisão dos conteúdos sobre história do RS trabalhados nas escolas, destacando a importância da migração (forçada) de africanos, e não só de europeus, e o protagonismo daqueles na formação social do RS.', NULL, NULL, '2021-10-06 09:28:23', '2021-11-04 21:27:03', 3, 2, 9, 5, true, 10, 10);
INSERT INTO public.projeto VALUES (8, 'PREBOT - Plataforma de Robótica Educacional', 'Este projeto apresenta o desenvolvimento de uma plataforma de robótica educacional, denominada PREBOT. A robótica educacional hoje é uma metodologia de ensino muito eficiente por se tratar de um método interdisciplinar que explora a criatividade e o trabalho em equipe dos alunos. Entretanto, o alto custo dos kits de robótica comerciais e a alta complexidade de se desenvolver um robô inteiramente são fatores que ainda dificultam a difusão deste método de ensino em muitas escolas. O objetivo do desenvolvimento desta plataforma é propagar a robótica educacional de uma forma acessível e simplificada a todos que buscam aprender sobre o assunto, tanto as pessoas que já possuem um conhecimento básico quanto as que não o possuem. Os materiais e métodos utilizados na construção da plataforma serão escolhidos de forma a simplificar e baratear ao máximo a fabricação e replicação do protótipo, desta forma, outros professores, alunos ou entusiastas poderão ter acesso a um kit de robótica de forma simples e com baixo investimento. A plataforma desenvolvida consistirá em um robô móvel, autônomo e reprogramável. O robô que será desenvolvido terá todos os elementos necessários para ser capaz de superar os principais desafios encontrados na robótica móvel. O desenvolvimento de estratégias sobre como utilizar esses elementos disponíveis para a realização das tarefas expostas será a ferramenta proposta para o aprendizado sobre programação e robótica móvel. Espera-se que o kit desenvolvido proporcione um aprimoramento das habilidades de programação, da capacidade criativa e do trabalho em equipe dos usuários. A validação dos resultados esperados será feita através da utilização dos protótipos em oficinas de robótica, nas quais o amadurecimento destas habilidades será avaliado.', NULL, NULL, '2018-07-25 13:28:44', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 8.875, 0);
INSERT INTO public.projeto VALUES (165, 'DESSALINIZAçãO E PURIFICAçãO DA áGUA', 'Neste trabalho/projeto, iremos apresentar como funciona a dessalinização(retirada do sal) da água do mar, e um projeto de filtro caseiro para a despoluição/purificação/filtragem da água doce. O nosso objetivi é mostrar às pessoas como podemos, através de um projeto simples, despoluir águas impróprias para a utilização. Sabemos que a despoluição e a dessalinização são extremamente necessárias, porém, ao contrário da dessalinização, que é um processo muito complexo e altamente caro, mostraremos que a despoluição/filtragem pode ser algo completamente acessível. Primeiramente, mostraremos como funciona a dessalinização da água do mar em unidades industriais e como funciona a despoluição/filtragem da água doce por meio de um filtro construído com elementos naturais que encontramos ao dia-à-dia. Mostraremos fotos e vídeos da construção e utilização do filtro que fizemos, neste filtro consiste em: utilizar uma garrafa pet com a ponta inferior cortada na horizontal, e, de baixo para cima, colocar pedras(brita), logo abaixo areia, depois carvão ativado(ou carvão normal), e por último, algodão, a água poluída será despejada na abertura da garrafa, passará pelas pedras para remover o conteúdo visível, como galhos e folhas, depois passará pela areia, que serve para remover os dejetos que passariam pelas pedras, depois vem o carvão, que serve para reter as impurezas da água e deixar ela potável, no final o algodão, que serve para deixar a água incolor. Escolhemos este assunto para nosso trabalho, porque o consideramos de extrema importância para a situação atual do Brasil e do resto do mundo, queremos conscientizar e motivar muitas pessoas a dar mais valor à pouca água potável ainda existente no mundo.', NULL, NULL, '2018-08-10 21:35:06', '2018-09-20 19:47:07', 8, 2, 6, 5, true, NULL, 4.44732142857142776);
INSERT INTO public.projeto VALUES (277, 'O QUE A COMUNIDADE PENSA DA SAúDE EM CANOAS?', 'O direito à saúde é um dos direitos fundamentais, por se tratar da saúde e bem-estar dos cidadãos, é uma obrigação do estado garantir uma saúde digna, ou seja, fornecer medicamentos, tratamentos e etc, para reduzir o risco de doenças entre outros. Nós queremos ver como está o acesso a saúde e ver o que as pessoas acham que pode melhorar, e mostrar algumas opções. Entrevistou-se pessoas em três diferentes bairros: São Luís, São José, Estância Velha, para descobrir o que as pessoas acham do direito à saúde em canoas, e ver o que está ruim ou seja o que precisa melhorar, totalizando 32 pessoas entrevistadas na faixa etária de 20 à 72 anos. Constatou-se que muitas pessoas não tem plano de saúde, e a maioria das pessoas que tem plano de saúde tem uma ajuda da empresa para pagar. Todas pessoas entrevistadas disseram que o direito a saúde não está muito bom, a maioria sabe o que é privatização, e acham que a saúde não melhoraria e que talvez melhoraria em certos aspectos, e alguns acham que melhoraria. Muita gente tem hospitais perto das suas casas e outros não tem eles acham que para melhorar tem que ter mais médicos e uma fiscalização melhor por causa do desvio de dinheiro. Concluiu-se que por mais que não esteja tão bom, está satisfatoriamente agradável, muitas pessoas não tem plano de saúde e os que tem a maioria é pago pela empresa. As pessoas disseram que um dos principais problemas são a lavagem em dinheiro e a demora do atendimento.', NULL, NULL, '2019-08-09 19:15:16', '2019-09-19 16:00:41', 11, 3, 7, 5, true, 7.25, 8.61250000000000071);
INSERT INTO public.projeto VALUES (415, 'DISCURSOS ENGANOSOS E COVID-19: OS IMPACTOS PARA ALéM DOS SINTOMAS.', 'No início da pandemia de Covid-19 foram espalhadas diversas Fake News sobre tratamento precoce e vacinas. Infelizmente muitos cidadãos acreditaram nessas notícias, fazendo uso de medicamentos desnecessários e até mesmo deixando de se vacinar. As informações falaciosas podem gerar transtornos e dificuldades na vida da população, além de causar a dúvida em relação à ciência e dividir uma nação por causa de informações espalhadas por pessoas enganadas, desinformadas e/ou negacionistas. Portanto, nossos objetivos são analisar e discutir os impactos dos discursos enganosos na população. Produzimos nosso trabalho a partir de artigos, pesquisas e notícias recentes. O que possibilitou nossa reflexão sobre a quantidade de fake news que são disseminadas, os meios de propagação das mesmas e os impactos e consequências. Foi criado um formulário com perguntas e afirmações relacionadas às Fake News e o Coronavírus. Obtemos como resposta que 100% dos integrantes da pesquisa sabem o que é uma fake news e que mais de 60% já acreditou em alguma informação falsa. Conseguimos constatar também que grande parte dos entrevistados tiveram acesso a essas informações falaciosas por meio das redes sociais. Ademais, verificamos algumas fake news que podem acarretar em problemas mais graves tanto na saúde individual quanto na saúde pública. Podemos citar como exemplo o uso do Kit Covid e as suas consequências. Em nossa pesquisa perguntamos aos entrevistados se haviam feito uso e se conheciam alguém que tenha utilizado o Kit Covid. Por conseguinte, após juntar todos os dados e analisá-los, concluímos que as Fake News já fazem parte do nosso cotidiano e, infelizmente, estão refletindo negativamente na vida de muitas pessoas. Além disso, discursos enganosos estão acontecendo cada vez com mais naturalidade e está se tornando comum a falta de pesquisa sobre assuntos que demandam estudos longos e feitos por profissionais da área.', NULL, NULL, '2021-10-13 21:16:06', '2021-11-02 20:49:49', 3, 2, 9, 5, true, 9.875, 0);
INSERT INTO public.projeto VALUES (291, 'DANÇA CONTRA A DEPRESSÃO', 'Doenças de transtornos mentais estão se tornando cada vez mais frequentes nos dias atuais e atingem mais de 400 milhões de pessoas no mundo. No Brasil a taxa de pessoas com transtornos de ansiedade é a maior no mundo sendo de 23, 9% da população, além de ser o quinto no ranking mundial em casos de depressão, em que a doença afeta cerca de 5,8% da população. Atualmente estamos vivendo uma realidade em que a depressão está muito presente no cotidiano, e na maioria dos casos as pessoas que têm depressão não sabem, e nos casos em que estão cientes que possuem a doença não sabem como devem agir e a quem recorrer para pedir ajuda, esse fato pode agravar ainda mais o problema, por isso procurar ajuda é tão importante. O mais recomendado é sempre recorrer ao auxílio médico, assim a pessoa começará um tratamento para que possa tratar a doença. Uma ferramenta tem mostrado resultados muito positivos e eficazes, sendo simples, acessível e com um grande poder. A dança é uma ferramenta que traz grandes benefícios para a saúde, tanto física quanto mental, e em muitos casos é usada como ponto de refúgio para quem sofre de doenças como a depressão. Além disso, a dança ajuda muito na comunicação e trabalho em equipe pois aos poucos faz com que quem dança confie nos seus colegas e também se conheça melhor, tanto nos seus limites quanto aprendendo o que seu corpo e mente podem fazer juntos. Se uma pessoa estiver de bem com si mesma, seu rendimento será muito melhor, tanto no trabalho, escola e em qualquer lugar que ela estiver, e o principal, será mais fácil aprender a lidar com os desafios e problemas pessoais sempre persistindo e dando o melhor. Tendo isso em mente, se a dança fosse mais presente no cotidiano, por meio de aulas e oficinas simples, com intuito de ser uma forma leve e divertida de relaxar e esquecer por um momento a rotina, que muitas vezes é exaustiva, os índices de pessoas com depressão seriam reduzidos através dessa arte e de um tratamento médico?', NULL, NULL, '2019-08-09 23:20:29', '2019-09-17 16:12:00', 3, 2, 7, 2, NULL, 6.375, NULL);
INSERT INTO public.projeto VALUES (80, 'A DITADURA DA BELEZA', 'Diante de toda a pressão da mídia e de uma sociedade que quer definir o que é um corpo perfeito, o que uma pessoa pode fazer para se enquadrar nesse estereótipo? Após pesquisas e debates no ambiente escolar, percebemos que a cobrança por um corpo perfeito começa desde muito cedo, e que ao invés de estarem aproveitando a adolescência, muitos jovens estão “aprendendo” a ficar horas sem comer ou a tomando outras medidas mais drásticas para não engordarem ou perderem peso. A grande variedade de produtos diet/light e formas de exercícios físicos e academias, são benéficas para a saúde, mas em que ponto deixam de ser pela saúde e passam a ser mais uma forma de “exigência disfarçada”? Inspirado no livro: A Ditadura da Beleza e a Revolução das Mulheres, do escritor, psicólogo e psiquiatra Augusto Cury, temos como objetivo conscientizar sobre as doenças, transtornos alimentares e psicológicos que a busca pelo “corpo perfeito” pode acarretar na vida de alguém e mostrar que mesmo o exterior podendo ser bonito, a verdadeira beleza está na essência.', NULL, NULL, '2018-08-08 16:20:08', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, 4.875, NULL);
INSERT INTO public.projeto VALUES (286, 'LINGOPETS: DESENVOLVIMENTO DE UM JOGO INFANTIL PARA AUXíLIO à APRENDIZAGEM DA LíNGUA INGLESA', 'As crianças da atualidade vivenciam cada vez mais o mundo como ambiente tecnológico e informativo. Segundo levantamento feito pela Viacom International Media Networks em 2017 (VIMN, 2017), crianças brasileiras entre 2 e 5 anos passam 50% a mais de tempo semanal na internet do que a média global, sendo mais de 70% do tempo de uso destinado às formas de entretenimento como jogos e vídeos (Redação E-Commerce Brasil, 2018). Em vista disso, é preciso encontrar uma maneira de equilibrar o tempo atribuído ao entretenimento e aos estudos habituais, pois, à medida que tratados com moderação e suporte dos pais, os jogos em ambiente tecnológico tornam-se grandes aliados quando o assunto é a aprendizagem divertida. Pensando em aliar a potencialidade dos jogos e a crescente necessidade de aprender a Língua Inglesa, foi estudada uma forma de unir o interesse infantil em novas tecnologias, com a facilidade existente em trazer o conhecimento na forma de lazer. Dessa forma, o objetivo geral proposto foi desenvolver um jogo infantil em ambiente tecnológico para auxílio à aprendizagem da Língua Inglesa. A implementação foi feita de forma lúdica e atrativa para o público infantil, com o uso de jogos intercalando o que foi aprendido com o exercício prático e ambientes interativos para a melhor memorização do conteúdo visto. A metodologia utilizada foi a pesquisa qualitativa, e a análise de requisitos, por sua vez, foi estudada de forma a integrar a experiência obtida como bolsista da monitoria de Língua Inglesa ao desenvolvimento do projeto. Posteriormente, para averiguação dos resultados, está prevista a realização de testes com o público alvo, o qual é formado por crianças de seis a oito anos de idade, para verificar a eficiência do LingoPets no quesito da aprendizagem do idioma proposto, assim como sua capacidade de entretenimento para o público infantil.', NULL, NULL, '2019-08-09 22:08:39', '2019-09-19 15:30:30', 6, 2, 7, 5, true, 8.875, 8.55000000000000071);
INSERT INTO public.projeto VALUES (336, 'O DESASTRE DE CHERNOBYL NA IMPRENSA BRASILEIRA', 'Durante a Guerra Fria, as duas grandes potências da época – EUA e URSS – competiam para provar sua forma de governo superior, onde um dos principais campos de conflito eram usinas de energia nuclear. Devido a pressões para superar o rival, a URSS optou por construir reatores nucleares de maneira barata, de modo que fossem construídos com maior rapidez. Porém os materiais de menor custo utilizados, combinados com os trabalhadores sem experiência que eram contratados, resultaram na explosão do reator de número quatro na então usina de Chernobyl. Diante deste contexto, fomos remetidas a seguinte questão: “como os jornais brasileiros representaram o desastre de Chernobyl?”. Em razão disso, nosso objetivo geral é perceber como a imprensa brasileira representou o desastre em Chernobyl e, como objetivos específicos, queremos compreender os impactos internos resultantes do desastre e analisar a influência desse acontecimento para a derrota da URSS na Guerra Fria. De acordo com nossa hipótese, a imprensa brasileira representou o desastre de forma equivocada, cautelosa quando comparada com os verdadeiros acontecimentos, que devido à “cortina de ferro” – estando em vigor na URSS – só foram divulgados ao mundo anos depois. Para analisar nossas fontes de pesquisa – os jornais Jornal do Brasil e Correio Braziliense – realizamos os fichamentos dos livros de História (ALEKSIÉVITCH, 2016; DOBBS, 1998; LUCA, 2006; REIS FILHO, 2003; VIZENTINI, 2003) enfatizando os acontecimentos que levaram ao incidente e suas consequências. Encerrando essa primeira etapa, começamos a coletar informações nos jornais disponíveis online na Hemeroteca da Biblioteca Nacional. Durante a análise, destacamos a contrariedade da URSS em revelar os fatos e o começo da possível conscientização do povo brasileiro sobre os perigos da radiação. Como resultados parciais, entendemos que a explosão em Chernobyl influenciou não só na dissolução da URSS, como também fez um alerta sobre o uso indevido de energia atômica.', NULL, NULL, '2019-08-10 22:57:22', '2019-09-19 13:11:56', 3, 2, 7, 5, true, 9.625, 9.5);
INSERT INTO public.projeto VALUES (129, 'SOCCERCULT - JOGO WEB PARA APRENDER HISTóRIA E GEOGRAFIA COM FUTEBOL', 'Trata-se de um sistema desenvolvido para o ambiente web que tem por objetivo auxiliar no ensino e fixação de conceitos de geografia e história, além de aumentar o interesse dos estudantes nesses campos, por meio da associação dessas áreas com conhecimentos relacionados ao futebol. O jogo se estabelecerá a partir de perguntas e respostas. A ideia parte de um contexto em que o interesse de estudantes por essas disciplinas é bastante baixo, dados de uma pesquisa realizada pelo Centro Brasileiro de Análise e Planejamento (CEBRAP) com o apoio da Fundação Victor Civita com alunos de São Paulo e Recife dão conta de que história e geografia estão entre as matérias que os estudantes menos consideram úteis, com números modestos, pouco acima dos 30% (história 35,1% e geografia 33,8%). Por outro lado, o futebol é notavelmente um dos esportes de maior popularidade no mundo, sobretudo no Brasil, e esse interesse só cresce com o passar do tempo. Diante disso, as questões tomam como base as relações possíveis entre esses campos, como eles podem mutuamente se influenciar. Por exemplo, como a altitude (tema da geografia) interfere em jogos de futebol, ou como a partida entre as seleções da Alemanha Ocidental e Alemanha Oriental na Copa do Mundo de 1974 ajuda a entender o contexto da Guerra Fria. Com isso, as questões são divididas em fases e competições. Uma competição trata-se um conjunto de fases e será guiada por um tema. Já uma fase é um bloco de duas perguntas, uma sobre futebol e outra sobre história e/ou geografia, além de um texto explicativo. O SoccerCult também vai contar com um ranking, níveis de jogadores, vidas e também com moedas que podem ser usadas para adquirir acessórios que interferem no andamento do jogo. Por fim, o SoccerCult também terá uma área de manutenção, onde se gerenciam as perguntas, competições e acessórios.', NULL, NULL, '2018-08-10 16:36:55', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7.75, 6.54017857142857295);
INSERT INTO public.projeto VALUES (334, 'MIGRAçãO: UM DIREITO HUMANO', 'A presença crescente de imigrantes provindos de países subdesenvolvidos no município de Canoas/RS tem sido uma realidade vivenciada por seus habitantes e por vezes gera situações conflitantes entre as partes envolvidas. Frente a isto, este trabalho visa descobrir qual as impressões dos canoenses a respeito dos imigrantes e destes a respeito de seu novo lugar. Para tal, como metodologia, foram desenvolvidos dois tipos de questionários: um destinado a moradores de Canoas e outro destinado a imigrantes, com perguntas a respeito de suas impressões sobre o assunto. Os questionários foram oferecidos nas versões online e impressa. As versões online foram divulgadas nas redes sociais e as versões impressas foram aplicadas nas aulas de Geografia da EMEF 7 de Setembro (6º a 9º anos) e na ONG Centro Batista de Ação Social, onde foi trabalhado no curso de português para imigrantes. A aplicação dos mesmos começou em Junho/2019 e ainda encontra-se disponível em sua versão online, portanto não finalizada. Como exemplo dos resultados parciais, o questionário destinado a Canoenses mostrou que enquanto 58,9% dos mesmos não se consideram xenofóbicos, o questionário dos imigrantes mostrou que 100% já enfrentaram situações de preconceito e que 66,7% já perderam vagas de emprego por serem imigrantes. Tal dicotomia demonstra que ainda há muito o que se explorar sobre o tema, nos lembra que ninguém migra em condições ideais de vida e que nunca estamos livres de precisar sair de nossa terra um dia.', NULL, NULL, '2019-08-10 22:47:12', '2019-09-19 13:55:38', 11, 3, 7, 5, true, 9.375, 10);
INSERT INTO public.projeto VALUES (316, 'DESENVOLVIEMTO DE UM AMBIENTE VIRTUAL DE APRENDIZAGEM(AVA) PARA O ENSINO DE QUÍMICA NO PRIMEIRO ANO DO ENSINO MÉDIO DO COLÉGIO DOM FELICIANO.', 'Os avanços tecnológicos estão cada vez mais mudando a sala de aula fazendo com que os professores de química tenham a necessidade atualizar sua maneira de ensino, se alinhando com tais avanços. Entretanto, diversos professores de química se deparam com problemas ao reunir materiais para suas aulas, uma vez aqueles disponíveis na internet estão dispostos de maneira desorganizada e confusa. A falta de uma plataforma compartilhada para conteúdos de química também é um problema já que os materiais que os professores de química encontram ou desenvolvem não são compartilhados de maneira conveniente para os professores. O presente trabalho oferece uma possível solução, um AVA (Ambiente Virtual de Aprendizagem) compartilhado entre professores, de navegação simples com conteúdos revisados. A plataforma teve como enfoque o ensino de química do primeiro ano do colégio Dom Feliciano, utilizando como base o plano de ensino utilizado na instituição e três principais características: a facilidade de navegação, a utilidade em sala de aula e a abrangência de conteúdos. Foi desenvolvida através do Google sites, visto que já são utilizados recursos do Google na escola e sua simplicidade de desenvolvimento e acesso. A plataforma tem o layout organizado na sequência de ensino de química aplicado na escola, onde cada conteúdo possui três elementos: um “slide principal”, breve apresentação e um acesso aos materiais daquele conteúdo. Para sua avaliação, o ambiente foi utilizado em sala de aula com alunos do primeiro ano do ensino médio no Colégio Dom Feliciano, que tiveram seu desempenho avaliado com questões antes e depois do acesso ao AVA. Também foi desenvolvido um questionário para o professor Christian Valério, avaliando a perspectiva do profissional do ensino de química sobre a plataforma. Ambos os questionário demonstraram resultados satisfatórios. O AVA se mostrou eficiente como uma ferramenta auxiliar no ensino de química, facilitando a relação da sala de aula com a tecnologia.', NULL, NULL, '2019-08-10 17:39:31', '2019-09-19 13:23:06', 4, 2, 7, 5, true, 8.25, 9.23928571428569967);
INSERT INTO public.projeto VALUES (239, 'MÃOS ESTENDIDAS - UMA PLATAFORMA MÓVEL VOLTADA AO SUPORTE DE IMIGRANTES E REFUGIADOS', 'O mundo tem se tornando perigoso, seja por causa de guerras, massacres, perseguições, discriminações ou violências generalizadas, causadas por diferentes motivos. Dentro deste contexto, os indivíduos que vivenciam essas situações muitas vezes acabam tendo que imigrar ou se refugiar em outro país para que assim consigam ter uma vida mais digna. Ao conseguirem encontrar um novo lugar para residir, muitas vezes, acabam se deparando com pessoas e atitudes xenófobas. No Brasil, o ódio pelos imigrantes e refugiados vem aumentando. Levando em consideração esta conjuntura, surgem alguns projetos que procuram suprir as necessidades desses imigrantes e refugiados, tornando, assim, suas vidas um pouco mais fáceis. Este projeto, derivado de um Trabalho de Conclusão de Curso Técnico em Informática para Internet apresenta o desenvolvimento de uma aplicação móvel voltada para esse público, baseada na plataforma Android. Seu objetivo principal é a redução dos índices de pessoas que sofrem xenofobia no Brasil. Para efeitos de comparação, foram estudados quatro trabalhos relacionados à área deste projeto. Este projeto encontra-se em estágio inicial de implementação. Um sistema que visa mostrar através de avaliações feitas pelos usuários sobre os locais em que estiveram e como foram tratados, de modo a alertar a outras pessoas se há a probabilidade de serem atacadas torna-se relevante. O aplicativo também incentiva a utilização de contatos de emergência caso haja uma situação de necessidade dos mesmos. Além disso, também contribui para que os usuários falem de seus medos, das situações de risco pelas quais passam, dos problemas que enfrentam ou, até mesmo, que deem boas referências de locais agradáveis que visitam. O aplicativo será validado com a ajuda de alguns imigrantes e refugiados residentes na cidade de Gravataí. Os resultados dos testes de uso serão discutidos na monografia do trabalho de conclusão de curso.', NULL, NULL, '2019-08-08 09:10:03', '2019-09-19 13:30:17', 6, 2, 7, 5, true, 7.75, 9.11428571428569967);
INSERT INTO public.projeto VALUES (352, 'EXAMINANDO O MICROCOMPUTADOR: OS POTENCIAIS USOS DA LINGUAGEM BASIC DIFUNDIDOS ATRAVéS DE REVISTAS DE INFORMáTICA NO INíCIO DOS ANOS 1980', 'Os microcomputadores surgiram no final dos anos 1970 com a proposta de liberdade individual, a partir da autonomia que os indivíduos teriam ao utilizá-los em seu ambiente doméstico. Porém, para desfrutar de suas potencialidades, era necessário criar algum nível de domínio entre seus usuários, já que um microcomputador acompanhava um interpretador em linguagem BASIC, meio necessário para possibilitar seu uso. Deste modo, para facilitar essa interação entre máquina e usuário, surgiram publicações especializadas que visavam contribuir no entendimento e exploração dos limites técnicos dos microcomputadores, envolvendo os leitores em um campo até então fechado a especialistas da Informática. A partir da experiência brasileira, nossa pesquisa visa observar como as publicações de microinformática no país traziam matérias e cursos envolvendo a linguagem BASIC para computadores, em suas diferentes apresentações. Como fontes, foram utilizadas as revistas Micro Sistemas, Micro Hobby e Micro Mundo, tendo em vista sua circulação e popularidade entre a comunidade informática. A pesquisa analisou matérias, propagandas e listagens de códigos em BASIC publicados nesses periódicos, observando as diversas propostas e funcionalidades, como aplicações comerciais e financeiras, jogos eletrônicos e programas voltados à Educação e à Saúde. Nossos resultados parciais apontam que havia um claro aspecto educacional, já que interessava despertar no usuário uma série de competências a partir do aprendizado da linguagem e construção de programas, tais como raciocínio lógico; por outro lado, os diferentes tipos de programas demonstram ainda uma certa indefinição sobre o papel no qual o microcomputador poderia representar, visto tanto como um “brinquedo” sofisticado voltado a jogos, quanto uma ferramenta de trabalho para profissionais liberais ou pequenos estabelecimentos comerciais. Por fim, entre os leitores que mandaram seus programas para a publicação há uma tendência aos jogos e utilitários.', NULL, NULL, '2019-08-12 22:13:44', '2019-09-19 16:12:07', 3, 2, 7, 5, true, 8.625, 9.51428571428570002);
INSERT INTO public.projeto VALUES (210, 'VIDA COM OU SEM GLúTEN!', 'O objetivo da pesquisa é avaliarmos a quantidade de glúten nas refeições dos alunos da EMEF Miguel Couto, inclusive as ofertadas pela escola. E mostrar através de pesquisas recentes, os malefícios causados pela ingestão excessiva do glúten em nossa dieta. Ao analisarmos o que os alunos merendavam no intervalo, verificamos que uma grande maioria ingere excessivamente o glúten. Convidamos 10 alunos da escola para serem avaliados, anotamos sua idade, massa e altura. Após pedimos que os mesmos respondessem um questionário de conhecimento e hábitos alimentares. Os mesmos precisaram anotar o que se alimentaram por um período de 12h. Realizamos uma entrevista com uma das merendeiras da escola. Dentre diversas perguntas queríamos saber que tipo de alimento a escola recebe e quem determina o cardápio escolar. Fomos visitar um mercado de nossa localidade para verificar a oferta de alimentos sem glúten. Com uma pesquisa descobrimos muitas coisas sobre o glúten, inclusive receitas que podem ser ofertadas na escola. Com isso, montamos um livro de receitas sem glúten. Como experimento, realizamos duas receitas: pão de queijo e cookies. Uma alimentação sem glúten fará os alunos sentir-se melhor porque irão fazer uma alimentação mais saudável.', NULL, NULL, '2019-07-31 19:20:18', '2019-09-21 08:18:22', 10, 3, 7, 5, true, 8.125, 9.19999999999999929);
INSERT INTO public.projeto VALUES (109, 'PAGES AND SCREENS: UMA REDE SOCIAL PARA LEITORES E CINéFILOS', 'Há poucos sistemas web voltados a livros e filmes projetados de maneira a facilitar a interação social e discussão dos usuários sobre esses assuntos. Os sistemas existentes não abrangem os dois assuntos simultaneamente, impossibilitando as interações entre os usuários. Foi então realizado um questionário com objetivo de recolher informações sobre a necessidade de um sistema que suprisse essas carências. O questionário, realizado tanto em âmbito nacional quanto internacional, recebeu cerca de mil respostas, nas quais 80% dos questionados expressavam interesse em ambos filmes e livros e 75% consideravam interessante a ideia de um sistema web que abordasse os dois. O único fator descriminante considerado na pesquisa foi a idade, em que cerca de 70% possuem menos de 18 anos ou entre 18 e 24 anos. Com isso, pode-se se observar a existência, e uma probabilidade de crescimento, na carência dos usuários por um sistema mais abrangente incluindo tanto cinéfilos quanto leitores. Se baseando nessas informações o presente projeto tem como objetivo a criação de uma rede social que aborde os dois assuntos e que possua internacionalização, os dois quesitos sendo de extrema importância para uma maior interação entre todos os usuários, caracterizando assim uma rede social. Redes sociais são um novo meio de construir relações e de se expressar, esse sendo o principal motivo da escolha desse tipo de sistema web, visto que a discussão e expressão de opiniões é o principal objetivo de leitores e cinéfilos em seus meio de comunicação. Para verificar a eficiência do projeto em suprir a carência dos usuários e em estimular sua interação ao final do projeto serão realizados pesquisas tanto qualitativas quanto quantitativas, nas quais por meio de logs no sistema e por meio de questionários de satisfação o projeto poderá avaliar sua real eficácia em cumprir seus objetivos.', NULL, NULL, '2018-08-10 08:26:11', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 8.625, NULL);
INSERT INTO public.projeto VALUES (396, 'UMA ANáLISE INTERDICIPLINAR DA POLUIçãO E SUAS CONSEQUêNCIAS', 'Esta produção cientifica tem como objetivo a realização de uma análise interdisciplinar das alterações genéticas a partir de poluentes químicos, a poluição industrial e meios de combate governamental para sua diminuição e o importante papel da química na diminuição da poluição ambiental, a pesquisa teve como base metodológica a análise de cinco diferentes fontes de informação analisando os dados e os cruzando como o intuíto de verificar sua precisão na implementação da pesquisa, ao final da exposição inicial e analise dos dados exploramos as implicações geopolíticas, sociais, econômicas e cientificas, com o os principais resultados sendo divididos em em seções, com o primeiro assunto abordando sendo as alterações genéticas causadas por exposição a poluentes químicos e suas consequências duradoras como por exemplo a sua perduração no genoma até três gerações após a sua exposição, posteriormente é desenvolvidos as alterações genéticas causadas pela a exposição radiológica da emissão gama a nível celular até a nível de tecidos do corpo humano, explorando as lesões provocadas por esse tipo de radiação que pode vir a ser emitida caso não haja um controle de poluidores radiológicos, após isso é dada continuidade para a explanação dos principais poluentes industriais, esses poluentes são resultantes da queima incompleta de combustìveis fosseís, posteriormente é realizado uma analise geopolitica dos problemas ambientais da república popular da china. Salientamos que esse estudo precisa ser ampliado para que melhor possamos entender o processo.', NULL, NULL, '2021-10-08 12:25:22', '2021-11-02 20:50:16', 4, 2, 9, 5, true, 6.25, 0);
INSERT INTO public.projeto VALUES (201, 'O ASSASSINATO DE EDSON LUíS E A PASSEATA DOS CEM MIL', 'O tema escolhido para o artigo foi Ditadura Militar no Brasil. Este tema foi escolhido com a finalidade de analisar os fatos ocorridos e tentar compreender e respectivamente idealizando se a imprensa brasileira foi instruída a censurar um dos fatos citado no problema de pesquisa: o assassinato de Edson Luís de Lima Souto, e após o protesto nomeado como Passeata dos Cem Mil, tentar remodelar os argumentos já afirmados. Outro fator que levou a deliberação deste tema é compreender como a sociedade da época reagia ao estado político daquele eminente período, e se a própria fiava-se ao que o jornal conceituava em suas matérias No entanto a análise em estudo deverá prover a concientização dos acontecimentos históricos que marcaram com repercussões de violência e agressividade, de um período contra uma população à procura de seus direitos como cidadãos. Buscamos como objetivo de foro íntimo e acadêmico devanear e constatar as verdades sobre os fatos ocorridos. Em termos metodológicos, nosso trabalho está fundamentado no estudo de jornais como fonte primária e bibliografias históricas de tal assunto como fonte secundária. A mídia e imprensa brasileira da época, em geral, relatou de forma legítima as informações sobre a realidade dos acontecimentos, ela foi muitas vezes detalhista, direta e cativante ao público. . Em questão aos acontecimentos de que se trata este artigo compreendemos que as ações tomadas pelos militares foram incoerentes, insensatas e injustas. Portanto conclui-se que seria e foi necessário o povo tentar intervir neste governo opressor, senão as atrocidades só tenderiam à piorar. Embora que esses movimentos não foram capazes de derrubar o governo naquele ano, eles serviram como base para uma estrutura resistente para uma nação democrática, onde esta nação só se faria presente e mostraria sua capacidade no fim da ditadura militar, mais especificamente no ano de 1985.', NULL, NULL, '2019-07-23 15:21:20', '2019-09-19 14:28:51', 3, 2, 7, 5, true, 7, 0);
INSERT INTO public.projeto VALUES (229, 'SAÚDE MENTAL E OS JOVENS EM IDADE ESCOLAR.', 'Este trabalho tem como objetivo falar sobre saúde mental e as principais doenças psicológicas que afetam os jovens durante o período escolar, abordando suas causas, sintomas e consequências. A justificativa para desenvolver este trabalho deve-se à ocorrência de tantos transtornos, cada vez mais comuns entre os jovens. Para atingir os objetivos iniciamos fazendo uma pesquisa sobre Saúde Mental. Em seguida, investigamos as enfermidades psicológicas que mais afetam os jovens estudantes, seus sintomas e razões para seu desenvolvimento. Para concluir, aplicamos um questionário com jovens entre onze e dezoito anos de idade de uma escola privada de Porto Alegre, com perguntas objetivas relacionadas à saúde mental e os principais sintomas desses distúrbios. Os resultados do questionário foram transformados em gráficos, porém podemos afirmar que um número expressivo dos jovens diz apresentar ao menos um dos sintomas, mais da metade do total afirma possuir irritabilidade e ansiedade com frequência, uma quantidade significativa afirma sentir todos os sintomas, e apenas uma pequena parcela assegura não sentir nenhum dos sintomas expostos no questionário. Concluímos que as doenças psicológicas são cada vez mais comum entre os jovens, especialmente por causas relacionadas ao cotidiano escolar e relações familiares. Assim como as doenças físicas, os distúrbios psicológicos precisam de diagnóstico e tratamento adequado, e quando não tratados e acompanhados com seriedade, podem ser fatais.', NULL, NULL, '2019-08-07 09:26:05', '2019-09-19 15:56:38', 11, 3, 7, 5, true, 7.25, 9.80000000000000071);
INSERT INTO public.projeto VALUES (154, 'SCIEVENTWEB: UM AMBIENTE WEB PARA GERENCIAMENTO DE EVENTOS CIENTíFICOS', 'Um problema constante no Campus Canoas do IFRS é a falta de ambientes adequados para a divulgação e organização de seus eventos científicos. Os mesmos utilizam ferramentas que não atendem suas necessidades, como por exemplo, um local adequado para inscrições. Um exemplo é a Feira de Ciências e Inovação Tecnológica do Campus Canoas(IFCITEC) que conta apenas com um site que utiliza a plataforma WordPress, que se mostra problemático para tal objetivo, uma vez que possui limitações, tanto na parte estética quanto funcional, além de necessitar de alguém com conhecimentos prévios mais avançados em informática e programação para a manutenção do site. Atualmente, muitos dos eventos científicos do Campus Canoas são resultantes de projetos de pesquisa, extensão e ensino que contam com orientadores e bolsistas que, na maioria das vezes, não possuem conhecimentos em programação e informática, o que influencia na decisão de não utilizar um site ou aplicação para a organização e divulgação do mesmo. O atual projeto propõe desenvolver uma aplicação web para o melhor funcionamento de eventos científicos, tendo em vista principalmente a sua divulgação e organização.. A IFCITEC em sua última edição recebeu mais de cem trabalhos inscritos nas categorias de ensino fundamental, ensino médio e ensino médio técnico. A cada ano a feira cresce mais e recebe um número maior de trabalhos inscritos, isso faz com que seja necessária uma maior organização acerca de suas informações, tais como regulamento, anais, etc. Atualmente a feira utiliza a plataforma WordPress como site para a divulgação e organização, este, é muito limitado e necessita de pessoas com conhecimentos avançados em informática e programação para fazer a manutenção do site. Por este motivo, a proposta do projeto se baseia em uma aplicação de fácil uso para todos, melhorando assim, a manutenção do site para orientadores e bolsistas.', NULL, NULL, '2018-08-10 20:30:27', '2018-09-20 19:47:07', 6, 2, 6, 2, true, 8.625, NULL);
INSERT INTO public.projeto VALUES (33, 'VAMOS JUNTAS? UMA PLATAFORMA MÓVEL VOLTADA À UNIÃO DAS MULHERES NO TRANSPORTE PÚBLICO', 'O presente trabalho dedica-se a desenvolver uma plataforma móvel voltada especialmente para mulheres, que surge a partir de uma proposta de Trabalho de Conclusão de Curso Técnico em Informática para Internet. Seu progresso se dá após uma série de pesquisas sobre as dificuldades de convivência diária das mulheres em uma realidade machista, sob o viés da insegurança das mesmas ao utilizarem transporte coletivo, que vem crescendo na Região Sul do país em decorrência dos assédios sofridos. Por conta destes fatos, cria-se uma ambição de encorajamento das mulheres e a necessidade de iniciativas que possam combater estas situações em função da segurança e da sororidade. Neste contexto, o trabalho tem como foco principal a redução dos índices de assédios no transporte público do município de Gravataí – RS. O aplicativo busca facilitar a comunicação entre as usuárias, conectadas através de um chat em grupo e permite o registro de assédio nas linhas de ônibus da cidade. Além disso, provê uma forma de consultar as denúncias já catalogadas e proporciona segurança às usuárias com a validação de gênero no momento do cadastramento da conta. É possível verificar que o tema ainda carece de atenção e que as mulheres precisam de alternativas mais acessíveis para reportar abusos e se manterem seguras e unidas. Portanto, este aplicativo, construído sob a plataforma Android e que está em fase de desenvolvimento, contribuirá para o avanço nas questões de visibilidade e denúncia da violência contra as mulheres, mostrando que elas não estão sozinhas nessas situações. Possibilitando que juntas elas possam enfrentar tais circunstâncias, traz o empoderamento feminino através da união, contribuindo para a redução dos índices de assédio no transporte público da cidade e ao combate à violência de gênero na mobilidade urbana.', NULL, NULL, '2018-08-03 12:27:05', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 9.75, 8.42678571428571388);
INSERT INTO public.projeto VALUES (150, 'VERIFICANDO FENÔMENOS ELETROSTÁTICOS E CONSTRUINDO UM PÊNDULO ELETROSTÁTICO', 'O trabalho consiste na verificação de fenômenos eletrostáticos e na criação de um pêndulo eletrostático caseiro, além de verificar fenômenos eletrostáticos em materiais com tipos diferentes e iguais de energia (positiva e negativa), observando e entendendo a atração e a repulsão de objetos. Os fenômenos eletrostáticos ocorrem quando um corpo possui excesso de cargas elétricas, quando tais cargas estão em repouso. A eletrostática se baseia em dois princípios: o princípio de conservação de cargas, em que a carga total de um sistema eletricamente isolado é constante; E o princípio de atração e repulsão de cargas, onde iguais se repelem e diferentes se atraem. Os fenômenos eletrostáticos ocorrem quando um corpo passa pelo processo de eletrização, e fica carregado eletricamente. Esses corpos podem se carregar de duas formas: positiva, em que há mais prótons do que elétrons no corpo; e negativa, em que há mais elétrons que prótons. Primeiramente tentamos realizar a experiência com materiais mais simples, como copo plástico, linha de costura/barbante, canudo e uma esfera de papel alumínio. Em tal tentativa não obtivemos êxito, talvez por conta do atrito que o fio e a esfera tiveram. Já na segunda tentativa, trocamos o canudo por um palito de churrasco e uma pequena tábua de madeira, além de trocarmos a esfera de papel alumínio por uma tira do mesmo material, esta tentativa funcionou da maneira esperada, pois o cano de PVC e o fio de alumínio se atraíram.', NULL, NULL, '2018-08-10 20:27:24', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 6.5, NULL);
INSERT INTO public.projeto VALUES (347, 'O IMPACTO CAUSADO PELO ASSASSINATO DO PRESIDENTE JOHN F. KENNEDY NA IMPRENSA BRASILEIRA', 'Nossa pesquisa aborda o assassinato do presidente dos Estados Unidos, John Fitzgerald Kennedy, que aconteceu em 22 de novembro de 1963 no próprio território estadunidense. Acreditamos que esse tema, por ser um fato muito importante, possui uma grande influência na História dos Estados Unidos e no desenvolvimento do conflito nomeado Guerra Fria. Sua morte, que foi vista como uma grande perda para os Estados Unidos, traz consigo inúmeras histórias e teorias, porém uma verdade em comum: o líder do mundo capitalista estava morto. A partir disso, ficamos curiosos para saber como esse triste acontecimento foi noticiado no Brasil, então elaboramos o seguinte problema de pesquisa: como a imprensa brasileira representou o assassinato de John F. Kennedy? Nosso objetivo geral é entender como a imprensa brasileira noticiou sua morte e nossos objetivos específicos são analisar os principais impactos da sua morte no Brasil e no mundo e destacar a importância de John F. Kennedy para a história dos Estados Unidos. Em termos metodológicos, nós, inicialmente, realizamos uma pesquisa bibliográfica sobre a história dos Estados Unidos, em especial ao governo de John F. Kennedy e fomos realizando fichamentos dessas leituras: KARNAL, 2018; TALBOT, 2013; VIZENTINI, 2003; WEINER, 2008; HERSH, 1997. O trabalho está em desenvolvimento: nesse momento, estamos pesquisando nossas fontes primárias, os jornais Correio da Manhã, Diário de Notícias e Jornal do Brasil, todos do Rio de Janeiro, que ainda era o grande centro político brasileiro, pois fazia apenas três anos que a capital tinha se transferido para Brasília. Nossa hipótese de pesquisa é que a imprensa brasileira retratou com grande destaque o assassinato do presidente John F. Kennedy, onde, os jornais brasileiros, de uma forma direta, noticiaram o acontecimento que marcou grandes manifestações silenciosas a favor do líder democrata.', NULL, NULL, '2019-08-11 22:01:24', '2019-09-19 14:27:15', 3, 2, 7, 5, true, 8.75, 8.84642857142855021);
INSERT INTO public.projeto VALUES (230, 'MODA INCLUSIVA: AUTONOMIA E AUTOESTIMA PARA PESSOAS COM DEFICIÊNCIA', 'Este trabalho tem o objetivo de apresentar a moda inclusiva, movimento a favor da autonomia e da autoestima através do vestuário para pessoas com deficiência. Também queremos expor a opinião de algumas pessoas que possuem deficiência física, a respeito das roupas que usam e as dificuldades enfrentadas para se vestirem com independência, conforto e bom gosto. Para atingir os objetivos propostos iniciamos fazendo uma pesquisa sobre a moda inclusiva, sua origem e como está se desenvolvendo esse movimento. Em seguida, buscamos encontrar casos de pessoas e marcas envolvidas no empoderamento desse setor. Para concluir, fizemos uma entrevista com uma jovem, cadeirante e influenciadora nas redes sociais, que fala exclusivamente sobre o assunto. Para complementar, ainda realizamos um questionário com pessoas com deficiência física, a fim de verificar suas opiniões e dificuldades relacionadas ao seu vestuário e rotina. Sobre os questionários aplicados e entrevista realizada podemos afirmar que todos declararam ter dificuldades em vestir-se, necessidade de adaptar suas roupas e sugeriram adequações que facilitariam sua rotina. Podemos afirmar que a moda inclusiva é um setor que ainda enfrenta preconceito ou desinformação, porém é um mercado promissor. Em síntese, podemos dizer que a moda inclusiva chega para mostrar à indústria da moda que os deficientes têm necessidades reais não só para seu conforto e autonomia, mas também para sua autoestima e seu desejo de inclusão social.', NULL, NULL, '2019-08-07 09:59:36', '2019-09-19 16:14:17', 12, 3, 7, 5, true, 7.875, 10);
INSERT INTO public.projeto VALUES (128, 'FIQUEBEM - UM APLICATIVO DE IDENTIFICAçãO, GEOLOCALIZAçãO E SUGESTõES DE HáBITOS SAUDáVEIS PARA AJUDAR PESSOAS COM DEPENDêNCIA QUíMICA', 'Este estudo abordará os temas das Substâncias Psicotrópicas e da Dependência Química visando vinculá-los com os avanços da Tecnologia da Informação e Comunicação (TIC). Por dependência química, entende-se, de acordo com a OMS, um transtorno mental no qual o adicto acaba por necessitar do consumo repetido da substância psicotrópica à qual ele é dependente para sentir-se bem, ou para evitar que se sinta mal (seja por causa de dores de cabeça, noutras regiões do corpo, ou quaisquer outros sintomas). A ideia central do estudo é alcançar um meio que permita auxiliar o dependente químico durante seu processo de retirada, encaminhando-o a Centros de Atenção Psicossocial (CAPS), Narcóticos Anônimos (NA), Alcoólicos Anônimos (AA), ou outras instituições. Também pretende-se informar o dependente de alguns hábitos que ele poderá implementar em sua rotina, como corridas matinais, completar palavras cruzadas, e outras atividades que auxiliem no combate aos sintomas da abstinência, como a ansiedade. Serão disponibilizadas informações sobre o conceito de dependência e como ocorre tal processo, de forma concentrada e atrativa, fazendo com que indivíduos que anteriormente não possuíam entendimento do assunto, acabem por interessar-se a aprender o que realmente acontece, desconstruindo quaisquer preconceitos. Para alcançar os objetivos do estudo, pretende-se realizar a aplicação de tecnologias como a Geolocalização, para realizar o encaminhamento dos usuários às instituições. Esperam-se, como resultados, o aumento da suscetibilidade do tratamento de dependentes químicos, e uma maior conscientização sobre do tema, de forma a desconstruir – ao menos parcialmente – o estigma que existe acerca dos dependentes químicos e da dependência em si.', NULL, NULL, '2018-08-10 16:26:46', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.26249999999999929);
INSERT INTO public.projeto VALUES (27, 'APROVE IFSUL: UMA PLATAFORMA WEB PARA AUXILIAR ESTUDANTES NOS PROCESSOS DE SELEÇÃO E INGRESSO NO IFSUL', 'Os Institutos Federais de Educação Básica, Técnica e Tecnológica são conhecidos por oferecerem uma uma educação pública, gratuita e de qualidade. Isso pode ser observado pelo crescente número de inscrições nos vestibulares para os cursos técnicos integrados dos institutos federais. Tal fato mostra que há mais estudantes em busca dessa educação do que vagas ofertadas pelos institutos federais. Além disso, a fim de acessar essas vagas, os estudantes buscam por cursos preparatórios para vestibulares, que, por serem pagos, não podem ser acessados por todas as pessoas interessadas na educação oferecida pelos institutos federais. Isso posto, esta pesquisa tem o objetivo de desenvolver uma plataforma web gratuita que auxilie estudantes em sua preparação para o processo de seleção e ingresso no IFSul (Instituto Federal Sul-Rio-Grandense). Uma vez reconhecida que a educação é um direito básico de qualquer cidadão, o desenvolvimento de uma plataforma web gratuita pode contribuir para a garantia desse direito ao oferecer uma tecnologia que é gratuita, que dialoga com estudantes representantes de uma geração que nasceu em uma era tecnológica (os quais podem apresentam diferentes estilos de aprendizagem) e que oferece recursos para pessoas com deficiências. Este trabalho apresenta, em primeiro lugar, pesquisas bibliográfica e documental. Em segundo lugar, para o levantamento e definição de funcionalidades da aplicação, há o uso de entrevistas face a face e grupos focais como instrumentos de coleta de dados, cujos dados serão interpretados pelo método de análise de conteúdo de Bardin (1977). Em terceiro lugar, para o desenvolvimento de uma plataforma web, o uso de das seguintes tecnologias: MySQL,direcionada para estruturação do banco de dados; HTML5, enquanto linguagem de marcação; CSS3, para implementação da idealização do design; e JavaScript, como a linguagem utilizada para interação do usuário com os itens dispostos na tela. Com isso, espera-se desenvolver a plataforma web.', NULL, NULL, '2018-07-31 21:13:52', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 8.125, NULL);
INSERT INTO public.projeto VALUES (266, 'FLORES COMESTíVEIS', 'As flores comestíveis estão espalhadas na natureza. Muitas vezes não percebemos, mas nós comemos flores, sim. São diversas as espécies cultivadas e próprias para utilização na culinária. A maior parte das espécies possui alta quantidade de nutrientes, como os óleos essenciais, que ajudam no consumo totalmente indicado para as pessoas que buscam uma alimentação equilibrada e saudável. Também é importante conhecer a flor que deseja consumir, assim evitando indigestão ou mal-estar após o consumo. O objetivo deste projeto é informar a importância das flores comestíveis ao público, pois muitos não têm o conhecimento que existe espécies que podem ser consumidas, sem prejuízo à saúde. O trabalho foi desenvolvido através da metodologia de pesquisa bibliográfica, para melhor conhecimento do assunto, elaboração de maquete demostrando exemplares ao público e elaboração de pôster. Com base no que foi apresentado e pesquisado, percebemos a importância de conhecer e explorar de forma detalhada a existência das flores comestíveis.', NULL, NULL, '2019-08-09 16:17:39', '2019-09-19 15:59:21', 11, 3, 7, 5, true, 9.125, 7.77500000000000036);
INSERT INTO public.projeto VALUES (261, 'A IMPORTâNCIA DO TRATAMENTO FíSICO-QUíMICO DA áGUA', 'A água é o bem mais precioso para a humanidade, por este motivo, é essencial que cuidemos dela. Este trabalho apresenta uma pesquisa sobre processo de tratamento da água. Será apresentado o processo por onde a água passa durante o tratamento, produtos químicos utilizados para a limpeza dela. Será abordado a importância da água, para isso, será feito um projeto caseiro que possibilita a visualização da água sendo clarificada. Concluímos com esse resultado que após adicionar a água impura no filtro, observa-se que dentro de alguns minutos a água começa a descer pelo filtro limpa e transparente. O objetivo com esse experimento é mostrar que podemos reutilizar a água impura para consumo doméstico como a limpeza de casa. Infelizmente, essa água não pode ser consumida através de alimentos ou qualquer outro consumo próprio para o corpo humano, por conter substâncias prejudiciais à saúde; porém, pode sim ser reutilizada. Também será apresentada uma maquete que representa uma Estação de tratamento de água.', NULL, NULL, '2019-08-09 14:53:14', '2019-09-19 14:04:05', 10, 3, 7, 5, true, 8.375, 6.47499999999999964);
INSERT INTO public.projeto VALUES (397, 'PREJUÍZO DAS AÇÕES ANTRÓPICAS PARA O ECOSSISTEMA', 'O Brasil, segundo dados disponibilizados pelo Sistema de Estimativa de Emissão de Gases é responsável por ocupar a quinta posição no ranking de maior emissor do efeito estufa, ou seja, gases poluentes no ano de 2019. Este trabalho tem o objetivo apresentar as principais alterações genéticas que ocorrem a partir da exposição a poluentes químicos, assim como as suas consequências, a diferença das leis ambientais na China e no Brasil, as medidas que a população e o governo chinês estão tomando para reduzir essa emissão e as fórmulas estruturais, moleculares e as respectivas funções orgânicas de cada composto. Nesse sentido, a justificativa para desenvolver o presente trabalho deve-se ao fato de que é um assunto de grande relevância para a sociedade atual. Dessa forma, a metodologia do trabalho surgiu a partir de estudos e pesquisas realizadas nos artigos disponíveis em repositórios da Universidade Federal do Rio Grande do Sul. Para essa pesquisa em artigos científicos utilizamos palavras chaves como: gases, meio ambiente, efeito estufa, China e poluentes. Pode-se concluir que os resultados apontam uma piora gradativa da situação atual do meio ambiente, isso principalmente ocorrido por ações antrópicas incoerentes e pela falta de fiscalização correta pelas leis ambientais. Sugerimos que mais estudos sejam realizados para que haja uma conscientização adequada das populações envolvidas no processo, com propostas efetivas para atenuar os problemas gerados e minimizar maiores prejuízos futuros.', NULL, NULL, '2021-10-08 12:44:07', '2021-11-02 20:50:35', 8, 2, 9, 5, true, 5.625, 0);
INSERT INTO public.projeto VALUES (13, 'COECO - UMA PLATAFORMA PARA FACILITAR O DESCARTE CORRETO DE RESíDUOS SóLIDOS URBANOS', 'Ao longo dos últimos anos o Brasil tem mostrado elevada taxa de geração de resíduos sólidos. Mesmo sabendo que a maior parte destes é de fato coletada, a dificuldade em reciclá-la expressa-se de forma clara, pois em 2016 apenas 18% dos municípios brasileiros contavam com sistema de coleta seletiva. Como parte fundamental do processo de reciclagem temos a separação dos resíduos por sua constituição e composição, que ocorre desde o acondicionamento na fonte geradora. Embora os brasileiros tenham o lixo como o principal problema ambiental, afirmam que não realizam nenhuma ação para lidar com ele. O que pode justificar a baixa participação da população é a falta de acesso às informações, que muitas vezes são pouco compartilhadas por portais governamentais. O uso de TICs (Tecnologias da Informação e Comunicação) nessa situação se torna indispensável pois ele permite colaborar de maneira ativa na disseminação de informações e práticas educativas sobre meio ambiente. O projeto foi dividido nas seguintes etapas: pesquisa e planejamento, análise dos trabalhos relacionados, coleta de dados, levantamento dos requisitos, e modelagem do sistema. Através de um questionário de opinião pública aplicado a possíveis usuários, foram comprovadas as questões abordadas durante a pesquisa bibliográfica. A maior parte das pessoas diz separar os resíduos recicláveis e não recicláveis, mas que seriam necessárias outras ações para maior aproveitamento deles. Diante disso, esta pesquisa tem como principal objetivo desenvolver uma plataforma colaborativa para facilitar o acesso compartilhado à informação sobre pontos de entrega voluntária (PEVs), visando a participação social e o descarte correto de resíduos sólidos urbanos. Espera-se que através do uso do sistema seja possível a promoção de conscientização e interação da população com a coleta seletiva.', NULL, NULL, '2018-07-30 23:46:52', '2018-09-20 19:47:07', 8, 2, 6, 5, true, NULL, 0);
INSERT INTO public.projeto VALUES (77, '“OS AMIGOS QUE DISCUTEM MICROCOMPUTAçãO”: A REVISTA MICRO SISTEMAS E A DIVULGAçãO DA INFORMáTICA NO BRASIL', 'Os anos 1980 caracterizaram-se pela popularização dos microcomputadores, contribuindo para disseminar a Informática na sociedade. Autores como Philippe Breton e Manuel Castells destacaram que os micros foram idealizados como artefatos baratos e simples capazes de realizar as mais diversas tarefas, com maior autonomia, transferindo o poder dos grandes computadores para os lares, de modo a permitir o ingresso de novos usuários na sociedade de Informação. Como forma de divulgar essas novidades tecnológicas, surgiu a revista Micro Sistema criada em 1981 pela jornalista Alda Campos, a revista aspirou ser a principal porta voz da microinformática, acompanhando os primeiros modelos nacionais e incentivando a formação de uma comunidade de usuários. Desta forma, o objetivo de nossa pesquisa é analisar a revista Micro Sistemas em seus dois primeiros anos de existência – período de consolidação da Informática brasileira – de modo identificar como e quais valores eram disseminados a respeito da microinformática no país. Do ponto de vista metodológico, foram realizados o levantamento de 299 matérias e 129 propagandas nos dois primeiros anos da revista, a fim de identificar autores e ideias (através de textos e imagens) representativos para o campo da microinformática brasileira. Nesse sentido, o levantamento das matérias tem permitido perceber os micros como facilitadores e promotores de conhecimento, de diversão e da organização da vida social nas mais diferentes áreas da sociedade brasileira, como Educação e Saúde. Em linhas gerais, a pesquisa tem observado que a Micro Sistemas não se restringiu apenas como um meio para estimular o consumo de microcomputadores nacionais, mas procurou incentivar a participação dos leitores/usuários, reforçando uma visão otimista do papel tecnológico dos microcomputadores, como meios capazes de preparar os indivíduos para o futuro através do aprendizado de programação, produzindo seus softwares e compartilhando experiências.', NULL, NULL, '2018-08-08 15:24:28', '2018-09-20 19:47:07', 3, 2, 6, 5, true, NULL, 8.33125000000000071);
INSERT INTO public.projeto VALUES (92, 'O BRASIL NA SEGUNDA GUERRA MUNDIAL: A INVASÃO AO FRONT ITALIANO', 'A presente pesquisa aborda a representação midiática nacional da invasão ao front italiano, proeza da Força Expedicionária Brasileira sob comando Aliado, evento este ocorrido em julho de 1943 durante o governo de Vargas. Além do contexto de entrada na guerra, que envolve as negociações onde o Brasil alcançou alto poder de barganha por sua posição estratégica, também expõe da diplomacia ambígua até a formação da Força Expedicionária Brasileira, que materializou o pacto entre o Brasil e os EUA que já havia sido manifesto através da construção da siderúrgica e seus feitos em solo estrangeiro. Para a realização deste trabalho adotamos o seguinte problema de pesquisa: “como a imprensa nacional representou a participação brasileira na invasão ao front italiano?”. A escolha do tema foi instigada pela necessidade de analisar as discrepâncias e semelhanças entre os fatos, obtidos através da revisão bibliográfica, e os periódicos, principal fonte de informações da época. Objetiva-se compreender como a participação brasileira na Segunda Guerra Mundial foi representada pela imprensa do país, através da análise das edições dos jornais Diário de Notícias e do Correio da Manhã além de perceber como a imprensa brasileira noticiou o ataque ao front italiano, captar a visão da época através das informações que chegavam à população e traçar um paralelo com a falta de conhecimento do público contemporâneo sobre o assunto. Para o desenvolvimento desta pesquisa, utilizamo-nos metodologicamente da reflexão de Tania de Luca para a obtenção do discernimento de que apenas através de uma seleção rigorosa de periódicos e uma comparação com a ocorrência encontrada na revisão da bibliografia, é possível a sua utilização adequada como fonte e objeto de pesquisa.', NULL, NULL, '2018-08-09 13:40:48', '2018-09-20 19:47:07', 3, 2, 6, 5, true, NULL, 9.36785714285714199);
INSERT INTO public.projeto VALUES (156, 'EMMTEC - SISTEMA DE GERENCIAMENTO DE PRESENçA E DE AVALIAçõES DE EVENTO (IFCITEC)', 'O presente trabalho visa gerenciar as avaliações e o controle de presença dos participantes da Feira de Ciência e Inovação Tecnológica (IFCITEC). A feira conta com um determinado horário de credenciamento onde os participantes devem se identificar assinando seu nome em uma lista e retirando seu crachá de identificação e também conta com os avaliadores que avaliam cada trabalho através de um formulário online que por problemas na rede tinham que ser passados a limpo. As duas etapas são muito demoradas devido ao trabalho manual e no grande número de participantes. Com isso, o EMMTEC (Events Mobile Manager IFCITEC) foi desenvolvido para suprir essas necessidades através de um leitor que registra a presença do participante lendo o código QR localizado no crachá de identificação e também registra as fichas de avaliações online e offline, caso esteja sem rede. Para o desenvolvimento do trabalho, foi realizado o levantamento de requisitos necessários para a modelagem do sistema. Além disso, foi utilizada a UML (Unified Modeling Language) para a elaboração dos diagramas de caso de uso e de atividades. A fim avaliar o aplicativo será disponibilizado a um grupo de controle, formado por professores e alunos voluntários, que irão observar a identificação de falhas e verificar se o sistema cumpriu com os objetivos propostos. O trabalho se encontra em andamento, e como resultados parciais pode-se citar a implementação completa dos módulos de login e presença. Nestes módulos, o aplicativo verifica a função do usuário na área de login e o redireciona para sua respectiva seção. Além disso, a presença é registrada através da leitura de um código QR, com o horário também armazenado.', NULL, NULL, '2018-08-10 20:56:29', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 7, 9.29910714285714235);
INSERT INTO public.projeto VALUES (265, 'TEOR DE ETANOL NA GASOLINA', 'Conforme a Agência Nacional do Petróleo (ANP), a gasolina é uma mistura de hidrocarbonetos que apresenta, um percentual obrigatório de etanol (C 2 H 6 O) de 27% com tolerância de 1% para mais ou para menos. O álcool utilizado na gasolina tem a função de diminuir a emissão de monóxido de carbono (CO) ao meio ambiente e aumentar a octanagem da gasolina (resistência a detonação). Em contrapartida, o alto índice de etanol na gasolina pode trazer danos ao veículo, como a corrosão do sistema de injeção eletrônica, entre outros. A partir dessas informações, este projeto tem por objetivo determinar o teor de etanol presente na gasolina de diferentes postos de abastecimento de Canoas-RS, verificando se o combustível é adulterado ou não. Como metodologia, será realizado um experimento utilizando volumes iguais de água e de cada amostra de gasolina (50 mL cada) formando misturas em provetas de 100 mL. Após a agitação de cada mistura, será verificada a alteração dos volumes iniciais para a determinação da quantidade de etanol presente em cada amostra. Sabe-se que o etanol apresenta uma parte polar e outra apolar em sua molécula, e que sua parte apolar é atraída pelas moléculas que constituem a gasolina, formando ligações do tipo dipolo induzido. Ao colocar a gasolina em contato com a água, a parte polar da molécula de etanol, que possui o grupo OH, irá se ligar com a água formando ligações de hidrogênio, que por serem muito mais fortes do que ligações de dipolo induzido são capazes de separar o etanol da gasolina. Assim, o volume ocupado pela mistura água e etanol indicará a quantidade desse álcool presente em cada uma das amostras de gasolina, indicando se elas estão de acordo com a legislação vigente.', NULL, NULL, '2019-08-09 16:14:45', '2019-09-19 14:27:07', 4, 2, 7, 5, true, 9.5, 7.18928571428574958);
INSERT INTO public.projeto VALUES (374, 'MICROCRéDITO E O EMPODERAMENTO DAS MULHERES - UM ESTUDO DE CASO NO NORDESTE DO BRASIL', 'O microcrédito tem papel fundamental como ferramenta de inclusão financeira. Para muitos microempreendedores de comunidades carentes, ter acesso a microcrédito para ajudar a tocar o seu negócio pode significar uma das poucas oportunidades para sair da pobreza. O universo que pode ser atingido pelo microcrédito é, por sua vez, consideravelmente grande. No Brasil, estima-se que existam quase 50 milhões de microemprendedores, dos quais dois terços são mulheres. O objetivo deste trabalho é analisar, com rigor estatístico, o impacto do microcrédito para mulheres microempreendedoras em comparação aos homens, a partir de dados reais coletados no Nordeste do Brasil. Foram coletados dados de microempreendedores que tiveram acesso ao crédito (grupo de tratamento) e daqueles que não tiveram seu crédito aprovado (grupo de controle), para que fossem comparados. A nossa análise foi dividida em duas partes. Na Parte I, realizamos uma análise estatística descritiva, para organizar e interpretar os dados coletados. Na Parte II, utilizamos o método estatístico inferencial das Diferenças em Diferenças, para comparar os grupos de tratamento e de controle e validar se o acesso ao microcrédito efetivamente impactou o faturamento dos microempreendedores, sobretudo o das mulheres. Os resultados obtidos em nossas regressões multivariadas indicam que os negócios gerenciados por mulheres crescem mais do que os dos homens ao longo do tempo, depois de terem acesso a microcrédito. O crescimento anualizado do faturamento das mulheres foi significativamente maior do que o dos homens. Estes resultados mostram a relevância do público feminino no cenário de microempreendedorismo e destacam a importância de que sejam criadas políticas de microcrédito com foco nas mulheres microempreendedoras.', NULL, NULL, '2021-09-24 02:02:55', '2021-10-22 13:13:31', 5, 2, 9, 3, NULL, 7.875, NULL);
INSERT INTO public.projeto VALUES (113, 'PROGRAMA CAMPUS DA GENTE', 'O programa Campus da Gente foi criado para aproximar o interno do campus com a comunidade externa, possíveis futuros alunos do IFRS Campus Farroupilha, criando projetos que auxiliem essa aproximação, o que gera visibilidade para a instituição. É perceptível a necessidade do enraizamento do nome do Campus Farroupilha em nossa comunidade, assim como o esclarecimento sobre a instituição. A criação de ações que envolvam a comunidade externa de forma ativa é necessária para a criação de vínculos de pertencimento, o que facilita o conhecimento da instituição. O programa visa estimular a criatividade em diferentes áreas de conhecimento, oferecendo oficinas e projetos cujo objetivo é enriquecer a visão de mundo do participante e oportunizar aos estudantes aprimorar suas competências. Como objetivos específicos, o programa visa desenvolver e gerenciar projetos como o Núcleo de Comunicação, oficinas de artes, visitações de escolas no Campus gerando divulgação institucional e vice-versa, participar em Eventos locais e região, oferecer oficinas nas escolas do município assim como criar um intercâmbio cultural entre o IFRS e às diferentes escolas públicas da região, o que gera um reconhecimento da instituição pela comunidade em geral, atraindo mais alunos. A metodologia é baseada na criação e execução dos projetos e eventos citados anteriormente, coordenados por servidores com afinidade nos setores de comunicação e cultura, promovendo a troca de conhecimento entre os alunos, servidores e a comunidade externa, que participa de forma atuante não apenas como receptores da divulgação da instituição mas como parte do processo de desenvolvimento das ações do programa. O programa trabalha com a relação entre ensino e extensão, priorizando a troca de conhecimento entre ambas as partes envolvidas. É uma iniciativa necessária que promove o reconhecimento da instituição e suas ações no município e na região, o que gera um crescimento da instituição no meio acadêmico.', NULL, NULL, '2018-08-10 11:01:22', '2018-09-20 19:47:07', 5, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (168, 'R.A.G. - ROBô AUTôNOMO GUIA', 'Orientar-se sempre foi um dos anseios da humanidade, tanto para se localizar quanto para obter recursos que estejam próximos à sua localização. Infelizmente nem todas as pessoas têm a capacidade de se orientar com facilidade, como por exemplo, as PNE (Pessoas com Necessidades Especiais). Uma importante ferramenta para auxiliar na localização atualmente é o GPS (Sistema de Posicionamento Global), porém em algumas situações adversas como ambientes fechados (indoor), esse tipo de tecnologia pode apresentar um desempenho não satisfatório dependendo da precisão necessária. Entretanto, em algumas aplicações, estas dificuldades podem ser superadas com outras estratégias de localização. visto essas brechas nos sistemas de localização de maior precisão e com foco de auxiliar na locomoção de PNE, temos o intuito de ampliar as possibilidade de auxiliar estas pessoas, um sistema robótico autônomo será proposto para guiar PNE dentro de uma escola. Mais precisamente, será implementado um sistema de mapeamento através de faixas coloridas postas sob o chão, as quais o robô terá a capacidade de reconhecer e então auxiliar na mobilidade de pessoas com deficiência que desejam se deslocar pelo colégio, o robô atuará com certa semelhança a um cão guia porém com rotas pré determinadas e se necessário auxílios sonoros ao longo do caminho. A ideia é que este dispositivo esteja inicialmente na sua base, onde possa recarregar as suas baterias. Os blocos da escola possuirão dispositivos eletrônicos, nos quais as PNE poderão solicitar a presença do robô para que o mesmo as auxilie no deslocamento até outro local da instituição.', NULL, NULL, '2018-08-10 22:22:04', '2018-09-20 19:47:07', 7, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (271, 'FLUIDOS NãO NEWTONIANOS PARA REDUZIR BURACOS NAS ESTRADAS', 'Os buracos na estrada são um grande problema para a sociedade, por isso, resolvemos pesquisar uma solução possível para esse problema. O objetivo da pesquisa foi verificar se seria possível a utilização do fluido não newtoniano (FNN) para cobrir buracos em estradas de uma maneira provisória até o conserto definitivo. Inicialmente foi feito o preparo do FNN através de diferentes proporções de amido de milho e água. Testou-se as proporções de 1:2, 1:1 e 2:1 de amido de milho e água. Para avaliar a viabilidade de tapar um buraco com o FNN, foi executado um teste com uma bicicleta. As rodas passaram por um buraco contendo o FNN envolvido por uma película plástica e o comportamento do material foi observado. Além disso, foi feito um questionário para saber as opiniões das pessoas sobre o assunto. A amostra de FNN que se comportou de maneira adequada a finalidade pretendida nessa pesquisa foi a de proporção igual a 2:1 (amido: água). Foi possível preencher um buraco com FNN de maneira a permitir a passagem de uma bicicleta sem que fosse percebido o desnível no solo. Quanto às perguntas do formulário, evidenciamos que 96% das pessoas entrevistadas acredita que o problema de buracos em vias públicas é solucionado lentamente. Dessa forma, concluiu-se que o FNN pode ser usado sim para tapar buracos, pois aguenta bem a pressão, ele só precisa ser colocado em algum tecido ou lona forte.', NULL, NULL, '2019-08-09 17:59:31', '2019-09-19 14:23:04', 10, 3, 7, 5, true, 7.375, 8.625);
INSERT INTO public.projeto VALUES (209, 'EU APRENDO ME DIVERTINDO!', 'Neste trabalho, nosso objetivo é contribuir com a aprendizagem e estimular a curiosidade e a autoconfiança, proporcionando o desenvolvimento do pensamento, da concentração e da atenção dos alunos do ensino fundamental final, com o auxilio pedagógico de jogos relacionados ao conteúdo vigente da disciplina de ciências. Ao avaliar um baixo rendimento escolar e a desmotivação dos alunos, montou-se uma equipe para confeccionar e aplicar os jogos de ciências, como uma alternativa metodológica para estimular o aprendizado. Confeccionamos diferentes jogos de ciências que abrangem os conteúdos de 6º a 9º anos, estes foram aplicados após a explicação tradicional da professora, e como experimento escolhemos duas turmas para realizarmos um teste de conhecimento. Em uma turma aplicamos o teste sem realizar o jogo/brincadeira e em outra turma aplicamos o teste após aplicar o jogo/brincadeira. Os resultados demonstram que este é um método pedagógico totalmente eficaz, estimulando o crescimento do conhecimento dos alunos.', NULL, NULL, '2019-07-31 19:12:09', '2019-09-19 16:27:17', 10, 3, 7, 5, true, 7.5, 9.40000000000000036);
INSERT INTO public.projeto VALUES (237, 'VOLUNTARIAN - SISTEMA DE LOCALIZAçãO E AGENDAMENTO DE TRABALHO VOLUNTáRIO', 'Os moradores de rua sofrem com a vulnerabilidade social e ambiental, pois são pessoas em situação de extrema pobreza. Para o bem dessas pessoas, existem diversos grupos compostos por indivíduos que compartilham de um objetivo em comum, que é doar o seu tempo e dedicar os seus esforços em prol dos sem-teto. Dentro deste contexto surge a questão-problema: seria possível que um aplicativo pudesse contribuir com o auxílio a moradores de rua, tendo como foco o voluntariado? Este trabalho apresenta o desenvolvimento de uma aplicação de localização e agendamento de trabalho voluntário, denominada Voluntarian. O aplicativo, em fase de desenvolvimento, utiliza a plataforma Android e é decorrente de Trabalho de Conclusão de Curso Técnico em Informática para Internet, sendo projetado com o objetivo de ajudar os moradores de rua através do suporte aos grupos voluntários. Como forma de validar esta iniciativa foi aplicado um questionário a diversos destes grupos. O resultado da pesquisa evidencia algumas situações que prejudicam ambos os lados, tanto os voluntários como os sem-teto. Os participantes das ações beneficentes relatam terem uma certa dificuldade em encontrar os sem-teto que ainda não receberam ajuda. Com certa frequência os grupos se direcionam para locais onde os sem-teto já foram atendidos por outras pessoas, ao invés de se direcionarem para áreas mais carentes. O aplicativo, através do uso do agendamento de ações, evita, em tese, que situações desta natureza ocorram. Além disso, outras funcionalidades oferecidas, como chat e mapa permitem, em tese, gerar um número maior de atendimentos às pessoas necessitadas. Este trabalho apresenta o resultado do atual estágio de desenvolvimento do aplicativo. Após a conclusão do protótipo, está prevista a validação de suas funcionalidades através do uso por parte dos grupos voluntários que contribuíram com a pesquisa. Os resultados dos testes serão detalhados na monografia do trabalho de conclusão de curso.', NULL, NULL, '2019-08-08 09:06:25', '2019-09-19 15:32:23', 6, 2, 7, 5, true, 8.375, 9.47857142857144908);
INSERT INTO public.projeto VALUES (172, 'MINI BOBINA DE TESLA', 'O presente trabalho sugere a construção de uma Mini Bobina de Tesla. Equipamento que torna possível criar energia através de um campo eletromagnético , pois os componentes que compõem seu circuito causam transformações n a corrente elétrica e amplificam a tensão da mesma. Este projeto tem como escopo, estudar, se familiarizar e compreender o fenômeno do eletromagnetismo, o funcionamento e a compreensão de todos os componentes eletrônicos do equipamento proposto, além de entender como ocorrem as transformações de correntes elétricas, na pratica, além da teoria. Nikola Tesla, com suas interpretações inconvencionais da natureza, trouxe inúmeras inovações para humanidade e em especial na área de eletricidade. A análise da sua visão nos traz uma melhor compreensão de diversos tópicos da Engenharia Elétrica até então desconhecidos. Ao reproduzir um de seus experimentos, a Mini Bobina de Tesla, podemos evidenciar a simplicidade e genialidade do inventor nas interpretações propostas. Portanto, este trabalho apresenta os aspectos da vida de Nikola Tesla e a construção didática de uma Mini bobina de Tesla com o objetivo de instigar para refletir sobre o uso convencional das tecnologias que possuímos hoje. A diferença entre as boninas originais de tesla e a que iremos apresentar:A bobina de Tesla pode proporcionar o fenômeno de manipular o som por meio de faíscas emitidas pelo aparelho, desta forma, tornando possível reproduzir diferentes notas musicais com ela, logo construir uma Bobina de Tesla capaz de lançar faíscas com uma tensão maior de cem mil Volts. Conseguir ligar aparelhos eletrônicos sem que haja nenhum tipo de contato com alguma fonte de alimentação de energia. Apenas com as descargas da Bobina de Tesla, através do ar. Reproduzir musica a partir da variação controlada da tensão elétrica das faíscas, atingindo frequências de vibração desejadas.', NULL, NULL, '2018-08-10 22:50:13', '2018-09-20 19:47:07', 7, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (6, 'ASPECTOS METODOLÓGICOS ENVOLVENDO O ENSINO DE ASTRONOMIA', 'Os professores e acadêmicos do curso de Física, desenvolve um projeto na área de Astronomia, aprovado pelo Conselho Nacional de Desenvolvimento Científico e Tecnológico – CNPq em 2009, estendido até 2010, cuja atividade tem como objetivo divulgar as pesquisas relativas ao conceito nesta área e seus ramos de estudo; sua ordem histórica e cronológica; as maquetes dos sítios arqueológicos; as metodologias adequadas à realidade das escolas, usando-se de aparelhos e softwares já existentes; além da montagem de um planetário caseiro. Isso possibilita conforme salienta Heineck (1999) a aproximação dos professores e alunos das escolas, principalmente quanto à carência dos recursos didáticos especialmente no que diz respeito a aulas experimentais, envolvendo aparelhos sofisticados e de alto valor financeiro. Esta ação resgata a criatividade junto aos processos educacionais nesta área, ao trabalhar de forma experimental, tendo a participação dos alunos desde a confecção de aparelhos laboratoriais construídos com materiais alternativos. Os acadêmicos e educadores são das diferentes redes de ensino e de diferentes séries, o que permite a esta equipe desenvolver vários encontros desde 2008 até os dias de hoje, perpassando por mini cursos, seminários, semanas acadêmicas, encontros com professores tanto a nível regional como estadual.', NULL, NULL, '2018-07-23 11:20:24', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 3.125, NULL);
INSERT INTO public.projeto VALUES (136, 'CARRO ROBóTICO WIFI', 'O nosso projeto, visa integrar a mecânica com a eletrônica através do Arduino onde contando com uma placa esp8266 se comunicando com este via comunicação serial, para comunicação via wireless, será possível o controle à distância do carro, que por sua vez possuirá um braço robótico. Utilizaremos um Arduino MEGA para processar todos os dados, e retorna-los para o usuário. Temos como objetivo deste proeto, criar um veículo controlado pelo ser humano de modo simples e prático, via sinal wireless, que proporciona mover peças em um local de difícil acesso a este. O mesmo, vai consistir basicamente de uma base locomotora com quatro rodas e quatro motores DC, controlados por arduino através de uma ponte H, e um braço robótico de três eixos com uma garra, o qual será movido a partir de quatro servomotores, de aproximadamente 20 centímetros estendido, o braço conseguirá girar em um ângulo de 180° no eixo horizontal, sendo possível pegar um objeto leve, em relação ao carro. Este que será controlado por um dispositivo qualquer com interface Windows 10 ou Android, onde toda essa transferência de dados será feita através de uma placa esp 8266 NodeMCU, que possibilitara o controle do carro, para a sua alimentação utilizaremos oito baterias modelo 18650, com uma placa para realizar o carregamento da mesma de forma segura utilizando uma onte de corrente. Este é apenas uma protótipo, para um produto que pretendemos aperfeiçoa-los com sistemas de segurança e colocarmos no mercado tentando manter o melhor custo beneficio.', NULL, NULL, '2018-08-10 18:25:45', '2018-09-20 19:47:07', 7, 2, 6, 5, true, 7.875, 6.01249999999999929);
INSERT INTO public.projeto VALUES (104, 'A MUDANÇA DE CURSO TÉCNICO EM GESTÃO CULTURAL PARA TÉCNICO EM EVENTOS: UM PROCESSO DE FEMINIZAÇÃO NO INSTITUTO FEDERAL/CAMPUS SAPUCAIA DOS SUL', 'Este projeto tem como tema a predominância de mulheres atualmente no Curso Técnico em Eventos do Instituto Federal Campus Sapucaia do Sul. Tendo como abordagem central de pesquisa a mudança de terminalidade do Curso Técnico em Gestão Cultural para Técnico em Eventos. Sendo assim, buscamos investigar o processo de feminização dentro da área cursante através da nossa questão norteadora: “ Como o curso Técnico em Eventos é visto e/ou estereotipado por homens e mulheres ao substituir o Curso de Gestão Cultural no Instituto Federal Sul rio-grandense/Campus Sapucaia do Sul?”. Como justificativa, utilizamos a desigualdade de gênero presente, ao longo da história recente, no Instituto Federal Campus Sapucaia do Sul entre o Técnico em Gestão Cultural e Eventos. A razão de desenvolver este projeto surgiu a partir dos nosso questionamentos em relação a composição das turmas do curso que estudamos, devido ao predomínio de mulheres, corresponde a 89,09% do gênero feminino. Para então responder a nossa questão norteadora, temos como objetivo geral identificar e analisar o comparativo entre as percepções dos alunos concludentes do Técnico em Gestão Cultural e do Técnico em Eventos em relação aos papéis de gênero em suas composição Nosso projeto tem como característica uma pesquisa qualitativa de caráter exploratório. Utilizamos pesquisas bibliográficas para aprofundamento de conceitos e referencial teórico e caderno de campo como instrumento para registros de reflexões e análises. Com o intuito de alcançar os objetivos propostos e responder nossa questão norteadora utilizaremos a técnica de grupo de discussões com a aplicação de entrevistas semi-estruturadas. Nosso público será os concluintes do curso Técnico em Gestão Cultural e do Técnico em Eventos. Após a coleta desses dados, utilizaremos o método de análise de conteúdos em diálogo permanente com as pesquisas bibliográficas.', NULL, NULL, '2018-08-09 21:26:43', '2018-09-20 19:47:07', 3, 2, 6, 5, true, NULL, 0);
INSERT INTO public.projeto VALUES (367, 'HáBITOS ALIMENTARES DAS CRIANçAS', 'A ideia surgiu quando o nosso colega ficou doente, descobriu que estava com diabetes. Ali vimos que temos que cuidar de nossos hábitos alimentares e para as pessoas refletirem sobre a sua saúde e a quantidade de açúcar que consomem. A partir do estudo sobre alimentação saudável no guia alimentar da população brasileira, percebemos que não é necessário excluir os alimentos de nossa dieta, contudo é necessário moderar o consumo dos grupos alimentares. No entanto, em nossa escola percebemos que as crianças consomem muito refrigerantes e outros açúcares durante o recreio e poucas frutas são consumidas ou até mesmo ofertadas pelas famílias a essas crianças. Ao longo do projeto comparamos o custo de cardápios mais saudáveis e cardápios não saudáveis, onde constatamos que é mais barato comer de forma saudável. Visto isso, realizamos uma prática de degustação de suco natural com a opção de adoçar com açúcar mascavo. Após os alunos do 4o ano responderam a um questionário para confirmar a nossa hipótese sobre o consumo de refrigerante entre as crianças. O trabalho tem por finalidade conscientizar os pais e responsáveis sobre a importância de uma alimentação saudável para seus filhos, tendo compromisso na alimentação e saúde das crianças.', NULL, NULL, '2019-09-17 14:15:12', '2019-09-19 15:32:40', 10, 3, 7, 5, true, 7.5, 8.19999999999999929);
INSERT INTO public.projeto VALUES (340, 'A CONQUISTA DO VOTO FEMININO NO BRASIL', 'Nossa pesquisa aborda o tema do voto feminino no Brasil. O voto feminino no Brasil foi um marco na história da política brasileira e possui grande impacto devido à ascensão feminina no cenário político brasileiro. Tudo se inicia no século XVIII durante a Revolução Francesa, quando Olympe de Gouges começa a agir a favor da igualdade de gênero, propondo uma Declaração dos Direitos da Mulher e da Cidadã. No Brasil, uma das principais lutadoras dessa causa foi Bertha Lutz, fundadora da Liga para a Emancipação Intelectual Feminina, uma das bases do feminismo no Brasil. Com a Revolução de 1930, Getúlio Vargas visualizou um crescimento feminino muito grande no mercado de trabalho e enxergou possíveis novos atores para a vida pública. Apesar da importância deste tema, ele é pouco debatido atualmente, por isso nosso problema de pesquisa é “Como a imprensa brasileira representou a luta pela conquista do voto feminino no Brasil?”. O nosso objetivo geral com esta pesquisa é analisar a conquista do voto feminino no contexto histórico brasileiro através da imprensa e nossos objetivos específicos são compreender o processo da conquista do voto feminino e abordar o impacto feminino na política. Para o desenvolvimento da pesquisa, foram realizadas leituras e fichamentos de fontes secundárias como FAUSTO (2001); PRIORE (2012); PERROT (2007); MARQUES (2018); KARAWEJCZYK (2008) e estamos utilizando como fontes primárias de pesquisa os jornais Diário Carioca, Jornal do Brasil e Correio da Manhã, disponíveis na Hemeroteca Digital da Biblioteca Nacional. Nossos resultados parciais indicam que houve uma movimentação nos periódicos brasileiros em relação a este acontecimento devido ao início das manifestações feministas no Brasil e ao estudar esse processo, podemos compreender a luta e como os acontecimentos fora do país e as mudanças na economia influenciaram nessa mudança no quadro político brasileiro, além de termos a chance de visualizar a importância feminina na política atualmente.', NULL, NULL, '2019-08-10 23:35:50', '2019-09-19 14:30:06', 3, 2, 7, 5, true, 8.25, 9.18214285714284983);
INSERT INTO public.projeto VALUES (28, 'SAúDE MENTAL: PERSPECTIVAS DA JUVENTUDE', 'Apesar dos avanços relativos à maior informação e conscientização da comunidade a respeito da saúde mental, este conceito ainda é pouco debatido no âmbito escolar, o que gera desconhecimento dos alunos a respeito do que significa saúde mental e quais suas repercussões na vida da juventude. O conceito de saúde vem sofrendo uma série de transformações ao longo do tempo, motivo pelo qual pensamos a saúde mental através de diferentes fatores, tais como acesso à cultura, à educação de qualidade, moradia com condições mínimas de saneamento básico, entre outros. Sabe-se que a saúde mental exerce forte influência na vida das pessoas e de forma especial durante a juventude, já que esta consiste em uma etapa de transição entre a infância e a vida adulta. Neste sentido, entendemos ser fundamental o desenvolvimento de ações no sentido de conscientizar a sociedade sobre a importância da prevenção e promoção em saúde mental. Estratégias de prevenção e promoção em saúde mental são importantes ferramentas para produzir conscientização da população, minimizando o número de transtornos e promovendo maior qualidade de vida das pessoas. Uma das formas de possibilitar que isto aconteça pode ocorrer através da escola e por isto esta pesquisa está sendo elaborada; o principal objetivo do presente projeto é, ao conhecer a realidade de saúde mental dos alunos do Instituto Federal Sul-rio-grandense (IFSul), Campus Charqueadas, fomentar a conscientização da comunidade escolar sobre a importância da saúde mental e sua influência na qualidade de vida de todos nós.', NULL, NULL, '2018-08-01 20:00:03', '2018-09-20 19:47:07', 3, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (311, 'ADUBAçãO E CRESCIMENTO VEGETAL: UM ESTUDO COMPARATIVO', 'A qualidade do solo é um aspecto importante para a produtividade dos vegetais. Existem diversas formas de melhorar a fertilidade de um determinado local, podendo ser usada adubação química e também adubação orgânica. O objetivo do trabalho é verificar a influência dos fatores abióticos (nutrientes do solo) no desenvolvimento vegetal. Para isso, será verificado se há diferença entre um solo adubado e solo não adubado e também se há variação entre diferentes adubações (orgânica e química). A pesquisa está sendo desenvolvida na EMEF Sete de Setembro, em Canoas – RS, durante junho a agosto, com alunos sexto ano. Foram preparados três canteiros, sendo um deles sem tratamento com adubos (canteiro 1 – controle) e os outros dois receberam ou adubação orgânica (canteiro 2 – orgânico) ou química (canteiro 3 – químico). Foi escolhido um vegetal de fácil manejo (Raphanus raphanistrum), que se adequa às características climáticas e de solo. Preliminarmente foi utilizada para avaliar o crescimento da planta uma medida de altura do solo e, quando colhidas, será avaliado o tamanho da raiz. Até o momento, verificou-se diferença entre o controle e os demais, pelo crescimento médio de 4,93cm contra 7,54cm no canteiro 2 e 8,58cm no canteiro 3. Analisando os dois canteiros 2 e 3, pode-se perceber uma pequena diferença entre o adubo químico e o orgânico no crescimento, entretanto o adubo orgânico é mais econômico (pode ser feito em casa) e sustentável, já que reutiliza materiais que virariam lixo.', NULL, NULL, '2019-08-10 16:16:54', '2019-09-19 16:38:25', 10, 3, 7, 5, true, 8.125, 8.67500000000000071);
INSERT INTO public.projeto VALUES (234, 'SISTEMA HIDROPôNICO', 'Sistemas hidropônicos são utilizados para cultivo de plantas (por exemplo, hortênsias, verduras e outros vegetais), sem a presença de solo (terra, substrato sólido). As raízes das plantas são dispostas de forma a ficarem periodicamente submersas em água com nutrientes. O presente projeto tem como objetivo desenvolver um modelo de sistema hidropônico, no qual a água será reaproveitada. Nesse sistema será possível também monitorar e controlar o uso de substancias, assim melhorando a qualidade da produção e racionalizar a utilização de água e outros recursos, uma vez que o sistema proposto é fechado. O sistema será automatizado. Parâmetros do ambiente serão monitorados (por exemplo, temperatura e umidade do ar) e estratégias serão programadas para adequá-la aos ciclos de fluxo da água e quantidades de nutrientes em função das grandezas monitoradas.A metodologia de elaboração no projeto será em uma plataforma de Programação por Arduino, O Arduino é uma plataforma aonde podemos programar aspectos físicos como um led ligar e desligar. No projeto o Arduino Mega que será utilizado tem como finalidade controlar: a) O ciclo fechado do sistema através de sensores alto programáveis, as plantas sem a presença do solo terá outra metodologia através de irrigação nas plantas com água nutricional (água com nutrientes específicos para a plantação), essa irrigação feita através de um reservatório com água nutricional, aonde terá dentro dela uma bomba d&#39;água controlada pelo Arduino para ligar e desligar o sistema. Terá sensores de umidade, temperatura, luminosidade como finalidade melhor a qualidade da planta através de um controle no ambiente dela, tentando um ambiente agradável para ela. Dentro de um reservatório terá água com nutrientes e uma bomba d&#39;água que a intervalos programados será acionada por 15 minutos, nesses 15 minutos a água do reservatório passará por uma tubulação em forma de ‘S&#39; e voltará para o reservatorio.', NULL, NULL, '2019-08-07 17:25:17', '2019-09-17 16:12:00', 8, 2, 7, 2, NULL, 6.875, NULL);
INSERT INTO public.projeto VALUES (339, 'DOENçAS PSICOSSOMáTICAS: DA EMOçãO à LESãO', 'O corpo e a mente são uma unidade, então se o emocional de um indivíduo não vai bem, ele pode desenvolver as chamadas Doenças Psicossomáticas, ou seja, um conjunto de transtornos físicos que aparentemente não há uma explicação médica, pois as dores sem causa aparente, surgem sem nenhuma razão conhecida. Tendo em vista que a sua causa não é física, ela pode ser de ordem emocional, ou seja, provocada pela própria mente humana. Então, o presente projeto tem por objetivo trazer ao conhecimento da comunidade escolar o que são as doenças psicossomáticas, apresentar as causas das destas doenças, ajudar as pessoas a compreender e reconhecer os sintomas de uma Doença Psicossomática para uma procura de tratamento adequado, expor os possíveis tratamentos disponíveis. Após a definição dos objetivos, foram realizadas pesquisas bibliográficas, coleta de dados através de enquete via Instagram que contou com a participação de setenta e três pessoas e a confecção de um mini-livro (informativo). Resumidamente, foi verificado que: O emocional pode causar muitos problemas à saúde; É necessária uma percepção orientada à importância do controle das emoções humanas; Há um grande percentual de indivíduos que desconhecem e/ou não identificam os possíveis indícios de um transtorno psicossomático.', NULL, NULL, '2019-08-10 23:19:31', '2019-09-19 11:26:39', 11, 3, 7, 5, true, 7.875, 9.625);
INSERT INTO public.projeto VALUES (325, 'O USO DAS TECNLOGIAS DIGITAIS DENTRO DOS ESPAçOS EDUCATIVOS DO ENSINO FUNDAMENTAL', 'O presente trabalho reflete sobre, o uso das tecnologias em sala de aula no Ensino Fundamental a partir da análise da experiência. Trata-se de um estudo de caso que evidencia como a prática docente usando as tecnologias de comunicação (celulares) pode facilitar o processo de ensino/aprendizagem. O exercício analítico buscou identificar aqueles elementos que viabilizam o aprendizado e proporcionam ao aluno aulas mais dinâmicas de modo a ajudá-lo a compreender melhor os conteúdos e a refletir sobre os problemas apresentados. Chegamos à conclusão que o uso dos recursos tecnológicos como os celulares ao estarem disponíveis em sala de aula e de fácil acessibilidade/portabilidade pelos alunos podem auxiliar no seu aprendizado, apesar do senso comum dizer que eles dificultam o fazer docente em sala de aula.', NULL, NULL, '2019-08-10 20:30:05', '2019-09-17 16:12:00', 10, 3, 7, 2, NULL, 4.75, NULL);
INSERT INTO public.projeto VALUES (355, 'O CIENTIFICISMO NO DISCURSO POPULAR: O CASO DA VACINA NA MíDIA', 'Dizer que as vacinas fazem mal à saúde e que determinadas fé a desacreditam é algo bastante comum ainda hoje. Além de determinados discursos religiosos contrários ao uso da vacina serem veiculados nas suas práticas e rituais e conversas informais acerca do assunto, há também discursos contrários ao uso da vacina divulgados em rede sociais, denominados fakenews. Este trabalho tem o objetivo de desmistificar os mitos relacionados ao uso das vacinas a partir de conhecimentos provados pela Ciência. Para isso, fez-se uma revisão bibliográfica acerca de eventos históricos que mostraram movimentos de repúdio às vacinas e buscas em notícias publicadas em redes sociais e comentários de seguidores acerca do tema. Após, foram aplicados questionários com discentes de quatro turmas de 6º e duas turmas de 7º ano da Escola. Com base nas respostas, foram elaboradas duas palestras para mostrar o que é fakenews e suas consequências na formação de opinião sobre a vacina com as mesmas turmas citadas e o que a Ciência exprime sobre o assunto. Espera-se que a repercussão das palestras rompa com os mitos criados sobre o uso da vacina e facilite uma abertura à racionalidade na qual a Ciência opera.', NULL, NULL, '2019-08-13 22:12:25', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 5.125, NULL);
INSERT INTO public.projeto VALUES (346, 'O CORANTE CARAMELO IV NA ALIMENTAçãO', 'O consumo de alimentos industrializados, como refrigerantes é cada vez mais frequente entre a população brasileira. Um dos principais constituintes do refrigerante é o corante Caramelo IV, entretanto, a OMS inseriu um de seus subprodutos na lista de substâncias possivelmente causadoras de câncer. O objetivo deste trabalho foi pesquisar os malefícios do consumo de refrigerante, especialmente do Caramelo IV, bem como demonstrar a presença do mesmo na bebida. Inicialmente foi realizada uma pesquisa bibliográfica, para obter informações sobre o Caramelo IV. Então para avaliar o consumo da bebida, foram entrevistadas 143 pessoas através do aplicativo Google formulários. Por fim foi realizado um experimento, no Laboratório de Química do Colégio Dom Feliciano, onde colocou-se 300 ml de Coca-Cola em um copo de Becker de 500 ml e aquecido por 1 h e 30 min. A pesquisa bibliográfica revelou que em grande concentração, o caramelo IV pode levar ao surgimento de alguns tipos de câncer e osteoporose. Cerca de 15% das pessoas entrevistadas consomem refrigerante regularmente, além disso 74% relatam conhecer pessoas que dão refrigerante a crianças pequenas. A experiência mostrou que a Coca-Cola apresenta uma grande quantidade de componentes que não volatilizaram. Concluímos que o Caramelo IV está presente em grandes quantidades no refrigerante, além disso, o corante traz diversos malefícios à saúde. O consumo de refrigerante pela população foi outra constatação preocupante dessa pesquisa.', NULL, NULL, '2019-08-11 20:23:52', '2019-09-19 16:49:09', 10, 3, 7, 5, true, 7.75, 9.91249999999999964);
INSERT INTO public.projeto VALUES (91, 'A INFLUÊNCIA DO ILUMINISMO NA CONSTITUIÇÃO BRASILEIRA DE 1988', 'A presente pesquisa foi construída a partir de um trabalho em sala de aula em que o professor solicitou uma reflexão sobre o tema.O iluminismo foi um movimento intelectual surgido na Europa, durante o século XVIII, responsável pela introdução de novas ideias políticas, econômicas e sociais que permitiu a superação das monarquias absolutistas (antigo regime) em novos regimes políticos, em especial, a concepção da regulamentação do poder, por exemplo em Monarquias Parlamentares constitucionais e Repúblicas. Abandona-se a concepção de súdito e introduz o conceito de cidadão, vinculado a direitos e deveres, agora escritos num documento formal, por exemplo, aquilo que Rousseau denominou de Contrato Social. As ideias do iluminismo, liberdade, igualdade e fraternidade, por exemplo, acabaram por resumir a Revolução Francesa de 1789. O objetivo do presente trabalho será a apresentação das ideias dos principais pensadores iluministas do século XVIII e relacioná-las com a Constituição Brasileira de 1988, conhecida como Constituição Cidadã, tendo em vista a superação do período autoritário da ditatura militar. A pesquisa será feita pelo método comparativo entre as ideias iluministas em correspondência aos artigos da Constituição Brasileira de 1988.', NULL, NULL, '2018-08-09 12:53:12', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, 6.5, NULL);
INSERT INTO public.projeto VALUES (187, 'REGROUND', 'O projeto ReGround apresenta o estudo da aplicação de pó de rocha como remineralizador em solos pela aplicação da técnica de rochagem. A justificativa para isso é que segundo Ribeiro (2016), necessita-se reduzir o esgotamento das fontes não renováveis, e para isso, devemos usufruir de novos processos produtivos como a produção orgânica, associado a técnicas que impactem menos no meio ambiente. Assim como, a produção de rochas ornamentais tem grande importância nesse processo, já que implica na geração excessiva de 800 mil toneladas de resíduos por ano, que mostram a necessidade de um descarte mais adequado do que a simples deposição em aterros à céus abertos. Sabendo disso, os objetivos do projeto são realizar análises de caracterização do pó de rocha e conceder uma investigação do solo utilizado para a aplicação da experimentação. A pesquisa desenvolve-se primeiramente pela coleta do pó de rocha e do solo, para em seguida a aplicação dos rejeitos no solo coletado. Fora adotado a referência de 1,5ton/ha e 3,0ton/ha de aplicação, que justifica o poder da correção da acidez do solo pela aplicação do pó de rocha. Para a verificação da ação de remineralizador, os solos foram submetidos à análises químicas e físico-químicas, com o intuito de ter conhecimento da quantidade de nutrientes disponibilizado e da quantidade de compostos orgânicos e moléculas. Já se sabe que , até o presente momento da pesquisa, o pó de rocha utilizado para aplicação é dotado de nutrientes como ferro, potássio, nitrogênio, etc, que contribuem positivamente para a correção da acidez do solo e para a fertilidade do mesmo, já que influenciam na troca de íons e na fixação de outros nutrientes; e possui pH de 8, apresentando-se como uma solução básica. No que diz respeito aos resultados do solo utilizado para o estudo, têm se conhecimento de que ele apresenta baixa quantidade de matéria orgânica, umidade aparente de 5% e pH de 5,8.', NULL, NULL, '2018-08-12 21:46:04', '2018-09-20 19:47:07', 4, 2, 6, 5, true, 9.125, 9.9375);
INSERT INTO public.projeto VALUES (66, 'SALGADINHO SAUDáVEL FEITO A PARTIR DE SEMENTE DE ABóBORA', 'A temática abordada foi escolhida por ter grande relevância social, uma vez que é necessário a pauta dos hábitos alimentares especialmente entre crianças e jovens. O objetivo dessa pesquisa foi a elaboração de um salgadinho saudável a partir do aproveitamento da semente de abóbora. Partindo da leitura de artigos científicos, foi elaborada uma receita para preparo do alimento. A nutricionista Cristiane Paim prestou auxílio técnico para a obtenção da receita final do salgadinho. A partir da Palestra da Luciana Ayer sobre a relação entre nutrição e cérebro, percebeu-se a importância da alimentação para adequado funcionamento do corpo humano. Os testes executados ao longo do projeto, motivaram a construção de um aplicativo para celular, que reunirá diversas receitas nutritivas com o reaproveitamento de outros subprodutos, como cascas de vegetais. Essa última etapa da pesquisa ainda está em execução. Concluímos que, criar métodos de aproveitamento desses materiais é dar um pequeno passo para a mudança da tão comum prática do desperdício de alimentos, além de aumentar a conscientização para hábitos saudáveis.', NULL, NULL, '2018-08-07 15:39:40', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 6.25, NULL);
INSERT INTO public.projeto VALUES (308, 'AAMAUT - APLICAÇÃO DE AUXÍLIO AO ENSINO DE MATEMÁTICA PARA AUTISTAS', 'No contexto atual da tecnologia quase tudo é possível de se realizar através de uma tela de computador, celular ou tablet. Na realidade que as crianças crescem hoje, viver sem tecnologias beira o impossível, o que gera uma facilidade na utilização dessa tecnologia para aprendizado. De acordo com a pesquisa TIC ​Kids online Brasil, “Usar a Internet todos os dias é um hábito comum a 81% das crianças e adolescentes brasileiros que possuem acesso à rede” (TIC KIDS ONLINE BRASIL, 2013). Isso não é diferente com crianças portadoras do transtorno do espectro autista (TEA ). A maioria dos indivíduos portadores do TEA possuem dificuldades das mais variadas para aprendizagem, por isso seria interessante aliar o uso da tecnologia - de maneira adaptada - para auxiliar na aprendizagem dessas crianças. O uso em excesso de estímulos em sites/aplicativos usados atualmente para ensino infantil é um problema frequente, principalmente, para crianças autistas, já que gera diversos estímulos que acabam por tirar o foco do indivíduo no conteúdo a ser aprendido. Tendo em vista as características apontadas acima, pretende-se, implementar uma aplicação ​web ​ que visa, auxiliar na aprendizagem de matemática para autistas. Para este público, é importante que o ​software centralize a atenção no que deve ser aprendido, diminuindo estímulos como excesso de cores, sons e movimentos. Procura-se, com isso, aumentar o nível de concentração e foco do usuário durante o período de estudo. Para desenvolvimento do projeto, serão realizadas pesquisas com profissionais da área como terapeutas ocupacionais, professores, pedagogas e pais, para tal, será utilizado também um questionário, solicitando respostas destes profissionais e pais.', NULL, NULL, '2019-08-10 15:15:10', '2019-09-17 16:12:00', 6, 2, 7, 2, NULL, 5.75, NULL);
INSERT INTO public.projeto VALUES (65, 'EDUCAçãO FINANCEIRA: UMA ABORDAGEM PARA O PúBLICO JOVEM', 'A educação financeira é um assunto pouco discutido pelos brasileiros no seu cotidiano. O presente projeto foi motivado a partir da reflexão acerca da importância desse tema e o impacto de maus hábitos de consumo na vida cotidiana das pessoas. Objetivo da pesquisa é traçar um perfil do comportamento financeiro dos estudantes do 1º ano do Ensino Médio do Colégio Dom Feliciano de Gravataí e com a análise dos dados elaborar um minicurso sobre educação financeira focado no público jovem. Iniciamos nossa pesquisa com uma pergunta: Os alunos do ensino médio então preparados para ter uma vida financeira saudável na vida adulta? Nossa hipótese foi que não eles não estão. Partindo disso desenvolvemos um questionário e aplicamos com os alunos do 1º ano do ensino médio e a partir desse questionário criamos gráficos para melhorar a visibilidade dos nossos resultados. Através de entrevistas com os participantes, percebemos também que os pais não orientam seus filhos adequadamente para que eles aprendam como lidar com o dinheiro. Decidimos fazer um curso no Moodle. O material visa auxiliar os alunos no início de suas vidas financeiras. O nosso curso foi pensado para que o processo de aprendizagem ao decorrer dele não fosse entediante, portanto, decidimos fazer 5 módulos que apresentariam ao final um modo interativo de testar o que foi aprendido pelos alunos. A abordagem do treinamento contemplou material escrito, vídeo aulas, simuladores e testes, nos quais apresentamos situações hipotéticas e avaliamos a tomada de decisão dos adolescentes. Concluímos que os jovens não fazem planos a longo prazo. Por isso, por meio de nossa pesquisa pretendemos contribuir para a economia do país. Desejamos contribuir para o aumento da reflexão acerca do tema, para que os jovens possam se conscientizar se tornando adultos menos endividados e com um maior planejamento financeiro de curto, médio e longo prazos, pois com a educação financeira.', NULL, NULL, '2018-08-07 15:22:35', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 9.75, 2.99374999999999991);
INSERT INTO public.projeto VALUES (285, 'PHARMACAR- SISTEMA AUTOMATIZADO DE DISTRIBUIÇÃO DE MEDICAMENTOS EM AMBIENTE HOSPITALAR', 'No Brasil e no mundo existem diversos casos de erros de medicação durante os tratamentos. Mesmo na presença de dupla checagem e outras estratégias aplicadas pelos profissionais. Muitos medicamentos são trocados no momento da distribuição para os leitos, chegando indevidamente aos pacientes. Este erro pode causar agravos severos no quadro clínico do paciente. Devido a falhas humanas pode-se acarretar em problemas maiores tanto para o paciente quanto ao próprio hospital. Pensando em uma solução que auxilie a diminuição dos erros de medicação, foi gerado o sistema automatizado, chamado Pharmacar, de entregas que visa realizar a distribuição de medicamentos corretamente aos leitos. Este pode diminuir conflitos, custos e aumentar a produtividade e rendimento dos profissionais da área, garantindo qualidade de serviço e atendimento. O funcionamento do Pharmacar é a programação feita por computador ou diretamente no Arduino, tendo como ponto de partida a farmácia interna, onde ele sai para o seu deslocamento em um trilho fixado na parede, que passará na parte superior das portas dos leitos, sendo automatizado para despejar os medicamentos corretos juntamente com a prescrição médica. Os medicamentos são entregues em caixas fixadas nas paredes dos respectivos leitos e somente pessoas autorizadas tem acesso aos medicamentos. Existindo esse sistema em um hospital faz com que possibilite um melhor aproveitamento de recursos humanos/técnicos dentro da unidade hospitalar ao realizar uma tarefa simples, sendo ela o transporte de um medicamento da farmácia do hospital até o leito, evitando desperdício de tempo, dinheiro e sobrecarga de trabalho. Dispondo deste projeto nas instalações do hospital, possibilita que a equipe responsável pelo tratamento médico possa trabalhar em outra área exercendo com mais êxito e tempo outras funções complexas em que se é necessário mais atenção.', NULL, NULL, '2019-08-09 21:57:19', '2019-09-17 16:12:00', 7, 2, 7, 2, NULL, 6.875, NULL);
INSERT INTO public.projeto VALUES (287, 'MÉTODO LÚDICO DE APRENDIZAGEM PARA DEFICIENTES INTELECTUAIS', 'No Brasil, as pessoas portadoras de deficiência intelectual estão cada vez mais, sendo exclusas da sociedade competitiva, e em um país que possui 45 milhões de deficientes declarados, mas que sua grande maioria não consegue se assegurar em autonomia e nem sequer envolver-se na sociedade. Ao fazer uma análise sobre isso foi pensado um problema norteador para traçar o direcionamento do projeto, que ficou definido em: “É possível criar um método de aprendizagem, através de um jogo lúdico e interativo, que auxiliem na autonomia de pessoas com deficiência intelectual em suas rotinas diárias e possibilite que eles sejam capazes de desempenhar determinada função dentro de um supermercado?”. Frente a este problema, o principal objetivo é desenvolver um método lúdico e interativo que seja capaz de auxiliar na construção do autogoverno de deficientes intelectuais, visando melhora em sua qualidade de vida e envolvimento em relação ao mercado de trabalho. Para alcançar esta atividade lúdica, será elaborado um questionário semiestruturado com portadores de deficiência intelectual, que ocorrerá como uma conversa interativa, para retirar informações relacionadas com o objetivo primordial. A pesquisa será adotada na Escola Municipal de Ensino Fundamental Sete de Setembro com perguntas abertas, para que os alunos que possuem a deficiência intelectual não se sintam constrangidos com excesso de formalidade, e para que os entrevistados possam interagir e fluir com o decorrer da entrevista. Após a coleta dos dados obtidos, que serão principalmente para saber suas presunções sobre o mercado de trabalho, os dados serão representados em forma de gráficos, que mostrarão de maneira simplificada as informações recolhidas. Com os gráficos em mãos será possível realizar a criação do tabuleiro lúdico, que será feito com materiais eletrônicos de baixa tensão em uma estrutura segura.', NULL, NULL, '2019-08-09 22:19:28', '2019-09-19 17:12:11', 5, 2, 7, 5, true, 8.5, 9.71071428571429962);
INSERT INTO public.projeto VALUES (281, 'COMO OCORRE A GRAVIDADE', 'A gravidade é um assunto que nos interessa porque está presente no nosso cotidiano e pode ser percebida brinquedos de parque de diversão. Por isso, o objetivo dessa pesquisa é entender como que ocorre a gravidade e saber o interesse das pessoas sobre este assunto. Fizemos uma pesquisa bibliográfica em sites na internet para responder as perguntas: “Como ocorre a gravidade?”, “Quais são os efeitos da gravidade?”, “Se a gravidade é a mesma, porque uma pena cai mais lentamente que uma pedra de cima de um edifício?”. Descobrimos que a gravidade é ocorre pela força que atrai dois corpos, um em direção ao outro. Quanto maior a massa de um objeto, mais forte sua atração gravitacional. Por causa da gravidade as maçãs caem em direção ao solo, e os planetas do nosso sistema orbitam o Sol. Porque um dos corpos sofre maior resistência do ar do que o outro. A partir do que aprendemos fizemos um experimento usando uma baixa de papelão grande para observar a queda de um pedaço de algodão e uma pedra. Conseguimos relacionar o que observamos com o que ocorre quando alguém voa de asa delta. A resistência do ar na asa faz com que as pessoas planem no ar. Já ocorre em uma montanha russa é diferente, é similar o que ocorre quando soltamos a pedra. O carrinho desce pelos trilhos acelerando e em alta velocidade. Depois de pesquisarmos, concluímos, que a gravidade atrai os corpos em direção a terra, porém a forma com que eles irão cair depende da aerodinâmica do sólido.', NULL, NULL, '2019-08-09 20:07:11', '2019-09-17 16:12:00', 10, 3, 7, 2, NULL, 5.625, NULL);
INSERT INTO public.projeto VALUES (365, 'CONSCIêNCIA AMBIENTAL NãO é TUDO: CANOENSES, é PRECISO ATITUDE!', 'A ausência de consciência ambiental por parte da população em relação ao descarte de materiais, sistemas ineficientes de coleta de lixo, mau uso do plástico e descaso para com a reciclagem vêm a acarretar problemas como um elevado índice de poluição. Como exemplo, têm-se as enchentes que poderiam ser evitadas com pequenas mudanças de hábitos. Este trabalho consiste em uma pesquisa com uma parcela de pessoas de diferentes faixas etárias e níveis de escolaridade. Os dados serão coletados no Parque Getúlio Vargas (Canoas/RS), em agosto de 2019, com cerca de 100 entrevistas. OBJETIVO: mostrar ao público que o descuido ambiental pode acarretar problemas. Mudanças urgentes são necessárias na tentativa de torná-los agentes críticos e multiplicadores, abrindo possibilidades de trazer transformações, melhorando sua qualidade de vida e das gerações futuras. METODOLOGIA: A pesquisa será quantitativa. Aplicar-se-á um questionário anônimo e voluntário estruturado por oito perguntas, com a finalidade de avaliar o conhecimento do público a respeito de suas próprias atitudes; criar uma apresentação de descuido ambiental; promover alertas sobre as maneiras de evitar enchentes e danos ao ambiente. PROBLEMA: falta de consciência da população de Canoas em relação aos cuidados com o meio ambiente e ao correto descarte de lixo. Resultados: os dados serão analisados e tabulados com auxílio do Excel. Palavras-chave: conscientização, enchentes, mudanças de hábitos, reciclagem e atitude.', NULL, NULL, '2019-09-17 14:03:01', '2019-09-19 16:47:57', 10, 3, 7, 5, true, 7.5, 9.125);
INSERT INTO public.projeto VALUES (71, 'AQUAPONIA : UMA SOLUÇÃO ECONÔMICA E SUSTENTÁVEL PARA A PRODUÇÃO DE ALIMENTOS', 'Aquaponia é um sistema de cultivo que une o cultivo de peixes e o cultivo de plantas. Esse sistema resolve um problema da piscicultura solucionando um problema da hidroponia. Basta alimentar os peixes que o ciclo se fecha. O excremento produzido pelos peixes é rico em nutrientes que alimentam as plantas que por sua vez filtram a água para o peixe. Os dois sistemas estão fisicamente separados e são interligados por um sistema de bombeamento que leva a água com fezes de peixe para o sistema hidropônico e devolve a água limpa do sistema hidropônico para o tanque com os peixes. O objetivo do trabalho é mostrar para a população, de um modo simples e prático, como montar um sistema caseiro de aquaponia e as vantagens desse sistema em larga escala. Ressaltando ainda, que a economia de água chega a 90% em relação à agricultura convencional e o espaço utilizado para produzir, por exemplo, 50 toneladas de alface na agricultura convencional, pode-se produzir 300 toneladas no sistema de aquaponia.', NULL, NULL, '2018-08-07 19:26:20', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (60, 'BOBINA TESLA', 'Nikola Tesla foi um importante cientista no século XX, cuja intenção era melhorar ou facilitar a vida da humanidade. Posteriormente seu brilhantismo foi esquecido por muitos e por outros foi considerado um maluco. Hoje é considerado um gênio e suas invenções nos ajudaram a ter as comodidades elétricas modernas como os motores dos eletrodomésticos, dos carros e os controles remotos. Tesla imaginava construir uma bobina gigante e transmitir energia para toda a terra. As pessoas só precisariam recebê-la e usá-la. Fizemos um modelo de bobina de Tesla, o qual apresentamos a seguir. Nosso trabalho começou a partir de um vídeo na Internet. Depois, fizemos inúmeras pesquisas sobre este assunto. Para realizar este experimento utilizamos: fios de cobre, bateria, conector, resistor, lâmpada, transistor, cano de PVC, caixa de MDF e solda elétrica. Com ajuda de adultos construímos uma bobina de Tesla. Após fazermos nossa bobina comprovamos que é possível transmitir eletricidade através do ar. Fato demonstrado através do acendimento da lâmpada sem que haja contato da mesma com a bobina. O funcionamento de uma bobina de Tesla é, resumidamente: uma combinação de alta frequência e alta tensão capaz de ionizar o ar e se propagar como faíscas. Concluímos através do experimento, a veracidade da teoria de Nikola Tesla. Percebemos que este inventor não obteve, na sua época, o devido reconhecimento.', NULL, NULL, '2018-08-07 14:47:51', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (163, 'A CONSCIÊNCIA ECOLÓGICA DOS NASCIDOS NA ERA DIGITAL UM PERFIL DA EMEF PROF DR RUI CIRNE LIMA', 'A investigação qualitativa e quantitativa problematiza a influência das tecnologias no pensamento e nas ações cotidianas dos estudantes e dos educadores (professores e funcionários) da escola relacionando as mesmas com as questões ecológicas ligadas da rotina escolar. Ela surgiu da necessidade de entender as mudanças que as tecnologias estão produzindo na consciência dos estudantes reduzindo o interesse deles na participação de atividades de cunho ecológico como revitalização da horta escolar. O estudo do livro de PALFREY, John “Nascidos na era digital” revelou elementos para a produção de questionários e entrevistas para os estudantes alfabetizados e educadores da escola. Ao tabular e colocá-las em gráficos, chegamos ao perfil dos estudantes analisando as diferenças etárias e de gênero em relação as hipóteses. O objetivo principal é conseguir mudar a abordagem das reflexões e ações em prol do ambiente escolar e do meio ambiente para ter maior adesão, eficácia e eficiência nas mesmas. Os resultados parciais apontam que mesmo em situação de periferia, as crianças e jovens estão sendo influenciados pelas tecnologias, especialmente pela INTERNET, contudo essa influência maior é nos meninos de maior faixa etária. Os educadores também recebem essa influência, porém os de faixa etária mais elevadas são de fato imigrantes digitais e tem resistência, pois não dispõe de facilidade para utilizá-las em aula preferindo permanecer no porto seguro das pedagogias mais tradicionais.', NULL, NULL, '2018-08-10 21:31:26', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, 7.625, NULL);
INSERT INTO public.projeto VALUES (216, 'NOSSA IDENTIDADE', 'O projeto consiste no desenvolvimento de pesquisa e na proposição de atividades interativas para turmas de 4° e 5° anos da Escola Municipal Sete de Setembro, em Canoas. Percebendo a dificuldade dos estudantes que frequentam a sala de recursos em conhecer sua própria história e que a construção de identidade é gradativa e se dá por meio de interações do indivíduo com seu meio social, surgiu a ideia de organizar estratégias que aproximem a realidade dos estudantes e suas trajetórias de vida, proporcionando um ambiente rico em interações, que acolha as particularidades de cada indivíduo, promovendo o reconhecimento e o respeito às diversidades. O projeto tem como objetivo Verificar o conhecimento dos estudantes sobre sua identidade, Quais são suas vivências e propor atividades interativas que despertem a curiosidade e o interesse sobre a história de cada um. A metodologia do trabalho é composta pelas seguintes etapas: Planejamento, construção dos objetivos, pesquisa de campo, Levantamento e análise de dados, construção da dinâmica de trabalho, experimento e conclusão. As análises feitas até o momento permitem afirmar que é possível criar estratégias através de atividades lúdicas, que promovam a interação e o sentido de pertencimento de grupo, além do fato que o contato dos alunos com uma aplicação de projeto serve também como incentivo à pesquisa. Os resultados serão verificados durante o desenvolvimento e aplicação do projeto, através da coleta e análise de dados', NULL, NULL, '2019-08-06 08:21:07', '2019-09-19 16:46:33', 12, 3, 7, 5, true, 8.625, 9.67500000000000071);
INSERT INTO public.projeto VALUES (110, 'CADEIRA UNIVERSITáRIA FLEX AMBIDESTRA', 'Todo indivíduo que possui maior habilidade em utilizar a mão esquerda para realizar tarefas diárias é dito canhoto. Os canhotos já sofreram muitos preconceitos e perseguições ao longo da história e muitas adversidades ainda são enfrentadas por eles nos dias atuais. No câmpus, há aproximadamente 30 cadeiras universitárias disponíveis para uso, todas para destros. Isso é um grande transtorno para alguns alunos que precisam adaptar-se, além disso, não seria conveniente para solucionar o problema comprar cadeiras para canhotos, pois não há como calcular a quantidade ideal a ser adquirida já que não é possível ter uma estimativa precisa do número de alunos canhotos que virão a utilizá-las. Nosso projeto busca a adaptação desse tipo de cadeira, promovendo a inclusão e o bem estar destes alunos, além de proporcionar melhor uso das cadeiras universitárias. A adaptação consiste na substituição do braço fixo da cadeira por um braço móvel intercambiável construído pelo grupo. Produziu-se o primeiro protótipo com tubos PVC e a prancheta foi confeccionada com MDF, ambos baseados em esboços desenvolvidos a partir de conhecimentos prévios em desenhos técnicos em software. Com isso, foi aprovado o conceito do projeto e atestada sua viabilidade e a solução do problema, mesmo sendo necessária a realização de algumas correções pontuais no protótipo. Está planejado para o segundo semestre a construção do protótipo final, que será construído com barras de aço e levando em consideração conhecimentos da mecânica como fixações adequadas e evitando esforços mecânicos desnecessários. Os modelamentos, detalhamentos e montagem em software do protótipo final foram concluídos, bem como a lista de materiais que serão necessários.', NULL, NULL, '2018-08-10 09:58:41', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 9.65357142857142847);
INSERT INTO public.projeto VALUES (89, 'DEPRESSÃO NA ADOLESCÊNCIA: UM TEMA A SER AMPLIADO', 'A depressão é uma doença que, embora seja considerada perfunctória pela maioria das pessoas, poderá trazer graves consequências para o indivíduo, muitas vezes fatais. A doença atinge qualquer pessoa e de várias idades, porém, os casos em adolescentes aumentam a cada ano. O objetivo desse estudo é mostrar que a depressão é uma doença séria, e que merece atenção, principalmente aos jovens, pois se não forem tratados, há grandes riscos, como abuso de álcool, drogas, e até mesmo suicídio. Foi efetuada uma pesquisa bibliográfica, partindo da definição das palavras chave do próprio trabalho realizou-se uma busca em bases de dados acadêmicos, a saber o Google Acadêmico. Podemos observar que algumas das maiores causas que levam ao aumento da depressão em jovens são as pressões e cobranças familiares ou até mesmo dos próprios adolescentes, da questão da sexualidade, do bullying, da competitividade para saber quem é mais popular, mais inteligente ou bonito, além de que é a fase em que se sentem na obrigação de se encaixar em algum padrão social. Assim, segundo um estudo feito em 2015 pela Organização Mundial da Saúde (OMS) revela que 322 milhões de pessoas pelo mundo sofrem dessa doença, e que no Brasil, 5,8% (11 milhões de brasileiros) possuem esse transtorno, sendo 12% jovens de 12 a 18 anos, ou seja, mais de um milhão, tornando-se o país com maior número de casos da América Latina, e o segundo maior das Américas, perdendo apenas para os Estados Unidos. Com base nos dados e informações investigados, a depressão é uma doença complexa e que requer muita atenção e cuidados, pois uma vez não tratada, poderá resultar em problemas graves. A doença atinge qualquer idade, principalmente jovens, pois estão numa fase da vida cheia de influências, e é onde começam a ter que tomar decisões.', NULL, NULL, '2018-08-09 08:18:23', '2018-09-20 19:47:07', 4, 2, 6, 5, true, 6.5, 3.95982142857142838);
INSERT INTO public.projeto VALUES (289, 'EXPLORANDO A FíSICA', 'A disciplina de física é de extrema importância para o currículo escolar, sobretudo por trazer assuntos que são a base da tecnologia que utilizamos no dia-a-dia e na compreensão dos fenômenos da natureza que nos cerca e do qual fazemos parte. Porém, fatores como falta de base escolar e conteúdos não condizentes com o dia a dia, acabam em tornar o estudo da Física no Ensino Médio desinteressante. Pretende-se por meio deste trabalho, apresentar dados sobre o nivelamento dos estudantes do primeiro ano do IFRS - Campus Canoas na disciplina de física, através de um jogo online de perguntas e respostas, a fim de facilitar o entendimento da matéria e propor dicas de estudos ao alunos, além de tentar descobrir através de um formulário online, quais são as suas dificuldades e facilidades com o ensino da física, a fim de propor soluções para facilitar o aprendizado. Verificou-se a necessidade da realização desse trabalho, pois viu-se que os alunos de modo geral, possuem grandes dificuldades de aprendizagem com a disciplina de física, exigindo grande esforço, e a mesma acaba sendo tida, por grande parte dos estudantes, como uma matéria de difícil entendimento, o que é pouco desejável, já que se trata de uma matéria tão importante na vida humana. O formato de pesquisa, através de dados, pesquisa própria e pesquisas externas, bem como a maneira de apresentar e representar do tema, foram escolhidas de modo que facilitasse a compreensão de todos os tipos de público e ajudasse na aproximação com o mesmo. Com esse trabalho, espera-se que alunos possam acender o interesse pela física buscando conhecimento, e através disso, os docentes possam até mesmo melhorar as formas de ensinar a física, liderando essa busca por conhecimento. Fazendo com que haja uma harmonia maior entre todos os estágios do conhecimento, visando um desenvolvimento saudável dos mesmos.', NULL, NULL, '2019-08-09 23:02:01', '2019-09-20 14:48:19', 4, 2, 7, 5, true, 8.125, 9.97499999999999964);
INSERT INTO public.projeto VALUES (220, 'GRAFENO – A PROMESSA DO SÉCULO', 'Conexões de internet mais velozes, chips ultra potentes e água a disposição de todos não é mais uma ficção científica. Essas sãos algumas das capacidades do grafeno, um composto alotrópico de carbono que se destaca por conta de sua incrível resistência e condutividade elétrica. Infelizmente o preço de uma grama de grafeno custa R$ 100(em média R$ 396) e isto o torna pouco acessível no momento. O objetivo deste projeto visa a propagação do conhecimento quanto ao grafeno para que se crie uma cultura em sua volta a fim de aumentar o apoio em pesquisas que concernem a chave para um grande futuro. Com a finalidade de estudá-lo, uma profunda pesquisa bibliográfica foi realizada para obter o máximo de informações sobre o material e suas aplicações para posteriormente disseminar seus potenciais e qualidades a outrem visto que 64% das pessoas que participaram de uma pesquisa realizada no Google Forms desconhecem o grafeno, além disso, dentre todos os participantes 15% confundiram grafeno com grafite e cerca de 42% não sabem nada em relação às utilidades do grafeno. Ao examinar as qualidades e características do grafeno, vê-se que sua popularidade é baixa e suas aplicações são infinitas e, de fato, possibilitarão um grande bem-estar para a população brasileira e mundial. A população nacional ganha destaque devido ao grande impacto que haverá na economia já que o Brasil possui cerca de 46% da reserva mundial de grafeno em território nacional. Por fim conclui-se que há uma grande necessidade de analisar e abordar este tema para aumentar o interesse no mesmo e desencadear uma série de investimentos, pesquisas e invenções que serão originados pelo uso do grafeno decorrente de sua popularidade, agora, em alta. Logo, acredita-se que haverá um aumento no interesse da população quanto ao grafeno, isto desencadeará inovações, pesquisas e novas utilidades para o grafeno dentro de 7 anos, isto concretiza o objetivo de todo profissional da ciência: a busca por um mundo melhor.', NULL, NULL, '2019-08-06 16:49:57', '2019-10-26 18:05:25', 4, 2, 7, 5, true, 7.875, 5.92499999999999982);
INSERT INTO public.projeto VALUES (93, 'REVOLUÇÃO VERMELHA: A REVOLUÇÃO DE OUTUBRO DE 1917', 'Resumo - A Rússia era um país relativamente atrasado no início do século XX, se comparado aos demais países da Europa, devido ao fato de não ter conseguido acompanhar a modernidade que chegara junto da Revolução Industrial. Com a derrota que ocorreu contra o Japão (1904-1905) e os pesados impostos, a sociedade não conformou-se com o regime absolutista e queria derrubá-lo. Com isso, em fevereiro de 1917, Czar Nicolau II abdicou ao trono por causa dos vários manifestos contra o seu governo, consequentemente, um novo governo provisório assumiu: era o início do governo provisório. Então aconteceu que em outubro de 1917, um levante armado buscou derrubar o governo provisório e a partir daí, iniciou-se a segunda Revolução Russa, que tinha como objetivo a realização de programas políticos e sociais, os quais expandiram os limites do país, tornando-o, assim, uma das grandes potências do século XX. Com isso em mente abordamos como problema: como a imprensa brasileira representou a Revolução de Outubro de 1917? Nossa hipótese é que já no momento dos acontecimentos, a imprensa brasileira retrata com destaque a revolução. Nosso objetivo geral é compreender como a imprensa do Brasil noticiou a Revolução de Outubro; e como objetivos específicos queremos analisar a importância da Revolução de Outubro para o Século XX e verificar as forças políticas que estavam em disputa durante os acontecimentos da época. Para a metodologia desta pesquisa, coletaremos as fontes primárias – os jornais Correio da Manhã e Diário de Notícias – e as analisaremos em conjunto com as fontes secundárias (bibliografia específica).', NULL, NULL, '2018-08-09 15:07:18', '2018-09-20 19:47:07', 3, 2, 6, 2, NULL, 7, NULL);
INSERT INTO public.projeto VALUES (100, 'BDOG - SISTEMA PARA CADASTRO E GERENCIAMENTO DE OBJETOS DE GINCANA', 'Gincana é uma competição que possui um conjunto de tarefas disputadas entre diversas equipes. Esse tipo de atividade acontece em várias cidades do Rio Grande do Sul, sendo que o IFRS Campus Canoas também possui sua gincana que é disputada anualmente desde 2012. As tarefas divulgadas são divididas normalmente em seis setores distintos - artística, charada, diversa, esportiva, objeto e rua -, cada um possuindo tarefas respectivas. As tarefas do setor de objetos de uma gincana são aquelas onde as equipes precisam entregar um item definido pela organizadora, em um determinado horário para conseguir uma certa quantia de pontos. Esses objetos, geralmente, são produtos de promoções, embalagens, brindes ou coleções de uma determinada marca ou empresa. Esse setor possui um grande problema por causa da desorganização das equipes, uma vez que seus membros não sabem se possuem ou não o item requisitado, por não terem um cadastro dos objetos que eles mesmos ou que sua equipe possui. Devido à desorganização que as equipes possuem no setor de objetos durante uma gincana, esse trabalho tem como objetivo solucionar esse problema, criando um sistema onde as pessoas possam catalogar seus objetos, fazendo com que os usuários tenham maior controle sobre eles. Além de cadastrar e gerenciar seus objetos, os usuários também poderão criar grupos, podendo assim ter acesso os objetos de outros usuários. A necessidade da implementação do sistema proposto surge da participação do autor deste projeto em mais de vinte gincanas. Em uma delas sendo responsável pelo setor de objetos, foi reparado que a desorganização e a falta de controle sobre os objetos que sua equipe e seus membros possuem, se tornou um dos principais motivos para o pouco aproveitamento dos pontos no setor.', NULL, NULL, '2018-08-09 20:43:05', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 7, NULL);
INSERT INTO public.projeto VALUES (111, 'EYESEE - UMA PLATAFORMA PARA AUXILIAR DEFICIENTES VISUAIS, UNINDO PESSOAS COM VONTADE DE AJUDAR E PESSOAS QUE PRECISAM DE AJUDA', 'A tecnologia simplificou a forma de pedir comida, pesquisar preços de produtos e até mesmo de se locomover. Porém, ainda está distante do ideal, pois existem muitos recursos que apesar da tecnologia não possuem acessibilidade. Levando em conta a quantidade de deficientes visuais, é possível perceber que a tecnologia é ainda mais limitada, ou seja, a internet não está preparada para integrar essas pessoas. Diante disso, o presente projeto de pesquisa tem como objetivo o estudo na área de inclusão social de pessoas com deficiência visual, assim, propondo o desenvolvimento de um aplicativo para auxiliar deficientes visuais em tarefas do seu cotidiano. Para elaboração do projeto, foram realizadas pesquisas bibliográficas, análise de artigos e o estudo das respostas obtidas através de um questionário autoral elaborado para pessoas com deficiência visual. De acordo com os pontos mais relevantes encontrados nos depoimentos de pessoas que possuem algum tipo de deficiência visual, foi possível mapear as dificuldades mais recorrentes no dia-a-dia, assim como a pesquisa já havia apontado. Portanto, constatou-se que a elaboração de uma plataforma desenvolvida exclusivamente para deficientes visuais é de grande valia e de suma importância. Pensando nisso, o aplicativo tem as funcionalidades de escâner de texto, como ferramenta auxiliar na leitura e também conta com a ajuda colaborativa por meio de videoconferências, assim, une pessoas com vontade de ajudar e pessoas que precisam de ajuda.', NULL, NULL, '2018-08-10 10:26:43', '2018-09-20 19:47:07', 3, 2, 6, 5, true, 7.75, 9.52232142857142883);
INSERT INTO public.projeto VALUES (366, 'ESTUDO DO ÍNDICE DE MASSA CORPORAL NA EMEF MONTEIRO LOBATO', 'A obesidade é uma doença caracterizada pelo excesso de gordura corporal e um dos maiores problemas de saúde no mundo. Milhões de crianças e adolescentes apresentam esta condição. De acordo com dados da Sociedade Brasileira de Pediatria, quatro em cada cinco crianças obesas permanecem obesas quando adultas. Várias são as complicações decorrentes deste estado, como diabetes, hipertensão, excesso de colesterol e de triglicerídeos, entre outras. Para saber se a criança está acima do peso recomendado, é necessário fazer o cálculo do IMC (Índice de Massa Corporal). O objetivo do projeto foi analisar o IMC dos alunos da Escola Municipal Monteiro Lobato, para posteriores intervenções de conscientização e prevenção. Foi verificado a estatura, o peso e o IMC de cada um dos 265 alunos. Destes, 22,2% apresentam sobrepeso e outros 21,8% são obesos. Os dados separados por sexo e faixa etária estão em processo de análise.', NULL, NULL, '2019-09-17 14:07:42', '2019-09-24 16:35:28', 10, 3, 7, 5, true, 7.5, 9.07499999999999929);
INSERT INTO public.projeto VALUES (178, 'A TECNOLOGIA E O DESEMPREGO', 'Pretende-se, por meio desse trabalho, apresentar argumentos – dados, gráficos, estudos - e defender uma visão que se difere do pensamento comum, o pensamento de que os avanços tecnológicos, como a automação e os robôs, vêm ao longo do tempo roubando empregos, sendo assim, gerando desemprego, e com isso consequentemente deixando a população em sua maioria, mais pobre. Uma opinião que a história já desmentiu e continua desmentindo várias vezes. Através de pesquisas vindas das mais diferentes fontes, escritas, dados e lógicas diretas, conseguimos provar justamente o contrário. A partir da observação de opiniões vindas de estudantes, professores e outros profissionais inseridos na vida acadêmica, verificou-se a necessidade da realização deste trabalho, pois viu-se que os mesmos tinham quase, ou mesma visão sobre o tema, algo pouco desejável, já que se trata de um tema tão atual. O formato de pesquisa, através de dados, pesquisas de fontes externas, e pesquisas próprias – com formulários -, e formas de apresentação e representação do tema, foram escolhidos com o objetivo de facilitar a compreensão para todos os tipos de públicos e se aproximar do mesmo. No presente trabalho, também iremos traçar uma linha do tempo para observarmos e fazermos comparativos utilizando fatos históricos e dados ligados ao desemprego, além de utilizar exemplos onde a tecnologia ao invés de destruir empregos acabou por gerar os mesmos, assim melhorando a qualidade de vida das pessoas. Com este trabalho, espera-se que alunos e profissionais sejam capazes de observar de maneira mais crítica tudo o que lhes cerca, duvidando de “Dogmas” populares da sociedade atual, passando a ter uma visão mais lógica e racional do tema e do mundo.', NULL, NULL, '2018-08-10 23:23:09', '2018-09-20 19:47:07', 5, 2, 6, 5, true, NULL, 7.32232142857142776);
INSERT INTO public.projeto VALUES (395, 'A INFLUÊNCIA DA POLUIÇÃO CHINESA NO ÂMBITO GEOGRÁFICO, QUÍMICO', 'A China é o maior emissor anual de gases causadores do efeito estufa. As emissões de dióxido de carbono relacionadas à energia na China aumentaram mais de 80% entre 2005 e 2019. Nesse sentido, percebe-se a necessidade de se estudar essa ameaça a população chinesa, bem como a saúde e a economia do resto do mundo. Por conta disso, estará contido neste trabalho por meio da relação entre a China poluidora, os principais elementos poluentes e como esses interferem na genética e na biodiversidade das espécies. A razão do desenvolvimento da pesquisa centra-se na necessidade de se discutir os efeitos da poluição, que tanto prejudica a biosfera e está muito presente nas pautas atuais. Além disso, é válido ressaltar que a poluição não afeta somente o meio geográfico e químico do planeta, mas também no âmbito biológico, alterando geneticamente o DNA de algumas espécies e prejudicando fortemente o seu desenvolvimento. Para atingir os objetivos propostos, foi feita uma pesquisa bibliográfica acadêmica em artigos e trabalhos dispostos em diversas plataformas e repositórios online. As análises feitas até o momento permitem afirmar que os ratos que respiraram ar filtrado tinham 35% menos mutações genéticas que os expostos à poluição siderúrgica, ou seja, pode se concluir que a poluição realmente altera o genótipo de algumas espécies e evidenciam como um país causador de grande poluição tem um enorme impacto negativo quando observamos esses fatores preponderantes que influenciam de modo significativo no mundo.', NULL, NULL, '2021-10-08 10:35:46', '2021-11-03 15:47:53', 4, 2, 9, 5, true, 10, 4.79999999999999982);
INSERT INTO public.projeto VALUES (279, 'VACINAçãO E FAKE NEWS', 'Recentemente, surgiram fake news que afirmam que a vacinação de crianças pode causar doenças como o autismo. Porém, não há nenhuma comprovação científica disso. Todavia, muitos pais acreditaram nesses rumores e decidiram não vacinar seus filhos. Por isso, casos de doenças já erradicadas, como o sarampo, estão novamente ocorrendo na população. O objetivo da minha pesquisa foi verificar se os meios de comunicação (rádios, jornais [virtuais, físicos ou na TV]) estão se preocupando em alertar a população sobre o perigo da não vacinação de crianças. Ao longo da pesquisa procurei responder à pergunta ‘Como surgiu a vacinação?’ através da leitura de reportagens e sites na internet e notícias na televisão. Além disso, através de uma pesquisa com as palavras ‘vacinação’, ‘fake news’ e ‘reportagem’ no site fiz uma busca no Google para verificar quais eram as notícias que foram veiculadas recentemente na mídia. Aprendi que se acredita que os primeiros vestígios da vacinação tenham surgido na China, no séc. X, para combater a varíola. Entre as reportagens pesquisadas que abordavam a vacinação contra o sarampo apenas 40% delas fazia um alerta sobre as falsas notícias sobre consequências da vacinação. Dessa forma, constatei que com o forte avanço de movimentos anti-vacinas, a mídia poderia intensificar a publicação de reportagens que esclarecessem a população sobre boatos falsos e os perigos de acreditar neles.', NULL, NULL, '2019-08-09 19:35:44', '2019-09-19 14:25:57', 11, 3, 7, 5, true, 8.125, 8.4375);
INSERT INTO public.projeto VALUES (102, 'BOMBAS ATÔMICAS', 'Para os combates da Segunda Guerra Mundial os EUA, desenvolveram um projeto chamado &#34;PROJETO DE MANHATTAN&#34; com a iniciativa de desenvolver um armamento pesado baseado na fissão do átomo, Vários engenheiros e cientistas que fugiram dos governos fascistas europeus participaram desse projeto, o primeiro teste desse projeto ocorreu no dia 16 de julho de 1945 e obteve sucesso quando a bomba de Plutônio foi explodida, e foi realizado no deserto Alamogordo, no estado do Novo México. A descoberta de nêutrons no ano de 1932, mudou completamente o sistema utilizado para os estudos das propriedades atômicas. Ao bombardear átomos de Urânio com nêutrons, cientistas como Otto Hahn e Lise Meitner, perceberam e além de tudo provaram que o núcleo desse átomo, formado por 92 prótons é dividido em núcleos menores, descobriram também que o Urânio pode fissionar (processo de fissão nuclear). O elemento Bário e o elemento Criptônio, cada um com 56 e 36 prótons no núcleo. Com isso os cientistas perceberam que era possível criar uma reação em cadeia que seriam capazes de gerar grandes quantidades de energia, e assim causar uma imensa explosão de alto poder destrutivo, surgindo assim uma nova arma: A Bomba Atômica. como o imperador do Japão recusou a rendição proposta pelos EUA, o presidente Henry Truman, tomou a decisão de utilizar a bomba atômica para impedir a invasão do Japão. Nos dias 6 e 9 de agosto de 1945, as cidades de Hiroshima e Nagasaki foram bombardeadas pelos EUA. Esse acontecimento foi um dos importantes para o final da Segunda guerra Mundial.', NULL, NULL, '2018-08-09 21:07:27', '2018-09-20 19:47:07', 3, 2, 6, 2, NULL, 3, NULL);
INSERT INTO public.projeto VALUES (7, 'A IDENTIDADE NO CAMPO DA CULTURA GAúCHA: VíNCULOS, ASSOCIAçõES E PAPéIS DOS AGENTES', 'O presente trabalho é uma pesquisa de campo qualitativa que busca analisar como se dão as relações dos agentes tradicionalistas gaúchos a partir de fatores históricos, sociais, folclóricos e das formas de poder. A questão problema indaga &#34;Quais aspectos do campo da cultura gaúcha caracterizam os vínculos e associações dos agentes dentro do Movimento Tradicionalista Gaúcho no Rio Grande do Sul?&#34;. Foi projetado identificar as complexas conexões que caracterizam os vínculos e associações entre os agentes dentro do Movimento Tradicionalista Gaúcho no Rio Grande do Sul, tendo como objetivo geral analisar os elementos através do que podemos chamar de campo da cultura gaúcha. Este levantamento busca refletir sobre fatores da área da cultura gaúcha, como os problemas que se apresentam existentes dentro deste meio, bem como a forma que se expressam social e culturalmente. Os métodos de análise de dados utilizados são: pesquisa documental, aplicação de questionários semi-estruturados (garantindo o anonimato dos questionados) e, através dos resultados coletados, método comparativo. O estudo se encontra em período de desenvolvimento: aplicação, coleta e análise de dados, já apresentando resultados parciais de algumas questões específicas que foram respondidas através de questionário virtual - entre elas, a identificação do papel representado pelo agente de maior poder dentro das entidades, o(a) patrão(oa), culminando na reflexão acerca do poder simbólico nos meios analisados. Os próximos passos da pesquisa consistem em analisar a representação da mulher dentro do campo da cultura gaúcha recorrendo aos fatores históricos, sociais e aos dados coletados.', NULL, NULL, '2018-07-24 12:16:48', '2018-09-20 19:47:07', 5, 2, 6, 5, true, NULL, 9.4178571428571427);
INSERT INTO public.projeto VALUES (83, 'CARRO AUTÔNOMO EXPLORADOR DE AMBIENTES', 'O objetivo deste projeto é elaborar um carro autônomo. Com sensores ultrassônicos o carro desviará de objetos à sua frente. Será também realizado um mapeamento do ambiente a sua volta, a visualização do mapa sera feito via monitor serial, utilizando o Arduíno como microcontrolador. Este projeto visa elaborar um carro que, automaticamente, desvie de objetos obstáculos e realize um mapeamento do ambiente percorrido. Para realizar este projeto, a proposta inicial é que este carro, utilizando-se de sensores ultrassônicos , consiga desviar de obstáculos em sua trajetória ao mesmo tempo em que armazena as informações obtidas pelo ultrassom, montando um mapa. O mapa será visualizado no monitor serial . Primeiramente será programado um sketch no arduino para a movimentação do carro. Como utilizaremos motores de passo, será feito a medição e controle da distância percorrida pelo mapa. Através dos sensores ultrassom, poderá ter a informação de algum objeto a frente, para o carro desviar, e armazenar as informações de objetos encontrados no percurso do carro faremos a montagem do mapa, do ambiente em que ele está presente. O protótipo pronto funcionará da seguinte forma: Posto em algum ambiente, o carro anda para frente; Se ele identificar algum obstáculo, ele desviará 90°; Durante o trajeto percorrido, as informações de distâncias dos obstáculos, e suas localizações obtidas pelos sensores, serão armazenadas na memória e também enviadas para o monitor serial, no qual poderá ser visualizado o mapa formado. Em suma, a elaboração do projeto ficará dividida em, de modo geral, e que poderão ser testadas separadamente: formação do mapa pelo algoritmo(que poderá ser visualizado no monitor serial), locomoção do carro e desvio dos objetos; recebimento e envio das informações para o monitor serial.', NULL, NULL, '2018-08-08 18:32:38', '2018-09-20 19:47:07', 7, 2, 6, 5, true, NULL, 3.73928571428571388);
INSERT INTO public.projeto VALUES (117, 'PHOBOS - UMA PLATAFORMA PARA UMA NOVA EXPERIÊNCIA DE DESENVOLVIMENTO SOCIAL', 'A realidade virtual e a comunicação são duas áreas relacionadas e com grande potencial de crescimento na educação, e se combinadas de uma forma correta, podem acarretar em um grande investimento para a melhora do método de aprendizagem, que é utilizado pelas escolas, pois quando utilizamos de artifícios diferentes, conseguimos a atenção dos estudantes. Por ser uma tecnologia inconstante, que está sempre mudando e melhorando os modos de imersão, a realidade virtual nunca será monótona em um aprendizado, pelo contrário, ela trará mais atenção e interesse por parte de quem vai aprender. Neste trabalho abordamos então a comunicação e a realidade virtual como um meio de auxílio para apresentações orais escolares, onde o aluno irá focar mais em treinamentos e não ficará tão intimidado em suas próximas experiências com a sociedade. O objetivo então, é implementar um sistema mobile que pode auxiliar alunos e alunas na preparação para apresentações orais escolares, transformando a preparação em uma nova experiência de desenvolvimento social de uma forma virtual, divertida e sem medo. A metodologia prevê pesquisas de textos e artigos acadêmicos relacionados, assim como a criação de um documento de requisitos para fins de definir funcionalidades para a aplicação. Os resultados parcialmente obtidos até o momento, apontam que não foram encontrados aplicativos em língua portuguesa com a abordagem em comunicação e realidade virtual, voltado ao auxílio de adolescentes em apresentações orais escolares.', NULL, NULL, '2018-08-10 13:27:43', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (298, 'RODA LEITURA', 'O Roda Leitura é um projeto de extensão desenvolvido no IFRS Campus Canoas com o intuito de incentivar a leitura. Têm-se como objetivos proporcionar momentos em que os participantes parem para refletir sobre assuntos variados, através de um tema previamente definido, tendo como viés a literatura, na expectativa de gerar maior interesse pelo hábito de ler. A realização destes encontros em outras escolas públicas é também algo a ser efetivado para alcançar os resultados almejados. É notória a importância deste projeto quando percebemos que hoje vive-se em uma sociedade baseada em informações rasas e passageiras. Portanto, é necessário estimular a leitura para que seja desenvolvido o senso crítico e a capacidade de questionar. Metodologicamente, são realizados encontros mensais em que os integrantes se organizam em roda, trazem trechos selecionados de antemão e os leem em voz alta, gerando uma discussão sobre o tema sugerido e um ambiente agradável para reflexão e debates. Como forma de divulgação e interação com o público, utiliza-se das mídias sociais e site próprio como ferramentas para dar dicas de leitura, além de cartazes impressos para divulgar todas as atividades realizadas. Procura-se através deste projeto, incentivar a rotina de leitura e formar novos leitores através de conversas e debates. Por consequência, fazer com que as pessoas passem a buscar conhecimento aprofundado e fundamentado. Pois assim, poderão usufruir dos benefícios da leitura habitual, como a ampliação do vocabulário tanto na escrita quanto na oralidade, e compreender as diversas visões sobre o mundo. E deste modo, espera-se dar continuidade ao projeto, mantendo os encontros mensais, atendendo outras escolas e incentivando a leitura.', NULL, NULL, '2019-08-10 11:02:47', '2019-09-19 10:56:33', 3, 2, 7, 5, true, 8.375, 8.79285714285715159);
INSERT INTO public.projeto VALUES (226, 'ANáLISE DE INICIATIVAS QUE ENVOLVEM A LóGICA DE PROGRAMAçãO NO ENSINO MéDIO', 'Nos últimos anos, indicadores brasileiros como os dados apresentados pelo Índice de Desenvolvimento da Educação Básica (IDEB) mostram que a qualidade da educação no Brasil está muito abaixo do que seria esperado. Muitas análises têm sido feitas para justificar este comportamento. Uma delas, por exemplo, é que mesmo diante da vasta quantidade de dispositivos tecnológicos existentes, existe uma considerável ausência de tecnologia no sistema educacional, uma vez que ela ainda pode ser um recurso de difícil acesso para boa parte da população brasileira, de acordo com dados do Instituto Brasileiro de Geografia e Estatística (IBGE). Diversos autores defendem que uma possível alternativa para amenizar este problema são as iniciativas que envolvem o ensino da Lógica de Programação, desde a Educação Básica. Assim, esta pesquisa visa investigar anais de eventos de referência na área e que sejam destinados a alunos de Ensino Médio, analisando seus resultados, o impacto que eles trouxeram aos envolvidos, e averiguando as principais iniciativas de sucesso. As buscas foram inicialmente realizadas nos anais das últimas quatro edições do CBIE e do SBIE, utilizando como filtro a busca por iniciativas com as palavras-chave “Pensamento Computacional”, “Raciocínio Lógico” e “Lógica de Programação”. No total foram encontrados 166 artigos, dos quais 16 possuíam estatísticas referente ao impacto do projeto. Analisando estes dados, observou-se uma variação de 48,7% e 90,9% de aproveitamento nas iniciativas realizadas, e dentre elas, as principais atividades desenvolvidas foram oficinas de programação, aplicativos lúdicos e oficinas de robótica, satisfazendo seus respectivos objetivos. Por isso, pretende-se ampliar a pesquisa, procurando revistas e anais de outros eventos que abordem o assunto, para agregar mais precisão aos resultados, incentivando inovações para contribuir de fato com a oferta de uma Educação de qualidade em nosso país.', NULL, NULL, '2019-08-06 20:40:20', '2019-09-19 14:53:04', 4, 2, 7, 5, true, 8.625, 9.94999999999999929);
INSERT INTO public.projeto VALUES (217, 'A DISSOLUçãO DA UNIãO SOVIéTICA NA IMPRENSA BRASILEIRA', 'O fim dos 69 anos da União das Repúblicas Socialistas Soviéticas (URSS) nunca esteve tão iminente quanto na década de 1990. Não é à toa que em 26 de dezembro de 1991, no Kremlin em Moscou, a bandeira da União Soviética descia do mastro principal e dava lugar à bandeira da Rússia como consequência da declaração n°142-H do então Soviete-Supremo da União Soviética, Mikhail Gorbachev, o último de sua história. Isso simbolizava ao mundo o fim: o fim dos anos gélidos da Guerra Fria, o fim de uma nação já desgastada econômica e politicamente e, principalmente, o fim da história de uma nação. Em razão disso, nosso problema de pesquisa consiste em investigar como a imprensa brasileira repercutiu a dissolução da União Soviética? Com isto em mente, adota-se, então, como objetivo geral apresentar como a imprensa representou a dissolução da União Soviética; como objetivos específicos, buscamos relacionar o fim da União Soviética com o fim da Guerra Fria, bem como busco apresentar as possíveis condições que levaram a dissolução da União Soviética. Como hipótese, elencamos a ideia que a imprensa deu uma grande cobertura jornalística do ocorrido. Quanto a metodologia deste projeto, iniciaremos fazendo a pesquisa com o fichamento da bibliografia sobre a Guerra Fria e sobre a União Soviética seguido de uma leitura intensiva e um fichamento das fontes primárias (jornais). Após essa etapa, faz-se a análise da documentação primária com a documentação bibliográfica onde, para fontes primárias, foram escolhidos os jornais O Estado de São Paulo e a Folha de São Paulo.', NULL, NULL, '2019-08-06 10:54:11', '2019-09-19 13:10:04', 3, 2, 7, 5, true, 8.625, 9.19642857142855163);
INSERT INTO public.projeto VALUES (153, 'MáQUINA DE MOVIMENTO PERPéTUO', 'Máquina de movimento Perpétuo, ou moto-contínuo, é um termo utilizado para designar um conjunto de máquinas hipotéticas que poderiam realizar trabalho indefinidamente sem uma fonte de energia externa. A fascinação por esse tipo de dispositivo data da idade média, sendo Bhaskara Akaria um dos primeiros matemáticos a desenvolver um modelo de perpetuum mobile (latim para movimento perpétuo) e continua atraindo novos entusiastas até hoje. Apesar das diversas tentativas, nenhuma das máquinas desenvolvidas até o momento conseguiu cumprir seu objetivo principal, continuar trabalhando por tempo indefinido, e consequentemente também não conseguiu gerar energia para utilização externa à máquina. O motivo de todas as tentativas serem falhas, é que todos projetos ferem alguma lei da física, geralmente a primeira ou a segunda lei da termodinâmica. Mesmo considerando um cenário hipotético de zero atrito, a máquina não funcionaria para gerar energia, a não ser a própria energia necessária para com que permaneça em movimento, pois violaria a lei da conservação de energia já que teria que produzir mais trabalho do que recebe em cada oscilação. Inúmeras pessoas continuam tentando construir máquinas de moto-perpétuo, com a convicção de que elas conseguirão contestar os princípios já definidos pela física e acreditarem que existem mais conceitos a serem descobertos, ignorando o fato de que as leis que contestam a existência das máquinas provém da análise de um grande número de fatos e experiências. É verdade que muitas certezas científicas foram mais tarde contestadas, e novas pesquisas sobre, por exemplo, os conceitos de cristais do tempo, dão esperança aos entusiastas que são muitas vezes vistos com desconfiança pelo meio científico. O projeto a ser apresentado então discutirá as polêmicas envolvendo as máquinas de movimento perpétuo e utilizará modelos físicos das mesmas para demonstrar seu funcionamento.', NULL, NULL, '2018-08-10 20:30:15', '2018-09-20 19:47:07', 4, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (122, 'MATEMÁTICA APLICADA NA VIDA: UM ESTUDO DE CASO DE VEíCULOS QUE TRANSITAM NA AVENIDA NAZáRIO EM CANOAS', 'A aplicação da matemática possui diversas interfaces na vida cotidiana das pessoas. Aplicar os conceitos de proporção, percentuais e gráficos em atividades corriqueiras dos estudantes de forma a facilitar o estudo tem atualmente uma tendência pedagógica. A presente pesquisa surgiu de uma atividade da disciplina de matemática em que tivemos que contabilizar num determinado período de tempo os veículos e suas características (marca, cor, tipos) que transitam em frente à Escola. Como objetivo além da utilização do conteúdo da matemática aplicada, queríamos pesquisar se seria possível estabelecer um padrão socioeconômico dos veículos que transitam no bairro. Os dados preliminares indicam uma tendência específica por veículos de características populares, por exemplo: motos e carros de um fabricante específico. Os resultados serão apresentados em forma gráfica com o intuito de demonstrar a forma de cálculo de médias tendências.', NULL, NULL, '2018-08-10 14:29:40', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (138, 'OFFBOARD- MANUTENçãO E SUPORTE A SERVIçO DA COMUNIDADE', 'O projeto Offboard é uma iniciativa do campus Canoas, para capacitar e estimular os alunos na realização de manutenção e assistência técnica em serviços de informática, atendendo tanto a comunidade interna do campus quanto a externa. Essas atividades são realizadas por 4 integrantes, sendo dois bolsistas e dois voluntários. Entre as atividades são destacadas a manutenção, a formatação, a catalogação, a limpeza e o teste de peças. Através de doações de peças, são montados computadores de mesa e notebooks, que são disponibilizados para serem doados ou emprestados para discentes com baixa renda ou que sofreram imprevistos com suas máquinas, impossibilitando a realização de atividades requisitadas pelo campus. Estes mesmos computadores montados são utilizados para fazer a verificação das peças que são oferecidas ao projeto. As peças doadas são devidamente testadas e verificadas, algumas apresentam defeitos e são impossibilitadas de serem reutilizada/s, assim tendo que ser descartadas. Com o descarte frequente de peças, o projeto acaba se preocupando com o destino adequado desses materiais, a partir daí surge uma parceria com uma empresa externa que faz a implementação de uma lixeira específica para descarte de materiais eletrônicos no campus IFRS-Canoas, já as com bom funcionamento também são oferecidas aos alunos que necessitam, para que estes possam efetuar trabalhos ou projetos. Além da montagem de computadores, o projeto oferece oficinas de capacitação para a comunidade interna e externa, levando assim integração entre o nível médio-técnico com os outro níveis de educação do campus Canoas, visando possibilitar o maior entendimento e a realização de atividades básicas de manutenção e assistência técnica. Além de aprimorar o conhecimento de todos os envolvidos nas oficinas o projeto acaba por ter uma maior visibilidade dentro e fora do campus.', NULL, NULL, '2018-08-10 18:59:33', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 9.125, 6.4375);
INSERT INTO public.projeto VALUES (120, 'PETS ROW: UMA PLATAFORMA DIGITAL COLABORATIVA DE GEOLOCALIZAÇÃO DE ANIMAIS.', 'Atualmente o número de animais nas ruas estima-se em mais de 30 milhões segundo a OMS, sendo eles perdidos ou abandonados. Assim, as ONGs não tem como suportar esse grande número de animais em seus estabelecimentos, pois isso passou a desencadear a transmissão de zoonoses desses animais, criando problemas de saúde, entre outros. Visto assim, o presente projeto tem como seu objetivo, desenvolver uma plataforma onde o usuário que tenha perdido seu animal de estimação, tenha um recurso de geolocalização do mesmo, para facilitar na busca e torná-la mais rápida e eficiente. Para as ONGs, proporcionará desenvolver um sistema onde ela poderá realizar e disponibilizar seu eventos e campanhas publicitárias, para assim obterem maior visibilidade. Quanto à metodologia, foi realizado uma pesquisa de opinião com foco no público-alvo do projeto que se volta para os usuários de tecnologias móveis, pois com o crescente número de vendas de smartphones, tornou-se o acesso à informação mais dinâmico, fácil e prático. As tecnologias usadas para a realização da plataforma são formadas por Android, Java, Spring Boot, Hibernate e MySQL, a comunicação dos dados é feita com os serviços do Web Service REST. O aplicativo será uma plataforma digital colaborativa, que visará trabalhar lado a lado com a geolocalização, fornecendo assim aos usuários, o poder de auxiliar e solicitar ajuda à sua vizinhança ou até mesmo com a colaboração da cidade para resultados de maior expressividade e precisão. O projeto também dispõe funcionalidades ao usuário, onde ele pode tornar-se um Pet Hoster que visa cuidar de animais de outras pessoas, ou realizar trabalhos voluntários às ONGs, de acordo com a necessidade das mesmas.', NULL, NULL, '2018-08-10 13:57:21', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 6, NULL);
INSERT INTO public.projeto VALUES (121, 'DE BOA - MEDITAÇÃO E MINDFULNESS APLICADOS AO DIA DIA DE PROFISSIONAIS DE TI', 'Dado o avanço das áreas profissionais nas últimas décadas, é evidente que existe um destaque especial para uma nova área, que cresce exponencialmente ano após ano, a da Tecnologia da Informação (TI). A revolução tecnológica ocorreu em larga escala e em curto período de tempo, porém, o número de profissionais não cresceu de maneira que supra a demanda por profissionais do mercado. É constatado pela revista Computer World que faltarão em torno de 449 mil profissionais na área de TI até 2019. A consequência dessa falta é a cobrança sobre os que já estão no mercado. O estresse provocado pela profissão tem se mostrado exaustivo, visto que a produção e demanda do trabalhador é cada vez maior. Isto pode ser observado em artigos que demonstram o impacto sobre a saúde dos profissionais. No estudo de Padma et al. (2015), realizado com 1000 funcionários, constatou-se que 56% tinham problemas músculo-esqueletais, 22% tinham hipertensão recentemente diagnosticada, 10% tinham diabetes, 36% tinham dislipidemia, 54% tinham depressão, ansiedade e insônia e, por fim, 40% eram obesos. Técnicas milenares de meditação sempre estiveram presentes como opção para tentativas de solução de problemas de saúde, como o estresse, dentre essas técnicas, a mindfulness se destaca. Mindfulness é um tipo de meditação que visa a conexão com o momento, onde todas as atenções devem estar no agora, através de respiração, audição e concentração o sujeito busca desvencilhar dos problemas e ligar-se ao agora. A partir disso foi, constatado que o método mais efetivo para auxiliar na saúde desses profissionais, de modo que não impacte na sua produtividade, inclusive podendo aumentá-la, é através de meditação mindfulness. Tendo isso em mente, o presente trabalho tem por objetivo geral o desenvolvimento de um aplicativo mobile que auxilie na prática da meditação mindfulness com foco em uma melhora na saúde física e mental do usuário e o desenvolvimento de uma maior qualidade de vida pessoal e no trabalho.', NULL, NULL, '2018-08-10 14:03:06', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, 5.125, NULL);
INSERT INTO public.projeto VALUES (416, 'AVALIAçãO DO POTENCIAL ANTIOXIDANTE E ANTIMICROBIANO IN VITRO DA COROA DO ABACAXI ANANAS COMOSUS', 'Mundialmente o abacaxi é uma das frutas preferidas, sendo produzidos cerca de 19 milhões de toneladas anuais. No Brasil, essas médias não são diferentes, visto que representam 9,89% da produção mundial de abacaxi. Porém, cerca de 45% de sua composição bruta, incluindo a coroa, é descartada sem ser utilizada. Outras condições adversas, como mau armazenamento e transporte inadequado, podem totalizar um desperdício de até 80%. Tendo em vista esses dados, o objetivo da pesquisa foi avaliar o potencial antioxidante e antimicrobiano da coroa do abacaxi Ananas comosus, cujo nome comercial é Pérola,, através de diferentes métodos de extração, solventes e análises. Sua relevância está relacionada com o melhor aproveitamento dos resíduos da fruta, já que estes apresentam composição rica em fibras, vitaminas, minerais e antioxidantes naturais, que são importantíssimos para o bom desempenho do corpo, além de não causarem efeitos tóxicos, que podem ser provocados pelo excesso de antioxidantes sintéticos. Para isso, foram realizados em triplicata três métodos de extração com três solventes, sendo eles maceração estática, extração por Soxhlet e percolação adaptada, usando acetato de etila, metanol e etanol. Posterior aos extratos, foram feitas as análises de compostos fenólicos totais, flavonoides totais, atividade antioxidante com radical DPPH, atividade antioxidante com radical ABTS, clorofilas e licopenos, para avaliar o potencial antioxidante, e difusão em disco frente às bactérias Staphylococcus aureus e Escherichia coli, para avaliar o potencial antimicrobiano. A partir dos resultados, pode-se concluir que as coroas do abacaxi apresentam bom potencial antioxidante e antimicrobiano, sendo os métodos e solventes mais indicados dependendo do objetivo. Porém, no geral, para atividade antioxidante o melhor é a percolação com metanol e para antimicrobiana, etanol com percolação para Staphylococcus aureus e maceração para Escherichia coli.', NULL, NULL, '2021-10-13 21:33:39', '2021-11-03 16:09:22', 4, 2, 9, 5, true, 10, 9.77499999999999858);
INSERT INTO public.projeto VALUES (142, 'ESCAPEIFRS: JOGO DE ESCAPE PARA O ENSINO DE LóGICA DE PROGRAMAçãO', 'A lógica de programação é a disciplina base para a maior parte dos cursos de informática. Nela são abordados, respectivamente, três temas principais: algoritmos, fluxogramas e pseudocódigo; cada um dos conteúdos tem como requisito o seu antecessor. Porém, nota-se uma constante dificuldade no entendimento da matéria, resultando em uma média de 25% de reprovação anual. Portanto, o presente trabalho tem como objetivo auxiliar os alunos no entendimento dos conteúdos da disciplina e, principalmente, estimular o desenvolvimento do raciocínio lógico e do pensamento estruturado, através de desafios e enigmas. A plataforma está sendo desenvolvida no projeto de pesquisa Gamificação, e é um jogo sério de escape, que tem como cenário o IFRS Campus Canoas. Ela está dividida em níveis, que abordam cada conteúdo da disciplina de lógica de programação progressivamente, juntamente dos desafios lógicos, e se tornam mais complexos conforme o avanço do jogador. Para os conteúdos específicos, serão utilizados exercícios da plataforma Tri-Logic, que fornece diversos desafios da matéria, e também faz parte do projeto Gamificação. O principal método de pesquisa utilizado na elaboração do trabalho foi a análise bibliográfica, relacionada ao ensino do pensamento estruturado e da lógica de programação, e o estudo de dados do desempenho dos alunos na disciplina. Como resultados, tanto os níveis quanto a história do jogo estão em desenvolvimento, e as fases existentes utilizam exercícios da plataforma Tri-Logic.', NULL, NULL, '2018-08-10 19:18:27', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 10, 8.58571428571428541);
INSERT INTO public.projeto VALUES (148, 'OVEREDOOK – GERENCIADOR WEB PARA PARTIDAS DO JOGO OVERWATCH', 'Overwatch é um jogo desenvolvido e publicado em 2016 pela empresa de entretenimento Blizzard. No mesmo ano de publicação, por ser um jogo eletrônico multijogador de tiro em primeira pessoa (FPS), introduziu o modo de jogo competitivo, atraindo jogadores que buscam uma experiência mais séria para o cenário. Ao escolher e iniciar o modo de jogo competitivo, o jogador passará por dez partidas de iniciais para que o sistema estabeleça sua classificação. Com o crescimento no número de jogadores, diversos são os usuários que preenchem essas diferentes classificações, sendo mais frequente jogadores possuírem um ranking mais baixo. Como o menor grupo de jogadores é o grupo mais habilidoso, o sistema de balanceamento automático do Overwatch acaba falhando, levando muito tempo para encontrar competidores de habilidade similar ou até mesmo emparelhando jogadores em uma partida extremamente desigual. Isso acaba por diminuir gradativamente o número de jogadores que se mantém jogando e, por consequência, as chances do Overwatch se manter em um cenário de constante evolução, o de jogos eletrônicos. Para solucionar esse problema, foi pensada a aplicação web, de nome OveRedook, que tem como objetivo proporcionar uma experiência de competição mais justa, servindo como plataforma para que os jogadores do Overwatch se encontrem, se organizem em grupos e pratiquem grupos contra grupos de mesma qualificação, possibilitando um aprendizado e experiência de jogo muito mais competitiva do qual é experimentado in-game. O estudo, compreensão do problema e do que poderia vir a ser sua solução foi atingido através de uma abordagem qualitativa, pois foram estudadas as opiniões fornecidas pelos jogadores em sítios específicos, sendo também incluída minha experiência enquanto jogador. Compreendendo o problema, desenvolveu-se este trabalho pensando na partida ideal que os usuários gostariam de vivenciar ordinariamente.', NULL, NULL, '2018-08-10 20:22:07', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 9.86607142857142883);
INSERT INTO public.projeto VALUES (436, 'PLATAFORMA WEB GRATUITA REVISãOONLINE: UM ESPAçO COLABORATIVO DE APRIMORAMENTO DA ESCRITA DE REDAçõES PARA O ENEM E DEMAIS VESTIBULARES', 'Com o objetivo de melhorar a produção de textos dissertativo-argumentativos de seus usuários a partir do uso das ferramentas de correção e escrita de redações da plataforma que são fundamentadas nas competências do ENEM, o sistema on-line gratuito do projeto RevisãoOnline foi desenvolvido no IFRS - Campus Canoas. Na metodologia da plataforma, os seguintes passos são realizados: o usuário produz uma redação através de um tema escolhido por ele ou sugerido pelo software; ele recebe textos motivadores à escrita que são no modelo em uso no ENEM; escreve seu texto e envia a produção à revisão de dois usuários sorteados pelo software; o sistema encaminha, aleatória e anonimamente, duas redações de demais estudantes para o usuário corrigir, podendo esse buscar mais revisões; e o escritor pode avaliar as correções feitas em sua produção com estrelas até cinco e/ou comentário enviado a cada revisor. Um dos recursos é de trabalho em grupo, que tem como intuito controlar os alunos como uma turma escolar ou restringir a interação por pares da revisão. Ele permite a um professor ou um estudante líder personalizar o grupo conforme a sua preferência, possibilitando ao software adequar-se às demandas de seus usuários e, assim, contribuir mais para o aprendizado. Ao presente, a plataforma do projeto conta com 850 usuários, os quais já produziram 852 redações e realizaram 2297 revisões através do uso do software. Além desses dados satisfatórios, o sistema tem 21 grupos de estudantes, que apresentam, na totalidade, 442 membros. O RevisãoOnline possui uma dinâmica que, tanto na escrita quanto na revisão, auxilia os estudantes na melhora da escrita e no alcance de uma boa nota no ENEM e/ou demais vestibulares, visto que promove o conhecimento das competências necessárias para a produção de um ótimo texto e de incoerências a evitar na escrita. A plataforma está sendo constantemente aprimorada, a fim de proporcionar recursos cada vez melhores e eficientes na aprendizagem dos usuários.', NULL, NULL, '2021-10-17 17:33:34', '2021-11-04 22:22:12', 3, 2, 9, 5, true, 8.75, 10);
INSERT INTO public.projeto VALUES (408, 'PLANTAS MEDICINAIS', 'Plantas Medicinais As plantas medicinais são todas aquelas que possuem princípios ativos que ajudam no tratamento de doenças ou que ajudam a melhorar a saúde ou qualidade de vida da pessoa. Popularmente, as plantas medicinais são utilizadas sob a forma de chás ou infusões, mas também existem vários extratos de plantas que podem ser consumidos sob a forma de pó, cápsulas ou comprimidos e que, normalmente, apresentem melhor efeito, já que contêm uma concentração maior do ativo da planta. Embora as plantas medicinais possam ser uma boa forma de manter a saúde, prevenir a doença e até completar o tratamento de vários problemas crônicos, não devem ser utilizadas para substituir qualquer orientação dada pelo médico e o seu uso deve, também, ser informado para o médico, já que várias plantas podem ter interação com os medicamentos que estão sendo receitados', NULL, NULL, '2021-10-13 15:21:40', '2021-11-03 21:38:09', 10, 3, 9, 5, true, 6.25, 2.33749999999999991);
INSERT INTO public.projeto VALUES (46, 'LOGICMANAGER: MóDULO DE GERENCIAMENTO AO PROFESSOR TRI-LOGIC', 'O presente trabalho consiste no desenvolvimento do LogicManager, um módulo de gerenciamento ao professor no ambiente gamificado Tri-Logic. O Tri-Logic, desenvolvido pelo projeto de pesquisa Uso de Técnicas de Gamificação como Auxílio ao Ensino e Aprendizagem de Lógica de Programação, conta com o uma série de exercícios de lógica de programação aliados a técnicas de gamificação para motivar o aluno usuário. No entanto, ele possui uma limitação, que é a falta de interatividade do professor, uma vez que todos os diálogos e modais apresentados são estáticos. Com o LogicManager, o professor poderá gerenciar os diálogos e modais apresentados no ambiente, adaptando-os da forma como achar melhor, gerenciar as oficinas e suas inscrições, determinando o período em que ocorrerão e quais fases do ambiente serão disponibilizadas, e, por fim, acompanhar o desempenho do aluno por meio de relatórios estatísticos com os erros e acertos em cada uma das fases. A metodologia para o desenvolvimento desse módulo consiste em uma abordagem qualitativa, na qual foram utilizados dois tipos principais de pesquisa, sendo elas pesquisa participante e grupos focais. Após finalizada a implementação, o sistema passará por uma etapa de testes e validações, na qual será disponibilizado para os professores da disciplina de lógica de programação que, após a utilização, responderão a um questionário. Os dados obtidos serão analisados para que novas adequações sejam realizadas, conforme mostrar-se necessário no resultado, a fim de otimizar o funcionamento do sistema.', NULL, NULL, '2018-08-06 19:09:34', '2018-09-20 19:47:07', 6, 2, 6, 5, true, 9, 9.28749999999999964);
INSERT INTO public.projeto VALUES (158, 'OBSERVAçãO DE PEIXE EM AQUáRIO', 'Os peixes vivem em qualquer lugar que seja espaçoso para eles nadarem, num ambiente livre de calcário, o que aumenta a dureza da água. Aquariofilia,é a prática de criação de peixes em aquário, com ênfase em peixes ornamentais , ou seja, de espécies que são selecionados pela sua exuberância na cor e forma e pela facilidade de mantê-los em cativeiro. Esse foi o pretexto da escolha do tema a ser trabalhado. As principais características desses animais é que se locomovem por nadadeiras, têm uma forma corporal fusiforme, membros transformados em barbatanas ou nadadeiras e são sustentadas por raios ósseos ou cartilaginosos. Eles respiram por guelras ou brânquias, absorvendo oxigênio dissolvido na água. O revestimento corporal é constituído de escamas. A maioria das espécies de peixes faz a fecundação externa. As fêmeas expelem os seus ovos e os machos o fertilizam com o seu sêmen. Dois dos peixes ornamentais mais procurados no comércio são dos gêneros Xiphophorus maculatus e Betta splendens. Poucos sabem o que realmente eles precisam para nadar saudáveis: três a quatro bolinhas de ração. O aquário não precisa ser imenso e nem ter filtros de limpeza. Quando deixados na água, sem cuidados, o peixe pode se estressar, desenvolver doenças e morrer. A temperatura da maioria dos aquários é em torno de 27°c a 30°c. Após estudo das características e observação de um exemplar de Betta, o objetivo do projeto foi atingido, visto o aprendizado e o domínio do assunto.', NULL, NULL, '2018-08-10 21:02:57', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (238, 'E-LEGG - A VERDADEIRA PARTICIPAÇÃO POPULAR', 'Atualmente a democracia representativa passa por um período de crise a nível mundial, algo que evidencia problemáticas que devem ser amplamente discutidas. No Brasil, segundo levantamento do Instituto Latinobarómetro, no ano de 2017, cerca de 87% da população não está satisfeita com a democracia. Esta insatisfação motiva um senso de não representatividade por parte dos eleitores, levando-os a desacreditarem e até mesmo questionarem a necessidade das estruturas do estado. Entretanto, é necessário que o Estado altere-se, modificando sua forma de atuação, para que o mesmo acompanhe as transformações sociais. A utilização das novas tecnologias para realizar comunicação instantânea é notável na atual conjuntura social. Contudo ainda há um potencial a ser trabalhado, onde a tecnologia pode ser utilizada como forma de integração social, constituindo-se como forma de inclusão a indivíduos esquecidos pelo poder político. A partir deste contexto surge a plataforma proposta, denominada e-Legg, que visa, como objetivo principal, a alteração dos processos internos no legislativo municipal de Gravataí-RS, de forma a promover a participação popular e buscar construir uma democracia verdadeiramente representativa que supra os anseios da sociedade. A plataforma proposta decorre do Trabalho de Conclusão de Curso de Curso Técnico em Informática para Internet e encontra-se em processo de desenvolvimento, tendo sido comparada com outros quatro trabalhos relacionados. Neste trabalho são discutidos resultados parciais, sendo demonstrado o desenvolvimento do projeto até o presente momento. Ao final da implementação serão realizados testes juntamente aos alunos da Instituição, que votarão e avaliarão projetos que estão em processo de tramitação no Poder Legislativo. Estes testes permitirão, em tese, avaliar as funcionalidades propostas e validar a utilização da plataforma em circunstâncias reais pela população.', NULL, NULL, '2019-08-08 09:08:53', '2019-09-19 20:55:47', 6, 2, 7, 5, true, 8.125, 8.625);
INSERT INTO public.projeto VALUES (422, 'IMPACTOS AMBIENTAIS PÓS-PANDÊMICOS NO BRASIL', 'A chegada do Coronavírus no Brasil ocorreu em fevereiro de 2020. E embora sejam frequentes os debates sobre a forma como o isolamento social afetou a população, são frequentes as atualizações de dados, também, sobre os impactos ambientais que vêm ocorrendo no território nacional. Uma vez que atividade humana é responsável por gerar elevados níveis de poluição, com o isolamento social foi possível notar taxas reduzidas de dióxido de carbono no ar, no Brasil, principalmente nas grandes metrópoles como São Paulo. Dessa forma, esse trabalho possui o objetivo principal de investigar e analisar os impactos no ambiente brasileiro, durante o período pandêmico, e refletir sobre a situação do meio ambiente pós-pandêmico. Para o trabalho está sendo realizada uma pesquisa de artigos publicados entre 2020 e 2021, disponíveis no Google Acadêmico. Os resultados obtidos são classificados em 5 categorias, sendo elas “Alterações na composição do ar atmosférico” (1), “Amazônia brasileira” (2), “Geração de resíduos sólidos” (3), “Queimadas no Brasil” (4) e “Análise geral dos impactos ambientais causados na pandemia” (5). Em seguida, conforme o andamento do trabalho, pretende-se comparar os dados obtidos dos artigos, à dados de outros grandes países como China e Estados Unidos, à fins de descobrir se a forma como foi administrada a pandemia possui relação com os impactos sofridos no ambiente; e quais seriam outras razões justificantes aos impactos. Até o presente momento, conclui-se que, no Brasil, grandes centros como São Paulo, Rio de Janeiro e Brasília, por exemplo, tiveram diminuição significativa nos níveis de poluição do ar. Na cidade paulista, o isolamento social contribuiu para a redução de 50% dos poluentes primários –emitidos diretamente das fontes poluidoras. Em relação mundial, só nos primeiros meses de 2020, o mundo emitia cerca de um milhão de toneladas de CO2, a menos por dia.', NULL, NULL, '2021-10-13 22:23:22', '2021-11-04 23:28:38', 8, 2, 9, 5, true, 9, 5.22499999999999964);
INSERT INTO public.projeto VALUES (170, 'ASSISTAEM1MINUTO: JORNALISMO ESCOLAR ATRAVéS DE VíDEOS-MINUTO', 'Este trabalho apresenta um projeto jornalismo escolar para melhorar a comunicação da Escola Municipal de Ensino Fundamental Assis Brasil. O objetivo do nosso trabalho é criar um veículo de notícias sobre a escola e a comunidade através de vídeos-minuto. Para isso, fizemos uma pesquisa bibliográfica em páginas da internet sobre videos-minuto, redes sociais e sobre como buscar pautas na escola. Como procedimentos metodológicos para a produção das notícias, nosso grupo desenvolveu uma rotina: buscar pautas na escola e na comunidade; planejar roteiros, muitas vezes registrando-os por escrito; gravar os materiais audiovisuais brutos em smartphones; editar as gravações no celular; e, por fim, publicar os vídeos-minuto. Para efetivar esse último procedimento, criamos uma conta no Instagram (@assistaem1minuto) e a conectamos com a página da escola no Facebook. Até o presente momento, publicamos nove vídeos. Através desse projeto, estamos aprendendo lidar com a vergonha, a nos tornar mais comunicativos e a fazer jornalismo na escola desde a adolescência.', NULL, NULL, '2018-08-10 22:34:30', '2018-09-20 19:47:07', 11, 3, 6, 5, true, 8.75, 9.30000000000000071);
INSERT INTO public.projeto VALUES (175, 'LYRICKED - APLICAçãO WEB PARA APRENDIZADO DA LíNGUA INGLESA ATRAVéS DE MúSICAS', 'O trabalho consiste em uma aplicação web que irá disponibilizar aos professores uma forma mais dinâmica de apresentar a língua inglesa aos seus alunos. A partir da aplicação procura-se fugir da forma padrão de ensino através da utilização de um serious game. O principal problema é a dificuldade no aprendizado de um novo idioma. Pois é notável que alunos que não tiveram uma boa base de ensino da língua inglesa possuem muitas dificuldades quando ingressam no Ensino Médio. O inglês passa a ser uma matéria bastante importante na vida cotidiana, tanto por ser cobrada em vestibulares, quanto para o mercado de trabalho. A dificuldade surge quando escolas especializadas em cursos de línguas estrangeiras usam uma dinâmica diferente para o ensino, diferindo do método adotado em escolas de Ensino Médio e Fundamental. Este método tradicional pode não ser o mais adequado para aprender um novo idioma, e muitas vezes deixa os alunos sem interesse nos estudos. A proposta de solução é o Lyricked, uma aplicação web que auxiliará o aluno no aprendizado da língua inglesa. O Lyricked utilizará músicas e as letras das mesmas para ajudar na memorização de palavras. Já que o interesse por músicas estrangeiras é relativamente alto entre os jovens, a proposta apresentada disponibiliza um modo de ensino que será de maior interesse. O professor poderá enviar uma música e retirar palavras ou as frases da letra. Com isso, o professor dará ao usuário um desafio para identificar o que ele escutar e responder corretamente às lacunas vazias.', NULL, NULL, '2018-08-10 23:04:21', '2018-09-20 19:47:07', 6, 2, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (383, 'DITADURA MILITAR NO BRASIL - O ASSASSINATO DE EDSON LUIS E A PASSEATA DOS CEM MIL', 'A pesquisa se trata da Ditadura Militar no Brasil. O tema foi escolhido com a finalidade de analisar os fatos ocorridos e tentar compreender se a imprensa brasileira foi instruída a censurar o assassinato de Edson Luís, e após a Passeata dos Cem Mil, tentar remodelar os argumentos já afirmados. Buscamos compreender como a sociedade da época reagia ao estado político daquele período. A análise em estudo deverá prover a conscientização dos acontecimentos históricos que consolidaram um período contra uma população à procura de seus direitos como cidadãos. Buscamos, como objetivo de foro íntimo e acadêmico, devanear e constatar as verdades sobre os fatos ocorridos, concluindo se as ações tomadas tanto pela sociedade, quanto pela administração política, foram justas ou insensatas. A metodologia está fundamentada no estudo de periódicos como fonte primária e bibliografias históricas como fonte secundária. Iniciamos realizando a leitura das fontes secundárias de MACIEL, Maria; PESAVENTO, Sandra; TAVARES, Maria; VENTURA, Zuenir; WASSERMAN, Claudia; KOCH, Adolar e BAUER, Caroline, e, após isso, realizamos a coleta de dados nos jornais Correio da Manhã (RJ) e Jornal do Brasil (RJ) publicados entre os dias 29 de março e 27 de junho de 1968. Por fim, a imprensa brasileira da época relatou de forma legítima as informações sobre a realidade dos acontecimentos, as matérias eram justificadas e estruturadas em base de entrevistas com protestantes, políticos, policiais e a sociedade em geral. Então, é adequado afirmar que nossos objetivos de compreender a metodologia da imprensa; analisar a repercussão; constatar tais manchetes e analisar o momento histórico no qual o país passava foram concluídos. Em questão aos acontecimentos, compreendemos que as ações tomadas pelos militares foram incoerentes, insensatas e injustas. Portanto conclui-se através das pesquisas feitas para projeto de pesquisa e este artigo, que seria e foi necessário o povo tentar intervir neste governo opressor.', NULL, NULL, '2021-10-01 16:06:27', '2021-11-03 19:14:25', 3, 2, 9, 5, true, 9.5, 9.02499999999999858);
INSERT INTO public.projeto VALUES (386, 'SMARTLEG VI - PROTÓTIPO DE PRÓTESE TRANSFEMORAL INTELIGENTE', 'Dos tipos de amputações realizadas na perna, a amputação transfemoral é nociva para o amputado, pois ele perde duas articulações necessárias para a caminhada humana: a articulação do joelho e a do tornozelo. Propondo uma solução comercial, são desenvolvidas próteses ativas com o objetivo de simular o joelho humano proporcionando maior naturalidade para a caminhada do usuário. Porém, possuem elevado custo para a maioria da população mundial e utilizam uma tecnologia de sensores invasivos. Uma solução com custo inferior às próteses ativas são as passivas, que oferecem apenas um apoio ao usuário. Essas próteses não oferecem nenhuma adaptação ao biotipo do protetizado, tampouco geram algum movimento. Partindo da discussão supracitada, chegou-se ao seguinte problema de pesquisa: como desenvolver um protótipo de prótese inteligente capaz de simular a marcha humana - adaptando-se ao biotipo de cada usuário -, e que seja de baixo custo, a partir de melhorias embasadas no material de estudo herdado pelas etapas anteriores da pesquisa? Tendo em vista solucionar esse problema, o objetivo deste projeto é desenvolver a sétima proposta de protótipo de prótese transfemoral inteligente, com tecnologia remodelada e avançada o suficiente para que se possa realizar testes seguros em seres humanos. Considerou-se construir um protótipo com um novo sistema de redução, com a implementação do sistema de controle e de sistema eletrônico estudados na etapa anterior, sendo hipotetizado que esta possa culminar na construção de uma prótese inteligente de baixo custo. Para isto, o sistema mecânico será redimensionado nos softwares SolidWorks e Fusion 360. Neles, também serão realizadas simulações a fim de testar a sua resistência mecânica sob aplicação de carga, além de um sistema eletrônico capaz de processar os dados de um sistema de controle de redes neurais artificiais.', NULL, NULL, '2021-10-05 12:37:16', '2021-11-04 09:48:20', 7, 2, 9, 5, true, 9.125, 9.26249999999999929);
INSERT INTO public.projeto VALUES (177, 'GOBOV - SISTEMA WEB DE GERENCIAMENTO BOVINO', 'Uma análise do processo de criação de bovinos em uma propriedade rural demonstra que o ciclo de vida do animal necessita de um acompanhamento rigoroso e contínuo. Os registros de informações relativas aos animais adquirem profunda relevância uma vez que, a falta de informações pode ocasionar um descontrole sanitário. A problemática dos pecuaristas, que são o público alvo do presente trabalho, se dá no fato de que embora o registro individual dos animais seja fundamental por conter informações indispensáveis ao manejo do animal, não é essa uma prática habitual, por se tratar de uma tarefa muitas vezes complicada, quando feita somente no papel, uma vez que este registro pode ser perdido ou danificado. O presente trabalho propõe-se a desenvolver um sistema web, visando gerenciar animais, proporcionando um controle de medicações, bem como a aplicação de um controle de peso. Quanto a metodologia de pesquisa, optou-se pela abordagem qualitativa, uma vez que buscou-se olhar realidade de fazendeiros de Caçapava do Sul. Possui natureza aplicada pois a plataforma tenta a solução de problemas específicos. O procedimento utilizado foi o estudo de caso, que é uma investigação empírica que investiga um fenômeno contemporâneo dentro de seu contexto da vida real, no caso, a realidade dos fazendeiros. Para a metodologia de desenvolvimento, utilizou-se a UML por se tratar de uma família de notações gráficas, apoiadas por um metamodelo único, que ajuda na descrição e no projeto de sistemas de software, particularmente daqueles construídos utilizando o estilo orientado a objetos(OO).', NULL, NULL, '2018-08-10 23:19:57', '2018-09-20 19:47:07', 6, 2, 6, 5, true, NULL, 8.12142857142857189);
INSERT INTO public.projeto VALUES (173, 'AS AVENTURAS DE JOãO E KREGORY: O PROCESSO DE CRIAçãO DE UMA HISTóRIA EM QUADRINHOS', 'Este trabalho apresenta o processo de criação de uma história em quadrinhos por dois adolescentes. A ideia surgiu durante as aulas de Língua Portuguesa em que tínhamos de criar personagens e organizar uma narrativa. Como gostamos muito de desenhar, decidimos criar contar a história através dos quadrinhos. O objetivo dessa pesquisa é produzir uma história em quadrinhos. Para isso, seguimos os seguintes passos: criamos a primeira versão da história; realizamos uma pesquisa bibliográfica sobre a história dos gibis e sobre os elementos de uma história em quadrinhos. Nesse momento estamos no processo de construção da segunda versão da nossa história. A partir da pesquisa bibliográfica, percebemos a necessidade de readequar esteticamente os nossos quadrinhos, padronizando as cores e os balões e reestruturando a sequência narrativa. Como conclusão, apontamos que, com criatividade e pesquisa, dois adolescentes podem ser autores de um gibi.', NULL, NULL, '2018-08-10 22:51:03', '2018-09-20 19:47:07', 11, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (179, 'GRAVIDEZ PRECOCE', 'Neste projeto o objetivo foi abordar o tema &#34;Gravidez Precoce&#34;, assunto polêmico e não discutido o suficiente para alertar nossos jovens à prevenção de uma gravidez indesejada. Foram coletados dados junto à Secretaria Municipal de Saúde, setor de Vigilância em Saúde, para mostrar o percentual de jovens grávidas em Canoas, objetivando um melhor conhecimento sobre a situação e incentivo dos diálogos dos familiares com os jovens. Através deste órgão e pesquisas sobre o tema, obteve-se um percentual antigo e um recente, de jovens grávidas, realizando-se um comparativo. Jovens de 13 a 18 anos precisam de toda orientação, não só da família, mas também de profissionais na área, sempre mantendo o diálogo e sendo verdadeiros uns com os outros. Assim, evitamos também o abandono dos pais e até mesmo do (a) companheiro (a). Caso aconteça o fato tema do projeto, abandono nunca é a solução. Conselhos e auxílio aos meninos e meninas para passar por isso, são válidos, tendo uma experiência boa de modo geral.', NULL, NULL, '2018-08-10 23:28:23', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, 6.125, NULL);
INSERT INTO public.projeto VALUES (182, 'MEDINDO A FREQüêNCIA CARDíACA', 'A freqüência cardíaca é a velocidade do ciclo cardíaco medida pelo número de contrações do coração por minuto (bpm). Ela pode variar de acordo com as necessidades físicas do organismo. É usualmente igual ou próxima à pulsação arterial medida em qualquer ponto periférico e pode ser alterada por exercício físico, sono, ansiedade, estresse, doenças ou ingestão de drogas. Quanto mais esforço o coração precisa fazer para mandar o sangue para o corpo, maior será a freqüência cardíaca dessa pessoa. A arritmia cardíaca, por exemplo, pode levar um acidente vascular cerebral (AVC) ou infarto, pois se configura como um ritmo cardíaco muito acelerado. O trabalho consiste em análise da freqüência cardíaca tomando-se como base um adulto sedentário, um adulto que pratica atividade física diária e uma criança. Pesquisou-se a variação de BPM em cada caso e fez-se o levantamento, usando-se o método de por o dedo indicador e o dedo médio ao lado do pescoço ou no pulso fazendo-se a contagem manualmente. Os dados coletados conferem com os dados pesquisados,', NULL, NULL, '2018-08-10 23:46:27', '2018-09-20 19:47:07', 10, 3, 6, 2, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (244, 'O CAOS DO SISTEMA PENITENCIÁRIO NO BRASIL E SUAS CONSEQUÊNCIAS', 'O trabalho tem o objetivo comparar o sistema prisional brasileiro com o de outros países considerados de primeiro mundo. O Brasil é falho no que se trata de investimentos em políticas públicas, o sistema carcerário está cumprindo apenas a função de punir, deixando a desejar no que se refere às funções ressocializadoras. Os detentos são isolados em estabelecimentos penais abarrotados, não recebem orientação no sentido de recuperação. Isso contribuiu para a elevação dos índices de reincidência penal entre os egressos. A Noruega investe em projetos diversos, inclusive no sistema carcerário. Além disso, possui o melhor IDH do mundo e sua taxa de desemprego é inferior a 5%. Já a Europa conta com infra-estrutura e investimentos, há um processo de reabilitação com o detento. Políticas públicas capazes de promover valorização humana e a inclusão social podem contribuir para a humanização da prisão e fazer com que ela deixe de ser um castigo e torne-se um ambiente de educação, aprendizagem e preparação para o trabalho, dando a possibilidade profissional, social e humana ao preso.', NULL, NULL, '2019-08-08 18:01:50', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 4.625, NULL);
INSERT INTO public.projeto VALUES (420, 'TINTIM NO CONGO: A NATURALIZAÇÃO COLONIALISTA.', 'O trabalho de pesquisa surgiu da leitura, na disciplina de História, da HQ do Tintim no Congo, escrita pelo cartunista, belga, Hergé, e publicada na forma de livro em 1931. Na obra o cartunista apresenta os africanos de forma estereotipada pelo discurso colonialista, seja na forma indolente e preguiçoso, seja ainda da inferioridade e da incivilidade dos africanos, incapazes de construir uma civilização sem a presença do homem branco europeu, reforçando os atributos do racismo. O objetivo da pesquisa é demonstrar como o HQ naturalizou um racismo velado, uma visão colonialista e estereotipada dos africanos, que afirma os colonizadores e subjuga os colonizados. A nossa metodologia foi analisar a obra do HQ, utilizando alguns eixos de leituras (racismo, estereótipos coloniais, missão civilizatória eurocêntrica, e a exploração imperialista do Congo Belga) que aparecem nas tirinhas, selecionando-as e problematizando-as. Ainda lemos a versão da tradução brasileira, e a versão Portuguesa, que ameniza o discurso colonialista, comparada com a versão original. Uma hipótese desta suavização reside justamente pelo fato do quadrinho ser revisto após a II Guerra Mundial, em que pese na versão original, manter o discurso imperialista, mesmo após as atrocidades belgas no Congo do século XIX, na extração do látex e do marfim. Nos resultados demonstraremos o discurso colonialista presente na HQ, considerando ainda que era destinado a um público infantil, naturaliza e estereotipa a África Negra.', NULL, NULL, '2021-10-13 22:08:31', '2021-11-03 19:33:45', 11, 3, 9, 5, true, 9.25, 7.88749999999999929);
INSERT INTO public.projeto VALUES (306, 'POSTE DE LUZ AUTOSSUSTENTÁVEL', 'O Projeto consiste em criar um sistema chamado de Poste de Energia Autossustentável, o qual irá gerar energia através de 2 fontes, uma Eólica e o outra Solar e que mantém a conservação de energia através de um sistema simples de baterias. Este Poste além de fornecer iluminação, contará com uma tomada de serviço padrão USB, permitindo também a alimentação de pequenos dispositivos eletrônicos. O objetivo desse Projeto é levar as localidades onde não há energia comercial (oriunda das concessionárias) ou ainda onde o custo de infraestrutura (postes e fiação) para chegar ao local é elevado. Exemplos: Estradas no interior, sítios, fazendas, localidades que precisam de iluminação. Para elaboração deste Projeto, serão aplicados conhecimentos oriundos das principais disciplinas de Física, Matemática, Química incluindo Biologia, Sociologia e Língua Portuguesa. De Física serão utilizados conhecimentos de Eletricidade, Mecânica e Óptica (leis da refração). De Química serão utilizados conhecimentos de Constituição da Matéria, Materia e Energia e Reações Químicas. A base Matemática fundamentara todo o Projeto, desde as medidas de cada grandeza aplicada em Física e Química até a mensuração de custos do Projeto e sua aplicabilidade real na sociedade. Relativo a Biologia, estamos falando de um Projeto de Sustentabilidade com aplicabilidades que vão do indivíduo ao coletivo, por isso a relação com aspectos da Sociologia. E obviamente conhecimentos de Língua Portuguesa que permitirão redigir todo o Projeto não somente na forma escrita, mas na condução oral da exequibilidade deste. Em resumo é um Projeto com ambições reais e aplicabilidade prática que permitirá que comunidades isoladas tenham acesso a energia elétrica e proporcionando os benefícios oriundos desta.', NULL, NULL, '2019-08-10 14:38:45', '2019-09-19 12:09:37', 7, 2, 7, 5, true, 7.125, 8.33928571428570109);
INSERT INTO public.projeto VALUES (373, 'YOURTEACHER - PLATAFORMA WEB PARA AUXILIAR NA BUSCA POR PROFESSORES PARTICULARES', 'A pandemia decorrente da Covid-19 teve impacto negativo na educação de grande parte dos estudantes, tendo em vista o fechamento das escolas durante meses. Estudo do UNICEF em parceria com o Cenpec Educação constatou que, em novembro de 2020, quase 1,5 milhão de crianças e adolescentes não frequentavam a escola. Além disso, 3,7 milhões de pessoas, mesmo estando matriculadas, não conseguiram manter o aprendizado em casa e não tiveram acesso às atividades escolares. Levantamento feito pela Associação Brasileira de Educação a Distância (ABED), sobre as atividades remotas na educação durante a pandemia, demonstrou que 67% dos alunos se queixam de dificuldades em estabelecer e organizar uma rotina diária de estudos. Em meio a essa situação surge a plataforma web YourTeacher, tendo como principal objetivo auxiliar pais e estudantes na procura por professores particulares que auxiliem no aprendizado dos estudantes. O software permitirá o cadastro como professor ou estudante. Ao usuário professor será permitido o anúncio do seu perfil, contendo uma breve biografia, os conteúdos a serem ensinados, disponibilidade de horários e o valor cobrado por suas aulas. O usuário aluno terá como funcionalidade principal a busca por professores, com uma série de filtros que facilitam a procura por um docente que atenda os seus requisitos. Além disso, é oferecida a comunicação entre professor e estudante através de correio eletrônico ou Whatsapp. As principais diferenças entre essa plataforma e outras com premissas semelhantes são o sistema de filtragem, a integração ao Whatsapp e a listagem de perfis selecionados pelo usuário. O projeto está na etapa inicial, sendo desenvolvido com o framework React integrado ao banco de dados PostgreSQL. As telas de login e cadastro estão com seus protótipos concluídos. Os próximos passos são a prototipação das demais telas, a implementação da lógica e a formação de um grupo de professores e alunos para testes.', NULL, NULL, '2021-09-23 15:32:22', '2021-11-04 21:34:07', 6, 2, 9, 5, true, 8.25, 9.26249999999999929);
INSERT INTO public.projeto VALUES (232, 'INICIAÇÃO CIENTÍFICA: A CONSTRUÇÃO PROFISSIONAL POR MEIO DO MÉTODO CIENTÍFICO: A CONSTRUÇÃO PROFISSIONAL POR MEIO DO MÉTODO CIENTÍFICO', 'A Iniciação Científica (IC) é uma forma de introduzir os alunos na pesquisa técnico-científica. Através do apoio teórico e da base metodológica para a realização dos projetos, a IC contribui na formação profissional dos que participam. Uma dessas formas de colaboração é a aprendizagem de técnicas e métodos científicos modernos. Além disso, estimula os alunos para o desenvolvimento do pensamento científico e da criatividade. Este trabalho tem por objetivo conhecer e analisar a importância e os impactos da iniciação científica nos estudantes. Para tanto, propusemos um questionário online para universitários de Porto Alegre, a fim de entender a importância da IC na construção da identidade profissional daqueles que já têm essa determinada. Com os dados coletados, apontados por 104 alunos, verificamos que a IC é importante para a carreira acadêmica dos estudantes, uma vez que 81 (84,24%) alunos afirmaram acreditar na importância da IC e apenas 23 (15,76%) revelaram não acreditar. Ademais, foi questionada a colaboração da IC para a escolha profissional. O resultado foi novamente positivo, pois 76 pessoas responderam que houve influência da IC na sua escolha profissional, enquanto os demais 28 responderam que não. Em conclusão, observamos que existe uma relação clara entre a carreira profissional escolhida e os projetos de IC desenvolvidos. Portanto, em uma sociedade onde é cada vez mais complexo escolher uma profissão que exerceremos durante a vida inteira, esse é um ponto a ser levado em conta na formação de uma identidade profissional. Logo, como o resultado nos comprova, os projetos de IC, os quais fortalecem o pensamento científico e profissional, devem ser projetos essenciais nas escolas onde o progresso profissional, pessoal e acadêmico é objetivado, assim projetando um conhecimento prévio sobre o que o discente pode escolher para sua formação profissional, sem temer a escolha de uma ocupação vitalícia.', NULL, NULL, '2019-08-07 13:00:44', '2019-09-19 12:10:15', 3, 2, 7, 5, true, 7.5, 9.90000000000000036);
INSERT INTO public.projeto VALUES (240, 'AFETO SIM, ASSéDIO NãO: ANáLISE DO IMPACTO DE CAMPANHA DE COMBATE AO ABUSO INFANTIL EM ALUNOS DO ENSINO FUNDAMENTAL.', 'A presente pesquisa objetiva analisar o impacto que campanhas de combate ao abuso sexual infantil provocam em alunos do Ensino Fundamental. Diante do alarmante número de casos de abuso contra crianças e adolescentes, em nossa cidade e em todo país, e considerando o crescente número de operações policiais que combatem crimes sexuais contra menores, levar o assunto em questão para as salas de aulas se mostra necessário e desafiador, levando em conta a complexidade e delicadeza do tema. Em questionário realizado com o público alvo, trinta alunos do Quinto Ano do Ensino Fundamental, se constatou ações preventivas contra o abusivo infantil era tema desconhecido ou conhecido superficialmente por quase totalidade dos entrevistados, a ponto de alguns afirmarem jamais terem recebido qualquer tipo de orientação sobre a questão. Diante da necessidade de esclarecimento do assunto, iniciamos uma série de atividades de conscientização sobre a importância do respeito à dignidade sexual de todas as pessoas, a se destacar palestras e jogos. Após a realização das atividades descritas, através da observação e da realização de novo questionário, foi possível constatar que grande parcela dos alunos demonstrou ter compreendido como identificar situações de risco, bem como as ações a serem tomadas em tais situações.', NULL, NULL, '2019-08-08 09:10:03', '2019-09-19 10:43:49', 11, 3, 7, 5, true, 8.25, 9.92500000000000071);
INSERT INTO public.projeto VALUES (377, 'CRAPD - CADEIRA DE RODAS ADAPTADA PARA PACIENTES COM DISTONIA', 'O presente projeto, com enfoque na área da tecnologia assistiva e engenharia mecânica, busca a elaboração de um projeto de cadeira de rodas adaptada que tenha como objetivo o amparo de movimentos involuntários espasmódicos e distônicos de idosos. Por conta disso, pode acontecer que, em determinado momento, os movimentos involuntários façam com que o idoso jogue seu peso para trás, fazendo com que os membros inferiores e superiores se mexam de forma brusca, ocasionando em uma situação perigosa. Recentemente, a adoção de dispositivos de mobilidade tem aumentado em decorrência do envelhecimento populacional. Essa realidade é cada vez mais evidenciada em instituições de longa permanência, como lares de idosos. No entanto, a quantidade de cadeiras de rodas existentes para tal finalidade no mercado é alta, mas com custo bastante elevado. Assim, decidiu-se, a partir de uma cadeira de rodas já existente, realizar as adaptações necessárias por meio do software Autodesk Inventor a fim atender o público acima citado, promovendo conforto, segurança e acessibilidade. A adaptação realizada na cadeira de rodas possui cintos para fixação dos membros superiores e inferiores, além de ter apoios que vão proporcionar uma fixação e certo conforto, respectivamente. O referencial teórico da pesquisa foi feito em sites, livros, artigos científicos e revistas, buscando fundamentar os conhecimentos acerca de tecnologia assistiva, engenharia mecânica, idosos e os movimentos involuntários espasmódicos e distônicos. Como resultado final, concluiu-se que a realização da adaptação projetada é viável e atende às necessidades dos pacientes que a utilizarão em geral. No entanto, vale salientar, como etapa futura, o melhoramento da cadeira de rodas como um todo, podendo adaptar o dimensionamento às medidas e necessidades específicas de cada paciente, de forma individual.', NULL, NULL, '2021-09-28 15:05:37', '2021-11-05 12:25:34', 7, 2, 9, 5, true, 9.625, 8.80000000000000071);
INSERT INTO public.projeto VALUES (329, 'INSTITUIçõES DE ENSINO BRASILEIRAS: ESTUDO E OBSERVAçãO', 'Nas últimas décadas, as instituições de ensino brasileiras, vêm passando por momentos considerados conturbados por muitos. Portanto, por conta das opiniões ouvidas pelos integrantes, fizemos esse trabalho, buscando trabalhar as informações coletadas para uma melhora da qualidade das instituições. Visamos apontar os principais problemas observados nas instituições de ensino brasileiras, evidenciando-os e propondo soluções. Além disso, buscamos relatar os principais distúrbios estruturais, no método de ensino e na organização das instituições como um todo. Nesse trabalho usamos formulários que divulgamos em nossas redes sociais, com colegas e professores da nossa escola; além disso, utilizamos pesquisas na internet e com educadores e estudantes de determinadas sociedades de ensino. Após a divulgação de um questionário criado pelos nossos integrantes, obtivemos 112 respostas, das quais 93,8% são de alunos, 4,4% são professores e 1,8% são pais. 89,3% dos entrevistados replicaram que sempre ou geralmente há um professor/pedagogo na escola, 10,7% raramente ou nunca há. Acerca da quadra de esportes e as salas de artes, em geral 65,1% possuem ambos espaços e 34,9% não os possuem. Após a análise dos dados coletados, constatamos que as instituições de ensino brasileiras estão em condições bem inferiores ao ideal, considerando que apenas metade dos ambientes disponibilizados foram classificados como bons.', NULL, NULL, '2019-08-10 22:17:48', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 3.125, NULL);
INSERT INTO public.projeto VALUES (290, 'SISGETEC - MóDULO DE HOMOLOGAçãO E AVALIAçãO', 'A Feira de Ciências e Inovação Tecnológica (IFCITEC), realizada no IFRS-Campus Canoas desde o ano de 2013, tem tido um aumento significativo de projetos inscritos, nos níveis de ensino fundamental e médio e, como resultado, no número de pessoas envolvidas ao decorrer dos anos nos quais tem sido implementada. Para auxiliar na organização do evento, a partir do ano de 2018, foi desenvolvido e implementado um sistema, intitulado Sistema de Gerenciamento de Evento IFCITEC (SISGETEC) que tem como objetivo auxiliar no gerenciamento das questões administrativas da feira. Embora o sistema tenha sido de grande ajuda no processo de organização da feira, tratando de forma informatizada os diversos processos, uma grande parte igualmente importante para o sucesso da feira não está satisfatoriamente implementada, uma vez que não era foco do SISGETEC: as homologações e avaliações dos projetos. Até o momento, as mesmas são realizadas através de formulários no Google Forms e os formulários utilizados através de plataforma externa, os quais acabam não sendo vinculados ao sistema e, consequentemente, não possuem uma gerência adequada, precisando ser refeitos a cada ano. A partir do conhecimento adquirido pela autora sobre o funcionamento da feira no ano de 2018, através da participação ativa como bolsista para a realização da VI IFCITEC, foi pensado e elaborado um módulo que fosse responsável por gerenciar os formulários de homologação e avaliação necessários para o evento e integrá-los ao SISGETEC. Para a constatação dos resultados, serão feitos testes efetivos durante o período de homologação e avaliação da VII IFCITEC. Durante o primeiro uso do novo módulo integrado ao sistema de gerenciamento, é esperada uma maior estabilidade no gerenciamento das homologações e avaliações de projetos, fator de imensa importância e necessidade para o evento.', NULL, NULL, '2019-08-09 23:04:16', '2019-09-17 16:12:00', 6, 2, 7, 2, true, 10, NULL);
INSERT INTO public.projeto VALUES (218, 'SYSTEM OUT: KERNEL PARA SOFTWARES INDEPENDENTES', 'Este projeto tem como objetivo o desenvolvimento de um exokernel com o intuito de facilitar ao programador conseguir rodar suas aplicações em um computador sem a intervenção de um sistema operacional e com acesso completo ao hardware. O problema abordado está na dificuldade que um desenvolvedor tem em desenvolver um programa para iniciar diretamente na máquina, sem um intermédio de um SO e sem concorrência de outros processos. Essa dificuldade existe pois o computador necessita de diversos ajustes na inicialização do computador para que ele libere todas as suas funcionalidades e fazer um software para efetuar essa inicialização pode demandar muito tempo o que pode acabar por desmotivar o desenvolvedor a continuar. Por essa razão, foi se desenvolvido um kernel que já faz toda a inicialização básica do computador deixando a cargo do desenvolvedor apenas o desenvolvimento do software a ser rodado. O Kernel é um programa capaz de organizar os diversos recursos de um computador, fazer sua inicialização de forma adequada, gerenciar dispositivos do hardware, lidar com interrupções, e também gerenciar o modo como os programas são executados e carregados na memória. Para desenvolver um kernel, deve se identificar qual a melhor arquitetura que se encaixaria no escopo proposto pelo trabalho, por isso se escolheu a arquitetura de um exokernel, que diferentes de outras arquiteturas como a de kernel monolítico ou micro-kernel foge do foco de que o sistema deve fornecer uma forte abstração para as aplicações, e em vez disso, se concentra na segurança do hardware e permite aos softwares instalado nele um maior controle no ambiente de processamento. Para o funcionamento do software o programador irá inserir os arquivos de código do programa dele junto aos arquivos do kernel, e será gerado um arquivo ‘.ISO’ que o mesmo pode colocar em um CD ou diretamente em alguma máquina virtual e iniciar a execução do software junto ao exokernel.', NULL, NULL, '2019-08-06 16:01:28', '2019-09-19 11:31:33', 6, 2, 7, 5, true, 8, 8.84999999999999964);
INSERT INTO public.projeto VALUES (400, 'OS PREJUíZOS CAUSADOS NO ENSINO PúBLICO DURANTE O ISOLAMENTO SOCIAL NA PANDEMIA: UM ESTUDO DE CASO NA E.M.E.F PAUL HARRIS EM SãO LEOPOLDO-RS.', 'Quais as dificuldades que o Covid-19 causou na educação dos alunos das séries finais da EMEF Paul Harris? Nosso grupo escolheu este assunto, porque percebemos que o coronavírus causou diversas mudanças na modalidade de ensino. Por isso decidimos pesquisar quais os prejuízos do Covid-19 no ensino público. Nossas hipóteses são: • Alunos não têm acesso à internet e por isso não conseguem acessar as atividades; • Pais/responsáveis de alunos não participam ou ajudam os mesmos em relação às aulas e atividades remotas; • Alunos não se interessam pelas aulas online e acabam deixando de lado; • Alunos não têm condições de acompanhar a aula em sua casa. Tomando como base os resultados encontrados na pesquisa realizada parcialmente, pois deverá ser coletado os dados dos alunos no sistema híbrido no final de agosto, verificou-se que algumas de nossas hipóteses não se confirmaram, pois conforme os dados coletados e analisados dos alunos on-line, percebemos que a principal dificuldade encontrada não foi a limitação de uso da internet para acessar a Plataforma do Google Classroom e as aulas virtuais pela Plataforma Meet ou ainda por falta de interesse dos alunos. Ao contrário da nossa Hipótese os dados apontam que a dificuldade emocional relacionada a alguma perda; ansiedade; estresse; entre outros; são os fatores que desencadearam as principais dificuldades na educação dos alunos das séries finais da EMEF Paul Harris.', NULL, NULL, '2021-10-08 22:40:52', '2021-11-05 01:38:24', 11, 3, 9, 5, true, 4.625, 7.11250000000000071);
INSERT INTO public.projeto VALUES (350, 'O CONHECIMENTO DE JOVENS SOBRE SíFILIS E NEUROSSíFILIS', 'A sífilis é uma doença infectocontagiosa sistêmica, de evolução crônica, causada pela bactéria Treponema pallidum. Sua transmissão pode ocorrer por via sexual, vertical e sanguínea. Normalmente apresenta fases distintas com sintomas específicos (sífilis primária, secundária, latente e terciária). Um dos grandes problemas relacionados à sífilis é o fato de ela ser assintomática, ou com sintomas pouco específicos. Uma das consequências pouco conhecidas da doença é a neurossífilis, quando existe um comprometimento do sistema nervoso central (SNC). Ao invadir o SNC, a bactéria pode determinar quadros clínicos variados, como alterações no líquor (indivíduos assintomáticos) e até mesmo quadros graves como a paralisia geral progressiva. As poucas informações disponíveis sobre essa condição e a falta de conhecimento das pessoas sobre a doença motivou a presente pesquisa. Sendo assim, esse trabalho teve como objetivo realizar um levantamento sobre o conhecimento da população acerca da sífilis e suas consequências. Após o levantamento bibliográfico sobre a sífilis, foi elaborado um questionário através do aplicativo Google Formulários. O questionário foi respondido por 156 pessoas, sendo a maior parte dos entrevistados jovens entre 15 e 20 anos. Os resultados obtidos reforçam as hipóteses levantadas no início da pesquisa, ou seja, a população possui pouco conhecimento sobre a doença. Muitos jovens não sabem que esta doença pode ser assintomática e que se não tratada pode levar a danos neurológicos ocorrendo a Neurossífilis. Concluímos que embora os jovens entrevistados tenham algum conhecimento sobre a doença, algumas informações básicas como a disponibilidade de tratamento pelo SUS e o fato de ser uma patologia assintomática ainda são pouco difundidas. A neurossífilis, que é uma condição grave, também precisa ser melhor divulgada, para que as pessoas procurem atendimento médico o quanto antes.', NULL, NULL, '2019-08-12 21:53:35', '2019-09-19 15:19:06', 4, 2, 7, 5, true, 8.875, 0);
INSERT INTO public.projeto VALUES (364, 'DEPRESSãO NO AMBIENTE ESCOLAR', 'Diante do número crescente de casos de quadros depressivos que se manifestam em ambiente escolar, entende-se que existe a necessidade de buscar mais informações sobre o assunto para, assim, contribuir com uma melhor compreensão do problema e ajudar quem esteja passando por isso ou quem convive com colegas que enfrentam essa situação. A abordagem metodológica do trabalho consistiu na realização de uma pesquisa de campo junto a cem (100) estudantes da EMEFRGS de sétimos, oitavos e nonos anos. Ao responderem a um questionário de cinco (5) perguntas, a pesquisa buscou verificar de que maneira o tema depressão é visto pelos jovens dessa idade escolar. Para definição do problema e análise dos dados, realizou-se o levantamento de informações, por meio da leitura de artigos em sites de referência no assunto, sobre como agir para auxiliar os adolescentes que apresentam um quadro depressivo e de que forma a escola pode ser um espaço de apoio aos adolescentes que vivem essa realidade. Diante dos dados levantados pela pesquisa, pode-se avaliar qual a percepção dos jovens acerca da incidência de quadros depressivos entre adolescentes. Assim percebe-se a importância de serem promovidas ações no espaço escolar em parceria com profissionais da saúde e grupos de apoio a pessoas com depressão, de modo a proporcionar aos adolescentes, ao corpo docente e aos familiares mais informações sobre como enfrentar esse problema.', NULL, NULL, '2019-09-17 13:59:56', '2019-09-19 14:21:37', 11, 3, 7, 5, true, 7.5, 9.75);
INSERT INTO public.projeto VALUES (236, 'CYBER CODE - ENSINANDO LÓGICA DE PROGRAMAÇÃO PARA CRIANÇAS', 'A tecnologia tem avançado rapidamente e tem sido cada vez mais importante o conhecimento sobre programação. Dentro desse contexto, torna-se imperativo aprender a programar e a desenvolver o pensamento computacional, pois engloba várias habilidades que são úteis para qualquer área do conhecimento. Aprender a programar desenvolve o pensamento computacional, que engloba habilidades como a resolução de problemas, a capacidade de abstração e a criatividade, úteis para qualquer área do conhecimento. Com foco nestes aspectos, foram desenvolvidos diversos jogos com teor educativo, que, através de interfaces lúdicas atraem as crianças e as envolvem em situações que as fazem desenvolver seu raciocínio e outras habilidades necessárias em programação. Este trabalho, que decorre de um trabalho de conclusão de curso Técnico em Informática para Internet, tem como objetivo principal ensinar lógica de programação para crianças através de um jogo mobile para Android. Suas principais diferenças entre os jogos que já estão disponíveis atualmente e que foram comparados com esta proposta serão as notificações ajustáveis e sua história imersiva. O primeiro funcionará como um despertador para lembrar o usuário de continuar os seus estudos, como uma maneira de incentivo. Já a história imersiva incluirá o usuário no jogo como um dos personagens, envolvendo-o na trama. O projeto encontra-se em estágio de desenvolvimento e será validado através de testes com usuários voluntários. O jogo traz conceitos de gamificação a partir de uma galeria de conquistas, onde ficarão os troféus dos objetivos alcançados pelo usuário. Apresentando conceitos básicos de programação que auxiliam o usuário a aprender este conteúdo através da plataforma, conclui-se que as habilidades desenvolvidas pelo indivíduo, como o incentivo à resolução de problemas e o estímulo à capacidade de abstração, serão muito importantes tanto para sua vida escolar quanto para, futuramente, quando for inserido no mercado de trabalho.', NULL, NULL, '2019-08-08 09:04:42', '2019-09-19 14:03:12', 6, 2, 7, 5, true, 7.75, 0);
INSERT INTO public.projeto VALUES (418, 'O GêNERO FEMININO NA REVISTA MéDICA POPULAR &#34;HYGIA&#34;', 'A digitalização de acervos presentes em museus tem sido uma prática usual e importante na preservação e divulgação de saberes, auxiliando na redução de custos, tempo e distância para pesquisadores, além de disseminar o conhecimento histórico à sociedade. O Instituto Federal de Educação, Ciência e Tecnologia do Rio Grande do Sul- Campus Osório e o Museu de História da Medicina do Rio Grande do Sul (MUHM), estão entre essas iniciativas, através do projeto Digitalização e Preservação de Obras Raras da Saúde, iniciaram um trabalho de disponibilização uma série de acervos relativos à História da Medicina, tais como periódicos especializados. Ao analisarmos essas fontes, surgiu-nos o interesse pela questão feminina, levando em conta sua limitada presença em espaços intelectuais no século XX, o que corroborou para a manutenção da desigualdade de gênero e exclusão cultural, política e social das mulheres. Assim sendo, o presente estudo objetiva analisar e debater a presença das mulheres no campo da Saúde a partir do periódico “Hygia- Revista Mensal Popular de Medicina e Educação Sanitária”, obra considerada rara e de importante papel de divulgação de cuidados de saúde. A metodologia utilizada pode ser dividida em duas etapas, a pesquisa documental e a pesquisa bibliográfica. Na pesquisa documental foram analisadas nove exemplares digitalizados deste periódico, destacando as autoras presentes e os temas femininos abordados. Enquanto a pesquisa bibliográfica realizou-se com o objetivo de entender a real participação feminina em diversas áreas do século XX, principalmente nos campos de ciência e saúde. Dentre as temáticas que identificamos na revista, encontram-se ginecologia, higiene e os cuidados na gravidez, maternidade e seus desafios e infecções sexualmente transmissíveis, sendo alguns deles artigos de autoria feminina, além desses, as mulheres também apareceram na autoria de artigos com assuntos mais diversos como os contos.', NULL, NULL, '2021-10-13 22:02:14', '2021-11-05 01:04:57', 3, 2, 9, 5, true, 8.625, 8.85000000000000142);
INSERT INTO public.projeto VALUES (278, 'CORRIDA ESPACIAL DO SéCULO XXI', 'A corrida espacial do século XXI pode salvar a raça humana de uma possível extinção, para tal coisa não acontecer é muito importante colonizar outros planetas como Marte, por exemplo. O objetivo da minha pesquisa foi mostrar a importância da exploração e da colonização de outros planetas para sobrevivência humana. Minha pesquisa foi feita através de uma revisão bibliográfica e para isso usei como referência sites de notícias e sites das próprias empresas privadas de exploração espacial. O New Gleen é um foguete reutilizável feito para levar carga e pessoas para a órbita da terra e além, sendo atualmente construido pela BLUE ORIGIN e entrará em operação em 2021. A Blue Moon será uma sonda lunar que poderá levar cargas que pesam toneladas e humanos à Lua, além de robôs para coletar amostras lunares para pesquisa. Poderá levar humanos a Lua por volta de 2024. Sendo desenvolvida atualmente pela Blue Origin. O Big Falcon Rocket é um futuro foguete que poderá levar carga e humanos a Marte, fazendo seu primeiro voo a Marte em 2022. Segundo o Físico renomado Stephen Hawking, a colonização de outros cosmos é essencial a sobrevivência da raça humana, e que nós temos um prazo limite de 100 anos para tal o fazer. Por causa dessas afirmações desse físico, bilionários como Elon Musk e Jeff Bezoss tem investido rios de dinheiro em suas próprias empresas de exploração espacial. Eu concluí, então, que a colonização de outros planetas é obrigatória para a sobrevivência da raça humana.', NULL, NULL, '2019-08-09 19:20:55', '2019-09-19 16:23:22', 12, 3, 7, 5, true, 2.75, 8.41249999999999964);
INSERT INTO public.projeto VALUES (375, 'A MECâNICA POR TRAZ DA CORRENTE ELéCTRICA', 'Correntes elétricas Você consegue se ver atualmente num mundo sem internet ? Ou sem luz? Sem micro-ondas ? Sem geladeira ?A resposta é simples, não. E isso tudo só é possível graças às correntes elétricas e grandes Cientistas como Nikolas Tesla e suas grandes invenções, que deram origem a importantes avanços da tecnologia. O estudo sobre correntes elétricas é fascinante, pois tudo ao nosso redor pode ser resumido ou melhor, explicado pela Eletricidade , por exemplo todas as reações químicas ocorrem por efeito de forças elétricas . É por meio desses impulsos elétricos que percorrem os nervos que nosso cérebro da ordens a nossos músculos. O estudo sobre a eletricidade originou-se de duas observações que, aparentemente , foram feitas pela primeira vez pelos gregos, no séculos VI a.C. Na realidade, é possível que outros povos tenham também observado esse fenômeno, mas os relatos mais antigos de que temos registro são os dos gregos, e assim atribui-se a eles a primazia desse feito. O próximo importante para e eletricidade foi dado pelo inglês Stephen Gray. ele mostrou que o corpo podia ficar eletrizado de outros modos não só pelo atrito . Mas o assunto principal é, as correntes elétricas e a , alternada e continua, e as suas mecânicas A corrente alternada, também conhecida como corrente de alta tensão, foi defendida por Nikolas Tesla enquanto a continua foi defendida por Thomas Edison . E dando origem então a Guerra das Correntes, que ocorreu nas ultimas décadas do século XIX, nos Estados Unidos da América, e contribuindo também a Segunda Guerra Mundial de 1939 a 1945.', NULL, NULL, '2021-09-24 15:03:16', '2021-10-25 17:42:25', 4, 2, 9, 2, NULL, 1.875, NULL);
INSERT INTO public.projeto VALUES (413, 'PERSPECTIVAS DA SAÚDE MENTAL DOS PROFISSIONAIS DE SAÚDE EM UMA SOCIEDADE PÓS-PANDÊMICA', 'A pandemia de Covid-19 afetou diretamente a saúde mental dos trabalhadores, como por exemplo, os profissionais de saúde, que se viram com a incumbência de trabalhar na linha de frente no combate ao Covid-19. Além de sofrerem com a sobrecarga e cansaço excessivo que advém do grande número de contaminações e colapso do sistema público de saúde, estão expostos diariamente a um alto risco de contágio. Desta forma, através desta pesquisa, visamos investigar a questão da saúde mental dos trabalhadores de saúde e suas consequências para as instituições onde trabalham, considerando o período pandêmico, particularmente nos momentos de maior taxa de ocupação de leitos. Para tanto, está sendo realizada uma pesquisa com aproximadamente 50 profissionais de saúde da região metropolitana de Porto Alegre, aplicando um questionário com 13 perguntas. Aborda-se o modo como a Covid- 19 tem sobrecarregado e desestabilizado os sistemas de saúde e profissionais que, por consequência, vêm desenvolvendo - ou desenvolveram - maior fragilidade da saúde mental, pelas incertezas e mortes que marcam esse período. A partir dos dados coletados até o momento, pode-se perceber que 64,1% dos profissionais de saúde sentiram ansiedade e 51,3% medo, devido à chegada da Covid-19 nos hospitais do Brasil. Cerca de 41% deles disseram ter um cansaço extremo e 35,9% alegaram ter um alto nível de estresse. Além disso, 41% afirmaram que a pandemia afetou muito a sua saúde mental. Assim, percebeu-se a falta de estrutura voltada ao bem-estar emocional dos profissionais de saúde, bem como a maneira pela qual a qualidade de vida profissional e pessoal deles foi impactada com o início da pandemia, sendo a causa principal de sua desestabilização emocional.', NULL, NULL, '2021-10-13 19:41:13', '2021-11-05 00:13:17', 3, 2, 9, 5, true, 9.75, 8.73750000000000071);
INSERT INTO public.projeto VALUES (282, 'VULCõES: A CIDADE DE POMPéIA', 'Escolhemos pesquisar sobre vulcões porque estávamos curiosos para entender o que acontecia com a lava do vulcão quando ele entra em erupção. O objetivo da nossa pesquisa foi estudar sobre os vulcões, pois surgiu interesse neste assunto. Foi feita pesquisa bibliográfica sobre vulcões em sites, e canais do Youtube. Nós fizemos uma entrevista com o professor Rodrigo “O que aconteceu na cidade Pompéia?” e “Quando aconteceu?”. Nós vimos o que aconteceu na cidade de Pompéia e queríamos saber o que aconteceu para as pessoas ficarem petrificadas. Segundo o professor Rodrigo, Pompéia foi petrificada por causa de uma fumaça tóxica que saía do vulcão, antes da erupção. Nós entendemos que, independentemente de onde elas estivessem, seja longe ou perto do vulcão, elas iriam ser petrificadas pela fumaça tóxica.', NULL, NULL, '2019-08-09 20:14:09', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 5.375, NULL);
INSERT INTO public.projeto VALUES (227, 'INCLUSÃO NO ENSINO SUPERIOR: DO ACESSO À CONCLUSÃO', 'Este trabalho tem o objetivo de apresentar o estudo realizado acerca da Inclusão no Ensino Superior. Queremos expor como é feita a inclusão nas duas maiores universidades do Rio Grande do Sul, mostrando suas ações desde o vestibular até e as práticas para incluir os alunos com necessidades especiais (NEE). Para atingir os objetivos propostos iniciamos por uma pesquisa bibliográfica, nos baseando em pesquisa pretérita sobre a inclusão escolar. Em seguida visitamos a UFRGS e a PUC a fim de conhecer os núcleos responsáveis pela inclusão e aplicarmos um questionário direcionado. Ao final dessa investigação, podemos afirmar que ambas Universidades estão em constante aprimoramento dos espaços e procedimentos a fim de garantir o acesso e permanência dos estudantes NEES. Nas duas instituições a acessibilidade física foi a primeira adaptação a ser feita e está em permanente configuração. Constatamos que na UFRGS, em função do público que recebe, os processos inclusivos são mais direcionados a pessoas com deficiências físicas, auditivas ou visuais. Já na PUC, onde os estudantes com transtornos de aprendizagem ou deficiências mentais aparecem em maior número, o processo também conta com locais e apoio especializados. Concluímos que as universidades estão reconhecendo a necessidade de adaptações efetivas e urgentes a fim de garantir o acesso e a formação de todos. Acreditamos que a inclusão é aceitação da diversidade e a oferta das mesmas oportunidades de desenvolvimento a todos.', NULL, NULL, '2019-08-06 20:59:38', '2019-09-19 16:13:00', 12, 3, 7, 5, true, 6.125, 9.33750000000000036);
INSERT INTO public.projeto VALUES (256, 'DESPEJO DE RESÍDUOS NO LAGO GUAÍBA E SUAS CONSEQUÊNCIAS AMBIENTAIS', 'É de conhecimento geral que o Lago Guaíba sofre de altos índices de poluição, causados desde o despejo de rejeitos até a liberação de compostos orgânicos no mesmo. As contaminações suportadas por esse ecossistema afetam de forma direta a vida de diversos seres, prejudicando a fauna e a flora da região. Além disso, é impossibilitada a utilização do Lago para banhos no verão e torna-se preocupante a própria qualidade da água a fins de consumo. Nesse sentido, o propósito desse trabalho é analisar as causas da poluição no Guaíba e compreender as consequências do despejo desde rejeitos até compostos orgânicos no mesmo. Para isso, busca-se reconhecer o tratamento dos efluentes realizado pelas estações de tratamento de esgoto (ETE&#39;s), em Porto Alegre administradas pelo DMAE (Departamento Municipal de Água e Esgoto), e apontar irregularidades no procedimento de limpeza da água, bem como identificar a proliferação de microrganismos patógenos aos seres humanos, como a bactéria Escherichia coli; há, também, os aeróbios decompositores de matéria orgânica que, presentes em excesso no meio, diminuem a concentração de oxigênio e dificultam a autodepuração do corpo hídrico, dando início ao processo de anaerobiose e relacionando-se com a morte de outros seres vivos. Ademais, faz-se necessária a análise da relevância do Rio Ipiranga quanto à poluição no Lago. Através disso, o grupo busca identificar as causas da elevada impureza no Guaíba e as consequências de tal contaminação, a fim de conscientizar a população acerca da situação e estimular a realização imediata de tarefas que auxiliem na limpeza das águas, como a separação adequada do lixo caseiro. A metodologia foi de caráter qualitativo; os integrantes trabalharam na coleta de informações em fontes confiáveis da internet, prezando por apresentar dados em forma de textos, tabelas e gráficos, com o objetivo de tornar a apresentação do tema didática e de fácil compreensão.', NULL, NULL, '2019-08-09 10:43:01', '2019-09-17 16:12:00', 4, 2, 7, 2, NULL, 6.125, NULL);
INSERT INTO public.projeto VALUES (389, 'VOCê SABE O QUE DIZ IN ENGLISH?', 'Pretende-se, com este trabalho, despertar e aumentar o conhecimento sobre palavras ditas cotidianas verificando seus significados. Diante do exposto, serão disponibilizados contextos que garantam a pesquisa e ou descoberta de conhecimento e apropriação de normativas em outro idioma. Para este fim, utilizamos diversos vocábulos provenientes da língua Inglesa e inseridas em nosso dia a dia. Salientamos ainda, que apesar da apropriação e aplicabilidade da palavra estrangeira, nem sempre o verdadeiro sentido do vocábulo utilizado é conhecido pelo falante. Em alguns casos, o termo é empregado com outro significado, diferente do que possui na sua língua materna. Neste sentido, nosso foco principal é trabalhar o Anglicismo. Substantivo masculino: Linguagem de origem estrangeira; cujo significado é o uso de palavras, frases ou expressões provenientes da Língua Inglesa. Para desenvolver nosso trabalho, realizamos pesquisas e trocas em grupo, além de produções referentes a empregabilidade de cada expressão no cotidiano. Até a presente data, nossas percepções são positivas quanto a aquisição e descoberta de vocábulos. Como conclusão prévia, notamos um maior interesse tanto na pesquisa como na aquisição de fala em outro idioma. Destacamos a participação efetiva dos alunos envolvidos, bem como suas correções ao empregar os estrangeirismos.', NULL, NULL, '2021-10-07 10:24:20', '2021-11-05 03:05:58', 11, 3, 9, 5, true, 5.375, 6.28749999999999964);
INSERT INTO public.projeto VALUES (319, 'IMPACTOS AMBIENTAIS DOS VAZAMENTOS DE PETRóLEO', 'O presente trabalho pretende mostrar às pessoas o que causa o vazamento do petróleo; os impactos ambientais causados; o que as empresas fazem a respeito e; porque não é um assunto muito citado no cotidiano, mesmo sendo importante. Através de pesquisas deseja-se ainda, anlisar a responsabilidade das empresas junto à comunidade, ou o local atingido, onde aconteceram os vazamentos de petróleo. Conhecer o que diz a Constituição Federal e os direitos universais e direitos humanos em relação ao meio ambiente. Foi feito pesquisas em vídeos, artigos, matérias e fotos na internet e na Constituição Federal e os direitos universais dos direitos humanos em relação ao meio ambiente. Foi analisado como os vazamentos de petróleo impactam uma comunidade e se as empresas responsáveis fazem a recuperação ambiental depois do ocorrido. Percebeu-se que as empresas de petróleo precisam seguir procedimentos padrões no caso de um vazamento de petróleo e seguir a lei baseada na Constituição Federal e assegurar os direitos das pessoas. Concluiu-se que todos temos direitos garantidos na lei (Constituição Federal) e que os direitos universais dos direitos humanos foi criado para segurar entre eles, um ambiente saudável.', NULL, NULL, '2019-08-10 18:44:56', '2019-09-17 16:12:00', 10, 3, 7, 2, NULL, 6.625, NULL);
INSERT INTO public.projeto VALUES (207, 'TUMBEIROS NEGROS: A TRAVESSIA, A MORTE E AS ORIGENS DOS QUE AQUI CHEGAM.', 'Este trabalho tem como objetivo analisar as consequências do tráfico negreiro, migração forçada que resultou na chegada de milhões de cativos africanos ao Brasil entre os séculos XV ao XIX. A razão do desenvolvimento da pesquisa é compreender os dados dos escravos desembarcados, as condições das viagens, os muitos óbitos provocados pelas péssimas condições do transporte, os valores atribuídos aos que conseguiam desembarcar, entre outros fatores. Entende-se o tráfico negreiro como a comercialização de pessoas vindas da África quando indivíduos eram trocados por alguma mercadoria valiosa, que poderia ser tabaco, cachaça, pólvora, entre outros. Depois de vendidos para algum comerciante europeu, eram embarcados em navios que os transportavam para a América ou Europa. Esses navios eram chamados de tumbeiros, pelo fato de ser um local onde muitos dos escravos embarcados morriam. Para atingir o objetivo proposto, foram seguidas as etapas: a) colocar os dados dos registros de africanos em uma planilha; b) analisar a planilha feita e fazer comparações com gráficos; c) pesquisar sobre escravidão e tráfico negreiro e d) elaboração de textos sobre o assunto. Como síntese geral, pode-se afirmar que Trabalhar a história e a cultura afro-brasileira permitirá a nós enquanto Escola promover um resgate as nossas origens, procurando sensibilizar a comunidade escolar da influência e da importância que a cultura africana teve ao longo dos tempos em diversos setores de nossa sociedade.', NULL, NULL, '2019-07-30 14:11:45', '2019-09-19 11:11:46', 11, 3, 7, 5, true, 8.875, 8.57499999999999929);
INSERT INTO public.projeto VALUES (372, 'EDUCA IDOSO - PLATAFORMA MÓVEL PARA AUXILIAR PESSOAS IDOSAS EM SEU APRENDIZADO', 'A necessidade emergente de ferramentas que auxiliem pessoas da terceira idade em sua jornada acadêmica no âmbito virtual é uma realidade no Brasil e no mundo. De acordo com o Censo da Educação Superior de 2019, promovido pelo Instituto Nacional de Estudos e Pesquisas Educacionais Anísio Teixeira (Inep), observa-se que o maior crescimento de matrículas em cursos de graduação é o da faixa etária acima de 65 anos, com uma taxa de expansão de 46,3% entre 2013 e 2019. O Censo da Educação Superior de 2017 estima que cerca de 7.813 idosos acima de 65 anos e 18,9 mil idosos com faixa etária entre 60 e 64 anos estejam matriculados em algum curso de graduação, enquanto a população total de idosos no Brasil, conforme dados do Instituto Brasileiro de Geografia e Estatística (IBGE) de 2017, é de aproximadamente 30,3 milhões. Nesse contexto, surge a aplicação Educa Idoso, que tem como principal objetivo auxiliar pessoas idosas em seus estudos através de um design intuitivo e conteúdos dispostos visando a fácil compreensão. O principal diferencial dessa aplicação é o fato de ser a primeira plataforma brasileira de estudos que se propõe a funcionar especificamente para atender às necessidades de estudantes idosos. O projeto permitirá uma troca entre os usuários que poderão submeter conteúdos na plataforma e os alunos da terceira idade, que poderão acessá-los de forma prática. Os conteúdos estarão disponíveis através de vídeos e textos, e as dúvidas poderão ser solucionadas através de fóruns. O trabalho está em fase inicial de implementação, sendo pensado para a plataforma Android e tendo seu desenvolvimento através do ambiente Kodular com integração ao banco de dados Firebase. A etapa de cadastro e login do aplicativo já teve todas as suas telas concluídas. As próximas etapas de desenvolvimento da aplicação incluem a formação de um grupo remoto de testes com pessoas idosas, o gerenciamento de conteúdos submetidos à plataforma, além da implantação de fóruns e notificações.', NULL, NULL, '2021-09-23 14:50:56', '2021-11-03 19:12:29', 6, 2, 9, 5, true, 9.125, 8.3125);
INSERT INTO public.projeto VALUES (304, 'REVITALIZAçãO DE áREAS DEGRADADAS PRóXIMAS à CONSTRUçãO DA EMEF OTáVIO REIS: INCENTIVAR PARA TRANSFORMAR', 'O projeto tem como finalidade promover a revitalização de uma área localizada no bairro Otília, em Charqueadas, RS. O local encontra-se em torno da construção da EMEF Otávio Reis, e se destina à deposição de resíduos como vidro, plástico, roupa, eletroeletrônicos, etc. Um dos problemas do Brasil é o descarte incorreto de resíduos sólidos, resultado do tempo de uso reduzido dos produtos comercializados. Diante do exposto, o problema está relacionado à indagação: “De que forma é possível incentivar a população do Bairro Otília a diminuir ou eliminar o acúmulo de lixo urbano em terrenos abandonados?”. Os objetivos desse projeto são: informar a comunidade escolar sobre a importância de despoluir áreas usadas como “lixão” em locais próximos à construção da EMEF Otávio Reis; relatar para a comunidade escolar a importância do descarte correto de lixo; conhecer a importância de diminuir o impacto ambiental provocado pelo descarte indevido de lixo, e criar parcerias com a administração pública para a recuperação da área em questão. Uma área degradada faz com que haja perda de valor econômico em sua proximidade e afasta a população de frequentá-la. Com sua restauração, agrega benefícios para toda a população, social e economicamente. Com base nas informações obtidas pela pesquisa, formularam-se panfletos para divulgação sobre meios corretos de descarte dos resíduos. Foram contatadas Secretarias Municipais para que a retirada dos resíduos seja realizada ainda no mês de agosto.', NULL, NULL, '2019-08-10 14:20:26', '2019-09-17 16:12:00', 11, 3, 7, 2, NULL, 6.25, NULL);
INSERT INTO public.projeto VALUES (192, 'BRINCANDO DE ARQUEÓLOGO: CONHECENDO O PASSADO ATRAVÉS DA CULTURA MATERIAL.', 'O propósito da presente pesquisa desenvolvida por alunos do 6º. Ano do Ensino Fundamental do Colégio Maria Auxiliadora, foi levá-los a conhecer a importância do trabalho realizado por arqueólogos e como se dá a investigação do passado, vista a partir de restos de cultura material. Para atingir esses objetivos, foram realizadas as seguintes etapas: a) reflexões teóricas sobre arqueologia; b) leitura de livros, sites e revistas; d) Análise de vídeos contendo imagens de escavações arqueológicas; d) simulação de uma escavação arqueológica em sítio construído no pátio da escola. Durante essa etapa os alunos anotaram em “diários de campo e registraram tudo e após, produziram teorias sobre os “agrupamentos humanos” encontrados. Com isso, podemos oportunizá-los experiências empíricas que favoreceram a compreensão do que são vestígios arqueológicos e a identificar a sua importância para a construção de explicações históricas. Podemos dizer que a através desse tema motivador, discutimos as diferentes etapas que norteiam a atividade arqueológica, o que envolve a formação acadêmica de um arqueólogo e onde atua esse profissional. Esses estudantes passaram por uma formação técnica e teórica e certamente terão um olhar mais qualificado no estudo das primeiras civilizações, pois grande parte do que sabemos sobre elas é fruto do trabalho arqueológico. Através do projeto, pretendemos acima de tudo, incentivá-los a valorizar, conhecer e preservar a memória cultural daqueles que nos precederam.', NULL, NULL, '2019-07-15 21:55:25', '2019-09-19 11:13:29', 11, 3, 7, 5, true, 9.5, 4.42499999999999982);
INSERT INTO public.projeto VALUES (435, 'DEPRESSãO E ANSIEDADE: COMO UMA AUTO-AVALIAçãO AUXILIA NA VIDA DOS JOVENS', 'A pesquisa é relevante porque o assunto atinge os jovens da nossa comunidade escolar. Ansiedade particulariza-se pelo medo e apreensão ininterrupta, a depressão frisa-se pela melancolia, isso se deve à junção de acontecimentos sócio-econômica e as incertezas que rodeiam a sociedade, tendo em vista o período da pandemia. Por esse motivo, deve-se considerar como viável uma auto-avaliação sobre os transtornos referidos, para que se obtenha um alicerce e, em caso de indagação, o suporte de um profissional do ramo. O propósito é demonstrar como podem identificar os sintomas, bem como salientar a importância e a busca de auxílio profissional. Formulamos perguntas para os alunos do Ensino Fundamental II da Escola Santa Doroteia Planalto. Em seguida, gravamos e compartilhamos podcasts, a fim de analisarmos a assimilação do conteúdo. Inicialmente, 63% já suspeitaram ter ansiedade e 37% consideraram ter depressão, o que indica que a falta de informação faz com que as pessoas de fato não saibam sua situação, prejudicando sadios e enfermos em decorrência da falta de propagação do tema. No segundo formulário as respostas surpreenderam, elas foram mais elaboradas. 83% considerou ter tido ansiedade alguma vez na vida e 61% afirma ter ansiedade. Concluímos que as informações transmitidas agregaram conhecimento. Ou seja, é eminente o fenômeno da falta de informação, que pode fazer com que a pessoa tire conclusões precipitadas sobre esse assunto muito importante.', NULL, NULL, '2021-10-17 17:14:42', '2021-11-03 22:06:45', 11, 3, 9, 5, true, 7.25, 8.52499999999999858);
INSERT INTO public.projeto VALUES (251, 'LETRAMENTO: UMA JANELA PARA O MUNDO, O ESTUDO DO CASO DA OBRA DE CAROLINA DE JESUS.', 'O projeto decorre de uma resenha crítica que fizemos, na aula de história, sobre o livro “O quarto do despejo: o diário de uma favelada”. Verificamos um diário que relata as vivências de Carolina e sua luta contra a fome, a condição de mulher, o machismo, o racismo, o desemprego, a miséria e a educação para os seus filhos. Dados de uma pesquisa sobre a legislação abolicionista que fizemos no ano de 2018 revelou que 40% dos entrevistados não queriam aprender mais sobre o tema e que 30% dos entrevistados achavam que o papel da escravidão era irrelevante no Brasil. Como mudar esse cenário de invisibilidade social do negro na formação intelectual brasileira? Nossa hipótese de trabalho seria que o letramento e o conhecimento da produção intelectual afrodescendente poderiam produzir uma ação afirmativa nos estudantes. Nossa metodologia foi aplicar questionários no ensino fundamental, em que avaliamos o conhecimento prévio de cada estudante sobre: a produção intelectual de autores afrodescendentes, o racismo e o machismo. Após isso elaboramos 5 aulas com temas transversais sobre a obra, com categorias de análises (Fome, machismo, racismo, democracia, exclusão social) em que os estudantes deveriam refletir a partir de situações vivenciadas num pequeno diário. Concluímos ainda de forma provisória que o desconhecimento da produção autoral de escritores afrodescendentes reforça a invisibilidade social da população negra brasileira, por isso a importância do seu estudo histórico.', NULL, NULL, '2019-08-09 02:54:13', '2019-09-19 14:48:29', 11, 3, 7, 5, true, 10, 10);
INSERT INTO public.projeto VALUES (259, 'AS REPRESENTAçõES DE FEMININO E O PODER: UMA ANáLISE DE CENAS DO FILME &#34;CAPITã MARVEL&#34;', 'Esta pesquisa surge a partir de minha participação como bolsista do projeto de extensão Gênero e manifestações culturais, vinculado ao NEPGS - Núcleo de Estudos e Pesquisas em Gênero e Sexualidades, do Instituto Federal do Rio Grande do Sul, campus Canoas. A partir do contato com alguns estudos e pesquisas feitas no núcleo, proponho-me a selecionar cenas do filme ‘’Capitã Marvel”, dos estúdios Marvel, para analisar e discutir sobre as feminilidades que estão sendo representadas em filmes, focando, contudo no filme ‘’Capitã Marvel’’. Meu interesse em desenvolver está pesquisa, deve-se ao fato de querer buscar refletir sobre como as mulheres estão sendo representadas nos filmes, quais os cargos que estão sendo atribuído a elas, se estão sendo valorizadas no campo onde atuam, enfim, que lugar pode ser atribuído as estas mulheres nas telas do cinema. Para isso, farei uso dos conceitos de representação e gênero, que vão operar as análises a serem realizadas a partir da desmontagem das cenas escolhidas. Neste sentido, farei uso da metodologia da etnografia de tela, no qual buscarei olhar para cenas mais profundamente, reparar nos detalhes e o que está sendo indicando com e a partir delas. Como hipótese, suponho que com este trabalho eu possa mostrar como filmes podem ensinar a seu público expectador sobre gênero e a importância de representar mulheres em posições de poder. Entretanto, o trabalho ainda está em andamento, não tendo, ainda, resultados explícitos para poder apresentar conclusões.', NULL, NULL, '2019-08-09 12:06:50', '2019-09-19 14:01:59', 3, 2, 7, 5, true, 8.625, 8.60714285714290028);
INSERT INTO public.projeto VALUES (388, 'GRAVIDEZ PREMATURA.', 'Gravidez entre 10 e 20 anos é considerado gravidez na adolescência. Acontece principalmente pela falta de preservativo. Mas existem outros fatores que contribuem para isso. A falta de aviso de familiares, pressão de amigos ou do companheiro, são outros exemplos. A gravidez pode causar problemas de saúde, para mãe e filho. O bebê pode nascer com anemia, prematuridade ou até mesmo ser abortado. Uma doença muito comum que acontece, é a depressão pós parto. A depressão na gravidez afeta muito a saúde mental, com muito sentimento de culpa, arrependimento e principalmente medo. Além disso, a gravidez afeta a vida social. Obviamente a mãe parará de ir em festa, pois agora há a responsabilidade do filho para cuidar. E faz a mãe se afastar de seus amigos e ter uma vida social mais parada. A aparência também pode ser alterada, como: alterações na pele, seios inchados.... Com base nas minhas pesquisas a região que mais tem casos de gravidez na adolescência, é a região norte com 4,8% ( 10 a 14 anos) e 74,9% ( 15 a 19 anos) e a região que menos tem casos é a região sul com 1,5 (10 a 14 anos) e 38,9 ( 15 a 19 anos). Então, se você pensa em ter ou tem uma vida sexual, sempre se cuide, use preservativo, não só por causa da gravidez, mas pelas doenças também. E nunca faça nada pela pressão de ninguém, faça tudo no seu tempo e no tempo do seu corpo, isso não só na adolescência, mas a vida toda.', NULL, NULL, '2021-10-06 10:21:33', '2021-11-03 22:07:40', 10, 3, 9, 5, true, 9.5, 5.77500000000000036);
INSERT INTO public.projeto VALUES (426, 'VIDA SAUDÁVEL E A PANDEMIA: CONSEGUIMOS MANTER NOSSA ROTINA E NOSSOS HÁBITOS?', 'Este trabalho tem como objetivo abordar o conceito de vida saudável e os principais hábitos necessários para melhorar a sua qualidade. Além disso, busca verificar se as pessoas conseguiram mantê-los durante a pandemia. A justificativa para desenvolver este trabalho deve-se ao fato de tratar-se de um assunto atual, que afeta diretamente a sociedade e seu desenvolvimento. Para atingir os objetivos propostos, iniciou-se uma pesquisa bibliográfica sobre vida saudável e os hábitos necessários para manter sua qualidade. Em seguida, foi realizada uma pesquisa quantitativa em forma de questionário com pessoas a partir de dez anos, com perguntas objetivas relacionadas às suas rotinas durante a pandemia. Para concluir, foram elaboradas algumas sugestões de boas práticas para o cuidado da saúde neste período. Segundo os resultados do questionário pôde-se afirmar que quase a totalidade dos entrevistados diz ter apresentado alterações de humor e sintomas de ansiedade em algum momento da pandemia. Outro dado relevante é com relação ao lazer, já que expressiva maioria afirma não ter conseguido mantê-lo. Os resultados também mostram o exagero no consumo de alimentos não saudáveis, bebidas alcoólicas e cigarro. Assim sendo, pôde-se concluir que a pandemia afetou drasticamente os hábitos das pessoas, principalmente com relação à saúde mental, lazer e alimentação. Pode-se dizer, por fim, que tais alterações devem ser observadas com cuidado e em alguns casos, acompanhadas por um profissional.', NULL, NULL, '2021-10-16 17:32:23', '2021-11-05 12:51:55', 11, 3, 9, 5, true, 9.75, 9.03749999999999964);
INSERT INTO public.projeto VALUES (280, 'AVALIAçãO DA CAPACIDADE DE RETENçãO DE óLEO VEGETAL POR FIBRA CAPILAR', 'O crescimento industrial ocasionou maior ocorrência de acidentes ambientais envolvendo substâncias oleosas, que ao atingirem corpos hídricos permanecem em sua superfície poluindo grande volume de águas superficiais. Dessa forma, é fundamental o desenvolvimento de tecnologias capazes de reter a camada de óleos a fim de que seja possível a retirada desses poluentes do local e permita a sua correta disposição. Por isso, o objetivo da pesquisa foi avaliar a capacidade de retenção de óleo de soja por produto superoleofílicas de baixo custo produzido com fibra capilar humana. Foram avaliados o aumento de massa de amostras de cabelo, previamente recolhido em centros de beleza do município de Gravataí, sujeitos a contato de 15 minutos com água e óleo de soja (OS). Além disso, a fim de se comparar os resultados obtidos com a fibra natural, repetiu-se a metodologia com amostras de fibras poliméricas (fios de nylon), o que permitiu avaliar se a retenção da água e do óleo observado nas amostras de cabelo, davam-se pela sorção ou apenas dela formação de fina película sobre o fio. Observou-se que a fibra capilar apresentou aumento em relação a sua massa inicial de 330% de água e 781% de OS. A amostra de fios de nylon não apresentou aumento de massa significativa, sugerindo que o cabelo foi capaz de sorver o óleo e água em sua estrutura molecular. Observou-se também a maior afinidade do fio natural com a substância polar do que a apolar sugerindo o potencial do material avaliado como produto para conter óleos vegetais na ocorrência de dano ambiental. Com tais resultados, pode-se perceber que o cabelo é eficaz no tratamento de águas contendo películas de óleo e pode ser uma alternativa mais barata e mais ecológicas que as esponjas já existentes no mercado mundial.', NULL, NULL, '2019-08-09 19:41:33', '2019-09-19 15:37:45', 8, 2, 7, 5, true, 9.625, 9.42500000000000071);
INSERT INTO public.projeto VALUES (411, 'O HÁBITO DE LEITURA ENTRE OS ALUNOS DOS ANOS FINAIS DA ESCOLA DR. JORGE GERMANO SPERB EM SÃO LEOPOLDO-RS', 'Com o trabalho intitulado “O hábito de leitura entre os alunos dos anos finais da EMEF Dr. Jorge Germano Sperb em São Leopoldo-RS” o grupo busca verificar como é a relação dos alunos dos anos finais com a leitura e conhecer os benefícios dela para o desenvolvimento do indivíduo. A ideia da pesquisa surgiu em uma conversa em aula onde todos sugeriram diversos temas, mas a temática da leitura foi bem aceita porque muitos da turma têm o hábito de ler. A pesquisa foi realizada através de sites da internet, e demais fontes confiáveis, realizamos aplicação de questionário nos alunos dos anos finais com a finalidade de conhecer seus hábitos de leitura e entrevistamos profissional da literatura. Acreditamos que a leitura pode trazer diversos benefícios para o desenvolvimento do indivíduo e tratar do tema pode ajudar a comunidade escolar a refletir sobre seus hábitos acerca da temática. Os resultados foram surpreendentes pois inicialmente acreditávamos que os colegas não tinham o hábito de ler mas descobrimos que muitos leem, mesmo que não livros literários costumam ler revistas em quadrinhos e outras formas de leitura. Acreditamos ainda que sejam necessárias mais ações por parte das famílias, governo e instituições de ensino para incentivar os jovens a lerem, mas a pergunta que fica é como os adultos poderão estimular os jovens a ler se os mesmo não tem tal hábito?', NULL, NULL, '2021-10-13 18:13:31', '2021-11-03 22:26:19', 11, 3, 9, 5, true, 7.5, 9.17500000000000071);
INSERT INTO public.projeto VALUES (202, 'A REPERCUSSãO DO ATAQUE A PEARL HARBOR NA IMPRENSA BRASILEIRA', 'Nesse trabalho falaremos sobre o ataque a base aero-naval norte-americana de Pearl Harbor, localizada no Havaí, que ocorreu no dia 7 de dezembro de 1941. A participação do Japão na Segunda Guerra foi um assunto que chamou muito a atenção do grupo, pois é essencial para o desenvolvimento da Guerra, marcando a entrada de vários países na disputa e fazendo com que a mesma passasse a ser de fato mundial. Assim, tentamos responder: como a imprensa brasileira representou o ataque japonês a Pearl Harbor? Tivemos como objetivo geral entender a importância que o ataque teve na Segunda Guerra Mundial, e como objetivos específicos, compreender os fatos que levaram o Japão a realizar o ataque e estudar as consequências do ato. Para nossa metodologia, iniciamos o projeto lendo as fontes secundárias (ARNAUT, MOTTA; GONÇALVES; LOPEZ; LUCA; RODRIGUES), realizando um fichamento sobre os livros e artigos. Após termos finalizado esses estudos, começamos a coletar dados das nossas fontes primárias: os jornais Correio da Manhã e Jornal do Commercio (RJ). A coleta foi realizada no site da Hemeroteca da Biblioteca Nacional, e pesquisamos todas as ocorrências a partir do início de dezembro de 1941, com foco nos relatos daquele mês. Como resultados finais, podemos concluir que o jornal Correio da Manhã noticia os fatos de maneira mais formal, enquanto o Jornal do Commercio tenta atrair o público com títulos sensacionalistas e chamativos, embora o conteúdo acabe não apresentando o mesmo caráter tão fortemente. O Jornal do Commercio apresenta maior número de notícias e informações, pois o outro, embora tenha várias matérias, repete muitas informações. O Correio da Manhã trata de vários pontos sobre o ataque, porém de forma mais curta, enquanto encontramos informações variadas no Jornal do Commercio, que apresenta vários itens não encontrados no outro, embora não tão detalhadamente.', NULL, NULL, '2019-07-23 16:20:17', '2019-09-19 11:56:05', 3, 2, 7, 5, true, 8.75, 9.21428571428570109);
INSERT INTO public.projeto VALUES (255, 'DESIGUALDADE ENTRE GÊNEROS NO AMBIENTE DE TRABALHO', 'No decorrer das últimas décadas, as mulheres conquistaram espaços sociais, culturais, políticos e profissionais que, historicamente, eram exclusivos do sexo masculino, o que foi um passo essencial em nossa história. A igualdade de gênero é um direito humano fundamental, um elemento essencial para a construção da justiça social e uma necessidade econômica. No entanto, as diferenças entre gêneros em âmbito trabalhista ainda são significativamente altas: há diferenças de ganhos salariais entre homens e mulheres que ocupam o mesmo cargo e, o número de mulheres que ocupam posições de gestão em empresas é extremamente pequeno quando comparado aos homens. Nesse sentido, o nosso projeto de Iniciação Científica tem por objetivo comprovar, com dados, a dissemelhança em variados aspectos entre gêneros no ambiente de trabalho. Para o alcance do objetivo, realizamos um questionário com perguntas livres e de múltipla escolha, que foi aplicado nas turmas de terceiro ano do Colégio Santa Doroteia, visando identificar a opinião de homens e mulheres sobre questões tais como, o assédio, a desigualdade, o machismo, etc. Como resultados parciais, destacamos que ainda existe uma parcela de 5,3% que realmente acredita que o sexo feminino é inferior ao masculino. Em uma das perguntas que foram colocadas no questionário, estava: ‘’você ou alguma mulher que conhece, já sofreu assédio no ambiente de trabalho? ’’e, como resultado, obtivemos um número alarmante, 73,7% afirmaram que sim. Como síntese geral, pode-se afirmar que, grande parte das mulheres sofre ou conhece outra que sofreu com a desigualdade salarial e com o assédio no ambiente de trabalho, apenas pelo seu gênero ser considerado inferior. E, para isso mudar, deve-se começar pela educação, ensinando desde cedo as crianças e jovens nas escolas de ensino público e privado sobre como todos devem ser tratados igualmente, sendo homem ou mulher, devemos receber o mesmo salário e o mesmo tratamento.', NULL, NULL, '2019-08-09 10:38:56', '2019-09-19 11:43:58', 3, 2, 7, 5, true, 7.25, 7.43571428571430015);
INSERT INTO public.projeto VALUES (197, 'ESCRAVIDÃO E DOENÇAS: MÉTODOS, ESCOLHAS E CAMINHOS.', 'Nosso foco de estudo são os registros de óbito, documentos que trazem informações diversas sobre enfermidades sofridas pela população em geral. Registros que possibilitam mapear causa mortis, observar a sazonalidade de doenças, calcular os índices de mortalidade por sexo, idade, nacionalidade etc. Considerando esse interesse, desenvolvemos um banco de dados sobre os registros de óbitos dos escravos e que constam no livro “Africanos na Santa Casa de Porto Alegre (1850-1885)” somando aproximadamente sete mil registros e, através desses dados, estabelecemos relações com as doenças dos escravos e as epidemias conhecidas na época. Depois dessa etapa, produzimos sínteses sobre aquilo que aprendemos, associando os conceitos da demografia (Geografia), escravidão no século XIX (História), sintomas e tratamentos de doenças (Ciências) e conceitos de estatística descritiva (Matemática). A metodologia usada buscou estabelecer relações entre as antigas populações escravizadas e assuntos do cotidiano visualizados através de tabelas e gráficos. A partir dos resultados encontrados formamos diferentes questionamentos, visando instigar o exercício da cidadania crítica, reflexiva e participativa, em decisões individuais e/ou coletivas. Em síntese, considerando as precárias condições de vida das populações levadas ao cativeiro submetidas à constante violência, reflete-se sobre como a problemática da saúde e da doença foi pensada para os negros e por sua vez, em que nível elas eram tratadas.', NULL, NULL, '2019-07-21 14:57:06', '2019-09-19 15:55:25', 11, 3, 7, 5, true, 7, 8.69999999999999929);
INSERT INTO public.projeto VALUES (361, 'PRODUÇÃO DE PISO TÁTIL A PARTIR DA DESVULCANIZAÇÃO ULTRASSÔNICA DE BORRACHA ORIUNDA DE PNEUS INSERVÍVEIS', 'O referido trabalho tem o propósito de produzir piso tátil a partir da desvulcanização pelo método ultrassônico de borrachas provenientes de pneus inservíveis. O desenvolvimento da pesquisa deve-se ao fato de que o descarte incorreto de pneus vem gerando graves danos ambientais devido a sua constituição, que apresenta uma rede de ligações cruzadas, impedindo assim a remoldagem por simples aquecimento. Esta dificuldade faz com que os rejeitos elastoméricos quase sempre sejam depositados em locais inadequados como aterros, terrenos baldios, rios e lagos. O reaproveitamento de pneus inservíveis é entendido como sendo o processo de desvulcanização pelo qual a borracha vulcanizada passa, no intuito de transformá-la em piso tátil. Iniciou-se a metodologia do trabalho realizando o banho ultrassônico nas amostras contendo ácido tioglicólico, cicloexano e soluções de 10, 20, 30 e 40% de ácido tioglicólico em cicloexano. Através da norma ASTM D 6814-02, realizou-se o cálculo para determinação da porcentagem de desvulcanização a partir das medidas de densidade de ligações cruzadas da borracha desvulcanizada. No mês de agosto serão realizados, a preparação de uma composição de borracha crua com a borracha desvulcanizada em um misturador aberto, o teste de curva reométrica e a posterior vulcanização da borracha para a produção da peça. Finalmente serão realizados testes físico-químicos de controle de qualidade, como DPC, Grip, Encolhimento, rasgo e resistência a água. As análises realizadas até o momento evidenciaram que a amostra contendo 20% de ácido tioglicólico em cicloexano apresentou melhor porcentagem de desvulcanização sendo de 78,77%. Como conclusões preliminares constatamos que a utilização da solução de 20% de ácido tioglicólico em cicloexano é a mais adequada para a realização dos objetivos descritos.', NULL, NULL, '2019-08-14 13:42:11', '2019-09-19 15:24:29', 7, 2, 7, 5, true, 10, 9.00714285714284912);
INSERT INTO public.projeto VALUES (211, 'SALVE O RIO DOS SINOS', 'O projeto Salve o Rio dos Sinos tem por objetivo promover em âmbito escolar atitudes que possam trazer conhecimento sobre o rio e que possam promover atitudes a favor da manutenção e conservação deste. O Rio dos Sinos é o rio que abastece a cidade de Nova Santa Rita e muitos alunos dependem deste para viver, inclusive boa parte dos alunos moram nas proximidades do rio. Como metodologia, utilizamos várias técnicas pedagógicas com alunos de diferentes idades. Até o momento, trabalhamos com alunos de 3°, 5°, 6° e 7° anos. Para estes realizamos uma palestra instrutiva, trazendo muitas informações sobre o rio e sua preservação, após os mesmos jogaram um jogo de tabuleiro de perguntas e respostas, que simula ser o Rio dos Sinos. Os 5° anos realizaram informativos com o tema “Salve o Rio dos Sinos” que foram entregues em uma blitz em frente da escola. Os 3º anos saíram a campo, ou seja, foram ás margens do Rio dos Sinos, e cada grupo de alunos ficou responsável em pesquisar um tema: fauna, flora, ação antrópica e resíduos. Os 6º anos participaram de uma atividade criativa produzida pelo grupo do projeto, esta envolve telecomunicação, através de um jornal de televisão os alunos mostram notícias e curiosidades sobre o Rio dos Sinos. Alternativas no modo de ensinar contribuem muito na aprendizagem dos alunos e estes se sentem motivados a agir e é o que precisamos para salvar o Rio dos Sinos.', NULL, NULL, '2019-07-31 20:18:51', '2019-09-19 13:33:42', 10, 3, 7, 5, true, 8, 8.69999999999999929);
INSERT INTO public.projeto VALUES (223, 'BARRAGEM DE BRUMADINHO: A CONSEQUÊNCIA DOS ELEMENTOS QUÍMICOS NO MEIO AFETADO', 'A Barragem de Brumadinho, em Minas Gerais, era um reservatório utilizado para a deposição de rejeitos da extração de minérios. Além dela, existem outras construções que estão nessa mesma situação. No entanto, pouco se sabe sobre o dano que os minérios fazem com o ambiente. O método de construção do Córrego Feijão é o mais simples e o menos seguro e, por isso, ocorreu o rompimento, espalhando uma lama cheia de minérios perigosos pela região. O presente trabalho objetiva mapear os principais danos ambientais causados pelo rompimento da Barragem de Brumadinho em 2018. A partir de diversas pesquisas bibliográficas, através do Google Acadêmico, baseando-se em documentários e dados acadêmicos, foi possível identificar 13 elementos químicos que, em grande quantidade, são prejudiciais à saúde, localizados na lama de rejeitos de Brumadinho. Entre os metais pesados encontrados estão o níquel, magnésio e cádmio. Além disso, a mineração contém, basicamente, óxido de ferro, amônia, sílica, slite e argila. A exposição a esses elementos químicos podem causar grandes problemas à saúde para humanos e animais, além de muitas perdas vegetais. O consumo de peixes contaminados ou a ingestão de águas com altas concentrações de metais pesados pode levar ao aparecimento de problemas neurológicos. Ficar exposto à poeira da lama seca também pode afetar a população, mesmo que o risco não seja maior como a ingestão da água, que pode contaminar animais aquáticos ou ser utilizada para irrigação e ampliar áreas de contaminação. Em síntese, pode-se dizer que, se o caso não for devidamente solucionado, causará danos ainda maiores, tanto na natureza, quanto na saúde pública. As espécies que ali viviam, por exemplo, acabaram desaparecendo, pois dependiam daquele meio para sobreviver. Portanto, sem água potável animais migram para outras regiões e sem eles a natureza também acaba se extinguindo.', NULL, NULL, '2019-08-06 17:38:14', '2019-10-26 18:02:00', 4, 2, 7, 5, true, 8.5, 4.9107142857142998);
INSERT INTO public.projeto VALUES (241, 'TALK – TRADUTOR AUTOMÁTICO DE IDIOMAS PARA CRIANÇAS', 'O movimento de pessoas decorrente do deslocamento de imigrantes e refugiados vem alterando a demografia das nações hospedeiras. Por conta disto, os problemas de comunicação de crianças imigrantes e refugiadas que estudam em escolas públicas têm crescido nos últimos anos no Brasil. O impacto que esta adversidade pode causar é bastante relevante. Essas crianças se sentem deslocadas socialmente, sofrendo bullying, rejeição e intolerância étnica ou cultural por parte dos colegas em sala de aula. Hoje em dia não existem ferramentas específicas voltadas a auxiliar esse público. Por conta disto, este projeto, decorrente de um trabalho de conclusão de curso Técnico em Informática para Internet, propõe-se a analisar meios para mitigar esta questão. Este trabalho apresenta um aplicativo que tem por objetivo principal executar a tradução do idioma português para a língua materna da criança. O projeto, denominado TALK, consiste em um tradutor automático de idioma para crianças. Analisando softwares relacionados a este tema, foram destacadas características que são necessárias para a implementação de uma aplicação que atenda a esta finalidade. Dentre estas características, destaca-se a distribuição de um software gratuito para um ambiente educacional que ofereça a tradução em tempo real para múltiplos idiomas, que possua uma interface intuitiva e que ofereça telas para o educador e para a criança. O aplicativo, desenvolvido na plataforma Android, possui duas principais funcionalidades, que são a criação de uma sessão, em que o usuário emissor recebe também resposta dos integrantes, e a participação em uma sessão ativa. Este trabalho exibe resultados parciais do projeto, que está em fase de desenvolvimento. Testes preliminares efetuados com o protótipo foram promissores, comprovando que a aplicação consegue atingir os objetivos e efetuar a tradução de idiomas em tempo real. Os resultados completos serão descritos na monografia decorrente do trabalho de conclusão de curso.', NULL, NULL, '2019-08-08 09:11:45', '2019-09-19 14:02:50', 6, 2, 7, 5, true, 8.75, 0);
INSERT INTO public.projeto VALUES (431, 'EFEITOS DO ISOLAMENTO SOCIAL NO DESENVOLVIMENTO MENTAL E EMOCIONAL EM CRIANçAS', 'Durante a pandemia de COVID-19, uma das medidas tomadas para reduzir a taxa de contágio foi o isolamento social. Esse processo acarretou inúmeras consequências para indivíduos no estado inicial de seu amadurecimento psicológico. Desse modo, o trabalho tem como objetivo principal investigar os efeitos do isolamento social no desenvolvimento mental e emocional de 70 crianças da faixa etária entre cinco e doze anos. A metodologia deste projeto consistiu na aplicação de um questionário virtual para pais e responsáveis, da região metropolitana de Porto Alegre, baseando-se na sua avaliação sobre seus filhos no processo de isolamento social. Os resultados revelaram que fatores diretamente relacionados com uma boa saúde mental receberam respostas negativas. Em geral, durante a quarentena, as crianças apresentaram mudanças de humor constantes (correspondente a 67% dos entrevistados) e se tornaram mais ansiosas (equivalente a 80%), consequentemente aumentando o cansaço diário e suas horas de sono. A alimentação dos avaliados também foi afetada em sua quantidade e qualidade. Crianças, em sua maioria (63%), estão comendo mais alimentos não saudáveis e altamente processados. Além disso, 73% apresentam-se menos ativas, afetando sua saúde física que está diretamente vinculada à psicológica. Assim, conclui-se que o desenvolvimento mental e emocional das crianças foi prejudicado devido ao isolamento social, já que a fase principal da formação psicológica ocorre na infância. Há um registro da situação atual como um acontecimento corriqueiro, em que a criança aprende a se adaptar ao mundo que lhe foi apresentado. É importante realizar estudos como este, pois é provável que, ao crescer, os medos e inseguranças dessa época fiquem registrados e se tornarão cada vez mais presentes em seu dia-a-dia. A pandemia pode até ter seu encerramento, mas seus danos futuros no âmbito psicológico de indivíduos em desenvolvimento são de longa data.', NULL, NULL, '2021-10-17 14:07:37', '2021-11-05 12:52:55', 3, 2, 9, 5, true, 8.25, 9.63749999999999929);
INSERT INTO public.projeto VALUES (199, 'FRONT LINE: MACHISMO NOS CAMPOS DE JUSTIÇA DO LEAGUE OF LEGENDS', 'Esta pesquisa tem como objetivo entender como e porque se desenvolve o discurso machista no servidor brasileiro de League of Legends. Nossa justificativa para desenvolver a presente pesquisa deve-se ao fato de que o mercado de jogos, em especial League of Legends, está em constante expansão. Com o mercado dos games em alta, o número de jogadores aumenta, o que gera também o aumento da comunidade tóxica do jogo. Essa comunidade acaba ganhando força por ser um jogo onde os usuários são anônimos, isso faz com que seja um ambiente propício a comportamentos hostis. Por conta destas comunidades muitas categorias de toxicidades foram geradas neste espaço, e uma das mais frequentes é o machismo. De acordo com pesquisas, 63% das jogadoras já foram vítimas de assédio ou xingamentos em jogos online, fazendo com que as mulheres, muitas vezes, se sintam desmotivadas a continuar jogando. A metodologia do trabalho seguiu as seguintes etapas: coleta de dados (screenshots de conversas no League of Legends que haviam sido postadas no Twitter); análise dos dados; organização dos discursos em categorias estabelecidas após a análise. Os resultados parciais indicam que a forma que os jogadores se comportam na hora de se expressar é bastante influenciada pelas construções de gênero. O espaço virtual de jogo coopera para que tais situações aconteçam: desde a forma que a empresa desenvolvedora usa pra agradar visualmente o público masculino em relação ao visual das personagens femininas, até a impunidade de usuários que apresentaram comportamento negativo e desrespeitoso com jogadoras mulheres. Como conclusões preliminares, podemos apontar que é necessária uma discussão a respeito do machismo nos jogos e como ele afeta as mulheres, não somente no aspecto virtual, mas também no real. Para isso, pesquisas como esta devem continuar sendo desenvolvidas a fim de que ações efetivas de combate ao machismo sejam pensadas e colocadas em prática no jogo.', NULL, NULL, '2019-07-22 17:13:52', '2019-09-19 16:05:43', 3, 2, 7, 5, true, 9.25, 9.42500000000000071);
INSERT INTO public.projeto VALUES (353, 'DTEC - VISõES SOBRE A TECNOLOGIA ATRAVéS DOS OLHOS DA SOCIEDADE', 'A fim de instituir debates e análises críticas de temas ligados à tecnologia presentes no quotidiano, foi criado em 2017 o programa de Extensão “dTEC – Diálogos com Tecnologias”, no Instituto Federal de Educação, Ciência e Tecnologia do Rio Grande do Sul - campus Osório. O programa surgiu a partir da percepção de que persiste uma visão tecnicista e incompreensível aos leigos aos temas tecnológicos que permeiam nossa sociedade, ignorando sua influência em seus diferentes aspectos sociais, culturais, econômicos e políticos. Para superar essa visão, o dTEC tem procurado desenvolver ações que instiguem a reflexão sobre temas tecnológicos, como filmes documentais ou ficcionais e publicações e interações em redes sociais que abordam assuntos como inteligência artificial, robótica e ética na informática. No entanto, o principal eixo do dTEC tem sido palestras, nas quais especialistas convidados pelo programa proporcionam debates de diferentes temáticas de interesse da comunidade, de modo ampliar a visão de como a tecnologia se incorpora ao meio social, abrangendo relevantes temas como questões de gênero, como espaço da mulher no mundo da informática, a criação de FabLabs, o papel da automação industrial na sociedade de consumo, a aproximação entre games e marketing digital. Ao atender um amplo público da região de Osório, como discentes dos cursos médios e superiores em Informática do campus até participantes externos de instituições de ensino da região, o dTEC abre a possibilidade dos participantes conhecerem mais sobre o mundo do trabalho a partir do desenvolvimento e uso de tecnologias. Ao propor-se desvelar o chamado blackbox que circundam as tecnologias atuais, acreditamos que o dTEC tem contribuído para aliar uma formação técnica a uma consciência crítica, ética e cidadã entre seus participantes, permitindo que entendam mais seu presente e possam projetar o futuro de uma sociedade tecnológica menos desigual e mais solidária.', NULL, NULL, '2019-08-12 22:29:34', '2019-09-19 16:18:03', 3, 2, 7, 5, true, 8.125, 6.97499999999999964);
INSERT INTO public.projeto VALUES (380, 'EDITORAS INDEPENDENTES E PRÊMIOS LITERÁRIOS: MAPEAMENTO LITERÁRIO BRASILEIRO NO SÉCULO XXI', 'Com os avanços tecnológicos ampliados pela contemporaneidade, cria-se um novo cenário dentro do sistema literário, para além da tríade autor-obra-público leitor, tendo em vista a ampliação de possibilidades vinculadas ao mercado editorial. Nesse contexto, a presente pesquisa surge da necessidade de analisar as características do sistema literário atual, buscando mapear o surgimento e o desenvolvimento de editoras independentes pela perspectiva dos prêmios literários nacionais. Tal pesquisa faz parte do projeto Literatura Brasileira Contemporânea e Decolonialidade (IFRS), cujo objetivo é avaliar a inserção da literatura brasileira no cenário contemporâneo em relação à chamada global literature. No ano de 2019, o projeto analisou o impacto dos prêmios literários no processo tradutório entre os anos de 2011 e 2019. Através de tais materiais já catalogados, cria-se a base para a atual pesquisa, de caráter qualiquantitativo, na qual, por meio da coleta e da análise de dados de finalistas e vencedores de prêmios literários, percebe-se a presença ascendente de editoras independentes ao longo da década. Por meio da análise dos materiais, percebeu-se um aumento significativo na presença dessas editoras como finalistas a partir do ano de 2015, tendo chegado a sua participação máxima no ano de 2018, com 46,2% das obras finalistas. No que tange à presença destas como vencedoras, percebe-se uma média de 17,1%, com exceção do ano de 2019, no qual 43,8% das obras premiadas foram publicadas por editoras independentes. Por meio de tal estudo, observa-se a expansão, ainda que lenta e gradual, da presença de editoras independentes no cenário nacional, gerando um ambiente propício ao surgimento de mais editoras com tal característica no mercado editorial. Por fim, percebe-se a importância de mapeamentos como este para a compreensão do sistema literário contemporâneo nacional, a fim de que sejam observadas e divulgadas novas tendências e forças para além do cânone.', NULL, NULL, '2021-09-29 13:05:01', '2021-11-03 09:55:38', 3, 2, 9, 5, true, 8.875, 8.36250000000000071);
INSERT INTO public.projeto VALUES (253, 'A RELAçãO DA PRáTICA DE ATIVIDADES FíSICAS COM TRANSTORNOS NEUROPSIQUIáTRICOS ENTRE JOVENS SEDENTáRIOS E ATIVOS EM PORTO ALEGRE.', 'No Brasil, pesquisas vigentes apresentam que menos de 50% dos adolescentes entre 14 e 18 anos pratica exercícios de modo assíduo. À luz disso, o Brasil teve um aumento de quase 700% nos episódios de suicídio nos últimos 16 anos. Isso posto, foi preciso estabelecer uma relação sólida entre ambos os problemas: sedentarismo e transtornos neuropsiquiátricos, principalmente a depressão. Para isso, foi desenvolvida uma série de perguntas embasada em questionários acadêmicos, sendo eles: testes de Hamilton, de ansiedade e depressão, devolvendo uma pontuação crescente ao usuário, de menos afetado ao mais afetado; juntamente do questionário internacional de atividade física (IPAQ). A partir do recolhimento de perfis adolescentes – entre 14 e 18 anos – pela internet, dividiram-se grupos com base no sexo, intensidade de atividades físicas e “score” feita nos testes de transtornos depressivos e ansiosos. Foi preciso criar, então, um banco de dados objetivo com auxílio do SPSS 22 – programa da “International Business Machines” (IBM) – e passar esses mesmos resultados pra uma planilha, através do serviço disponibilizado pelo próprio “Google”. Por fim, a partição em exercícios físicos do sexo feminino é menor em relação ao masculino (55% contra 70%); apesar de ter um índice de 40% de jovens que não praticam esportes regularmente, os mesmos sentem-se motivados ao exercitar-se, mesmo que de modo casual, e entendem que a saúde física é um pilar para a saúde humana em geral. Foi percebido, também, que a falta ou excesso de práticas físicas não têm relação direta com o transtorno de ansiedade, mas sim com a depressão juvenil; enquanto os jovens, ainda que inativos fisicamente, sentem-se motivados enquanto praticam exercícios – seja uma aula de educação física ou uma caminhada no parque, sem incluir na rotina – mas são contrariados pelo mal-do-século (depressão), mesmo que de modo involuntário e, muitas vezes, inexplicável.', NULL, NULL, '2019-08-09 09:49:22', '2019-09-19 15:11:54', 4, 2, 7, 5, true, 7.125, 6.98571428571429998);
INSERT INTO public.projeto VALUES (370, 'PETSHELP - UMA PLATAFORMA QUE AUXILIA ANIMAIS ABANDONADOS', 'O número de animais em situação de risco nas ruas é expressivo e chama a atenção o número de cães e gatos abandonados no Brasil. Entretanto, analisando apenas os números de cães abandonados no mundo, divulgados pela Federação das Associações Veterinárias Asiáticas (FAVA), é possível concluir que o abandono é um problema com proporção mundial. De acordo com matéria publicada pelo G1, os animais, quando abandonados, sofrem com a fome, maus tratos e perigos nas ruas, além de ser um problema que afeta diversas áreas como saúde, meio ambiente e trânsito. Dados divulgados pela União Internacional Protetora dos Animais (UIPA), o índice de abandono teve um aumento significativo por conta do contexto atual de pandemia. Sendo assim, torna-se demasiado importante incentivar a adoção e a maior participação das pessoas para atenuar essa situação. Por conta disto, este projeto propõe-se a analisar meios para mitigar estas questões. Este trabalho apresenta um aplicativo que tem por objetivo principal auxiliar cães e gatos abandonados e incentivar a adoção dos mesmos, denominado PETSHELP. O aplicativo, em fase de desenvolvimento, utiliza a plataforma Android, fazendo uso do ambiente MIT App Inventor e do banco de dados Firebase. O aplicativo possui duas principais funcionalidades, que são o cadastro de cães e gatos encontrados nas ruas e as opções de auxiliá-los, que se dão por meio da adoção e assistência para a alimentação por meio de mapeamento da localização dos mesmos. Este projeto encontra-se em estágio inicial de implementação, estando concluídas a sua identidade visual e a interface gráfica de seus módulos de login e cadastro de usuários, e, atualmente, sendo finalizada a interface gráfica do módulo de cadastro de animais. Após a conclusão do protótipo, está prevista a validação de suas funcionalidades através do uso por parte de grupos voluntários.', NULL, NULL, '2021-09-23 08:28:19', '2021-11-05 12:45:39', 6, 2, 9, 5, true, 8.25, 9.32499999999999929);
INSERT INTO public.projeto VALUES (439, 'MERCADO DE TRABALHO: AS NOVAS RELAçõES DOS EMPREGOS FORMAIS E INFORMAIS NO BRASIL.', 'Este estudo surge a fim de analisar com base num método qualiquantitativo, ou seja, com referências bibliográficas e via formulário, as relações trabalhistas do século 21 no Brasil. Identificamos que o trabalho no Brasil acaba por diferir do resto do mundo. Hoje com 13,4 milhões de desempregados, temos de forma simbólica o banco Itaú que, ao bater recorde no faturamento líquido, demite 6,9 mil funcionários. Em entrevista, Antonio Detsi da rede Bob’s diz que a automação aumentou o lucro de suas lojas em 25%. Enquanto isso ocorre no Brasil, em Gotemburgo, Suécia, há uma jornada de 6 horas de trabalho, e na Finlândia a primeiraministra Sanna Marin quer aprovar seis horas de trabalho por 4 dias na semana. Dados do formulário feito com 200 pessoas indicam que 87% se sentem desanimados ou ansiosos frequentemente durante o isolamento social. Perguntados se a jornada de trabalho os estaria sobrecarregando 79,5% responderam que frequentemente. Por fim, nas visões pessoais do emprego hoje no Brasil 49% responderam que acham regular, 37,5% ruim e 13,5% bom. Concluindo assim que o trabalho no século 21 possui as mesmas associações das suas origens, o trabalho não liberta e nem emancipa o indivíduo trabalhador, acaba por deixá-lo doente. Por isso, é papel da sociedade lutar por trabalho justo e igualitário, tal qual as nações desenvolvidas da Europa, buscar inspiração em figuras como Sanna Marin, assim fazendo o trabalho ser emancipatório.', NULL, NULL, '2021-10-17 21:36:25', '2021-11-03 23:33:49', 10, 3, 9, 5, true, 8.375, 8.55000000000000071);
INSERT INTO public.projeto VALUES (404, 'DO ESTUDANTE PARA O ESTUDANTE | CONTEXTOS PRáTICOS QUE PODEM POTENCIALIZAR A APRENDIZAGEM DA FíSICA E DO ESPANHOL', 'Neste projeto temos como objetivos aprimorar o entendimento das ideias de Nikola Tesla, especificamente os conceitos do eletromagnetismo, e perceber outras formas de aproveitamento das mesmas, bem como ampliar os conhecimentos do idioma espanhol. Sob o contexto prático, as concepções acerca dos conhecimentos envolvidos dão um sentido cotidiano e real para estas áreas do conhecimento. Abordaremos o modelo chamado pelos estudantes de: “do estudante para o estudante”. Tratará de um experimento que, desde a construção de um modelo não inédito até a explicação dos fenômenos, partirá dos estudantes, um fator atrativo para eles. Outro fator relevante se traduzirá na gestão deste projeto como consequência da elaboração e utilização da língua espanhola para comunicar a escrita, visto que o ensino do espanhol é muito desvalorizado nas escolas brasileiras, além do mais o acesso a condições que promovam pensamentos transversais entre e inter áreas é relevante. Bourdieu (1989) complementa este pensar quando ressalta que os recursos potenciais simbólicos apresentam variadas relações, tensionando ora distanciamentos, ora aproximações. Ainda no campo da complementação deste contexto, estudos neurológicos apresentam que o ato da prática é extremamente favorável à percepção de teorias, principalmente as de assuntos tão complexos de se entender, como é o caso das ideias que serão apresentadas no projeto. Esta abertura para as ciências e idiomas é passível de atrair novos estudantes focados no objetivo de aprender profundamente sobre os assuntos e transitar entre áreas do conhecimento das ciências da natureza e suas tecnologias e conscientização de seus fenômenos, que mesmo com nossa tecnologia de hoje, é pouco explorado, apesar de seu grande potencial para a humanidade.', NULL, NULL, '2021-10-11 17:50:42', '2021-11-03 12:33:12', 4, 2, 9, 5, true, 6.625, 6.52500000000000036);
INSERT INTO public.projeto VALUES (417, 'CAMINHOS PARA A AUTONOMIA - CONHECENDO TRAJETóRIAS DE EGRESSOS DO ENSINO MéDIO INTEGRADO DO IFRS CAMPUS OSóRIO (2014-2019)', 'O Caminhos para a Autonomia é um projeto de indissociabilidade entre Pesquisa, Ensino e Extensão que objetiva conhecer as experiências de estudantes egressos do Ensino Médio Integrado (EMI) do IFRS Campus Osório. Ao percebermos que a instituição não realiza um acompanhamento daqueles que passaram pelo EMI, pensamos um projeto que analisasse as diferentes trajetórias e perfis dos egressos, compreendendo suas percepções como discentes, incluindo percursos e experiências profissionais e acadêmicas após sua passagem pelo campus. Estabelecer o projeto exigiu conhecer melhor as políticas de egressos existentes nos Institutos Federais, pois são meios que permitem compreender as trajetórias dos ex-alunos em relação ao mundo do trabalho, contribuindo para o aperfeiçoamento dos processos de ensino-aprendizagem. Assim, desenvolvemos uma pesquisa nos sites oficiais dos 38 IFs sobre suas políticas de acompanhamento de egressos. Uma minoria das instituições torna pública estas informações, que apresentam-se, inclusive entre campi, de maneiras distintas. Isso pode apontar para carências institucionais que prejudicam a continuidade de ações que visam uma formação continuada e contato próximo com ex-alunos. Na sequência, elaboramos um questionário aos egressos do EMI (entre 2014 e 2019). Aplicado entre julho e outubro de 2020, este auxiliou a identificar o percurso dos ex-alunos desde antes de ingressarem na instituição, experiências deles no campus e trajetória profissional e acadêmica após a formação, buscando saber quanto o campus influenciou na vida de cada um. Obtivemos respostas de 199 egressos. Com base no questionário, convidamos 21 egressos para participarem de entrevistas semiestruturadas sobre suas vivências no campus, oportunizando-lhes um espaço de fala, que nos possibilitou interagir e descobrir mais sobre suas experiências. Por fim, ressaltamos que muitos egressos entrevistados demonstraram interesse em ser parte ativa da instituição, mantendo o vínculo com a mesma.', NULL, NULL, '2021-10-13 21:38:57', '2021-11-05 13:03:13', 3, 2, 9, 5, true, 6.375, 9.80000000000000071);
INSERT INTO public.projeto VALUES (369, 'EXTRAÇÃO E TRANSFORMAÇÃO DO LODO PROVENIENTE DO BENEFICIAMENTO DO CORTE DE MÁRMORES E GRANITOS EM MASSA PLÁSTICA', 'O Brasil por conta de sua variedade geográfica se tornou um grande importador e exportador de rochas ornamentais, chegando ao quinto lugar mundial. Entretanto, com a maior demanda, ocorre maior formação de fontes não renováveis. Dentro desse contexto, estão surgindo cada vez mais processos focados na reutilização de materiais provenientes desses insumos, por possuírem baixo custo e boa aplicabilidade. A formulação de uma massa plástica sustentável derivada de resíduos de cortes de mármores e granitos, com base na resina de poliéster insaturada, demonstra eficácia dentre os pontos econômicos e ecológicos. O objetivo desse trabalho foi avaliar uma possível transformação dos resíduos provenientes do corte de mármores e granitos para posterior utilização como massa plástica, substituindo aquelas produzidas industrialmente. As propriedades de concentração em matéria foram analisadas por meio de fotometria de chama e espectrometria de absorção atômica, além de titulações com EDTA para comparação de resultados. A partir disso foram realizados testes físicos estes sendo: de resistência e aderência a tração e resistência a flexão em três pontos e um teste químico de teor de umidade. A massa plástica desenvolvida apresentou resultado superiores à massa plástica comercial testada em relação ao teste de resistência a aderência a tração, possuindo uma média de 9,82 kN frente a comercial que apresentou a média de 6,57 kN, tornando-se eficiente o resíduo quando misturado com a resina e apresentando potencial de substituição em relação a massa industrializada.', NULL, NULL, '2021-09-21 13:47:03', '2021-11-04 22:50:54', 8, 2, 9, 5, true, 9.375, 9.66250000000000142);
INSERT INTO public.projeto VALUES (191, 'O SUICíDIO DE GETúLIO VARGAS NA IMPRENSA BRASILEIRA', 'Os anos de 1951 a 1954 foram anos importantes para o país. Época de uma industrialização rápida e urbanização acelerada, nesse período aconteceu o suicídio do presidente Getúlio Vargas, marco importante da História do Brasil. O governo de Vargas representou mudanças importantes para a sociedade, cujas consequências podemos ter como base para refletir sobre nossas escolhas futuras. Em razão disso, nosso problema de pesquisa é investigar como foi a repercussão do suicídio de Vargas nos jornais Correio da Manhã e Jornal do Brasil? Desse modo, nosso objetivo geral é compreender como a imprensa brasileira representou esse acontecimento político e como objetivos específicos queremos entender o que levou Getúlio a cometer o terrível ato do suicídio e aprofundar nossos conhecimentos sobre a política, o governo e a figura pública de Getúlio. Em termos metodológicos, nossa pesquisa baseia-se na análise de fontes primárias e secundárias. Começamos realizando a leitura das fontes secundárias (FAUSTO, 2011; SKIDMORE, 1982; FERREIRA, 1994) e elaborando fichamentos sobre estes textos. Depois de estudarmos essas obras, obtemos mais informações após realizar a coleta de dados no site da Hemeroteca da Biblioteca Nacional. Fizemos pesquisas nos jornais Correio da Manhã e Jornal do Brasil publicados entre os dias 24 de agosto e 29 de agosto de 1954, sendo a primeira data o dia do suicídio do Presidente Getúlio Vargas e a última o dia em que as publicações sobre o assunto começaram a perder relevância nos jornais. Podemos concluir que a repercussão do suicídio de Getúlio foi muito grande, tanto no Brasil quanto no exterior. Não eram poucas as reportagens que ressaltavam a pessoa admirável que ele era, principalmente por seus eleitores. Mas mesmo com tantas pessoas a seu favor a imprensa sempre o pressionou para renunciar ao governo, tendo grande influência na tentativa de manchar a moral política de Getúlio, o que se intensificou no ano de 1954.', NULL, NULL, '2019-07-15 20:50:44', '2019-09-19 12:37:52', 3, 2, 7, 5, true, 7.5, 0);
INSERT INTO public.projeto VALUES (326, 'A IMPORTâNCIA DAS ABELHAS', 'O projeto tem como finalidade debater a importância ecológica das abelhas. Atualmente, muitos estudos apontam um declínio considerável nas populações de abelhas no Brasil. Há a necessidade de entender o que causa a mortalidade desses insetos e de que forma é possível diminui-la. O problema de pesquisa está relacionado à seguinte indagação: “De que forma as abelhas contribuem para a polinização?”. O objetivo geral é demonstrar a importância ecológica das abelhas. Os objetivos específicos são: pesquisar sobre a população de abelhas no Brasil, entender quais as causas do declínio da população de abelhas no Brasil e no mundo e traçar soluções para diminuir a mortalidade das abelhas nas cidades. Muitos estudos apontam que entre as principais causas relacionadas à diminuição da diversidade desses insetos, está a perda de seu habitat e o uso indiscriminado de agrotóxicos, como, por exemplo, aqueles derivados da nicotina. Como forma de atingir os objetivos propostos, foram feitos estudos de revisão de literatura, entrevistas com apicultores e entrega de sementes. A partir das pesquisas realizadas, foi possível entender o ciclo de vida da abelha, seu papel como agente polinizador das plantas e as causas de sua mortalidade em diferentes estados do Brasil. A partir do exposto, entende-se a necessidade de criar mecanismos para facilitar o aumento da população de abelhas nas cidades, como o plantio de flores silvestres que possam favorecer o processo de polinização.', NULL, NULL, '2019-08-10 20:42:35', '2019-09-25 11:41:29', 10, 3, 7, 5, true, 7.625, 8.61250000000000071);
INSERT INTO public.projeto VALUES (248, 'BRAIN HELP - UTILIZANDO CHATBOT E INTELIGÊNCIA ARTIFICIAL NO APOIO A PORTADORES DE ALZHEIMER', 'A doença de Alzheimer é realidade na vida de milhões de pessoas no mundo todo. Os sintomas dessa enfermidade podem atingir, principalmente, idosos com mais de 65 anos e se tornam ainda mais comuns após os 85 anos. Muitas vezes os sintomas da doença são confundidos apenas como sintomas comuns do envelhecimento, portanto em alguns casos não há um diagnóstico definitivo. Estudos afirmam que atividades interativas ajudam os pacientes a manter a capacidade de realizar tarefas cotidianas e retardam o comprometimento cognitivo. Com isso, a presente pesquisa tem como objetivo o desenvolvimento de uma plataforma que auxilia no dia-a-dia de pessoas diagnosticadas com a doença através da prática de atividades que ajudam na redução dos sintomas do Alzheimer e prover uma melhora na qualidade de vida de familiares e cuidadores envolvidos com o cuidados dessas pessoas. A coleta de dados está sendo realizada através de entrevistas e aplicação de questionários com profissionais responsáveis pela Associação Brasileira de Alzheimer (ABRAz), assim como cuidadores e familiares de pessoas diagnosticadas com a doença. Os dados obtidos serão analisados e possibilitará complementar as funcionalidades identificadas através da pesquisa bibliográfica e documental realizada. Para o desenvolvimento da plataforma pretende-se utilizar inteligência artificial e chatbots, tecnologias consideradas tendências na área de computação. Com base nas pesquisas realizadas pode-se afirmar que o tratamento complementar ao farmacêutico, auxilia na redução e retardamento dos sintomas da doença. Como resultados futuros espera-se que a plataforma auxilie os diagnosticados com a doença e seus familiares em suas rotinas, com a comunicação entre o chatbot, prática de atividades e geração de relatórios de acompanhamento para o médico.', NULL, NULL, '2019-08-08 21:26:30', '2019-09-19 11:51:04', 6, 2, 7, 5, true, 8.375, 8.98928571428569967);
INSERT INTO public.projeto VALUES (247, 'APLICATIVOS DE CELULAR: FERRAMENTA PEDAGÓGICA NO ENSINO DA MATEMÁTICA', 'Como diretrizes governamentais, a inserção de Tecnologias é explicitamente incentivada nos parâmetros curriculares nacionais (Brasil, 1998). Pensando nisso, nossa pesquisa tem como objetivo avaliar se os aplicativos dos celulares podem ser utilizados como ferramenta pedagógica para o ensino da matemática e suas influências na aprendizagem dos estudantes. Nossa metodologia: No primeiro momento, pesquisar uma quantidade de aplicativos matemáticos que possam ser usados em sala de aula. Num segundo passo, escolher duas turmas de mesma serie. Durante um mês, serão realizadas as aulas com os mesmos conteúdos em ambas as classes, mas com a turma piloto utilizando os aplicativos e a outra turma controle não. Nós faremos um relatório ao fim de cada aula. Esse diário de classe comentará os pontos positivos e negativos do evento, assim como o comportamento e desempenho dos estudantes. E além disso, no final do mês, será realizado um teste igual para ambas as turmas. A última etapa do nosso trabalho será examinar e comparar os dados coletados nas aulas. O momento atual pode promover reflexões acerca da utilização dos aparatos digitais de modo que possam enriquecer intervenções pedagógicas nos processos de ensino e aprendizagem. Acreditamos que é possível evidenciar a grande variedade de recursos tecnológicos existentes que podem auxiliar os professores em sala de aula para trabalhar conteúdos, não só de matemática, mas também com outras disciplinas.', NULL, NULL, '2019-08-08 21:13:11', '2019-09-19 14:14:07', 10, 3, 7, 5, true, 8, 9.32499999999999929);
INSERT INTO public.projeto VALUES (294, 'PROJETO: APP.E.B (APLICATIVO ENSINANDO BHASKARA).', 'Este projeto será feito pelos alunos do curso técnico integrado de eletrônica 1: Pedro Rolin Schmitz (pedrorolin8@gmail.com) Saimon dos Santos Carvalho ( saimonssc118@gmail.com) E será orientado pela professora de lógica de programação: Carla Odete Balestro SIlva (carla.silva@canoas.ifrs.edu.br) Este projeto tem como base ensinar Bhaskara para indivíduos que têm uma certa dificuldade (Bhaskara nada mais é do que uma fórmula para calcular a equação de segundo grau, escrita na forma de “ax2+bx+c=0” , a Bhaskara é bastante útil para os acadêmicos da área de exatas) , por meio de um aplicativo criado em portugol studio. Este projeto consiste em um aplicativo onde a pessoa que deseja aprender irá pegar seus exercícios dados na escola ou retirados de outras fontes, e colocará as informações que o aplicativo solicitar, logo após o aplicativo irá mostrar um passo a passo do que o indivíduo deverá fazer para solucionar o exercício assim fazendo com que o aplicativo não precise dar a resposta de bandeja para o usuário que quer aprender Bhaskara. O objetivo deste projeto é tentar ensinar as pessoas que têm dificuldade em Bhaskara a entenderem a matéria por meio de um aplicativo, cada vez mais as pessoas estão se adaptando à tecnologia e hoje em dia as pessoas têm mais vontade e facilidade de aprender as coisas utilizando da mesma. Os alunos responsáveis pelo projeto tiveram a ideia deste projeto pela imensa dificuldade que muitos indivíduos têm nesta matéria, eles fizeram essa observação por terem passado pelo nono ano e muitos colegas de turma diziam que era o ano mais difícil pela matéria de matemática, a Bhaskara.', NULL, NULL, '2019-08-09 23:52:00', '2019-09-17 16:12:00', 6, 2, 7, 2, true, 7.75, NULL);
INSERT INTO public.projeto VALUES (414, 'COMO A PANDEMIA AFETOU A ESCOLARIDADE', 'A pandemia da doença infecciosa Covid-19, causada pelo vírus SARS-CoV-2, afetou o mundo e o Brasil inteiros, fazendo com que fossem necessárias grandes mudanças nos hábitos da população, incluindo em setores extremamente importantes da sociedade, como a saúde, higiene, economia e, foco deste trabalho, a educação. Com o intuito de descobrir o impacto que a pandemia e as medidas sanitárias para sua prevenção tiveram na educação dos jovens do ensino secundário brasileiro, estão sendo analisadas pesquisas e dados relacionados à evasão escolar pré e pós-pandêmica, e como essa mudança afeta o trajeto dos alunos brasileiros pelo sistema educacional. Estimamos que devido a pandemia Covid-19, uma grande porção de alunos terá a sua carreira escolar prejudicada. Devido a medidas de segurança, muitos alunos perderam a oportunidade que tinham de ir à escola presencialmente, ocasionando no uso do ensino remoto, que, por conta de diversos motivos, como, por exemplo, a falta de acesso de internet estável por parte da população e a falta de um ambiente dedicado ao estudo, dificulta o aprendizado. A Pesquisa Nacional de Amostra de Domicílios Contínua realizou uma pesquisa em 2019, em que foi descoberto que o abandono escolar afetava 28,6% dos adolescentes no ensino médio. Dentre os principais motivos estão problemas de infraestrutura e currículos escolares que não interessam aos alunos (DAYRELL; JESUS, 2013). No período entre 2020 e 2021, foi regularizado o ensino remoto por meio da internet, entretanto, apenas 33% dos domicílios brasileiros possuem computador e acesso a internet, de acordo com a Undime. Além disso, 44% dos estudantes do ensino médio buscaram emprego e sentiram-se desinteressados na aprendizagem. Estes dados sugerem que a evasão escolar afeta principalmente estudantes que precisam trabalhar e aqueles que não tem acesso a internet, ou seja, afeta principalmente a população mais pobre, causando a desdemocratização do ensino brasileiro.', NULL, NULL, '2021-10-13 20:08:53', '2021-10-22 13:13:31', 3, 2, 9, 3, NULL, 7.625, NULL);
INSERT INTO public.projeto VALUES (315, 'LIVRE DE PRECONCEITOS', 'As questões de gênero e sexualidade são bastantes polêmicas e mexem com um aspecto importante da sociedade: o preconceito. A sigla LGBTQI tornou-se popular como autodesignação e se destina a promover a diversidade das culturas baseadas em identidade sexual e de gênero. O objetivo do trabalho é elucidar a diversidade envolvida à sigla LGBTQI, explicar questões básicas de gênero e sexo e também aplicar um questionário anônimo com perguntas para verificar o conhecimento dos estudantes acerca do tema. O trabalho foi desenvolvido na EMEF Sete de Setembro, em Canoas – RS, durante o mês de julho, com a aplicação do questionário e a pesquisa dos termos e conceitos sobre o assunto. Foram feitas as seguintes perguntas: 1- Você sabe a diferença entre identidade de gênero e sexo?, 2- Você se considera: heterossexual, homossexual, bissexual, transexual, queer ou intersexo?, 3- Você aceitaria uma pessoa LGBTQI na sua família? Analisando as respostas, observou-se que a maioria dos alunos se considera heterossexual (82%) e afirma saber a diferença entre identidade de gênero e sexo (71%). Em relação a questão 3, a maioria disse aceitar (92%). Fica evidente que, mesmo em um ambiente escolar pequeno (210 alunos entrevistados), as minorias ficam representadas e, por isso, é necessário compreender, tolerar e respeitar as pessoas do modo que elas são.', NULL, NULL, '2019-08-10 17:33:33', '2019-09-19 13:52:27', 10, 3, 7, 5, true, 7.25, 8.27500000000000036);
INSERT INTO public.projeto VALUES (385, 'O AUMENTO DOS TRANSTORNOS MENTAIS NA PANDEMIA.', 'Este trabalho visa levar o conhecimento sobre saúde mental para as pessoas, mostrar a importância deste tópico, como a saúde mental tem impacto no nosso dia a dia, os impactos negativos da pandemia no tema, mostrar como é possível e necessário você procurar ajuda e como você não está sozinho nesta luta. A metodologia utilizada neste trabalho foi a coleta de informações de sites confiáveis e um levantamento de dados. Na pesquisa realizada tive o conhecimento que grande parte das pessoas acham que a pandemia teve um impacto negativo na sua saúde mental, todas as pessoas entrevistadas entendem que os transtornos psicológicos não são “drama”, percebi que a maioria das pessoas procurariam ajuda psicológica se percebessem que precisam, mas algumas delas marcaram que não iriam buscar ajuda ou talvez buscasse ajuda, isso me deixou em alerta, por mais que a maioria das pessoas entenda a importância da ajuda psicológica, tem pessoas que não tem conhecimento o suficiente sobre ou até mesmo tem vergonha de pedir ajuda. Com esse trabalho, espero poder mostrar que está tudo bem em pedir ajuda! A relevância social desejada com esse trabalho é alertar um pouco as pessoas sobre sua saúde mental, às vezes nós focamos tanto no exterior que não olhamos para o interior e tentar mostrar uma esperança em meio ao caos. Cuidar da sua saúde mental é cuidar de você mesmo!', NULL, NULL, '2021-10-05 10:02:40', '2021-11-05 00:03:16', 10, 3, 9, 5, true, 7, 7.125);
INSERT INTO public.projeto VALUES (314, 'SITE: FERRAMENTA QUE Dá SUPORTE PARA O APRENDIZADO DA LíNGUA PORTUGUESA', 'Desenvolver as competências linguísticas de ler, escrever e falar são os grandes desafios da área da língua portuguesa. Os estudantes atuais são curiosos e atentos a tudo o que acontece à nossa volta, são submetidos a uma grande quantidade de estímulos e de informações e estão totalmente familiarizados com a internet e os dispositivos eletrônicos. A partir de estudos realizados, procurou- se auxiliar os alunos a desenvolver competências e habilidades para usar seu conhecimento tecnológico e as informações a que tem acesso de modo crítico por meio da criação de um site nas aulas de língua portuguesa. Para desenvolver este trabalho, realizamos a seguinte dinâmica: os sétimos anos realizaram atividades envolvendo as mídias digitais e que foram sendo postadas no site, ao longo do semestre como: vídeos, mapas conceituais, apresentações, pesquisas, jogos... Após esta interação, aplicamos um questionário, nos sétimos anos, para saber se realmente o uso do site, nas aulas de língua portuguesa, pode favorecê-los na aprendizagem. Analisamos os gráficos e percebemos que 58% dos alunos preferem fazer o estudo da língua, usando os recursos digitais articulados aos conhecimentos. Por esse motivo, concluímos que a aprendizagem, por meio de um site, é enriquecedora, pois esta ferramenta oferece recursos que estimulam o jovem a desenvolver a autonomia, as habilidades de ler, escrever e se expressar, na tomada de decisão e resolução de problemas.', NULL, NULL, '2019-08-10 17:17:16', '2019-09-19 15:58:10', 11, 3, 7, 5, true, 7, 8.80000000000000071);
INSERT INTO public.projeto VALUES (430, 'AVALIAçãO DA QUALIDADE DA áGUA E ACúMULO DE MICROPLáSTICOS EM INTESTINO DE PEIXES COLETADOS DO RIO DOS SINOS, RS', 'Cerca de 300 milhões de toneladas de plásticos são produzidas por ano, destas, 13 milhões são destinadas a rios e oceanos, ocorrendo a eventual fragmentação em microplásticos e facilitando a entrada desses na cadeia alimentar de animais aquáticos. Contudo, apenas cerca de 13% das pesquisas sobre microplásticos estão relacionadas aos sistemas de água doce, sendo desenvolvidas, na grande maioria, em países denominados de primeiro de mundo. Em vista disso, o presente estudo objetivou avaliar e quantificar o acúmulo de microplásticos encontrados na água e nos intestinos de peixes oriundos do Rio dos Sinos. Para isso, após aprovação pela comissão de ética, foram coletados 10 peixes, dos gêneros Bryconamericus iheringii e Astyanax, em diferentes trechos do rio (Caraá (P1) e Sapucaia do Sul (P2)). Os animais foram anestesiados e eutanasiados, para a dissecação do intestino. Posteriormente, foi feita a digestão com a solução de KOH a 10%, por cerca de dois meses. A análise da água foi feita a partir de uma digestão e posterior filtração à vácuo com membrana filtrante. Tanto a água quanto os animais coletados em P1 apresentaram uma quantidade de microplásticos superior às obtidas em P2; sendo 20 fibras na amostra da água e 56 fibras nas amostras de intestino. Em P2 foram encontrados 8 e 26 fibras nas amostras de água e do intestino, respectivamente. Os resultados obtidos neste estudo são os primeiros a serem divulgados sobre a presença de microplásticos em espécies nativas do Rio dos Sinos/RS. Isto confirma a importância de mais estudos relacionados a estas micropartículas em água doce no Brasil e de seus potenciais efeitos tóxicos, visto que os peixes acabam ingerindo microplásticos quando estes estão juntos aos alimentos.', NULL, NULL, '2021-10-16 20:40:15', '2021-11-05 00:07:42', 4, 2, 9, 5, true, 9.625, 9.91249999999999964);
INSERT INTO public.projeto VALUES (442, 'A SOLIDãO DA MULHER NEGRA', 'A mulher negra dificilmente é vista como um sujeito que merece afeto, o próprio termo solidão da mulher negra se refere a falta de companheiros, principalmente românticos, na vida de mulheres negras, essa situação não é motivada pela escolha desses indivíduos e sim pelas consequências de opressões, como racismo e machismo, que interferem na vida dessas mulheres. A miscigenação racial acontece no Brasil desde o período de colonização, e é uma característica dela que homens negros mantenham relações afetivas com mulheres brancas muito mais do que homens brancos mantenham com mulheres negras, isso reforça a sua solidão. Um estudo de 2008 na cidade de São Paulo demonstrou que nos bairros periféricos, 75,6% das uniões inter-raciais eram entre homem negro e mulher branca, enquanto que 24% eram entre homem branco e mulher negra, dessa forma, percebe-se que as mulheres negras não são preferidas pelos homens negros e brancos. É importante destacar que mesmo que motivada por, a solidão da mulher negra não carece somente de relacionamentos românticos, mas de qualquer expressão afetiva. É preciso combater esse estado emocional fortalecendo a afeição e as reconhecendo como sujeito, entende-se que, independente do fator racismo ser enfrentado por todos os indivíduos negros no Brasil, mulheres negras necessitam de espaço para luta de seus direitos, além desse dever social, cabe a sociedade identificar que em relações negras as experiências raciais individuais podem ser compreendidas e ser atraente não é o mais importante. Hoje, a mulher negra encara uma situação que sua identidade está vinculada a sua solidão, ser negra tem como consequência a falta de afeto, quando esse tem estiver difundido e excluirmos o estigma dessa parcela da população, mulheres negras poderão escolher estar solteiras.', NULL, NULL, '2021-10-18 00:42:47', '2021-10-25 17:42:25', 3, 2, 9, 2, NULL, 4.5, NULL);
INSERT INTO public.projeto VALUES (242, 'SABãO CASEIRO: UMA AçãO SUSTENTáVEL EM RELAçãO AO RESíDUO óLEO DE COZINHA', 'O óleo de cozinha é um produto alimentar utilizado em praticamente todos os domicílios, porém é de grande importância que a sociedade saiba dos efeitos que o descarte inadequado deste resíduo pode causar, principalmente em relação à contaminação da água. Todos os tipos de óleos não podem ter como destino pias, ralos ou bueiros pois impactam negativamente não só a água, mas também o encanamento das casas. Em vista que, o óleo é mais denso que a água, ele fica na superfície de rios e lagos, impedindo a passagem de luz e oxigênio, causando a morte de seres vivos aquáticos. Além do solo e da água, acaba poluindo até mesmo a atmosfera, porque a decomposição do óleo produz o gás metano (CH4), que é um gás do efeito estufa, que é capaz de reter o calor do sol na troposfera, o que acaba aumentando o problema do aquecimento global. Diante as políticas sustentáveis, estabelecimentos que utilizam grandes quantidades de óleo são orientados, fiscalizados e direcionam esse resíduo para empresas especializadas na reciclagem do óleo, que pode ser utilizado para produção de biodiesel, sabão, tintas a óleo, massa de vidraceiro e outros produtos. Uma forma fácil, viável, útil e sustentável em relação ao resíduo óleo de cozinha é a produção caseira de sabão, que além de ter um produto que poderá ser usado, representando economia para o orçamento familiar, ainda ajuda a conservar o meio ambiente. Diante o exposto, nosso projeto objetivou analisar os custos e eficácia de diferentes receitas de sabão caseiro. Sendo uma receita selecionada e testada, devido sua facilidade de execução e custo acessível. A partir das informações levantadas, oficinas de elaboração de sabão caseiro e orientações sustentáveis em relação ao resíduo foram realizadas como forma de conscientizar sobre os efeitos negativos do óleo e adotar medidas ecológicas no dia a dia da população.', NULL, NULL, '2019-08-08 15:46:21', '2019-09-19 16:43:16', 8, 2, 7, 5, true, 10, 9.91428571428570038);
INSERT INTO public.projeto VALUES (327, 'O IMPACTO DO PLáSTICO SOBRE OS ANIMAIS MARINHOS', 'O projeto refere-se ao descarte inadequado do plástico que chega até os oceanos, prejudicando diretamente a vida marinha. É importante conscientizar a população sobre a maneira correta do descarte do plástico, garantindo sua menor incidência nos diferentes ecossistemas. O problema de pesquisa está relacionado à seguinte indagação: “De que forma é possível diminuir a utilização de plástico para que seu uso não atinja os animais marinhos?”. Seu objetivo geral é conscientizar sobre a maneira correta de descartar o plástico. Faz-se necessário entender a forma que o plástico presente nos oceanos afeta a população marinha, para que seja possível conscientizar e divulgar maneiras de diminuir o seu consumo ou alternativas para substitui-lo. O plástico flutuante pode ser visto em todos os oceanos. Estudos comprovam que em determinados locais, a massa de plástico é superior à massa de organismos marinhos. Para atingir os objetivos propostos, utilizaram-se pesquisas bibliográficas, experimento com plástico biodegradável e entrevista com a comunidade escolar. Um dos resultados obtido na entrevista traz que 53% dos entrevistados não utilizam o canudinho de plástico, ainda assim, é notório que mudanças devem ser realizadas a fim de diminuir o uso exacerbado do plástico. Como forma de conscientização, foi criada uma página em uma Rede Social com o intuito de divulgar alternativas mais sustentáveis de substituição do plástico e como seu uso pode prejudicar a biodiversidade marinha.', NULL, NULL, '2019-08-10 20:45:47', '2019-09-25 11:43:28', 10, 3, 7, 5, true, 7.75, 8.8125);
INSERT INTO public.projeto VALUES (421, 'CARRO ELÉTRICO E CARRO HIDROGÊNIO, QUAL É A MELHOR OPÇÃO PARA O FUTURO?', 'O presente projeto de pesquisa tem como objetivo analisar e discutir os diferentes tipos de combustíveis e suas vantagens para o meio ambiente. O artigo foi pensado decorrente do entendimento dos autores acerca das expressivas mudanças climáticas que tem ocorrido nas últimas décadas, e das discussões levantadas a respeito de novas propostas para substituir o tradicional carro a combustão. Portanto, neste projeto, será apresentado, as diferentes alternativas ecológicas para esta substituição em relação ao combustível comum, como o carro elétrico, que funciona a partir de energia elétrica, gerada por fontes renováveis (como painéis solares, turbinas eólicas, entre outros) ou por usinas de fontes não renováveis (como as termoelétricas), e o carro à hidrogênio que funciona a partir da conversão de hidrogênio, armazenado em botijões dentro da carro, para energia elétrica afim de alimentar o motor elétrico, liberando apenas água pelo escapamento porém, possui uma considerável desvantagem por ter um elevado custo consequência da baixa exploração desta tecnologia. E assim, identificar seus prós e contras no viés econômico e sustentável. Um grande impasse que foi possível notar a partir dos resultados obtidos é que nenhum destes atende os requisitos sustentáveis em sua plenitude. Entretanto, há opções com maior custo-benefício que atendem este viés ecológico as quais serão melhor apresentadas no artigo final e possibilitarão que o leitor compreenda e julgue qual é a opção mais adequada para seu consumo.', NULL, NULL, '2021-10-13 22:21:14', '2021-11-03 23:52:52', 7, 2, 9, 5, true, 6.625, 5.07499999999999929);
INSERT INTO public.projeto VALUES (405, 'AGRICULTURA FAMILIAR - UM RELATO DE ESTÁGIO NA SECRETARIA DA FAZENDA DO MUNICÍPIO DE DOM PEDRITO - RS', 'Este presente trabalho foi desenvolvido na Prefeitura Municipal de Dom Pedrito, no Setor da Secretaria da Fazenda, e tem como objetivo destacar a importância da Agricultura Familiar e os seus recursos destinados à esfera municipal. Com o auxílio do Secretário da Fazenda, seus demais colaboradores, e amparo de nutricionistas da Secretaria da Educação, pode-se fazer uma pesquisa geral com as informações obtidas sobre esta área. Coletou-se dados dos recursos da Agricultura Familiar destinados à alimentação escolar referentes ao ano de 2019, levando em consideração que o ano de 2020 e 2021 são considerados atípicos, devido à Pandemia do COVID-19. Através do PNAE (Programa Nacional de Alimentação Escolar) identificou-se o valor gasto na alimentação escolar, e quais agricultores familiares forneceram os alimentos no ano de 2019, tanto para as escolas Municipais Fundamentais, Urbanas e Rurais como para as Escolas Infantis. Posteriormente iniciou-se um comparativo com os recursos gastos pelo município na alimentação escolar em produtos oriundos da Agricultura Familiar e em produtos de Empresas Jurídicas. Obteve-se assim que nas Escolas Municipais, Fundamentais, Urbanas e Rurais 20,10% do valor gasto no ano letivo de 2019 é destinado a Agricultura Familiar, e os 79,90% para as Empresas Jurídicas. Enquanto que nas Escolas Infantis, 12,68% do valor é destinado a Agricultura Familiar e o restante, 87,32% para as Empresas Jurídicas. Além disso, foram coletadas informações de como são separados os alimentos e para quais escolas são encaminhados, aliado a quantidade de alunos que usufruíram dos alimentos saudáveis fornecidos pela Agricultura Familiar. Portanto, proporcionando uma visão geral da atuação da Agricultura Familiar, e como essa complementa a merenda escolar de maneira saudável, e simultaneamente beneficiando a cadeia de produção e comercialização para o município.', NULL, NULL, '2021-10-11 22:24:28', '2021-11-05 11:59:34', 4, 2, 9, 5, true, 9.25, 8.46249999999999858);
INSERT INTO public.projeto VALUES (203, 'DITADURA MILITAR: A MORTE DE VLADIMIR HERZOG', 'A presente pesquisa aborda o tema Ditadura Militar no Brasil, delimitando na morte de Vladimir Herzog. Vladimir Herzog teve uma grande participação e influencia no período militar, onde, se opôs aos atos institucionais e lutou pela liberdade de expressão. Vlado, como era conhecido, morreu nas dependências do Destacamento de Operações de Informações - Centro de Operações de Defesa Interna (DOI – CODI). Sua morte, noticiada pela imprensa brasileira e pelos veículos de comunicações internacionais, como, por exemplo: New York Times, trouxe uma grande mobilização nacional que potencializou o movimento pelo fim do regime militar no Brasil. Vladimir Herzog se tornou, no ano de 1975, uma imagem de luta e resistência contra o fascismo e o regime ditatorial brasileiro. Além disso, a imprensa brasileira divulgou, segundo os documentos oficias liberados pelo II Exército, que Vladimir teria se suicidado voluntariamente, porém, sua morte foi contestada, mas encoberta pela censura. Sua esposa, Clarice Herzog, lutou até o último momento por justiça. Ao debatermos, hoje, nas instituições de ensino são poucos cidadãos que conhecem sua história e sua importância para a constituição de nossa tão jovem democracia. A partir disso, temos como problema de pesquisa compreender como a imprensa brasileira retratou a morte do jornalista Vladimir Herzog, tendo como objetivo analisar os periódicos dos anos de 1975 – 1985 com o intuito de encontrar formas de oposição ao regime ditatorial, compreender como a imprensa brasileira retratou o ocorrido e apresentar a importância de Vladimir Herzog para a constituição da resistência antifascista. Por fim, para a realização da presente pesquisa foi realizado uma revisão bibliográfica e, como fonte primaria de pesquisa, foi exercida a leitura de treze veículos de comunicação brasileiros disponibilizados na Hemeroteca Digital da Biblioteca Nacional.', NULL, NULL, '2019-07-23 16:24:06', '2019-09-19 12:36:04', 3, 2, 7, 5, true, 9.375, 0);
INSERT INTO public.projeto VALUES (284, 'USO DE CHATBOT COMO REFORçO PARA A APRENDIZAGEM DE ESTUDANTES PORTADORES DE NECESSIDADES ESPECIAIS', 'Este trabalho relata o desenvolvimento de um assistente inteligente operado por voz ou por teclado para ser usado no reforço da aprendizagem de estudantes portadores de necessidades especiais. O projeto visa aprofundar a inclusão destes estudantes com deficiências visuais ou auditivas usando para tal recursos de Inteligência Artificial para a construção de um chatbot. O chatbot desenvolvido neste projeto utiliza o framework da Google Dialogflow, o qual possibilita reconhecer as intenções de usuários através de informações relevantes em parágrafos de texto convertidas a partir do reconhecimento da voz. A arquitetura de nossa aplicação é composta por um servidor web Node.js para que as respostas às intenções do usuário possam ser processadas consultando uma base de dados de conteúdo educacional. Uma vez em execução, o chatbot analisa o pedido, acessa o banco de dados e fornece as informações desejadas através do reconhecimento da intenção do usuário. Os resultados parciais obtidos por testes realizados em laboratório usando o chatbot mostraram-se bem-sucedidos. No estágio atual das atividades já contamos com uma infraestrutura pronta para disponibilizar o chatbot a qualquer dispositivo móvel que execute o Android. Na segunda fase do projeto esperamos automatizar a criação de descrições para modelos que possam ser traduzidas para uma forma de código diretamente, como um modelo de banco de dados que poderia ser traduzido em forma de código através de programas como o brModelo, ou explorando a possibilidade de usar redes neurais treinadas para gerar descrições de imagens. Este aplicativo, por funcionar em qualquer Smartphone Android, seria abrangente e de fácil implementação para várias salas de aula, pois seria também criado um aplicativo que possibilita a adição de informações necessárias, facilitando então a inclusão de alunos com deficiências visuais, principalmente em matérias que possuem ou dependem de figuras, slides, gráficos ou outros elementos visuais.', NULL, NULL, '2019-08-09 21:33:34', '2019-09-19 15:38:57', 6, 2, 7, 5, true, 7.125, 7.49642857142854968);
INSERT INTO public.projeto VALUES (343, 'SOMBRAS COLORIDAS, AS TELAS DE IMAGEM E A VISãO HUMANA', 'A visão humana não detecta todas as cores isoladamente da forma como as conseguimos ver. São três tipos diferentes de cones que permitem aos nossos olhos enxergar todas as cores que conhecemos. Um tipo de cone responde à luz de cor vermelha, outro de cor verde, e um terceiro de cor azul. Nosso trabalho consiste em demonstrar e compreender a formação de sombras coloridas de objetos através de um experimento que usa lâmpadas de três cores diferentes, montadas em soquetes separados. A partir dessa compreensão, vamos explicar como nossos olhos enxergam as cores e como são formadas as imagens por telas de eletrônicos. Pelo experimento, podemos observar que a partir de duas cores diferentes conseguimos uma terceira cor, diferente daquelas que deram sua origem. Este é o princípio da formação da imagem em televisores, telas de computadores e outros. Existem três cores denominadas de primárias, o vermelho, o verde e o azul. A sobreposição dessas cores pode gerar todas as outras cores que enxergamos. Cada ponto de luz de determinada cor proveniente de uma tela de imagem, denominado de pixel, tem origem na combinação e sobreposição das três cores primárias. O agrupamento de um conjunto de pontos forma a imagem. Nessas telas, os LEDs de fundo emitem luz branca, que é a soma de todas as cores. Cada pixel tem filtros das três cores primárias que fazem a combinação e controlam a intensidade de cada uma das cores primárias, produzindo todas as outras cores. Na visão, tudo acontece por causa da luz. A cor não está no objeto. Um objeto é amarelo quando é iluminado por uma luz branca e absorve todas as outras cores que estão na luz, refletindo somente a luz amarela, e essa chega aos nossos olhos atingindo a retina, onde estão localizados os cones e bastonetes. Essas células têm diferentes sensibilidades de luz e transmitem as informações para o cérebro. Portanto, uma demonstração de sombras coloridas irá nos ajudar a compreender a formação das imagens em telas de LED e a visão humana.', NULL, NULL, '2019-08-11 09:59:54', '2019-09-19 14:28:59', 4, 2, 7, 5, true, 8.25, 8.66785714285714981);
INSERT INTO public.projeto VALUES (215, 'CAVALOS DE GUERRA - O USO DE EQUINOS NOS COMBATES DA PRIMEIRA GUERRA MUNDIAL.', 'Este trabalho tem como objetivo analisar o uso dos cavalos na Primeira Guerra Mundial. Conflito que ao longo de quatro anos, contabilizava suas vítimas: 8 milhões de cavalos, a principal força animal usada na agricultura na época. A cada dois homens atingidos por tiros, bombas e gases letais, um cavalo morreu. O propósito deste trabalho é abordar a importância desses animais no conflito. A razão do desenvolvimento da pesquisa centra-se na importância do assunto na atualidade, quando passamos a defender o direito dos animais. A maior parte morria de fome e exaustão, sacrificada ou abandonada nas longas travessias entre os campos de batalha. Para atingir os objetivos propostos, foram seguidas as etapas: a) analisamos o contexto da Guerra e a importância e os números referentes ao uso dos cavalos na Guerra; b) assistimos e analisamos o filme Cavalo de Guerra; c) verificamos a história do uso dos cavalos na história das antigas Civilizações, d) produzimos textos. Os resultados indicam Em 1918, os poucos sobreviventes foram vendidos para os raros fazendeiros que tentavam retomar suas vidas. Os novos proprietários reclamavam que os cavalos estavam fracos, cansados, magros e poucos ajudavam nas plantações. Como síntese geral conclui-se que sem a ajuda desses bichos, a agricultura europeia recebeu um golpe fatal. Nos anos seguintes, o continente amargou uma grande fome, com o desenvolvimento de armamentos mais precisos, os generais perceberam que os cavalos pouco ajudavam no front.', NULL, NULL, '2019-08-05 17:40:14', '2019-09-19 15:55:24', 11, 3, 7, 5, true, 9.125, 6.21250000000000036);
INSERT INTO public.projeto VALUES (357, 'O TRATAMENTO DA DIABETES MELLITUS TIPO 2 COM O AUXÍLIO DA CINNAMOMUM ZEYLANICUM E CINNAMOMUM CASSIA', 'O propósito deste trabalho é analisar o potencial de inibição do extrato aquoso da Cinnamomum zeylanicum e Cinnamomum cassia sobre a enzima alfa glicosidase, testando sua possível capacidade antidiabética e o potencial antioxidante. O experimento proposto deve-se ao fato de que o Diabetes Mellitus Tipo 2 é mais recorrente que o tipo 1, sendo que, nos últimos anos, houve um aumento no número de casos dessa doença em adultos e também em jovens e crianças. O Tipo 2 caracteriza-se por uma deficiência no Pâncreas, glândula responsável pela produção de hormônios, que, por sua vez, fomenta a falta de insulina na rede sanguínea quando os níveis de glicose se elevam. Em alguns casos, é necessário o uso de medicamentos orais, como inibidores da enzima alfa-glicosidase. Se ainda não for suficiente, há a possibilidade de usar-se terapias combinadas. Existem vários estudos in vivo evidenciando a ação da canela sobre o controle do níveis glicêmicos e esses sugerem que uma das contribuições da canela possa ser inibindo a enzima alfa-glicosidase. Portanto, esta pesquisa visa evidenciar uma forma de tratamento para a Diabetes tipo 2. Inicialmente, realizou-se as análises fitoquímicas das duas espécies utilizando os extratos aquosos. No mês de agosto, será medida a capacidade antioxidante total das duas espécies e será realizado o teste de inibição da enzima alfa-glicosidase frente ao medicamento controle Acarbose. Nos testes fitoquímicos, ambas as espécies foram positivas para taninos insolúveis, compostos fenólicos, cumarinas e flavonóides e foram negativas para taninos solúveis, saponinas e alcalóides. Portanto, conclui-se que as espécies são semelhantes em relação às análises fitoquímicas; quanto ao FRAP e a inibição, os resultados serão avaliados com a ANOVA e o t de student.', NULL, NULL, '2019-08-13 23:57:30', '2019-09-17 16:12:00', 4, 2, 7, 2, NULL, 6.375, NULL);
INSERT INTO public.projeto VALUES (345, 'SARCA - SISTEMA DE ALERTA AO RESPONSáVEL DA CRIANçA AUTISTA', 'O projeto visa desenvolver um sistema de envio de alerta ao smartphone do responsável da criança autista durante uma crise. De acordo com a ONU, na infância crises nervosas ocorrem quando há acumulo de informações sensoriais simultâneas, aumentando o nível de estresse e elevando os batimentos cardíacos. O Transtorno do Espectro Autista é uma condição médica que leva a problemas no desenvolvimento da linguagem, na interação social e nos processos de comunicação, segundo Klin (2006). Smartwatches são muito utilizados, tendo modelos com sensor de frequência cardíaca e pedômetro. O pedômetro tem função de contar passos, e o sensor de frequência cardíaca, mede os batimentos por uma luz LED, que através da pele identifica mudanças do fluxo sanguíneo através dos vasos. A partir disso, como desenvolveríamos um sistema que identifique a situação de crise da criança autista e notifique os responsáveis imediatamente? Analisamos que é possível, criar um sistema aplicativo que monitore os batimentos e movimentos de caminhada, através dos sensores no relógio, e alerte uma crise. Para desenvolver o aplicativo, usaremos o App Inventor que permite realizar a programação e é compatível com Android. A programação analisará informações da frequência e do pedômetro, e ao ocorrer uma variação nos valores, enviará uma notificação de crise para o smartphone com o aplicativo. Autistas tem dificuldade em aceitar coisas novas, e na infância é maior, para facilitar a aceitação da criança no uso do protótipo, acoplaremos no smartwatch um recurso lúdico, na forma de brinquedo, para isso realizaremos uma atividade com a criança, junto da profissional, para entender o gosto, que será inspiração para um projeto CAD de brinquedo impresso 3D para tornar o sistema atrativo. Para provar a eficácia, realizaremos testes com uma criança autista, supervisionada pelos responsáveis, o acompanhamento da profissional da psicologia ocorrerá de 2 a 4 semanas, 2 vezes por semana, durante o teste.', NULL, NULL, '2019-08-11 19:53:25', '2019-09-19 16:12:31', 7, 2, 7, 5, true, 10, 9.33214285714285019);
INSERT INTO public.projeto VALUES (245, 'TORNADOS', 'O presente projeto trata dos tornados. Esses fenômenos naturais, propensos a ocorrer nos Estados Unidos, sul do Brasil e Triângulo Mineiro, acontecem devido à combinação de alguns fatores, como encontro de massas de ar, tipo de relevo, etc. Enquanto nos Estados Unidos os ventos são superiores a 300km/h e duram horas, no Brasil, eles não passam de 200km/h e duram minutos. Os tornados se caracterizam por terem ventos em formato de “funil” que podem ultrapassar 120km/h. O objetivo é apresentar os aspectos gerais sobre tornados. A partir desse conteúdo, desenvolvemos o experimento em que os materiais utilizados foram fonte de computador, HD, arame, cilindro de vidro, cola quente, água, caixa, tinta, clipes, bastão de luz de emergência, óleo, super imã e energia elétrica. Inicialmente conectamos o HD na fonte, colamos o super imã na parte giratória do HD e, depois de colocarmos um clipe no conector, que é acoplado na placa mãe, pegamos o cilindro com um pedaço de arame de um centímetro, água e o líquido do bastão dentro e o posicionamos em cima do HD, para que o super imã possa afetar magneticamente o arame. Em seguida, conectamos à energia elétrica e ligamos a fonte. Disponibilizamos todo o experimento dentro da caixa aberta na frente e, após finalizarmos, concluímos que, a forma que enxergamos a natureza, pode ser modificada conforme tentamos compreendê-la, e assim explicar onde e como ocorrem os tornados de uma forma clara e prática.', NULL, NULL, '2019-08-08 19:25:23', '2019-09-19 16:10:32', 10, 3, 7, 5, true, 7, 8.48750000000000071);
INSERT INTO public.projeto VALUES (243, 'INCLUSãO DIGITAL E ENSINO DE PROGRAMAçãO ATRAVéS DE ATIVIDADES LúDICAS', 'Este trabalho relata a prática de oficinas lúdicas, envolvendo dinâmicas com jogos de tabuleiro e recursos digitais, para a abordagem de conteúdos que envolvam o pensamento computacional e o raciocínio lógico em sala de aula, tendo como público-alvo alunos das séries finais do Ensino Fundamental, buscando aprimorar o aprendizado dos alunos, proporcionando o contato com atividades que abordam os conceitos básicos de programação. Além de contribuir para a inclusão digital, busca-se diminuir a desigualdade de gênero na área da informática, incentivando mulheres a participar de tais oficinas, já que elas possuem baixa representatividade na área tecnológica. O principal problema que justifica a necessidade de melhorias na educação básica é apresentado através dos dados divulgados pelo Índice de Desenvolvimento da Educação Básica (IDEB, 2019), que é obtido através da Prova Brasil, e visa analisar a qualidade do ensino brasileiro. Nenhuma das 3 últimas edições do IDEB conseguiu atingir a meta nacional esperada. Para amenizar esta situação, as oficinas visam contribuir para o desenvolvimento de habilidades, capacidade de raciocínio, criatividade e tomada de decisões. Para atender mais estudantes, elas foram divididas em 2 modalidades: Offline e Online. A primeira é realizada sem computadores, com jogos manuais, incluindo as atividades “Programação em papel Quadriculado” (Code, 2019) e “Estacionamento Algorítmico” (Computacional, 2019); a segunda utiliza jogos digitais disponíveis na plataforma Code.org (Code, 2019). Ao todo, 307 pessoas já participaram das oficinas, oriundas de 15 instituições diferentes, entre 2017 e 2019. Os resultados obtidos para 2019 mostram melhorias na compreensão de enunciados de até 35%, evidenciando que as atividades desenvolvidas podem fazer diferença na aprendizagem dos estudantes. Os bons resultados estimulam o aperfeiçoamento do projeto, para atender cada vez mais escolas, compartilhando saberes e experiências com a comunidade.', NULL, NULL, '2019-08-08 17:04:28', '2019-09-19 13:25:39', 6, 2, 7, 5, true, 8.875, 10);
INSERT INTO public.projeto VALUES (360, 'QUÍMICA DOS REFRIGERANTES', 'Esse projeto tem como objetivos motivar os alunos a aprender química de uma forma agradável por através de práticas experimentais em sala de aula. Analisar através da investigação dos rótulos a composição química dos refrigerantes e o teor de sódio presente nos mesmos Mostrar os riscos-malefícios associados a essa bebida. Comparar os refrigerantes light e diet e zero com sucos naturais. Levar os alunos a refletir sobre a influência das propagandas comerciais no consumo desde produto. Foi desenvolvido no primeiro ano do Ensino Médio Da Escola Estadual José Gomes de Vasconcelos Jardim. Tendo como metodologia inicial um levantamento de dados bibliográficos em livros, revistas, consulta a sites de pesquisas para construção do referencial teórico que servira de base a nossa pesquisa. A seguir aplicamos um questionário a cinquenta alunos da primeira série de nossa escola com objetivo de realizar um levantamento de suas concepções. Posteriormente separamos os mesmos em dez grupos e cada grupo recebeu rótulos de refrigerantes diferentes e uma tabela para anotar os ingredientes presentes nos mesmos. Tendo sido abordado alguns tópicos necessários para o entendimento da composição do refrigerante. A seguir realizamos um debate sobre os prejuízos causados pelo consumo de refrigerantes e como propaganda tem influenciado mesmo por meio da apresentação de vídeos sobre o assunto. Explicamos também a diferença entre refrigerantes light e diet e zero através da análise da rotulagem e de um teste sensorial. A seguir realizamos a análise da coleta de dados por meio das respostas dos alunos ao questionário inicial. Os resultados obtidos foram agrupados e descritos quantitativamente em gráficos. A realização do presente projeto nos permite concluir que: O refrigerante é um exemplo de como a química está inserida em nosso cotidiano, não apenas no que diz respeito à preparação desse produto, mas também no controle de qualidade necessária para que seja consumido sem risco à saúde.', NULL, NULL, '2019-08-14 12:05:32', '2019-09-17 16:12:00', 4, 2, 7, 2, NULL, 9.25, NULL);
INSERT INTO public.projeto VALUES (324, 'PAINEL PARA PRÁTICAS DE INSTALAÇÕES ELÉTRICAS', 'Aulas práticas constituem uma importante etapa metodológica, pois facilita o desenvolvimento do ensino-aprendizagem em diversas áreas. Através da experimentação alia-se teoria à prática, despertando a curiosidade e o interesse do aluno e transformando o estudante em sujeito da aprendizagem. As aulas práticas possibilitam ao discente desenvolver habilidades e competências específicas, além de fazê-los perceber as dificuldades reais de cada conteúdo. O IFSul Câmpus Sapiranga conta com cursos que possuem disciplinas relacionadas a instalações elétricas, porém os espaços de prática dessas disciplinas possuem apenas bancadas didáticas que auxiliam no estudo do conceito mas dificultam a sua compreensão na prática. Assim, o objetivo deste projeto é construir um painel para práticas de instalações elétricas que, especificamente, garanta a segurança durante a operação, disponha da melhor distribuição dos componentes e que possua uma vasta possibilidade de realização de práticas. No painel, portanto, pretendemos elaborar diagramas unifilares e multifilares para as práticas a serem realizadas, compará-lo com as bancadas didáticas e desenvolver um manual do usuário. Acreditamos que o painel possibilitará uma melhor experiência aos alunos, pois possibilitará que realizem atividades próximas a de um processo real, como fazer a passagem de condutores em eletrodutos e realizar emendas. Definido o problema, foi analisada a viabilidade da construção do painel dentro da nossa realidade acadêmica cujo resultado positivo proporcionou o início das pesquisas sobre o tema e o desenvolvimento do referencial teórico. Em seguida, concluímos o modelamento e detalhamento do painel no SolidWorks, realizamos a seleção de materiais e montamos a estrutura mecânica e elétrica do painel. Além disso ainda temos que realizar os diagramas unifilares e multifilares para as práticas, executar testes e verificar se há falhas no painel e por fim, elaborar um manual do usuário do painel.', NULL, NULL, '2019-08-10 19:59:12', '2019-09-19 15:05:38', 7, 2, 7, 5, true, 9.875, 8.97857142857139934);
INSERT INTO public.projeto VALUES (427, 'TRABALHO REMOTO NA PANDEMIA: UMA ANÁLISE DOS OFÍCIOS EM DISTANCIAMENTO.', 'Este projeto tem como objetivo identificar a situação e os problemas decorrentes da pandemia no trabalho remoto, analisando os impactos socioeconômicos e intrapessoais ocasionados pelo modelo. Além disso, pretende-se trazer sugestões para minimizar tais consequências. Uma vez que, na atual pandemia, os brasileiros foram retirados dos seus ambientes de trabalho e tiveram que adotar o modelo remoto, faz-se necessário compreendê-lo para assim melhorá-lo atualmente e no futuro, pois mesmo com o fim do período pandêmico esse método tende a continuar e crescer. Com a finalidade de desenvolver os objetivos propostos, buscou-se informações em artigos científicos e de comunicação. Em seguida, foi realizada uma pesquisa quantitativa direcionada a pessoas que trabalharam remotamente, na região metropolitana de Porto Alegre. Posteriormente, aplicou-se exercícios laborais, orientados por um fisioterapeuta, visando ver o impacto em reuniões virtuais. Também foi feita a divulgação de dicas resultantes da pesquisa em um perfil do projeto criado em mídia social. Segundo os resultados da pesquisa quantitativa, a maioria das empresas planeja manter-se a distância, assim como a expressiva parte dos entrevistados prefere seguir remotamente. Também foi observado que a relação com o modelo de trabalho é satisfatória, contudo a relação interpessoal com as famílias e com o ambiente de trabalho decaiu. Outro dado apontado pelos trabalhadores é o descaso por parte das empresas neste período. Conclui-se que o modelo remoto indubitavelmente continuará, com necessidade de melhorias em diversas frentes; visto que o modelo recentemente adotado e o distanciamento ocasionaram problemas psicossociais e econômicos agravados pela indiferença das empresas. Isto posto, evidencia-se a importância da tomada de medidas pelos gestores e uma comunicação mais efetiva entre as equipes, priorizando uma adaptação saudável ao atual e crescente modelo.', NULL, NULL, '2021-10-16 17:43:12', '2022-05-24 12:08:47', 3, 2, 9, 5, true, 9.75, 6.48750000000000071);
INSERT INTO public.projeto VALUES (283, 'A EXALTAçãO DA MASCULINIDADE HEGEMôNICA NA RELAçãO ENTRE O “CIDADãO DE BEM” E A DEFESA DO PORTE DE ARMAS', 'Como bolsista do projeto de extensão “Gênero e manifestações culturais”, vinculado ao NEPGS – Núcleo de Estudos e Pesquisas em Gênero e Sexualidade - do IFRS campus Canoas. Pretendo problematizar o fortalecimento no Brasil da representação de um “cidadão de bem”, que defende o porte de armas. Por considerar que a internet acabou se tornando o principal veículo para a propagação desta discussão. Busco analisar como esta articulação se estabelece por meio de publicações nas redes sociais (Facebook e Twitter), trazendo em pauta tais assuntos que validam certos argumentos e representações que parecem contrapor-se aos direitos humanos. A legitimação das falas dos ditos cidadãos de bem sobre o porte de armas, importa para refletirmos sobre seus impactos na organização social e nas estatísticas relacionadas a mortes com armas de fogo. Para analisar estas publicações, utilizo-me dos estudos de gênero e dos estudos de masculinidades, que articulados a fatores como: contexto sócio-histórico, classe, etnia, gênero e sexualidade podem influenciar na constituição do modo que se pensa o que significa “ser homem”. Para isto, proponho-me a realizar procedimentos netnográficos, por meio da busca e seleção de postagens, amparadas a artigos da internet, entrevistas e dados estatísticos que discutem à defesa do porte de armas. Considero como hipótese que as representações de uma masculinidade hegemônica se fortalecem por argumentos constituintes da fala destes “cidadãos de bem”. Neste sentido, a pesquisa busca analisar como tal fenômeno pode influenciar no contexto atual das relações de gênero e na constituição de masculinidades, “reconhecendo as contradições internas e as possibilidades de movimento em direção à democracia de gênero” (2013, CONNELL).', NULL, NULL, '2019-08-09 20:42:40', '2019-09-19 14:19:56', 3, 2, 7, 5, true, 8.75, 9.46071428571429962);
INSERT INTO public.projeto VALUES (410, 'O HáBITO DE LEITURA ENTRE OS ALUNOS DOS ANOS FINAIS DA ESCOLA DR. JORGE GERMANO SPERB EM SãO LEOPOLDO-RS', 'Com o trabalho intitulado “O hábito de leitura entre os alunos dos anos finais da EMEF Dr. Jorge Germano Sperb em São Leopoldo-RS” o grupo busca verificar como é a relação dos alunos dos anos finais com a leitura e conhecer os benefícios dela para o desenvolvimento do indivíduo. A ideia da pesquisa surgiu em uma conversa em aula onde todos sugeriram diversos temas, mas a temática da leitura foi bem aceita porque muitos da turma têm o hábito de ler. A pesquisa foi realizada através de sites da internet, e demais fontes confiáveis, realizamos aplicação de questionário nos alunos dos anos finais com a finalidade de conhecer seus hábitos de leitura e entrevistamos profissional da literatura. Acreditamos que a leitura pode trazer diversos benefícios para o desenvolvimento do indivíduo e tratar do tema pode ajudar a comunidade escolar a refletir sobre seus hábitos acerca da temática. Os resultados foram surpreendentes pois inicialmente acreditávamos que os colegas não tinham o hábito de ler mas descobrimos que muitos leem, mesmo que não livros literários costumam ler revistas em quadrinhos e outras formas de leitura. Acreditamos ainda que sejam necessárias mais ações por parte das famílias, governo e instituições de ensino para incentivar os jovens a lerem, mas a pergunta que fica é como os adultos poderão estimular os jovens a ler se os mesmo não tem tal hábito?', NULL, NULL, '2021-10-13 18:13:00', '2021-10-15 00:19:52', 11, 3, 9, 1, NULL, NULL, NULL);
INSERT INTO public.projeto VALUES (263, 'AS SITUAçõES EM QUE O ABORTO é LEGALIZADO NO BRASIL', 'As situações em que o aborto é legalizado no Brasil está baseado no artigo 196 da constituição federal, que fala sobre o direito à saúde. O artigo 128 do código penal fala sobre o aborto necessário e em quais situações é necessária e permitida por lei realizá-lo. O trabalho cita alguns dados sobre o aborto legal no Brasil e como procede-lo para realizá-lo se preciso. O aborto no Brasil somente não é considerado crime em três situações: quando a gravidez for fruto de estupro; se colocar a vida da gestante em risco ou quando o feto for anencéfalo (não possuir cérebro), que nesse caso as gestantes têm direito de obter o aborto legal pelo SUS. É importante que as pessoas tenham o conhecimento acerca das situações que são legalizadas no Brasil e também para o caso de algum familiar ou amigo passar por uma delas; a pessoa poderá ajudá-la explicando o que é cada situação e o que pode fazer. Mostraremos com ele o que, hoje, no Brasil é legal, e falar sobre as 3 situações legalizadas para um conhecimento mais profundo sobre elas. Nós pesquisamos em artigos que falam sobre a saúde das mulheres; no site Jusbrasil que escreve artigos de acordo com a Lei; e em algumas outras fontes que falam sobre o aborto legal e cada situação. Concluímos que o aborto legal ajuda, ameniza a condição e a situação em que a mulher está, quando o estado se responsabiliza pelo sofrimento que elas tenham, pois o aborto pode afetar a sua saúde física e mentalmente.', NULL, NULL, '2019-08-09 15:32:20', '2019-09-19 15:03:59', 11, 3, 7, 5, true, 7.375, 8.73750000000000071);
INSERT INTO public.projeto VALUES (328, '“RELEITURAS MACHADIANAS”: UMA ESTRATéGIA DE ENSINO PARA LER CLáSSICOS DO SéCULO XIX NO UNIVERSO CONTEMPORâNEO', 'Machado de Assis é considerado um dos maiores escritores da literatura brasileira. Sua genialidade é presente em toda sua obra, composta por contos, romances, crônicas, peças de teatro, poesia, entre outros. Contudo, o leitor do século XXI encontra dificuldades em disponibilizar o tempo e dedicação necessários para a compreensão das obras do autor do século XIX. Os empecilhos para a leitura do bruxo do Cosme Velho vão além do pouco tempo, visto que a linguagem utilizada na época é, em geral, pouco atrativa ao leitor contemporâneo. Desta forma, surge a necessidade de buscar meios para a aproximação desse leitor contemporâneo a esse grande escritor. O projeto &#34;Releituras Machadianas&#34; busca, desde 2016, incentivar a leitura de contos de Machado de Assis e salientar a presença de críticas, ironias e reflexões provocadas pelo autor em seus textos que ainda estão vivas no século XXI, incentivando e aprimorando a leitura dos clássicos machadianos. A proposta do projeto consiste na realização dos “Encontros com Machado”. Durante a semana são realizados, nos contraturnos, encontros com os alunos do IFRS Campus Canoas organizados pelas bolsistas do projeto, nos quais são lidos e debatidos os contos machadianos. Além da leitura, são utilizados curtas-metragem, peças teatrais, histórias em quadrinho, clipes musicais, canções, etc. para criar uma máxima aproximação dos leitores contemporâneos aos textos do Machado. A cada ano, realiza-se o Festival Literário em que os alunos dos segundos anos dos cursos técnicos submetem curtas-metragem autorais, que posteriormente serão premiados no evento e avaliados na disciplina de língua portuguesa. Conclui-se que é possível realizar essa aproximação junto aos alunos, pois tanto nos debates semanais quanto na criação dos curtas, os estudantes percebem a vivacidade das histórias independente do tempo ou espaço, bem como a maestria das obras-primas deixadas para as próximas gerações.', NULL, NULL, '2019-08-10 21:49:30', '2019-09-19 11:59:21', 3, 2, 7, 5, true, 9.5, 9.14285714285714946);
INSERT INTO public.projeto VALUES (390, 'BIOMA AMAZôNIA: UM MUNDO HISPANOHABLANTE A DESCOBRIR', 'Este trabalho tem como objetivo apresentar as diferentes percepções acerca do bioma Amazônia retratadas nos principais veículos on-line da mídia jornalística do Brasil e países de língua hispânica pelos quais esse bioma se estende. A pesquisa sobre esse tema se justifica pelos diferentes posicionamentos encontrados em uma observação prévia da mídia em língua espanhola comparando com o que é oferecido pela mídia jornalística nacional e a realidade apresentada nos períodos de biologia. O bioma Amazônia é uma floresta tropical úmida que se estende pela bacia hidrográfica do rio Amazonas, cuja maior extensão se encontra no Brasil e no Peru. Entretanto, também abrange Bolívia, Colômbia, Equador, Guiana, Guiana Francesa, Suriname e Venezuela, sendo que no Brasil e nos três últimos países a língua oficial é não-hispânica. Entende-se que, fazer pesquisa é uma atividade dialógica (BAKHTIN, 1992), que responde, antecipa ou polemiza com outras práticas interpretativas, e que a mídia jornalística apresenta as notícias com uma visão influenciada por aspectos socioculturais e políticos, muitas vezes distantes do fato científico e da realidade observada. Destaca-se a relevância social ao fato deste trabalho dar voz às minorias e à língua estrangeira que envolve tal estudo. O que será comentado é o que as principais mídias jornalísticas de cada país amazônico de língua hispânica veiculam sobre o bioma Amazônia, em comparação com o que a mídia nacional veicula para a população. Os resultados até então encontrados mostram discrepância na extensão e consequências de danos ambientais entre os países vizinhos e o Brasil. Também foram encontradas discrepâncias na autonomia sobre o bioma e concepção geopolítica do mesmo, em relação à pesquisa e escrita em língua espanhola.', NULL, NULL, '2021-10-07 10:28:24', '2021-11-04 13:04:10', 8, 2, 9, 5, true, 7, 9.23750000000000071);
INSERT INTO public.projeto VALUES (437, '&#34;O QUE SE CALA&#34;: ANáLISE DA APROPRIAçãO CULTURAL NA NOVELA NOVO MUNDO', 'Desde pequenos aprendemos que o Brasil é um país de diversas etnias e grupos sociais, entretanto, também aprendemos que o racismo e a desigualdade são inegavelmente existentes no nosso cotidiano e que implicam nas mais diversas situações, inclusive, em estereótipos culturais. Diante desse contexto, fui remetida à seguinte questão: como a apropriação social se insere na sociedade como forma de propagar o racismo? Compreender a influência da apropriação cultural no Brasil, desde sua formação como um país colonizado, não é apenas compreender um processo de difamação de culturas oprimidas, mas sim, entender como essas culturas são representadas. Vejo esse projeto como uma forma de compreender de maneira crítica os discursos utilizados por aqueles que acreditam em teorias etnocêntricas e suas consequências para a representação das diferenças raciais e culturais nos meios de comunicação. Nesse sentido, esse projeto tem como objetivos analisar o discurso da apropriação cultural nos meios de comunicação e analisar a questão racial como sendo fundamental para a estruturação da sociedade. A primeira parte deste trabalho trata-se de uma revisão bibliográfica sobre os temas cultura, raça e apropriação cultural. Na segunda parte, analisamos a novela “Novo Mundo”, da Rede Globo de Televisão, a partir da discussão sobre apropriação cultural. Entre os resultados da análise proposta, percebemos a presença da mercantilização, ridicularização e desvalorização das culturas e vivências de grupos étnico-raciais.', NULL, NULL, '2021-10-17 19:58:05', '2021-11-05 13:12:06', 3, 2, 9, 5, true, 10, 9.96250000000000036);
INSERT INTO public.projeto VALUES (213, 'MINI ESTAçãO METEOROLóGICA', 'A maioria das atividades estão ligadas, direta ou indiretamente, às condições do tempo. Em algumas, o conhecimento prévio de como a atmosfera irá se comportar é muito importante. É o caso, por exemplo, de uma viagem de avião ou em um evento ao ar livre. Se houver fortes chuvas e ventos, o avião não poderá aterrissar e o evento será adiado ou cancelado. Na agricultura, o tempo é de suma importância, pois além de ser um dos principais fatores que determinam a produtividade de uma safra, as condições de tempo também determinam o calendário de atividades das fazendas. Na construção civil, estradas principalmente, na defesa civil para alertar os moradores de grandes tempestades, alagamentos, deslizamentos, etc. e em dezenas de outros serviços, encontramos exemplos da importância da meteorologia para orientar essas atividades. O projeto deverá realizar três funções principais: fazer a leitura dos dados de ambos os sensores , o armazenamento destas leituras, a exibição através do Display LCD, que será ligado manualmente com um botão, ou através de uma página criadada, a fim de, monitorar a leitura dos dados. Para realização do presente trabalho, será utilizado o Microcontrolador ESP32 (ESP32 NodeMCU). O ESP32 é uma série de microcontroladores de baixo custo e baixo consumo de energia. também é um sistema-em-um-chip com microcontrolador integrado, Wi-Fi e Bluetooth. Os comandos necessários para realização dessas ações podem ser programados em linguagem Arduino, baseada nas linguagens C e C++, através do IDE (do inglês Integrated Development Environment, ou em português, Ambiente de Desenvolvimento Integrado), ou seja, o Software Arduino', NULL, NULL, '2019-08-01 16:38:44', '2019-09-17 16:12:00', 8, 2, 7, 2, NULL, 7.875, NULL);
INSERT INTO public.projeto VALUES (228, 'EDUCAçãO SEXUAL: UMA NECESSIDADE PARA A CONTEMPORANEIDADE', 'Entre 2011 e 2017, o Brasil teve um aumento de 83% nas notificações gerais de violência contra crianças e adolescentes, segundo o Ministério da Saúde. No período foram notificados 184.524 casos, sendo mais de 60% contra crianças e adolescentes. Sabendo-se que no contexto escolar as manifestações da sexualidade estão presentes, cabe ao professor e a professora discuti-las. Educação sexual é uma estratégia de ensino sobre os aspectos intelectuais, emocionais, físicos e sociais da sexualidade. Seu objetivo é prover conhecimento para crianças e jovens, idoneidade, atitudes e valores que os empoderem para: vivenciar sua saúde, bem estar e autoestima; considerar como suas escolhas afetam o bem estar próprio e dos outros e entender e garantir a proteção de seus direitos ao longo da vida. Porém ao realizar a discussão histórica da educação sexual no século XX percebemos que ocorrem momentos de conquistas e recuos. O objetivo desta pesquisa é identificar como a educação sexual está sendo trabalhada nas escolas e a opinião dos docentes sobre como abordar a temática. Para a coleta de dados utilizamos: revisão bibliográfica; pesquisa de relatos de casos de violência sexual e violência moral contra crianças e adolescentes e aplicação de questionário online e presencial em instituições de ensino da rede pública de Caxias do Sul, com estudantes e professores. Notou-se uma grande parcela de alunos que já presenciaram alguma abordagem ou discussão sobre o assunto na instituição de ensino, porém limitada a assuntos tratados em aulas de biologia. Os mesmos se mostraram interessados em ter assuntos como sexualidade, autoestima, assédio, abuso sexual, etc. Observou-se, também, que a maioria dos professores gostariam de participar de cursos de capacitação, por considerar o assunto de suma importância. Conclui-se a necessidade de uma política pública de prevenção, a ser desenvolvida nas escolas, que promova a capacitação de profissionais para a implementação de aulas de educação sexual.', NULL, NULL, '2019-08-07 09:15:19', '2019-09-19 17:09:48', 5, 2, 7, 5, true, 8.25, 9.40714285714285126);
INSERT INTO public.projeto VALUES (349, 'ECOLOGICAMENTE CORRETA &#34;NAQUELES DIAS&#34;', 'Toda mulher um dia iniciará o uso dos absorventes íntimos por um período de aproximadamente 30-40 anos. Pensando na quantidade de absorventes utilizados neste período, como são descartados e para onde eles vão decidimos investigar e buscar soluções para preservar o meio ambiente sem interferir no ciclo menstrual das garotas. Nossoa objetivos: descobrir qual é a média do fluxo menstrual; como eram os absorventes antigamente; verificar a composição química dos componentes e possível impacto ambiental; informar as pessoas, que o absorvente contém resíduos que podem prejudicar o corpo da mulher; trazer e analisar a visão do uso do absorvente em outras culturas. Faremos: levantamento de dados e pesquisas referentes aos absorventes mais vendidos e sua composição química; busca de informações referentes as diferentes culturas do uso de absorventes e impactos ambientais. Até o momento sabemos que uma mulher utiliza, aproximadamente, cerca de 12 mil absorventes entre a menarca até a menopausa. De acordo com os dados do IBGE/2017 a maioria das brasileiras entre 15 e 55 anos (62,6 milhões) consumiria produtos relacionados a menstruação. Partindo do pressuposto de que uma mulher menstrua, em média, 5 dias por mês e utiliza 4 absorventes por dia, em um ano utilizaria 240 absorventes externos totalizando 15 bilhões descartados nos lixões. O coletor menstrual tem o formato de um copo feito de silicone medicinal o que permite o uso durante a menstruação por um período de até 12 horas.', NULL, NULL, '2019-08-12 20:58:13', '2019-09-19 14:12:48', 10, 3, 7, 5, true, 7.75, 8.86250000000000071);
INSERT INTO public.projeto VALUES (269, 'EMBALAGEM BIODEGRADáVEL FEITA A PARTIR DE FOLHA DE BANANEIRA', 'O uso de embalagens plásticas e papéis na indústria alimentícia é extremamente comum e muitas delas não são corretamente recicladas, criando um grande acúmulo de lixo em certos locais por um longo período. O objetivo foi desenvolver uma embalagem alternativa e biodegradável para comercialização de hortifrutis sensíveis a choques mecânicos, utilizando folhas de bananeira coladas com adesivo a base de material biodegradável. Foram realizadas uma série de testes de prototipação do material. Entre os parâmetros avaliados nos testes estavam: a cola utilizada; o entrelaçamento das folhas de bananeira; e o tempo de colheita da folha. Os aspectos avaliados entre as amostras foram tempo de secagem, resistência mecânica e aspecto visual. Foi ainda pesquisado como o produto poderia ser implementado no mercado. Para isso, foram feitas entrevistas em três estabelecimentos de Gravataí, a respeito de embalagens para hortifrutis. Foi observado que a melhor configuração de embalagem foi a produzida com folhas verdes trançadas coladas com cola sintética biodegradável. Com os as entrevistas observaram-se que todos os estabelecimentos comercializam produtos com embalagens plásticas mesmo tendo críticas ao uso desse material. Isso sugere que haveria mercado consumidor para a embalagem biodegradável desenvolvida. Conclui-se que é viável o uso de folha de bananeira para produção de embalagens para produtos de hortifruti sensíveis, tais como: kiwi e caju.', NULL, NULL, '2019-08-09 17:46:49', '2019-09-19 15:26:54', 10, 3, 7, 5, true, 10, 9.78750000000000142);
INSERT INTO public.projeto VALUES (312, 'ELETROCORE- ELETROCARDIóGRAFO DIGITAL', 'O Eletrocore é um projeto de tecnologia de engenharia aplicada na área da saúde e de doenças cardíacas que tem a função de tornar o eletrocardiógrafo convencional em um equipamento de fácil manuseio, com menor custo e vinculado ao celular, como objetivo geral a elaboração de um sistema eletrônico para captação, registro e análise de batimentos cardíacos e sinais de eletrocardiograma. Existem atualmente no mercado brasileiro equipamentos que auxiliam no diagnóstico de doenças cardíacas, como o Eletrocardiógrafo ECG. Este dispositivo é ligado a eletrodos que analisam o ritmo dos batimentos cardíacos em repouso, podendo ver se há falhas na condução elétrica pelo coração, podendo ser problemas cardíacos. Alguns dos problemas do Eletrocardiógrafo são: alto custo de compra, exige uma grande quantidade de eletrodos para a realização do exame e é um equipamento com grandes dimensões, causando um difícil transporte quando há necessidade de levar até a casa de um paciente. Portanto, observamos que seria de grande interesse para os médicos ter um dispositivo eletrônico que facilitaria o trabalho do clínico e ajudaria na detecção destas doenças. O Eletrocore é um dispositivo com um sensor de pulso, que por meio de um relógio smartwatch captura os dados vitais envia as informações pelo sistema Bluetooth do relógio para o aplicativo do celular, o próprio aplicativo processa o gráfico ECG no visor do celular, para a visualização de um profissional da área. Após, o aplicativo salva o processo na memória. Etapas da Metodologia: 1. Estudos sobre o eletrocardiógrafo e as formas de ondas presentes no corpo humano. 2. Realização de uma pesquisa semiestruturada para coletar informações sobre o eletrocardiograma. 3. Desenvolvimento do protótipo. 4. Realização de testes. 5. Comparação com o eletrocardiógrafo convencional. 6. Análise de dados. Atualmente nos encontramos na quarta etapa do projeto (realização de testes).', NULL, NULL, '2019-08-10 16:44:40', '2019-09-19 16:04:34', 7, 2, 7, 5, true, 7.625, 9.26071428571430033);
INSERT INTO public.projeto VALUES (382, 'BIONIC STEP II: DISPOSITIVO MECâNICO BíPEDE PARA LOCOMOçãO DE DEFICIENTES MEDULARES', 'Nos últimos anos, a taxa de ocorrência de lesões medulares por consequência traumática vem crescendo constantemente, chegando a uma marca, em 2020, de 54 novos casos por milhão de habitantes apenas nos Estados Unidos da América. Esses deficientes medulares precisam lidar com problemas que vão além da sua pouca ou nenhuma capacidade de movimentação, abrangendo o âmbito físico e psicológico, e tendo seu quadro clínico agravado, muitas vezes, pelo confinamento a equipamentos como as já tão conhecidas cadeiras de rodas. Assim, esta pesquisa trata-se da segunda fase de desenvolvimento de um dispositivo mecânico bípede para locomoção de deficientes medulares, capaz de reproduzir o movimento de marcha humana através da utilização de músculos artificias pneumáticos (PAMs). Sua principal finalidade resume-se em atuar na reabilitação fisioterapêutica de indivíduos com pouca ou nenhuma movimentação dos membros inferiores do corpo humano, impactando positivamente na sua qualidade de vida, a partir de um mecanismo acessível a grande parte da população. O presente projeto abrange as áreas de anatomia, tecnologia assistiva, engenharia mecânica e eletropneumática, e parte de pesquisas acerca da marcha humana, dos músculos do corpo e dos tipos de PAMs existentes. Posteriormente, apresenta a testagem prática de um músculo artificial pneumático de McKibben, cujos resultados puderam demonstrar a força exercida por esses atuadores (estimada em 3,5 kgf), bem como possibilitar o início do planejamento do protótipo. A modelagem em software CAD ocorreu por meio do software Autodesk Fusion 360 e, consequentemente, análises de tensão puderam ser realizadas nas principais peças da estrutura, obtendo-se satisfatórios resultados. Por fim, pode-se iniciar o desenvolvimento do sistema eletropneumático, de modo a montar o circuito no software FluidSIM e, como passo conseguinte, executar a listagem dos principais materiais necessários a uma primeira testagem do dispositivo em laboratório.', NULL, NULL, '2021-09-30 23:15:04', '2021-11-04 13:44:17', 7, 2, 9, 5, true, 9.75, 9.47499999999999964);
INSERT INTO public.projeto VALUES (300, 'AQUAPONIA - CRIAçãO DE PEIXES X CULTIVO DE HORTALIçAS', 'O presente projeto refere-se ao funcionamento de um sistema de produção de alimentos que combina aquicultura com a hidroponia, em um ambiente simbiótico. Dessa forma, as plantas utilizam as sobras e os excrementos dos peixes como alimento, limpando novamente a água para os mesmos. A importância do funcionamento de um sistema aquapônico, sua origem histórica, aliado a criação de peixes e ao cultivo de hortaliças de maneira sustentável foi o que motivou o pesquisador a realizar este projeto. Como problema de pesquisa utilizou-se a seguinte questão: “Como cultivar hortaliças e criar peixes em casa de maneira sustentável ocupando pouco espaço?”. O objetivos do projeto são: compreender a importância da construção de um sistema compacto de aquaponia; analisar e investigar o funcionamento desse sistema; comparar a redução do consumo de água com o método tradicional de cultivo, e avaliar o crescimento das hortaliças. A partir das informações coletadas, procedeu-se a montagem de um sistema com materiais adaptados. Entre os meses de março a agosto, observou-se o crescimento das hortaliças, que apresentaram bom desenvolvimento e aparência sadia. Já os peixes, estão ativos e dinâmicos. Acredita-se ser possível a manutenção doméstica de um sistema aquapônico, visto que necessita de pouca interferência humana para limpeza do sistema. O aprimoramento do projeto se dará através da divulgação sobre a aquaponia no cultivo de hortaliças e a criação de um manual de instruções sobre esse sistema.', NULL, NULL, '2019-08-10 12:36:40', '2019-09-19 16:07:27', 10, 3, 7, 5, true, 8.375, 9.71250000000000036);
INSERT INTO public.projeto VALUES (321, 'ESTAçãO METEOROLóGICA NO PáTIO DE EXPERIMENTOS', 'O Pátio de Experimentos é um projeto de ensino em execução no Instituto Federal do Rio Grande do Sul Campus Canoas que visa à integração de diferentes áreas do conhecimento através da construção de dispositivos diversos que incentivam ações de ensino, pesquisa e extensão nas áreas de ciências, tecnologia, sustentabilidade e aproveitamento de energias renováveis. Atualmente, o projeto tem como foco principal o desenvolvimento de uma estação meteorológica, na qual serão recolhidos e disponibilizados a todos os frequentadores do campus dados climatológicos locais. Assim sendo, esse dispositivo servirá como ferramenta de auxílio pedagógico ao ensino de diferentes ciências, além de proporcionar o desenvolvimento de estudos de novos métodos de coleta, armazenamento e disponibilidade de dados de climatologia. A estação está sendo produzida a partir de diferentes sensores capazes de fazer medidas climáticas controlados por Arduino. Assim, os estudantes tiveram o desafio de calibrar os dispositivos na plataforma do microcontrolador através do uso da linguagem de programação C++. O abrigo, ambiente onde os sensores são instalados, o anemômetro, dispositivo utilizado para medir a velocidade do vento, e a biruta, equipamento para informar a direção e o sentido do vento, foram construídos artesanalmente. Atualmente, as medições efetuadas pela estação meteorológica são de temperatura ambiente, umidade relativa do ar, velocidade e direção do vento e índice de radiação UV. Pretende-se futuramente acrescentar novos sensores capazes de realizar outras medições, como por exemplo, umidade do solo e pressão atmosférica local. Além disso, visa-se futuramente armazenar e disponibilizar todos os dados recolhidos pela estação meteorológica em um link no site oficial do IFRS Campus Canoas.', NULL, NULL, '2019-08-10 19:21:28', '2019-09-18 23:26:26', 7, 2, 7, 3, true, 9.5, NULL);
INSERT INTO public.projeto VALUES (258, 'LóTUS: UMA PLATAFORMA INTELIGENTE DE APOIO à BIBLIOTERAPIA E ESTíMULO à LEITURA', 'Segundo a pesquisa &#34;retratos da leitura no Brasil&#34; (INSTITUTO PRÓ LIVRO, 2016), o brasileiro lê em média 2,43 livros por ano. Este índice preocupa uma vez comparado com os índices dos Estados Unidos que possui 5,1 livros e da França que possui média igual a 7,0 livros lidos anualmente. Em contrapartida, os dados da Organização Mundial da Saúde (2017) demonstram que cerca de 18,6 milhões de brasileiros são afetados por ansiedade e 11,5 por depressão, atribuindo ao Brasil a posição de país mais ansioso e depressivo da América Latina. Desta forma, viu-se a possibilidade de desenvolver uma plataforma móvel que objetiva auxiliar no tratamento dos transtornos mais recorrentes através da prática da biblioterapia, que proporciona um tratamento menos severo com base na prescrição de livros a partir do perfil do paciente. Ademais, além desta temática atuar no tratamento dos transtornos mentais, também atua melhorando o panorama literário brasileiro. Para a realização da pesquisa, inicia-se o referencial teórico apresentando a prática de terapia por meio de livros. Posteriormente são apresentados sistemas de recomendação e chatbot, tecnologias essas que serão utilizadas no desenvolvimento da aplicação. Para tornar a aplicação possível, será utilizado o sistema Android por meio da IDE Android Studio e para a criação do chatbot o framework IBM Watson. O desenvolvimento será viabilizado por meio das linguagens Java, banco de dados SQL e framework Spring. Como resultados espera-se que, por meio da plataforma Lótus, seja possível atribuir uma nova identidade para a leitura e disponibilizar um meio digital que auxilie na prática da biblioterapia como meio terapêutico.', NULL, NULL, '2019-08-09 11:53:07', '2019-09-19 15:19:51', 3, 2, 7, 5, true, 9.375, 9.86785714285715088);
INSERT INTO public.projeto VALUES (406, 'AS ÁFRICAS NO RIO GRANDE DO SUL: PORTO ALEGRE E OS ASSENTOS DE óBITO DOS ESCRAVIZADOS (1801-1802)', 'O presente trabalho é acerca da escravidão no espaço sul-rio-grandense ao cabo do ínterim colonial. Os fatores relativos ao percurso histórico da população africana no Rio Grande do Sul são pouco conhecidos, e caso sejam, muitas vezes é de forma genérica, o que se ocasiona pelos efeitos do racismo. Em ciência de tal problemática, da sua gravidade e sensibilidade, surge o objetivo de compreender as características específicas desses povos em Porto Alegre na virada dos setecentos aos oitocentos, levando em conta as conjunturas gerais da capitania, da região e da freguesia. Para a efetivação disso, superou-se a pesquisa por fontes historiográficas, utilizando-as para o diálogo com as documentais primárias adotadas. Essas são mapas da população de 1797 e 1802, localizados no Arquivo Histórico Ultramarino - Projeto Resgate, empenhadas no destrinchamento do cenário geral, regional e local no tocante de censos populacionais. E, para as “características específicas”, municia-se a metodologia dos registros de óbito dos escravizados presentes nos livros da Matriz de Porto Alegre, a Igreja Nossa Senhora Madre de Deus, dos anos de 1801 e 1802, cuja providência é do Family Search. A partir disso, renovou-se algumas perspectivas historiográficas sobre os números do contingente de cativos, descobriu-se uma capital em maioria preta, as causas de morte dessas pessoas, quem exatamente morria, os sacramentos recebidos antes da morte, possibilidades de resistência, aspectos que questionam e delimitam o uso desses registros e uma ampla gama de termos étnicos-raciais, como Angola, Mina, Benguela, Costa, Monjolo, Congo, Cabinda e Robolo em referência à África, e em relação aos raciais, achou-se os seguintes: preto, preto novo, preto bruto, negro novo, negro, pardo, crioulo, cabra e mulato. Destarte, logrou-se de uma fração das Áfricas na espacialidade porto-alegrense, alcançando, pois, o objetivo e avanços no que concerne a problemática, a luta contra os frutos do racismo.', NULL, NULL, '2021-10-12 12:02:07', '2021-11-04 21:28:48', 3, 2, 9, 5, true, 8.75, 9.625);
INSERT INTO public.projeto VALUES (423, 'WIKIESCOLAS', 'O programa denominado WikiEscolas, idealizado e desenvolvido numa parceria entre o Instituto Federal do Rio Grande do Sul - Campus Osório, Campus Farroupilha e a Universidade Federal do Rio Grande do Sul busca, através do mapeamento colaborativo, desenvolver uma aplicação para geolocalização escolar pública e nacional. O propósito do mesmo origina-se a partir da percepção em relação a carência de um espaço único destinado a divulgação de informações básicas como meios de contato e localização, bem como da divulgação de eventos e projetos de escolas públicas nacionais, dificultando desta forma, o engajamento da comunidade em relação ao seu corpo sócio-educacional. Assim sendo, há um ano o projeto de uma aplicação que atenda todas essas demandas vêm sendo desenvolvido no campus Osório, através dos requisitos determinados pelo IFRS - Campus Farroupilha e UFRGS. Operando mediante a práticas da metodologia de desenvolvimento ágil Scrum, a construção do software encontra-se em andamento, utilizando a linguagem de programação Javascript voltada para o front-end com engine EJS e para o back-end, Node.js e o banco de dados não relacional MongoDB foram escolhidos para o desenvolvimento. Levando em consideração o princípio de mapeamento, optou-se por utilizar a interface de programação de aplicações Leaflet para visualização e interação dos usuários com mapas. No presente momento, a aplicação conta com as funcionalidades de cadastro e demarcação dinâmica de escolas concluídas e, após o desenvolvimento completo da mesma, oficinas serão ofertadas para instruir e ocasionar na aproximação do corpo docente ao uso deste sistema. Espera-se um bom acolhimento da aplicação no âmbito escolar e da comunidade, assim como, a facilitação do relacionamento interescolar.', NULL, NULL, '2021-10-13 23:36:11', '2021-11-05 15:41:03', 6, 2, 9, 5, true, 7.625, 9.5);
INSERT INTO public.projeto VALUES (440, 'TRILOGIC: UMA PLATAFORMA EDUCATIVA PARA O ENSINO DA LóGICA DE PROGRAMAçãO A ALUNOS OUVINTES E NãO OUVINTES', 'Devido ao vasto uso de recursos computacionais nos mais diversos ramos, os cursos de formação na área de Tecnologia da Informação (TI) são cada vez mais requisitados. É indispensável que quem deseja ingressar na área de informática conheça e entenda a lógica de programação (LP) pois seus conceitos são essenciais para o aprendizado de qualquer linguagem de programação, ou seja, tem grande influência no processo de aprendizagem dos alunos de TI. A compreensão de LP é imprescindível para que o aluno consiga avançar nos cursos de TI, mas cerca de 60% das retenções acontecem nas disciplinas que abordam esse conteúdo. Tendo em vista o índice de retenção citado, desenvolveu-se uma plataforma de estudos intitulada Trilogic que usa atividades lúdicas para melhorar a compreensão de conceitos básicos da LP e motivar os alunos. O projeto, inicialmente, contemplou uma extensa pesquisa bibliográfica com ênfase em ensino de LP que elencou elementos para o desenvolvimento da plataforma, possibilitando a modelagem e implementação da plataforma. Ao longo de sua utilização, o projeto obteve a aprovação de 90,9% dos alunos usuários e tem contribuído para um aumento do rendimento nas disciplinas de LP. Ao perceber que a plataforma não estava abrangendo os alunos surdos ou ensurdecidos, já que estes não eram capazes de usufruir da plataforma em sua totalidade devido a sua condição auditiva, foram propostas e implementadas melhorias no projeto com o intuito de tornar a plataforma acessível a este público a partir da utilização da Suíte Vlibras, responsável por realizar a tradução dos textos didáticos presentes no Trilogic com o auxílio de um intérprete 3D. As adaptações implementadas foram avaliadas por profissionais intérpretes de Libras e novos testes estão sendo realizados com a comunidade não ouvinte. Cabe destacar que o Trilogic está disponível para o usuário final e vem sendo utilizado pelos docentes e alunos dos cursos de desenvolvimento de diversas instituições.', NULL, NULL, '2021-10-17 22:44:39', '2021-11-03 19:15:44', 6, 2, 9, 5, true, 9.5, 8.75);
INSERT INTO public.projeto VALUES (378, 'EXCUSE ME CHAIR - DISPOSITIVO DE SUSTENTAçãO COM ESTíMULOS SENSORIAIS PARA CRIANçAS COM ENCEFALOPATIA CRôNICA NãO PROGRESSIVA', 'O presente projeto é voltado para a área da engenharia mecânica, juntamente com a tecnologia assistiva e tem como tema estudar sobre a projeção de um dispositivo de sustentação com estímulos sensoriais para crianças com encefalopatia crônica não progressiva (paralisia cerebral). Sendo um comprometimento motor que ocorre através de lesões no sistema nervoso central, os portadores de PC podem ter diversas deficiências como motoras, alterações sensitivas, perceptivas e cognitivas. Assim pode-se dizer que o impacto ocorre de uma maneira e grau de dificuldade diferente para cada deficiente. Por se tratar de uma deficiência que atinge o sistema motor e sensorial, ela possui uma classificação topográfica dos prejuízos, neste projeto serão estudadas as principais classificações que necessitam da cadeira de rodas como apoio. O acompanhamento com fisioterapeutas e terapeutas ocupacionais é de extrema importância para o desenvolvimento dos sistemas que a PC afeta, nesses atendimentos é necessário retirar o paciente da cadeira de rodas, o que traz alguns transtornos, pois muitas vezes eles não têm a estabilidade no tronco para ficarem sentados sozinhos. Quem faz esse auxílio é o profissional, que para buscar uma melhor posição utiliza suportes não projetados para isso, consequentemente trazendo desconforto à criança. Como solução, esse projeto consiste na projeção de um dispositivo de sustentação, que irá trazer mais liberdade, autonomia e conforto à criança, além de possibilitar que o profissional trabalhe de maneira mais livre. Acoplado ao dispositivo, é proposto a projeção de objetos que auxiliem no desenvolvimento do sistema sensorial. A pesquisa conta com o auxílio de uma terapeuta ocupacional, juntamente com a APAE/Esteio, o que nos possibilita ter uma maior compreensão das reais dificuldades encontradas pelos portadores de PC. Além de serem utilizados como referências para a fundamentação teórica deste projeto, sites, livros e artigos científicos.', NULL, NULL, '2021-09-28 16:23:58', '2021-11-04 13:55:29', 7, 2, 9, 5, true, 7.875, 8.53750000000000142);
INSERT INTO public.projeto VALUES (407, 'SAI PRá Lá ANSIEDADE E DEPRESSãO! VEM SE EXERCITAR!', 'O projeto &#34;Sai pra lá ansiedade e depressão! Vem se exercitar!&#34; surgiu a partir da observação dos alunos no período de pandemia, no qual tendo contato com as manchetes de jornais com as notícias dos acontecimentos atuais, muitas pessoas vieram a desenvolver transtornos de ansiedade e depressão, muitas delas por estarem presas em suas casas e, por isso, levando uma vida sedentária. Assim, a partir de entrevistas com profissionais de diversas áreas da saúde, leitura de material bibliográfico e pesquisa realizada com os alunos do sétimo ano da Escola Hohendorff, criou-se alternativas para auxiliar as pessoas que passam por tal situação, incentivando à prática de exercícios físicos com ações como encontros online para realização de exercícios físicos, como zumba e ginástica, publicação de dicas para uma vida saudável, mensagens motivacionais aos alunos, projeto de um espaço de exercícios físicos na escola, com aparelhos específicos para isso construídos com materiais de baixo custo e fácil aquisição, tais como canos de PVC. A partir das ações foi possível reafirmar que fazer atividade física ajuda no combate à depressão e ansiedade, além de trazer mais saúde proporcionar uma vida com maior qualidade, tornando as pessoas seres mais felizes e prontos para os desafios e amenizando o tempo de isolamento social.', NULL, NULL, '2021-10-13 14:10:29', '2021-11-04 23:58:15', 11, 3, 9, 5, true, 8.125, 9.75);
INSERT INTO public.projeto VALUES (434, 'AVALIAçãO IN VITRO DOS EFEITOS MEDICINAIS DO EXTRATO DE ESPINHEIRA-SANTA NO TRATAMENTO DE ÚLCERA', 'A úlcera péptica é uma ferida que ocorre na parede do estômago ou duodeno, tendo como principais causas a bactéria Helicobacter pylori e as drogas anti-inflamatórias não esteroidais. No Brasil, a prevalência de úlcera em homens e mulheres é de 0,2% e 0,1%; respectivamente. A Maytenus ilicifolia é uma planta nativa da região do sul do Brasil, amplamente utilizada na medicina popular no tratamento de doenças estomacais. O problema da pesquisa visou definir como o extrato aquoso da espinheira-santa atua no tratamento de úlcera péptica, com o objetivo de avaliar seu potencial antibacteriano e capacidade antioxidante. Para isso, foi realizada uma triagem fitoquímica a fim de identificar a presença de compostos bioativos. Preparou-se o extrato aquoso concentrado da planta e dele foram feitas 5 diluições em diferentes concentrações. A capacidade antioxidante das diluições foi testada pelo método de captura do radical ABTS•+. O potencial antibacteriano foi testado frente às bactérias Escherichia coli e Staphylococcus aureus por meio do método de difusão em ágar por disco utilizando dois diferentes modos de esterilização: autoclave e membrana filtrante. Os resultados obtidos na triagem indicaram a presença de metabólitos secundários no extrato aquoso, além de resultados positivos no ensaio antioxidante, com capacidade diretamente proporcional à concentração de extrato. Além disso, seu potencial antibacteriano demonstrou inibição de bactérias Gram-positivas e Gram-negativas. As diferentes concentrações do extrato se comportaram de maneira singular nas análises do trabalho, mas indicaram potenciais maiores para a maior concentração do extrato diluído. Para avaliar melhor os principais mecanismos responsáveis pelos efeitos medicinais da planta, são necessárias análises mais específicas, como cromatografia líquida acoplada a detector de massas, que podem ser realizadas futuramente. Com isso, será possível identificar quais são as substâncias que atuam combatendo a ulceração.', NULL, NULL, '2021-10-17 15:28:41', '2021-11-05 00:21:51', 4, 2, 9, 5, true, 9.25, 9.96250000000000036);
INSERT INTO public.projeto VALUES (371, 'ECO-PLAY: UM APLICATIVO PARA O AUXÍLIO DO ESTUDO DE BIOMAS', 'Dois temas muito relevantes na atualidade são o desmatamento e as queimadas que ocorrem pelo Brasil. Segundo o Instituto do Homem e Meio Ambiente da Amazônia (Imazon), o período de agosto de 2020 até junho de 2021 foi o que apresentou maior área desmatada neste bioma, com cerca de 8.400 km² de mata derrubada. Houve também, no ano de 2020, uma grande quantidade de incêndios no Pantanal, com o maior registro de áreas queimadas desde 1990, segundo o Instituto Nacional de Pesquisas Espaciais (Inpe). Nesse sentido, este trabalho tem como objetivo principal desenvolver uma aplicação com o intuito de auxiliar os usuários nos seus estudos a respeito dos biomas brasileiros, bem como favorecer a divulgação destas formações naturais do nosso país. Sabendo o quanto é importante conhecer os biomas brasileiros para entender a importância de preservá-los, o projeto se propõe a propagar conhecimento sobre esta temática. Além disso, pretende cobrir lacunas encontradas em outros softwares com o mesmo enfoque, pois eles não abordam os biomas do Brasil de modo efetivo, de forma que não oferecem material didático sobre o assunto. O Eco-play está sendo desenvolvido para o sistema operacional Android, utilizando a ferramenta Kodular e com integração ao banco de dados Firebase. Ademais, ele está concebido de forma a oferecer um quiz sobre os biomas brasileiros, um sistema de recompensas para determinadas atividades cumpridas pelo usuário, um fórum para a interação entre pessoas, juntamente com subsídios teóricos sobre cada um dos biomas. Atualmente já estão concluídos os protótipos das telas, o diagrama de casos de uso, a arquitetura do projeto e o modelo da aplicação que o Eco-play utilizará. Além disso, também está em progresso a elaboração do banco de dados, tendo o modelo entidade relacionamento (MER) concluído. Os próximos passos do desenvolvimento envolvem a implementação do aplicativo com os recursos citados e a seleção das questões e do material de apoio que a plataforma oferecerá.', NULL, NULL, '2021-09-23 14:47:55', '2021-11-04 21:08:55', 6, 2, 9, 5, true, 7.75, 7.9375);
INSERT INTO public.projeto VALUES (402, 'A ANáLISE DO FEMININO A PARTIR DAS ESTRATéGIAS DE SEDUçãO PRESENTES NAS HEROIDES DE OVíDIO', 'A presente pesquisa procura analisar as estratégias de sedução utilizadas por Páris para conquistar Helena de Tróia nas cartas XVI e XVII da obra Heroides, que tem como autor o poeta romano Públio Ovídio Naso. O objetivo central do estudo se relaciona a observar as táticas utilizadas pelo troiano para convencer sua amada de fugir com ele e como se dá a recepção destas investidas amorosas por parte da rainha espartana, analisando as questões de gênero presentes nessas epístolas. Helena de Tróia foi abordada de diversas maneiras por inúmeros autores ao longo da história. Dito isso, o estudo se justifica pelo fato de ser fundamental compreender o feminino atualmente e como ele é apresentado nos discursos de diferentes autores ao longo do tempo. Assim, o projeto tem caráter interdisciplinar, contribuindo para a compreensão filosófica, sociológica e histórica dos fatos apresentados. Como metodologia, foi feita a leitura das cartas citadas anteriormente. Depois, extraiu-se delas trechos nos quais é possível identificar estratégias de sedução e como elas eram respondidas. Para analisar o feminino romano presente nas entrelinhas desse jogo de amor, foi realizada uma considerável revisão bibliográfica sobre gênero e cultura. Como resultados, observamos que Páris conhece o jogo de sedução muito bem, sabendo se declarar de forma intensa à anfitriã. O príncipe aproveita oportunidades como um jantar para, fingindo-se embriagado, usar sinais para demonstrar seu interesse por Helena. Além disso, Páris procura contatar as servas de Helena e arrolar argumentos para convencer a semideusa a fugir com ele. Porém, Helena se apresenta pelas palavras de Ovídio como alguém racional e que joga o jogo de Páris com suas próprias regras, contrariando a ideia ligada ao feminino de impulsividade. Dessa forma, notamos que a sedução entre os dois não é natural. Assim, uma série de práticas performativas permite que se possa compreender o feminino e o amor no início do Império Romano.', NULL, NULL, '2021-10-09 16:06:56', '2021-11-04 21:24:33', 3, 2, 9, 5, true, 8.125, 6.375);
INSERT INTO public.projeto VALUES (419, 'AS DIFERENçAS ENTRE OS PROCEDIMENTOS DE FUSãO ESPINHAL E SUBSTITUIçãO DE DISCO NA COLUNA LOMBAR', 'O atual projeto tem como finalidade estudar os procedimentos cirúrgicos de fusão espinhal e substituição do disco intervertebral na coluna lombar (artrodese e artroplastia lombar), através de pesquisas bibliográficas. Além disso, também há a pretensão de compará-las para que seja possível identificar a opção que melhor corresponda às necessidades das condições de cada paciente. Ambas cirurgias são responsáveis por solucionar as complicações causadas pela discopatia degenerativa na região inferior da coluna, porém a artrodese utiliza um método mais antigo, no qual o cirurgião funde duas ou mais vértebras, para que elas se curem em um único osso sólido. Já a artroplastia, consiste na substituição do disco intervertebral por uma prótese com mobilidade intrínseca, conservando o movimento da coluna e, consequentemente, evitando o sobrepeso nas áreas adjacentes. Até o presente momento, foi possível constatar que ambos procedimentos cirúrgicos são satisfatórios quanto às necessidades do estado clínico de cada paciente, no entanto, foi possível observar o quão limitado é o número de fontes que abordam a artroplastia no Brasil, se comparado ao número de fontes da artrodese;além de ser uma cirurgia delicada, a artroplastia é mais inacessível, uma vez que a própria prótese do disco intervertebral é importada, o que acaba agravando os custos do procedimento. Tendo em vista o panorama atual, esses aspectos tornam evidente a necessidade do desenvolvimento de equipamentos acessíveis e de qualidade em região nacional,com a intenção de viabilizar o acesso a artroplastia, tornando-a tão acessível quanto a artrodese.', NULL, NULL, '2021-10-13 22:02:36', '2021-11-05 13:28:53', 4, 2, 9, 5, true, 9.375, 9.36250000000000071);
INSERT INTO public.projeto VALUES (428, 'CHAPA COMPENSADA DE CASCA DE ARROZ E AGLUTINANTE NATURAL DE AMIDO DE MILHO', 'A utilização de painéis de madeira aglomerada para produção de móveis é bastante comum, porém essa prática provoca o corte de árvores e as resinas usadas são tóxicas à saúde dos trabalhadores dessas indústrias. Nesse contexto, é importante o estudo de materiais alternativos para produção de chapas compensadas. O objetivo da presente pesquisa, ainda em andamento, é o desenvolvimento de uma placa a base de casca de arroz e amido gelificado com características mecânicas similares às convencionalmente confeccionadas com cavacos de madeira e resina fenólica. A metodologia se constituiu de duas etapas, a primeira foi a elaboração do projeto e construção de uma prensa caseira; e a segunda foi a produção das chapas compensadas atóxicas. Foram construídas 3 prensas com tábuas de pinus capazes de produzir amostras com dimensões de 20 x 15 cm. Para produção das resinas aglutinantes serão preparadas misturas de água destilada com 5 % de amido de milho, mantidas sob aquecimento controlado (65 - 77 ºC) até a gelificação. Essa goma terá a função aglutinar o material celulósico usado na produção das chapas. Foram escolhidas as cascas de arroz, por se tratar de um material de baixo custo e descartadas em grande quantidade pelas empresas da região. A fim de comparar as placas produzidas com essa fibra, serão também preparadas chapas de serragem utilizando a mesma metodologia. As análises físico-químicas previstas são: resistência à pressão transversal sob vão livre, resistência a umidade e resposta da chapa a procedimentos como perfuração e corte utilizados na indústria moveleira. Já foi concluída a primeira etapa da investigação científica, sendo a segunda iniciada em seguida. Espera-se já ter os primeiros resultados experimentais com as chapas até a data da apresentação oficial do trabalho.', NULL, NULL, '2021-10-16 18:28:17', '2021-11-04 22:41:33', 4, 2, 9, 5, true, 9.5, 9.60000000000000142);
INSERT INTO public.projeto VALUES (432, 'BIOPLáSTICO à BASE DE AMIDO COM A ADIçãO DA FIBRA DA CANA-DE-AçúCAR EM Pó.', 'O plástico de origem petroquímica é largamente utilizado para produção de bens de consumo e se tornou uma causa de impacto ambiental, devido a sua lenta degradação, permanecendo no ecossistema por centenas de anos. Nesse cenário, o bioplástico vem se tornando uma alternativa vantajosa, devido à sua rápida degradação após o descarte. O objetivo da presente pesquisa é desenvolver bioplástico à base de amido com a adição da fibra cana-de-açúcar, para que este tenha maior resistência e possa vir a ser utilizado como matéria-prima para produção de embalagens. A metodologia desenvolvida se baseou na preparação do bioplástico com posterior adição da fibra e secagem em placa de petri em estufa. Foram produzidas duas amostras. A amostra 1 foi preparada com 2,4g de amido de milho, 2,5g de fibra de cana-de-açúcar em pó (previamente triturada em mixer doméstico), 2,5 mL de ácido acético, 5,2 mL de glicerina, e 60 mL de água destilada. A amostra 2 foi preparada seguindo a mesma receita, alterando-se a quantidade de água para 45 mL. Os ingredientes foram misturados sob aquecimento e posteriormente a massa obtida foi espalhada em placas de petri. A secagem foi realizada em estufa por um tempo total de 2h dividido em intervalos de 30 min, a temperatura média foi de 100ºC. Após completa solidificação da amostra, o bioplástico foi removido do molde manualmente. Foi percebido forte odor de açúcar em ambas as formulações. Além disso, se observou que partes da superfície do bioplástico apresentavam aspecto aderente como uma espécie de “grude”, possivelmente causado pela caramelização dos açúcares. As análises física e bioquímica previstas são: biodegradabilidade e resistência mecânica ainda não realizadas. A investigação científica está em andamento e, assim, muitos resultados ainda serão produzidos ao longo dos experimentos. Porém, as observações prévias demonstram potencial existente da ideia proposta.', NULL, NULL, '2021-10-17 14:26:03', '2022-04-06 15:50:40', 4, 2, 9, 5, true, 10, 7.28749999999999964);
INSERT INTO public.projeto VALUES (429, 'CAPI- CADEIRA DE RODAS ADAPTADA PARA IDOSOS', 'A CAPI – Cadeira de Rodas Adaptada para Idosos II é um projeto científico que envolve as áreas de Mecânica Industrial e Tecnologia Assistiva que tem por objetivo auxiliar pessoas idosas com atrofia muscular por desuso que utilizam cadeira de rodas a ter maior acessibilidade a banheiros e locais de convivência. Tendo em vista que a atrofia muscular por desuso é uma atividade funcional contrátil do músculo esquelético, acompanhada por uma redução de proteínas transportadoras de aminoácidos, logo, o projeto teve como intuito principal desenvolver dois acessórios mecânicos práticos e seguros em uma cadeira de rodas convencional capazes de prover a acessibilidade e estabilidade dos usuários. Para tanto, foram feitas pesquisas sobre cadeiras de rodas que apresentam acessórios com as mesmas funções do projeto CAPI. Com isso, a fabricação dos protótipos dos acessórios desenvolvidos e projetados, teve início com a análise da melhor forma de abordagem para suprir as necessidades identificadas nas entrevistas realizadas com profissionais da saúde e com pessoas que apresentam necessidades especiais, e na subsequência a projeção e dimensionamento, após análises virtuais (software de CAE), e o processamento atraves da utilização de diversos meios de usinagem, corte a laser, corte de materiais e processos de montagem, foi finalizado o protótipo dos acessórios CAPI. A pesquisa discorreu satisfatoriamente, pois entende todo o dinamismo, além da privacidade e facilidade adquiridas, permite o acesso ao banheiro e a áreas comuns de lazer. O projeto tem como objetivo futuro, ainda, testar por um tempo maior, analisar as possíveis melhorias nos acessórios. Diminuir o peso, e melhorar o mecanismo para facilitar o transporte da cadeira CAPI, são dois objetivos futuros, e não menos importante, automatizar o deslocamento do assento, proporcionando maior conforto ao usuário das cadeiras de rodas CAPI e desta forma contribuir para uma melhor qualidade de vida para idosos.', NULL, NULL, '2021-10-16 18:59:15', '2021-11-05 12:00:06', 7, 2, 9, 5, true, 8.875, 9.73750000000000071);
INSERT INTO public.projeto VALUES (381, 'DESENVOLVIMENTO DE UM BIOPLáSTICO A PARTIR DA FIBRA DO CAROçO DA MANGA', 'A partir do ato de comer uma manga, nos perguntamos o que fazer com o seu caroço, que nunca tínhamos dado importância. Observamos que utilizamos muitos plásticos descartáveis mas que nem sempre há um descarte adequado, gerando consequências ao meio ambiente, já que não são biodegradáveis e são difíceis de compactar, geram um grande volume de lixo, espalhando-se facilmente. Para minimizar esses impactos, utilizamos o caroço da manga, para a produção de um bioplástico que tem como vantagem a sua degradabilidade, ser obtido de fontes orgânicas e reaproveitáveis. Esse caroço não é aproveitado pela indústria, promovendo a extensão do tempo de vida deste resíduo e a diminuição dos impactos ambientais causados pelos polímeros artificiais. No processo de produção do bioplástico foram utilizadas diferentes proporções de fibra triturada, glicerina, amido e água deionizada, à quente para a gelatinização do amido, após a secagem, conseguimos moldá-lo e, com camadas, formamos um pote, para possível aplicação em embalagens de fast food. Em relação aos resultados, no teste de densidade, o Tratamento 1 apresentou densidade de 2,15 g/mL, o Tratamento 2: 2,37 g/mL, o Tratamento 3: 2,45 g/mL e o Tratamento 4: 2,93 g/mL. No teste de absorção de água, colocamos as amostras em potes com água por 1 semana e ao final deste período o Tratamento 1 absorveu 26,4% de água, o Tratamento 2: 25,14%, o Tratamento 3: 18,17% e o Tratamento 4: 14,54%. No teste de biodegradabilidade após 3 semanas, todas as amostras sofreram 100% biodegradação. No teste de resistência à temperatura, as amostras ficaram quebradiças em 180°C. Futuramente serão feitos testes para definir os alimentos que podem ser armazenados no pote. Realizando o projeto, conseguimos produzir protótipos do bioplástico para tentar minimizar os problemas causados pelos plásticos convencionais, buscando promover o consumo responsável dos plásticos entre a comunidade e fomentando um ambiente mais sustentável.', NULL, NULL, '2021-09-29 22:19:19', '2021-11-04 20:37:20', 8, 2, 9, 5, true, 9, 9.23750000000000071);
INSERT INTO public.projeto VALUES (391, 'FORMULAçãO ALIMENTíCIA COM CIANOBACTéRIAS: POTENCIAL BIOTECNOLOGICO DA JUJUBA ENRIQUECIDA COM ARTHOSPIRA SPIRULINA PLATENSIS', 'Cianoactérias como a spirulina, têm sido estudadas por apresentar grandes quantidades de proteínas e isando contribuir com soluções o grupo formulou a pesquisa com base no segundo e terceiro ODS da agenda 2030 da ONU. O projeto cultivou e avaliou a produção dessas cianobactérias por meio de um aquário com técnicas de custo e, produziu receitas próprias de jujubas enriquecido com esse super alimento de modo a deixar o sabor mais palatável estimulando o consumo. A metodologia desenvolvida na primeira fase foi construída como uma forma de cultivar essas cianobactérias em ambiente domiciliar e para isso, foi adquirido um frasco de 100 ml de cultura inicial, adicionado em um aquário com água filtrada e não clorada.O cultivo foi cuidadosamente monitorado, observando os parâmetros como: temperatura da água, incidência solar e uso de bomba para manter a oxigenação da água adequada. Na segunda fase do projeto foi realizado vários testes para se produzir as receitas e no final optou-se por quatro metodologias: diet, com açúcar, vegana e vegana/diet que foram aprovadas e avaliadas por testes sensoriais. Foram produzidos gráficos com os resultados e uma tabela comparativa do potencial protéico do alimento. que tem sido foco de importantes pesquisas biotecnológicas, principalmente por sua importância nutricional, sendo eleita pela OMS como alimento do milénio', NULL, NULL, '2021-10-07 16:56:54', '2021-11-04 23:30:13', 10, 3, 9, 5, true, 7.875, 8.61250000000000071);
