INSERT INTO public.revisao VALUES (30, 165, 522, 'O texto necessita apenas de revisão gramatical, mas está homologado.', 9.5, true);
INSERT INTO public.revisao VALUES (19, 76, 933, 'Acredito, que o projeto deve ser refeito, focalizando no objetivo geral da proposta que é ensinar mulheres a usar &#34;Software livre Inkscape Project&#34;, pois, falta dizer como tal software pode ser usado como fonte renda. Outro ponto, como o projeto é uma iniciativa encaminha-se para o empreendedorismo, não fica evidenciado no texto como tal ação ocorrerá. O projeto também não demonstra a sua metodologia de pesquisa ou de ensino. Além disso, deixa uma grande lacuna sobre seu processo de execução (recomendo organizar em etapas, destacando como o mesmo será organizado, com número de envolvidos (alunos e professores ou instrutores) e os recursos necessários). Última orientação, o texto necessita passar por um revisor, pois, apresenta erros de estrutura gramatical.', 2.75, true);
INSERT INTO public.revisao VALUES (51, 119, 547, 'O resumo apresentou um tema relevante e bom delineamento do projeto.', 8.75, true);
