INSERT INTO public.revisao VALUES (363, 167, 86, 'O projeto apresenta bastante relevância e parece bem escrito. No que se refere ao problema de pesquisa, a questão a ser investigada com as adolescentes deve contemplar mais dos que as mudanças no corpo e abordar também a dificuldade de ser adolescente do gênero feminino na sociedade de hoje.', 8.25, true);
