INSERT INTO public.revisao VALUES (110, 62, 941, 'É um ótimo resumo, com uma escrita muito bem feita e com a metodologia muito clara. Apenas, indico acrescentar a palavra-chave sociedade, para que o trabalho fique ainda mais completo.', 9.5, true);
INSERT INTO public.revisao VALUES (9, 49, 261, 'Nas palavras chaves há repetição da palavra planejamento. Sugiro a inserção da palavra &#34;inclusão&#34;. O verbo utilizado para o objetivo não caracteriza pesquisa. Sugestão: Verificar a interação entre alunos da Sala de Recursos e comunidade escolar, através de dinâmicas (...)&#34;. Foi mencionado apenas o objetivo geral e a metodologia está confusa em relação a este. Pode-se pensar as etapas de realização: coleta de dados, análise, planejamento, construção de estratégias, aplicação, avaliação e análise dos resultados.', 6.75, true);
