INSERT INTO public.revisao VALUES (194, 124, 532, 'Há uma letra minúscula no título. O resumo está muito bem escrito, mas não é possível entender bem o método a partir dele - não há impedimento por isso, mas se houver a chance, seria interessante escrever mais detalhadamente como a pesquisa ocorrerá.', 9, true);
INSERT INTO public.revisao VALUES (333, 140, 532, 'É um trabalho excelente, com metodologia muito clara, muito bem apresentado. Eu só recomendaria trocar o titulo. Entendo que ele é interessante, chama a atenção. No entanto, ele tem um tom de tratamento pejorativo, não é bom chamar a depressão de inimigo, procurem algo que cause curiosidade, vontade de vencer, enfim, mas não que uma condição que acompanhar algumas pessoas por toda a vida deva ser tratado assim.', 9.75, true);
INSERT INTO public.revisao VALUES (14, 113, 532, 'Esse resumo poderia ser reescrito. Seria importante, pois diversas informações são repetidas em sequência - até quatro vezes, com alguma variação pequena de conteúdo, mas a mesma apresentação do projeto. E, talvez por repetir diversas vezes algumas coisas (inserir externos, participar e fazer eventos), não há nenhuma vez uma apresentação um pouco mais aprofundada do que será realmente o projeto. Também me preocupou o caráter de pesquisa dessa apresentação, parece-me haver um evidente viés de extensão - ou de várias extensões dentro de um projeto guarda-chuva, mas nenhuma das apresentadas teria como resultado alguma pesquisa.', 5.5, true);
INSERT INTO public.revisao VALUES (39, 75, 510, 'Nota final (soma dos totais * 2) = 19,5 pontos', 9.75, true);
