INSERT INTO public.revisao VALUES (158, 38, 533, 'Tema de pesquisa muito relevante e metodologia convergente com a pesquisa histórica. Entretanto, o problema de pesquisa não está devidamente exposto e o objetivo principal também está muito subjetivo.', 5.75, true);
INSERT INTO public.revisao VALUES (341, 149, 533, 'Trabalho de pesquisa bem estruturado quanto ao tema, problema, objetivos e metodologia. Sugiro incluir referencial historiográfico, uma vez que no resumo consta que será realizada análise histórica nas alteração do conto. Exemplo: se o corpus selecionado encontra-se entre o século XVIII e XIX, do ponto de visto histórico, que autor será utilizado para dar conta do contexto histórico da época?', 8.75, true);
INSERT INTO public.revisao VALUES (308, 94, 533, 'Trabalho muito bom, completo e bem estruturado.', 10, true);
INSERT INTO public.revisao VALUES (164, 63, 534, 'O título do resumo é abrangente e o resumo não define quais os procedimentos e resultados são esperados pelo estudo.', 4, true);
INSERT INTO public.revisao VALUES (212, 11, 534, 'O desenho do Estudo está bem descrito e o detalhamento das etapas do método são coerentes aos objetivos e resultados esperados.', 9.25, true);
INSERT INTO public.revisao VALUES (230, 162, 534, 'A investigação é relevante, contudo a apresentação do resumo não está apresentada de maneira coerente pois apresenta os objetivos misturados à justificativa e a etapa de execução do estudo. A apresentação das etapas do projeto poderiam ter sido melhor desenvolvidas.', 6.25, true);
INSERT INTO public.revisao VALUES (256, 105, 534, 'O tema do estudo é relevante, porém o resumo apresenta erro de escrita e concordância nominal além de não apresentar de forma clara como será desenvolvida a metologia e os procedimentos do estudo.', 5.5, true);
INSERT INTO public.revisao VALUES (262, 117, 534, 'O tema do estudo é relevante, porém a justificativa não está bem desenvolvida pois faz afirmações baseadas no senso comum, a respeito do tema, além disso o desenvolvimento da metodologia e a apresentação dos resultados esperados está em desacordo.', 4.5, true);
INSERT INTO public.revisao VALUES (22, 112, 538, 'O projeto apresentado tem uma relevância importante ao que se propõe. No entanto, aponto dois problemas significativos que não estão esclarecidos e requisitados quando se redige um resumo. 1) A METODOLOGIA, ou seja o detalhamento do método (entrevista), a abordagem, validação do método, o número de participante, o período de início do projeto, quantos alunos bolsistas e voluntários participam do projeto do Núcleo; 2) o Título precisa ser repensado, pois não está refletindo o contexto do projeto.', 6, true);
INSERT INTO public.revisao VALUES (296, 175, 534, 'A justificativa e o objetivo da pesquisa está bem descrita, mas a metodologia e os procedimentos não estão bem delineados.', 5.5, true);
INSERT INTO public.revisao VALUES (163, 63, 538, 'O projeto está delineado adequadamente. Atende aos requisitos de um resumo, ou seja, prevê introdução, objetivos, método e resultado. No entanto, a ABNT recomenda no item Palavras-Chaves o mínimo de três e no máximo cinco palavras-chave. falta ajustar esse item.', 7, true);
INSERT INTO public.revisao VALUES (204, 166, 538, 'O resumo apresentado é de extrema relevância. Atende aos requisitos de um resumo, ou seja, prevê introdução, objetivos, método e resultado. No entanto, a ABNT recomenda no item Palavras-Chaves o mínimo de três e no máximo cinco palavras-chave.', 8.75, true);
INSERT INTO public.revisao VALUES (312, 28, 538, 'O projeto apresentado tem uma relevância importante ao que se propõe. No entanto, alguns problemas significativos que não estão esclarecidos e contemplados quando se redige um resumo. A saber: detalhamento do método a abordagem, o número de participante, o período do projeto para o desenvolvimento das ações indicadas.', 5, true);
INSERT INTO public.revisao VALUES (15, 178, 937, 'Vários aspectos estão muito bem resolvidos. Aconselho apenas que atentem para o título e as palavras-chaves para o termo desemprego. Pois dá a entender que há a relação entre o desemprego e o desenvolver da tecnologia; o trabalho se propõe o contrário. Talvez termos como empregabilidade, mundo do trabalho e atividades laborais sejam mais adequados (?).', 8.5, true);
INSERT INTO public.revisao VALUES (301, 130, 926, 'Não ficou claro quem realiza o uso do software e quais dados serão coletados/informados.', 6, true);
INSERT INTO public.revisao VALUES (258, 114, 926, 'Deve comparar a solução com outras existentes, como o Duolingo', 7.5, true);
INSERT INTO public.revisao VALUES (228, 135, 937, 'O resumo e o trabalho estão bem descritos e estruturados. Acredito que os resultados serão positivos e promoverão grande aprendizado. Não creio que seja necessária a inclusão do termo &#39;IFRS Osório&#39; nas palavras-chaves. Essas palavras serão usadas para buscas e indexações, portanto deve-se usar os termos relevantes sobre o trabalho.', 9.25, true);
INSERT INTO public.revisao VALUES (261, 117, 937, 'Apenas aconselho um aprofundamento no para justificativa do projeto onde sobre como os estudantes que justifiquem se a tecnologia realmente atrai a atenção dos alunos.', 9, true);
INSERT INTO public.revisao VALUES (337, 132, 947, 'Mais atenção à escrita.', 8.75, true);
INSERT INTO public.revisao VALUES (340, 145, 931, NULL, 8.5, true);
INSERT INTO public.revisao VALUES (335, 141, 93, 'Poucos dados de como será desenvolvida a pesquisa.', 7.25, true);
INSERT INTO public.revisao VALUES (332, 134, 546, NULL, 9.75, true);
INSERT INTO public.revisao VALUES (346, 169, 109, NULL, 3.5, true);
INSERT INTO public.revisao VALUES (334, 140, 935, NULL, 9.25, true);
INSERT INTO public.revisao VALUES (370, 183, 87, NULL, 10, true);
INSERT INTO public.revisao VALUES (379, 189, 86, 'Projeto oriundo da III FEMUCITEC', 7.5, true);
INSERT INTO public.revisao VALUES (104, 155, 314, 'Para que o resumo seja aceito, é fundamental que ocorram duas correções. (1) No texto aparece o quilograma (kg) com a unidade de media nos trechos “… obtendo um total de 4741 kg de resíduos, sendo destes, 3198 kg ...”. No prosseguimento da leitura, percebe-se há uma confusão entre quilograma e grama. Por exemplo, o autor ou quer dizer 3198 kg e, após, 489 kg, ou 3198 gramas e 489 gramas. (2) No trecho “… garrafa PET, 489 gr. de recipientes de papelão, 383 gr. de recipientes plásticos, 355 gr. de latas de alumínio e 316 gr. de tampinhas ...” aparece “gr.” como símbolo para representar a unidade grama, o que está incorreto. A unidade grama é representado por simplesmente “g”. Ou se escreve por extenso “gramas” ou se representa por “g”, mas não por “gr.”.', 6.25, true);
INSERT INTO public.revisao VALUES (338, 132, 941, 'O resumo possui coerência, porém a metologia utilizada para responder o problema de pesquisa e os objetivos não está clara. E, não apresenta resultados preliminares. Também, sugiro a inclusão da palavra-chave &#34;Dia D&#34;.', 6, true);
INSERT INTO public.revisao VALUES (210, 98, 937, 'Precisa de algumas melhorias no texto, descrevendo melhor o processo e demonstrando de forma mais clara a aplicabilidade do objeto.', 4.75, true);
INSERT INTO public.revisao VALUES (359, 125, 92, NULL, 5.75, true);
INSERT INTO public.revisao VALUES (70, 95, 535, 'O trabalho torna-se interessante por ter sido desenvolvidos por alunos do ensino fundamental. É necessário desenvolver o gosto pelas ciências ainda nesse nível de ensino', 6.75, true);
INSERT INTO public.revisao VALUES (78, 52, 528, 'o trabalho tem conteúdos de estatística. porém não é apresentado nenhuma pesquisa realizada com famílias apenas com um economista. Apenas apresenta números e dados e não referencia os dados apresentados , ou seja qual seria a fonte dos dados apresentados? Sugiro ao grupo realizar pesquisa com famílias.', 6.25, true);
INSERT INTO public.revisao VALUES (214, 30, 528, 'O trabalho proposto é o desenvolvimento de um aplicativo. A ideia é muito interessante, os alunos realizaram e fundamentaram a pesquisa. Informaram as ferramentas que serão utilizadas para o desenvolvimento do aplicativo. A pesquisa tem uma metodologia bem definida porém pode melhorar nas descrições das funcionalidades do aplicativo.', 8.75, true);
INSERT INTO public.revisao VALUES (252, 86, 528, 'A proposta de um sistema de avaliação de acessibilidade urbana está sendo desenvolvida. Não ficou claro no texto se o sistema terá acessibilidade? E quais os recursos inteligentes de acessibilidade? O texto também não ficou claro a metodologia de trabalho que será usada e testada o sistema. A proposta de trabalho é boa mas precisa fazer essas melhorias.', 8.25, true);
INSERT INTO public.revisao VALUES (267, 123, 528, 'A proposta deste trabalho é desenvolver um sistema web que permita o agendamento de consultas médicas pelos pacientes. O sistema é uma realidade e muitas clinicas. Porém a metodologia do trabalho ainda não está bem descrita. O sistema não é informado a linguagem ou as tecnologias/ferramentas que serão desenvolvidas. Qual seria o benefício para a clinica em ter esse sistema (financeiro e social)? Essas evidências não ficaram claras na proposta do problema descrito.', 6.75, true);
INSERT INTO public.revisao VALUES (352, 54, 504, NULL, 6.25, true);
INSERT INTO public.revisao VALUES (135, 87, 86, 'O projeto tem mérito e a justificativa está bem definido. No entanto, a redação do resumo não deixa claro quais são os objetivos específicos do projeto. O resumo carece ainda de informações que levem a compreensão do status do projeto: se ainda está em andamento, já está operacional, etc. Solicita-se um maior cuidado na escrita do resumo que possui palavras faltando e outras repetidas.', 7, true);
INSERT INTO public.revisao VALUES (139, 106, 86, 'O projeto apresentado é muito interessante. Há ausência de sinalização do status do projeto: se já está concluído, em fases de testes, etc. Assim, a metodologia ficou um pouco comprometida. As palavras-chaves podem ser melhor pensadas de forma a conseguir se sobressair em pesquisas de indexação.', 8.25, true);
INSERT INTO public.revisao VALUES (138, 85, 86, 'O projeto parece ser bem interessante, no entanto, na escrita do resumo não é possível perceber corretamente qual o objetivo geral e os específicos, qual a metodologia empregada e quais os resultados são esperados. O resumo foi construído em linguagem coloquial com bastante erros de digitação, com trechos na primeira pessoa. Além disso, o texto parece um recurso de uma descrição bastante informal do projeto em si.', 5.75, true);
INSERT INTO public.revisao VALUES (49, 153, 518, 'Na primeira linha do resumo precisa ficar bem claro do que se trata o trabalho. Isso não consta no início, somente no final do resumo. Não é apresentada justifica e nem os objetivos coerentes.', 2.25, true);
INSERT INTO public.revisao VALUES (75, 61, 518, 'Ter mais cuidado com a ortografia, Terra é nome próprio do nosso planeta, não pode ser escrito com letra minúscula. Procurar usar outras fontes como referência, somente pesquisa na Internet fica limitado, use os livros de Ciências também.', 6, true);
INSERT INTO public.revisao VALUES (218, 103, 530, 'Da leitura do resumo, não se consegue extrair que de fato seja um projeto de pesquisa, e sim um projeto social, onde de fato há objetivos baseados em diversos critérios. Não se enxerga adequadamente o estabelecimento de uma metodologia, assim como não se vislumbram claramente resultados.', 4.5, true);
INSERT INTO public.revisao VALUES (88, 71, 530, 'Projeto com algumas falhas na identificação de fatores importantes num projeto de pesquisa. Faltou definir melhor a metodologia, e mostrar resultados ou potenciais. O objetivo do trabalho é mostrar para a população, de um modo simples e prático, como montar um sistema caseiro de aquaponia, mas isto não necessariamente é enquadrado num projeto de pesquisa por si só.', 5, true);
INSERT INTO public.revisao VALUES (354, 73, 919, 'O trabalho, em geral, está bom. Entretanto a problemática não está bem clara, afinal o foco está em descobrir se os alunos estão cientes ou não da importância dos gênero seminário na sua vida escolar ou o problema está em falar sobre a desvalorização do gênero seminário?', 6.25, true);
INSERT INTO public.revisao VALUES (329, 31, 919, 'O problema apresentado, na verdade, era um objetivo. Inclusive o(a) autor(a) repete o &#34;problema&#34; como objetivo quando diz: &#34;Partindo do problema de pesquisa &#39;perceber como os jornais brasileiros representaram [...]&#34; e &#34;o nosso objetivo geral é analisar como a grande imprensa do país representou [...]&#34;.', 7.5, true);
INSERT INTO public.revisao VALUES (137, 85, 680, 'Faltou informar que tipo de precisão se espera do equipamento (resultados esperados). É interessante revisar a linguagem no texto.', 6.25, true);
INSERT INTO public.revisao VALUES (146, 83, 530, 'Projeto com boa dose de pesquisa, os objetivos são coerentes com a metodologia adotada e com o uso de tecnologias, possivelmente para objetivos mais complexos talvez Arduino não fosse tecnologia suficiente. É um bom projeto de pesquisa no ensino médio e/ou técnico, envolvendo fatores tecnológicos e de física simultaneamente.', 7, true);
INSERT INTO public.revisao VALUES (357, 104, 733, 'Não ficou claro qual o intuito da pesquisa. Após a obtenção dos resultados, o que se pretende? Logo, sugiro que verifiquem os objetivos do trabalho e o que se pretende alcançar, pois não está claro.', 6.25, true);
INSERT INTO public.revisao VALUES (355, 70, 546, NULL, 9.5, true);
INSERT INTO public.revisao VALUES (350, 156, 457, NULL, 8.5, true);
INSERT INTO public.revisao VALUES (376, 188, 87, 'Projeto Feira Afiliada', 7.5, true);
INSERT INTO public.revisao VALUES (375, 188, 86, 'Projeto oriundo da III FEMUCITEC', 7.5, true);
INSERT INTO public.revisao VALUES (133, 101, 530, 'Projeto muito interessante, mas considero existir simplificações para uso em pesquisa de nível médio. Na verdade para este projeto ser levado à prática existem outros diversos fatores a considerar para estabelecer o tempo de rega, desde fatores fisológicos da planta até fatores de cálculo da evapotranspiração potencial dependendo do tipo de planta e do tipo de produção, tipo de solo, etc. Mas simplificações podem ser contempladas, até para ter primeiras aproximações de resultados. Acredito que este projeto pode render dados interessantes para ajustar a metodologia.', 7.25, true);
INSERT INTO public.revisao VALUES (151, 151, 530, 'Este projeto tem objetivos bem definidos, apresentada de maneira sucinta a metodologia, mas na realidade existem diversos fatores para uma boa amostragem que dificilmente serão razoavelmente executados por um robô com um orçamento curto. São diversos fatores para a escolha do local no processo de amostragem de solo que se baseiam em conhecimento de vários assuntos relacionados na área agronômica. Para isto a base de conhecimento que este robô deverá ter é algo complexo, a não ser que um técnico decida antes onde coletar e o robô seja levado remotamente ao local escolhido. Tem a retirada de matéria orgânica superficial e a vegetação, que possivelmente o robô não terá condições de fazer de maneira adequada. Decidir o número de amostras dependendo da variabilidade do terreno, etc, etc. Enfim, um projeto interessante mas que tem muitas variáveis a ajustar e pensar como implementar.', 7, true);
INSERT INTO public.revisao VALUES (125, 172, 530, 'Projeto no qual faltam estabelecer questões metodológicas, objetivos claros, resumo não bem estruturado e com lacunas que dificultam a compreensão. Não tem resultados esperados claros. Não vejo no projeto, que fatores da vida do cientista possam ser relevantes no projeto, conforme descreve: &#34;este trabalho apresenta os aspectos da vida de Nikola Tesla e a construção didática de uma Mini bobina de Tesla com o objetivo de instigar para refletir sobre o uso convencional das tecnologias que possuímos hoje...&#34;. A construção da bobina é um ótimo experimento na área técnica, transformar eta prática experiencial numa pesquisa me parece que deve evoluir um pouco mais o projeto, definir melhor as questões citadas acima, mostrando alguns resultados ou definindo resultados potenciais.', 4.75, true);
INSERT INTO public.revisao VALUES (117, 68, 530, 'Projeto ambicioso para pesquisa de nível médio ou técnico. Faltou uma melhor definição da metodologia a adotar. Não está claro em que fase está o projeto, se é uma revisão bibliográfica, simulador experimental ou já em testes o protótipo de veículo propriamente dito. Como aparentemente pela leitura do resumo, o escopo do projeto não está totalmente fechado, vejo que existem variáveis ainda não bem definidas, e que dependem de resultados de testes para implementar. Seria interessante ver resultados dos estudos de: carga máxima e deformações em aplicação de carga.', 8.25, true);
INSERT INTO public.revisao VALUES (342, 149, 918, NULL, 9.25, true);
INSERT INTO public.revisao VALUES (348, 167, 542, 'O trabalho está muito bem descrito, tema de pesquisa está corretamente definido e com objetivo bem traçado. O projeto é totalmente aplicável e relevante para a comunidade científica. O título apresenta algumas letras em caixa alta e baixa. Isso deve ser corrigido.', 10, true);
INSERT INTO public.revisao VALUES (55, 186, 542, 'O titulo está de acordo com o resumo. O problema da pesquisa deveria ser melhor elaborado assim como a justificativa. A metodologia e a conclusão foram bem descritas.', 8.25, true);
INSERT INTO public.revisao VALUES (317, 77, 542, 'O título do projeto apresenta algumas letras em caixa alta e caixa baixa, isso deve ser corrigido. As palavras chave estão adequadas. Faltou detalhar o problema da pesquisa. Os objetivos e a metodologia estão corretamente definidos.', 9.25, true);
INSERT INTO public.revisao VALUES (33, 79, 93, 'Os resultados dos jovens poderiam ser descritos com uma melhor análise destes.', 8.5, true);
INSERT INTO public.revisao VALUES (109, 62, 93, 'Poderiam ter acrescentados dados sobre as entrevistas e explicado melhor a metodologia. Mesmo assim, o tema é relevante e precisa ser abordado. Homologado', 8.25, true);
INSERT INTO public.revisao VALUES (167, 44, 537, 'O quesito &#34;metodologia&#34; está pouco contemplado no resumo, visto que os autores relatam a utilização de &#34;atividades em que o aluno possa efetivamente realizar trocas afetivas e intelectuais com professores e colegas&#34;; Isto é posto de forma muito ampla e abrangente, devendo os mesmos delimitarem de fato quais foram as atividades utilizadas bem como qual a dinâmica e os requisitos aplicados no momento de classificação dos brinquedos e brincadeiras. A oração &#34;Pesquisado brinquedos usados por gerações passadas&#34; também precisa de ajustes, visto que está em discordância semântica com o restante do texto. Outro aspecto importante a ser delimitado nesta oração é qual o período que engloba estas gerações, gerações da década de 90? 80? 70?', 6.75, true);
INSERT INTO public.revisao VALUES (323, 102, 927, 'O texto contempla um relato da história e não apresenta os itens para se configurar um projeto de pesquisa.', 1.75, true);
INSERT INTO public.revisao VALUES (113, 72, 925, 'O título fala em &#34;compartimento&#34;. No entanto, esse termo parece um pouco vago. Só percebe-se que os autores referem-se a dispositivos como cofres ao longo do texto. O texto permite compreender a essência das ideias dos autores. Porém há muitos problemas de redação que tornam o texto pouco claro, dificultando a compreensão do problema, dos objetivos, método e resultado. Questões que permanecem sem esclarecimento: o problema enfrentado pelos autores são os cofres com pouca mobilidade ou com pouca/nenhuma forma de controle de acesso?', 5, true);
INSERT INTO public.revisao VALUES (8, 82, 546, 'Pelo resumo percebe-se que é um excelente trabalho, muito importante no contexto dos IFes. Vida longa a este projeto.', 10, true);
INSERT INTO public.revisao VALUES (356, 104, 119, 'O resumo apresenta uma pesquisa muito interessante. Entretanto, acredito que maiores detalhes sobre a mudança de nomenclatura dos cursos seja necessária.', 7.75, true);
INSERT INTO public.revisao VALUES (353, 73, 119, 'O texto do resumo apresenta metodologia quantitativa e referenciais vagos. Há inúmeros erros de apresentação em língua portuguesa. Sugiro uma profunda revisão textual. Resta saber também qual seria a aplicação do resultado da pesquisa.', 6, true);
INSERT INTO public.revisao VALUES (101, 158, 508, 'O título pode ser melhorado a fim de chamar mais atenção para o trabalho, e os resultados, ainda que parciais, também podem ser descritos com mais clareza. Ao todo o trabalho está coerente com um tema criativo e interessante.', 9.5, true);
INSERT INTO public.revisao VALUES (57, 187, 508, 'O tema é bastante interessante, aborda uma problemática ambiental e econômica. O projeto foi bem delineado e apresenta coerência no conjunto da obra.', 10, true);
INSERT INTO public.revisao VALUES (304, 40, 554, 'Na escrita do resumo, revisar a pontuação, o emprego da crase e a repetição de palavras.', 7.75, true);
INSERT INTO public.revisao VALUES (345, 169, 554, 'É preciso contextualizar os dois eventos citados no título, delimitar mais claramente os objetivos, reformular a justificativa e expor a metodologia utilizada. Também faz-se necessária uma revisão completa na escrita do resumo, com adequações gramaticais, ortográficos e mesmo de registro.', 2.25, true);
INSERT INTO public.revisao VALUES (189, 97, 558, 'O trabalho atende a todos os critérios definidos em um texto claro e objetivo.', 9.5, true);
INSERT INTO public.revisao VALUES (225, 109, 506, 'Não informou como está o andamento da rede social, visto que esse é o objetivo da proposta do projeto', 9.25, true);
INSERT INTO public.revisao VALUES (243, 4, 558, 'O tema é relevante, entretanto o projeto dá poucas informações. Não há descrição da metodologia de criação ou aplicação. Quanto aos resultados cita que forma excelentes mas não identifica ou exemplifica.', 8, true);
INSERT INTO public.revisao VALUES (273, 137, 558, 'A proposta é interessante mas não se configura como um projeto de pesquisa, faz somente uma descrição da criação de uma aplicação web para fotógrafos. Sugiro que solicite ao autor adequar a proposta, incluindo metodologia, objetivos bem definidos e resultados esperados.', 4, true);
INSERT INTO public.revisao VALUES (241, 33, 558, 'O texto está claro, objetivo e bem estruturado e a pesquisa é de muita relevância.', 10, true);
INSERT INTO public.revisao VALUES (59, 39, 239, 'Não é um projeto de pesquisa, apenas uma construção que demonstra a pressão hidrostática por meio de articulações. A proposta é interessante para feira, pois é uma demonstração educativa e com potencial aplicação em diferentes áreas tecnológicas.', 3, true);
INSERT INTO public.revisao VALUES (107, 182, 720, 'Faltou detalhar melhor os objetivos e a metodologia do trabalho.', 6.5, true);
INSERT INTO public.revisao VALUES (60, 39, 106, 'O resumo poderia ser melhor escrito para evidenciar a importância do estudo e a natureza do experimento. Apesar de não ser convidativo, acredito que o grupo merece estar na feira para mostrar seu trabalho.', 5.75, true);
INSERT INTO public.revisao VALUES (100, 144, 523, 'Colocar mais informações no título; informar o que a proposta traz de bom levando em conta o ambiente escolar.', 7, true);
INSERT INTO public.revisao VALUES (46, 89, 531, 'O trabalho apresenta um título muito interessante, mas no decorrer do texto não fica claro como os autores pretendem &#39;ampliar&#39; o tema depressão. O objetivo do trabalho está confuso e misturado com uma possível hipótese. A metodologia é adequada e os resultados são interessantes, mas não estão bem estruturados no texto. A citação da OMS é interessante e acredito que tenha sido bem explorada pelos autores. A finalização do trabalho (considerações finais), está um pouco confusa, não remete ao título e objetivo, soa um pouco como repetição da introdução. Não demostra toda a importância do tema que os autores querem abordar.', 5.25, true);
INSERT INTO public.revisao VALUES (94, 96, 531, 'O trabalho é bem claro e foi bem executado. Achei muito interessante o assunto abordado e a linha de pensamento dos autores. Os autores poderiam ter colocados mais um ou duas palavras-chaves o que poderia chamar mais atenção para o trabalho em buscas.', 8.25, true);
INSERT INTO public.revisao VALUES (171, 80, 537, 'O resumo não apresenta todos os fatores necessários para a caracterização de um projeto de pesquisa visto que expõe apenas o tema e os objetivos do projeto. Há escassez na justificativa, não apresenta metodologia bem como não delimita o campo onde será realizada a pesquisa (Na comunidade? Na escola?) É necessário definir também qual o público alvo deste projeto. Somente mulheres irão participar? Qual a idade dos indivíduos pesquisados?', 4.25, true);
INSERT INTO public.revisao VALUES (53, 159, 658, 'O trabalho está vinculado a um projeto de ensino. O trabalho se propõe a construir um relógio solar e o objetivo compreendido a partir do resumo é apenas compreender seu funcionamento e aprender/ensinar a montar um.', 2.5, true);
INSERT INTO public.revisao VALUES (17, 69, 529, 'O autor expressou o objetivo da prática em sala de aula, e não o objetivo do trabalho para o IFCITEC que, ao meu ver, deve ser &#34;relatar a condução de pesquisas científicas no ensino fundamental&#34;, e não de &#34;orientar os alunos sobre a condução de pesquisas&#34;. Acredito que o objetivo destacado no resumo seria um dos objetivos específicos no projeto. Apesar do objetivo apresentado no resumo estar confuso, compreendi o objetivo do autor, e compreendo a relevância de se apresentar a experiência no evento OFCITEC, promovido pelo IFRS, tendo em vista demonstrar ser possível trabalhar com a iniciação científica desde as séries iniciais, de forma a possibilitar a construção do conhecimento.', 6.75, true);
INSERT INTO public.revisao VALUES (74, 6, 261, 'O resumo não deixa claro o período de execução do projeto, pois traz datas como 2009, 2010 e 2008. O autor pode esclarecer, a partir da exposição da metodologia, como o projeto vem ocorrendo desde 2008 até o momento. Embora cite metodologias utilizadas, não menciona periodicidade. O objetivo apresentado menciona a divulgação de pesquisas na área proposta e não se relaciona com as metodologias utilizadas para o ensino de física. Em resumos não deve haver citação.', 2.75, true);
INSERT INTO public.revisao VALUES (265, 120, 925, 'Projeto interessante. A redação carece de melhorias que, se implementadas, trarão importantes acréscimos à interessante iniciativa relatada.', 7.5, true);
INSERT INTO public.revisao VALUES (98, 143, 543, 'Acredito que é importante destacar que é um projeto para o ensino fundamental. Também seria importante destacar o porquê de fazer este modelo de respiração pulmonar (facilita a compreensão, palpável, etc).', 5.75, true);
INSERT INTO public.revisao VALUES (321, 99, 924, 'Penso que poderia ser feita uma pesquisa com o nível o superior visto que se fala na questão do Ensino Superior, em nenhum momento foi mencionado as cotas é uma forma de diminuir essa desigualdade', 8.5, true);
INSERT INTO public.revisao VALUES (181, 55, 924, 'Nas palavras chaves não aparece a questão das doenças, no texto isso aparece com certa relevância sugiro que no titulo também mencione.', 7.5, true);
INSERT INTO public.revisao VALUES (215, 29, 925, 'A palavra &#34;Haicai&#34; não é de domínio de grande público. Sugere-se uma modificação no título e/ou a definição desse termo ao longo do texto.', 5.25, true);
INSERT INTO public.revisao VALUES (35, 47, 923, 'O tema é interessante e relevante. No entanto, a amostragem é pequena para maiores conclusões.', 8, true);
INSERT INTO public.revisao VALUES (83, 66, 923, 'Trabalho interessante para a disciplina de ciências. O resumo indica que o objeto principal do trabalho desenvolvido foi a criação de um aplicativo com receitas nutritivas com produtos considerados sobras na cozinha, como cascas de vegetais. Nesse contexto entrou o feitio do salgadinho, que parece ter sido o início, mas que tornou-se secundário. Seria mais coerente focar mais na receita do salgadinho ou mudar o foco para o aplicativo.', 5.75, true);
INSERT INTO public.revisao VALUES (121, 157, 925, 'O texto merece uma revisão em aspectos relacionados à ortografia, concordância etc. O título contém termos que não são de domínio do público em geral, como &#34;arduino&#34; e &#34;switcher looper&#34;. Sugere-se alterar para algo mais genérico.', 5.25, true);
INSERT INTO public.revisao VALUES (136, 87, 204, 'Apenas uns poucos erros de ortografia.', 7.75, true);
INSERT INTO public.revisao VALUES (349, 156, 217, 'Caro aluno, parabéns pela iniciativa. Seu trabalho apresenta uma proposta bastante interessante e que pode sim auxiliar a organização de eventos, entretanto recomendo que você revise alguns pontos como: A descrição do trabalho apresenta-se de forma vaga em alguns pontos, é preciso descrever melhor o por quê fazer, como fazer, de que forma fazer e o que se espera alcançar, ou seja, problema de pesquisa, justificativa, metodologia e resultados. Consegui entender o que você quer fazer, porém uma melhor descrição, ajuda o leitor comum, entender o que você pretende.', 5.5, true);
INSERT INTO public.revisao VALUES (316, 65, 223, 'O resumo como um todo está coerente e apresenta todas as etapas do projeto de pesquisa.', 9.75, true);
INSERT INTO public.revisao VALUES (344, 176, 223, 'O texto do resumo encontra-se coerente. No entanto, apresenta diversos problemas de revisão textual.', 8.75, true);
INSERT INTO public.revisao VALUES (372, 164, 87, NULL, 8.5, true);
INSERT INTO public.revisao VALUES (144, 116, 437, 'Com relação ao item &#34;Considerando o título, objetivos, metodologia e resultados, há coerência&#34; o resumo do projeto não foi considerado ótimo apenas pela falta de resultados esperados ou conclusões parciais', 8.25, true);
INSERT INTO public.revisao VALUES (358, 125, 437, 'O título do sistema não é suficiente como título do projeto por não transmitir sobre o que se trata. É preciso complementá-lo com a proposta do sistema após o nome do mesmo. Sugestão: “TAIDEFIM: Teclado Adaptado para Deficientes Físicos e Mentais”. Sugere-se também verificar se o termo Deficiente no nome do sistema e nas palavras chaves deve ser substituído por “portador de necessidades especiais”.', 8.5, true);
INSERT INTO public.revisao VALUES (150, 136, 437, 'O resumo do projeto leva muito tempo para dizer o porque de criar o carro robótico, no caso, criar um veículo controlado via wireless para mover peças em locais de difícil acesso. É interessante que isto seja incorporado de alguma maneira também no título do trabalho', 8.5, true);
INSERT INTO public.revisao VALUES (58, 187, 562, 'Poderia evidenciar o tipo de pesquisa para definir melhor o método, quasi experimental?', 8.25, true);
INSERT INTO public.revisao VALUES (343, 176, 932, 'Revisão de português. Com destaque para o seguinte trecho &#34; Fizemos também a leitura do Conhecendo esses fatos vamos procurar e fazer uma leitura das diversas notícia&#34;', 6.25, true);
INSERT INTO public.revisao VALUES (373, 126, 86, 'A pesquisa trata de assunto muito relevante e necessário, que é a desigualdade de gênero e raça nas carreiras científicas. No entanto, penso que seria possível atingir melhores resultados se o escopo da pesquisa, ao invés de Brasil, fosse o Rio Grande do Sul. No mais, parabéns aos jovens pesquisadores e pesquisadoras.', 8.75, true);
INSERT INTO public.revisao VALUES (362, 80, 86, 'O resumo do projeto não deixa claro qual a metodologia adotada e qual o resultado esperado pela pesquisa. Depois de analisar o livro, como serão verificados se os adolescentes da comunidade sofrem influência dessa ditadura?', 5.5, true);
INSERT INTO public.revisao VALUES (365, 44, 86, 'O projeto parece muito interessante e trata de um assunto bastante comentado atualmente. A escrita do resumo, no entanto, não deixa muito claro quais são, de fato, os objetivos, a metodologia e os resultados que se espera.', 7.75, true);
INSERT INTO public.revisao VALUES (366, 76, 86, 'Há coerência e mérito no projeto, mas ele não configura um projeto de pesquisa e, sim, pelo que dá a entender, um projeto de extensão. Assim, a metodologia, os objetivos e os resultados esperados não estão em acordo com o esperado para a IFCITEC.', 5.25, true);
INSERT INTO public.revisao VALUES (371, 54, 86, 'O projeto tem mérito e parece ter sido bem desenvolvido, no entanto, não fica claro quais os objetivos e os resultados esperados. Penso que isso se deve à redação do resumo que poderia ser mais focado nessas questões. No mais, desejo uma excelente apresentação se o projeto for homologado.', 7.75, true);
INSERT INTO public.revisao VALUES (380, 189, 87, 'Projeto Feira Afiliada', 7.5, true);
INSERT INTO public.revisao VALUES (381, 247, 86, 'O trabalho é interessante e de temática relevante. Não fica claro o que motivou os alunos a pensarem nessa problemática: o uso do celular é um problema na escola? Pq a matemática? A metodologia está excelente, parabéns! Com relação aos objetivos: talvez seja difícil conseguir &#34;medir&#34; a influência do uso dos aplicativos no ensino da matemática devido ao curto espaço de tempo. Talvez fosse mais adequado pensar em tempos de motivação para a aprendizagem. Bom trabalho para vcs!', 8.5, true);
INSERT INTO public.revisao VALUES (420, 253, 1212, 'Primeiramente, gostaria de parabenizar os autores pelo trabalho! O tema é atual e relevante para sociedade. O número alarmante de jovens com transtornos neuropsiquiátricos deve ser amplamente discutido, assim como os problemas relacionados ao sedentarismo. O trabalho está bom e possui mérito científico. A seguir, adiciono alguns pontos à refletir e algumas dicas e sugestões, que talvez possam auxiliar os autores em trabalhos futuros. De antemão peço desculpas pelo “textão” e reitero que não críticas negativas, mas observações que possam contribuir com o desenvolvimento do trabalho e dos pesquisadores. Mesmo estando um tanto quanto longo, o título do trabalho está adequado. O recomendado é não utilizar no tópico de palavras-chave nenhuma palavra que esteja no título do trabalho. Em relação à justificativa: este item poderia ser melhor explorado, faltou os autores indicarem brevemente alguma evidência de que estes dois fatores estão associados, indicando assim que a realização do trabalho possui algum respaldo lógico. A delimitação do tema está precisa e as estimativas no início do resumo são um ponto positivo no estudo. Sobre o objetivo geral do trabalho: este item deve conter uma “palavra de ação” no infinitivo (ex: verificar, estudar, analisar, e como foi utilizado, estabelecer..) e deve indicar, de fato, o que pretende-se estudar. A forma como foi descrita no resumo remete quase a uma hipótese de pesquisa: a frase passa a impressão de que os autores acreditam veemente que encontrarão uma relação entre a ausência de atividade física e a ocorrência de transtornos neuropsiquiátricos. O fato de que talvez em outras populações esta relação foi estabelecida não garante que este mesmo tipo de associação seja encontrada na população de estudo dos autores. Desta forma, o real o objetivo do trabalho é verificar se há associação entre o sedentarismo e a ocorrência de transtornos neuropsiquiátricos na população de estudo. A metodologia poderia ser escrita de forma mais enxuta, pois há detalhes desnecessário em um resumo. Porém, mesmo estando longa, está faltando detalhes importantes para a compreensão do estudo. Uma informação importante que está faltando no resumo é o número de indivíduos que responderam o questionário. Seria interessante trocar o termo “internet” por uma frase que indique que os adolescentes responderam um formulário disponível em meio eletrônico. Não é recomendado escrever em um resumo o nome da empresa, a citar a IBM e o Google. Alguns pesquisadores alegam que isto poder ser interpretado como propaganda. De forma geral, poderia ser escrito que os dados foram analisados no programa (ou “software) SPSS (a versão do programa, empresa e a localização da mesma devem ser sim descritos, mas apenas no trabalho completo). Os autores indicaram que utilizaram um programa para análises estatística, porém, não descreveram quais testes foram empregados na análises dos dados. Essa informação é (utilizando uma figura de linguagem) extremamente importante! Neste tipo de estudo de associação, realizar (e citar) qual teste foi empregado serve para indicar o “grau de credibilidade” dos dados. Um “valor de p” indicaria se a associação encontrada é estatisticamente relevante. A conclusão, a partir de um estudo de associação só pode ser estabelecida por meio de resultados de estatística inferencial. Sugiro também que os autores trabalhem melhor na forma de descrever e discutir os resultados. A primeira frase dos resultados ficou bem escrita, porém a última ficou um pouco vaga. Como dicas gerais, recomendo observar a concordância verbal e o uso de figuras de linguagem. Diferentemente de outras áreas de estudo, a e escrita acadêmica, na área de ciências biológicas/saúde é extremamente objetiva, chegando quase a soar “quadrada”, e portanto, é recomendado manter a escriva de forma clara, sem a utilização de termos rebuscados. Além disso, é importante cuidar para não escrever parágrafos muito extensos. Por fim, gostaria de dizer que o estudo possui grande potencial, com alguns ajustes e detalhes, há a possibilidade de criarem um artigo original e publicarem em alguma revista científica.', 6.5, true);
INSERT INTO public.revisao VALUES (401, 240, 555, 'Trabalho muito importante de ser desenvolvido no ensino fundamental. Parabéns pela iniciativa.', 8.25, true);
INSERT INTO public.revisao VALUES (761, 253, 86, 'O tema da pesquisa é muito relevante, bem como sua justificativa. No entanto, a metodologia poderia ter sido melhor explicada em relação aos resultados encontrados. Não fica claro se os objetivos foram atingidos, pela forma como o resumo foi escrito. Sugiro que ele seja revisado para submissões em outras feiras, de forma que fique mais claro e objetivo. Parabéns pelo tema!', 7.75, true);
