INSERT INTO public.revisao VALUES (432, 280, 522, 'Sugiro apenas uma alteração na frase &#34;Com tais resultados, pode-se perceber que o cabelo é eficaz no tratamento de águas contendo películas de óleo e pode ser uma alternativa mais barata e mais ecológicas que as esponjas já existentes no mercado mundial&#34; para &#34;com tais dados, há evidências que sugerem uma forte relação entre a utilização da fibra capilar no tratamento de águas contendo películas de óleo, o que poderá reduzir os custos em relação aos processos que utilizam outros métodos como esponjas. Razão: a ciência está em constante descoberta. Evita-se afirmar , mas sugerir relação ou correlação, já que outros trabalhos poderão ser feitos, sustentando o refutando. Chama-se de &#34;humildade científica&#34;.', 10, true);
