INSERT INTO public.revisao VALUES (637, 357, 1101, 'Somente FRAP para atividade antioxidante in vitro? Sugiro teste hidroxil, capacidade quelante de ferro, DPPH, TBARS in vitro como avaliações iniciais. Sempre comparado a um antioxidante padrão. O projeto menciona que serão feitos estes de inibição da enzima alfa-glicosidase e ao mesmo tempo na conclusão afirmam ter feito. Por gentileza, esclarecer. Ainda na questão da enzima, como serão feitos estes testes para avaliar a inibição? O projeto fala em tratamento do TIIDM, mas não encontrei nenhuma abordagem que utilizará modelos in vivo que são mais adequados para a questão proposta.', 6, true);
INSERT INTO public.revisao VALUES (616, 350, 86, 'Pesquisa cujo tema é muito relevante. Não fica claro no resumo qual as características da população investigada, pois o resumo se refere apenas a maioria como sendo jovem entre 15 e 20 anos. Pessoas de outras idades responderam o questionário? Se sim, porque a pesquisa abordou no título os jovens? Onde o formulário ficou disponível? No mais, acredito que a pesquisa contribui com a discussão da doença no âmbito escolar.', 7.75, true);
INSERT INTO public.revisao VALUES (702, 250, 528, NULL, 10, true);
INSERT INTO public.revisao VALUES (453, 281, 517, 'O resumo deve ter uma abordagem mais científica, pois do modo como está configurado parece ser mais uma pesquisa escolar do que um projeto de pesquisa. Minha sugestão é que pesquisem um pouco mais sobre como elaborar projetos de pesquisa.', 4, true);
INSERT INTO public.revisao VALUES (629, 327, 517, 'Pesquisar mais sobre a organização de um resumo, principalmente em projetos de pesquisa. Obs: os objetivos específicos (como foram descritos) não são apresentados no resumo. Vale ressaltar que o tema é de extrema relevância.', 7, true);
INSERT INTO public.revisao VALUES (509, 349, 517, '&#34;Nossos objetivos&#34; (listas de objetivos) Não soa bem em um projeto. Pesquisar mais sobre o que deve conter num resumo de um trabalho acadêmico. Sugestão: Sendo assim, pretende-se investigar sobre a média do fluxo menstrual, identificando os absorventes usados... &#34;Faremos&#34; (listas de ações) - idem ao comentário anterior. Sugestão: Neste sentido, será realizado um levantamento de dados e pesquisas...', 7, true);
INSERT INTO public.revisao VALUES (680, 205, 1107, 'Em nosso artigo abordamos a Segunda Guerra Mundial, conflito que ocorreu entre os anos de 1939 e 1945 dividindo o mundo entre Aliados (Estados Unidos, União Soviética, Inglaterra, França e os demais países que se integraram) e Eixo Berlim-Roma-Tóquio. CUIDADOS COM AS EXPRESSÕES: EM NOSSO ARTIGO, UTILIZAR SEMPRE A FORMA IMPESSOAL. nos interessamos SEGUNDA GUERRA MUNDIAL: A GUERRA EM HOLLYWOOD - Repetição do termo guerra. verificar. Sugestões - A Segunda Guerra Mundial nas telas de HOLLYWWOD. Em termos metodológicos, nossa pesquisa está fundamentada na análise dos filmes Até o último homem e Corações de Ferro e de livros e artigos (ARNAUT, MOTTA; FERRO; REIS FILHO, FERREIRA, ZENHA; LOPEZ; PADRÓS, RIBEIRO, GERTZ). QUAL O TIPO DE ANÁLISE METODOLÓGICA? HERMENÊUTICA, BIBLIOGRÁFICA, ETONOGRÁFICA? - UTILIZAR OS VERBOS NA TERCEIRA PESSOA DO SINGULAR OU PLURAL.', 6.5, true);
INSERT INTO public.revisao VALUES (672, 242, 522, NULL, 10, true);
INSERT INTO public.revisao VALUES (493, 275, 522, 'Dentre outros problemas como correção gramatical, o mais grave é a falta de foco no estudo. Ora, dá-se muita atenção à dessalinização, ora ela posta como algo menor quando comparada com a filtragem da água. Não fica claro para o leitor qual o rela foco do trabalho diante das idas e vindas da argumentação. Recomenda-se, ainda, o uso impessoal da linguagem. Evitem o &#34;eu&#34; ou o &#34;nós&#34;. Exemplo: ao invés de iremos apresentar, prefiram será apresentado....', 5, true);
INSERT INTO public.revisao VALUES (454, 276, 92, 'O resumo apresenta muitas frases a serem revistas: No modelo A as bandejas foram cobertas individualmente POR um saco de tecido voil... (inclusão de &#34;por&#34;). Além disso, o tecido... (inclusão da vírgula). Após o início a emergência (sem sentido). NO segundo método avaliado, Modelo B, não é feita a aspiração das mariposas (Alteração de O por No).', 8.25, true);
