INSERT INTO public.revisao VALUES (698, 257, 434, NULL, 9.25, true);
INSERT INTO public.revisao VALUES (422, 202, 1437, 'Muito interessante o trabalho. Penso que seja importante dar um bom contexto histórico na apresentação, pois em ocasiões as pessoas possuem poucos conhecimentos sobre a conjuntura da época, e as vezes até limitados aos relatos dos filmes.', 9.5, true);
INSERT INTO public.revisao VALUES (644, 285, 92, 'O projeto apenas altera a forma de transporte do medicamento, não inclui nenhuma segurança extra no processo. Entendo que poderia se utilizar tecnologias mais avançadas, comunicando (IoT) a identificação dos pacientes (em cada quarto) com a identificação da receita para correta e automatizada distribuição. Além disso, a necessidade de trilhos aéreos requer um investimento em obras. Robôs (a exemplo dos robôs da Amazon) poderiam fazer este processo sem alterar a infraestrutura do hospital.', 6.5, true);
INSERT INTO public.revisao VALUES (662, 214, 92, 'A identificação da instituição e de membros da equipe não deve aparecer no resumo. Não se fala em como uma placa pode &#34;proporcionar a melhora de habilidades como: lateralidade e motricidade fina e ampla&#34;. A obtenção será feita a partir de um processo de sobreposição, onde os retalhos foram... (Futuro ou passado?).', 5.75, true);
INSERT INTO public.revisao VALUES (690, 332, 92, '&#34;A pesquisa está sendo elaborado&#34;', 5.5, true);
INSERT INTO public.revisao VALUES (599, 267, 92, 'Não se indica como se obterá um modelo de baixo custo. Limitou-se a expor objetivos.', 4.25, true);
INSERT INTO public.revisao VALUES (678, 229, 1437, 'O trabalho parece muito interessante. No resumo não fica muito clara a relação entre os sintomas que o questionário apresentava e quais as enfermidades relacionadas a eles, penso que seja necessário esclarecer mais isso na apresentação.', 8.25, true);
INSERT INTO public.revisao VALUES (460, 341, 1112, 'Sua proposta é muito interessante, e, sua redação está coerente e clara. Porém, seria de melhor entendimento se você coloca-se de modo explícito os itens centrais de sua pesquisa, como problema e justificativa. Além disso, nos resultados gostaria de saber o andamento da pesquisa, até que fase ela já foi desenvolvida. E por tratar-se de uma pesquisa científica cuidado com termos genéricos como &#34;normalmente&#34; ou &#34;frequentemente&#34;. De atenção a ortografia e a gramática, mas foram pequenos detalhes, como: &#34;foi elaborado e aplicado uma pesquisa de opinião&#34; serei &#34;...foi elaborada uma pesquisa&#34;; e também cuidado com a repetição de termos, como &#34;professor&#34;, pode ser substituído por docente, eles, estes, ou um pronome oblíquo.', 7, true);
INSERT INTO public.revisao VALUES (710, 307, 1112, 'A proposta da sua pesquisa é extremamente relevante, porém o modo como você organizou e redigiu seu resumo atrapalha a compreensão da mesma. Tenha mais cuidado com a estrutura das frases, existem situações onde as ideias não estão acabas. O modo como foi redigido o objetivo o torna problemático, &#34;o objetivo estabelecido pelo projeto foi de promover &#34; atenção aos verbos, por exemplo estabelecido pelo projeto, quem tem capacidade de estabelecer é o projeto ou os sujeitos? Quanto a metodologia foram descritas as ações, porém não foi explicitada nenhuma metodologia científica que as embasem, metodologia de coleta de dados, de analise, método de registro. As palavras chaves, cuidado elas devem ter coerência clara no resumo, a gamificação ficou apenas subentendida, você pode suprimi-la das palavras chaves ou trazê-la para o texto. Em resumo não se colocam citação, por favor reescrever as frases relacionadas e retirar o &#34;(Rocha, 2010)&#34;. Na frase &#34;cerca de 60% das retenções no curso&#34;; Qual curso? Destaco, a pesquisa é pertinente, porém o resumo precisa ser reescrito com bastante atenção.', 5.25, true);
INSERT INTO public.revisao VALUES (624, 318, 1112, 'O tema de estudo é pertinente e seus resultados ao atingir diretamente os sujeitos são louváveis. Porém, no resumo não consegui observar a estrutura de um projeto de pesquisa, apenas uma descrição da realidade. Seu texto está bom, com pequenos erros de ortografia e gramática. Mas, sugiro que ele seja reescrito, que sejam apresentados, de modo claro, tema, problema, objetivo, metodologia e justificativa.', 5, true);
INSERT INTO public.revisao VALUES (546, 271, 504, 'O trabalho é bastante interessante e relevante. Chegou a ser analisada a viabilidade econômica desta solução? Há alguma estimativa da duração desta solução temporária? Parabéns pelo trabalho!', 7.25, true);
INSERT INTO public.revisao VALUES (571, 243, 1112, 'Parabéns, seu projeto tem um grande alcance social, o resumo está bem escrito e as ideias centrais foram bem apresentadas. Sugiro suprimir as fontes que estão entre (), porque não se usa citações em resumos. E melhorar a frase sobre os objetivos, para dar mais destaque a questão de tamanha relevância. Outra questão, não é obrigatório colocar os itens exigidos ( tema, problema, objetivo, justificativa, metodologia e resultados) de forma explícita, mas isso traz segurança ao leitor, é apenas uma sugestão para futuros trabalhos.', 7.75, true);
INSERT INTO public.revisao VALUES (586, 315, 504, 'A temática é muito importante e relevante! Parabéns pela iniciativa! O resumo poderia trazer quais ações foram ou serão desenvolvidas, além da aplicação do questionário, para atingir os objetivos descritos.', 6.5, true);
INSERT INTO public.revisao VALUES (695, 246, 504, 'Pesquisa partindo das realidades e interesses dos estudantes. Parabéns!! Os estudantes são de qual ano? A pesquisa é vinculada a alguma disciplina? Sugeriria apenas que o título trouxesse mais informações sobre o trabalho de vocês.', 6.75, true);
INSERT INTO public.revisao VALUES (717, 317, 504, 'A temática é muito atual. Trabalho muito relevante e interessante. Vocês chegaram a concluir se temos atualmente um aumento dos casos ou apenas um aumento do número de diagnósticos? Quais ações foram desenvolvidas para esclarecer a comunidade escolar sobre esta característica e tratamentos.', 8, true);
INSERT INTO public.revisao VALUES (515, 238, 1112, 'Parabéns seu texto está muito bem escrito. Sugiro para outras escritas trazer explicitamente no texto os itens que devem compor o resumo, tema, problema, objetivos, justificativa e metodologia. Quanto as palavras chaves, será que a palavra aplicação é mais importante que tecnologia para o seu resumo?', 7.25, true);
INSERT INTO public.revisao VALUES (604, 230, 1435, 'Para que possa agregar valor e interesse a procura do trabalho, nas palavras chaves poderia ter mais uma palavra, sabemos que é vestuário adaptado e serve para esse público inclusivo, porem o que isso vai interferir ? Tem palavras no titulo que agrega nesse caso. Sobre a justificativa do trabalho, foram feitos levantamentos às necessidades e interesses dos envolvidos, mas quem escreveu o trabalho de onde surgiu essa necessidade, porque foi escrito esse trabalho? Acredito ter faltado a justificativa.', 9.25, true);
INSERT INTO public.revisao VALUES (480, 356, 1112, 'Sua pesquisa é interessante e o resumo a descreve de forma apropriada. Sugiro acrescentar o problema de pesquisa, trazer uma pergunta, pois entendo que seu tema seja interdisciplinar e abarque a leitura infantil e o interesse por ciências, por isso a pergunta eliminaria as dúvidas quanto ao recorte definido para pesquisa , delimitando melhor sua abrangência. Quanto aos objetivos é bom reescrever essa frase, tomando cuidado com os verbos. Por exemplo o verbo desenvolver, quem tem capacidade para desenvolver o aplicativo é o projeto ou os sujeitos pesquisadores? Quanto as palavras chaves, te questiono o se o tema é leitura infantil e interesse por ciências porque este segundo não foi destacado. Sugestão talvez trocar o letramento digital ou a gamificação pelo ensino de ciências, os dois utilizados estão dentro do mesmo grande tema que seria informática na educação.', 6.75, true);
INSERT INTO public.revisao VALUES (415, 226, 1076, 'Em relação a parte &#34;dos quais 16 possuíam estatísticas referente ao impacto&#34; sugiro alterar para &#34;dos quais 16 possuíam estatísticas referentes ao impacto&#34;. Em relação a parte &#34;Analisando estes dados, observou-se uma variação de 48,7% e 90,9% de aproveitamento nas iniciativas realizadas,&#34; não entendi a utilização das porcentagens. Porcentagens em relação ao que? Sugiro explicar um pouco (sucintamente) isso e, talvez, alterar para &#34;Analisando estes dados, observou-se uma variação de 48,7% a 90,9% de aproveitamento nas iniciativas realizadas,&#34; No geral, o resumo está bem escrito.', 9, true);
INSERT INTO public.revisao VALUES (597, 338, 1435, 'O projeto tem o objetivo de construir um triciclo, porem na descrição do resumo esquece de colocar se o mesmo foi devidamente construído e testado, somente mostra a intenção do mesmo, ainda assim no ultimo paragrafo coloca que é visada a adaptação do triciclo e avaliação do resultado pelo usuário e por um profissional da área fisioterapêutica e possíveis usuários. O projeto é descrito para uma criança específica e no fim se amplia para outros usuários, para isso precisamos ter o conhecimento se o instrumento de pesquisa foi positivo.', 9.25, true);
INSERT INTO public.revisao VALUES (464, 278, 1435, 'Por mais que o assunto seja polemico e amplo, não possui pesquisas concretas que possam se justificar e concluir tal contexto e afirmações de veracidade.', 1.25, true);
INSERT INTO public.revisao VALUES (384, 305, 95, 'Projeto de pesquisa bem estruturado e apresentando problemática é metodologia pertinente. Sugiro, apenas, pontuar com maior detalhamento os resultados esperados.', 8.5, true);
INSERT INTO public.revisao VALUES (400, 283, 95, 'O presente projeto, apensar de ter temática de grande valia para a sociedade e, especialmente, à comunidade discente, apresenta algumas questões que podem ser corrigidas. Destaco, primeiramente, a fragmentação de ideias causada pela pontuação utilizada pelo autor (há pontos onde poderiam ser colocadas vírgulas, por exemplo); igualmente, destaco a importância para a apresentação de possíveis resultados ou hipóteses de estudo.', 7.5, true);
INSERT INTO public.revisao VALUES (426, 259, 95, 'Seria interessante, também, pensar em um trabalho comparativo. Problematizar diferentes tipologias e perceber as formas como a temática do feminino é abordado, parece enriquecer a pesquisa.', 10, true);
INSERT INTO public.revisao VALUES (490, 274, 1076, 'Sugestões: 1) Acrescentar a palavra &#34;residências&#34; como palavra-chave; 2) A frase &#34;Dessa forma, conseguimos perceber que muitas pessoas têm bons hábitos. Os restaurantes entrevistados também têm uma maneira muito boa de lidar com os alimentos, diferente do que nós pensávamos, muitos já monitoram o desperdício de alimentos.&#34; tem teor subjetivo demais. Sugiro escrevê-la mais ou menos assim: &#34;Dessa forma, conseguimos perceber que, aparentemente, muitas pessoas preocupam-se com o disperdício de alimentos. Inclusive, muitos responsáveis por restaurantes monitoram monitoram tal disperdício em seus estabelecimentos&#34;. Essa sugestão vale tanto para o resumo em si (caso precisem utilizá-lo em outros locais e tiverem a oportunidade de reescrevê-lo) quanto para o dia da apresentação.', 9.75, true);
INSERT INTO public.revisao VALUES (781, 272, 86, 'Parabéns, excelente projeto!', 10, true);
INSERT INTO public.revisao VALUES (771, 362, 434, NULL, 9.5, true);
INSERT INTO public.revisao VALUES (572, 227, 86, 'A pesquisa é muito interessante e o assunto muito relevante. Sobre o título: criou a expectativa que o projeto abordaria todo o processo até a conclusão, mas pelo escrito, focou-se mais no acesso e, um pouco, na permanência. Os objetivos do estudo poderiam ter sido melhor abordados (geral e específico). No que tange à metodologia, quem respondeu aos questionários foram apenas os servidores que atuam nos núcleos? Não foi contemplado nenhum aluno NEE? Acredito que a pesquisa tenha sido extremamente rica, sugiro que o resumo seja construído de forma mais objetiva em submissões futuras. No mais, parabéns pela sensibilidade na escolha do tema.', 8, true);
INSERT INTO public.revisao VALUES (556, 220, 1076, 'Não é aconselhável utilizar expressões que evidenciam opinião no resumo e é preciso ter cautela ao escrever. Por exemplo: ao invés de &#34;uma profunda pesquisa bibliográfica foi realizada para obter o máximo de informações sobre o material e suas aplicações&#34; eu optaria por &#34;uma pesquisa bibliográfica foi realizada para obter informaçõe sobre o material e suas aplicações&#34;; em relação a frase &#34;64% das pessoas que participaram de uma pesquisa realizada no Google Forms desconhecem o grafeno, além disso, dentre todos os participantes 15% confundiram grafeno com grafite e cerca de 42% não sabem nada em relação às utilidades do grafeno.&#34; o ideal seria deixar claro por quem foi feita essa pesquisa e quantas pessoas responderam o questionário. Além disso, a expressão &#34;não sabem nada&#34; não é adequada. Prefira &#34;aparentemente desconhecem completamente&#34; ou &#34;ouviram falar do material mas nunca de suas utilidades&#34;', 8.75, true);
INSERT INTO public.revisao VALUES (606, 216, 86, 'A pesquisa traz um tema muito interessante e desperta o interesse em saber mais. O título poderia ser mais completo para dar maior noção sobre o conteúdo do projeto. Sugiro que o termo &#34;história de vida&#34; seja incluída como palavra-chave no lugar de construção, estratégia ou interação que são muito abrangentes. O projeto caracteriza um projeto de pesquisa? Marquei &#39;bom&#39; porque ele já inicia com algumas afirmações que fazem parte de seus objetivos, como se algo já fosse conhecido a priori, mas não fica claro como foi o processo de percepção de que os alunos desconhecem a sua história. Desejo boa conclusão da pesquisa!', 8, true);
INSERT INTO public.revisao VALUES (593, 264, 1076, 'Não entendi a frase &#34;Muits pessoas sabem que existem meios mais viáveis de não prejudicar o meio ambiente, do mesmo jeito não se interessam em trazê-los para suas vidas,&#34; tal vez o correto seria &#34;Muitas pessoas sabem que existem meios viáveis de não prejudicar o meio ambiente, porém não se interessam em pô-los em prática&#34;. Ao invés de &#34;Mas mesmo com esses materiais, não podemos jogar nenhum tipo na natureza&#34;, prefira &#34;Mas mesmo esses materiais devem ter o descarte adequado&#34;. Ao invés de &#34;não devemos jogar nenhum tipo de material no ambiente.&#34; prefira algo do tipo &#34;qualquer que seja o meterial, não devemos descartá-lo de qualquer maneira&#34;.', 8.25, true);
INSERT INTO public.revisao VALUES (638, 325, 86, 'Embora o assunto do projeto seja relevante, não é possível identificar os elementos essenciais solicitados nessa avaliação. O Ensino Fundamental é um amplo caminho de formação. Quais os anos que foram contemplados com a pesquisa? Faltam informações sobre o público alvo, portanto. Quais disciplinas foram contempladas? Faltam elementos para compreender o processo metodológico da pesquisa, bem como sua motivação/justificativa. O espaço do resumo deveria ter sido melhor aproveitado, tendo em vista que foram utilizados apenas 811 caracteres dos 1500 disponíveis. Infelizmente, a economia de palavras levou a uma insuficiente compreensão do projeto.', 4.5, true);
INSERT INTO public.revisao VALUES (735, 191, 1107, 'queremos entender - UTILIZAR O VERBO NA TERCEIRA PESSOA DO SINGULAR OU DO PLURAL. EXEMPLO: ENTENDE-SE...', 7.5, true);
INSERT INTO public.revisao VALUES (548, 301, 652, 'Acredito que seria importante detalhar mais como foi realizada a entrevista e quais resultados surgiram delas.', 7, true);
INSERT INTO public.revisao VALUES (730, 279, 223, 'O resumo está coerente, relatando textualmente todas as partes da pesquisa empreendida.', 10, true);
INSERT INTO public.revisao VALUES (649, 330, 86, 'Muito interessante o tema da pesquisa! Parabéns! Sugiro que o título contemple o conceito de paralisia do sono como, por exemplo, &#34;Preso nas alucinações: conhecendo a paralisia do sono&#34;. A metodologia poderia ter contemplado a incidência do distúrbio entre os alunos da escola para enriquecer os resultados encontrados.', 9, true);
INSERT INTO public.revisao VALUES (687, 343, 1076, 'Ao invés de &#34;Um tipo de cone responde à luz de cor vermelha, outro de cor verde, e um terceiro de cor azul.&#34; prefira &#34;Um tipo de cone responde à luz de cor vermelha, outro à luz de cor verde, e um terceiro à luz de cor azul.&#34; Não sei dizer se a crase está sendo usada de forma correta. Em relação à frase &#34;soma de todas as cores.&#34; o que quer dizer soma de cores? Seria algo como sobreposição de todas as cores? E como assim &#34;todas&#34;? Seriam todas as (3) primárias?; Não saberia dizer também se a palavra &#34;sombra&#34; não se encaixa como palavra-chave.', 8.5, true);
INSERT INTO public.revisao VALUES (729, 225, 86, 'A pesquisa apresenta tema bastante relevante e importante no contexto da ciência e dos direitos das mulheres ao reconhecimento de suas potencialidades. No entanto, o resumo, da forma como foi construído, deixa algumas dúvidas sobre os objetivos do projeto. Era objetivo conhecer a vida das mulheres que foram negligenciadas ao longo da história da ciência ou a percepção contemporânea sobre a história dessas mulheres? Observando o título, parece que a pesquisa se refere ao papel das mulheres e não a percepção de jovens a respeito. No entanto, quando observamos a metodologia, fica óbvio que o objetivo foi elucidar o quanto os jovens escolarizados conhecem sobre algumas mulheres expoentes no meio científico, bem como, propor soluções para possíveis correções de rota. Sugiro que estes aspectos sejam melhor costurados nas submissões posteriores, pois a pesquisa tem potencial e trata de assunto de boa visibilidade.', 8, true);
INSERT INTO public.revisao VALUES (602, 213, 445, 'Sugere-se escrita explicitando o problema de pesquisa em forma de pergunta, bem como o resumo inicia de forma vaga (&#34;a maioria das atividades...&#34;, de que tipo de atividades se refere? isso só é citado na sequência); poderia haver palavra-chave que traga a ideia da proposta da pesquisa, de prevenção.', 6.5, true);
INSERT INTO public.revisao VALUES (386, 293, 206, NULL, 6.5, true);
INSERT INTO public.revisao VALUES (738, 289, 206, NULL, 7.5, true);
INSERT INTO public.revisao VALUES (740, 320, 535, NULL, 8, true);
INSERT INTO public.revisao VALUES (595, 287, 538, 'Prezados jovens pesquisadores. A leitura do resumo apresentado foi prazerosa. A proposta de investigação é relevante, bem como a contribuição lúdica a ser proposta aos portadores de deficiência intelectual, a partir de um jogo educativo. Seguem algumas contribuições, cujo objetivo é colaborar nesse exercício investigativo.  Na introdução, considero significativo mencionar rever a seguinte frase sublinhada: “... pessoas portadoras de deficiência intelectual estão cada vez mais, sendo exclusas da sociedade competitiva...” • Neste caso a escrita dá a entender que antes os portadores de deficiência intelectual não eram excluídos.  Ainda na Introdução sugiro informar a fonte dos dados referente aos 45 milhões de deficientes A título de sugestão de redação: No Brasil, as pessoas portadoras de deficiência intelectual, como..(citar algumas)... ainda passam por processos de exclusão na sociedade competitiva. Segundo (fonte desse dado, ano) o país possui 45 milhões de deficientes declarados, na qual a grande parcela desses não consegue se assegurar em autonomia e nem sequer envolver-se na sociedade. No problema de pesquisa sugiro alterar o início da pergunta: (1ª)“É possível criar”... para (2ª) “Como é possível criar...”. A primeira possibilidade indica a respostar sim ou não o que poderá complicar na hora de atender o objetivo. Já a segunda possibilidade instiga aos pesquisadores pensarem como proceder, após o levantamento dos dados, para criação do tabuleiro lúdico. Outro ponto fundamental para realizar essa pesquisa é a assinatura dos participantes do Termo de Consentimento Livre e Esclarecido (TCLE). Sucesso!', 9.5, true);
INSERT INTO public.revisao VALUES (578, 348, 538, 'Prezados jovens pesquisadores. Interessante o tema apresentado. É extremamente relevante usar o cinema e literatura como ponto de pesquisa. Um filme é uma mídia-educação e seu contexto está relacionado ao exercício de Educação do olha espectador. A análise de um filme pode provocar diferentes modos de ver, de ler, de pensar e, principalmente, de se aprender com história. Sugestão de título “O olhar do cinema para o Massacre de Katyn” Para contribuir com o estudo apresento uma série de leituras possíveis ao olhar do espectador, a partir de Casetti (2004, p. 28): Modo espetacular: ver filme como um espetáculo, como entretenimento e distração; Modo ficcional: ver filme para fazer o espectador vibrar, sentir ao ritmo dos eventos, participar das vivências dos personagens; Modo fabulante: ver filme para extrair uma lição da mensagem proposta; Modo documentarizante: ver filme para informar-se sobre a realidade das coisas do mundo, filmes históricos, etnográficos e documentários; Modo argumentativo-persuasivo: ver filme para convencer, elaborar um discurso, filmes; didáticos com fins educativos e escolares; Modo artístico: ver filme destacando a produção de um autor, filmes de arte; Modo estético: ver filme interessando-se pelo trabalho de imagens e sons, filmes experimentais; Modo energizante: ver filme para vibrar ao ritmo das imagens e dos sons sem preocupar-se com conteúdos, filmes musicais e videoclipes; Que olhares pretendem despertar? Fonte: CASETTI, F. Teorie del cinema 1945-1990. Milano: Bompiani, 2004. Sucesso!', 9.75, true);
INSERT INTO public.revisao VALUES (739, 289, 1444, 'Revisar o texto, pois a palavra &#34;dia a dia&#34;, por exemplo, foi escrita de duas maneiras diferentes.', 8.75, true);
INSERT INTO public.revisao VALUES (745, 360, 1444, '* Revisar o texto, pois, por exemplo, as frases &#34;Analisar através da investigação dos rótulos a composição química dos refrigerantes e o teor de sódio presente nos mesmos Mostrar os riscos-malefícios associados a essa bebida.&#34; não foram separadas por sinal de pontuação. * &#34;Foi desenvolvido no primeiro ano do Ensino Médio Da Escola Estadual José Gomes de Vasconcelos Jardim&#34;, o que foi desenvolvido?', 9, true);
INSERT INTO public.revisao VALUES (743, 265, 1444, NULL, 9.75, true);
INSERT INTO public.revisao VALUES (741, 320, 1444, NULL, 8.75, true);
INSERT INTO public.revisao VALUES (742, 265, 1081, NULL, 9.25, true);
INSERT INTO public.revisao VALUES (673, 211, 508, 'O tema é importante e deve ser abordado, o Ensino Fundamental é um excelente público para este trabalho. O projeto apresenta uma configuração mais adequada para um projeto de extensão, nestes, obviamente, a pesquisa deve sempre ser valorizada. No entanto acredito em sua validade enquanto pesquisa para ser apresentado em feiras de ciências e ideias como forma de divulgação.', 8, true);
INSERT INTO public.revisao VALUES (478, 198, 508, 'O trabalho está bem delineado, apresentando uma ótima estrutura. O tema é excelente e foi muito bem escolhido, mostrando a sua importância para solucionar um problema, indo na contramão de outros trabalhos que buscam &#34;apenas evitar o problema&#34;. A apresentação de soluções para as questões atuais são dignas de reconhecimento, a sociedade precisa de mais proatividade.', 10, true);
INSERT INTO public.revisao VALUES (757, 193, 239, 'O grupo poderia ter mencionado mais informações sobre líquidos iônicos e até mesmo sobre o líquido iônico usado. Poderiam ter apresentado mais dados estatísticos dos resultados.', 9.25, true);
INSERT INTO public.revisao VALUES (772, 288, 87, NULL, 8.5, true);
INSERT INTO public.revisao VALUES (403, 363, 920, 'Para ficar mais claro os objetivos, sugiro numerá-los e incluí-los numa mesma frase. Por exemplo: &#34;Este trabalho tem como objetivos: 1) relacionar as contribuições de Tesla e Thomas Edison para a revolução energética, ou seja, a era elétrica, 2) identificar os tipos de corrente elétrica citando as vantagens e desvantagens de sua utilização e 3) explicar como esta batalha afetou o sistema elétrico brasileiro.&#34; Note que é Edison com &#34;i&#34;. Recomendo que no objetivo 2) em vez de: &#34;identificar os tipos de correntes&#34;, usar: &#34;identificar os tipos de corrente elétrica&#34;. Sugiro em vez de: &#34;Inicialmente, foi feito um estudo da história da eletricidade e magnetismo anterior aos dois cientistas. Através de pesquisa e leitura de livros e artigos, entre outros, disponíveis eletronicamente na WEB. Tendo como foco estabelecer as relações entre os trabalhos desenvolvidos, que relatam da origem das observações dos primeiros fenômenos elétricos e magnéticos, até o final do século XIX e início do século XX, a aplicação na indústria da geração elétrica.&#34; Usar: &#34;Inicialmente foi feito um estudo da história da eletricidade e magnetismo, anterior aos dois cientistas, através de pesquisa e leitura de livros e artigos, entre outros, disponíveis eletronicamente na WEB. O foco deste estudo foi estabelecer as relações ......(NO QUE SEGUE AQUI, SOBRE AS RELAÇÕES NÃO ESTÁ CLARO). Nas palavras-chaves em vez de &#34;Tesla; edson; eletrica&#34; usar &#34;Nikola Tesla; Thomas Edison; corrente elétrica&#34;.', 8.25, true);
INSERT INTO public.revisao VALUES (765, 233, 86, 'Parabéns pela pesquisa!', 10, true);
INSERT INTO public.revisao VALUES (776, 269, 86, 'Parabéns pelo projeto!', 10, true);
INSERT INTO public.revisao VALUES (565, 200, 538, 'Prezados Jovens pesquisadores A leitura do resumo apresentado foi extremamente agradável, tornando a proposta de investigação relevante. O Brasil possui propostas de políticas públicas voltadas para o público LGBT desde 2002. Porém, existe uma grande inquietação quando se pensa sobre a efetividade dessas ações e programas em relação a melhores condições de vida para as pessoas que têm sua sexualidade considerada “diferente” perante o meio social e vigiada, vivendo em sua própria sociedade como estrangeiros/as. O Ministério da Saúde (2008, p.30) reconhece que a população LGBT tem seus direitos humanos básicos agredidos por não se adequar a identidade sexual heteronormativa ou a não adequação do gênero ao sexo biológico, se encontrando em uma situação de vulnerabilidade. Por isso, a identidade de gênero e identidade sexual são fatores contribuintes para o processo de exclusão e de discriminação, em que predominam fatores como saúde, dignidade e violação ao direito. Também é relevante usar o cinema como ponto de pesquisa, pois um filme está relacionado ao exercício de Educação do olhar espectador. A análise de um filme pode provocar diferentes modos de ver, de ler, de pensar e, principalmente, de se aprender com história. Em caráter de contribuição peço que revejam na Introdução a escrita a população LGBT+,(2ª linha do resumo), pois naquele período mencionado o símbolo “+” não era considerado. Fonte: BRASIL. Ministério da Saúde. Painel de Indicadores do SUS nº5 – Prevenção de Violências e Cultura de Paz. Brasília, 2008. 30 p. Sucesso!', 9.5, true);
INSERT INTO public.revisao VALUES (553, 231, 733, 'O trabalho é de grande relevância. Sugiro que os autores realizem uma revisão quanto as normas de Português. O trecho do resumo que aborda os resultados pode ser revisado, pois ficou um pouco confuso. Parabenizo o grupo pela escolha do tema.', 8, true);
INSERT INTO public.revisao VALUES (465, 278, 538, 'Prezado(a) Jovem pesquisador(a). O tema de pesquisa que apresentou, refere-se à necessidade investir na exploração de outros planetas para a perpetuação da raça humana, No entanto, o resumo apresentado não se configura adequadamente para um projeto de pesquisa. Está faltando delimitar o problema da pesquisa, ou seja, qual foi a pergunta guia dessa investigação (não aparece no texto); Além disso, é preciso a partir desta pergunta elencar quais são os objetivos específicos que delineou para eleger a metodologia (isto é revisão bibliográfica); A escrita da metodologia se entrelaça com introdução. A tua metodologia é: uma revisão bibliográfica e para isso usei como referência sites de notícias e sites das próprias empresas privadas de exploração espacial. O que segue no texto é introdução; As palavras-chave estão incompletas, segundo normas de pesquisa devem ser no mínimo 3 (três) e no máximo 5 (cinco) palavras-chave; Dica importante para aprimorar a escrita: cuidar algumas expressões como: ‘tal coisa’; ‘rios de dinheiro’ ‘Minha pesquisa’; ‘Eu’ - estas palavras quebram o sentido científico de um projeto de pesquisa, sugiro adequar. Fiz uma rápida pesquisa sobre a sonda no site para me apropriar do assunto. Encontrei a seguinte informação: A sonda espacial está sendo “desenvolvida há anos”, de acordo com o site do novo projeto da empresa, e é capaz de aterrissar “várias toneladas” de carga na superfície da Lua. “Sua capacidade de realizar aterrisagens precisas e suaves poderão permitir uma presença humana sustentável na Lua”, alega o site da Blue Moon. Também sugiro revisar a escrita das seguintes frases: “A Blue Moon será uma sonda lunar que poderá levar cargas que pesam toneladas e humanos à Lua” – Sugestão de adequação da frase: “A Blue Moon será uma sonda lunar que vem sendo projetada que envolvem desde levar cargas que pesam toneladas para a Lua, bem como expandir o acesso a viagens espaciais aos seres humanos”. Outra observação: “[...] Por causa dessas afirmações desse físico, bilionários como Elon Musk e Jeff Bezoss tem investido rios de dinheiro em suas próprias empresas de exploração espacial [...] – Sugestão de adequação da frase: [...] “As afirmações de Hawking, instigaram bilionários como Elon Musk e Jeff Bezossa a realizarem altos investimentos nas próprias empresas. O que tem caracterizado a esta exploração do cosmo, como uma corrida espacial para o século XXI, frente ao tempo preestabelecido pelo físico”[...] Assim, ao analisar as orientações e/ou sugestões que foram apresentadas, certamente o título ficará conectado ao proposto. Jovem pesquisador(a) O exercício da pesquisa é exatamente esse, aprimorar dados, informações, escrita. Estudo de um determinado tema não fica estagnado só por estar pronto. Pesquisa é um exercício constante, em evolução e muito estimulante. Sucesso!.', 4.25, true);
INSERT INTO public.revisao VALUES (527, 342, 733, 'O trabalho apresenta um tema relevante à comunidade estudantil, porém, não caracteriza da forma como está colocado no resumo, um trabalho científico. Trata-se de um projeto institucional. Sugiro a reescrita do resumo, colocando em evidência o problema a ser investigado, o objetivo DESSE TRABALHO (e não do projeto como um todo) e a metodologia adotada para ESSE TRABALHO. Também é espero que os autores evidenciem os resultados atingidos ou esperados nesse recorte realizado.', 6.25, true);
INSERT INTO public.revisao VALUES (756, 193, 508, 'A linguagem está adequada, o resumo bem estruturado apresentando clareza quanto ao que está sendo desenvolvido na pesquisa. O trabalho está excelente, o tema é de extrema relevância e atual.', 10, true);
INSERT INTO public.revisao VALUES (467, 224, 505, 'Considero trabalho homologado, no entanto, proponho as seguintes sugestões para adequação do resumo: ajustes na redação do resumo para trazer mais clareza, observando a escrita na terceira pessoa do singular; apresentar quais fontes da internet foram utilizadas para a pesquisa, assim como, o público que participou da pesquisa e o critério de seleção do público-alvo.', 8, true);
INSERT INTO public.revisao VALUES (562, 206, 505, 'Considero trabalho homologado, no entanto, proponho as seguintes sugestões para adequação do resumo: apresentar os critérios de seleção das mulheres artistas que serão analisadas e abordadas no projeto; deixar claro se todas as sessões serão realizadas com a comunidade acadêmica e qual comunidade acadêmica; colocar nomes de autores em minúsculas (exceto primeira letra) quando fora de parênteses e em maiúsculas quando dentro de parênteses; apontar o ano de todos os autores citados. Parabéns pelo projeto!', 8, true);
INSERT INTO public.revisao VALUES (733, 354, 505, 'Considero trabalho homologado, no entanto, proponho as seguintes sugestões para adequação do resumo: ajustes na redação do resumo, observando a escrita na terceira pessoa do singular (acrescentar no início do resumo que milhares de pessoas encararam tempestade e falta de banheiros…); colocar nomes de autores em minúsculas (exceto primeira letra) quando fora de parênteses. Parabéns pelo projeto!', 8.5, true);
INSERT INTO public.revisao VALUES (488, 256, 733, 'O tema do trabalho é relevante, porém, sugiro ao grupo uma revisão quando aos objetivos da pesquisa e adequações às normas de Português. Ao longo do resumo não fica evidente qual o objetivo geral do trabalho pois nesse trecho: &#34;busca-se reconhecer o tratamento dos efluentes realizado pelas estações de tratamento de esgoto (ETE&#39;s), em Porto Alegre administradas pelo DMAE (Departamento Municipal de Água e Esgoto), e apontar irregularidades no procedimento de limpeza da água, bem como identificar a proliferação de microrganismos patógenos aos seres humanos, como a bactéria Escherichia coli; há, também, os aeróbios decompositores de matéria orgânica que, presentes em excesso no meio, diminuem a concentração de oxigênio e dificultam a autodepuração do corpo hídrico, dando início ao processo de anaerobiose e relacionando-se com a morte de outros seres vivos. (reescreva a frase, está grande demais o que dificulta a compreensão). Aqui parece ser outro objetivo: &#34;Através disso, o grupo busca identificar as causas da elevada impureza no Guaíba e as consequências de tal contaminação, a fim de conscientizar a população acerca da situação e estimular a realização imediata de tarefas que auxiliem na limpeza das águas, como a separação adequada do lixo caseiro&#34;. Selecione um objetivo geral. Deixe isso evidente ao leitor. O problema a ser pesquisado também precisa estar evidente ao leitor. A Metodologia está caga, não esclarece exatamente o que foi realizado e não apresenta nenhum resultado e nem aponta os possíveis resultados a serem encontrados. Sugiro revisão do resumo.', 5.75, true);
INSERT INTO public.revisao VALUES (396, 217, 538, 'Prezados Jovens pesquisadores Retomar fases marcantes da história é importante. Olhar para o passado, remete reflexões e debates saudáveis e fundamentados, na atualidade. A fonte de pesquisa selecionada é ótima, pois o acervo da Folha de São Paulo data do final do século 1800. Como os objetivos estão bem delineados certamente não irão se perder pelas páginas da história. Apenas faço uma ressalva referente às palavras-chave. Sugiro acrescentarem a lista a palavra (Guerra Fria), ou ainda podendo substituir, caso considerem apropriado pela palavra “Dissolução”. O título ficaria adequado se fosse: A DISSOLUÇÃO DA UNIÃO SOVIÉTICA CONTADO PELA IMPRENSA BRASILEIRA Por fim, é adequado marcar o recorte temporal que essa investigação realizará nos jornais indicados. Sucesso!', 8.75, true);
INSERT INTO public.revisao VALUES (402, 363, 733, 'O trabalho apresenta um tema interessante, porém, sugiro aos autores uma delimitação maior quanto aos objetivos. Escolha um objetivo ou coloque-o de forma mais ampla que contemple o que foi realizado no projeto. Ao que me parece, o objetivo central foi apresentar as principais contribuições de Nikola Tesla e Thomas Edson para a revolução energética. Na parte da metodologia, sugiro que explique melhor o trabalho que foi desenvolvido com a turma, se já haviam trabalhado o conteúdo antes do documentário, que documentário foi esse, quantas aulas utilizaram para aplicar toda a atividade, etc.', 6.5, true);
INSERT INTO public.revisao VALUES (468, 236, 928, 'Essas duas frases estão repetitivas: &#34;Dentro desse contexto, torna-se imperativo aprender a programar e a desenvolver o pensamento computacional, pois engloba várias habilidades que são úteis para qualquer área do conhecimento. Aprender a programar desenvolve o pensamento computacional, que engloba habilidades como a resolução de problemas, a capacidade de abstração e a criatividade, úteis para qualquer área do conhecimento&#34;', 6, true);
INSERT INTO public.revisao VALUES (463, 297, 1025, 'O referido resumo não apresenta, de forma clara, o problema de pesquisa, bem como objetivos e metodologia. O que está exposto é uma explicação de como funciona o Projeto de Extensão “Linguagens e(m) Comunicação e a atividade relacionada à prática de conversação, o Conversation Meetings.', 3.5, true);
INSERT INTO public.revisao VALUES (731, 279, 1025, 'O resumo, apesar de apresentar uma estrutura, necessita de melhorias em alguns requisitos como justificativa, objetivos, metodologia e nos resultados.', 6.25, true);
INSERT INTO public.revisao VALUES (389, 359, 525, 'O tema é muito interessante, no entanto, o resumo está confuso e apresenta frases incompletas (faltando informações).Não há coerência na organização das informações. O texto precisa ser reescrito com a apresentação dos objetivos, da metodologia e dos resultados obtidos.', 4, true);
INSERT INTO public.revisao VALUES (558, 272, 525, 'O resumo mostra um trabalho muito interessante. Apenas indico a necessidade de correção na ortografia (imagino que tenha ocorrido erro no momento da digitação), assim apareceu &#34;forma avaliados&#34; onde imagino que seria foram e &#34;a receita base escolhido&#34; onde imagino que seria a receita base escolhida.', 10, true);
INSERT INTO public.revisao VALUES (408, 194, 1439, 'Sugestões: modificar a redação da metodologia para contemplar o atingimento do objetivo proposto (atenção aos verbos utilizados). Rever o uso do termo &#34;Didáticos Pedagógicos&#34;. Rever a concordância nominal em &#34;foi experimentado os jogos&#34;. Rever o significado de alguns trechos como por exemplo &#34;identificação de construção de conceitos da Administração&#34; , &#34;foi verificado na prática nos jogos digitais as possibilidades de&#34;, &#34;planejamento, organização, coordenação e controle&#34; ou planejamento, organização, direção e controle?. Excelente trabalho. Desejo sucesso na pesquisa!', 7, true);
INSERT INTO public.revisao VALUES (728, 225, 1439, 'Sugestões: rever o título, talvez suprimir o termo epistemológica. O seguinte trecho poderia ser reescrito ou até posicionado junto aos resultados: &#34;Nesse âmbito, destacou-se o grupo de 15 a 21 anos, cursando o ensino médio, deixando em segundo lugar o público com mais de 35 que frequenta ou já concluiu o ensino superior&#34;. Destacou-se em que sentido? Reavaliar o uso da expressão &#34;sobre esses&#34;. &#34;Sobre estes&#34;? Considerar padronizar a expressão dos resultados em frequência absoluta ou relativa. Explicar melhor a seguinte expressão &#34;aos 86,8% que não consideraram essa valorização suficiente&#34;. Qual valorização? Houve um quesito sobre isto? Qual quesito? Confirmar o uso do termo dímere!', 8.25, true);
INSERT INTO public.revisao VALUES (407, 261, 508, 'O projeto tem grande importância, está com objetivos bem delineados, no entanto seria interessante apresentar um diferencial e apresentar na mostra o experimento desenvolvido.', 9.5, true);
INSERT INTO public.revisao VALUES (425, 222, 505, 'Considero trabalho homologado, no entanto, proponho as seguintes sugestões para adequação do resumo: apresentar a justificativa do trabalho; incluir o período coberto pela revisão bibliográfica (recorte temporal) e o motivo pela escolha da plataforma Lume para a revisão bibliográfica; sugiro apresentar o quantitativo de pessoas entrevistadas e sua faixa etária; os resultados podem ser apresentados de forma mais genérica, mas com a inclusão de uma análise interpretativa dos dados pelos pesquisadores. Sugestão para o projeto: considerando que a quarta revolução industrial já é uma realidade e que o próprio estudo propõe habilidades para adaptação a esse novo panorama, sugiro adequação do objetivo do projeto para “identificar e esquematizar habilidades que os trabalhadores devem desenvolver para se adaptarem à era cibernética ou à quarta revolução industrial. Parabéns pelo projeto.', 7, true);
INSERT INTO public.revisao VALUES (519, 269, 508, 'O projeto está bem delineado, foi executado com eficiência e apresenta bons resultados. Considerando ser um trabalho desenvolvido por alunos do Ensino Fundamental, chamou a atenção a criatividade e organização do projeto.', 10, true);
INSERT INTO public.revisao VALUES (788, 352, 87, NULL, 7.5, true);
INSERT INTO public.revisao VALUES (404, 326, 1212, 'Primeiramente, gostaria de parabenizar os autores pelo trabalho! Este estudo se faz muito necessário devido ao nobre papel das abelhas no ecossistema. O tema é atual e muito relevante para sociedade. O trabalho está bom e possui mérito científico. A seguir, adiciono alguns pontos à refletir e algumas sugestões. O título do projeto está um tanto abrangente, seria interessante deixa-lo mais específico, a fim de valorizar e chamar a atenção para o projeto. Eu sugiro adicionar algum termo que remeta para a importância ambiental, visto que as abelhas também possuem &#34;interesse econômico&#34; devido à produção de mel. O recomendado é não utilizar no tópico de palavras-chave nenhuma palavra que esteja no título do trabalho. A realização do estudo está devidamente justificada. Porém, há uma incoerência em relação à pergunta de pesquisa e ao objetivo geral, pois de certa forma a pergunta de pesquisa deve estar atrelada ao objetivo geral, e não aos objetivos específicos. Na metodologia, sugiro indicar que se trata de um estudo de revisão de literatura. A conclusão do trabalho ficou clara: deu para acompanhar os resultados, e consequentemente, o aprendizado que os autores adquiriram ao executar o trabalho. Para concluir, minha principal dica e para que os autores sigam a diante divulgando os dados do trabalho e apliquem os resultados do estudo na prática. Talvez, no futuro, seria interessante passar a diante as informações para a secretária de meio ambiente e aos governantes do município de residência dos autores. Visto que as conclusões do estudo poderiam incentivar a prefeitura a estimular o plantio de plantas que atraem as abelhas.', 7, true);
INSERT INTO public.revisao VALUES (392, 340, 1120, 'O tema é pertinente e necessário para o debate na contemporaneidade. No entanto, o título do trabalho está muito amplo e não contempla a abordagem principal da pesquisa que é a representação na imprensa. É preciso limitar o campo da pesquisa. Sugiro que o título do trabalho seja modificado e nele contemplado seu recorte tematico, como por exemplo: A narrativa da conquista do voto feminino no Brasil na imprensa local.', 7, true);
INSERT INTO public.revisao VALUES (473, 291, 982, 'No início quando usa o termo &#34;doenças de transtornos mentais&#34; parece que o estudo é muito mais amplo, considerando que esse refere a diversos tipos de doenças (Depressão, Transtorno de ansiedade, Transtorno bipolar, Transtorno do déficit de atenção com hiperatividade, Autismo, etc). Assim, sugere-se que utilize apenas o termo &#34;depressão&#34; para não confundir o leitor, assim como o termo &#34;ansiedade&#34; deve ser retirado por não ser o foco do estudo. Não apresenta a metodologia do estudo, considerando como poderá evidenciar que a dança utiliza na depressão.', 6, true);
INSERT INTO public.revisao VALUES (514, 238, 982, 'O título não deixa claro o que é a pesquisa, assim como as palavras-chave também não deixam explícita do que se trata o estudo. Sugere-se uma melhor explicação de como serão aplicados os testes. Será através de questionário online, entrevista, observação da plataforma e posterior aplicação do questionário etc.', 9, true);
INSERT INTO public.revisao VALUES (684, 234, 531, 'O trabalho de maneira geral está bem estruturado. Possuí boa temática e seu desenvolvimento é conciso. Contudo, peço um pouco mais de atenção na revisão do texto (português).', 7.5, true);
INSERT INTO public.revisao VALUES (491, 274, 531, 'O trabalho aborda um tema atual e relevante. Além de trazer informações interessantes sobre como os restaurantes tratam o desperdício de alimentos. Os autores poderiam trazer informações sobre o quanto é desperdiçado no mundo e no Brasil por ano. Seria interessante também, contextualizar um pouco melhor o que pode ser feito para que haja redução deste desperdício.', 7.5, true);
INSERT INTO public.revisao VALUES (524, 252, 531, 'O trabalho trás informações interessantes sobre uma temática atual e importante no âmbito de conservação. Gostaria de ter visto dados sobre as espécies de abelhas sem ferrão existentes no município de Canoas; e como os autores pretendem mostrar a importância da preservação das abelhas. Mas de um maneira geral o trabalho esta muito bom.', 7.5, true);
INSERT INTO public.revisao VALUES (619, 346, 531, 'O trabalho é interessante, está bem estruturado e escrito. Somente o título poderia ser alterado para: O corante caramelo IV no refrigerante (coca-cola). Pois o trabalho tratou do corante somente no refrigerante. Seria interessante realizar os mesmo teste de laboratório em outros refrigerantes que possuam esse corante.', 7.25, true);
INSERT INTO public.revisao VALUES (484, 316, 531, 'O trabalho está coerente e bem escrito. Sugiro apenas que os autores apliquem (se possível) o questionário para mais de um professor, com o objetivo de aumentar o sucesso de seu projeto.', 7.5, true);
INSERT INTO public.revisao VALUES (482, 268, 1120, 'Tema complexo na contemporaneidade e que precisa de muitos estudos. Importante a discussão dentro da escola e a preocupação em identificar a possível doença e possibilitar mecanismos de ajuda. Penso que é interessante elencar os sites pesquisados, no próprio resumo. Senti falta dessa identificação. Lembrando que é preciso muito cuidado e rigor com as fontes que buscamos na Internet. Há muitos sites interessantes de profissionais que discutem essa temática, bem como outros de caráter duvidoso. A título de contribuição alguns sites que podem ajudar a aprofundar a pesquisa caso não tenham sido consultados: organização mundial de saúde; ministério da saúde; drauzio varella; conselho federal de psicologia; revista brasileira de neurologia e psiquiatria e o próprio centro de valorização da vida (este último de caráter preventivo).', 7.5, true);
INSERT INTO public.revisao VALUES (451, 235, 1441, 'Prezados Pesquisadores (as), Parabéns!! Adorei ler o trabalho de você! Acredito que este tipo de sistema deveria sair de fabrica afim de evitar do desperdício de energia e recursos naturais como a água. Estou ansioso para ler o restante do trabalho. Vocês estão no caminho certo. Forte Abraço,', 9.5, true);
INSERT INTO public.revisao VALUES (657, 303, 1212, 'Primeiramente, gostaria de parabenizar os autores pelo trabalho e pela escolha do tema, que é atual e de interesse público. Além do mais, os resultados do trabalho podem vir a serem aplicáveis pela indústria no futuro. No geral, o projeto está escrito de forma adequada, com linguagem acadêmica, o que contribui para o mérito científico do projeto. A indicação do objetivo geral, do tema e do problema de pesquisa foram descritas de forma clara e precisa no texto. A justificativa ficou muito bem escrita e embasada. Os autores indicaram argumentos relevantes para a realização do estudo. As etapas referentes à metodologia empregada no estudo foram muito bem descritas. Destaco um ponto positivo em relação à conclusão dos resultados preliminares. A mesma está escrita de forma adequada e objetiva. A seguir, adiciono alguns pontos à refletir e algumas sugestões a sobre escrita. Primeiramente: observar a escrita correta do microrganismo, visto que a grafia está escrita de forma errada, o nome correto do organismo é Bacillus amyloliquefaciens. É interessante citar no texto que “MO13” trata-se de um isolado da espécie. O recomendado é não utilizar no tópico de palavras-chave nenhuma palavra que esteja no título do trabalho. Na escrita acadêmica, escrevermos os conteúdos referentes à justificativa, e demais subitens do texto, de forma subentendida, ou seja, não é usual escrever “a justificativa da pesquisa”. O ideal é escrever os o conteúdo de forma mais direta e fluida, de forma que o texto não fique truncado.', 9.25, true);
INSERT INTO public.revisao VALUES (774, 195, 86, 'Interessante tema pesquisado. Parabéns!', 8.5, true);
INSERT INTO public.revisao VALUES (452, 281, 1434, 'SUGESTÕES DE ALTERAÇÃO AS SUGESTÕES ESTÃO ENTRE COLCHETES [...] A gravidade é um assunto que nos interessa porque está presente no nosso cotidiano e pode ser percebida [nos] brinquedos de parque de diversão[, por exemplo]. Por isso, o objetivo dessa pesquisa é entender como que ocorre a gravidade e saber o interesse das pessoas sobre este assunto. Fizemos uma pesquisa bibliográfica em sites na internet para responder as perguntas: “Como ocorre a gravidade?”, “Quais são os efeitos da gravidade?”, “Se a gravidade é a mesma, porque uma pena cai mais lentamente que uma pedra de cima de um edifício?”. Descobrimos que a gravidade é [ocorre pela (excluir)] [a] força que atrai dois corpos, um em direção ao outro. Quanto maior a[s] massa[s] [de um (excluir)] [dos] objeto[s], mais forte [sua (excluir)] [será a] atração gravitacional [entre eles]. Por causa da gravidade as maçãs caem em direção ao solo, e os planetas do nosso sistema orbitam o Sol. [Porque um dos (excluir)] [Por que um] corpo[s (excluir)] sofre maior resistência do ar do que o outro[. (excluir)] [?] A partir do que aprendemos fizemos um experimento usando uma [baixa (excluir)] [caixa] de papelão grande para observar a queda de um pedaço de algodão e [de] uma pedra. Conseguimos relacionar o que observamos com o que ocorre quando alguém voa de asa delta. A resistência do ar na asa faz com que as pessoas planem no ar. Já [o que] ocorre em uma montanha russa é diferente, é similar o que ocorre quando soltamos a pedra. O carrinho desce pelos trilhos acelerando e em alta velocidade. Depois de pesquisarmos, concluímos, que a gravidade atrai os corpos em direção a terra, porém a forma com que eles irão cair depende da aerodinâmica do [sólido (excluir)] [corpo]. (COMENTÁRIO: Seria interessante incluir no resumo o que já foi constatado a respeito “do interesse das pessoas sobre este assunto”.)', 7.25, true);
INSERT INTO public.revisao VALUES (689, 332, 1441, 'Prezados Pesquisadores (as), Parabéns pelo projeto, apresenta uma solução que deve sim ser considerada afim de baixar os altos cursos de produção agrícola e manter um controle sustentável dos recursos naturais. Para uma nova etapa no desenvolvimento do STILBOMB - SISTEMA DE RADIAÇÃO SOLAR COM BOMBEAMENTO PARA USO NA IRRIGAÇÃO, recomento a implementação de uma automação com APP (Aplicativo) para dispositivos moveis afim de ter um real controle do quanto de água está sendo enviado para cada lavoura e a potência gerada por este motor nos períodos do dia. Outros parâmetros podem ser pré-determinados como: Manutenção preventiva, Controle de fluxo e vazão, medição hídrica, etc. Somente automatizar o envia de água com energia solar não irá alcançar o real potencial deste projeto, as informações que podem ser levantadas com uma APP junto a este sistema sim trarão um valor real. Vocês estão no caminho certo. Forte Abraço,', 7.75, true);
INSERT INTO public.revisao VALUES (530, 209, 1434, 'Sugiro a alteração da última frase, “Os resultados demonstram que este é um método pedagógico totalmente eficaz, estimulando o crescimento do conhecimento dos alunos.” pela frase Os resultados indicam que este é um bom método pedagógico, que contribui para o crescimento do conhecimento dos alunos.', 8, true);
INSERT INTO public.revisao VALUES (675, 345, 1441, 'Parabéns!! Adorei ler o trabalho de você! Recomento a implementação do sistema SARCA - SISTEMA DE ALERTA AO RESPONSÁVEL DA CRIANÇA AUTISTA, em uma segunda fazer para o IOS. Um projeto com uma proposta tão relevante e importante quanto este que busca auxiliar os pais com seus filhos deve poder oferecer uma portabilidade entre os dois sistemas moveis mais releve-te atualmente com isto podendo atender um número maior de pais e criança. Estou ansioso para ler o restante do trabalho. Vocês estão no caminho certo. Forte Abraço,', 10, true);
INSERT INTO public.revisao VALUES (661, 214, 1441, 'Prezados Pesquisadores (as), Parabéns!! Adorei ler o trabalho de você! Acredito que o projeto REMOLDED – ENSAIO SOBRE REUTILIZAÇÃO DE TECIDOS NA DEMONSTRAÇÃO SOBRE SUSTENTABILIDADE oferece uma relevância importante e deve ser implementado o quanto antes. Como sugestão recomendo o uso de mais matérias e recursos que são descartados pelos processos industriais. Estou ansioso para ler o restante do trabalho. Vocês estão no caminho certo. Forte Abraço,', 8, true);
INSERT INTO public.revisao VALUES (567, 204, 1441, 'Prezados Pesquisadores (as), Parabéns!! Adorei ler o trabalho de você! Acredito que o projeto HYDRA: UMA SOLUçãO INTELIGENTE CONTRA ENTUPIMENTO DE BUEIROS oferece uma relevância importante e deve ser implementado o quanto antes. Como sugestão recomendo o uso múltiplas plataformas como IOS e Android para disseminar a informação também através de APP para a população de áreas que estão para serem atingidas por alagamento e mostrar a real situação dos bueiros da cidade afim de ter um maior controle para manutenção e limpeza. Estou ansioso para ler o restante do trabalho. Vocês estão no caminho certo. Forte Abraço,', 9.25, true);
INSERT INTO public.revisao VALUES (474, 351, 1441, 'Prezados Pesquisadores (as), Parabéns!! Adorei ler o trabalho de você! Acredito que o projeto DEFICIêNCIA VISUAL: ENSINO DE ELETRICIDADE ATRAVéS DA TECNOLOGIA ASSISTIVA oferece uma relevância importante e deve ser implementado o quanto antes. Estou ansioso para ler o restante do trabalho. Vocês estão no caminho certo. Forte Abraço,', 10, true);
INSERT INTO public.revisao VALUES (734, 191, 1120, 'A título de contribuição para esse tema instigante na História do Brasil é a consulta ao CPDOC da Fundação Getúlio Vargas, caso ainda não tenham feito, haja vista a citação: FERREIRA, 1994 que tinha entendido como sendo da historiadora, Marieta de Moraes Ferreira.', 7.5, true);
INSERT INTO public.revisao VALUES (526, 342, 1212, 'Primeiramente, gostaria de parabenizar os autores pelo trabalho e, principalmente, pela escolha do tema. Este projeto se faz muito necessário devido ao crescente aumento da obesidade, e suas comorbidades associadas, em jovens. O título do projeto está bom, instiga o leitor a saber mais sobre o conteúdo do trabalho. A escolha das palavras-chave estão corretas. O projeto em si possui mérito cientifico, uma vez que apresenta tema, objetivos e metodologia de forma adequada. Como sugestão para trabalhos futuros, indico que seria interessante citarem no resumo os problemas relacionados ao sedentarismo., e especificamente em jovens. Este tópico poderia embasar um pouco mais a justificativa para a realização do Esportizando. De modo geral, o item objetivos tende a ser mais conciso, portanto, sugiro que estimulem escrever os objetivos de forma mais breve e objetiva. A metodologia foi bem clara, pois com apenas a leitura do resumo foi possível entender quais serão as práticas adotadas para a execução do projeto. Senti falta de resultados, mesmo que preliminares. Seria interessante relatarem qual a situação prática do projeto: se o mesmo ainda está em fase de planejamento ou se alguma fase está em execução no momento. Uma dica de escrita: não utilizar siglas sem escrever primeiramente o termo correspondente por extenso. Para concluir, estimo que o projeto seja implementado e que siga adiante, servindo de modelo para outras instituições de ensino.', 6.75, true);
INSERT INTO public.revisao VALUES (442, 248, 434, 'Olá! Sugiro deixar mais claro que tipo de interações a plataforma pretende possibilitar aos pacientes, pois o uso de chatbot e inteligência artificial deixa muito abertas as possibilidades. Sugiro também rever o objetivo &#34;prover uma melhora na qualidade de vida de familiares e cuidadores envolvidos com o cuidados dessas pessoas&#34;. Acredito que essa seria mais uma consequência do que um objetivo, caso o paciente obtive melhor ou ao menos estabilidade. Acredito que os objetivos focados na melhoria do paciente e controle da doença ficaria mais coerente.', 9, true);
INSERT INTO public.revisao VALUES (713, 284, 434, 'Olá! Para melhoria do resumo, sugiro em alguma parte, em uma frase, deixar mais claro para o leitor o que se pretende, de forma mais simples, por exemplo: pretende-se que estudantes com deficiências visuais ou auditivas possam passar demandas referentes aos conteúdos ao assistente e o assistente retornar registros sobre o conteúdo demandado. Esta sugestão vem a facilitar o entendimento do trabalho por pessoas de outras áreas de conhecimento.', 7.75, true);
INSERT INTO public.revisao VALUES (721, 237, 434, 'Olá! O trabalho explora um tema muito nobre, que é o auxílio aos moradores de rua. Uma sugestão para melhoria do resumo é deixar mais claro o fluxo do processo do suporte aos moradores de rua, pois fiquei com a dúvida se qualquer pessoa com o aplicativo, que vê uma situação vulnerável, pode registrar no aplicativo, mesmo que não queira/possa auxiliar diretamente. Aí quem quer participar ajudando, pode visualizar onde existem situações de vulnerabilidade. É isso? Verificar essa clareza no resumo.', 9, true);
INSERT INTO public.revisao VALUES (434, 273, 1052, '&#34;O projeto iniciou-se pela obtenção e plantio de citronela&#34; está confuso no texto, poderia ser mais claro &#34;O bioensaio não apresentou diferença significativa de mortalidade do inseto-praga, 80% no controle contra 77,5% na dieta com citronela.&#34;. Qual o teste estatístico utilizado para afirmar se teve ou diferença estatística. Esse resultado demonstrou apenas o percentual. palavras- chaves: incluir Citronela, uma vez que é o tema do estudo', 7.5, true);
INSERT INTO public.revisao VALUES (455, 276, 1052, 'No Objetivo: &#34;segundo a produção total de ovos de&#34; é método, não é objetivo. - retirar assim ficará mais claro Justificativa; descrever qual a importância de se fazer esse estudo, o que já se conhece na literatura sobre o tema e o que está faltando. Detalhar mais a metodologia Corrigir: Dessa fora, &#34;forma&#34; Palavras-chaves,: incluir Ephestia kuehniella', 8, true);
INSERT INTO public.revisao VALUES (557, 220, 1052, 'Justificativa: &#34;Com a finalidade de estudá-lo, uma profunda pesquisa bibliográfica foi realizada para obter o máximo de informações sobre o material e suas aplicações para posteriormente disseminar seus potenciais e qualidades a outrem visto que 64% das pessoas que participaram de uma pesquisa realizada no Google Forms desconhecem o grafeno, além disso, dentre todos os participantes 15% confundiram grafeno com grafite e cerca de 42% não sabem nada em relação às utilidades do grafeno Muito extensa a frase: Deixar mais claro o porque fazer uma revisão bibliográfica sobre o tema. A frase esta muito longa. Utilizar as informações descritas porém frases curtas Metodologia: não foi apresentada; descrever quais os recursos utilizados na revisão bibliográfica, &#34;A população nacional ganha destaque devido ao grande impacto que haverá na economia já que o Brasil possui cerca de 46% da reserva mundial de grafeno em território nacional.&#34; - Revisar esta sentença. O Grafeno é um material sintético Resultados: não foi descritos conforme autores pesquisados na literatura e que o estudo se propôs', 7, true);
INSERT INTO public.revisao VALUES (598, 267, 1052, 'Tema super importante principalmente por se tratar de saúde. A frase: &#34;Como solução&#34;, esse projeto consiste...- o tema apontou alternativas ou propostas para estudar ao invés de &#34;solução&#34; Introdução está muito bem descrita. Objetivos não estão claros. Metodologia não está descrita', 7.75, true);
INSERT INTO public.revisao VALUES (413, 323, 464, 'Rever norma culta do português, em especial regência e concordância verbo-nominais. Evidenciar os elementos (ou conceitos-chave) do pensamento iluminista que estão sendo mobilizados no estudo dos autores citados. Rever descrição metodológica, pois não está clara a relação entre a análise de livros didáticos com os objetivos propostos, tampouco explicitado o objetivo específico da aplicação de questionário (público-alvo, tema de questionamento, etc.).', 5, true);
INSERT INTO public.revisao VALUES (483, 268, 464, 'Excelente tema de pesquisa. Em termos de norma culta do português, rever estrutura sintática das frases, em especial, utilizar conectores; excluir repetições como &#34;nós&#34;; utilizar recursos linguísticos (nominalizações, advérbios) para indicar o aspecto descrito (ex.: metodologicamente, os objetivos são...). Citar mais dados, aprofundar a análise dos resultados do questionário e discutir os desdobramentos desses resultados, pois parece que os objetivos destoam dos dados obtidos, já que estes últimos apontam para a percepção das pessoas acerca da depressão.', 4, true);
INSERT INTO public.revisao VALUES (577, 329, 464, 'Rever norma culta do português. Os objetivos, o objeto de pesquisa e a justificativa estão muito amplas quando postas em relação aos itens propostos pelo questionário. Buscar especificar quais critérios são utilizados para definir o que seria a qualidade de uma instituição de ensino e como aumentá-la. Além disso, é importante delinear melhor o que se entende por instituição de ensino, qual o nível, localização, etc.', 3.75, true);
INSERT INTO public.revisao VALUES (667, 292, 464, 'A proposta de um robô para ensino de língua inglesa aos estudantes de 2o e 3o anos do ensino fundamental é excelente. Entretanto, falta rigor na escrita do resumo, pois não está clara a metodologia empregada, tampouco as etapas da pesquisa e objetivos específicos. Seria fundamental rever a norma culta da língua portuguesa e descrever mais o que é robô, seu funcionamento e conteúdos de língua inglesa mobilizados (o quê e como).', 3.75, true);
INSERT INTO public.revisao VALUES (685, 314, 464, 'Rever norma culta do português. Excelente tema de pesquisa, porém, não está adequadamente descrito, pois fica a dúvida quanto aos resultados apontarem para o simples uso de sites no ensino de português ou para o uso específico deste site utilizado no ensino de português. Quais especificidades o site apresenta? Quais atividades foram desenvolvidas? Seriam elas o grande diferencial do projeto? O que se entende por aprendizagem através de site? São aspectos importantes a serem desenvolvidos.', 4, true);
INSERT INTO public.revisao VALUES (636, 357, 566, 'Não há citação à quem está realizando o trabalho e qual sua relevância. Qual a área de atuação, saúde ou biológica? Ou as duas?', 6.75, true);
INSERT INTO public.revisao VALUES (658, 303, 566, 'O resumo está com muita informação. poderia ser mais sucinto e contemplar uma justificativa mais objetiva e lógica.', 6.75, true);
INSERT INTO public.revisao VALUES (705, 245, 652, 'Poderia ter apresentando de forma mais clara os objetivos do projeto. Acredito que a explicação do projeto poderia ter sido omitida e ser explicado mais como correu a pesquisa, não ficou claro. Os resultados e o porque na conclusão ficou muito vago.', 5, true);
INSERT INTO public.revisao VALUES (617, 350, 652, 'Resumo muito bem escrito, deixando claro os objetivos e como foi realizada a pesquisa.', 10, true);
INSERT INTO public.revisao VALUES (587, 315, 652, 'O texto está bem escrito, o questionário poderia ter aprofundado mais o tema.', 8, true);
INSERT INTO public.revisao VALUES (643, 285, 1052, 'O tema é relevante. As informações na introdução estão adequadas. Objetivo do estudo: Não esta claro Metodologia: não foi descrita Sentença muito extensa: &#34;Existindo esse sistema em um hospital faz com que possibilite um melhor aproveitamento de recursos humanos/técnicos dentro da unidade hospitalar ao realizar uma tarefa simples, sendo ela o transporte de um medicamento da farmácia do hospital até o leito, evitando desperdício de tempo, dinheiro e sobrecarga de trabalho&#34;. Resultados esperados: não estão claros Palavras- chaves: incluir medicamentos e ambiente hospitalar', 7.25, true);
INSERT INTO public.revisao VALUES (760, 247, 87, NULL, 7.5, true);
INSERT INTO public.revisao VALUES (503, 195, 1120, 'O tema é interessante e pertinente. No entanto, não aparece o recorte espacial, nem temporal no projeto. Penso que o termo &#34;Peste Bubônica&#34;, que é mais comum no Brasil, ficaria melhor conceituado no lugar de &#34;Peste Negra&#34;. Se o objetivo for de fato pesquisar sobre a Peste Negra, fato histórico ocorrido durante a Idade Média, estabelece-se um tempo histórico muito longo para se fazer comparações, e acaba resultando em anacronismo. A pesquisa atingiria um resultado melhor se fosse trabalhado somente com as doenças existentes na atualidade: Hanseníase, AIDS e Peste Bubônica.', 4.5, true);
INSERT INTO public.revisao VALUES (543, 208, 1120, 'Tema interessante que merece ter prosseguimento e ser melhor aprofundado. Não ficou evidenciado no texto as fontes utilizadas para a pesquisa.', 6.75, true);
INSERT INTO public.revisao VALUES (576, 329, 1120, 'O tema da pesquisa é pertinente e necessário. No entanto, está muito genérico e não traz critérios objetivos para mensurar de qual lugar e instituições se está falando. Não fica claro sobre os instrumentos de pesquisa utilizados: formulários, questionário, pesquisa na internet, nem o que seriam as determinadas sociedades de ensino. Qual o universo da pesquisa? Quantos questionários foram aplicados para a obtenção de 112 respondentes? É uma amostra de qual porcentagem, considerando que temos 181.939 escolas de educação básica no Brasil - de acordo com o Censo Escolar de 2018 – sendo que a maior parte desse total (60,6%) é de responsabilidade municipal, seguida da rede privada (22,3%). (http://portal.inep.gov.br/documents/186968/484154/Resumo+T%C3%A9cnico+-+Censo+da+Educa%C3%A7%C3%A3o+B%C3%A1sica+2018/ea4da895-169f-44d3-9442-0b87a612c63c?version=1.2)', 2.5, true);
INSERT INTO public.revisao VALUES (579, 348, 1446, 'Levando em conta o nível de ensino, o problema de pesquisa está bem construído e a metodologia está clara e bem delimitada. Considera-se que é preciso aprimorar os objetivos específicos, que são caminhos para se atingir o objetivo geral. Se o objetivo geral é compreender como o cinema representou o massacre de Katyn ,alguns objetivos específicos poderiam ser: -Identificar, através de revisão bibliográfica, as controvérsias historiográficas em torno do massacre de Katyn; -Mapear obras audiovisuais que problematizaram o referido evento histórico; -Analisar como essas obras se posicionam em relação às controvérsias historiográficas sobre o massacre de Katyn; Essas são sugestões, mas vocês podem melhorar os objetivos específicos de acordo com aquilo que fizeram durante a pesquisa. Em pesquisas futuras, vocês podem avançar na discussão teórica sobre a relação entre memória, verdade histórica e jogos de poder, a partir do caso do Massacre de Katyn ou até mesmo comparar com outros casos semelhantes.', 9.25, true);
INSERT INTO public.revisao VALUES (692, 218, 434, 'Como sugestões, o resumo precisa apresentar de forma mais clara ao leitor, qual o benefício do programador utilizar este exokernel. Desempenho? Segurança? Maior acesso ao hardware? É um formato diferente ou semelhante ao Docker? O resumo apresenta alguns erros gramaticais, precisando de uma revisão.', 6, true);
INSERT INTO public.revisao VALUES (679, 205, 1446, 'O título deve ser preciso, trazer os conceitos mobilizados no trabalho e dar ao leitor um panorama sintético do que vem pela frente. Nesse trabalho, o título está ambíguo, pois possibilita interpretar que a Segunda Guerra também ocorreu em Hollywood. Seria melhor algo do tipo: A Segunda Guerra: suas representações no cinema hollywoodiano contemporâneo. O problema de pesquisa está apresentado, mas é demasiado descritivo. O interessante em um projeto de pesquisa é trabalhar com problemas que mobilizem e problematizem os conceitos e os objetos que trabalhamos. Poderíamos pensar em algo como: As representações da segunda guerra mundial no cinema hollywoodiano contemporâneo seguem uma linha historiográfica hegemônica ou desafiam os discursos consolidados sobre a temática? O objetivo geral deve ser uma resposta ao problema de pesquisa, que oriente a realização dos objetivos específicos e as etapas metodológicas. Por exemplo: Compreender como a Segunda Guerra Mundial é representada no cinema hollywoodiano contemporâneo, à luz do debate historiográfico. Os objetivos específicos devem ser &#34;passos&#34; para se alcançar o objetivo geral. Por exemplo: -Identificar na literatura pertinente as representações mais consolidadas a respeito da Segunda Guerra Mundial; - Analisar as representações da Segunda Guerra Mundial em filmes Hollywoodianos. - Identificar pontos de aproximação e distanciamento entre as representações historiográficas e cinematográficas do objeto de estudo.', 7.25, true);
INSERT INTO public.revisao VALUES (427, 259, 223, 'O resumo como um todo atinge o objetivo de apresentar a pesquisa que está sendo empreendida. No entanto, tenho duas considerações que auxiliariam o leitor a identificar melhor alguns elementos da pesquisa. O problema de pesquisa, se apresentado em forma de pergunta, informa melhor o leitor da questão que a pesquisa busca resolver. O objetivo, por outro lado, é quase uma resposta a esse problema, representado numa frase que se utiliza de verbos no infinitivo para apresentar o que se busca no estudo.', 7.25, true);
INSERT INTO public.revisao VALUES (462, 297, 223, 'O presente resumo está muito bem escrito como um todo. No entanto, o mesmo parece relatar um projeto cujo foco se dá sobre ensino e extensão. Certamente o projeto também envolve pesquisa, mas o texto submetido não relata atividades investigativas. Nesse sentido, seria necessário reformular o texto para que o mesmo relate as atividades de pesquisa que podem estar sendo desenvolvidas no âmbito desse projeto.', 6.25, true);
INSERT INTO public.revisao VALUES (654, 294, 434, 'Algumas considerações quanto ao resumo: a) Não se deve identificar os participantes e contatos no texto do resumo; b) A questão de que os alunos apresentam dificuldade na aplicação da Bhaskara está repetitivo e em diversos trechos do resumo; c) A explicação do que é a Bhaskara é necessária, mas não justifica estar entre parênteses; d) Não utilizar expressões do dia a dia, como &#34;dar a resposta de bandeja&#34;; e) Organizar o resumo, pontuando a separação ao menos dos itens a seguir: problema, proposta, justificativa e resultado esperado. f) Sugere-se a realização de uma revisão gramatical.', 6.25, true);
INSERT INTO public.revisao VALUES (433, 280, 457, 'Sugiro a troca da palavra chave &#34;Acidente ambiental&#34; por &#34;superoleofílicas&#34; , &#34;oleofilica&#34; ou &#34;absorção&#34; por estarem mais ligadas ao objetivo da pesquisa.', 9.25, true);
INSERT INTO public.revisao VALUES (510, 228, 457, 'Sugiro a troca da palavra chave &#34;violência sexual&#34; por &#34;escola&#34; , já que o objetivo é verificar como o tema da pesquisa está sendo tratado neste contexto específico. Como bem explicado no resumo, o objetivo e a importância da Educação Sexual é mais amplo do que prevenção da violência sexual.', 8.5, true);
INSERT INTO public.revisao VALUES (486, 255, 555, 'O trabalho poderia ter um foco mais específico dentro da temática da desigualdade entre gêneros no ambiente de trabalho. O problema a ser investigado poderia ser número de mulheres que ocupam cargos de chefia e diferenças salariais entre homens e mulheres que ocupam o mesmo cargo.', 7.5, true);
INSERT INTO public.revisao VALUES (560, 196, 457, 'O problema da pesquisa precisa ser evidenciado. A metodologia de um trabalho é selecionada em função de atingir os objetivos propostos.Se motivo de fazer o questionário foi evidenciar o entendimento da comunidade escolar sobre o assunto, faltou colocar este propósito como objetivo.', 4.75, true);
INSERT INTO public.revisao VALUES (769, 242, 86, 'Parabéns! Excelente iniciativa!', 10, true);
INSERT INTO public.revisao VALUES (789, 354, 87, NULL, 8.75, true);
INSERT INTO public.revisao VALUES (614, 355, 457, 'O objetivo do trabalho está bem definido, mas a pesquisa bibliográfica não teve o foco apropriado para comprovar cientificamente o uso da vacina, de acordo com o proposto. O uso do questionário não está justificado, além disto não estão claros os conceitos de cientificismos e fake news empregados.', 3.5, true);
INSERT INTO public.revisao VALUES (664, 212, 457, 'O projeto está excelente, mas não é um projeto de pesquisa e sim de ensino e até extensão. Sugiro a troca do nome do projeto, pois &#34;retalhar&#34; da ideia de separar em pedaços e o projeto &#34;uni&#34; saberes de várias áreas, Sugiro Patchwork de saberes, em alusão as almofadas e união de conhecimentos e saberes.', 2.25, true);
INSERT INTO public.revisao VALUES (438, 223, 1212, 'Primeiramente, gostaria de parabenizar os autores pelo trabalho e pela escolha do tema, que é atual e de interesse público. No geral, o projeto está escrito de forma adequada, com linguagem acadêmica, o que contribui para o mérito científico do projeto. Além disso, a divisão do trabalho está muito bem estruturada. O objetivo geral, o tema, a justificativa, a metodologia e o problema de pesquisa foram descritos de forma clara e precisa no texto. A escrita foi direta, sem muitos rodeios e termos rebuscados, o que é o recomendado na área de ciências biológicas e exatas. Destaco um ponto positivo em relação à conclusão dos resultados, a mesma vai de encontro com o objetivo e a justificativa do texto, fornecendo um bom “fechamento” para o trabalho. A seguir, adiciono alguns pontos à refletir e algumas sugestões a sobre escrita. O recomendado é não utilizar no tópico de palavras-chave nenhuma palavra que esteja no título do trabalho. Primeiramente, logo na primeira frase, sugiro acrescentar “no estado brasileiro de Minas Gerais. Mesmo sendo um acontecimento de grande repercussão nacional e internacional, é necessário identificar corretamente a localização do acontecido. Além disso, é necessário corrigir a data do rompimento da barragem, pois o fato ocorreu no ano de 2019 e não em 2018, como é descrito no texto. Em relação à metodologia, sugiro acrescentar o termo “base de dados”, antes de Google Acadêmico. Nos resultados, sugiro trocar o termo “aparecimento” por “desenvolvimento”.', 9.5, true);
INSERT INTO public.revisao VALUES (411, 270, 947, 'Ótima pesquisa, com metodologia adequada e relevante, considerando o nível de ensino em que a pesquisa é realizada. Há necessidade de uma revisão textual e linguística (em função de pequenas incorreções de ordem gramatical). Parabéns!', 8.5, true);
INSERT INTO public.revisao VALUES (511, 228, 947, 'Ótimo projeto de pesquisa: tema relevante, atual, metodologia adequada, objetivos ótimos, conclusões explicitadas. No entanto, há pequenas incoerências ao longo do texto (repetições, omissões, por exemplo). O texto inicia abordando a violência em geral, depois sem apresentações/introduções passa a falar exclusivamente sobre violência sexual. Há necessidade de revisão textual e linguística, pois há pequenos problemas de ordem gramatical e isso ajudará a aperfeiçoar a escrita (que já está boa para este nível de ensino). Parabéns!', 8, true);
INSERT INTO public.revisao VALUES (561, 196, 947, 'Bom projeto de pesquisa. Há pequenas incoerência na apresentação da justificativa e delimitação do tema. Uma etapa posterior, poderia ser a realização de oficinas para promover uma melhor compreensão do tema por parte da comunidade acadêmica. Assim, os resultados ou conclusões da pesquisa poderiam ser difundidos e socializados com outros estudantes. Há necessidade de uma revisão textual e linguística em razão de pequenas inadequações de ordem gramatical. Parabéns pelo trabalho!', 6.5, true);
INSERT INTO public.revisao VALUES (592, 264, 1212, 'Primeiramente, gostaria de parabenizar os autores pelo trabalho e pela escolha do tema, que é atual e de extrema importância mundial. A seguir, adiciono alguns pontos à refletir e algumas dicas e sugestões, que talvez possam auxiliar os autores em trabalhos futuros. O título do projeto está um tanto abrangente, seria interessante deixa-lo mais específico, a fim de valorizar e chamar a atenção para o projeto. O recomendado é não utilizar no tópico de palavras-chave nenhuma palavra que esteja no título do trabalho. A introdução está um pouco longa, o tamanho poderia ser mais enxuto. No geral, a escrita deve ser mais longa nos tópicos de resultados e discussões. Também é recomendado evitar generalizações e informações que não possam ser comprovadas por referências bibliográficas. Sobre o objetivo geral do trabalho: este item deve indicar, de fato, o que pretende-se estudar. A forma como foi descrita no resumo indica que o objetivo do projeto é promover ações de educação ambiental, sendo que, segundo os outros tópico do resumo, o foco do projeto são os materiais biodegradáveis em si. O recomendado é escrever a metodologia no tempo verbal pretérito perfeito. Sugiro melhorarem a descrição dos meios de busca de dados na internet, como por exemplo, citar que a pesquisa foi feita em sites especializados sobre o tema. Seria interessante citarem o número de alunos entrevistados e mesmo sendo implícito, citar que trata-se de uma turma de estudantes, e escrever o nível de ensino. Nos resultados, faltou indicar (caso tenha sido feito) os dados obtidos nas entrevistas com os estudantes. Caso esses dados não tenham sido analisados, faltou indicar que os resultados são preliminares. A conclusão precisa ser construída com mais informações, sempre relacionando as conclusões com os resultados obtidos na pesquisa em si, e não em convenções do sentido comum. Como dicas gerais, recomendo observar a grafia correta das palavras, assim como o uso excessivo de adjetivos e o uso de figuras de linguagem. Diferentemente de outras áreas de estudo, a e escrita acadêmica, na área de ciências biológicas/saúde é extremamente direta, chegando quase a soar “quadrada”, e portanto, é recomendado manter a escriva de forma objetiva. Por fim, gostaria de dizer que o estudo possui grande potencial, e que com alguns ajustes e detalhes, há a possibilidade de criarem um trabalho com cada vez mais excelência cientifica. Reitero que não são críticas negativas, mas observações que possam contribuir com o desenvolvimento do trabalho e dos pesquisadores', 5, true);
INSERT INTO public.revisao VALUES (608, 201, 555, 'O assunto é muito relevante, pois refere-se a um período de nossa história que não devemos esquecer. Sugiro uma boa revisão do texto, pois apresenta erros de ortografia (Ex.: concientização) e ou digitação e alguns problemas de clareza. Algumas frases poderiam ser reescritas.', 6.75, true);
INSERT INTO public.revisao VALUES (663, 212, 555, 'O trabalho está muito bom! Inspirar as pessoas, convidá-las a ler poesia e a refletir sobre a presença da natureza no nosso cotidiano são ações essenciais em nossos tempos. Parabéns! Sugiro acrescentar, nas palavras-chave, a palavra natureza. Corrigir as seguintes partes: do 7º anos; freqüência; Estes (refere-se ao que será dito); benefícios;', 9.5, true);
INSERT INTO public.revisao VALUES (762, 335, 86, 'Considerei o projeto criativo e interessante. No entanto, penso que um dos experimentos precisava ter sido feito anteriormente e, na feira, um novo experimento, de forma a poder comparar os dois. Assim, o projeto teria algum resultado a priori para mostrar e, no dia da feira, validaria ainda mais a questão. No mais, adorei o assunto e desejo sucesso nos cálculos ao longo da feira.', 8, true);
INSERT INTO public.revisao VALUES (758, 326, 86, 'Excelente tema! Muito relevante. O resumo só não deixa claro a metodologia utilizada: foram feitas pesquisas em que materiais? Foi entrevistado algum profissional do meio-ambiente? Desejo uma excelente pesquisa para vocês!', 8.25, true);
INSERT INTO public.revisao VALUES (763, 222, 86, 'Pesquisa de cunho muito relevante e bem construída. Apenas não notei, na discussão das justificativas e resultados, a problematização sobre essas novas competências para o mercado. É importante reconhecê-las, mas também refletir criticamente sobre essas exigências.', 9.25, true);
INSERT INTO public.revisao VALUES (764, 273, 86, 'Gostei muito do projeto e da forma objetiva como o resumo foi construído. No entanto, ao ler os resultados obtidos, parece que o projeto teve dois objetivos e acaba não ficando claro se a necessidade era conhecer a mortalidade através do uso da citronela ou a mais eficaz extração do óleo essencial. No mais, parabéns!', 9, true);
INSERT INTO public.revisao VALUES (766, 313, 86, 'Muito interessante o projeto, no entanto, não fica claro quais os produtos são produzidos a partir do reaproveitamento de resíduos da cozinha. Pelo título e palavras-chave, intui-se que são tintas, mas a metodologia e os resultados esperados deviam deixar isso mais claro.', 7.5, true);
INSERT INTO public.revisao VALUES (775, 349, 86, 'Considero o tema bastante relevante e a pesquisa bem construída. A forma como foi escrito, no entanto, o resumo, deixa o resultado da pesquisa um pouco confuso. Redigir mais claramente em novas submissões. Boa pesquisa!', 8.5, true);
INSERT INTO public.revisao VALUES (784, 213, 86, 'O projeto é muito interessante, no entanto, não fica claro em que ponto o projeto se encontra. Boa parte do resumo foi utilizado para a justificativa que poderia ser mais objetiva. Há alguns erros de ortografia.', 9.25, true);
INSERT INTO public.revisao VALUES (783, 334, 86, 'O projeto é muito interessante, mas não fica claro como o assunto despertou interesse na comunidade escolar que, parcialmente, respondeu ao questionário. O tema é muito relevante, parabéns!', 9.5, true);
INSERT INTO public.revisao VALUES (767, 307, 434, 'Olá! Deixo abaixo algumas sugestões para melhoria do resumo: - quando escreves que os alunos apresentam dificuldades no curso, deves especificar qual nível e área deste curso; - quando escreves que a intérprete de libras do Campus Canoas avaliará, sugiro que coloque todo o nome da instituição ou utilize apenas &#34;será avaliado por uma intérprete de libras&#34;; - o trecho &#34;Diante das melhorias proporcionadas pelo projeto, foi pensado em ampliar o ambiente, o tornando acessível a alunos não ouvintes, a partir da utilização da Suíte Vlibras, responsável por realizar a tradução dos textos didáticos presentes no TriLogic com o auxílio de um intérprete 3D para interação com o usuário. Logo, o objetivo estabelecido pelo projeto foi de promover a adequação do ambiente TriLogic de forma a atender, além de alunos ouvintes, os alunos não ouvintes.&#34; parece estar repetindo a afirmação.', 8.25, true);
INSERT INTO public.revisao VALUES (797, 367, 87, 'Projeto Homologado via Feira Afiliada', 7.5, true);
INSERT INTO public.revisao VALUES (795, 366, 87, 'Projeto Homologado via Feira Afiliada', 7.5, true);
INSERT INTO public.revisao VALUES (791, 365, 87, 'Projeto Homologado via Feira Afiliada', 7.5, true);
INSERT INTO public.revisao VALUES (793, 364, 87, 'Projeto Homologado via Feira Afiliada', 7.5, true);
INSERT INTO public.revisao VALUES (792, 364, 86, 'Projeto homologado via Feira Afiliada (PM Canoas);', 7.5, true);
INSERT INTO public.revisao VALUES (796, 367, 86, 'Projeto homologado via Feira Afiliada (PM Canoas)', 7.5, true);
INSERT INTO public.revisao VALUES (794, 366, 86, 'Projeto homologado via Feira Afiliada (PM Canoas).', 7.5, true);
INSERT INTO public.revisao VALUES (801, 439, 87, 'Sem comentários.', 10, true);
INSERT INTO public.revisao VALUES (808, 429, 535, 'O projeto está excelente, parabéns pela iniciativa', 10, true);
INSERT INTO public.revisao VALUES (815, 379, 535, 'O projeto está muito bem escrito e aborda um tema muito relevante, parabéns pela iniciativa', 10, true);
INSERT INTO public.revisao VALUES (821, 371, 1615, 'Pelo resumo elaborado, a proposta de estudo parece estar encaminhada, bem como há um grande potencial para usuários para a aplicação proposta. O projeto se enquadra em uma temática muito promissora, a da conservação do meio ambiente, portanto acho relevante seu desenvolvimento e publicação no evento.', 8, true);
INSERT INTO public.revisao VALUES (831, 373, 1615, 'O resumo apresenta adequadamente o projeto proposto. A problemática é relevante, e a solução proposta interessante e promissora. Acredito que este projeto tem bastante potencial, por isso recomendo a publicação neste evento, assim como a a continuação da pesquisa, tenho interesse em ver o aplicativo terminado.', 7.25, true);
INSERT INTO public.revisao VALUES (828, 423, 1615, 'Achei o projeto interessante, todavia acho importante que seja destacada qual a diferença da aplicação proposta das tecnologias que já temos disponíveis, pois uma aplicação para geolocalização escolar é um aplicativo que já temos várias opções disponíveis no portfólio de empresas como o Google, o próprio site da instituição oferece divulgação de informações básicas como: contato e localização, também divulgação de eventos e projetos, então deveria ser descrito qual o real diferencial deste aplicativo, em meio as dezenas que já existem.', 6.5, true);
INSERT INTO public.revisao VALUES (804, 374, 207, 'Projeto relevante, bem problematizado, trazendo a questão feminina como elemento de interesse e discussão.', 7.75, true);
INSERT INTO public.revisao VALUES (826, 384, 1615, 'Este projeto tem um grande potencial e de possibilidade de alcance de muitos usuários. É uma proposta inovadora e interessante, dessa forma recomendo fortemente sua publicação, bem como a continuidade do projeto. Sugiro também que o lançamento do jogo fosse publicado a toda a comunidade do IFRS, acho que realmente pode ser muito aproveitado pelos alunos.', 10, true);
INSERT INTO public.revisao VALUES (846, 385, 920, 'Penso que a área de conhecimento do trabalho é Ciências Humanas e afins.', 5.25, true);
INSERT INTO public.revisao VALUES (905, 420, 1603, 'Parabéns pela pesquisa.', 10, true);
INSERT INTO public.revisao VALUES (817, 386, 1725, 'O projeto é bastante relevante. No entanto, senti falta dos resultados esperados ou parciais.', 8.5, true);
INSERT INTO public.revisao VALUES (903, 399, 1600, 'Sugere-se: substituir &#39;Neste trabalho&#34; por &#34;Na pesquisa&#34; explorar melhor as palavras-chave', 7.75, true);
INSERT INTO public.revisao VALUES (870, 395, 920, 'Revisar pequenos erros gramaticais.', 10, true);
INSERT INTO public.revisao VALUES (906, 411, 1600, 'Sugere-se deixar mais claro objetivos, justificativa e metodologia. Também, explorar mais as palavras-chaves.', 5, true);
INSERT INTO public.revisao VALUES (893, 438, 535, 'Projeto de grande potencial inovador', 10, true);
INSERT INTO public.revisao VALUES (840, 425, 106, 'Os instrumentos de cólera de dados não permitem inferir resultados para todos os leopoldenses, uma vez que não se tem uma amostragem representativa da população. Isso não tira o mérito do trabalho. No entanto, sugiro fazer uma ressalva nesse sentido no texto.', 6.5, true);
INSERT INTO public.revisao VALUES (880, 369, 106, 'O resumo está adequadamente escrito. O projeto tem mérito', 9.25, true);
INSERT INTO public.revisao VALUES (865, 432, 535, 'Projeto excelente com grande potencial inovador', 10, true);
INSERT INTO public.revisao VALUES (891, 398, 535, 'Não entendi a conexão da frase &#34;Além disso, solucionar o problema da corrupção é fundamental, visto que os investimentos no setor é lento.&#34; com as demais partes do texto', 8, true);
INSERT INTO public.revisao VALUES (879, 433, 535, 'Não ficou claro quais as ações para preservação dos recursos hídricos foram/são indicadas', 8.25, true);
INSERT INTO public.revisao VALUES (908, 407, 207, 'Projeto muito relevante. Recomenda-se discutir mais a metodologia.', 8, true);
INSERT INTO public.revisao VALUES (902, 399, 1608, 'Não há.', 8.25, true);
INSERT INTO public.revisao VALUES (907, 411, 1608, 'Não há.', 10, true);
INSERT INTO public.revisao VALUES (822, 372, 1607, 'Metodologia não é explícita.', 8.5, true);
INSERT INTO public.revisao VALUES (825, 370, 1607, 'A Metodologia não está explícita', 8, true);
INSERT INTO public.revisao VALUES (896, 435, 1607, 'Qual é o objetivo da pesquisa? E o qual é o produto final da mesma? Não está claro no resumo tais questionamentos.', 7, true);
INSERT INTO public.revisao VALUES (858, 428, 1597, 'Para comparação, realizar também testes com amostras de madeira aglomerada convencional (comercial).', 9.25, true);
INSERT INTO public.revisao VALUES (869, 403, 516, 'Parabéns pelo trabalho. Sugiro inserir, ao final do resumo, as conclusões obtidas a partir dos dados relatados. Ou seja, há relação entre os hábitos alimentares e o humor dos estudantes do EMI? Abraço.', 9.75, true);
INSERT INTO public.revisao VALUES (839, 425, 652, 'Podria ter trazido mais informações sobre a metodologia. Quantidade de dados coletados ou mais alguns informações.', 8.25, true);
INSERT INTO public.revisao VALUES (814, 379, 543, 'O projeto é muito interessante. Está muito bem apresentado e elaborado. Talvez a apresentação de um cronograma para as etapas seja interessante na parte de desenvolvimento da pesquisa.', 10, true);
INSERT INTO public.revisao VALUES (810, 421, 92, 'Bom trabalho.', 7.75, true);
INSERT INTO public.revisao VALUES (843, 388, 508, 'O trabalho está bem organizado, no entanto sugiro descrever melhor a metodologia desenvolvida durante a pesquisa. Parabéns ao grupo!', 9.75, true);
INSERT INTO public.revisao VALUES (857, 419, 508, 'O projeto está bem estruturado e escrito com clareza. Parabéns ao integrantes do grupo!', 10, true);
INSERT INTO public.revisao VALUES (860, 416, 508, 'O trabalho está bem delineado, escrito com clareza e bem objetivo. Parabéns ao grupo!', 10, true);
INSERT INTO public.revisao VALUES (871, 395, 508, 'O projeto está bem organizado e escrito de forma objetiva. Parabéns aos integrantes!', 10, true);
INSERT INTO public.revisao VALUES (811, 421, 305, 'É citado que será apresentado soluções em um artigo final??? Esse é o artigo final e por isso o mesmo não apresenta conclusões lógicas.', 5.5, true);
INSERT INTO public.revisao VALUES (827, 384, 305, 'Poderia explicar um pouco mais como seria o jogo casual visto que cita apenas exemplos mas o que o Seranus tem fica na expectativa.', 7, true);
INSERT INTO public.revisao VALUES (820, 371, 305, 'Poderia evidenciar o que já tem desenvolvido ao invés do que será desenvolvido', 7.5, true);
INSERT INTO public.revisao VALUES (882, 422, 86, 'Trabalho muito interessante e extenso. Sugiro, apenas, refinar a pesquisa acessando periódicos de indexadores científicos como o SCIELO, SCOPUS, entre outros.', 9.5, true);
INSERT INTO public.revisao VALUES (832, 377, 136, 'Explicitar no resumo os objetivos do trabalho', 9.25, true);
INSERT INTO public.revisao VALUES (920, 431, 136, 'Trabalho relevante e com possibilidade de ampliação para estudos futuros.', 10, true);
INSERT INTO public.revisao VALUES (886, 392, 86, 'A pesquisa tem muito mérito e aborda assunto de extrema importância. O resumo, no entanto, pode ser elaborado de forma mais objetiva para evidenciar os aspectos como objetivo, conclusões, etc., de forma mais assertiva.', 9, true);
INSERT INTO public.revisao VALUES (938, 406, 136, 'Sugiro ajuste da palavra &#34;óbito&#34; no título do resumo. Trabalho relevante para o resgate histórico sobre a constituição social da população no Estado e com possibilidade de continuidade em trabalhos futuros.', 10, true);
INSERT INTO public.revisao VALUES (899, 400, 1603, 'O resumo carece de explicitar qual o objetivo da pesquisa, e seria mais esclarecedor para o leitor elencar os objetivos específicos. Também não foi apresentado a forma como os dados foram coletados, ou como ainda pretendem coletar os dados futuros, dessa forma não fica claro como os &#34;prejuízos&#34; estão diretamente conectados durante o isolamento social e não por outras variáveis, pois pode ocorrer que os problema emocionais já existam antes do isolamento e somente agora vieram a tona por conta da pesquisa e não por causa direta do isolamento social.', 6, true);
INSERT INTO public.revisao VALUES (912, 442, 136, 'Necessidade de apresentar de forma clara os objetivos e metodologia do trabalho', 7.25, true);
INSERT INTO public.revisao VALUES (842, 391, 1605, 'O resumo apresenta pequenos erros de ortografia e pontuação. No entanto, o trabalho está bem estruturado, mostrando-se muito relevante.', 8, true);
INSERT INTO public.revisao VALUES (936, 437, 136, 'Relevante pesquisa', 10, true);
INSERT INTO public.revisao VALUES (922, 415, 136, 'Pesquisa relevante e apresenta possibilidade de estudos futuros', 10, true);
INSERT INTO public.revisao VALUES (933, 436, 1600, 'Sugere-se que no resumo fique claro se trata de projeto de pesquisa/extensão/ensino.', 7.5, true);
INSERT INTO public.revisao VALUES (929, 383, 1603, 'Parabéns pela pesquisa.', 9.25, true);
INSERT INTO public.revisao VALUES (926, 380, 1600, 'Sugere-se que fique claro qual tipo de cânone se faz referência. Seria ao tradicional?', 9.5, true);
INSERT INTO public.revisao VALUES (937, 437, 1603, 'Parabéns pela pesquisa.', 10, true);
INSERT INTO public.revisao VALUES (872, 404, 920, 'Faltou evidenciar: o problema, a metodologia e os resultados ou conclusões, mesmo que parciais.', 4, true);
INSERT INTO public.revisao VALUES (901, 389, 1600, 'Sugere-se: explorar mais as palavras-chave; na primeira frase deixar claro que se trata de tal idioma; deixar clara qual positividade é essa percepção mais clareza quanto objetivos e metologia; se é projeto de pesquisa; direcionar melhor o título ao foco do trabalho, pois é muito amplo', 4.75, true);
INSERT INTO public.revisao VALUES (812, 378, 1725, 'O tema da pesquisa é bastante relevante. Todavia, o resumo apresenta alguns problemas. O mais indicado é após &#34;topográficas de prejuízo&#34;, acrescentar um ponto e iniciar a próxima frase com letra maiúscula. Faltou separar melhor cada tópico do seu trabalho (Introdução, problema e justificativa; objetivo(s); metodologia e resultados esperados). A forma como está escrita deixa o leitor um pouco confuso. Senti falta de uma metodologia bem definida e dos resultados esperados.', 6.75, true);
INSERT INTO public.revisao VALUES (940, 412, 1603, 'Parabéns pela inciativa e pesquisa. Segue alguns questionamentos: - Porque o enfoque na área de humanidades, se a lei é para todo o sistema de ensino? - Ter referencias negras é suficiente para afirmar que se está seguindo a lei 10.639/03? -Antes de trabalhar na formação dos discentes, não seria interessante e importante trabalhar na re-formação (ou atualização) dos docentes? -E qual a formação acadêmica do docentes que devem seguir a lei? Na própria formação, as referencias não são centradas na figura do patriarcado? -Palavras-chaves devem aparecer no corpo do resumo, por isso são &#34;chave&#34;. Isso não ocorre com a palavra &#34;Descolonização&#34;.', 9.5, true);
INSERT INTO public.revisao VALUES (841, 391, 720, 'Olá, a proposta do trabalho é muito interessante e mostra a preocupação dos estudantes com questões como a fome, agricultura sustentável, assim como preocupações com a saúde e o bem estar. O resumo está bem redigido, mas não consigo identificar com clareza a proposta de investigação, bem como os objetivos almejados. Espero que a apresentação possa contemplar estas dúvidas. Obs.: Fazer uma revisão ortográfica, no título a palavra &#34;biotecnológico) está sem acento, e na primeira linha do resumo aparece a palavra &#34;isando&#34;, creio que tenha sido suprimida a letra &#34;v&#34;. Parabéns pelo trabalho e estou ansioso par poder ver os resultados obtidos.', 7.75, true);
INSERT INTO public.revisao VALUES (919, 414, 1603, 'Parabéns pela pesquisa.', 10, true);
INSERT INTO public.revisao VALUES (925, 387, 1603, 'Parabéns pela pesquisa. Segue alguns questionamentos: - Por que o números de negros que perpassaram pelas &#34;pias batismais nas diferentes capelas do RS entre 1780 e 1850&#34; dariam a representatividade dos negros no RS? -Todos negros e negras foram batizados? E os que morreram no percurso até o RS? -Com os resultados esperados, quais seriam os possíveis impactos para a sociedade do RS? E quais seriam o impacto nas escolas? -Os conteúdos escolares, apesar da obrigatoriedade de se ensinar a cultura africana, estão sendo revisados nas escolas? - Onde se pretende arquivar todas as remeniscências?', 10, true);
INSERT INTO public.revisao VALUES (854, 405, 720, 'Olá, não identifiquei relação entre o título e o resumo, pois ao ler o resumo identifica-se a proposta de investigação com o objetivo de destacar a importância da agricultura familiar e como os recursos municipais foram utilizados, mas não apresenta relação com o estágio citado no título. Com relação a metodologia utilizada e com os dados apresentados não consigo perceber que os objetivos foram totalmente alcançados, visto que foram apresentados dados sobre os investimentos mas não destacando a importância da agricultura familiar. Espero que a apresentação possa contemplar estas dúvidas. Parabéns pelo trabalho, pois se tratada de um tema relevante e importante para as comunidades rurais, assim como para a alimentação saudável dos estudantes.', 8.5, true);
INSERT INTO public.revisao VALUES (914, 402, 1592, 'o resumo está coerente e apresenta todos os aspectos para o entendimento do leitor.', 10, true);
INSERT INTO public.revisao VALUES (924, 387, 1592, 'Pesquisa de grande relevância, traz todos os aspectos no resumo para o entendimento do leitor.', 10, true);
INSERT INTO public.revisao VALUES (941, 412, 1592, 'Pesquisa de grande relevância, necessária e urgente! O resumo traz todos os aspectos para o entendimento do leitor.', 10, true);
INSERT INTO public.revisao VALUES (934, 394, 1608, 'Não há.', 9.25, true);
INSERT INTO public.revisao VALUES (928, 383, 1608, 'não há', 9.75, true);
INSERT INTO public.revisao VALUES (923, 415, 1608, 'não há', 9.75, true);
INSERT INTO public.revisao VALUES (917, 427, 87, 'Pesquisa muito relevante. Parabéns.', 9.5, true);
INSERT INTO public.revisao VALUES (913, 442, 1631, 'A proposta não apresenta justificativa, objetivos, metodologia e resultados, pois foi redigido em formato de texto dissertativo-argumentativo, contendo citações de dados e de impressões pessoais, não se configurando, assim, como um projeto de pesquisa.', 1.75, true);
INSERT INTO public.revisao VALUES (927, 380, 1631, 'Esta proposta é um bom trabalho!', 8.25, true);
INSERT INTO public.revisao VALUES (939, 406, 1631, 'No geral, é uma boa proposta!', 7.5, true);
INSERT INTO public.revisao VALUES (853, 375, 920, 'Há erros de digitação que comprometem o entendimento, além de erros ortográficos e gramaticais. E o texto não apresenta os itens básicos necessários a um resumo como: Introdução/Justificativa, Objetivo(s), Metodologia, Resultados parciais/finais e Conclusões/considerações finais.', 1, true);
INSERT INTO public.revisao VALUES (915, 402, 1600, 'Sugere-se deixar claro quais questões de gênero se refere. A ideia está incompleta neste trecho &#34;Helena de Tróia foi abordada de diversas maneiras por inúmeros autores ao longo da história&#34; &#34;O estudo se justifica pelo fato de ser fundamental compreender o feminino atualmente&#34;, deixar claro; Compreender o feminino onde? &#34;discursos de diferentes autores ao longo do tempo&#34;, discursos sobre Helena de Tróia? &#34;compreender o feminino e o amor no início do Império Romano&#34; ou &#34;O estudo se justifica pelo fato de ser fundamental compreender o feminino atualmente&#34;. Todos os aspectos apontados tem a função de qualificar melhor o texto para próximos possíveis eventos.', 6.25, true);
INSERT INTO public.revisao VALUES (803, 424, 1592, 'O projeto como está descrito não configura como projeto de pesquisa na sua essência, mas entendo que poderá vir a ser, a proposta, até mesmo pelo prazo de 6 meses, se configura como extensão. Sugiro que seja realizada uma pesquisa longitudinal, para que seja possível mensurar se as ações do projeto cumpriram com todos os objetivos, impactando de forma efetiva a vida dessas empresas, se configurando assim uma pesquisa de impacto na aplicabilidade.', 6.25, true);
INSERT INTO public.revisao VALUES (900, 389, 1592, 'O trabalho tem mérito para um pesquisa de impacto por conta da aplicabilidade e de grande relevância no tema, entretanto o resumo não foi escrito para que tenha esse alcance, sugiro refazer o resumo, corrigir algumas palavras empregadas incorretamente que dificultam o entendimento do leitor, por exemplo, o trabalho está em andamento, então subtrair palavras no futuro.', 6, true);
INSERT INTO public.revisao VALUES (866, 434, 720, 'Olá, muito interessante a proposta de pesquisa, visando validar ou não as crenças populares como o tratamento por &#34;plantas medicinais&#34;. O trabalho está muito bem redigido e contemplando quase que todas as etapas, tema, objetivos, problema de pesquisa, metodologia e resultados, no entanto não foi possível perceber no texto a justificativa da pesquisa. Parabéns pelo trabalho.', 9.25, true);
INSERT INTO public.revisao VALUES (931, 418, 1592, 'Pesquisa de relevância importantíssima para a transformação digital tão em voga que estamos vivenciando, o resumo traz todos os aspectos para o entendimento do leitor.', 10, true);
INSERT INTO public.revisao VALUES (862, 430, 720, 'Olá, parabéns pelo trabalho. Uma pesquisa desta têm muito a contribuir para futuros estudos referentes a qualidade das águas doces e dos peixes, principalmente na nossa região. Com relação aos dados apresentados referentes ao Rio dos Sinos, um dos principais rios da região metropolitana nos traz um alerta, para que não voltamos a ter um episódio semelhante ao de 2006 com a mortandade de peixes. O que me deixou intrigado (ou curioso) foi o fato de haver maior concentração de microplásticos na região P1 em Caraá na nascente do Rio dos Sinos em comparação com a região Metropolitana de Sapucaia.', 10, true);
INSERT INTO public.revisao VALUES (845, 385, 1604, 'Sobre o título, indico que possa ser melhorado, pois não há indicações numéricas sobre o aumento mencionado, nem quais transtornos mentais estão sendo estudados. Sugestão &#34;Impactos da pandemia na saúde mental&#34;. É possível alterar a escrita da metodologia apenas referenciando que foi realizada uma revisão bibliográfica sobre o assunto. De fato, importante atentar para a busca de artigos e publicações com credibilidade ao invés de sites em geral. A escrita dos resultados e o que foi encontrado na pesquisa poderia ser melhorar quanto à língua portuguesa. Sugestão: Diminuir o tamanho das frases e evitar a pessoalidade do autor ao referir o que encontrou na pesquisa. Exemplo: Trocar &#34;tive conhecimento que...&#34; por &#34;através da análise dos dados, contatou-se que...&#34;. No mais, acredito que seja um trabalho com potencial e interessante para ser discutido no nível onde está inscrito.', 8.75, true);
INSERT INTO public.revisao VALUES (875, 390, 106, 'A metodologia utilizada não ficou clara. Imagino que tenha sido frita uma análise documental, mas não foi dito como nem em quais veículos da mídia a pesquisa foi feita.', 6, true);
INSERT INTO public.revisao VALUES (809, 429, 75, 'Excelente tema, de muita relevância. Poderia deixar mais claro a questão problema, bem como a metodologia do projeto.', 7.75, true);
INSERT INTO public.revisao VALUES (883, 422, 106, 'O trabalho tem relevância. Não ficou claro qual foi o referencial adotado para chegar à conclusão dos resultados. Qual o parâmetro utilizado para afirmar que houve diminuição da poluição nos grandes centros? Valores de 2019? Ou de outros anos?', 8.5, true);
INSERT INTO public.revisao VALUES (884, 381, 106, 'O trabalho tem muita relevância. Foram apresentados alguns resultados, como densidade, que se tornam sem sentido para o leitor, pois não há uma referência para comparação como, por exemplo, uma embalagem utilizada por empresas de fast food.', 8, true);
INSERT INTO public.revisao VALUES (807, 382, 1602, 'Como sugestão pode-se incluir no título a palavra controlado, ou programável, para especificar que se trata de um dispositivo que pretende realizar a marcha com algum tipo de assistência computacional, se for mesmo este o caso.', 9.5, true);
INSERT INTO public.revisao VALUES (889, 397, 106, 'O primeiro objetivo parte do pressuposto de que há alterações genéticas decorrentes da poluição por gases de efeito estufa. Poderia deixar mais aberto: investigar as alterações que os gases de efeito causam no organismo humano. Foi feita a pesquisa no repositório só com foco na China? Por que, então, o texto inicia falando no Brasil? Seria mais abrangente utilizar outras bases de dados, como o Google acadêmico.', 6.25, true);
INSERT INTO public.revisao VALUES (816, 386, 1602, 'O projeto é muito interessante. O resumo deixa dúvidas com relação ao estado de desenvolvimento do projeto, uma vez que se refere a mais um desenvolvimento de protótipo dentre outros, mas não especifica quais melhorias que se propõe. Entendemos que isto é muito difícil de elucidar apenas no resumo, mas aguardamos com curiosidade a apresentação do projeto se for classificado. Sugerimos também que as palavras &#34;sendo hipotetizado&#34; sejam substituidas por &#34;tendo como hipótese principal&#34;.', 9.75, true);
INSERT INTO public.revisao VALUES (904, 420, 207, 'Muito boa a proposta de pessquisa. Parabéns!', 8.5, true);
INSERT INTO public.revisao VALUES (897, 435, 207, 'Faltou informar qual era o número total de estudantes analisados pelo projeto.', 7.5, true);
INSERT INTO public.revisao VALUES (819, 440, 1595, 'O trabalho apresenta um projeto voltado a um tema extremamente relevante. A preocupação com estudantes da comunidade surda torna o projeto ainda mais relevante, já que muitas ferramentas de desenvolvimento de software atuais não são acessíveis a pessoas com deficiência. Fiquei com uma dúvida: a pesquisa bibliográfica inicial contemplou soluções que apresentem acessibilidade para surdos? Ao desenvolver a parte de acessibilidade do projeto, foram consultados intérpretes de libras ou pessoas da comunidade surda? O Vlibras contempla sinais específicos para termos técnicos na área de lógica de programação? Sei que o espaço para o resumo é limitado, mas essas são questões que surgiram quando li o resumo e que acho interessantes de, se possível, serem acrescentadas ao texto.', 9.75, true);
INSERT INTO public.revisao VALUES (830, 373, 1595, 'O projeto é bastante interessante. Foi pensado em alguma pesquisa de opinião prévia para verificar a aceitação de tal solução junto ao público?', 9.25, true);
INSERT INTO public.revisao VALUES (823, 372, 1595, 'Gostei muito da proposta do trabalho. Uma questão que me preocupa um pouco é a questão da alfabetização digital de idosos. É claro que, ao se trabalhar com idosos universitários, a chance de que essas pessoas tenham mais familiaridade com a tecnologia é maior. Existe alguma pesquisa que demonstre esse fato?', 9.75, true);
INSERT INTO public.revisao VALUES (916, 427, 1608, 'Não há.', 10, true);
INSERT INTO public.revisao VALUES (851, 396, 1597, 'É necessário uma revisão de Português, há vários erros de grafia e concordância, além de palavras repetidas ou desnecessárias. O resumoestá muito confuso, os temas ambientais, em demasiado número, vão sendo apresentados ao longo do texto sem o aprofundamento necessário. Os resultados não são claros, e não estão suficientemente relacionados com os objetivos e a metodologia, que foi insuficientemente descrita.', 3.75, true);
INSERT INTO public.revisao VALUES (867, 434, 1597, 'A concentração é uma variável importante nos resultados obtidos, porém nenhuma indicação da relação substrato/solvente utilizada e fator(es) de diluição foi descrita. Também não foi descrita como a triagem fitoquímica foi realizada.', 9.25, true);
INSERT INTO public.revisao VALUES (863, 430, 1597, 'Trabalho muito interessante e relevante. Sugiro critérios para amostragem e tratamento da água, que pode comprometer os resultados. Caracterizar (descrever) os pontos de amostragem (P1 e P2) e relacionar com os resultados.', 9.25, true);
INSERT INTO public.revisao VALUES (833, 377, 1656, 'Parabéns pela escolha do tema e pela realização do trabalho! Os autores afirmam que a adaptação projetada é viável. Como sugestão, acredito que possa ser especificado em qual sentido se deu a viabilidade do projeto. Seria do ponto de vista técnico? Econômico? Ou ambos? Bom trabalho!', 10, true);
INSERT INTO public.revisao VALUES (849, 408, 516, 'O resumo deve conter o tema, problema, objetivos e justificativa do trabalho, além de comentar os resultados (obtidos ou esperados). Neste sentido, creio que o resumo foi confundido com parte da introdução, no qual o tema é apresentado e explicado.', 3.5, true);
INSERT INTO public.revisao VALUES (873, 404, 516, 'Parabéns pela pesquisa. O entendimento do problema de pesquisa ficou prejudicado por conta da frase inicial do resumo &#34;Neste projeto temos como objetivos aprimorar o entendimento das ideias de Nikola Tesla, especificamente os conceitos do eletromagnetismo, e perceber outras formas de aproveitamento das mesmas, bem como ampliar os conhecimentos do idioma espanhol&#34;. Dado que não fica claro o que seriam as outras formas de aproveitamento das ideias de Tesla. Abraço.', 9.25, true);
INSERT INTO public.revisao VALUES (802, 424, 982, 'O único ponto de melhoria está nas palavras-chave que são &#34;Viamão - RS ; Administração ; Empreendedor;&#34;. As mesmas não deixam claro a relevância do trabalho, pois este estudo pode ser aplicado em qualquer cidade e terá a mesma relevância. Sugiro que inclua alguma palavra que relacione a assessoria do projeto e o fortalecimento da economia local. Inclusive, pode ser mencionado no título também a questão do fortalecimento da economia.', 9, true);
INSERT INTO public.revisao VALUES (895, 426, 982, 'O projeto é muito relevante neste contexto atual e portanto, deve ser disseminado os dados de pesquisa, ao maior número de pessoas. Sugiro que no final do resumo &#34; acompanhadas por um profissional&#34;, seja alterado por um médico e um psicólogo. Pois o conforme os dados, essas pessoas podem ter afetada a saúde física e a psicológica, como já mostra o estudo. Sugiro acrescentar a &#34;qualidade de vida&#34;, nas palavras-chave.', 9.75, true);
INSERT INTO public.revisao VALUES (918, 414, 982, 'A proposta da pesquisa é entender &#34;COMO A PANDEMIA AFETOU A ESCOLARIDADE&#34;, porém no resumo não apresenta os dados de evasão escolar durante a pandemia. Mostra dados anteriores, porém saber quantos da população não tem internet, não indica que quem não possui esses recursos, tenham desistido de estudar. Mesmo que haja desinteresse na aprendizagem, como o resumo mostra, ainda sim, não quer dizer que os mesmos evadiram.', 5.25, true);
INSERT INTO public.revisao VALUES (932, 436, 982, 'O projeto é de extrema relevância, pois a escrita é melhorada através de revisão e leitura. Quando se assume a figura de revisor, é possível questionar o seu próprio ponto de vista, escrita e ainda aprender mais sobre as temáticas, pois possibilita ter acesso a diversas visões sobre o mesmo assunto.', 10, true);
INSERT INTO public.revisao VALUES (910, 417, 982, 'O projeto é muito relevante e sugiro que sejam expostos para as instituições participantes, os dados gerais, sem mencionar a que IF pertence determinada informação, como utilizando dados quantitativos. Isso é importante para adaptação do contexto pedagógico. Faltou apresentar dados mínimos de resultados da pesquisa, pois somente afirma que os mesmos sentiram vontade de manter o vínculo com a instituição após a pesquisa, porém não demonstra por exemplo: quantos % estão atuando na sua área, o quanto mudou a vida deles por terem estudado no IF, entre outros.', 9, true);
INSERT INTO public.revisao VALUES (818, 440, 1726, 'Acredito que seria interessante, num futuro, apresentar os resultados com os alunos não ouvintes também, para verificar se as alterações com a VLibras surtiram o efeito desejado ou se é necessário adaptar ainda mais a plataforma.', 9.25, true);
INSERT INTO public.revisao VALUES (813, 378, 543, 'A metodologia não foi apresentada, o que está coerente porque o meu acesso foi apenas ao resumo e, tradicionalmente, não apresenta-se metodologia em um resumo. O questionário de avaliação é bastante incoerente porque o resumo não serve para avaliar pontos como objetivo, metodologia, desenvolvimento, etc. As perguntas de avaliação são direcionadas para alguém que tem acesso ao trabalho completo, onde é possível a leitura detalhada de objetivos, metodologia que serão utilizadas, como será feito e o que espera-se atingir e de que forma, com embasamento teórico...enfim, muitos detalhes que não devem entrar em um resumo - até porque deixaria de ser um resumo. Voltando ao resumo em análise...excelente projeto, muito bem escrito, claro na apresentação e promissor.', 9, true);
INSERT INTO public.revisao VALUES (859, 428, 543, 'Excelente projeto de pesquisa! Muito bem escrito e estruturado. Todas as etapas estão bem explicadas e planejadas, inclusive a comparação com placas de serragem. Estou curiosíssimo pela apresentação dos resultados de comparação em situações de pressão transversal, resistência à umidade, etc...', 9.75, true);
INSERT INTO public.revisao VALUES (829, 423, 1726, 'O título do trabalho é bem curto e objetivo, mas talvez precisasse de algo a mais para evidenciar do que se trata o trabalho. De qualquer forma não invalida a pesquisa. A metodologia está bem descrita e concisa. Acredito que se poderia descrever mais como vai se dar a interação da comunidade com a plataforma. É apenas uma plataforma para consulta e navegação? O pessoal apenas consulta as escolas e os eventos ou a ideia é que haja algum outro tipo de interação com ela? Sei que o trabalho está em estágio inicial, mas é bem promissor.', 8.75, true);
INSERT INTO public.revisao VALUES (824, 370, 1726, 'O título está bem objetivo de acordo com o trabalho e o texto bem escrito. O que acho que poderia ser mais explicado são os resultados esperados. Existe alguma projeção em números? Por exemplo &#34;se espera um aumento de x nas adoções com o uso da ferramenta&#34; (levando em consideração algum outra pesquisa similar) ou não é o caso?', 8.5, true);
INSERT INTO public.revisao VALUES (805, 374, 92, 'Um potencial problema da pesquisa se refere ao grupo de controle. O fato deste grupo contar com pessoas que tiveram seu crédito negado indica que haviam fatores para essa negativa, que potencialmente influenciam no seu insucesso. Ou seja, o insucesso pode ser consequência não apenas da falta de crédito, mas de outros problemas não levantados. No mais, um ótimo trabalho.', 8, true);
INSERT INTO public.revisao VALUES (898, 400, 1631, 'No título, menciona-se &#34;prejuízos causados&#34; no ensino público, entretanto, não há considerações sobre quais seriam estes prejuízos. Não seria mais pertinente &#34;dificuldades causadas&#34;, visto que isso é mais enfatizado no texto? Afinal, &#34;prejuízos&#34; ou &#34;dificuldades&#34;? Dessa forma, o texto não contempla o seu enunciado no título. As palavras-chave &#34;Ensino&#34; e &#34;prejuízo&#34; são insuficientes, pois deveriam especificar mais sobre o tema proposto, tais como: ensino na pandemia; prejuízos no ensino público. O texto não apresenta objetivos corretamente definidos e coerentes. Não apresenta metodologia, que contemple os objetivos. O título, os objetivos e a metodologia apresentam-se insuficientes.', 3.25, true);
INSERT INTO public.revisao VALUES (930, 418, 86, 'Sugiro que, em outros resumo, seja dado mais ênfase à pesquisa em si e menos ao histórico da pesquisa anterior que deu origem à trazida nessa pesquisa. Assim, o espaço do resumo poderá ser melhor aproveitado para explicar com mais detalhes o projeto.', 7.25, true);
INSERT INTO public.revisao VALUES (935, 394, 86, 'Parabéns pela ideia bastante interessante. Pensar em sustentabilidade é sempre relevante. Faltaram alguns detalhes importantes: como se conseguem esses retalhos? Qual o custo de produção e venda da Green Bag? De onde vem os tecidos orgânicos de seu interior? Sugiro, em outros resumos, expandir essa explicação sobre a metodologia e o produto final.', 7.5, true);
INSERT INTO public.revisao VALUES (942, 413, 86, 'Projeto muito interessante e necessário! Parabéns! Entendo que a pesquisa ainda está sendo realizada, mas quantos respondentes compõem a porcentagem apresentada? Com base nos resultados dessa pesquisa, como discutir melhores condições de trabalo? O que os profissionais acreditam que pode ser feito para melhorar a perspectiva futura e para minimizar os impactos do que viveram?', 9.5, true);
INSERT INTO public.revisao VALUES (855, 405, 508, 'O trabalho está bem organizado e escrito com clareza. Parabéns aos integrantes!', 10, true);
INSERT INTO public.revisao VALUES (844, 388, 1601, 'Embora se observem pequenas falhas linguísticas, o projeto é de suma importância, principalmente no final do ensino fundamental e inicio do ensino médio, de modo que logo, este tema será um assunto de interesse recorrententre os adolescentes. Sugiro que o projeto seja continuado, e que maiores levantamentos estatísticos sejam realizados, inclusive com a publicação de cartazes, informativos e encontros para discussão deste tema na escola. Palestras que os próprios alunos podem ministrar para outros colegas mostrando estes dados são de valor inestimável para a educação dos alunos.', 9.25, true);
INSERT INTO public.revisao VALUES (911, 417, 1631, 'O título do projeto está insuficiente, pois apresenta a proposta de se “conhecer as trajetórias de egressos”, entretanto, no texto, isso não é evidenciado. Afinal, quais foram as trajetórias desses egressos? Enfim, o texto não contempla a proposta do título. As palavras-chave “egressos”, “trajetórias” e “acompanhamento” são insuficientes, pois deveriam especificar mais sobre o tema proposto, tais como: “egressos do Ensino Médio Integrado”; “trajetórias de egressos do Ensino Médio Integrado”; e “acompanhamento de egressos”. Os resultados/conclusões são insuficientes, pois não apresentam quais foram as compreensões diante das trajetórias dos egressos, percursos e experiências. Há de se destacar também que foi proposto “compreender as trajetórias dos ex-alunos em relação ao mundo do trabalho, contribuindo para o aperfeiçoamento dos processos de ensino-aprendizagem”, todavia, não foram explicadas essas percepções. Portanto, as trajetórias ficaram “vagas” e não foram elucidadas de forma mais explícita ao leitor. Sendo assim, o título e os resultados, ao relacioná-los com os objetivos e a metodologia, estão insuficientes.', 3.75, true);
INSERT INTO public.revisao VALUES (848, 408, 1601, 'O trabalho contempla um tema interessantíssimo, aliado a um momento de procura da população por fontes mais naturais de tratamento. Reitero ainda a importancia de ter sido citado o acompanhamento médico, aliado ao uso destes produtos com propriedades medicinais. Uma sugestão é o cuidado na escrita do trabalho. Uma das palavras-chave tem um erro de digitação, o que pode prejudicar a procura pelo trabalho.', 9, true);
INSERT INTO public.revisao VALUES (861, 416, 1601, 'Estes trabalhos de atividade biológica de produtos naturais são de suma importancia para a saúde pública, pois partem do principio do uso de produtos naturais, neste caso, produtos que seriam descartados, e buscam uma aplicabilidade importantissima como a busca por compostos antioxidantes e antimicrobianos. Sugiro uma pesquisa na literatura para fazer um levantamento de quais classes de compostos do metabolismo secundário são passíveis de serem encontrados em cada tipo de extração. Estas informações enriquecerão os trabalhos futuros deste projeto. Parabéns aos autores.', 10, true);
INSERT INTO public.revisao VALUES (864, 432, 1601, 'A busca por novos materiais biodegradáveis talvez seja a saída para que o ambiente deixe de ser contaminado com tanto plástico. Existe uma estimativa que até 2050, existirá mais massa de plástico nos oceanos do que de peixes, o que é uma estimativa preocupante. Alguns autores estimam que esse nivel seja atingido já em 2030. A iniciativa pela busca de novos materiais biodegradáveis deve ser muito estimulada. Desejo que os testes apresentem dados promissores. E mesmo que este material seja menos resistente à água, poderá ser utilizado para a embalagem de materiais secos, o que também é de suma importância para a economia e o meio ambiente. Parabens pelo projeto.', 10, true);
INSERT INTO public.revisao VALUES (876, 393, 1601, 'A pesquisa sobre o impacto ambiental e social da poluição na China é de grande valia, não só para os habitantes da região, mas para o mundo todo, de modo que a China, hoje, é um dos maiores produtores e comerciantes de insumos que subsidiam a economia mundial. Entendo somente que haja a necessidade de determinar com clareza quais são os objetivos deste projeto, embora se saiba que muitas vias de pesquisa sejam importantes nesta área.', 9, true);
INSERT INTO public.revisao VALUES (887, 392, 1601, 'Solicito aos autores observar se não houve alguma troca no título do trabalho com outro trabalho (&#34;CONSEQUêNCIA DA POLUIçãO NOS GENES E SEU COMBATE EM INDúSTRIAS CHINESAS&#34;) enviado para a IFCITEC. Este título parece pertencer ao outro resumo, e o outro título cabe mais neste resumo. Caso nao tenha ocorrido nenhuma troca, assim como o outro resumo, desconsiderem . Este trabalho tem grande importancia diante dos níveis de poluição observados na atmosfera, e estes dados podem corroborar com a importancia da busca por novas fontes de energia e redução da poluição eitida pelas industrias e grandes centros.', 9, true);
INSERT INTO public.revisao VALUES (921, 431, 1631, 'Como no texto também foi abordada a questão do desenvolvimento físico da criança, no título, seria mais pertinente também incluir essa perspectiva. As palavras-chave “saúde mental”, “Crianças” e “isolamento social” são regulares, pois deveriam especificar mais sobre o tema proposto, tais como: “saúde mental de crianças”; “isolamento social na pandemia”. Já as palavras “Covid-19” e “Pandemia” podem ser sintetizadas por “pandemia do Novo Coronavírus – COVID 19”. Não apresenta justificativa de forma explícita e definida, apesar de, nas conclusões, constar a sua relevância. No geral, é uma boa proposta!', 6.5, true);
INSERT INTO public.revisao VALUES (806, 382, 1656, 'Parabéns pelo trabalho! Com relação ao número de novos casos de pacientes com lesões medulares, seria interessante trazer o dado referente ao Brasil, caso exista.', 10, true);
INSERT INTO public.revisao VALUES (947, 426, 87, 'Sem comentários.', 9.75, true);
INSERT INTO public.revisao VALUES (946, 433, 86, 'Trabalho muito relevante e, pelo resumo, bem realizado. Grande volume de dados analisados. Parabéns.', 9.5, true);
INSERT INTO public.revisao VALUES (948, 396, 87, 'Trabalho bem relevante, porém com alguns erros de português na escrita do resumo.', 8.75, true);
INSERT INTO public.revisao VALUES (892, 438, 86, 'Excelente pesquisa, no entanto, não fica claro no resumo se o dispositivo já foi desenvolvido e testado.', 9, true);
INSERT INTO public.revisao VALUES (944, 419, 86, 'A pesquisa é muito interessante, mas a metodologia poderia ser melhor explanada, pois não fica clara como se deu a pesquisa bibliográfica. Interessante apresentar o período pesquisado e os períodicos acessados.', 8.75, true);
INSERT INTO public.revisao VALUES (888, 397, 86, 'A pesquisa parece interessante e relevante, mas o resumo está confuso. Itens como a justificativa precisam ser revistos, bem como, a amplitude dos objetivos e a descrição da metodologia.', 5, true);
INSERT INTO public.revisao VALUES (949, 375, 86, 'O resumo tem erros de grafia e pontuação. No entanto, o maior problema é que o resumo não aborda o que o trabalho objetivava, qual era a metodologia. O que foi pesquisado? Como foi pesquisado? Qual era o objetivo do estudo? Pq esse estudo foi feito? Estes itens são imprescindíveis para um projeto de pesquisa.', 2.75, true);
INSERT INTO public.revisao VALUES (952, 381, 87, 'Sem Comentários.', 10, true);
INSERT INTO public.revisao VALUES (950, 390, 87, 'Sem comentários.', 8, true);
INSERT INTO public.revisao VALUES (955, 413, 87, 'Sem comentários.', 10, true);
INSERT INTO public.revisao VALUES (956, 439, 86, 'O projeto traz assunto bem relevante e parece que foi realziada uma pesquisa interessante. No entanto, não ficam claro como a pesquisa foi feita, quantos trabalhadores foram entrevistados, etc. Também é um pouco confuso o objetivo a ser alcançado. No título se desenha uma relação com o emprego informal, mas isso não aparece no resumo.', 6.75, true);
INSERT INTO public.revisao VALUES (953, 369, 86, 'Pesquisa muito interessante. O início do resumo parece um pouco confuso, mas na sequência se entende a proposta. A metodologia poderia ser melhor explicada: de onde saem esses resíduos utilizados na pesquisa, por exemplo.', 9.5, true);
INSERT INTO public.revisao VALUES (951, 393, 86, 'A pesquisa é bastante interessante, mas sugiro a busca em outros repositórios que contemplem mais pesquisas sobre o tema (Scielo, Scopus, etc.).', 9, true);
INSERT INTO public.revisao VALUES (954, 403, 86, 'Excelente pesquisa. Resumo muito bem elaborado. Parabéns!', 10, true);
INSERT INTO public.revisao VALUES (957, 398, 87, 'Sem comentários.', 9.5, true);
INSERT INTO public.revisao VALUES (958, 407, 87, 'Sem comentários.', 8.25, true);
INSERT INTO public.revisao VALUES (959, 443, 86, 'O projeto tem mérito e parece muito interessante, no entanto, o texto do resumo aborda pouco sobre as características da proposta robótica a ser implementada. Para além do questionário realizado com pecuaristas, quais os demais procedimentos realizados na metodologia? Quais as tecnologias mobilizadas para fazer o protótipo? Sugiro abordar de forma melhor estes aspectos na versão a ser apresentada na feira.', 7.25, true);
INSERT INTO public.revisao VALUES (960, 443, 87, 'O projeto se apresenta como uma excelente pesquisa, porém com pouco resultado prático apresentado.', 7.5, true);
