INSERT INTO public.tarefa VALUES (1, 'Coordenador de Sala', 'Ficará responsável pela organização, limpeza e controle da sala a qual ficar designado.', '2018-08-07 18:39:55', '2018-08-07 18:39:55', 4);
INSERT INTO public.tarefa VALUES (2, 'Auxiliar de Sala', 'Ficará responsável por auxiliar o coordenador de sala tanto internamente em uma sala bem como terá que controlar os corredores.', '2018-08-07 22:03:53', '2018-08-07 22:03:53', 4);
INSERT INTO public.tarefa VALUES (4, 'Auxiliar de Avaliações', 'Ficará responsável por auxiliar aos avaliadores presenciais bem com a comissão organizadora da feira.', '2018-08-07 22:05:35', '2018-08-07 22:05:35', 2);
INSERT INTO public.tarefa VALUES (5, 'Recepção de Prédio', 'Ficará responsável em auxiliar os participantes da feira a localizarem seus projetos dentro do prédio aonde se encontram alocados os projetos.', '2018-08-07 22:07:08', '2018-08-07 22:07:08', 1);
INSERT INTO public.tarefa VALUES (7, 'Auxiliar de Credenciamento', 'Ficará responsável por recepcionar aos participantes da feira controlando seu credenciamento, distribuição de crachás e lista de presença entre outros.', '2018-08-07 22:10:09', '2018-08-07 22:10:09', 3);
INSERT INTO public.tarefa VALUES (8, 'Controlador de Presença IFRS', 'Ficará responsável por controlar e organizar a lista de presença dos alunos do IFRS - Campus Canoas.', '2018-08-07 22:11:08', '2018-08-07 22:11:08', 2);
INSERT INTO public.tarefa VALUES (9, 'Fotógrafo', 'Ficará responsável por registrar todos os acontecimentos durante a feira. Bem como a montagem do vídeo final de premiação e organização das fotos que irão compor a galeria da edição.', '2018-08-07 22:15:32', '2018-08-07 22:17:18', 3);
INSERT INTO public.tarefa VALUES (10, 'Sonorização', 'Ficará responsável pelo organização da sonorização durante a feira e principalmente durante a premiação.', '2018-08-07 22:18:48', '2018-08-07 22:18:48', 2);
INSERT INTO public.tarefa VALUES (11, 'Recepção as Escolas Visitantes', 'Ficará responsável pela recepção e coordenação do tour das escolas visitantes pelo IFRS - Campus Canoas bem como controlar o encaminhamento dos mesmos a visitação dos projetos.', '2018-08-07 22:21:29', '2018-08-07 22:21:29', 3);
INSERT INTO public.tarefa VALUES (12, 'Auxiliar de Lanches', 'Ficará responsável por auxiliar o pessoal do IFRS - Campus Canoas na distribuição dos lanches aos participantes dos projetos.', '2018-08-07 22:23:26', '2018-08-07 22:23:26', 1);
INSERT INTO public.tarefa VALUES (3, 'Coordenador do Prédio', 'Ficará responsável por coordenar e orientar os coordenadores de sala bem como seus auxiliares.', '2018-08-07 22:04:44', '2018-09-12 19:20:56', 1);
INSERT INTO public.tarefa VALUES (6, 'Coordenação de Credenciamento', 'Ficará responsável por coordenar e a auxiliar na recepção aos participantes da feira controlando seu credenciamento, distribuição de crachás e lista de presença entre outros.', '2018-08-07 22:09:24', '2018-09-12 19:21:07', 1);
INSERT INTO public.tarefa VALUES (13, 'Auxiliar de Projetos Externos', 'Auxiliar os participantes da feira que irão expor projetos externos a feira.', '2018-09-15 11:21:46', '2018-09-15 11:21:46', 1);
INSERT INTO public.tarefa VALUES (14, 'LEMA', 'Projeto LEMA', '2019-09-19 09:03:57', '2019-09-19 09:03:57', NULL);
